var book = {
	"name": "အၪ့အူၭ",
	"numChapters": 150,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ၦလၧအလလ့ၩဘၪဝ့ၫ လၧၦလတီၩလလီၩ့ဘၪ အဆၧကိၪ့ထၪ့ဖၭလၩ့အဖၧၩ့တၭ, လဆၧၫ့ထုၪ့ဘၪဝ့ၫ လၧၦမၩဆၧဒဲၩဘၭအဖၧၩ့ၥၭ, ဒဲလဆၧၫ့နၩ့ဘၪဝ့ၫ လၧၦဒုၪဒွ့ၪဆၧအလးဆၧၫ့နၩ့ဖၧၩ့နီၪ, ဘၪဆိၪဂ့ၩဝ့ၫ",
			"2": "<sup>2</sup> လီၫ.- အဝ့ၫဒၪမုၬလၩဝ့ၫလၧ ယဟိဝၩအဆၧၥီၪ့ဆၧၥၫ့ အဖၧၩ့တၭ, လၧဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့နီၪဆီၫ့မီၪ့ဝ့ၫလၧ",
			"3": "<sup>3</sup> မုဆၫဆၫမုနၩနၩဆ့လီၫ.- ဆၧမိမၩအၥၭဘဲၫၥံၪ့ၥုၪ့ လၩ့အၥၭလၧထံၫဖိၪချိၬနဲၩ့ထံၭအၥိၭနီၪ, လၧအဆၧၫ့ အထီဘၪနီၪၥၪထၪ့ဝ့ၫဒၪတၭ, အလၪလလၩ့ယံၭဘၪ လီၫ.တၭကယဲအမၩဆၧလမံၩ့လါလါနီၪ မိကဲၪထၪ့ ကဲၪထီၫဝ့ၫဒၪလီၫ.",
			"4": "<sup>4</sup> အ့ၪမွဲၦလတီၩလလီၩ့ဘၪနီၪ မွဲဘဲၫနီၪၥိၭအ့ၬ,",
			"5": "<sup>5</sup> မၩအၥၭဘဲၫဖ့ၫလၧလံၩအူၪခွံၬဝ့ၫအၥိၭလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ လၧဆၧစ့ၩရၫ့အဖၧၩ့နီၪ,ၦလတီၩလလီၩ့ ဘၪလဆၧၫ့ထုၪ့ဘၪဝ့ၫတၭ, ၦဆၧဒဲၩဘၭဖိၪနီၪ ဎဆၧၫ့ ထုၪ့ၭလၧၦအတီၩအလီၩ့ အဆၧအီၪကီၪ့အကျၩနီၪဆ့",
			"6": "<sup>6</sup> အ့ၬ.- အဂဲးဘဲၫယီၩ ယဟိဝၩၥ့ၪယၫၦအတီၩအလီၩ့ အဖၧၩ့ၥၭလီၫ. အ့ၪမွဲၦလတီၩလလီၩ့ဘၪ အဖၧၩ့ၥၭ နီၪမိထီၩ့ဝ့ၫဒၪလၧဆၧဂၭဂီၩ့ဂၭစၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> တၭမွဲဘၪနီၫလၫလၧ ၦဆၨၩလဖၪတုၩ့ထၪ့တုၩ့လၩ့",
			"2": "<sup>2</sup> ဒဲၦခမျၧးၥံၪကိၪ့ထၪ့ဖၭလၩ့ ဆၧပျီၩပျီၩနီၪလဲၪ.- ဂၪ့ခိၪ အစဎွၩၥံၪအီၪက့ၪဆၧၫ့ထုၪ့အၥၭ, ဒဲၦဒိၪၦၡါၥံၪကိၪ့",
			"3": "<sup>3</sup> လိၬအၥၭထၫ့ဒုၪဒၩယဟိဝၩ, ဒဲအဎရံၬနီၪလီၫ.- မွဲပ ဖ့ၬထ့ၬခွံၬၡီၩ့အဝ့ၫၥံၪအဆၧစၧၩ့ထၬတၭ, မွဲပခွံၬၡိၭ ခွံၬၡီၩ့အဖျံၩၥံၪနီၪဆံၭ. ဎစံၭဝ့ၫဒၪ,ၭ",
			"4": "<sup>4</sup> ၦလၧအဆၧၫ့နၩ့လၧ မူၭခိၪလဂၩနီၪမိနံဘၪဝ့ၫလီၫ.",
			"5": "<sup>5</sup> ကဆါမိမၩကြၩ့ထမးအဝ့ၫၥံၪလီၫ.- ထီးနီၪလဖၧၫ့အ ဝ့ၫဒၪမိချဲၩ့ဆၧလၧအဝ့ၫၥံၪ လၧအၥၭထၪ့တၭ, လၧအ",
			"6": "<sup>6</sup> ၥၭခဲၩထၪ့နီၪ မိမၩၥၭမဲၪၥၭဖျဲၩ့အဝ့ၫၥံၪလီၫ.- မွဲလါ နၫ့ယဝ့ၫဒၪယီၩ ယအီၪက့ၪထၪ့ယူၭယစဎွၩလၧယခိၪ လီၩ့ဆံၫ့ဎံၪဇံအိၫ့အလီၩ့ယူၭ.",
			"7": "<sup>7</sup> ယမိလီၩဘၪဆၧစ့ၩရၫ့ဝဲၩနီၪလီၫ. ယဟိဝၩစံၭ ယၧၩ, နဝ့ၫဒၪယီၩ, နမွဲယဖိၪခွၫလီၫ. ယထၪ့ဖိၪယူၭ",
			"8": "<sup>8</sup> နၧၩလၧမုဆၫလနံၩယီၩယူၭ.- အၪ့ကံၩ့ဆၧလၧယၧၩ ဆံၭ,တၭယမိဖ့ၪလၫ့ၦဆၨၩလဖၪ လၧနန့ၥၫဆၧအဂး, ဒဲဂၪ့ခိၪအထုၬလဖၪ လၧနစူၪလးနခၪ့ခိၪ အဂးလီၫ.",
			"9": "<sup>9</sup> တၭနမိဒိၪခါအဝ့ၫၥံၪ လၧနိၪထးထၭတၭ,ဘဲၫဖၧၩ့ဂၪ့ ခိၪအၥိၭနီၪ, နမိဒိၪလၩ့ဘျ့ၭဆံၫ့ခွံၬ အဝ့ၫၥံၪလီၫ.",
			"10": "<sup>10</sup> အခိးမွဲဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ, စဎွၩၥံၪဧ့,အီၪလၧ ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪဆံၭ. ဂၪ့ခိၪအၡၩစ့ၩရၫ့ခွးနၥံၪဝ့ၫ",
			"11": "<sup>11</sup> ဧ့,ဒိၭန့ဆၧၥီၪ့ဆၧၥၫ့ဆံၭ.- မၩယဟိဝၩ အဆၧမၩ လၧနၥံၪအဆၧၥၭမဲၪၥၭဖျဲၩ့တၭ, ၥုၪ့ဎွံၫၥၭယီၫ လၧန",
			"12": "<sup>12</sup> ၥံၪၥုၪ့ဝၭထိၬ ၥၭဝၭထိၬဆံၭ.- အဲၪဂါဖိၪခွၫနီၪဆံၭ, အဝ့ၫမိၥၭထၪ့ဘၪခိၬတၭ, နၥံၪမိဂၭဂီၩ့လၧဖၧၩ့ၥၭအ ဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩအၥၭထၪ့နီၪ မိဆူၭခဲၩထၪ့ဘၪ ၡုၭဆၧလီၫ. ကယဲၦလၧအဒိၭနဲၩ့အၥၭ လၧအဝ့ၫနီၪ ဘၪဆိၪဂ့ၩဝ့ၫထီးအလူၬလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, ၦလၧအမၩခိမၩဝီၩယၧၩအၪထၪ့အၪ မၬကလဲၪ. ၦဂဲထုၪ့ထၫ့ဒုၪထၫ့ဒၩယၧၩ အၪဂၩလီၫ.",
			"2": "<sup>2</sup> ၦအၪဂၩစံၭဆၧလၧယၥၭမၧၫ့အကၠီၩ့, ဆၧထိးထဲၩ့ တၩ့ထဲၩ့လၧအဂးနီၪအီၪလၧယွၩအဖၧၩ့အ့ၬ.(စ့လၫ.)",
			"3": "<sup>3</sup> အ့ၪမွဲနဝ့ၫဒၪယီၩ, ယဟိဝၩဧ့,နမွဲထၩ့ဖံၭလဘံၪ့လၧ အအီၪဝၬဖီၩ့ယၧၩ, နမွဲယလၩယဖၩ့ဒဲဆၧဒုၭမိၬထၪ့",
			"4": "<sup>4</sup> ယခိၪဎွံၪလီၫ.- ယကိၭထၪ့ယဟိဝၩ လၧယလူတၭ, အဝ့ၫခိၭနၪယၧၩ လၧအခိၪလီၩ့ဆံၫ့ဎံၪနီၪလီၫ. (စ့လၫ.)",
			"5": "<sup>5</sup> ယမံၫနၩ့ယူၭဒဲမံၫမၪယူၭတၭ, ယနၪ့ထၪ့ထဲၩ့ယူၭ, အဂဲးဘဲၫယီၩယဟိဝၩ ယိထဲၩ့ခွါထဲၩ့ယၧၩလီၫ.",
			"6": "<sup>6</sup> ၦခမျၧးအလၬၥံၪလၧအအီၪဝၬဖီၩ့ ထၫ့ဒုၪဒၩယၧၩနီၪ, ယမိၥၭမဲၪယဝ့ၫအ့ၬ.",
			"7": "<sup>7</sup> ယဟိဝၩဧ့,ဂဲထုၪ့ဆံၭ, ယယွၩဧ့,ထိးထဲၩ့တၩ့ထဲၩ့ ယၧၩဆံၭ. အဂဲးဘဲၫယီၩနဒိၪယူၭယဒုၪယဒၩအဘိၭ ဖၩထံၭအဎွံၪထီးအလူၬယူၭ, နမၩဖိၬယူၭၦလတီၩလ",
			"8": "<sup>8</sup> လီၩ့ဘၪၥံၪအၥွၫလဖၪယူၭ.- ဆၧထိးထဲၩ့တၩ့ထဲၩ့နီၪ အီၪလၧယဟိဝၩလီၫ. မွဲနဆိၪဂ့ၩဆၧနီၪဘၪနၡၩခမျၧးဆံၭ. (စ့လၫ.)"
		},
		"4": {
			"1": "<sup>1</sup> ယဆၧတီၩဆၧလီၩ့အယွၩဧ့, ထီးယကိၭထၪ့နၧၩ တၭ, ခိၭနၪယလူဆံၭ.ထီးယဘၪဆၧၡၪ့ဆၧနၭတၭ, နမၩဖီၩ့မၩဖျ့ၭယူၭယၧၩယူၭ. ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩ တၭခိၭနၪယဆၧဘၩဆိၪဖၪဆံၭ.",
			"2": "<sup>2</sup> ၦၡၩအဖိၪခွၫၥံၪဧ့, ယလၩယဖၩ့မိအီၪလၧဆၧမ့ၬမဲ အဂးနီၪဆံၭယံၬလဲၪ. နၥံၪမိအဲၪဆၧပျီၩပျီၩတၭ နၥံၪ မိအၪ့ဎၬဆၧအဘျံၭအဘျၪဆံၭယံၬလဲၪ.(စ့လၫ.)",
			"3": "<sup>3</sup> အ့ၪမွဲၥ့ၪယၫ လၧယဟိဝၩအီၪက့ၪလၩ့မဲၩအၡၩ ၥၭဘီၩ့လၧအဂးဒၪဝ့ၫနီၪဆံၭ. ထီးယအ့ၪကိၭထၪ့တၭ,",
			"4": "<sup>4</sup> ယဟိဝၩမိခိၭနၪယလူလီၫ.- ၥၭမဲၪၥၭဖျဲၩ့တၭ, ဂၭဎ့ၭ ဆၧဒဲၩဘၭဆံၭ. ဆီၫ့မီၪ့လၩ့နၥံၪအၥၭဒၪနၥံၪဝ့ၫလၧ နၥံၪအလးမံၫဖၧၩ့တၭ, အီၪလၩ့မါပံၭဆံၭ.(စ့လၫ.)",
			"5": "<sup>5</sup> လုထၪ့ဆၧတီၩဆၧလီၩ့အဆၧလုတၭ, ဒိၭနဲၩ့နၥံၪ အၥၭလၧယဟိဝၩဆံၭ.",
			"6": "<sup>6</sup> ၦအၪဂၩစံၭဝ့ၫ, မွဲပလၫမိဒုၭနဲၪပၧၩလၧဆၧအဂ့ၩ လဂၩလဲၪ. ယဟိဝၩဧ့,ဒုၭဖၩ့ဘၪပၧၩလၧနမ့ၬအဆၧ",
			"7": "<sup>7</sup> ဖၩ့နီၪဆံၭ.- နဒုၭၥၭထိၬယၧၩ ဒိၪနဲၪ့အဆၧၫ့အထီ လၧအဝ့ၫၥံၪအဘုၪၥံၪဂူၫၥံၪဒဲ လၧအစဘံၭထံၫအၪထၪ့",
			"8": "<sup>8</sup> နီၪဒံၭလီၫ.- လၧဆၧမုၬလၩအဖၧၩ့ ယမိမံၫနၩ့ဒဲမံၫမၪ ယဝ့ၫဒၪဆ့တၭ, အဂဲးဘဲၫယီၩယဟိဝၩဧ့, ၦဒုၭအီၪ ဂုးခၧၫ့ယၧၩမွဲန့ၫနၧၩလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ဒိၭနနါလၧယဆၧချဲၩ့လဖၪ, ယဟိဝၩဧ့,နၪၥ့ၪ",
			"2": "<sup>2</sup> ယဆၧဆီၫ့မီၪ့ဆံၭ.- ခိၭနၪယကိၭထၪ့ဆၧအလူဆံၭ, ယစဎွၩဒဲယယွၩဧ့, အဂဲးဘဲၫယီၩ ယမိဘၩဆိၪဖၪ လၧနၧၩလီၫ.",
			"3": "<sup>3</sup> ယဟိဝၩဧ့, လၧဂီၩလခီၫနမိနါဂၧၫ့ယလူတၭ, လၧဂီၩလခီၫ ယမိဒုၭလ့ၩထၪ့ ယဆၧဘၩဆိၪဖၪလၧန",
			"4": "<sup>4</sup> အီၪ,ဒဲယမိအီၪခိၭဆၧလီၫ.- အဂဲးဘဲၫယီၩနလမွဲဘၪ ယွၩလဂၩလၧအဘၪအၥၭလၧ ဆၧလတီၩလလီၩ့ဘၪ",
			"5": "<sup>5</sup> နီၪတၭ, ဆၧအအၧၩ့မိအီၪလၧနၧၩအ့ၬ.- ၦအီၪက့ၪဖိၫ လိၫအၥၭနီၪ လဆၧၫ့ထုၪ့ဘၪ လၧနမ့ၬယၫတၭ,နမ့ၬ",
			"6": "<sup>6</sup> လဲၩကယဲၦမၩအၧၩ့မၩၥၫ့ဆၧကိၭဂၩဒ့ၭလီၫ.- နမိမၩ ဂၭဂီၩ့ၦလၧအချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧနီၪလီၫ. ၦဘၪဆဲၫ့ လၧဆၧၥွံၪ, ဒဲၦအၪ့လီၫဆၧနီၪ ယဟိဝၩၥလိၪဝ့ၫဒၪ",
			"7": "<sup>7</sup> လီၫ.- အ့ၪမွဲယဝ့ၫဒၪယီၩ, လၧနခိးနတၩ အၪဝ့ၫအ ကၠီၩ့တၭ, ယမိဂဲၫနုၬလၧနဂံၪ့ဖၧၩ့, ယမိဘၩထၪ့ဆၧ လၧနဆၧၥၭမဲၪအဖၧၩ့ လၧနနီးဆံၫ့ဎံၪအဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩဧ့, ၥိၫ့ယၧၩလၧနဆၧတီၩဆၧလီၩ့အဖၧၩ့ လၧယဒုၪယဒၩ အကၠီၩ့နီၪဆံၭ. မၩပျၩ့နဖၧၩ့ၥၭလၧ",
			"9": "<sup>9</sup> ယမ့ၬယၫဆံၭ.- အဂဲးဘဲၫယီၩဆၧချဲၩ့တီၩလအီၪဘၪ လၧအဝ့ၫၥံၪအနိၭဖၧၩ့တၭ, အၥၭခံဖၧၩ့နီၪမွဲဆၧအၧၩ့ တၭ,အခိၬဖၧၩ့နီၪမွဲဆၧၥွၪခိၪအဖၧၩ့ အီၪဝဲထၪ့အၥၭ",
			"10": "<sup>10</sup> တၭ,အဝ့ၫၥံၪချဲၩ့မုၬနါဆၧလၧအဖျ့ၩလီၫ.- ယွၩဧ့, အီၪက့ၪဆၧဒဲၩဘၭလၧအဝ့ၫၥံၪအလီၩ့နီၪဆံၭ. အဝ့ၫ ၥံၪမိလၩ့ထံၩဖါဝ့ၫ လၧအဆၧဒုၭကိၪ့ဒၪဝ့ၫနီၪလီၫ.နၫ့ ထၪ့ခွံၬအဝ့ၫၥံၪ လၧအမၪဘၪဆၧအၪမံၩ့အကၠီၩ့နီၪ",
			"11": "<sup>11</sup> ဆံၭ.အဂဲးဘဲၫယီၩအဝ့ၫၥံၪပိၩ့ထၪ့နၧၩလီၫ.- အ့ၪမွဲ ကယဲၦလၧအဒိၭနဲၩ့အၥၭလၧနၧၩနီၪ မိၥုၪ့ဎွံၫၥၭယီၫ လထံၪဎးဘီၩ့ဎး, အဂဲးဘဲၫယီၩနအီၪဝၬဖီၩ့အဝ့ၫၥံၪ တၭ,ၦလၧအအဲၪနမံၩ့နီၪ မိၥုၪ့ဎွံၫၥၭယီၫလၧနဖၧၩ့",
			"12": "<sup>12</sup> လီၫ.- အဂဲးဘဲၫယီၩ နဝ့ၫဒၪနမိဆိၪဂ့ၩ ၦအတီၩအ လီၩ့,ယဟိဝၩဧ့, နမိအီၪဝၬဖီၩ့အဝ့ၫဒၪလၧဆၧအခိး အတၩဘဲၫလၧထၩ့ဖံၭလဘံၪ့အၥိၭနီၪလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, ထီးဖယံၬယၧၩ လၧနၥၭထၪ့အဖၧၩ့",
			"2": "<sup>2</sup> လဂ့ၩ, ဒဲအၪ့ၥီၪ့ယၧၩလၧနၥၭခဲၩထၪ့လဂ့ၩ.- ယၫ့ၥုၪ့ ယၫ့ၥၭယၧၩဆံၭ, ယဟိဝၩဧ့, အဂဲးဘဲၫယီၩယလၩ့ ဘဲၩဖီၩ.ယဟိဝၩဧ့, မၩဘျၪထဲၩ့ယၧၩဆံၭ, အဂဲးဘဲၫ",
			"3": "<sup>3</sup> ယီၩယဎွံၪလဖၪဝၭထိၬဝ့ၫလီၫ.- ယၥၭဝၭထိၬနၭမၬ",
			"4": "<sup>4</sup> လီၫ.တၭနဝ့ၫဒၪယဟိဝၩဧ့, ဆံၭယံၬလဲၪ.- ဂဲၫထဲၩ့ ယဟိဝၩဧ့, မၩဖီၩ့မၩဖျ့ၭယၥၭဆံၭ. ထိးထဲၩ့တၩ့ထဲၩ့",
			"5": "<sup>5</sup> ယၧၩလၧနဆၧယၫ့ၥၭ အကၠီၩ့ဆံၭ.- အဂဲးဘဲၫယီၩ ဆၧနၪ့ထၪ့ထဲၩ့နၧၩ လအီၪဘၪ လၧဆၧၥံၫအဖၧၩ့ နီၪတၭ,လၧဖျႃဖၧၩ့နီၪ မွဲပလၫမိစံၭထၪ့အၪ့အူၭနၧၩ",
			"6": "<sup>6</sup> လဂၩလဲၪ.- ဆၧပွံၭယၥၭလၧယဂၪ့အုၩအကၠီၩ့, ၥၫ့ နၩချီၩ့ယမၩထၪ့ဖီၫယလးမံၫတၭ, လၧယမ့ၬထံၫလ",
			"7": "<sup>7</sup> ဖၪနီၪ,ယဒုၭလၩ့ယွၩယလးမံၫလီၫ.- ယမ့ၬၥၪဂၭဂီၩ့ လၧယဆၧခိဆၧဝီၩအကၠီၩ့တၭ, လၩ့ၡါဝ့ၫလၧယဒုၪ ယဒၩထီးအလူၬအကၠီၩ့လီၫ.",
			"8": "<sup>8</sup> ကယဲၦမၩဆၧအၧၩ့ထီးအလူၬၥံၪဧ့, စဲၪ့ထၪ့ခွံၬလၧ ယအီၪဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩနါဂၧၫ့ယူၭယဂၪ့",
			"9": "<sup>9</sup> ဆၧအၥီၫယူၭ.- ယဟိဝၩနါဂၧၫ့ယူၭယအၪ့ကံၩ့ဆၧ အၥီၫယူၭ, ယဟိဝၩမိထိးဆၧၫ့ ယဆၧဘၩဆိၪဖၪ",
			"10": "<sup>10</sup> လီၫ.- ယဒုၪယဒၩထီးအလူၬ မိမ့ၬမဲဒဲၥၭမဲၪၥၭဖျဲၩ့ ဆၧလီၫ.အမ့ၬမိမဲၡုၭတၭမိထဲၩ့ထဲၩ့ဝ့ၫလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> ယဟိဝၩ,ယယွၩဧ့, ယဒိၭနဲၩ့ယၥၭလၧနၧၩလီၫ. ထိးထဲၩ့တၩ့ထဲၩ့ယၧၩလၧကယဲ ၦမၩအၧၩ့မၩၥၫ့ယၧၩ",
			"2": "<sup>2</sup> အစူၪဖၧၩ့ ဒဲမၩဖီၩ့ဖျ့ၭယၧၩဆံၭ.- မွဲအမိၡၫ့ဘၪ ခိၬယၥၭမၧၫ့ဘဲၫဆၬလၥၧၫ့ အၥိၭနီၪ, မိအဲၪ့ၡၫ့ထ့ၬ ဘၪခိၬတၭ, ဆၧမၩဖီၩ့မၩဖျ့ၭအီၪနးဂၩအ့ၬ.",
			"3": "<sup>3</sup> ယဟိဝၩယယွၩဧ့, ယအ့ၪမၩယူၭဆၧယီၩ ဆၧ",
			"4": "<sup>4</sup> အၧၩ့အ့ၪအီၪလၧယစူၪဖၧၩ့တၭ,- ၦလၧအဘၪလိၬ အိၭလိၬလၧယၧၩနီၪ, ယအ့ၪမၩဆၧၫ့ထဲၩ့ လၧဆၧ အၧၩ့တၭ, (မွဲယူၭအမၩဖီၩ့မၩဖျ့ၭၦလၧအမွဲယဒုၪ",
			"5": "<sup>5</sup> ယဒၩပျီၩပျီၩ,)- ထီးနီၪလဖၧၫ့မွဲဆၧအဒုၪအဒၩလီၩ့ ဆီးအၥၭမၧၫ့တၭ, ချႃၬန့ဝ့ၫ, ဒဲယဲးထဲးအၥၭမၧၫ့လၧ ဂၪ့ခိၪဒဲဒုၭအီၪယလၩယဖၩ့ လၧဂၪ့ခိၪမုၬအကျၩနီၪ ဆံၭ.(စ့လၫ.)",
			"6": "<sup>6</sup> ဂဲထုၪ့ထၪ့လၧနၥၭထၪ့ဆံၭ, ယဟိဝၩဧ့, အီၪက့ၪ ဆၧၫ့ထုၪ့နၥၭ လၧယဒုၪယဒၩလဖၪ အၥၭထၪ့ဆၧဖၭ ဒိၪအကၠီၩ့တၭ, နၪ့ထၪ့လၧယဂးဆံၭ, နမၪလူၬယူၭ",
			"7": "<sup>7</sup> ဆၧစ့ၩရၫ့ခွးယူၭ.- တၭၦခမျၧးအဆၧအီၪကီၪ့အီၪဝၬ ဖီၩ့နၧၩတၭ, လၧအဝ့ၫၥံၪအကၠီၩ့ထဲၩ့ထဲၩ့နဝ့ၫလၧဆၧ",
			"8": "<sup>8</sup> အလးထၪ့ထီၫ လၧအဝ့ၫၥံၪအဖၫ့ခိၪနီၪဆံၭ.- ယဟိ ဝၩမိစ့ၩရၫ့ၦဆၨၩလဖၪလီၫ. စ့ၩရၫ့ယၧၩ, ယဟိဝၩ ဧ့,ဘဲၫယဆၧတီၩဆၧလီၩ့အၥိၭတၭ, ဘဲၫဆၧလၧၫ့",
			"9": "<sup>9</sup> ဆၧဎွ့ၩလၧအအီၪလၧယဖၧၩ့အၥိၭနီၪဆံၭ.- မွဲၦလ တီၩလလီၩ့ဘၪ အဆၧအၧၩ့နီၪလူၬခွံၬလါဆံၭ, အ့ၪမွဲ ၦတီၩၦလီၩ့နီၪ ဒုၭအီၪဂုးအီၪခၧၫ့ဆံၭ. တၭယွၩအ တီၩအလီၩ့လဂၩဧ့, နမွဲၦလၧအမၩယိခွါ ၦအၥုၪ့ အၥၭလဖၪလီၫ.",
			"10": "<sup>10</sup> ယထၩ့ဖံၭလဘံၪ့အီၪလၧယွၩ လၧအထိးထဲၩ့တၩ့",
			"11": "<sup>11</sup> ထဲၩ့ၦလၧအၥၭလီၩ့လီၫ.- ယွၩမွဲၦစ့ၩရၫ့ဆၧအတီၩ အလီၩ့လဂၩတၭ, ယွၩၥၭထၪ့ၦလတီၩလလီၩ့ဘၪ",
			"12": "<sup>12</sup> ကိၭမုနံၩမုနၩဒ့ၭလီၫ.- အ့ၪလကၠၪလီၩ့ဘၪအၥၭတၭ, ဆၧမိကျဲၩ့အနၭလဘံၪ့တၭ, ဆၧဖဲၪ့ထၪ့ယူၭအချံၪ,ဒဲ",
			"13": "<sup>13</sup> ပယူၪထၪ့ယူၭလီၫ.- တၭတဲၩ့ဝဲၩယူၭဆၧၥံၫအစူၪဝဲၩ လၧအဂး, ဒဲအဖျါမ့ၪလၧအမိခၭဝ့ၫအဂးလီၫ.",
			"14": "<sup>14</sup> ယိခွါ, အဝ့ၫဒၪအဂူၭမိဆၫလၧဆၧအၧၩ့,ဒဲဒၧၩ့ထၪ့ လၧဆၧၡၪ့ဆၧနၭတၭ, အီၪဖျဲၪန့ဆၧအဘျံၭအဘျၪ",
			"15": "<sup>15</sup> လီၫ.- ခုၪ့လၩ့ယူၭဆၧဖၧၩ့ယူၭတၭ, မၩဘံၭဝ့ၫ, မွဲလါ နၫ့တၭအနၫ့ဆါလၩ့ထ့ၬယူၭ လၧဆၧဖၧၩ့လၧအမၩဝ့ၫ",
			"16": "<sup>16</sup> နီၪလီၫ.- တၭအဆၧၡၪ့ဆၧနၭမိဘၪ အခိၪဎွံၪဒၪဝ့ၫ,ဒဲ အဆၧအၧၩ့မိလၩ့ဘၪ လၧအခိၪဒၩ့ခိၪဒၪဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ယမိစံၭထၪ့အၪ့အူၭယဟိဝၩ ဘဲၫအဆၧတီၩဆၧ လီၩ့အၥိၭနီၪတၭ, ယမိၥံၫကျံၩအၪ့အူၭထၪ့ဆၧထၪ့ ထီၫထုၬယဟိဝၩအမံၩ့နီၪလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ယဟိဝၩ,ပကဆါဧ့, နမံၩ့လၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫ, မွဲအဂ့ၩဆံၭအၪလဲၪ. နအီၪက့ၪနလၩနဖၩ့လၧမူၭခိၪ",
			"2": "<sup>2</sup> အလီၩ့လီၫ.- နအီၪက့ၪဆၧစီၩ့ဆၧမၩ့လၧဖိၪၥၪဆံၭ လဖၪ,ဒဲဖိၪၥၪအၪ့နုလဖၪအနိၭ လၧနဒုၪနဒၩၥံၪအ ကၠီၩ့ဘဲၫၥိၭနမိဒုၭအီၪလၩ့မါပံၭ ဆၧအဒုၪအဒၩ, ဒဲၦ မၩဆၧၩ့ဆၧအၧၩ့လဖၪလီၫ.",
			"3": "<sup>3</sup> ထီးယယိထၪ့လၧမူၭခိၪ, လၧနစူၪနိၩ့ၥံၪအဆၧမၩ",
			"4": "<sup>4</sup> နီၪ,လၩဒဲၡၪလၧနအီၪက့ၪလၩ့ဝ့ၫလဖၪနီၪတၭ,- ၦ ၡၩလၧနမိနၪ့ထၪ့ထဲၩ့ဝ့ၫမွဲဂ့ၩ, ဒဲၦၡၩအဖိၪခွၫလၧနမိ",
			"5": "<sup>5</sup> အီၪၡီၩ့ဝ့ၫမွဲဂ့ၩ, မွဲဆၧနီၪလဲၪ.- နအီၪက့ၪလၩ့ဘူၭလၧ အလၩ့ဂၬအၥီၫ့ၥံၪတၭ, ဒုၭချႃၬဝ့ၫလၧၥရဖူၩအကယး",
			"6": "<sup>6</sup> ကဖး,ဒဲဆၧလၩဖၩ့လီၫ.- နဒုၭပၧၩ့ဘၪဝ့ၫဆၧလၧန မၩလၧနစူၪ, နအီၪက့ၪလၩ့ဆၧထီးအလူၬ လၧအခၪ့",
			"7": "<sup>7</sup> အဖၫ့လၬ,- ၥိၪၥံၪ, ဘ့ၪၥံၪ, ဒဲချီဖၫၥံၪ ထီးအလူၬ, ဒဲ",
			"8": "<sup>8</sup> ဆၧဖိၪဆၧဎါလၧမံၩ့လၬကျၩလဖၪဆ့,- ဒဲထိၪၥံၪလံၪ ၥံၪလၧမူၭဖိၭဖၫ့, ဒဲဒ့ၪၥံၪယၪၥံၪ လၧမၫဆမံၭအဖၧၩ့, ဆၧလၧအလ့ၩလၧမၫဆမံၭ အဖၧၩ့ၥၭလဖၪနီၪလီၫ.",
			"9": "<sup>9</sup> ယဟိဝၩ, ပကဆါဧ့, နမံၩ့လၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ ယၫ,မွဲအဂ့ၩဆံၭအၪလဲၪး"
		},
		"9": {
			"1": "<sup>1</sup> ယမိစံၭထၪ့အၪ့အူၭ ယဟိဝၩ လၧယၥၭထၧၫ့ဖျိၪ့ ယၫ ယမိဒုၭနဲၪ နဆၧမၩလၩ့လၭ ထီးအလူၬလီၫ.",
			"2": "<sup>2</sup> ယမိၥုၪ့ထိၬၥၭထိၬ, ဒဲၥုၪ့ဎွံၫၥၭယီၫလၧနဖၧၩ့, ယမိအၪ့ အူၭထၪ့နမံၩ့, ဆၧထၪ့ထီၫထုၬဧ့.",
			"3": "<sup>3</sup> ထီးယဒုၪယဒၩအ့ၪထဲၩ့ထဲၩ့နီၪ, မိလၩ့ထံၩဖါဝ့ၫဒဲ",
			"4": "<sup>4</sup> ဂၭဂီၩ့လၧနမ့ၬယၫလီၫ.- အဂဲးဘဲၫယီၩနမၩယူၭယ ဆၧစ့ၩရၫ့, ဒဲယခွးယူၭ, နဆၧၫ့နၩ့ယူၭ လၧနလးဆီၩ့",
			"5": "<sup>5</sup> ဆီ,စ့ၩရၫ့ခွးနီၪတီၩယူၭ.- နအၪ့ၥီၪ့ယူၭၦဆၨၩၥံၪ ယူၭ,နမၩဂၭဂီၩ့ၦလတီၩလလီၩ့ဘၪယူၭ. နထူၭခွံၬ",
			"6": "<sup>6</sup> ယူၭအမံၩ့ အဆိၩဆိၩအကၠၪကၠၪယူၭ.- ဆၧအဒုၪအ ဒၩနီၪဆၧမၩဂၭဂီၩ့ဝ့ၫထုၬယူၭ လၩ့ဆိၩလၩ့ကၠၪယူၭ တၭ,နမၩဂၭဂီၩ့ယူၭဒိၩ့လဖၪယူၭတၭ, ဆၧနၪ့ထၪ့ ထဲၩ့အဝ့ၫၥံၪဂၭဂီၩ့ယူၭလၧအၥိၭယူၭ.",
			"7": "<sup>7</sup> အ့ၪမွဲယဟိဝၩနီၪအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ. အ ဝ့ၫဒၪ တဲၩ့ဝဲၩယူၭ အလးဆီၩ့ဆီ လၧစ့ၩရၫ့ဆၧအဂး",
			"8": "<sup>8</sup> ယူၭ.- တၭမိစ့ၩရၫ့ၦဂၪ့ခိၪဖိၪလၧဆၧတီၩတၭ, မိစ့ၩ ရၫ့ၦခမျၧးအခွးလၧဆၧလီၩ့လီၫ.",
			"9": "<sup>9</sup> ယဟိဝၩမွဲဆၧဖလ့ၬအလး လၧၦဘၪဆၧမၩနၧၩ့ မၩစၪဝ့ၫအဂး, ဆၧဖလ့ၬအလး လၧဆၧမၩခိမၩဝီၩ",
			"10": "<sup>10</sup> အဆၧၫ့အထီအဖၧၩ့နီၪလီၫ.- တၭၦလၧအၥ့ၪယၫန မံၩ့လဖၪနီၪ မိဒိၭနဲၩ့အၥၭ လၧနဖၧၩ့လီၫ. အဂဲးဘဲၫ ယီၩနလစဲၪ့ဒၪဘၪၦလဖၪ လၧအအၪ့ဎၬနၧၩ, ယဟိ ဝၩဧ့.",
			"11": "<sup>11</sup> ၥံၫကျံၩအၪ့အူၭထၪ့ယဟိဝၩ လၧအအီၪဝ့ၫလၧဇံ အိၫ့အလီၩ့တၭ, ဒုၭနဲၪအဆၧမၩ လၧၦခမျၧးအကျၩ",
			"12": "<sup>12</sup> နီၪဆံၭ.- အဂဲးဘဲၫယီၩ ထီးၦလၧအအၪ့ဎၬန့ဆၧၥွံၪ, နၪ့ထၪ့ထဲၩ့အဝ့ၫၥံၪတၭ, ၦလၧအဘၪထိးဆၧၡၪ့ဆၧ နၭအဆၧကိၭၡၭထၪ့နီၪၥၭနၪ့ဝ့ၫအ့ၬ.",
			"13": "<sup>13</sup> ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩ, ယဟိဝၩဧ့, ၦလၧအဒုၭဂဲ ထုၪ့ထဲၩ့ယၧၩလၧဆၧၥံၫအတရၫ့ဖၧၩ့လဂၩဧ့, ယိဆီၫ့ မီၪ့ခွါယဆၧနၭ ဆၧၡၪ့ လၧယဒုၪ ယဒၩ အကၠီၩ့နီၪ",
			"14": "<sup>14</sup> ဆံၭ.- ဘဲၫၥိၭယမိလီၩလၩ့လၬလၩ့ ကယဲဆၧစံၭထၪ့ အၪ့အူၭလၧဇံအိၫ့အဖိၪမုၪ အတရၫ့ဖၧၩ့လီၫ. ယမိၥုၪ့ ဎွံၫၥၭယီၫ လၧနဆၧထိးထဲၩ့တၩ့ထဲၩ့ အဖၧၩ့လီၫ.",
			"15": "<sup>15</sup> ၦဆၨၩၥံၪလၩ့ဘၧၩ့ယူၭလၧဆၧဖၧၩ့ လၧအမၩဝဲၩ ဝ့ၫယူၭ. ဖျံၩခွၩ့လၧအအီၪက့ၪၥူၪဝ့ၫနီၪဘၪယူၭအခၪ့",
			"16": "<sup>16</sup> ဒၪဝ့ၫယူၭ.- ၦၥ့ၪယၫယဟိဝၩ လၧဆၧစ့ၩရၫ့လၧ အ မၩဝ့ၫလီၫ. ၦလတီၩလလီၩ့ဘၪနီၪဘၪယူၭ လၧဖျံၩ ခွၩ့အဖၧၩ့ လၧအမၩဝ့ၫလၧအစူၪဒၪဝ့ၫယူၭ.ဎစ့လၫ.ၭ",
			"17": "<sup>17</sup> ၦလတီၩလလီၩ့ဘၪလဖၪ, ဒဲကယဲၦဆၨၩလဖၪ လၧအၥၭနၪ့ယွၩထီးအလူၬနီၪ မိဘၪထဲၩ့လၧလရၬဖၧၩ့ လီၫ.",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩ ၦၡၪ့ဖိၪယၬဖိၪနီၪဆၧမိၥၭနၪ့ဝ့ၫလၩ့ ဆိၩလၩ့ကၠၪအ့ၬ, ၦဘၪၡၪ့ဘၪနၭလဖၪ အဆၧယိလါ နီၪလၩ့မါဘၪအဆိၩဆိၩအကၠၪကၠၪအ့ၬ.",
			"19": "<sup>19</sup> ဂဲထုၪ့ထၪ့ဆံၭ, ယဟိဝၩဧ့, မွဲထီးၦၡၩမၩနၧၩ့ဆၧ လဂ့ၩ, မွဲၦဆၨၩၥံၪဘၪဆၧစ့ၩရၫ့ လၧနမ့ၬယၫဆံၭ.",
			"20": "<sup>20</sup> အီၪက့ၪဆၧၥၭမဲၪလၧအဝ့ၫၥံၪအလီၩ့, ယဟိဝၩဧ့, မွဲ ၦဆၨၩ ၥံၪလၧအမွဲဒၪၦၡၩလဖၪဆံၭ.(စ့လၫ.)"
		},
		"10": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့,မွဲဆၧနီၫလၫနဆၧၫ့ထုၪ့ လၧအယဲၩ့ဘဲၫ နီၪလဲၪ.နအီၪက့ၪကဒုၩနၥၭ လၧဆၧမၩခိမၩဝီၩအ",
			"2": "<sup>2</sup> ဆၧၫ့အထီနီၪမွဲဘၪလဲၪ,- လၧအအီၪက့ၪဖိၫအၥၭအ ကၠီၩ့နီၪၦလတီၩလလီၩ့ဘၪ မၩအၧၩ့မၩနၭ ၦၡၪ့ဖိၪ ယၬဖိၪလီၫ.ဆၧလၧအဆီၫ့မီၪ့ကိၪ့ထၪ့န့ဝ့ၫနီၪ, မွဲအ",
			"3": "<sup>3</sup> ဘၪန့အနၫ့ဆါဒၪဝ့ၫဆံၭ.- အဂဲးဘဲၫယီၩၦလတီၩလ လီၩ့ဘၪ အီၪက့ၪဖိၫအၥၭ လၧအဆၧဆိၫ့လၧအၥၭ ဖၧၩ့အကၠီၩ့နီၪ, ဒဲလၧအၥၭလိဖၭနီၪ စဲၪ့ဒၪခွံၬလါနၫ့",
			"4": "<sup>4</sup> တၭ,မၩကြၩ့ထမးယဟိဝၩလီၫ.- ၦလတီၩလလီၩ့ ဘၪလၧအအီၪက့ၪထၪ့ထီၫအမ့ၬအကၠီၩ့နီၪ, အၪ့ဎၬ ဆၧအ့ၬ, လၧအဆၧဆီၫ့မီၪ့ထီးအလူၬအဖၧၩ့နီၪယွၩ",
			"5": "<sup>5</sup> အီၪအ့ၬ.- အဖၧၩ့ၥၭၥံၪဘီၪထၪ့ယီၫထၪ့ ကိၭအဆၧၫ့ အထီဒ့ၭလီၫ. နဆၧစ့ၩရၫ့လဖၪအီၪ လၧထၭယဲၩ့ယဲၩ့ လ့ၬ,ထီးအဒၪစိၩလထူၬဘၪလီၫ. မၩကြၩ့ထမးအ",
			"6": "<sup>6</sup> ဒုၪအဒၩထီးအလူၬလီၫ.- စံၭဝ့ၫလၧအၥၭခံဖၧၩ့, ယမိ ဘၪဆၧအၪ့လဲၩခွံၬယလးအ့ၬ, အဂဲးဘဲၫယီၩယမိ",
			"7": "<sup>7</sup> ဘၪဆၧအၡၪ့နးဆိၭအ့ၬ.- အခိၬဖၧၩ့ဎွ့ၩလၧဆၧဆိၪ အၧၩ့,ဒဲဆၧအၪ့လီၫၥံၪ ဒဲဆၧအၪ့ဂူၬန့ဆၧလီၫ. တၭ ဆၧမၩအၧၩ့ဒဲဆၧဘျံၭဆၧဘျၪအီၪဝ့ၫ လၧအဖျ့ၩဖၫ့",
			"8": "<sup>8</sup> လၬလီၫ.- ဆၧၫ့နၩ့အီၪဝ့ၫ လၧအလးအီၪကဒုၩလၧ တဝၫ့လဖၪအဖၧၩ့, လၧအလးအီၪၥူၪလဖၪအဖၧၩ့နီၪ မွဲအမၩၥံၫၦလၧအဆၧဒဲၩဘၭလအီၪဘၪ, အမ့ၬၥၪ",
			"9": "<sup>9</sup> ၥံၪခိၭၥူၪဆၧလၧၦၡၪ့ဖိၪယၬဖိၪအဂးလီၫ.- အီၪခိၭၥူၪ ဝ့ၫလၧအလးအီၪကဒုၩဘဲၫဆၬလၥၧၫ့ လၧဆၧၡိၬကျၩ အီၪခိၭဝ့ၫဘဲၫၥိၭ အမိဖီၪ့န့ၦၡၪ့ဖိၪယၬဖိၪလီၫ. ဖီၪ့န့ ၦၡၪ့ဖိၪယၬဖိၪတၭ, မီၩ့န့ဝ့ၫလၧအဖျံၩခွၩ့ဖၧၩ့လီၫ.",
			"10": "<sup>10</sup> အဝ့ၫဒၪကူၭလၩ့ဝ့ၫ, ၡီၫ့လၩ့အၥၭတၭ, ၦၡၪ့ဖိၪယၬ",
			"11": "<sup>11</sup> ဖိၪလၩ့ထံၩဖါလၧအၡၩဆီၪ့လဖၪအကၠီၩ့လီၫ.- အဝ့ၫ ဒၪစံၭလၧအၥၭခံဖၧၩ့, ယွၩၥၭနၪ့ယူၭ, အီၪက့ၪၥူၪအ မ့ၬယူၭ,အဆိၩအကၠၪဒၪဘၪဝ့ၫအ့ၬ.",
			"12": "<sup>12</sup> ယဟိဝၩဧ့, ဂဲထုၪ့ဆံၭ, ယွၩဧ့, ယူၬထၪ့နစူၪဆံၭ,",
			"13": "<sup>13</sup> ၥၭနၪ့ၦလၧအဘၪၡၪ့ဘၪနၭနီၪလဂ့ၩ.- ၦလတီၩလ လီၩ့ဘၪမၩကြၩ့ထမးယွၩမွဲဘၪလဲၪ. စံၭဝ့ၫလၧ အ",
			"14": "<sup>14</sup> ၥၭခံဖၧၩ့,နမိအၪ့ကံၩ့ဆီၪ့ဆၧနီၪအ့ၬ.- နဒၪဘၪယူၭ, အဂဲးဘဲၫယီၩနယိလၩ့ဆၧၡၪ့ဆၧနၭ ဒဲဆၧခိဆၧဝီၩ နီၪဘဲၫၥိၭ နမိဖ့ၪထဲၩ့ဆၧလၧနစူၪလီၫ. ၦၡၪ့ဖိၪယၬဖိၪ မိဖ့ၪလၫ့အၥၭလၧနၧၩတၭ, နမွဲၦမၩဆၧၩ့ၦဖိၪဎွ့ၪၥံၪ လီၫ.",
			"15": "<sup>15</sup> မၩခါခွံၬလါၦလတီၩလလီၩ့ဘၪအစူၪဒူၪနီၪဆံၭ, ဒဲၦအၧၩ့ဖိၪနီၪ, နမိအၪ့ဎၬ အဆၧအၧၩ့ထီးနလဒၪန့ လၧၩ့ဘၪလီၫ.",
			"16": "<sup>16</sup> ယဟိဝၩမွဲစဎွၩအဆိၩဆိၩအကၠၪကၠၪလီၫ. ၦဆၨၩ",
			"17": "<sup>17</sup> ၥံၪဂၭဂီၩ့ယူၭ လၧအဝ့ၫအခးဖၧၩ့ယူၭ.- ယဟိဝၩဧ့, ၦလၧအဘၪၡၪ့ဘၪနၭ အဆၧဆိၫ့နီၪ နနါဂၧၫ့ယူၭ, န",
			"18": "<sup>18</sup> တဲၩ့ဝဲၩအၥၭ, နမိဒိၭနနါ,- လၧနစ့ၩရၫ့ၦဖိၪဎွ့ၪ ဒဲၦ ဘၪဆၧမၩနၧၩ့မၩစၪလဖၪနီၪ, ဘဲၫၥိၭအထီးဘၪၥၭ မဲၪလၧၩ့ၦၡၩလၧ အဘၪဆဲၫ့လၧဂၪ့ခိၪလဂ့ၩ."
		},
		"11": {
			"1": "<sup>1</sup> ယဒိၭနဲၩ့ယၥၭလၧယဟိဝၩလီၫ. စဲၪ့ထီၩ့လၧနခိၪ လီၩ့ဘဲၫထိၪအၥိၭနီၪဘီၪ, မွဲနၥံၪစံၭယၥၭဘဲၫၥ့ၪလဲၪ.",
			"2": "<sup>2</sup> အဂဲးဘဲၪယီၩ, ယိခွါ, ၦလတီၩလလီၩ့ဘၪနီၪဖဲၪ့ထၪ့ ယူၭအချံၪယူၭ, တဲၩ့ဝဲၩအၥၭလၧချံၪဖျံၩအဖၫ့ခိၪယူၭ, ဘဲၫၥိၭလၧဆၧခံၭကျၩနီၪ မိခၭဘၪ ၦလၧအၥၭတီၩ",
			"3": "<sup>3</sup> လီၫ.- ဆၧအခၪ့ထံၭလဖၪနီၪ အ့ၪဂၭဂီၩ့တၭ,ၦအတီၩ အလီၩ့လဖၪမိမၩဆၧနီၪလဲၪ.",
			"4": "<sup>4</sup> ယဟိဝၩအီၪဝ့ၫလၧအနီးဆံၫ့ဎံၪအဖၧၩ့လီၫ. ယဟိ ဝၩအလးဆီၩ့ဆီအီၪဝ့ၫလၧမူၭခိၪ, တၭအမ့ၬၥၪဒၪ",
			"5": "<sup>5</sup> ဆၧ,အမ့ၬဖံၭမၩခွါၦၡၩဖိၪလီၫ.- ယဟိဝၩမၩခွါၦ တီၩၦလီၩ့လီၫ. အ့ၪမွဲၦလတီၩလလီၩ့ဘၪ,ဒဲၦလၧအ အဲၪဆၧမၩဆီၪ့လဖၪနီၪ, အဝ့ၫဒၪအၥၭမ့ၬလဲၩဝ့ၫဒၪ",
			"6": "<sup>6</sup> လီၫ.-အဝ့ၫဒၪမိဒုၭဂဲၫဆၧၩ့လၩ့ဖျံၩခွၩ့ၥံၪ လၧၦလ တီၩလလီၩ့ဘၪအလီၩ့, မ့ၪဒဲကး, ဒဲလဖုၬခဲၩထၪ့, မွဲ",
			"7": "<sup>7</sup> လၧအဝ့ၫၥံၪအထွ့ၫအဂးဖီၩ,- အဂဲးဘဲၫယီၩ ယဟိ ဝၩမွဲၦအတီၩအလီၩ့, အဝ့ၫဒၪအဲၪဆၧတီၩဆၧလီၩ့ အမ့ၬယိၦၡၩအတီၩလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ထိးထဲၩ့တၩ့ထဲၩ့ဆံၭ, ယဟိဝၩဧ့,အဂဲးဘဲၫယီၩ ၦဆံၫ့ဎံၪလူၬဝ့ၫ, ၦအလူတီၩလအီၪလၧၩ့ဘၪလၧၦၡၩ",
			"2": "<sup>2</sup> အဖိၪၥံၪအကျၩလီၫ.- ၦချဲၩ့ဆၧပျီၩပျီၩလဂၩဒဲလဂၩ လၧၦလၧအနဲၩ့ထံၭ, အဝ့ၫၥံၪချဲၩ့ဆၧလၧနိၭဖျံၩချဲၩ့",
			"3": "<sup>3</sup> မုၬနါဆၧ, လၧၥၭနံၫထၧၫ့လီၫ.- ယဟိဝၩမိဒၪ့ထ့ၬခွံၬ နိၭဖျံၩလၧအချဲၩ့မုၬနါ ဆၧထီးအလူၬ, ဒဲဖျ့ၩလၧအ",
			"4": "<sup>4</sup> ချဲၩ့ဆၧဖၭဒိၪလဖၪလီၫ.- ၦလၧအစံၭယူၭ, ပမိမၩ နၧၩ့ဆၧလၧပဖျ့ၩ, ပနိၭဖျံၩၥံၪ မွဲပဆၧဒၪပဝ့ၫတၭ, မွဲ ပလၫမိကဲၪကဆါလၧ ပဖၫ့ခိၪလဂၩလဲၪ.",
			"5": "<sup>5</sup> လၧၦၡၪ့ဖိၪယၬဖိၪ ဘၪဆၧမၩနၧၩ့မၩစၪဝ့ၫအကၠီၩ့, ဒဲလၧၦၡၪ့ဖိၪယၬဖိၪ အဂၪ့အုၩ့ဂၪ့ထိၬဆၧအကၠီၩ့နီၪ, ဘိၩ့နဲၪ့ယီၩယမိဂဲထုၪ့, ယဟိဝၩစံၭဝ့ၫဒၪ, တၭၦလၧ",
			"6": "<sup>6</sup> အဘၪထိးဆၧဒုၪဒွ့ၪနီၪ, ယမိဒုၭဖီၩ့ဖျ့ၭဝ့ၫလီၫ.- ယ ဟိဝၩအဆၧချဲၩ့နီၪ မွဲဆၧချဲၩ့အဆံၫ့ဘဲၫစ့ၩ လၧၦမၩ",
			"7": "<sup>7</sup> ဆံၫ့ဝ့ၫလၧမ့ၪဖၧၩ့ ထီးအဎွ့ၩထၪ့နွ့ၫဖၧၫ့နီၪလီၫ.- နဝ့ၫ ဒၪယဟိဝၩဧ့, နမိယိလၩ့ခွါလၩ့အဝ့ၫၥံၪ, နမိအီၪခိၭ အဝ့ၫၥံၪလၧၦလဆိၩယီၩ အစူၪဖၧၩ့လၩ့ဆိၩလၩ့ကၠၪ",
			"8": "<sup>8</sup> လီၫ.- ထီးၦၡၩအဖိၪခွၫ အအၧၩ့ထုၬလဖၪ ဘၪဆၧ အီၪက့ၪထၪ့ထီၫဝ့ၫတၭ, ၦလတီၩလလီၩ့ဘၪလဖၪ လ့ၩဆၧဎံၩ့ဎံၩ့လ့ၬလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ဆံၭယံၬလဲၪ, ယဟိဝၩဧ့, နမိၥၭနၪ့ယၧၩလၩ့ဆိၩ လၩ့ကၠၪဆ့ဧၪ, နမိအီၪက့ၪၥူၪနမ့ၬလၧယၧၩဆံၭယံၬ",
			"2": "<sup>2</sup> လဲၪ.- ယဘၪအီၪက့ၪဆၧဆီၫ့မီၪ့ လၧယၥၭဖၧၩ့, ဆၧ ၥုၪ့အုၭၥၭအုၭ လၧယၥၭခံဖၧၩ့ၥံၫ့ၥံၫ့နံၩ ဆံၭယံၬလဲၪ, ယဒုၪယဒၩ မိဘၪဆၧအီၪက့ၪထၪ့ လၧယဖၫ့ခိၪဆံၭ ယံၬလဲၪ.",
			"3": "<sup>3</sup> ယိခွါ, ခိၭနၪယလူဆံၭ, ယဟိဝၩ, ယယွၩဧ့, ဒုၭ ဖၩ့ထၪ့ယမ့ၬဆံၭ, ဘၪလဘၪယမိမံၫၥံၫဘၪခိၬလီၫ.",
			"4": "<sup>4</sup> ဘၪလဘၪယဒုၪယဒၩမိစံၭဘၪခိၬ, ယမၩနၧၩ့ယူၭအ ဝ့ၫယူၭ, တၭထီးယအ့ၪဝၭတၭ, ၦလၧအမၩခိမၩဝီၩ",
			"5": "<sup>5</sup> ယၧၩလဖၪ မိၥုၪ့ဎွံၫၥၭယီၫဘၪခိၬလီၫ.- အ့ၪမွဲယဝ့ၫ ဒၪယဒိၭနဲၩ့ယၥၭလၧနခိးနတၩ, ယၥုၪ့ဎွံၫၥၭယီၫလၧ",
			"6": "<sup>6</sup> နဆၧထိးထဲၩ့တၩ့ထဲၩ့အဖၧၩ့လီၫ.- ယမိအၪ့အူၭထၪ့ ယဟိဝၩနီၪ, အဂဲးဘဲၫယီၩအဝ့ၫဒၪမၩဂ့ၩယူၭယၧၩ ယူၭ."
		},
		"14": {
			"1": "<sup>1</sup> ၦဂီၩ့ဖိၪစံၭယူၭလၧအၥၭခံဖၧၩ့, ယွၩအီၪနးဂၩအ့ၬ. အဝ့ၫၥံၪအၧၩ့ဝ့ၫတၭ, မၩယူၭဆၧဘၪၥၭလိၪယူၭ, ၦ",
			"2": "<sup>2</sup> မၩဆၧဂ့ၩ အီၪဝ့ၫနးဂၩအ့ၬ.- ယဟိဝၩယိလၩ့လၧ မူၭခိၪလၧၦၡၩအဖိၪၥံၪအလီၩ့, ဘဲၫၥိၭအမိဒၪဘၪ ဝ့ၫလၧၦအၥၭဖၭ, ၦလၧအအၪ့ဎၬယွၩမွဲ အအီၪလဂၩ",
			"3": "<sup>3</sup> ဂၩဆ့ဧၪ.- အဝ့ၫၥံၪလ့ၩမၪယူၭထီးအလူၬယူၭ, အၧၩ့ ထၪ့ယူၭလစီၪ့ဎးယူၭ. ၦမၩဆၧဂ့ၩအီၪနးဂၩအ့ၬ, န့ၫ လဂၩနီၪအီၪအ့ၬ.",
			"4": "<sup>4</sup> ကယဲၦလၧအမၩဆၧအၧၩ့ ထီးအလူၬလဖၪနီၪ မွဲ အၥ့ၪယၫဆၧနးမံၩ့အ့ၬဧၪ, တၭအၪ့ယၡၩခမျၧးဘဲၫ အအၪ့ကိၪတၭ, လကိၭထၪ့ဘၪ ယဟိဝၩနီၪလီၫ.",
			"5": "<sup>5</sup> ထီးနီၪအဝ့ၫၥံၪ အီၪလၧဆၧၥၭမဲၪဖၭဒိၪ အဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ယွၩအီၪဝ့ၫလၧၦအဆိၩအတီၩအလီၩ့",
			"6": "<sup>6</sup> အကျၩလီၫ.- နၥံၪဒုၭမ့ၬမဲ ၦၡၪ့ဖိၪယၬဖိၪအဆၧဒုၭ ကိၪ့ဝ့ၫနီၪ,အဂဲးဘဲၫယီၩ ယဟိဝၩမွဲအဆၧဖီၩ့ဖျ့ၭအ လးလီၫ.",
			"7": "<sup>7</sup> မွဲဆၧဖ့ၪလၫ့လါအံၫစရ့လၭ အဆၧထိးထဲၩ့တၩ့ ထဲၩ့လၧဇံအိၫ့အဖၧၩ့ဆံၭ. ထီးယဟိဝၩဒုၭထဲၩ့ထဲၩ့ အၡၩဆၧအၪ့မၧၫ့ဎီးတၭ, စယၫကူၭမိၥုၪ့ဎွံၫၥၭယီၫ တၭ,အံၫစရ့လၭမိၥုၪ့ထိၬၥၭထိၬလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, မွဲပလၫမိအီၪဝ့ၫလၧနတဲၩဆံၫ့ဎံၪအ ဖၧၩ့လဂၩလဲၪ, မွဲပလၫမိအီၪဂုးခၧၫ့ လၧနခိၪလီၩ့ဆံၫ့ ဎံၪအလီၩ့လဂၩလဲၪ.",
			"2": "<sup>2</sup> ၦလၧအလ့ၩဆၧ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ, ဒဲမၩဆၧတီၩ ဆၧလီၩ့တၭ, ချဲၩ့ဆၧမွဲဆၧတီၩလၧအၥၭခံဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪလချဲၩ့ခဲၪဘၪ ဆၧလၧအဖျ့ၩတၭ, လမၩအၧၩ့ ဘၪအထံၩအၥိၭတၭ, လမၩန့ထၪ့ဘၪဆၧဒုၪဒွ့ၪထၫ့",
			"4": "<sup>4</sup> ဒၩၦၡၩလၧအနဲၩ့ထံၭနီၪလီၫ.- ၦအၧၩ့ဖိၪလၧအဘၪ ဆၧခွံၬၡိၭခွံၬဝ့ၫနီၪ မွဲဆၧၥၭလိၪလၧအမ့ၬယၫ, အ့ၪ မွဲယူၭယၪ့ၦလၧအၥၭမဲၪ ယဟိဝၩ နီၪလီၫ. အ့ၪဆိၪ လၩ့ယူၭအၥၭ လၧအဘၪထံၭဆၫ အနၫ့ဆါဒၪဝ့ၫလါ",
			"5": "<sup>5</sup> နၫ့တၭ,မၩကဒံၩကဒၩအၥၭအ့ၬ.- လဒုၭအၪ့လီးဘၪ စ့ၩလၧစ့ၩအအ့ၪအဂးတၭ, မၩန့လၬဆီၪ့ထၫ့ဒုၪဒၩၦ လၧအဆၧဒဲၩဘၭလအီၪဘၪနီၪဆ့အ့ၬ. ၦလၧအမၩ ဆၧလဖၪနီၪမိဂဲၩဝၭဘၪနးဆိၭအ့ၬ."
		},
		"16": {
			"1": "<sup>1</sup> ယိထဲၩ့ခွါထဲၩ့ယၧၩဆံၭ, ယွၩဧ့,အဂဲးဘဲၫယီၩယ",
			"2": "<sup>2</sup> ဒိၭနဲၩ့ယၥၭလၧနၧၩလီၫ.- ယၥၭဧ့, နစံၭယဟိဝၩ, နမွဲယကဆါလီၫ. လၧနၧၩအဖၫ့ခိၪနီၪ ယဆၧဂ့ၩအီၪ",
			"3": "<sup>3</sup> နးမံၩ့အ့ၬ.- ၦဆံၫ့ဎံၪလၧဂၪ့ခိၪချိၫ့ယီၩ, အဝ့ၫၥံၪမွဲၦ အဂ့ၩအဘွၩတၭ, ကယဲယဆၧမုၬထီးအလူၬအီၪဝ့ၫ လၧအဝ့ၫၥံၪအဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> ၦလၧအအၪ့လဲၩခွံၬမၩန့ယွၩအဂူၫဂၩနီၪ, အဝ့ၫၥံၪ အဆၧၡၪ့ဆၧနၭ မိအၪထၪ့အၪအၪလ့ၬလီၫ. ယလ လူၫလၩ့ဘၪအဝ့ၫၥံၪ အဆၧလုအီၩလၧၥွံၪတၭ, ယ",
			"5": "<sup>5</sup> ဎွံၩ့ဘၪအမံၩ့လဖၪ လၧယနိၭဖျံၩအ့ၬ.- ယဟိဝၩမွဲ ယဆၧန့ၥၫအဂး, ဒဲယထွ့ၪအဂးလီၫ. နအီၪက့ၪဂုး",
			"6": "<sup>6</sup> ခၧၫ့ဆၧအၪ့နၩ့ဖၭလၧယဂးလီၫ.- နိၪထိၪအဖျံၩလၩ့ ဘၪလၧယဂးလၧအလးမုၬလီၫ, မွဲမၬ,ယဆၧန့ၥၫနီၪ",
			"7": "<sup>7</sup> မွဲဆၧအဂ့ၩအဘၪလီၫ.- ယမိစံၭထၪ့အၪ့အူၭယဟိ ဝၩလၧအဒုၭကိၪ့ယၧၩလီၫ. တၭယၥုၪ့ယၥၭၥီၪ့ထဲၩ့ ယၧၩလၧမုနၩလခီၫဆ့လီၫ.",
			"8": "<sup>8</sup> ယအီၪက့ၪယဟိဝၩ လၧယမ့ၬယၫလထံၪဎးလီၫ. အဝ့ၫဒၪအီၪလၧယစူၪထွ့ၪအကၠီၩ့တၭ, ယဂဲၩယဝၭ",
			"9": "<sup>9</sup> ဘၪအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ ယၥၭမိၥၭထိၬတၭ, ယလၩယဖၩ့ၥုၪ့ဎွံၫၥၭယီၫလီၫ. ယဖံၭယယၪဆ့မိ",
			"10": "<sup>10</sup> ဒိၭနဲၩ့အၥၭလၧဆၧယိလါအဖၧၩ့လီၫ.- အဂဲးဘဲၫ ယီၩနလအီၪက့ၪလၩ့ထးဘၪ ယၥၭၡီၩ့လၧဖျႃဖၧၩ့ တၭ,နဒုၭဒၪဘၪနၡၩဆံၫ့ဎံၪလဂၩ လၧဆၧအုၪနီၪဆ့",
			"11": "<sup>11</sup> အ့ၬ.- နမိဒုၭနဲၪယၧၩလၧဆၧမၧၫ့အဖၧၩ့ၥၭ, ဆၧၥုၪ့ ဎွံၫၥၭယီၫလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလၧနမ့ၬယၫ, ဆၧမုၬ ဆၧလၩအီၪဝ့ၫ လၧနစူၪထွ့ၪ အဆိၩဆိၩ အကၠၪကၠၪ လီၫ."
		},
		"17": {
			"1": "<sup>1</sup> ခိၭနၪလါဆၧတီၩဆၧလီၩ့, ယဟိဝၩဧ့,ခိၭနၪယ ကိၭထၪ့ဆၧ, ဒိၭနနါလၧယဘၩဆိၪဖၪဆၧလၧနိၭဖျံၩ",
			"2": "<sup>2</sup> လၧအလအၪ့လီၫန့ဘၪဆၧ,-ယဆၧစ့ၩရၫ့ခွးနီၪ, မွဲ အဂဲၫထၪ့လၧနမ့ၬယၫ, မွဲနမ့ၬၥၪယိဆၧအတီၩအလီၩ့",
			"3": "<sup>3</sup> ဆံၭ.- နမၩခွါယၥၭတၭ, နအၪ့စိၭအၪ့စၪ့ယၧၩလၧမု နၩလခီၫ, နအၪ့ကဲၪ့ယၧၩတၭ, နဒၪဘၪဆၧနးမံၩ့အ့ၬ, ယကိၪ့ယူၭဆၧ, ယမိချဲၩ့မၪဘၪဆၧလၧယနိၭအ့ၬ.",
			"4": "<sup>4</sup> ဘၪဆဲၫ့လၧၦၡၩအဆၧမၩၥံၪ, လၧနနိၭဖျံၩအဆၧချဲၩ့ အကၠီၩ့နီၪ, ယထီးလၩ့ယၥၭဂၭဎ့ၭခွံၬၦမၩဂၭဂီၩ့ဆၧ",
			"5": "<sup>5</sup> အဖၧၩ့ၥၭလီၫ.- တၭယခၫထၪ့ဝ့ၫဂုးဂုးခၧၫ့ခၧၫ့လၧန ဖၧၩ့ၥၭဖၧၩ့နီၪယခၪ့ဖျၬအ့ၬ.",
			"6": "<sup>6</sup> ယကိၭထၪ့နၧၩ, အဂဲးဘဲၫယီၩနခိၭနၪယလူ, ယွၩ",
			"7": "<sup>7</sup> ဧ့,ဒိၭနနါလၧယၧၩတၭ, ခိၭနၪယဆၧချဲၩ့ဆံၭ.- ၦလၧ အထိးထဲၩ့တၩ့ထဲၩ့ၦလဖၪ လၧအဒိၭနဲၩ့အၥၭလၧ နၧၩ,လၧၦလၧအဂဲထုၪ့ထၫ့ဒုၪဒၩအဝ့ၫၥံၪ အစူၪဖၧၩ့ လၧနစူၪထွ့ၪနီၪလဂၩဧ့, ဒုၭနဲၪနခိးနတၩလၩ့လၭနီၪ",
			"8": "<sup>8</sup> ဆံၭ.- ယိထဲၩ့ခွါထဲၩ့ယၧၩဘဲၫၦမ့ၬၡၩအၥိၭ နီၪတၭ, လၧနဒံၭအလၩၡုၪအဖၧၩ့နီၪ အီၪက့ၪၥူၪခွံၬယၧၩ,",
			"9": "<sup>9</sup> လၧၦလတီၩလလီၩ့ဘၪ လၧအမၩနၧၩ့မၩစၪယၧၩအ မ့ၬယၫ, ယၥၭမၧၫ့အဒုၪအဒၩလၧအအီၪဝၬဖီၩ့ယၧၩ",
			"10": "<sup>10</sup> နီၪဆံၭ.- အဝ့ၫၥံၪဘီၪ့ဝ့ၫၥိၪဝ့ၫတၭ, အနိၭချဲၩ့ဆၧဘဲၫ",
			"11": "<sup>11</sup> လၧအၥၭထၪ့ထီၫအၥိၭလီၫ.- လၧပခၫထၪ့ၥံၪနီၪအ ဝ့ၫၥံၪအီၪဝၬဖီၩ့ပၧၩ ဘိၩ့နဲၪ့ယီၩလီၫ. အီၪက့ၪအမ့ၬ",
			"12": "<sup>12</sup> ဘဲၫၥိၭအမိမၩလၩ့ထံၩဖါပၧၩလၧဂၪ့ခိၪလီၫ.- မၩအ ၥၭဘဲၫဆၬလၥၧၫ့ လၧအဆိၫ့ၡၫ့ခွံၬဆၧအၥိၭတၭ, ဒဲ ဘဲၫဆၬလၥၧၫ့အၥၭဘၪ့ လၧအအီၪခိၭၥူၪဆၧလၧအ လးအီၪၥူၪၥံၪအဖၧၩ့အၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> ဂဲထုၪ့ယဟိဝၩဧ့, လ့ၩခိၭထ့ၬအဝ့ၫ, ဒုၭၡီၫ့လၩ့အ ဝ့ၫဒၪ, မၩဖီၩ့မၩဖျ့ၭယၥၭမၧၫ့ လၧၦလတီၩလလီၩ့",
			"14": "<sup>14</sup> ဘၪအစူၪဖၧၩ့, လၧအမွဲနနၭလဘံၪ့နီၪဆံၭ.- ဒဲလၧၦ ၡၩၥံၪ,နစူၪ, ယဟိဝၩဧ့, လၧၦယီၩလကၠၪဖိၪ လၧအ ဂးအီၪလၧၥၭမၧၫ့ဒံၭ အဘိၩ့ဘၭတၭ, နမၩဎွ့ၩအဂူၭ ဖိၫ့လၧနဆၧအီၪက့ၪကီၪ့နီၪ, အဝ့ၫၥံၪန့အဖိၪၥံၪဘျဲၩန့ တၭ,အီၪက့ၪလၩ့ထးအဝ့ၫၥံၪ အဆၧအဘျဲၪအဆဲလၧ အဖိၪအလံၩအဂးလီၫ.",
			"15": "<sup>15</sup> အ့ၪမွဲယဝ့ၫဒၪယီၩ ယမိဒၪဘၪနမ့ၬလၧဆၧတီၩ ဆၧလီၩ့အဖၧၩ့လီၫ. ထီးယအ့ၪနၪ့ထၪ့ယၥၭအီၪလၧ နခံးနဂၩ့တၭ ယမိမံၫ့ၥုၪ့မံၫ့ၥၭယဝ့ၫလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ယမိအဲၪနၧၩကွံၩနၧၩ, ယဂဲးယဘၭ,ယဟိဝၩဧ့,",
			"2": "<sup>2</sup> ယဟိဝၩမွဲယလဲၫ့, ဒဲယထိၬ, ဒဲယဆၧမၩဖီၩ့ဖျ့ၭ, ယယွၩယလဲၫ့, ယမိဒိၭနဲၩ့ယၥၭလၧအဖၧၩ့ ယထၩ့ ဖံၭလဘံၪ့,ဒဲယဆၧထိးထဲၩ့တၩ့ထဲၩ့အနိၩ့, ယတၨၭ",
			"3": "<sup>3</sup> ထီၫလီၫ.-ယမိကိၭထၪ့ယဟိဝၩ, လၧအဘၪဆၧစံၭ ထၪ့အၪ့အူၭဝ့ၫတၭ, ယမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့",
			"4": "<sup>4</sup> န့ယၧၩလၧယဒုၪယဒၩၥံၪအစူၪဖၧၩ့လီၫ.- ဆၧၥံၫအ ဖျံၩလဖၪ အီၪဝၬဖီၩ့ယၧၩတၭ,ဆၧမၩဂၭဂီၩ့အထံၫ",
			"5": "<sup>5</sup> ချိၬလဖၪမၩၥၭမဲၪၥၭဖျဲၩ့ယၧၩလီၫ.- တၭဖျႃဖၧၩ့အ ဖျံၩလဖၪအီၪဝၬဖီၩ့ယၧၩ, ဆၧၥံၫအဖျံၩခွၩ့ၥံၪပဒၩ့",
			"6": "<sup>6</sup> ထၬယၧၩလီၫ.- ထီးယဘၪဆၧခိဆၧဝီၩတၭ,ယကိၭ ထၪ့ယဟိဝၩတၭ, ယအၪ့ယၫဆၧလၧယယွၩလီၫ. အဝ့ၫခိၭနၪယလူလၧအနီးဖၧၩ့တၭ, ယအၪ့ယၫဆၧ",
			"7": "<sup>7</sup> နီၪလ့ၩထီၩ့လၧအမ့ၬယၫလၧအနါဖၧၩ့လီၫ.- ထီးနီၪ လဖၧၫ့လၧအၥၭထၪ့ဝ့ၫအကၠီၩ့နီၪ, ဂၪ့ခိၪဝၭၡိၩ့ၡိၬဝ့ၫ တၭ,ခိၪလီၩ့ၥံၪအခၪ့ထံၭ ၥုၭအၥၭ ဒဲဝၭဝ့ၫဒၪလီၫ.",
			"8": "<sup>8</sup> မ့ၪခူၪစဲၪ့ထၪ့ခွံၬလၧအနၫဖၧၩ့, ဒဲမ့ၪလၧအနိၭအၪ့ဆၧ",
			"9": "<sup>9</sup> တၭမ့ၪအၧၩ့ဖၭဘၪဆူၭခဲၩထၪ့လၧအဝ့ၫလီၫ.- အဝ့ၫ မၩကူၭလၩ့မူၭခိၪ, ဂဲၫလၩ့တၭ, ဆၧခံၭၥၧၫ့အီၪဝ့ၫလၧ",
			"10": "<sup>10</sup> အခၪ့အဖၫ့လၬလီၫ.- အဝ့ၫဒၪထူၬခ့ၫရူၬလဒုၩတၭ, ယူၩဝ့ၫ,မွဲမၬ, ယူၩဝ့ၫလၧလံၩအဒံၭ အဖၫ့ခိၪလီၫ.",
			"11": "<sup>11</sup> အဝ့ၫဒၪအီၪက့ၪဆၧခံၭလၧအမွဲ အလးအီၪၥူၪဝ့ၫတၭ, အတဲၩအီၪဝၬဖီၩ့အဝ့ၫနီၪ, ထံၫၥၧၫ့ၥံၪ, မူၭဖိၭဖၫ့အဆၧ",
			"12": "<sup>12</sup> အုၪ့တၪ့လီၫ.- လၧဆၧယုၩ့ယဲအမ့ၬယၫနီၪ ဆၧအုၪ့",
			"13": "<sup>13</sup> တၪ့ဒံၩခွံၬဝ့ၫ, မုၥၪဒဲမ့ၪအၧၩ့ဖၭ,- တၭယဟိဝၩအၪ့ မၧၫ့လၫ့ဎွံၩ့ လၧမူၭခိၪတၭ, ဆၧထၪ့ထီၫထုၬ အလူၥီၫ",
			"14": "<sup>14</sup> ထၪ့ဝ့ၫတၭ, မုၥၪဒဲမ့ၪအၧၩ့ဖၭ,- အဝ့ၫဒၪဖျါလၩ့အဖျါ ၥံၪတၭ, မၩလၩ့ပြံၩပြၩဝ့ၫတၭ, အၪ့မၧၫ့လၫ့ဝဲအဒံၭ",
			"15": "<sup>15</sup> အၪအၪလ့ၬတၭ, မၩနၧၩ့မၩစၪဝ့ၫလီၫ.- ထံၫၥံၪအ အကၠီၪ့ပဒၪဘၪဝ့ၫတၭ, ဂၪ့ခိၪအခၪ့ထံၭလဖၪအီၪဖျီၪထၪ့ ဝ့ၫလၧနအၪ့ၥီၪ့ဆၧအကၠီၩ့, လၧနနၫဖၧၩ့ ၥၪၡိၫဆၧ",
			"16": "<sup>16</sup> လဘျၩ့အကၠီၩ့နီၪ, ယဟိဝၩဧ့,- အီၪဝ့ၫလၧဆၧထၪ့ ထီၫတၭ, မွဲအအၪ့မၧၫ့လၩ့ ဆၧမၩန့ထၪ့ယၧၩတၭ,",
			"17": "<sup>17</sup> ထုၭခွံၬယၧၩ လၧထံၫအၪအကျၩလီၫ.- အဝ့ၫမၩဖီၩ့ ဖျ့ၭယၧၩလၧယဒုၪယဒၩ လၧအဂဲးဆီၪ့အဘၭဆီၪ့လ ဂၩ,ဒဲလၧၦလၧအမ့ၬလဲၩယၧၩၥံၪအစူၪဖၧၩ့လီၫ. အ",
			"18": "<sup>18</sup> ဂဲးဘဲၫယီၩ မွဲအဝ့ၫၥံၪဆီၪ့လၨၪလၧယဂးလီၫ.- လၧ ယဆၧနၭဆၧၡၪ့အမုနံၩနီၪ, အဝ့ၫၥံၪပဒၩ့ထၬယၧၩ လီၫ.မွဲလါနၫ့တၭ, ယဟိဝၩမွဲဆၧဒိၭနဲၩ့အလးလၧ",
			"19": "<sup>19</sup> ယဂးလီၫ.- တၭအဝ့ၫဒၪၥိၫ့ထၪ့ယၧၩထီၩ့လၧအလး ဖၭလဲမၩဖီၩ့မၩဖျ့ၭယၧၩလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫမုၬ န့အၥၭလၧယၧၩလီၫ.",
			"20": "<sup>20</sup> ယဟိဝၩဖ့ၪလၫ့ထဲၩ့ဆၧလၧယၧၩ ဘဲၫယဆၧတီၩ ဆၧလီၩ့အၥိၭ, ဘဲၫယစူၪဆံၫ့အၥိၭဒုၭန့ဆၧၫ့ယၧၩ",
			"21": "<sup>21</sup> လီၫ.- အဂဲးဘဲၫယီၩယထီးန့ယူၭယဟိဝၩအဖၧၩ့ၥၭ လဖၪယူၭတၭ, ယစဲၪ့ဒၪမၩမၪဘၪ ယယွၩဆ့အ့ၬ.",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩ အဆၧစ့ၩရၫ့ထီးအလူၬ အီၪဝ့ၫလၧယ မ့ၬယၫတၭ, အဆၧမၪလူၬလဖၪနီၪ, ယခွံၬၡိၭခွံၬလၧ",
			"23": "<sup>23</sup> ယအီၪအ့ၬ.- ယတီၩဝ့ၫလီၩ့ဝ့ၫလၧအမ့ၬယၫတၭ,ယ",
			"24": "<sup>24</sup> ခိၭထၬယၥၭလၧယဆၧအၧၩ့လီၫ.- တၭယဟိဝၩဖ့ၪ လၫ့ထဲၩ့ဆၧလၧယၧၩ ဘဲၫယဆၧတီၩဆၧလီၩ့အၥိၭ,",
			"25": "<sup>25</sup> ဘဲၫယစူၪဆံၫ့လၧအမ့ၬယၫအၥိၭလီၫ.- လၧၦယၫ့ၥၭ ဆၧအမ့ၬယၫနီၪ နမိအီၪက့ၪယၫ့ၥၭနၥၭ, လၧၦအတီၩ အလီၩ့အမ့ၬယၫနီၪနမိအီၪက့ၪတီၩအီၪက့ၪလီၩ့နၥၭ,",
			"26": "<sup>26</sup> လၧၦအဆံၫ့ဎံၪအမ့ၬယၫနီၪ, နမိအီၪက့ၪဆံၫ့ဎံၪနၥၭ တၭ,လၧၦကၪအမ့ၬယၫနီၪ နမိအီၪက့ၪ ကၪနၥၭလီၫ.",
			"27": "<sup>27</sup> အဂဲးဘဲၫယီၩ နမိထိးထဲၩ့တၩ့ထဲၩ့ ၦခမျၧးလၧအဘၪ ၡၪ့ဘၪနၭ, အ့ၪမွဲဆၧအမ့ၬၥၪထၪ့ထီၫနီၪ နမိဆၪ့လၩ့ ဝ့ၫလီၫ.",
			"28": "<sup>28</sup> အဂဲးဘဲၫယီၩနမိဒုၭဖၩ့ထၪ့ယမ့ၪဒိၩ့, ယဟိဝၩ,",
			"29": "<sup>29</sup> ယယွၩမိမၩဖၩ့ထၪ့ယဆၧခံၭလီၫ.- အဂဲးဘဲၫယီၩ, ယစဲၪ့တလဲးနုၬဖျီၫ့ယူၭ ၦၥုၭလဒီၪ့လၧနၧၩတၭ, လၧ",
			"30": "<sup>30</sup> ယယွၩလဂၩယဖုၫဖၭယူၭထိၬယူၭ.- ဆၧလၧယွၩနီၪ အဖၧၩ့ၥၭ လၧၫ့ဎွ့ၩဝ့ၫတၭ, ယဟိဝၩ အလူနီၪဘၪ ဆၧမၩဆံၫ့ထၪ့ဝ့ၫဒၪလီၫ. ယဟိဝၩမွဲထၩ့ဖံၭလဘံၪ့, လၧကယဲၦလၧအဒိၭနဲၩ့အၥၭ လၧအဖၧၩ့ထီးအလူၬ",
			"31": "<sup>31</sup> အဂးလီၫ.- အဂဲးဘဲၫယီၩအ့ၪလမွဲဘၪယဟိဝၩနီၪ, မွဲပလၫကဲၪယွၩလဂၩလဲၪ. တၭအ့ၪလမွဲဘၪယွၩနီၪ,",
			"32": "<sup>32</sup> မွဲပလၫကဲၪလဲၫ့လဖျိၪ့လဂၩလဲၪ.- ၦလၧအခဲးထူၬယ ယးဒံၩ့ လၧဆၧဂဲးဆီၪ့ဘၭဆီၪ့နီၪ မွဲယွၩလီၫ. ဒဲမၩ",
			"33": "<sup>33</sup> လၧၫ့ထၪ့ဎွ့ၩထၪ့ယဖၧၩ့ၥၭလီၫ.- အဝ့ၫမၩယခၪ့ဘဲၫ ခ့ၫဘၩ့မိအၥိၭတၭ, ဒုၭဆၧၫ့ထုၪ့ယၧၩလၧယလးထၪ့",
			"34": "<sup>34</sup> ထီၫၥံၪအဖၫ့ခိၪလီၫ.- အဝ့ၫၥီၪ့လိၪယစူၪဘဲၫၥိၭယမိ ဒုၭဆၧတၭ, ယဖဲၪ့ထၪ့ချံၪထီးဘၩ့ လၧယစူၪဒူၪလီၫ.",
			"35": "<sup>35</sup> နဖ့ၪလၫ့ယၧၩလၧနဆၧထိးထဲၩ့တၩ့ထဲၩ့ အထၩ့ဖံၭလ ဘံၪ့တၭ,နစူၪထွ့ၪဒုၭအီၪဂုးအီၪခၧၫ့ယၧၩတၭ, နဆၧ",
			"36": "<sup>36</sup> အွံၪၥၭဆၧၩ့နီၪမိမၩဒိၪထၪ့ယၧၩလီၫ.- နမၩလဲထၪ့ယ",
			"37": "<sup>37</sup> ခၫထၪ့ဆၧလဖၪတၭ, ယခၪ့ဒံၩ့ဝၭထိၬဘၪအ့ၬ.- ယမိ လီၩ့ဆီးယဒုၪယဒၩ ချႃၭန့အဝ့ၫၥံၪတၭ, အဝ့ၫၥံၪဂၭ",
			"38": "<sup>38</sup> ဂီၩ့လချႃၭလူၬဒံၭဘၪနီၪ, ယဂဲၫထဲၩ့ထဲၩ့အ့ၬ.- ယမိ ကျီၪ့ခွံၬအဝ့ၫၥံၪထီးအဂဲထုၪ့ထဲၩ့ဝ့ၫလန့ဘၪတၭ, မိ",
			"39": "<sup>39</sup> လၩ့ထံၩဖါဝ့ၫလၧယခၪ့အဖၫ့လၬလီၫ.- အဂဲးဘဲၫယီၩ နခဲးထူၬယယးဒံၩ့ လၧဆၧဂဲးဆီၪ့ဘၭဆီၪ့ လၧဆၧဒုၭ ၥုၭအဂးတၭ, ၦလၧအဂဲထုၪ့ထၫ့ဒုၪဒၩယၧၩနီၪ နဒုၭ",
			"40": "<sup>40</sup> ၡီၫ့လၩ့လၧယဖၫ့လၬလီၫ.- နဖ့ၪလၫ့ယၧၩလၧယဒုၪ ယဒၩအခိၬတၭ, ၦလၧအမ့ၬလဲၩယၧၩလဖၪနီၪယမိ",
			"41": "<sup>41</sup> မၩဂၭဂီၩ့ခွံၬအဝ့ၫၥံၪလီၫ.- အဝ့ၫၥံၪမိအၪ့ကံၩ့အၪ့ယၫ ဆၧတၭ, ဆၧမၩဖီၩ့မၩဖျ့ၭဝ့ၫအီၪနးဂၩအ့ၬ, ကိၭထၪ့ လၧယဟိဝၩနီၪလါနၫ့ အဝ့ၫဒၪစံၭဆၧၫ့အဝ့ၫၥံၪအ့ၬ.",
			"42": "<sup>42</sup> တၭယမိမၩလၩ့ဘျ့ၭအဝ့ၫၥံၪ ဘဲၫဂၪ့ခိၪမုၬလၧလံၩအ မ့ၬယၫအၥိၭနီၪ, ဘဲၫဖၧၩ့ၥၭအဖံၬအၥိၭနီၪ, ယလူၫ",
			"43": "<sup>43</sup> လၩ့ခွံၬဝ့ၫဒၪလီၫ.- နမိမၩဖီၩ့မၩဖျ့ၭယၧၩလၧၦခမျၧး အဆၧအဲၪ့လိၬဆိၭချဲၩ့, နအီၪက့ၪယၧၩလၧၦဆၨၩ ၥံၪအခိၪ,တၭၦခမျၧး လၧယလၥ့ၪယၫဘၪဝ့ၫနီၪ မိမၩ",
			"44": "<sup>44</sup> ယဆၧလီၫ.- ထီးအနါဂၧၫ့ဆၧလၧအနါတၭ, မိခိၭနၪ ယလူ, ၦလခီၫဘၩ့မုးဖိၪမိကျဲၩ့ဆၪ့လၩ့အၥၭလၧယ",
			"45": "<sup>45</sup> ဖၫ့လၬလီၫ.- ၦလခီၫဘၩ့မုးဖိၪမိလၩ့ယံၭခွံၬတၭ, မိ ဝၭထိၬဝ့ၫလၧအထိၬခၧၫ့အဖၧၩ့လီၫ.",
			"46": "<sup>46</sup> ယဟိဝၩမၧၫ့ဝ့ၫတၭ, မွဲယလဲၫ့ဘၪဆၧစံၭထၪ့အၪ့ အူၭဝ့ၫ,ဒဲယဆၧထိးထဲၩ့တၩ့ထဲၩ့အယွၩနီၪ, မွဲအဘၪ",
			"47": "<sup>47</sup> ဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫဆံၭ.- ၦလၧအမၩဆၧၫ့ဆၧ အၧၩ့လၧယဂးမွဲယွၩလီၫ. တၭမွဲအဆၪ့လၩ့ၦခမျၧး",
			"48": "<sup>48</sup> ၥံၪလၧယဖၫ့လၬ,- ဒဲမၩဖီၩ့မၩဖျ့ၭယၧၩလၧယဒုၪယ ဒၩလီၫ. မွဲမၬ, နမိအီၪက့ၪထၪ့ယၧၩထီၫနဲၪ့ ၦလၧအ ဂဲထုၪ့ထၫ့ဒုၪဒၩယၧၩလီၫ. နမၩဖီၩ့မၩဖျ့ၭယၧၩလၧ",
			"49": "<sup>49</sup> ၦမၩဆီၪ့ဆၧလဂၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယမိစံၭ ထၪ့အၪ့အူၭနၧၩလၧၦဆၨၩၥံၪအကျၩ, ယဟိဝၩဧ့,",
			"50": "<sup>50</sup> တၭယမိအၪ့အူၭထၪ့နမံၩ့လီၫ.- အဝ့ၫဒုၭအီၪထၪ့ဆၧ ထိးထဲၩ့တၩ့ထဲၩ့ဖၭဒိၪလၧအစဎွၩအဂးတၭ, ဒုၭနဲၪ ဆၧအခိးအတၩလၧအၡၩဒိၭဂုၪအၥၭလဂၩ, လၧစဒၫ ဝံၭဒဲအချံၫအၥၪ အဆိၩဆိၩအကၠၪကၠၪလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> မူၭခိၪဒုၭဖျီၪထၪ့ယွၩအလၩအဖၩ့, ဒဲဆၧလၧအမၩ",
			"2": "<sup>2</sup> ဝ့ၫလၧအစူၪနီၪ မူၭဖိၭဖၫ့ ဒုၭနဲၪဝ့ၫလီၫ.- လနံၩဘၪ လနံၩလီၩဖျီၪထၪ့ဆၧ, ဒဲလနၩဘၪလနၩဒုၭနဲၪဆၧၥ့ၪ",
			"3": "<sup>3</sup> ယၫလီၫ.- အလးလၧဆၧအလၨအီၪမွဲဂ့ၩ, ဒဲဆၧချဲၩ့ အီၪမွဲဂ့ၩ, ဆၧလနါဂၧၫ့ဘၪအဝ့ၫၥံၪအလူနီၪ, အီၪနး",
			"4": "<sup>4</sup> စီၪ့အ့ၬ.- လၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫနီၪ အဖျံၩထိၪဆၧ လ့ၩထၪ့ဝ့ၫတၭ, အဆၧချဲၩ့နီၪထီၩ့လၧဂၪ့ခိၪအထုၬ နီၪလီၫ.တၭအဝ့ၫဒၪအီၪက့ၪတဲၩလဖျိၪ့ လၧမုအဂး",
			"5": "<sup>5</sup> လၧအဖၧၩ့နီၪလီၫ.- အဝ့ၫနီၪမၩအၥၭဘဲၫတလၭမူၭ အခွၫလၧအဂဲၫထၪ့လၧဒူၭဖၧၩ့အၥိၭနီၪတၭ, အၥုၪ့ဎွံၫ အၥၭယီၫ ဘဲၫၦအဂဲးဆီၪ့ လၧအမိစဲၪ့ပြၧၩ့အၥိၭနီၪ",
			"6": "<sup>6</sup> လီၫ.- ဂဲၫထၪ့ဝ့ၫလၧမူၭထံၭတၭလ့ၩဎဲၪ့ဝၬဝ့ၫလၧမူၭ ထံၭနီၪလီၫ. တၭလၧအဆၧခိအမ့ၬယၫနီၪ ဆၧအီၪ ဘံၭဝ့ၫနးမံၩ့အ့ၬ.",
			"7": "<sup>7</sup> ယဟိဝၩအဆၧၥီၪ့ဆၧၥၫ့နီၪ လၧၫ့ထၪ့ဎွ့ၩထၪ့တၭ, ဒုၭၥၫ့ထၪ့ထဲၩ့ပၥၭလီၫ. ယဟိဝၩအဆၧထိးအၥၭနီၪ မွဲအတီၩတၭ, ဒုၭကိၪ့ၥ့ၪၦလၧအၥၭလဖၭဘၪလီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩအၥနိၫလဖၪတီၩဝ့ၫတၭ, မၩဎွံၫထၪ့ထဲၩ့ၦၥၭ လီၫ. ယဟိဝၩအဆၧမၪလူၬနီၪဆံၫ့ဎံၪဝ့ၫတၭ, မၩဖၩ့",
			"9": "<sup>9</sup> ထၪ့ၦမ့ၬၥၪလီၫ.- ဆၧၥၭမဲၪယဟိဝၩနီၪဆံၫ့ဝ့ၫတၭ, အီၪဝ့ၫအဆိၩဆိၩအကၠၪကၠၪလီၫ. ယဟိဝၩအဆၧ စ့ၩရၫ့လဖၪနီၪမွဲဆၧတီၩတၭ, အဝ့ၫၥံၪတီၩလိၬလီၩ့လိၬ",
			"10": "<sup>10</sup> အၥၭထီးအလူၬလီၫ.- ၦၥၭကွံၩဆၧလဖၪနီၪ အလး အီၪအၪနဲၪ့ထီၫ့, ဒိၪနဲၪ့ထီၫ့ဆံၫ့အၪအၪလ့ၬလီၫ. ဆၧၫ့ နဲၪ့န့ၫစၩ့ဒဲန့ၫစၩ့လၧအလၩ့ဆၩ့ လၧအခိၪထံၫဖၧၩ့နီၪ ဒံၭလီၫ.",
			"11": "<sup>11</sup> နခ့ၫနၡၩဒိၭဆၧၥီၪ့ဆိၫဝ့ၫလၧအဝ့ၫၥံၪတၭ, ၦလၧ",
			"12": "<sup>12</sup> အထီးန့ဝ့ၫနီၪဒိၭန့အခိးအတၩဖၭဒိၪလီၫ.- တၭဆၧ ၥူၭဆၧမၪလဖၪနီၪ မွဲပလၫနၪမိၥ့ၪလဂၩလဲၪ. လၧဆၧ",
			"13": "<sup>13</sup> လဖျီၪဘၪလဖၪနီၪ, မၩဖီၩ့မၩဖျ့ၭယၧၩဆံၭ.- ပဒၩ့ထၬ နခ့ၫနၡၩ လၧဆၧမၪအဒူၩဆ့ဆံၭ. မွဲအထီးပၧၩ့ဘၪ ယၧၩလဂ့ၩ, ထီးနီၪလဖၧၫ့ယမိကဲၪၦအတီၩတၭ,ဆၧ မၪအဒိၪအယိၬအီၪအ့ၬ.",
			"14": "<sup>14</sup> ယနိၭအဆၧချဲၩ့လဖၪ, ဒဲယၥၭအဆၧဆီၫ့မီၪ့လဖၪ လၧနမ့ၬယၫနီၪ, မွဲအကဲၪဆၧဘၪနၥၭဆံၭ, ယလဲၫ့ဒဲ ဆၧဎွ့ၩန့ထဲၩ့ယၧၩ, ယဟိဝၩဧ့."
		},
		"20": {
			"1": "<sup>1</sup> လၧဆၧမၩခိမၩဝီၩအမုလနံၩနီၪ, မွဲယဟိဝၩခိၭ နၪနလူဆံၭ. မွဲစယၫကူၭအယွၩအမံၩ့နီၪအီၪက့ၪနၧၩ",
			"2": "<sup>2</sup> လၧဆၧထၪ့ထီၫဆံၭ.- မွဲအအၪ့မၧၫ့လၩ့ဆၧမၩဆၧၩ့ နၧၩလၧအလးဆံၫ့ဎံၪတၭ, ဒုၭအီၪဂုးအီၪခၧၫ့နၧၩ လၧဇံ",
			"3": "<sup>3</sup> အိၫ့နီၪဆံၭ.- နၪ့ထၪ့ထဲၩ့နဆၧမၩဘိၪ့ထီးအလူၬတၭ,",
			"4": "<sup>4</sup> ထိးဆၧၫ့နဆၧလုမ့ၪနီၪဆံၭ.- မွဲအဖ့ၪလၫ့နၧၩလၧဆၧ ထီးဒၪနၥၭတၭ, မၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ နဆၧကိၪ့ထၪ့",
			"5": "<sup>5</sup> ဖၭလၩ့ထီးအလူၬနီၪဆံၭ.- ပမိၥုၪ့ဎွံၫၥၭယီၫလၧနဆၧ ထိးထဲၩ့တၩ့ထဲၩ့အဖၧၩ့တၭ, လၧပယွၩအမံၩ့နီၪ ပမိ ဘိၭထၪ့ၥုၭဖိၪအလၫ့လီၫ. မွဲယဟိဝၩဖ့ၪလၫ့ဆၧလၧ နအၪ့ကံၩ့လဖၪထီးအလူၬဆံၭ.",
			"6": "<sup>6</sup> ဘိၩ့နဲၪ့ယီၩယၥ့ၪယၫ လၧယဟိဝၩ ထိးထဲၩ့တၩ့ ထဲၩ့အၡၩဒိၭဂုၪအၥၭလဂၩနီၪလီၫ. မိခိၭနၪဝ့ၫအလူ လၧအမူၭခိၪဆံၫ့ဎံၪတၭ, မိထိးထဲၩ့တၩ့ထဲၩ့ဆၧလၧ အစူၪထွ့ၪလီၫ.",
			"7": "<sup>7</sup> ၦလနၩ့နၩ့ဒိၭနဲၩ့အၥၭလၧလဲၪ့ၥုၭၥံၪတၭ, ၦလနၩ့ နၩ့လၧကၥ့ၪၥံၪ, အ့ၪမွဲပဝ့ၫဒၪယီၩ ပမိအၪ့အူၭလၩ့",
			"8": "<sup>8</sup> ပၥၭလၧယဟိဝၩအမံၩ့လီၫ.- အဝ့ၫၥံၪနီၪခိၬလၩ့ယူၭ ဒဲလၩ့ထံၩဖါယူၭ, အ့ၪမွဲပဝ့ၫဒၪယီၩ ပဂဲထုၪ့ထၪ့ဒဲပ အီၪထုၪ့လၧၫ့ဝ့ၫလီၫ.",
			"9": "<sup>9</sup> ယဟိဝၩဧ့, ထိးထဲၩ့တၩ့ထဲၩ့ဆၧဆံၭ, ထီးပအ့ၪ ကိၭထၪ့ဆၧလနံၩနီၪ, မွဲစဎွၩခိၭနၪပလူဆံၭ."
		},
		"21": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့,စဎွၩမိၥုၪ့ထိၬၥၭထိၬ လၧနဂဲးနဘၭအ ဖၧၩ့တၭ, လၧနဆၧထိးထဲၩ့တၩ့ထဲၩ့အဖၧၩ့နီၪ, မွဲအ",
			"2": "<sup>2</sup> ၥုၪ့ဎွံၫၥၭယီၫဆံၭဒိၪလဲၪ,- နဖ့ၪလၫ့အဝ့ၫထီးဒၪအၥၭ ဆိၫ့န့ဘၪဝ့ၫတၭ, ဆၧလၧအနိၭအၪ့ကံၩ့ဝ့ၫလဖၪနီၪ နပဒၩ့နဝ့ၫဆ့အ့ၬ.(စ့လၫ.)",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ နမၩဆိၫအဝ့ၫလၧဆၧဂ့ၩအဆၧဆိၪ ဂ့ၩလဖၪ,နအီၪက့ၪၥရဖူၩထီၫ့ဆံၫ့လၧအခိၪဎွံၪအလီၩ့",
			"4": "<sup>4</sup> လီၫ.- အဝ့ၫဒၪအၪ့ကံၩ့ဆၧမၧၫ့လၧနၧၩတၭ, နဖ့ၪလၫ့ ဝ့ၫနီၪ,ဒဲလၧအမုနံၩထီၫ အဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"5": "<sup>5</sup> အလၩအဖၩ့ဒိၪဝ့ၫ လၧနဆၧထိးထဲၩ့တၩ့ထဲၩ့အကၠီၩ့ လီၫ.ဆၧယူၭယၪ့ဒဲဆၧအကယးကဖးနီၪ နအီၪက့ၪ",
			"6": "<sup>6</sup> လၧအလီၩ့လီၫ.- အဂဲးဘဲၫယီၩနဒုၭကဲၪထၪ့အဝ့ၫလၧ ဆၧဆိၪဂ့ၩလဖၪ အဆိၩဆိၩအကၠၪကၠၪလီၫ. နဒုၭၥၭ ထိၬအၥုၪ့အၥၭလၧဆၧၥၭဎွံၫလၧနမ့ၬယၫလီၫ.",
			"7": "<sup>7</sup> အဂဲးဘဲၫယီၩစဎွၩဒိၭနဲၩ့အၥၭ လၧယဟိဝၩတၭ, လၧဆၧထၪ့ထီၫထုၬ အခိးအတၩအကၠီၩ့နီၪမိဂဲၩဝၭ ဘၪဝ့ၫဒၪအ့ၬ.",
			"8": "<sup>8</sup> နစူၪမိဒၪန့နဒုၪနဒၩထီးအလူၬတၭ, နစူၪထွ့ၪမိဒၪန့",
			"9": "<sup>9</sup> ၦလၧအမ့ၬလဲၩနၧၩလဖၪနီၪလီၫ.- ထီးနၥၭထၪ့ဆၧ တၭ,နမိအီၪက့ၪအဝ့ၫၥံၪ လၧမ့ၪဖံၫ့ချၪ အဖၧၩ့လီၫ. တၭယဟိဝၩမိအၪ့ယုလၩ့ခွံၬဝ့ၫ လၧအၥၭထၪ့ဆၧအ",
			"10": "<sup>10</sup> ဖၧၩ့တၭ, မ့ၪမိအၪ့ခွံၬဝ့ၫဒၪလီၫ.- အဝ့ၫၥံၪအဆၧၥၪနီၪ နမိမၩဂၭဂီၩ့ခွံၬ လၧဂၪ့ခိၪချိၫ့, ဒဲအချံၫအၥၪနီၪလၧၦ",
			"11": "<sup>11</sup> ၡၩအဖိၪခွၫၥံၪအကျၩလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪကိၪ့ မၩအၧၩ့နၧၩတၭ, ကိၪ့ထၪ့ဖၭလၩ့ဆၧလၧလဂ့ၩဘၪ",
			"12": "<sup>12</sup> တၭ,ကဲၪထၪ့ဝ့ၫၥ့ၪအ့ၬ.- အဂဲးဘဲၫယီၩနမိဒုၭကၠၪဒိၭ ချိၫ့အဝ့ၫၥံၪအၥၭတၭ, လၧနချံၪဖျံၩလဖၪနီၪနမိပယူၪ ထၪ့ထၫ့ဒုၪဒၩအဝ့ၫၥံၪအမ့ၬလီၫ.",
			"13": "<sup>13</sup> ယဟိဝၩဧ့, လၧနဂဲးနဘၭအကၠီၩ့နီၪ, မွဲနဘၪဆၧ အီၪက့ၪထၪ့ထီၫနၧၩဆံၭ. ပမိၥံၫကျံၩဆၧ, ဒဲစံၭထၪ့ အၪ့အူၭနစီၩ့နမၩ့ လၧထၭခိၪအဖၧၩ့လီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ယယွၩဧ့, ယယွၩဧ့, မွဲဘၪနီၫလၫလၧနစဲၪ့ဒၪယၧၩ လဲၪ, ယကိၭၡၭထၪ့အဆၧချဲၩ့လဖၪနီၪ ယဲၩ့လၧဆၧ",
			"2": "<sup>2</sup> ထိးထဲၩ့တၩ့ထဲၩ့ယၧၩလီၫ.- ယယွၩဧ့, ယကိၭထၪ့ လၧမုဆၫလခီၫတၭ, နလစံၭဆၧၫ့ဘၪ, ဒဲလၧမုနၩလ",
			"3": "<sup>3</sup> ခီၫ,ဆၧဒုၭအီၪလၩ့မါပံၭယၧၩအ့ၬ.- အ့ၪမွဲနဝ့ၫဒၪန မွဲဆံၫ့ဎံၪ,ၦလၧအအီၪ လၧအံၫစရ့လၭအစံၭထၪ့အၪ့",
			"4": "<sup>4</sup> အူၭအကျၩလဂၩဧ့,- ပဖါၥံၪဒိၭနဲၩ့အၥၭလၧနၧၩလီၫ.",
			"5": "<sup>5</sup> ဒိၭနဲၩ့အၥၭတၭ, နမၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪလီၫ.- တၭ အဝ့ၫၥံၪကိၭထၪ့ဝ့ၫလၧနၧၩတၭ, ဖီၩ့ဖျ့ၭဝ့ၫ, ဒိၭနဲၩ့",
			"6": "<sup>6</sup> အၥၭလၧနၧၩတၭ, အမ့ၬမဲအ့ၬ.- အ့ၪမွဲယဝ့ၫဒၪယီၩ ယမွဲလိၪ့လဘီၩ့, လမွဲဘၪၦၡၩတၭ,မွဲၦၡၩအဆၧဒုၪ",
			"7": "<sup>7</sup> ဒွ့ၪ,ဒဲဘၪဆၧကြၩ့ထမး လၧၦခမျၧးလီၫ.- ကယဲၦ လၧအဒၪဘၪယၧၩ လဂၩလါလါနီၪ နံဒုၪဒွ့ၪယၧၩတၭ,",
			"8": "<sup>8</sup> အၩ့ထၪ့အနိၭ ဂံၩဂုအခိၪ,- တၭစံၭဝ့ၫဒၪ, ဒိၭနဲၩ့ အၥၭလၧယဟိဝၩ လၧအမိမၩဖီၩ့မၩဖျ့ၭဝ့ၫဒၪလီၫ. မွဲအထိးထဲၩ့တၩ့ထဲၩ့ဒၪဝ့ၫဆံၭ, အဂဲးဘဲၫယီၩမုၬလၩ",
			"9": "<sup>9</sup> ဝ့ၫလၧအဝ့ၫဒၪအဖၧၩ့လီၫ.- မွဲလါနၫ့တၭ, နမၩန့ထၪ့ ယၧၩလၧဆၧဒၧၩ့လးအဖၧၩ့, လၧယအီၪလၧယမိအ",
			"10": "<sup>10</sup> နုအလီၩ့နီၪတၭ, နဒုၭဒိၭနဲၩ့ယၥၭလီၫ.- ဆၧဖ့ၪလၫ့ ယၧၩလၧနစူၪဖၧၩ့ခီၫလၧဆၧဒၧၩ့လးဖၧၩ့နီၪ, ခီၫလၧ ယမိအဂူၭဖိၫ့ဖၧၩ့နီၪ နမွဲယယွၩလီၫ.",
			"11": "<sup>11</sup> အီၪယဲၩ့လၧယၧၩလဂ့ၩ, အဂဲးဘဲၫယီၩ ဆၧမၩခိ မၩဝီၩအီၪဘူၭဝ့ၫ, အဂဲးဘဲၫယီၩ ဆၧမၩဆၧၩ့လအီၪ ဘၪနးဂၩလီၫ.",
			"12": "<sup>12</sup> တၭချီဖၫ အီၪဝၬဖီၩ့ယၧၩအၪဒုၩတၭ, ဘၫၡၫ့အ",
			"13": "<sup>13</sup> ဆၧဆီၪ့လဖၪဝၩ့ထၬယၧၩလီၫ.- အဝ့ၫၥံၪအၩ့ထၪ့အ နိၭလၧယလီၩ့, ဆၬလၥၧၫ့ လၧအအဲၪ့ ၡၫ့ခွံၬဆၧဒဲ",
			"14": "<sup>14</sup> ယုၩ့ဆၧလီၫ.- ဆၧလူၫလၩ့ခွံၬယၧၩ ဘဲၫထံၫအၥိၭ နီၪ,ယဎွံၪလဖၪလၩ့ဖၭလိၬအၥၭ, ယၥၭမၩအၥၭဘဲၫ",
			"15": "<sup>15</sup> ဎိၭအၥိၭ,ဖံထၪ့ဝ့ၫလၧယအီၩ့ဖၧၩ့နီၪလီၫ.- ယဂဲးယ ဘၭဎဲၫ့ထၪ့ခွံၬဘဲၫဖၧၩ့ကဲၩ့အၥိၭနီၪတၭ, ယဖျ့ၩဘုၭ ထၬလၧယခၪဎွံၪတၭ, နအီၪက့ၪလၩ့ယၧၩလၧဆၧၥံၫ",
			"16": "<sup>16</sup> အဂၪ့ခိၪမုၬအကျၩလီၫ.- အဂဲးဘဲၫယီၩထွံၪၥံၪအီၪဝၬ ဖီၩ့ယၧၩ, ၦအၧၩ့အဆၧအီၪကီၪ့နီၪဝၩ့ထၬယၧၩတၭ,",
			"17": "<sup>17</sup> ဆ့ၭဖိးယစူၪဒဲယခၪ့လီၫ.- ယဝံထၪ့နၬထၪ့ယဎွံၪလ ဖၪထီးအလူၬၥ့ၪတၭ, အဝ့ၫၥံၪယိဝ့ၫတၭ, ယိဖၧၩ့ဝ့ၫ",
			"18": "<sup>18</sup> လၧယၧၩလီၫ.- ၦလဖၪအၪ့နၩ့ဖၭ ယကီၩ့ယၥိၭလၧ အဝ့ၫၥံၪအကျၩတၭ, ဖၭဝ့ၫလၧယဆဲၫ့အဂးလီၫ.",
			"19": "<sup>19</sup> အ့ၪမွဲနဝ့ၫဒၪယဟိဝၩဧ့, အီၪယဲၩ့လၧယၧၩလဂ့ၩ,",
			"20": "<sup>20</sup> ယဂဲးယဘၭဧ့, ဂဲၫမၩဆၧၩ့ယၧၩချဲၫ့ချဲၫ့ဆံၭ.- မၩ ဖီၩ့မၩဖျ့ၭယၥၭ လၧနၭၥံၪဖၩ့ၥံၪ, ယၥၭမၧၫ့ယီၩလၧ",
			"21": "<sup>21</sup> ထွံၪအစူၪဖၧၩ့ဆံၭ.- မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧဆၬ လၥၧၫ့အနိၭနီၪဆံၭ, အဂဲးဘဲၫယီၩ လၧချီဖၫမံၩ့ အ နိၩ့နီၪ,နနါဂၧၫ့ယူၭ ယလူ ဎဒဲမၩဖီၩ့မၩဖျ့ၭယၧၩၭလီၫ.",
			"22": "<sup>22</sup> ယမိလီၩဘၪယထၧၫ့ဖုဝဲလၧနမံၩ့, ယမိစံၭထၪ့အၪ့",
			"23": "<sup>23</sup> အူၭနၧၩ လၧဆၧအီၪကီၪ့အၥၭကျၩနီၪလီၫ.- ၦလၧအ ၥၭမဲၪယဟိဝၩဧ့, စံၭထၪ့အၪ့အူၭဝ့ၫဆံၭ, ကယဲစယၫ ကူၭအချံၫအၥၪထီးအလူၬၥံၪဧ့, မၩလၩမၩဖၩ့ၡီၩ့အ ဝ့ၫဆံၭ,ကယဲအံၫစရ့ၭလၭ အချံၫအၥၪထီးအလူၬၥံၪဧ့,",
			"24": "<sup>24</sup> ၥၭမဲၪအဝ့ၫနီၪဆံၭ.- အဂဲးဘဲၫယီၩ အဝ့ၫလမၩကြၩ့ ထမးဘၪတၭ, ၥၭလိၪၦဘၪၡၪ့ဘၪနၭ အဆၧၡၪ့ဆၧ နၭဆ့အ့ၬ. တၭအီၪက့ၪၥူၪခွံၬအမ့ၬ လၧအဝ့ၫဒၪဆ့ အ့ၬ.အ့ၪမွဲထီးအဝ့ၫဒၪအၪ့ယၫဆၧနီၪတၭ, ခိၭနၪအ",
			"25": "<sup>25</sup> လူလီၫ.- ယစံၭထၪ့အၪ့အူၭနၧၩနီၪ ၦမိနါဂၧၫ့ဝ့ၫလၧ ဆၧအီၪကီၪ့ဖၭဒိၪအဖၧၩ့, ယမိမၩဘိၪ့ဆၧဘၪဆဲၫ့ လၧယဆၧဆိၪလၩ့ယၥၭလဖၪ လၧၦလၧအၥၭမဲၪအ",
			"26": "<sup>26</sup> ဝ့ၫနီၪအမ့ၬယၫလီၫ.- ၦၡၪ့ဖိၪယၬဖိၪမိအၪ့ဆၧဒဲဘျဲၩ အၪ့ဝ့ၫတၭ, ၦလၧအအၪ့ဎၬယဟိဝၩလဖၪနီၪ, မိစံၭ ထၪ့အၪ့အူၭအဝ့ၫ,မွဲနၥံၪအၥၭမၧၫ့ဝ့ၫ အဆိၩဆိၩအ",
			"27": "<sup>27</sup> ကၠၪကၠၪနီၪဆံၭ.- ကယဲဂၪ့ခိၪအထုၬ ထီးအလူၬမိနၪ့ ထၪ့ထဲၩ့တၭ, မိကၠၪအၥၭ လၧယဟိဝၩအအီၪတၭ, ၦဆၨၩအဂံၪ့အဒီၪ့ၥံၪ ထီးအလူၬ မိဘိၪ့ထၪ့ဘၩထၪ့",
			"28": "<sup>28</sup> ဆၧလၧနမ့ၬယၫလီၫ.- အဂဲးဘဲၫယီၩ ဘၩ့မုးနီၪမွဲယ ဟိဝၩအဆၧလီၫ. တၭအဝ့ၫဒၪ ပၧၩ့ဘၪဆၧ လၧၦ",
			"29": "<sup>29</sup> ဆၨၩၥံၪအကျၩလီၫ.- ကယဲၦအလၧၫ့အဎွ့ၩလၧဂၪ့ ခိၪချိၫ့ထီးအလူၬမိအၪ့ဝ့ၫတၭ, ဘၩထၪ့ဝ့ၫနီၪ,ကယဲ ၦလၧအလ့ၩလၩ့လၧဂၪ့ခိၪမုၬအကျၩထီးအလူၬ, ဒဲၦ လၧအဒုၭမၧၫ့အၥၭလၥ့ၪဘၪနီၪ, မိၡီၫ့လၩ့အၥၭ လၧအဝ့ၫဒၪအမ့ၬယၫလီၫ.",
			"30": "<sup>30</sup> ဆၧအချံၫအၥၪမိမၩအဆၧတၭ, ဆၧမိလီၩဘၪၦအ",
			"31": "<sup>31</sup> ဆိၩၥံၪ လၧအကဆါအဂဲးလီၫ.- အဝ့ၫၥံၪမိဂဲၫတၭ, ဒုၭနဲၪဆၧတီၩဆၧလီၩ့ လၧၦခမျၧးလၧအမိအီၪဖျဲၪနီၪ, အဂဲးဘဲၫယီၩအဝ့ၫဒၪမၩဝ့ၫလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> ယဟိဝၩမွဲယၡၩယူၬၥိၪတၭ, ဆၧဆိၫ့န့ဘၪယၥၭ",
			"2": "<sup>2</sup> လၧဆၧလမံၩ့မံၩ့အလးအီၪအ့ၬ.- တၭအဝ့ၫဒၪဒုၭမံၫ နၩ့ယၧၩ လၧဆၧအၪ့အဆၪ အလးၥံၫ့ဆ့ၬအကျၩနီၪ",
			"3": "<sup>3</sup> တၭ,ၥိၫ့ယၧၩလၧထံၫဂုးအနဲၩ့ထံၭနီၪလီၫ.- ဒုၭမၧၫ့ ယၥၭတၭ,ၥိၫ့ယၧၩလၧဖၧၩ့ၥၭ အတီၩအလီၩ့ လဖၪ အဖၧၩ့လၧအမံၩ့အကၠီၩ့လီၫ.",
			"4": "<sup>4</sup> ထီးယအ့ၪလ့ၩလါနၫ့ လၧဆၧၥံၫအလၩၡုၪ အခိၪ လီၩ့ဆူၭဖၧၩ့နီၪ, ယၥၭမဲၪဆၧအၧၩ့နးမံၩ့အ့ၬ. အဂဲး ဘဲၫယီၩနအီၪလၧယၥိၭလီၫ. နနိၪပုၭ ဒဲနနိၪထိၭနီၪ မၩမုၬထၪ့ယၧၩလီၫ.",
			"5": "<sup>5</sup> နတဲၩ့ဝဲၩစပွဲလၧယဂးလၧ ယဒုၪယဒၩၥံၪအမ့ၬ ယၫလီၫ. နဂုၪယခိၪလၧၥိၪ, ယထွ့ၫလဘံၪ့ဎွ့ၩလၨၪ ခွံၬဝ့ၫဒၪလီၫ.",
			"6": "<sup>6</sup> ကယဲဆၧဂ့ၩ ဒဲဆၧအခိးအတၩနီၪ မိဖိၬယခဲၫ့ လဆိၩဒၪယၥၭတၭ, ယမိအီၪဂုးခၧၫ့ လၧယဟိဝၩ အဂံၪ့ဖၧၩ့ အဆိၩဆိၩအကၠၪကၠၪလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> ဂၪ့ခိၪဒဲဆၧလၧအမၩဎွ့ၩဝ့ၫနီၪ မွဲယဟိဝၩအဆၧ, ဂၪ့ခိၪဒဲၦအီၪဝ့ၫလၧအဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩမွဲအ အီၪက့ၪလၩ့ဝ့ၫအခၪ့ထံၭ လၧမၫဆမံၭအဖၫ့ခိၪတၭ, ဒုၭအီၪခၧၫ့ဝ့ၫလၧထံၫလုၬဘံၭ ဆၧအဖၫ့ခိၪနီၪလီၫ.",
			"3": "<sup>3</sup> တၭမွဲပလၫမိလ့ၩထၪ့ထီၩ့ လၧယဟိဝၩအခိၪလီၩ့ လဂၩလဲၪ. တၭမွဲပလၫမိဆၧၫ့ထုၪ့လၧအလးဆံၫ့ဎံၪ အဖၧၩ့နီၪလဂၩလဲၪ.",
			"4": "<sup>4</sup> ၦလၧအစူၪဆံၫ့ဒဲအၥၭဆံၫ့ဎံၪဝ့ၫ, လၧအလၥိၫ့ထၪ့ ဘၪအၥၭလၧဆၧပျီၩပျီၩတၭ, လဆိၪလၩ့ဘၪအၥၭ",
			"5": "<sup>5</sup> လၧအၪ့လီၫဆၧအဖၧၩ့နီၪလီၫ.- အဝ့ၫဒၪမိဒိၭန့ဆၧ ဆိၪဂ့ၩလၧယဟိဝၩ, ဒဲဆၧတီၩဆၧလီၩ့ လၧအဆၧ ထိးထဲၩ့တၩ့ထဲၩ့အယွၩလီၫ.",
			"6": "<sup>6</sup> အယီၩမွဲၦလဆိၩလၧအအၪ့ဎၬအဝ့ၫဒၪ, ၦလၧအ အၪ့ဎၬနမ့ၬမွဲယၫကူၭလီၫ.(စ့လၫ.)",
			"7": "<sup>7</sup> ဘဲၫၥိၭဆၧလၩဖၩ့ အစဎွၩ မိလ့ၩနုၬဝ့ၫဒၪတၭ,မိၬ ထၪ့နၥံၪအခိၪဘီၪ တရၫ့ၥံၪဧ့, ဒဲဆိၬထၪ့ထီၫနၥံၪအ ၥၭဘီၪ, တရၫ့အဆိၩအကၠၪၥံၪဧ့.",
			"8": "<sup>8</sup> တၭဆၧလၩဖၩ့အစဎွၩလဂၩနီၪ, မွဲပလၫလဂၩ လဲၪ.ယဟိဝၩအဂဲးဆီၪ့အဘၭဆီၪ့တၭ, အီၪလၧအ စီၩ့အမၩ့, ယဟိဝၩအီၪလၧအစီၩ့အမၩ့ လၧဆၧဒုၭၥုၭ အဖၧၩ့နီၪလီၫ.",
			"9": "<sup>9</sup> ဘဲၫၥိၭဆၧလၩဖၩ့ အစဎွၩမိလ့ၩနုၬဝ့ၫဒၪတၭ, မိၬ ထၪ့နၥံၪအခိၪဘီၪ, တရၫ့ၥံၪဧ့,ဒဲဆိၬထၪ့ဆၧဘီၪ, တ ရၫ့အဆိၩအကၠၪၥံၪဧ့,",
			"10": "<sup>10</sup> တၭဆၧလၩဖၩ့အစဎွၩလဂၩနီၪ, မွဲပလၫလဂၩ လဲၪ.ဆၧၥုၭမုခမျၧးအယဟိဝၩ, အဝ့ၫဒၪနီၪ မွဲဆၧ လၩဖၩ့အစဎွၩလီၫ. (စ့လၫ.)"
		},
		"25": {
			"1": "<sup>1</sup> ယယွၩဧ့, ယဒိၭနဲၩ့ယၥၭလၧနၧၩလီၫ. မွဲယမ့ၬထီးဘၪမဲလဂ့ၩ. မွဲယဒုၪယဒၩ ထီးၥုၪ့ထိၬၥၭထိၬ လၧယဖၫ့ခိၪလဂ့ၩ.",
			"3": "<sup>3</sup> မွဲမၬ, ၦလၧအယိလါဆၧလၧနၧၩလဖၪနီၪ, မွဲအထီး မ့ၬမဲဘၪနးဂၩလဂ့ၩ. ၦလဖၪလၧအမၩမၪဆၧတၭ,",
			"4": "<sup>4</sup> အၪ့လီၫဆၧပျီၩပျီၩနီၪမိဘၪဆၧမ့ၬမဲလီၫ.- ယဟိဝၩ ဧ့,ဒုၭၥ့ၪယၫယၧၩ လၧနဖၧၩ့ၥၭလဖၪနီၪဆံၭ. ၥီၪ့လိၪ",
			"5": "<sup>5</sup> ယၧၩလၧနဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭဆံၭ.- ဒုၭလ့ၩယၧၩလၧန ဆၧမွဲဆၧတီၩအဖၧၩ့, ဒဲၥီၪ့လိၪယၧၩဆံၭ. အဂဲးဘဲၫ ယီၩနမွဲဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩ အယွၩတၭ,ယယိ",
			"6": "<sup>6</sup> လါဆၧလၧနၧၩ ၥံၫ့ၥံၫ့နံၩလီၫ.- ယဟိဝၩဧ့,နၪ့ထၪ့ ထဲၩ့နဆၧယၫ့ၥၭလဖၪ, ဒဲနခိးနတၩလဖၪဆံၭ. အဂဲး",
			"7": "<sup>7</sup> ဘဲၫယီၩ အဝ့ၫၥံၪအီၪခီၫလၧဖျိၩ့လီၫ.- ယဖိၪၥၪခွၫ ထၪ့အဆၧဒဲၩဘၭဒဲယဆၧမၪလဖၪနီၪ နၪ့ထၪ့ထဲၩ့လ ဂ့ၩ.တၭဘဲၫနခိးနတၩအၥိၭနီၪ နၪ့ထၪ့ထဲၩ့ယၧၩလၧ နဆၧဂ့ၩအကၠီၩ့ဆံၭ, ယဟိဝၩဧ့,",
			"8": "<sup>8</sup> တၭယဟိဝၩနီၪ မွဲဆၧဂ့ၩဆၧဘွၩ, ဒဲဆၧတီၩဆၧ လီၩ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ, မိဒုၭနဲၪၦဆၧဒဲၩဘၭ",
			"9": "<sup>9</sup> ဖိၪလၧဖၧၩ့ၥၭလီၫ.- အဝ့ၫဒၪမိၥိၫ့ၦအၥၭဆၧၩ့လဖၪ လၧဆၧတီၩဆၧလီၩ့အဖၧၩ့ ဒဲဒုၭနဲၪအဖၧၩ့ၥၭလၧၦ အၥၭဆၧၩ့လဖၪလီၫ.",
			"10": "<sup>10</sup> တၭယဟိဝၩအဖၧၩ့ၥၭ ထီးအလူၬ မွဲဆၧအခိး အတၩ, ဒဲဆၧမွဲဆၧတီၩ လၧၦလၧအထီးန့ အဆၧအုၩ့",
			"11": "<sup>11</sup> လၩ့ဒဲအဆၧထိးအၥၭလဖၪနီၪအဂးလီၫ.- လၧနမံၩ့ အကၠီၩ့နီၪယဟိဝၩဧ့, ဖျါခွံၬယဆၧမၪဆံၭ, အဂဲး",
			"12": "<sup>12</sup> ဘဲၫယီၩမွဲအဒိၪအယိၬလီၫ.- ၦလၧအၥၭမဲၪယဟိဝၩ လဂၩနီၪ, မွဲပလၫလဂၩလဲၪ, တၭဆၧမိနဲၪလိၪအဝ့ၫ",
			"13": "<sup>13</sup> ဒၪဖၧၩ့ၥၭလၧအကြၨၭရွံန့ဝ့ၫ လဘီၩ့နီၪလီၫ.- အၥၭအီၪ ဝ့ၫလၧဆၧဂ့ၩအဖၧၩ့တၭ, အချံၫအၥၪမိန့ၥၫထံၫၥံၪ ခးၥံၪလီၫ.",
			"14": "<sup>14</sup> ယဟိဝၩအဆၧအီၪၥူၪနီၪ အီၪလၧၦလၧအၥၭမဲၪဝ့ၫ အဂးလီၫ. တၭမိဒုၭၥ့ၪယၫအဝ့ၫၥံၪ လၧအဆၧအုၩ့",
			"15": "<sup>15</sup> လၩ့နီၪလီၫ.- ယမ့ၬၥၪယိဆၧလၧယဟိဝၩနီၪလထံၪ ဎးတၭ, အဂဲးဘဲၫယီၩ အဝ့ၫဒၪနီၪဒုၭဂၭဖျ့ၭထၪ့ခွံၬယ",
			"16": "<sup>16</sup> ခၪ့လၧဖျံၩခွၩ့အဖၧၩ့လီၫ.- ကၠၪနၥၭလၧယအီၪတၭ, ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩဆံၭ, အဂဲးဘဲၫယီၩ ယအီၪယူ",
			"17": "<sup>17</sup> တၭ,ယဘၪၡၪ့ဘၪနၭဆ့လီၫ.- ယၥၭအဆၧခိဆၧဝီၩ နီၪအၪထၪ့ဝ့ၫလီၫ. ဒုၭဂၭထၪ့ခွံၬယၧၩလၧဆၧခိဆၧ",
			"18": "<sup>18</sup> ဝီၩအဖၧၩ့နီၪဆံၭ.- ယိလၩ့ယဆၧၡၪ့ဆၧနၭ, ဒဲဆၧခိ",
			"19": "<sup>19</sup> ဆၧဝီၩတၭ, ဖျါခွံၬယဆၧဒဲၩဘၭထီးအလူၬဆံၭ.- ယိ လၩ့ယဒုၪယဒၩလဖၪဆံၭ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအီၪ အၪဂၩတၭ, မ့ၬလဲၩယၧၩလၧဆၧမ့ၬလဲၩမၩအၧၩ့ဆၧ",
			"20": "<sup>20</sup> လီၫ.- ယိထဲၩ့ခွါထဲၩ့ယၥၭတၭ မၩဖီၩ့မၩဖျ့ၭယၧၩ ဆံၭ,တၭမွဲယမ့ၬထီးဘၪမဲလဂ့ၩ, အဂဲးဘဲၫယီၩယ ဒိၭနဲၩ့ယၥၭလၧနၧၩလီၫ.",
			"21": "<sup>21</sup> မွဲဆၧလၧၫ့ဆၧဎွ့ၩဒဲဆၧဆုးလီၩ့နီၪ ပၧၩ့ဘၪယၧၩ ဆံၭ,အဂဲးဘဲၫယီၩ ယယိလါဆၧလၧနၧၩလီၫ.",
			"22": "<sup>22</sup> ယွၩဧ့, ဎွ့ၩန့ထဲၩ့ အံၫစရ့လၭ လၧအဆၧခိဆၧ ဝီၩထီးအလူၬအဖၧၩ့ဆံၭ."
		},
		"26": {
			"1": "<sup>1</sup> စ့ၩရၫ့ယၧၩဆံၭ, ယဟိဝၩဧ့, အဂဲးဘဲၫယီၩယလ့ၩ ယူၭလၧယဆၧလၧၫ့ဆၧဎွ့ၩအဖၧၩ့ယူၭ, ဒဲယဒိၭနဲၩ့ ယူၭယၥၭ လၧယဟိဝၩယူၭတၭ, ယဂဲၩယဝၭလၧၩ့",
			"2": "<sup>2</sup> အ့ၬ.- မၩခွါယၧၩ, ယဟိဝၩဧ့,စီၩ့ယိယၧၩဆံၭ. မၩ",
			"3": "<sup>3</sup> ဆံၫ့မၩဎံၪယၥုၪ့ယၥၭဆံၭ.- အဂဲးဘဲၫယီၩနဆၧအဲၪ အခိးအတၩ အီၪဖျီၪလၧယမ့ၬယၫတၭ, ယလ့ၩယူၭ",
			"4": "<sup>4</sup> လၧနဆၧမွဲဆၧတီၩ အဖၧၩ့လီၫ.- ယလဆၧၩ့နၩ့ဘၪ လၧၦအဘျံၭအဘျၪအၥိၭတၭ, ယမိလ့ၩနုၬလၧၦအၪ့",
			"5": "<sup>5</sup> လီၫဆၧအအီၪနီၪဆ့အ့ၬ.- တၭယမ့ၬလဲၩယူၭ ၦမၩ ဆၧအၧၩ့အဆၧအီၪကီၪ့တၭ, ယမိဆၧၫ့နၩ့လၧၦလ",
			"6": "<sup>6</sup> တီၩလလီၩ့ဘၪအၥိၭအ့ၬ.- ယမိၥူၫဝၭခွံၬယစူၪလၧ ဆၧဒဲၩဘၭလအီၪဘၪအဖၧၩ့တၭ, ယမိအီၪဝၬဖီၩ့န",
			"7": "<sup>7</sup> ဆၧလုအလးနီၪယဟိဝၩဧ့,- ဘဲၫၥိၭယမိဒုၭနါဂၧၫ့ ဆၧစံၭထၪ့အၪ့အူၭအၥီၫ, ဒဲလီၩလၩ့လၬလၩ့ကယဲန",
			"8": "<sup>8</sup> ဆၧမၩလၩ့လၭထီးအလူၬလီၫ.- ယဟိဝၩဧ့, ယအဲၪ နဂံၪ့အလး ဒဲဆၧအလးထီးနလၩနဖၩ့ အီၪဝ့ၫလစီၪ့ နီၪလီၫ.",
			"9": "<sup>9</sup> တၭအီၪက့ၪကီၪ့ယၥၭ လၧၦဆၧဒဲၩဘၭဖိၪအၥိၭ, ဒဲယၥၭမၧၫ့ လၧၦၡၩဘၪဆဲၫ့လၧဆၧၥွံၪ အၥိၭနီၪလ",
			"10": "<sup>10</sup> ဂ့ၩ.- ဆၧမၩအၧၩ့အီၪလၧအစူၪဖၧၩ့တၭ, အစူၪထွ့ၪ နီၪဎွ့ၩဝ့ၫလၧလၬဆီၪ့လဖၪလီၫ.",
			"11": "<sup>11</sup> အ့ၪမွဲယဝ့ၫဒၪ ယမိလ့ၩလၧယဆၧလၧၫ့ဆၧဎွ့ၩအ ဖၧၩ့တၭ, ဎွ့ၩန့ထဲၩ့ယၧၩ, ဒဲယၫ့ၥုၪ့ယၫ့ၥၭယၧၩဆံၭ.",
			"12": "<sup>12</sup> ယခၪ့ဆၧၫ့ထုၪ့လၧအလးအီၪဎၩ့ဝ့ၫတၭ, ယမိစံၭ ထၪ့အၪ့အူၭယဟိဝၩ လၧဆၧအီၪကီၪ့ၥံၪအဖၧၩ့လီၫ."
		},
		"27": {
			"1": "<sup>1</sup> ယဟိဝၩမွဲယဆၧဖၩ့, ဒဲယဆၧထိးထဲၩ့တၩ့ထဲၩ့ တၭ, ယမိၥၭမဲၪပလၫလဂၩလဲၪ. ယဟိဝၩမွဲယၥၭ မၧၫ့အဂဲးအဘၭတၭ, ယမိၥၭမဲၪပလၫလဂၩလဲၪ.",
			"2": "<sup>2</sup> ထီးၦလတီၩလလီၩဘၪ ၥုၭဘူၭအၥၭထၫ့ဒုၪဒၩယၧၩ, ဘဲၫၥိၭအမိအၪ့ခွံၬယဖံၭယယၪ, ၦမၩခိမၩဝီၩယၧၩ, ယဒုၪယဒၩလဖၪနီၪ, အဝ့ၫၥံၪအခၪ့ဘၪထၧၩ့ဒဲလၩ့",
			"3": "<sup>3</sup> ထံၩဖါဝ့ၫဒၪလီၫ.- ၥုၭမုခမျၧးအ့ၪၥုၪ့တဲၩထၫ့ဒုၪဒၩ ယၧၩလါနၫ့ဘိၩ, ယလၥၭမဲၪဘၪ, ၦဒုၭၥုၭအ့ၪဂဲထုၪ့ ထၫ့ဒုၪဒၩယၧၩလါနၫ့တၭ, ယမိဒိၭနဲၩ့ယၥၭလၧဆၧ",
			"4": "<sup>4</sup> ယီၩလမံၩ့အဖၧၩ့လီၫ.- ယအၪ့ကံၩ့ယူၭဆၧလမံၩ့ လၧယဟိဝၩလီၫ. ဆၧနီၪလမံၩ့ယအၪ့ဎူၫအၪ့ဎၬန့, ဘဲၫၥိၭယမိအီၪဂုးခၧၫ့ လၧယဟိဝၩအဂံၪ့ဖၧၩ့လဆိၩ ဒၪယၧၩ ဘဲၫယမိယိဆၧဖျီၪဎံၫဖျီၪလၩဘၪဆဲၫ့လၧယ",
			"5": "<sup>5</sup> ဟိဝၩ ဒဲအၪ့စၪ့ဆၧလၧအနီးဖၧၩ့နီၪလီၫ.- အဂဲးဘဲၫ ယီၩလၧမုနံၩမုနၩ အအၧၩ့အၥၫ့နီၪ အဝ့ၫမိမၩဘံၭ ယၧၩလၧအတဲၩဖၧၩ့တၭ, မိအီၪက့ၪၥူၪယၧၩလၧအ လးအီၪလၧယၫလၧတဲၩဆံၫ့ဎံၪအဖၧၩ့နီၪလီၫ. မိအီၪ",
			"6": "<sup>6</sup> က့ၪထၪ့ထီၫယၧၩ လၧလဲၫ့လဖျိၪ့အဖၫ့ခိၪလီၫ.- ဘိၩ့ နဲၪ့ယီၩ ယခိၪမိအီၪထၪ့ထီၫ လၧယဒုၪယဒၩဝၬဖီၩ့ ယၧၩအဖၫ့ခိၪတၭ, ယမိလုထၪ့ဆၧၥုၪ့ဎွံၫၥၭယီၫအ ဆၧလုလၧအတဲၩဆံၫ့ဎံၪဖၧၩ့တၭ, ယမိဆၬထၪ့ယလူ, ဒဲၥံၫကျံၩစံၭထၪ့အၪ့အူၭယဟိဝၩလီၫ.",
			"7": "<sup>7</sup> ထီးယအ့ၪကိၭထၪ့လၧယလူတၭ, ခိၭနၪဆံၭ,ယ",
			"8": "<sup>8</sup> ဟိဝၩဧ့, ယၫ့ၥၭယၧၩတၭ, စံၭဆၧၫ့ယၧၩဆံၭ.- ထီး နစံၭ,အၪ့ဎၬယမ့ၬဆံၭ. ယၥၭစံၭယူၭနၧၩ, ယဟိဝၩ",
			"9": "<sup>9</sup> ဧ့,နမ့ၬနီၪယမိအၪ့ဎၬလီၫ.- ထီးအီၪက့ၪၥူၪခွံၬ နမ့ၬ လၧယၧၩလဂ့ၩ, နၫ့ထၪ့ခွံၬနခ့ၫနၡၩ လၧနၥၭထၪ့လ ဂ့ၩ.နမွဲယူၭဆၧမၩဆၧၩ့ယၧၩလီၫ. တၭထီးခွံၬၡိၭ ယၧၩလဂ့ၩ,ထီးစဲၪ့ဒၪယၧၩလဂ့ၩ, ဆၧထိးထဲၩ့တၩ့ ထဲၩ့ယၧၩ,ယွၩဧ့.",
			"10": "<sup>10</sup> ထီးယမိဒဲယဖါအ့ၪစဲၪ့ဒၪယၧၩတၭ, ထီးနီၪလ",
			"11": "<sup>11</sup> ဖၧၫ့ယဟိဝၩမိမၩန့ထၪ့ယၧၩလီၫ.- ယဟိဝၩဧ့, ဒုၭ နဲၪယၧၩလၧနဖၧၩ့ၥၭတၭ, ၥိၫ့ထၪ့ယၧၩလၧဖၧၩ့ၥၭလီၩ့",
			"12": "<sup>12</sup> လဘီၩ့အဖၧၩ့လၧယဒုၪယဒၩအကၠီၩ့နီၪဆံၭ.- တၭ ထီးဖ့ၪလၫ့ခွံၬယၧၩ ဘဲၫယဒုၪယဒၩအၥၭအီၪဝ့ၫအ ၥိၭနီၪလဂ့ၩ, အဂဲးဘဲၫယီၩ ၦထိးအၥၭလၧဆၧအ ဘျံၭအဘျၪတၭ, ၥၪထၪ့ဆၧမၩအၧၩ့လဖၪနီၪ ဂဲထုၪ့ ထၫ့ဒုၪဒၩယူၭယၧၩယူၭ.",
			"13": "<sup>13</sup> ယအ့ၪလနဲၩဘၪ လၧယမိဒၪဘၪ ယဟိဝၩအဆၧ",
			"14": "<sup>14</sup> ဂ့ၩလၧဆၧမၧၫ့အခးဖၧၩ့တၭ,- ယိလါဆၧလၧယဟိ ဝၩဆံၭ, အီၪက့ၪဒုုၩနၥၭ, ဒဲမၩဆီၪ့ထၪ့နၥၭအဂဲးအ ဘၭဆံၭ,တၭယိလါဆၧ လၧယဟိဝၩဆံၭ."
		},
		"28": {
			"1": "<sup>1</sup> ယမိကိၭထၪ့နၧၩယဟိဝၩဧ့, ယလဲၫ့လဖျိၪ့ဧ့, ဒိၭ အၧၩ့နနါ လၧယၧၩလဂ့ၩ. နအ့ၪအီၪလၩ့မါပံၭ လၧ ယၧၩတၭ, ယမိမၩဘၪခိၬယၥၭ ဘဲၫၦလၧအလ့ၩလၩ့ လၧဖျႃဖၧၩ့ အၥိၭနီၪလီၫ.",
			"2": "<sup>2</sup> ထီးယအ့ၪအၪ့ယၫနၧၩ ထီးယယူၬထၪ့ယစူၪလၧ နဒုၭချဲၩ့ဆၧဆံၫ့ဎံၪအအီၪတၭ, ခိၭနၪယအၪ့ယၫဆၧ",
			"3": "<sup>3</sup> အလူဆံၭ.- မွဲနထီးထုၭထၪ့ခွံၬယၧၩအီၪလၧၦလတီၩ လလီၩ့ဘၪအၥိၭလဂ့ၩ, အဝ့ၫၥံၪမၩဆၧအၧၩ့ လါနၫ့ တၭ,ချဲၩ့မုၬဆၧလၧၦအီၪလၧအနဲၩ့ထံၭၥံၪတၭ, ဆၧ",
			"4": "<sup>4</sup> အၧၩ့အီၪလၧအၥၭခံဖၧၩ့လီၫ.- ဖ့ၪလၫ့ဆၧလၧအဝ့ၫ ၥံၪဘဲၫအမၩဆၧအၥိၭ ဒဲဘဲၫအမၩဆၧအၧၩ့အၥိၭနီၪ ဆံၭ.ဖ့ၪလၫ့အဝ့ၫၥံၪ ဘဲၫအမၩဆၧ လၧအစူၪအၥိၭ နီၪ,ဒုၭန့ထဲၩ့အဝ့ၫၥံၪလၧဆၧအကြၨၭန့ဘၪနီၪဆံၭ.",
			"5": "<sup>5</sup> အဝ့ၫၥံၪလဒူၩလယၪ့ဘၪ ယဟိဝၩအဆၧမၩ, ဒဲအမၩ ဆၧလၧအစူၪနီၪဒူၩယၪ့ဆ့အ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫဒၪမိမၩဂၭဂီၩ့ခွံၬ အဝ့ၫၥံၪတၭ, မၩထၪ့ထဲၩ့ဝ့ၫ ဆ့အ့ၬ.",
			"6": "<sup>6</sup> မွဲယဟိဝၩဘၪဆၧစံၭထၪ့အၪ့အူၭဝ့ၫဆံၭ, အဂဲးဘဲၫ ယီၩ အဆၧခိၭနၪယူၭယအၪ့ကံၩ့ဆၧအၥီၫယူၭ,တၭ",
			"7": "<sup>7</sup> ယဟိဝၩမွဲယဂဲးယဘၭ,ဒဲယထၩ့ဖံၭလဘံၪ့လီၫ.- ယ ၥၭဒိၭနဲၩ့အၥၭ လၧအစူၪဖၧၩ့တၭ, ယန့ဘၪဆၧမၩ ဆၧၩ့ယၧၩ, မၩအၥၭဘဲၫနီၪတၭ,ယၥုၪ့ဎွံၫၥၭယီၫလၧ ယၥၭတၭ, ယမိစံၭထၪ့အၪ့အူၭအဝ့ၫ လၧယဆၧၥံၫ",
			"8": "<sup>8</sup> ကျံၩနီၪလီၫ.- ယဟိဝၩမွဲအဝ့ၫၥံၪ အဆၧဂဲးဆၧဘၭ ဒဲအၡၩဒိၭဂုၪအၥၭ အဆၧထိးထဲၩ့တၩ့ထဲၩ့ အထိၬ",
			"9": "<sup>9</sup> လီၫ.- ထိးထဲၩ့တၩ့ထဲၩ့နၡၩခမျၧးဆံၭ, ဆိၪဂ့ၩနဆၧ န့ၥၫဆံၭ, ယိထဲၩ့ခွါထဲၩ့ဝ့ၫ, ဒဲဆိၬထၪ့အဝ့ၫၥံၪအဆိၩ ဆိၩအကၠၪကၠၪဆံၭ."
		},
		"29": {
			"1": "<sup>1</sup> ဖ့ၪလၫ့ဆၧလၧယဟိဝၩ, ယွၩအဖိၪခွၫၥံၪဧ့, ဖ့ၪလၫ့ ဆၧလၩဖၩ့ ဒဲဆၧဂဲးဆၧဘၭ လၧယဟိဝၩနီၪဆံၭ.",
			"2": "<sup>2</sup> ဖ့ၪလၫ့ယဟိဝၩအမံၩ့အလၩအဖၩ့ လၧအနၫ့ဆါဒၪ ဝ့ၫအဂးတၭ, ဘၩထၪ့ယဟိဝၩ လၧဆၧဆံၫ့ဎံၪအဎံၫ အလၩနီၪဆံၭ.",
			"3": "<sup>3</sup> တၭယဟိဝၩအလူအီၪဝ့ၫလၧထံၫအဖၫ့ခိၪတၭ, ဆၧ လၩဖၩ့အယွၩအလၫ့ၥီၫတၭ, ယဟိဝၩအီၪလၧထံၫ",
			"4": "<sup>4</sup> အၪအဖၫ့ခိၪလီၫ.- တၭယဟိဝၩအလူလၧၫ့ဎွ့ၩလၧအ စီၩ့အမၩ့တၭ, ယဟိဝၩအလူလၧၫ့ဎွ့ၩလၧအကယး",
			"5": "<sup>5</sup> ကဖးလီၫ.- ယဟိဝၩအလူမၩခါၥံၪ့ၡိၫအ့ရ့ၭတၭ,",
			"6": "<sup>6</sup> ယဟိဝၩမၩခါလ့ၭဘနၧၫ့အၥံၪ့ၡိၫအ့ရ့ၭလီၫ.- တၭ, မွဲအအၪ့မၧၫ့အဖုၫဝ့ၫဘဲၫချီဖိၪအၥိၭ, လ့ၭဘနၧၫ့, ဒဲစံ",
			"7": "<sup>7</sup> ရအၧၫ့ဘဲၫချီမံၩ့ဖၫဖိၪအၥိၭနီၪလီၫ.- ယဟိဝၩအလူ မၩထ့ဖၭမ့ၪလၪလီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩအလူမၩဝၭၡါမုနၧၫ့ဖၫတၭ, ယဟိဝၩမၩ",
			"9": "<sup>9</sup> ဝၭၡါမုနၧၫ့ဖၫက့ဒ့ၭတၭ,- ယဟိဝၩအလူဒုၭဖိၪဆါ ခ့ၫဘၩ့မိတၭ, ဒုၭအီၪရံၫရီးမံၩ့လၬကျၩ အၥံၪ့နီၪလီၫ. တၭလၧအနီးဖၧၩ့နီၪၦထီးအလူၬစံၭ, ဆၧလၩဖၩ့ဖီၩ.",
			"10": "<sup>10</sup> ယဟိဝၩဆၧၫ့နၩ့လၧထံၫလုၬဘံၭ ဆၧအဖၫ့ခိၪတၭ, ယဟိဝၩဆၧၫ့နၩ့ကဲၪစဎွၩ အဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"11": "<sup>11</sup> တၭယဟိဝၩမိဖ့ၪလၫ့ၦၡၩခမျၧး လၧဆၧဂဲးဆၧဘၭ လီၫ.ယဟိဝၩမိဆိၪဂ့ၩအၡၩခမျၧး လၧဆၧဘၪလိၬ အိၭလိၬလီၫ."
		},
		"30": {
			"1": "<sup>1</sup> တၭယမိအီၪက့ၪထၪ့ထီၫနၧၩ, ယဟိဝၩဧ့, အဂဲးဘဲၫ ယီၩနမၩဖီၩ့မၩဖျ့ၭယၧၩတၭ, ဒုၭၥၭဎွံၫယဒုၪယဒၩ",
			"2": "<sup>2</sup> လၧယဖၫ့ခိၪအ့ၬ.- ယဟိဝၩ, ယယွၩဧ့, ယအၪ့ယၫ ယူၭဆၧလၧနၧၩတၭ, နမၩဘျၪထဲၩ့ယူၭယၧၩယူၭ.",
			"3": "<sup>3</sup> ယဟိဝၩဧ့, နဒုၭဂဲၫထၪ့ခွံၬ ယၥၭလၧဖျႃဖၧၩ့, နဒုၭ မၧၫ့ဒံၭယၧၩဘဲၫၥိၭ ယထီးလ့ၩလၩ့ဘၪ လၧဆၧဖၧၩ့ လဂ့ၩ.",
			"4": "<sup>4</sup> ၥံၫကျံၩစံၭထၪ့အၪ့အူၭယဟိဝၩ, အၡၩဆံၫ့ဎံၪၥံၪ ဧ့,တၭစံၭထၪ့အၪ့အူၭဆၧ လၧဆၧနၪ့ထၪ့ထဲၩ့အဆၧ",
			"5": "<sup>5</sup> ဆံၫ့ဎံၪနီၪဆံၭ.- အဂဲးဘဲၫယီၩအဆၧၥၭထၪ့နီၪအီၪ လဆိဖိၪ, အ့ၪမွဲလၧအခိးအတၩအဖၧၩ့နီၪ, မွဲဆၧမၧၫ့ လီၫ. လၧမုနၩလခီၫနီၪ မ့ၬထံၫလၩ့ၥၫ့နၩချီၩ့, အ့ၪမွဲ လၧဂီၩလခီၫဆၧၥုၪ့ဎွံၫၥၭယီၫ အီၪထၪ့ဝ့ၫဒၪလီၫ.",
			"6": "<sup>6</sup> ယဝ့ၫဒၪယီၩ, လၧယဘီၪထၪ့ယီၫထၪ့နီၪယစံၭ,",
			"7": "<sup>7</sup> လဆိၩဒၪယၥၭယဝၭလၧၩ့အ့ၬ.- ယဟိဝၩဧ့, နဒုၭ ဆီၪ့ထၪ့ယခိၪလီၩ့အဂဲးအဘၭ လၧနခိးနတၩအကၠီၩ့ လီၫ.နအီၪက့ၪၥူၪယူၭနမ့ၬတၭ, ယၥုၪ့ခိယၥၭဝီၩ လီၫ.",
			"8": "<sup>8</sup> ယကိၭထၪ့နၧၩယဟိဝၩဧ့, ဒဲယအၪ့ကံၩ့ဆၧလၧ",
			"9": "<sup>9</sup> ယဟိဝၩလီၫ.- ထီးယလ့ၩလၩ့ လၧဆၧဖၧၩ့နီၪတၭ, ယၥွံၪန့ကၩဆၧနီၪလဲၪ. မွဲဂၪ့ခိၪအမုၬစံၭထၪ့အၪ့အူၭ",
			"10": "<sup>10</sup> နၧၩဆ့ဧၪ, မွဲအမိဒုၭနဲၪနဆၧမွဲဆၧတီၩဆ့ဧၪ.- ခိၭနၪ လါဆံၭ, ယဟိဝၩဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩဆံၭ, ယဟိ ဝၩဧ့, ကဲၪထၪ့ဆၧမၩဆၧၩ့ယၧၩဆံၭ.",
			"11": "<sup>11</sup> ယဂၪ့ဆၧယၧၩ့ဆၧနီၪ နဒုၭကဲၪထၪ့လၧ ဆၧဂဲထုၪ့ လံလၧယဂးလီၫ. နကွဲၪလၩ့ယရၧၬဆၧကဲၩ့ယၬ, ဒဲခဲး",
			"12": "<sup>12</sup> ထူၬယယးဒံၩ့လၧဆၧၥၭထိၬ,- ဘဲၫၥိၭယလၩယဖၩ့ မိၥံၫကျံၩထၪ့နၧၩတၭ, အီၪလၩ့မါပံၭအ့ၬ. ယဟိဝၩ ယယွၩဧ့, ယမိစံၭထၪ့အၪ့အူၭနၧၩ အဆိၩဆိၩအကၠၪ ကၠၪလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> ယဒိၭနဲၩ့ယၥၭလၧနၧၩ, ယဟိဝၩဧ့, မွဲယမ့ၬထီး ဘၪမဲနးဖၧၫ့လဂ့ၩ. မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧနဆၧတီၩ",
			"2": "<sup>2</sup> ဆၧလီၩ့အကၠီၩ့နီၪဆံၭ.- ဒိၭနနါလၧယၧၩ မၩဖီၩ့မၩ ဖျ့ၭယၧၩချဲၫ့ချဲၫ့, ကဲၪထၪ့ထိၬအလဲၫ့လၧယဂး, ဂံၪ့ဖ လ့ၬလၧယဂး, ဂံၪ့ဖလ့ၬလၧယမိဖီၩ့ဖျ့ၭအဂးနီၪဆံၭ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ နမွဲယလဲၫ့, ဒဲယထိၬလီၫ. တၭနမိၥိၫ့",
			"4": "<sup>4</sup> ယၧၩ,ဒဲမီၩ့န့ယၧၩ လၧနမံၩ့အကၠီၩ့လီၫ.- နမိဒုၭစဲၪ့ ထၪ့ခွံၬယၧၩ လၧဖျံၩခွၩ့အဖၧၩ့ လၧၦအီၪက့ၪၥူၪလၧ ယဂးလီၫ. အဂဲးဘဲၫယီၩ နမွဲယဂဲးယဘၭလီၫ.",
			"5": "<sup>5</sup> ယအီၪက့ၪလၩ့ယၥၭ လၧနစူၪဖၧၩ့, ယဟိဝၩဆၧမွဲဆၧ",
			"6": "<sup>6</sup> တီၩအယွၩဧ့, နဎွ့ၩန့ထဲၩ့ယၧၩလီၫ.- ယမ့ၬလဲၩၦ လၧအထီးန့ဆၧအၪ့လီၫ အဆၧပျီၩပျီၩနီၪ, အ့ၪမွဲယ",
			"7": "<sup>7</sup> ဒိၭနဲၩ့ယၥၭလၧယဟိဝၩလီၫ.- ယမိၥုၪ့ဎွံၫၥၭယီၫဒဲ ၥုၪ့ထိၬၥၭထိၬ လၧနခိးနတၩအဖၧၩ့, နယိလၩ့ယဆၧ ၡၪ့ဆၧနၭ, နၥ့ၪယၫယၥၭလၧအဘၪခိဘၪဝီၩအဖၧၩ့,",
			"8": "<sup>8</sup> တၭနဒုၭထၬယၧၩ လၧယဒုၪယဒၩအစူၪဖၧၩ့အ့ၬ, န ဒုၭဆၧၫ့ထုၪ့ယခၪ့ လၧအလးဖၭလဲအဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩဆံၭ, ယဟိဝၩဧ့,အဂဲးဘဲၫယီၩ ယဘၪဆၧခိဆၧဝီၩလီၫ. ယမ့ၬၥၪဒဲယၥၭ, ဒဲယဂူၭဂၭ",
			"10": "<sup>10</sup> ဂီၩ့လၧဆၧၥုၪ့အုၭၥၭအုၭ အကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩ ယၥၭမၧၫ့လူၬဝ့ၫလၧဆၧၥုၪ့အုၭၥၭအုၭ, ဒဲယနံၪ့လဖၪ နီၪလၧဆၧဂၪ့အုၩ့ဂၪ့ထိၬအဖၧၩ့တၭ, ယဂဲးယဘၭ လၩ့ဆါထဲၩ့ဝ့ၫလၧယဆၧဒဲၩဘၭအကၠီၩ့တၭ, ယဎွံၪ",
			"11": "<sup>11</sup> ၥံၪဂၭဂီၩ့လီၫ.- ယကဲၪထၪ့ဆၧဒုၪဒွ့ၪအလးလၧယဒုၪ ယဒၩထီးအလူၬအကျၩ, ဒဲၦအီၪလၧယနဲၩ့ထံၭနီၪနၭ နဲၪ့ဒံၭလီၫ. ဒဲဆၧၥၭမဲၪအလးလၧၦၡၩလၧအၥ့ၪယၫ ယၧၩလဖၪလၧအမ့ၬယၫလီၫ. တၭၦလဖၪလၧအဒၪဘၪ",
			"12": "<sup>12</sup> ယၧၩလၧခီၫနီၪစဲၪ့ခွံၬလၧယအီၪလီၫ.- တၭဆၧၥၭနၪ့ ယၧၩ, ဘဲၫၦၥံၫလၧအလအီၪဘၪလၧ ၦၥၭခံဖၧၩ့အၥိၭ နီၪလီၫ. ယမၩယၥၭဘဲၫထွ့ၫထ့ဖၭ လဘံၪ့အၥိၭနီၪ",
			"13": "<sup>13</sup> လီၫ.- အဂဲးဘဲၫယီၩ ယနါဂၧၫ့ၦအၪဂၩ အဆၧဒုၪဒွ့ၪ နီၪ, လၧအကိၪ့လိၬအၥၭလစီၪ့ဎးထၫ့ဒုၪဒၩယၧၩနီၪ, ဆၧၥၭမဲၪၥၭဖျဲၩ့အီၪဝၬဖီၩ့ဝ့ၫလီၫ. တၭအဝ့ၫၥံၪကိၪ့ ထၪ့ဝ့ၫဘဲၫၥိၭအမိမၩၥံၫယၧၩလီၫ.",
			"14": "<sup>14</sup> တၭယဝ့ၫဒၪယီၩ, ယဒိၭနဲၩ့ယၥၭလၧနၧၩ, ယဟိ",
			"15": "<sup>15</sup> ဝၩဧ့, ယစံၭ,နဝ့ၫဒၪယီၩနမွဲယယွၩလီၫ.- ယဆၧၫ့ယ ထီလဖၪအီၪဝ့ၫလၧနစူၪဖၧၩ့လီၫ. မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧယဒုၪယဒၩအစူၪဖၧၩ့, ဒဲလၧၦလၧအမၩအၧၩ့",
			"16": "<sup>16</sup> ယၧၩဆံၭ.- ဒုၭဖၩ့ဘၪနမ့ၬ လၧနခ့ၫနၡၩလဂၩယီၩ အလီၩ့ဆံၭ, တၭလၧနခိးနတၩ အကၠီၩ့နီၪ ထိးထဲၩ့",
			"17": "<sup>17</sup> တၩ့ထဲၩ့ယၧၩဆံၭ.- မွဲယထီးဘၪဆၧမ့ၬမဲလဂ့ၩ. ယ ဟိဝၩဧ့, အဂဲးဘဲၫယီၩ ယကိၭထၪ့နၧၩလီၫ. မွဲၦလ တီၩလလီၩ့ဘၪနီၪဘၪဆၧမ့ၬမဲဆံၭ. မွဲအအီၪလၩ့မါ",
			"18": "<sup>18</sup> ပံၭလၧဖျႃဖၧၩ့နီၪဆံၭ.- ၦအဘျံၭအဘျၪ အနိၭဖျံၩ လၧအချဲၩ့ဆၧကၪထၫ့ဒုၪဒၩ ၦတီၩၦလီၩ့တၭ, အီၪ က့ၪထၪ့ထီၫအၥၭတၭ, မၩကြၩ့ထမးဆၧနီၪ, မွဲဆၧဒုၭ အီၪလၩ့မါပံၭဝ့ၫဆံၭ.",
			"19": "<sup>19</sup> နဆၧဂ့ၩဆၧဘွၩလၧနအီၪက့ၪကီၪ့ လၧၦလၧအၥၭ မဲၪနၧၩအဂး, လၧနမၩဝဲၩလၧၦလၧအဒိၭနဲၩ့အၥၭ လၧနၧၩအဂး, လၧၦၡၩအဖိၪခွၫၥံၪအမ့ၬယၫနီၪ, မွဲ အဆံၭဒိၪဆံၭအၪလဲၪ.",
			"20": "<sup>20</sup> နမိအီၪက့ၪၥူၪၦလဖၪနီၪလၧနမ့ၬယၫ အဆၧအီၪ ကဒုၩအလး, ဖီၩ့ခွံၬဝ့ၫလၧၦၡၩအမၩအၧၩ့ဆၧလီၫ. နမိခိၭထၬၥူၪအဝ့ၫၥံၪ လၧတဲၩဖၧၩ့ဖီၩ့ခွံၬ လၧၦနိၭ အဲၪ့လိၬဆိၭချဲၩ့လိၬနီၪလီၫ.",
			"21": "<sup>21</sup> မွဲယဟိဝၩဘၪဆၧစံၭထၪ့အၪ့အူၭဝ့ၫဆံၭ, အဂဲး ဘဲၫယီၩ မွဲအမၩယၧၩ လၧအခိးအတၩ လၩ့လၭဝ့ၫ",
			"22": "<sup>22</sup> ဎဘဲၫၭလၧဒိၩ့အီၪလၧအခိၪဒၧၩ့ခၧၫ့အၥိၭလီၫ.- မွဲလါ နၫ့တၭလၧယစဲၪ့ဖျိၭချဲၫ့ချဲၫ့နီၪယစံၭ, ယဘၪဆၧဒၪ့ ထ့ၬခွံၬလၧနမ့ၬယၫလီၫ. အ့ၪမွဲထီးယကိၭၡၭထၪ့လၧ နၧၩနီၪ,နခိၭနၪယအၪ့ယၫဆၧအလူလီၫ.",
			"23": "<sup>23</sup> ယဟိဝၩအၡၩဆံၫ့ဎံၪထီးအလူၬၥံၪဧ့, အဲၪယဟိ ဝၩဆံၭ, ယဟိဝၩပၧၩ့ၦအလူတီၩတၭ, ၦလၧအအီၪ က့ၪထၪ့ထီၫအၥၭနီၪ ဖ့ၪဆၧၫ့ထဲၩ့ဝ့ၫအဆၧအၪမၬလ",
			"24": "<sup>24</sup> ခီၫလီၫ.- ကယဲၦလၧအယိလါ ဆၧလၧယဟိဝၩ ထီး အလူၬၥံၪဧ့, အီၪက့ၪဆီၪ့နၥံၪအဂဲးအဘၭတၭ, မၩဒူၩ နၥံၪအၥၭဆံၭ."
		},
		"32": {
			"1": "<sup>1</sup> ၦလၧအဆၧမၪဖျါယူၭ, လၧအဆၧဒဲၩဘၭဘၪဆၧ",
			"2": "<sup>2</sup> ချႃၬဘံၭယူၭနီၪ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ.- ၦလၧယဟိဝၩ လအီၪက့ၪဘၪဆၧအၧၩ့လၧအလီၩ့, ဒဲအၪ့လီၫဆၧလ အီၪဘၪလၧအၥၭခံဖၧၩ့နီၪ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ.",
			"3": "<sup>3</sup> ထီးယဎွံၪလဖၪကျၪခွံၬဝ့ၫ လၧယကိၭၡၭထၪ့ၥံၫ့ၥံၫ့",
			"4": "<sup>4</sup> နံၩအကၠီၩ့တၭ, ယအီၪလၩ့မါပံၭလီၫ.- အဂဲးဘဲၫယီၩ လၧမုဆၫဒဲလၧမုနၩနီၪနစူၪအီၪဎၧၫ့လၧယလီၩ့လီၫ. ယဆၧၥံၫ့ဆ့ၬကဲၪထၪ့ဆၧခိအထီ အဆၧဎဲၫ့ထၬလီၫ. (စ့လၫ.)",
			"5": "<sup>5</sup> ယမိဒုၭၥ့ၪယၫနၧၩလၧယဆၧဒဲၩဘၭတၭ, ယဆၧ အၧၩ့နီၪယအီၪက့ၪၥူၪအ့ၬ. ယစံၭယမိလီၩလၩ့လၬ လၩ့ယဆၧမၪ လၧယဟိဝၩနီၪတၭ, နဖျါခွံၬယဆၧ ဒဲၩဘၭလီၫ.",
			"6": "<sup>6</sup> မွဲလၧဆၧနီၪအကၠီၩ့တၭ, လၧၦဒၪန့ဘၪနၧၩအ ဆၧၫ့အထီနီၪ ကယဲၦဆံၫ့ဎံၪထီးအလူၬ မိဘၩဆိၪဖၪ နၧၩကိၭဂၩဒ့ၭလီၫ. မွဲမၬ, လၧထံၫအၪလုၬဘံၭဆၧနီၪ",
			"7": "<sup>7</sup> ချႃၭန့ဘၪအဝ့ၫနီၪအ့ၬ.- နဝ့ၫဒၪယီၩ နမွဲယအီၪကဒုၩ အလးလီၫ. နမိမၩဖီၩ့မၩဖျ့ၭယၧၩ လၧဆၧခိဆၧဝီၩ တၭ,နမိဒုၭအီၪဝၬဖီၩ့ယၧၩ လၧဆၧၥံၫကျံၩဘၪဆဲၫ့လၧ ဆၧမၩဖီၩ့မၩဖျ့ၭဆၧလီၫ.(စ့လၫ.)",
			"8": "<sup>8</sup> ယမိၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့နၧၩ, ဒဲဒုၭနဲၪနၧၩလၧဖၧၩ့ၥၭ လၧနမိဘၪဖိၬဝ့ၫလဘီၩ့နီၪလီၫ. ယမိဒုၭကိၪ့နၧၩတၭ,",
			"9": "<sup>9</sup> ယမ့ၬမိအီၪလၧနလီၩ့လီၫ.- တၭအီၪက့ၪနၥံၪအၥၭ ဘဲၫကၥ့ၪ, ဘဲၫကၥ့ၪလၫလၧအနၪဆၧလၥ့ၪဘၪအၥိၭ နီၪလဂ့ၩ, ဆၧဘၪပဒၩ့အဝ့ၫၥံၪလၧနိၭထၭဒဲဖျံၩနီၪ, မိဂဲၫဘူၭဘၪခိၬလၧနအီၪအကၠီၩ့လီၫ.",
			"10": "<sup>10</sup> ဆၧၥုၪ့အုၭၥၭအုၭ အီၪလၧၦလတီၩလလီၩ့ဘၪအ လီၩ့လီၫ. အ့ၪမွဲၦလၧအဒိၭနဲၩ့အၥၭလၧယဟိဝၩနီၪ",
			"11": "<sup>11</sup> ဆၧယၫ့ၥုၪ့ယၫ့ၥၭမိအီၪဝၬဖီၩ့ဝ့ၫဒၪလီၫ.- ၥၭထိၬလၧ ယဟိဝၩအဖၧၩ့, ဒဲၥုၪ့ဎွံၫၥၭယီၫ, ၦအတီၩအလီၩ့ၥံၪဧ့, ဒဲကယဲၦလၧအၥၭဆုးလီၩ့ ထီးအလူၬၥံၪဧ့, ကိၭၡၭ ထၪ့လၧဆၧၥၭထိၬအကၠီၩ့ဆံၭ."
		},
		"33": {
			"1": "<sup>1</sup> ၥုၪ့ဎွံၫၥၭယီၫလၧယဟိဝၩအဖၧၩ့, ၦအတီၩၥံၪဧ့,",
			"2": "<sup>2</sup> ဂ့ၩလၧၦအတီၩအလီၩ့ စံၭထၪ့အၪ့အူၭဆၧလီၫ.- စံၭ ထၪ့အၪ့အူၭယဟိဝၩ လၧၥၫ့ထီးအလီၩ့တၭ, ၥံၫကျံၩ",
			"3": "<sup>3</sup> ထၪ့အဝ့ၫ လၧနါဒံၩ့အီၪလၧဖျံၩဆံၫဘီၩ့.- တၭၥံၫကျံၩ ထၪ့အဝ့ၫလၧဆၧၥံၫကျံၩအၥၫ့, ဒံၩ့ဆၧဂ့ၩဘၪစဲၪအီၪ လၧဆၧၥၭထိၬအၥီၫဆံၭ.",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩယဟိဝၩအလူနီၪမွဲအတီၩ, ဒဲက",
			"5": "<sup>5</sup> ယဲအဆၧမၩနီၪအီၪဝ့ၫလၧအမွဲအတီၩလီၫ.- မွဲအအဲၪ ဆၧတီၩဆၧလီၩ့ ဒဲဆၧစ့ၩရၫ့တီၩလီၫ. ဂၪ့ခိၪဎွ့ၩလၧ ယဟိဝၩအခိးအတၩလီၫ.",
			"6": "<sup>6</sup> လၧယဟိဝၩအလူအကၠီၩ့နီၪ, မူၭခိၪကဲၪထၪ့ဝ့ၫ, ဒဲလၧအနိၭအၥၪအကၠီၩ့နီၪ, ကယဲအဎၧၩ့အဎီထီး",
			"7": "<sup>7</sup> အလူၬလီၫ.- တၭမွဲအဒုၭအီၪကီၪ့မၫဆမံၭ ဘဲၫဆၧ ပိၩ့အၥိၭနီၪတၭ, အီၪက့ၪထံၫယိၬလဖၪလၧဆၧအီၪ က့ၪကီၪ့အလးဖၧၩ့နီၪလီၫ.",
			"8": "<sup>8</sup> မွဲဂၪ့ခိၪထီးအလူၬၥၭမဲၪယဟိဝၩဆံၭ. ကယဲၦ အီၪဝ့ၫလၧဂၪ့ခိၪချိၫ့နီၪ, မွဲအဆၧၫ့ထုၪ့အီၪလၩ့မါပံၭလၧ",
			"9": "<sup>9</sup> အဝ့ၫနီၪအကၠီၩ့ဆံၭ.- အဂဲးဘဲၫယီၩအဝ့ၫဒၪစံၭဆၧ တၭ,ဆၧကဲၪထၪ့ဝ့ၫအဝ့ၫဒၪမၪလူၬဆၧတၭ, ဆၧအီၪ",
			"10": "<sup>10</sup> ခၧၫ့ဝ့ၫလီၫ.- ယဟိဝၩမၩဂၭဂီၩ့ ၦဆၨၩၥံၪအဆၧကိၪ့ လီၫ.တၭမွဲအဒုၭကဲၪထၪ့ၦခမျၧး အဆၧကိၪ့ထၪ့ဖၭ",
			"11": "<sup>11</sup> လၩ့လၧဆၧနးမံၩ့အ့ၬ.- ယဟိဝၩအဆၧကၩ့ကၩဝ့ၫ အီၪဂုးအီၪခၧၫ့ အဆိၩဆိၩအကၠၪကၠၪနီၪ, ဒဲအၥၭအ ဆၧဆီၫ့မီၪ့လဖၪနီၪ လဆိၩဘၪလဆိၩထီးအလူၬလီၫ.",
			"12": "<sup>12</sup> ၦလဆၨၩလၧယဟိဝၩမွဲအယွၩ, ၦခမျၧးလၧ ယွၩ ရွံန့ဝ့ၫ လၧအဆၧန့ၥၫအဂးနီၪ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ.",
			"13": "<sup>13</sup> လၧမူၭခိၪနီၪယဟိဝၩ ယိလၩ့ဝ့ၫတၭ, ဒၪဘၪၦၡၩအ",
			"14": "<sup>14</sup> ဖိၪခွၫၥံၪကိၭဂၩဒ့ၭလီၫ.- လၧအအီၪဝ့ၫအလးနီၪယိ",
			"15": "<sup>15</sup> လၩ့ဒၪဘၪၦအီၪလၧဂၪ့ခိၪချိၫ့ထီးအလူၬလီၫ.- အဝ့ၫ ဒၪတဲၩ့လၩ့အဝ့ၫၥံၪအၥၭထီးအလူၬ, ယိနဲၪ့အဆၧမၩ",
			"16": "<sup>16</sup> ထီးအလူၬလီၫ.- စဎွၩလၧအထီၩ့လၧဆၧထိးထဲၩ့ တၩ့ထဲၩ့လၧအၥုၭမုခမျၧးအၪအကၠီၩ့နီၪ အီၪဝ့ၫနးဂၩ အ့ၬ.ၦအဆီၪ့နီၪ ဖီၩ့ဖျ့ၭလၧအဂဲးဆီၪ့အဘၭဆီၪ့အကၠီၩ့",
			"17": "<sup>17</sup> နီၪဆ့အ့ၬ.- တၭကၥ့ၪနီၪမွဲဆၧပျီၩပျီၩ လၧဆၧထိး ထဲၩ့တၩ့ထဲၩ့အဂးတၭ, မၩဖီၩ့မၩဖျ့ၭဆၧလၧအဂဲး",
			"18": "<sup>18</sup> ဆီၪ့အဘၭဆီၪ့အကၠီၩ့နီၪၥ့ၪအ့ၬ.- ယိခွါ, ယဟိဝၩ အမ့ၬအီၪလၧၦလၧအၥၭမဲၪဝ့ၫအလီၩ့, လၧၦလၧ အယိလါအခိးအတၩ အဖၧၩ့ၥၭလဖၪနီၪအလီၩ့လီၫ.",
			"19": "<sup>19</sup> မွဲဘဲၫၥိၭ အမိမၩဖီၩ့မၩဖျ့ၭ အဝ့ၫၥံၪလၧဆၧၥံၫနီၪ, ဒဲဘဲၫၥိၭအမိဒုၭမၧၫ့ဒံၭ လၧဆၧၥၭဝံလၩ့ဒိၩ အဖၧၩ့ လီၫ.",
			"20": "<sup>20</sup> ပၥၭယိလါယဟိဝၩအဖၧၩ့ၥၭတၭ, အဝ့ၫဒၪမွဲ",
			"21": "<sup>21</sup> ဆၧမၩဆၧၩ့ပၧၩ, ဒဲပထၩ့ဖံၭလဘံၪ့နီၪလီၫ.- အဂဲး ဘဲၫယီၩပၥၭထိၬလၧအဖၧၩ့နီၪ, အဂဲးဘဲၫယီၩ ပဒိၭ",
			"22": "<sup>22</sup> နဲၩ့ပၥၭလၧအမံၩ့ဆံၫ့ဎံၪအဖၧၩ့လီၫ.- ယဟိဝၩဧ့, န့ၫဎီၩ့လၧပယိလါဆၧလၧနၧၩနီၪ, မွဲနခိးနတၩဘၪ ပၧၩဆံၭ."
		},
		"34": {
			"1": "<sup>1</sup> ယမိစံၭထၪ့အၪ့အူၭ ယဟိဝၩကိၭအဆၧၫ့အထီဒ့ၭ လီၫ. အဆၧစံၭထၪ့အၪ့အူၭမိအီၪလၧယနိၭလထံၪဎး",
			"2": "<sup>2</sup> လဘီၩ့ဎးလီၫ.- ယၥၭမိအီၪက့ၪဖိၫလိၫအၥၭလၧယ ဟိဝၩအဖၧၩ့တၭ, ၦၡၪ့ဖိၪယၬဖိၪလဖၪ မိနါဂၧၫ့ဝ့ၫ",
			"3": "<sup>3</sup> တၭ,မိၥၭထိၬဆ့လီၫ.- အီၪက့ၪဒိၪၡီၩ့ယဟိဝၩနၥံၪ ဝ့ၫလၧယၥိၭဆံၭ. တၭမွဲပအီၪက့ၪထၪ့ထီၫၡီၩ့ အမံၩ့ ဆံၭ.",
			"4": "<sup>4</sup> ယအၪ့ဎၬယဟိဝၩတၭ, အဝ့ၫဒၪစံၭဆၧၫ့ယၧၩ, ဒဲမၩဖီၩ့မၩဖျ့ၭယၧၩ လၧကယဲဆၧလၧယအၪ့ယိၪၥၭ",
			"5": "<sup>5</sup> မဲၪၥၭဖျဲၩ့ၥံၪထီးအလူၬအဖၧၩ့လီၫ.- အဝ့ၫၥံၪယိဒၪ",
			"6": "<sup>6</sup> ဘၪအဝ့ၫတၭ,ဒိၭဆၧဖၩ့တၭ, အမ့ၬမဲဘၪအ့ၬ.- ၦဘၪ ၡၪ့ဘၪနၭလဂၩယီၩ ကိၭထၪ့ဝ့ၫနီၪယဟိဝၩခိၭနၪဝ့ၫ တၭ,ထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫ လၧအဆၧခိဆၧဝီၩ ထီးအ",
			"7": "<sup>7</sup> လူၬအဖၧၩ့လီၫ.- ယဟိဝၩအၥီၫ့ၥုၪ့တဲၩဝၬဖီၩ့ ၦလၧ အၥၭမဲၪအဝ့ၫနီၪတၭ, မၩဖီၩ့မၩဖျ့ၭဝ့ၫဒၪလီၫ.",
			"8": "<sup>8</sup> ထဲးယိခွါတၭ, ဒၪဘၪလၧယဟိဝၩမွဲအဂ့ၩနီၪ ဆံၭ.ၦလၧအဒိၭနဲၩ့အၥၭလၧအဝ့ၫနီၪ ဘၪဆိၪဂ့ၩဝ့ၫ",
			"9": "<sup>9</sup> လီၫ.- အၡၩဆံၫ့ဎံၪၥံၪဧ့, ၥၭမဲၪယဟိဝၩဆံၭ. အဂဲး ဘဲၫယီၩဆၧလလၧၫ့ဘၪ လၧၦလၧအၥၭမဲၪအဝ့ၫဒၪ",
			"10": "<sup>10</sup> အဂးနီၪအီၪနးမံၩ့အ့ၬ.- ဆၬလၥၧၫ့ဖိၪလဖၪ ဘၪ ၡၪ့တၭဆၧၥၭဝံအၥၭလီၫ. အ့ၪမွဲၦလၧအအၪ့ဎၬ ယ ဟိဝၩလဖၪ အဆၧဂ့ၩလၧအလလၧၫ့ဘၪနီၪ အီၪနး မံၩ့အ့ၬ.",
			"11": "<sup>11</sup> ဂဲၫဘီၪ, ဖိၪၥၪၥံၪဧ့, ခိၭနၪယလူဆံၭ. တၭယမိၥီၪ့",
			"12": "<sup>12</sup> လိၪနၥံၪ လၧဆၧၥၭမဲၪယဟိဝၩနီၪလီၫ.- ၦလၧအဘၪ အၥၭ လၧၥၭမၧၫ့တၭ, အဲၪမုနံၩလဖၪဘဲၫၥိၭအမိဒၪ ဘၪဆၧဂ့ၩနီၪ, မွဲပလၫလဂၩလဲၪ.",
			"13": "<sup>13</sup> ဘဲၫၥိၭနဖျ့ၩထီးဘၪဆၧအၧၩ့လဂ့ၩ, ဒဲနနိၭဖျံၩလ ဖၪထီးအၪ့လီၫဆၧလဂ့ၩနီၪ, ခိၭထၬအဝ့ၫၥံၪဆံၭ.",
			"14": "<sup>14</sup> ကၠၪခွံၬနၥၭလၧဆၧအၧၩ့တၭ, မၩဆၧဂ့ၩတၭ, အၪ့ ဎၬဆၧမုၬဘၪလိၬအိၭလိၬတၭ, လီၩ့ဆီးဝ့ၫဆံၭ.",
			"15": "<sup>15</sup> ယဟိဝၩအမ့ၬၥၪအီၪလၧ ၦတီၩၦလီၩ့အလီၩ့တၭ,",
			"16": "<sup>16</sup> အနါအီၪဒိၭအၥၭ လၧၦအၪ့ယၫဆၧအဂးလီၫ.- ယ ဟိဝၩအမ့ၬၥၪထၫ့ဒုၪဒၩ ၦမၩဆၧအၧၩ့နီၪ ဘဲၫၥိၭအမိ ဒၪ့ထ့ၬခွံၬဆၧနၪ့ထၪ့ထဲၩ့အဝ့ၫၥံၪ လၧဂၪ့ခိၪချိၫ့လီၫ.",
			"17": "<sup>17</sup> ထီးၦတီၩၦလီၩ့ကိၭၡၭထၪ့ဝ့ၫတၭ, ယဟိဝၩနါဂၧၫ့ မၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪ လၧအဆၧခိဆၧဝီၩထီးအလူၬ",
			"18": "<sup>18</sup> လီၫ.- ယဟိဝၩအီၪဘူၭလၧၦလၧအၥုၪ့ခါအၥၭလၩ့, ဒဲၦလၧအနီၫ့ယါလၩ့ထဲၩ့အၥၭနီၪ, ထိးထဲၩ့တၩ့ထဲၩ့",
			"19": "<sup>19</sup> ဝ့ၫဒၪလီၫ.- ဆၧအၧၩ့အၪမံၩ့ဘၪၦအတီၩအလီၩ့လါ နၫ့ဘိၩယဟိဝၩမၩဖီၩ့မၩဖျ့ၭဝ့ၫ လၧဆၧထီးအလူၬ",
			"20": "<sup>20</sup> အဖၧၩ့လီၫ.- ယိထဲၩ့ခွါထဲၩ့အဎွံၪထီးအလူၬတၭ, ခါဘၪနးဘီၩ့အ့ၬ.",
			"21": "<sup>21</sup> ဆၧအၧၩ့ဆၧၥၫ့နီၪ မိမၩၥံၫၦလတီၩလလီၩ့ဘၪ,ဒဲ ၦလၧအမ့ၬလဲၩၦအတီၩအလီၩ့လဖၪနီၪ မိဘၪထိး",
			"22": "<sup>22</sup> ဆၧဒဲၩဘၭလီၫ.- ယဟိဝၩဎွ့ၩန့ထဲၩ့အခ့ၫအၡၩအၥၭ, ဒဲၦလၧအဒိၭနဲၩ့အၥၭ လၧအဝ့ၫနီၪဘၪထိးဆၧဒဲၩဘၭ နးဂၩအ့ၬ."
		},
		"35": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, ချဲၩ့အ့ၪယခွးလၧၦလၧအချဲၩ့ခွးလၧ ယၧၩ,ဒုၭၥုၭထၫ့ဒုၪဒၩ ၦလၧအဒုၭၥုၭထၫ့ဒုၪဒၩယၧၩ",
			"2": "<sup>2</sup> ဆံၭ.- ဖီၪ့ထၬထၩ့ဖံၭဖိၪ, ဒဲထၩ့ဖံၭဖၭဒိၪတၭ, ဂဲထုၪ့",
			"3": "<sup>3</sup> ထၪ့လၧဆၧမၩဆၧၩ့ယၧၩအဂးဆံၭ.- တၭထုၭထၪ့ ဖၩ့ဒဲနၭလၧအကၠိၭဖၧၩ့ ဘဲၫၥိၭနမိပဒၩ့ထၬ ၦလၧအ လီၩ့ဆီးယၧၩ အဖၧၩ့ၥၭနီၪဆံၭ. ယမွဲနဆၧထိးထဲၩ့",
			"4": "<sup>4</sup> တၩ့ထဲၩ့နီၪ, လီၩဘၪယၥၭဆံၭ.- ၦလၧအအၪ့ဎၬယ ၥၭလဖၪနီၪ, မွဲအဘၪမ့ၬမဲ, ဒဲဘၪဆၧအီၪက့ၪမဲအမ့ၬ နီၪဆံၭ.တၭၦလၧအအၪ့ဎၬ ဒုၭဘၪယၧၩလၧဆၧအၧၩ့ နီၪ,မွဲဆၧဒုၭထဲၩ့ထဲၩ့အဝ့ၫၥံၪ လၧအလးခဲၫ့နီၪတၭ,",
			"5": "<sup>5</sup> မွဲအဘၪဆၧမ့ၬမဲနီၪဆံၭ.- မွဲအမၩအၥၭဘဲၫဖ့ၫ လၧလံၩအမ့ၬယၫအၥိၭ, ဒဲယဟိဝၩအၥီၫ့ခွံၬလၩ့ခွံၬ",
			"6": "<sup>6</sup> အဝ့ၫၥံၪဆံၭ.- မွဲအဝ့ၫၥံၪ အဖၧၩ့ၥၭခံၭဝ့ၫ, ဒဲဖျ့ၫဝ့ၫ တၭ,မွဲယဟိဝၩအၥီၫ့နီၪ ထၫ့ဒုၪဒၩအလီၩ့ဆီးအဝ့ၫၥံၪ",
			"7": "<sup>7</sup> ဆံၭ.- အဂဲးဘဲၫယီၩအလးလအီၪဘၪတၭ, အဝ့ၫၥံၪ အီၪက့ၪၥူၪအဖျံၩခွၩ့ လၧဆၧဖၧၩ့လၧယဂးတၭ, အ လးလအီၪဘၪတၭ, ခုၪ့လၩ့ဆၧဖၧၩ့ လၧယၥၭအဂး လီၫ.",
			"8": "<sup>8</sup> လၧအဝ့ၫဒၪလချႃၭၥ့ၪယၫဒံၭဘၪနီၪ, မွဲဆၧမၩဂၭ ဂီၩ့ဘၪအဝ့ၫနီၪ, ဒဲဖျံၩခွၩ့လၧအအီၪက့ၪၥူၪဝ့ၫနီၪ, မွဲ အဘၪအနၫ့ဆါဒၪဝ့ၫ, ဘဲၫၥိၭအမိဂၭဂီၩ့တၭ, မွဲအ",
			"9": "<sup>9</sup> လၩ့ထံၩဖါလၧအဖၧၩ့နီၪဆံၭ.- တၭယမိၥုၪ့ထိၬၥၭ ထိၬလၧယဟိဝၩအဖၧၩ့, မိၥုၪ့ဎွံၫၥၭယီၫလၧအဆၧ",
			"10": "<sup>10</sup> ထိးထဲၩ့တၩ့ထဲၩ့အဖၧၩ့လီၫ.- ယဎွံၪထီးအလူၬမိစံၭ, ယဟိဝၩဧ့, ၦလၧအမၩဖီၩ့မၩဖျ့ၭ ၦဘၪၡၪ့ ဘၪနၭ လၧၦလၧအဂဲးအဘၭ ဆီၪ့နဲၪ့ဒံၭအဝ့ၫနီၪ အစူၪဖၧၩ့ တၭ,ၦဘၪၡၪ့ဘၪနၭ ဒဲၦၡၪ့ဖိၪယၬဖိၪ လၧၦလၧအ အၪ့ဂူၬန့အဆၧလၧအစူၪဖၧၩ့နီၪ မွဲပလၫလၩ့ဂၬနၧၩ လဂၩလဲၪ.",
			"11": "<sup>11</sup> ၦထိးအၥၭ အဘျံၭအဘျၪလဖၪ ဂဲထုၪ့ထၫ့ဒုၪဒၩ ယၧၩတၭ, အဝ့ၫၥံၪအၪ့စၪ့ ယဆၧလၧယလၥ့ၪယၫ",
			"12": "<sup>12</sup> ဘၪလီၫ.- အဝ့ၫၥံၪဖ့ၪဆၧၫ့ထဲၩ့ယၧၩ ဆၧအၧၩ့လၧ",
			"13": "<sup>13</sup> ဆၧဂ့ၩအဂးတၭ, ယဘၪဆၧစဲၪ့ဒၪယၧၩလီၫ.- အ့ၪမွဲယ ဝ့ၫဒၪယီၩ လၧအဝ့ၫၥံၪဘၪဆၧဆၫနီၪ ယကီၩ့ယၥိၭမွဲ ရၧၬအဆၧယၬလီၫ. ယမၩၡၪ့ယၥၭလၧ ယဒုၪဆၧ အၪ့ဆၧအီၩတၭ, ယဆၧဘၩဆိၪဖၪနီၪ မိဂဲၫထဲၩ့လၧ",
			"14": "<sup>14</sup> ယၥၭနၫၡါအဖၧၩ့လီၫ.- ယလ့ၩဝံၩ့ဝၩ့ဆၧဘဲၫအမွဲ ထၧၫ့ထံၩထၧၫ့ၥိၭ, ထၧၫ့ဖုထၧၫ့ဝဲလၧယၧၩအၥိၭတၭ, ဘဲၫၦလၧအဂၪ့လၧ အမိအကၠီၩ့အၥိၭနီၪ, ယလီၩ့စံၪ",
			"15": "<sup>15</sup> စၪတၭ, ယၡီၫ့လၩ့ယခိၪလီၫ.- အ့ၪမွဲထီးယဘၪယ ဝ့ၫဆၧခိဆၧဝီၩတၭ, အဝ့ၫၥံၪၥၭထိၬဝ့ၫ, အီၪကိၩ့အီၪကီၪ့ တၭၦအၧၩ့ဖိၪလဖၪ အီၪကိၩ့အီၪကီၪ့ထၫ့ဒုၪ့ဒၩယၧၩ တၭ,ယၥ့ၪယၫယဝ့ၫအ့ၬ, အဝ့ၫၥံၪၡၫ့ယၬဆၧတၭ,",
			"16": "<sup>16</sup> အီၪထီဝ့ၫအ့ၬ.- လၧၦလၧအအၪ့လီၫ ဆၧမၩလိၪအ ၥၭလၧကိၪအဂးအကျၩနီၪ, အဲၪ့ဂံၬအၥွၫလၧယလီၩ့ လီၫ.",
			"17": "<sup>17</sup> ကဆါဧ့, နမိယိဖၧၩ့ဝ့ၫဆံၭယံၬလဲၪ. ထုၭထၪ့ခွံၬ ယၥၭလၧအဝ့ၫၥံၪ အဆၧဂၭဂီၩ့အဖၧၩ့, ယၥၭမၧၫ့လၧ",
			"18": "<sup>18</sup> ဆၬလၥၧၫ့လဖၪနီၪဆံၭ.- အနီၪတၭ, ယစံၭထၪ့အၪ့ အူၭနၧၩလၧ ဆၧအီၪကီၪ့ဖၭဒိၪအကျၩ လၧၦခမျၧး အၪဂၩအကျၩနီၪ ယမိအၪ့အူၭထၪ့နၧၩလီၫ.",
			"19": "<sup>19</sup> တၭၦလၧအမွဲယဒုၪယဒၩပျီၩပျီၩလဖၪနီၪ, မွဲအ ထီးၥၭထိၬဘၪလၧယဖၫ့ခိၪလဂ့ၩ, ဒဲၦလၧအမ့ၬလဲၩ",
			"20": "<sup>20</sup> ယၧၩပျီၩပျီၩနီၪ, မွဲအထီးဖျၭဘၪအမ့ၬလဂ့ၩ.- အဂဲး ဘဲၫယီၩဆၧဘၪလိၬအိၭလိၬနီၪ အဝ့ၫၥံၪချဲၩ့အ့ၬ. အ့ၪ မွဲကိၪ့ထၪ့ဆၧချဲၩ့အၪ့လီၫဆၧ ထၫ့ဒုၪဒၩၦလၧအအီၪ",
			"21": "<sup>21</sup> လၩ့မါပံၭလၧခးဖၧၩ့နီၪလီၫ.- တၭအဝ့ၫၥံၪအၩ့ထၪ့ အနိၭဖၭလဲလၧယလီၩ့တၭစံၭဝ့ၫ, ဟဲၬ ဟဲၬ ပမ့ၬဒၪ ဘၪယူၭ.",
			"22": "<sup>22</sup> နဒၪဘၪယူၭ, ယဟိဝၩဧ့, အီၪလၩ့မါပံၭလဂ့ၩ,က",
			"23": "<sup>23</sup> ဆါဧ့, အီၪယဲၩ့လၧယၧၩလဂ့ၩ.- ထိၪဂဲထုၪ့နၥၭ,နၪ့ ထၪ့နၥၭလၧဆၧစ့ၩရၫ့ယၧၩအဂး လၧယမူၭအဂးနီၪ",
			"24": "<sup>24</sup> ဆံၭ.ယယွၩဒဲယကဆါဧ့,- စ့ၩရၫ့ယၧၩဘဲၫနဆၧတီၩ ဆၧလီၩ့အၥိၭနီၪဆံၭ. ယဟိဝၩယယွၩဧ့, တၭဒုၭၥၭ",
			"25": "<sup>25</sup> ထိၬအဝ့ၫၥံၪလၧယဖၫ့ခိၪလဂ့ၩ.- မွဲအထီးစံၭလၧအ ၥၭခံဖၧၩ့, ဟဲၬ, ထီးပၥၭဆိၫ့ဆၧနီၪ,လဂ့ၩ. မွဲအထီး",
			"26": "<sup>26</sup> စံၭပယုလၩ့ခွံၬယူၭအဝ့ၫနီၪလဂ့ၩ.- ၦလၧအၥၭထိၬ လၧယဘၪဆၧအၧၩ့အကၠီၩ့လဖၪနီၪ, မွဲအဘၪဆၧမ့ၬ မဲတၭ,ဘၪဆၧအီၪက့ၪမဲအဝ့ၫၥံၪအမ့ၬ လစီၪ့ဎးဆံၭ. ၦလၧအအီၪက့ၪဒိၪအၥၭလၧယဖၫ့ခိၪလဖၪနီၪ, မွဲအ ဘၪဆၧဒုၭကီၩ့ဒုၭၥိၭဝ့ၫ လၧဆၧမ့ၬမဲ, ဒဲဆၧအီၪက့ၪ",
			"27": "<sup>27</sup> ဆၧမ့ၬမဲလၧအဝ့ၫၥံၪအလီၩ့နီၪဆံၭ.- ၦလၧအဘၪအ ၥၭလၧယတီၩယလီၩ့နီၪ, မွဲအၥုၪ့ဎွံၫၥၭယီၫဒဲၥုၪ့ထိၬ ၥၭထိၬဒဲစံၭလထံၪဎး, ယဟိဝၩလၧအဘၪအၥၭလၧ အခ့ၫအၡၩ အဆၧဘၪလိၬအိၭလိၬနီၪ, ဘၪဆၧအီၪ",
			"28": "<sup>28</sup> က့ၪထၪ့ထီၫနီၪဆံၭ.- တၭယဖျ့ၩချဲၩ့လၧနဆၧတီၩ ဆၧလီၩ့,မိစံၭထၪ့အၪ့အူၭနၧၩၥံၫ့ၥံၫ့နံၩလီၫ."
		},
		"36": {
			"1": "<sup>1</sup> ၦအၧၩ့အဆၧမၪအၥီၫလၩ့ လၧယၥၭခံဖၧၩ့နီၪ,စံၭ",
			"2": "<sup>2</sup> ဝ့ၫဒၪ, ဆၧၥၭမဲၪယွၩအီၪလၧအမ့ၬယၫအ့ၬ.- အဂဲး ဘဲၫယီၩအၪ့လွ့ၫလၩ့အၥၭ လၧအမ့ၬယၫဒၪဝ့ၫ ထီး ဆၧဒၪန့အဆၧအၧၩ့အဂဲး, လၧဆၧၥၭဂဲၫ့အဂးလီၫ.",
			"3": "<sup>3</sup> အနိၭချဲၩ့ဆၧနီၪ မွဲဆၧအၧၩ့ ဒဲဆၧအၪ့လီၫဝ့ၫလီၫ. တၭမၩဆၧလၧဆၧကိၪ့ၥ့ၪ ဒဲဆၧမၩဂ့ၩနီၪထုၬဝ့ၫဒၪ",
			"4": "<sup>4</sup> လီၫ.- အဝ့ၫဒၪဆီၫ့မီၪ့ဆၧအၧၩ့ လၧအလးမံၫဖၧၩ့, အီၪက့ၪဆၧၫ့ထုၪ့အၥၭ လၧဖၧၩ့ၥၭလဂ့ၩဘၪအဖၧၩ့နီၪ တၭ,ဂၭဎ့ၭဆၧအၧၩ့ဆ့အ့ၬ.",
			"5": "<sup>5</sup> ယဟိဝၩဧ့, နခိးနတၩအီၪလၧမူၭခိၪတၭ,ဆၧမၩန",
			"6": "<sup>6</sup> လူတီၩနီၪထီၩ့လၧဆၧအုၪ့လဖၪလီၫ.- နဆၧတီၩဆၧ လီၩ့မၩအၥၭဘဲၫယွၩအခိၪလီၩ့ၥံၪအၥိၭ, နစ့ၩရၫ့ဆၧ လဖၪနီၪမွဲဆၧဖၧၩ့ယိၬဖၭဒိၪလီၫ. ၦၡၩဒဲဆၧဖိၪဆၧ",
			"7": "<sup>7</sup> ဎါနီၪနမၩဖီၩ့မၩဖျ့ၭနဝ့ၫဒၪလီၫ,ယဟိဝၩဧ့,- နဆၧ အဲၪအခိးအတၩနီၪ, မွဲဆၧလူဒိၪဎွ့ၩဒိၪဆံၭဒိၪလဲၪ, ယွၩဧ့,တၭၦၡၩအဖိၪၥံၪ ဒိၭနဲၩ့အၥၭ လၧနဒံၭအ",
			"8": "<sup>8</sup> လၩၡုၪဖၧၩ့လီၫ.- အဝ့ၫၥံၪမိဘျဲၩအၪ့ လၧၫ့လၧၫ့ဎွ့ၩ ဎွ့ၩလၧနဂံၪ့အၥိၪအချၫတၭ, နမိဒုၭအီၩအဝ့ၫၥံၪလၧ",
			"9": "<sup>9</sup> နဆၧမုၬလၩ အထံၫချိၬလီၫ.- အဂဲးဘဲၫယီၩ ဆၧမၧၫ့ အထံၫထၪ့ဖျိၭနီၪ အီၪလၧနၧၩတၭ, လၧနဆၧဖၩ့အ ကျၩနီၪပမိဒၪဘၪ ဆၧဖၩ့ဆ့လီၫ.",
			"10": "<sup>10</sup> ဒုၭအီၪဂုးခၧၫ့နဆၧအဲၪအခိးအတၩ လၧယၫထူထူ, လၧၦၥ့ၪယၫနၧၩအဂး, ဒဲနဆၧတီၩဆၧလီၩ့ လၧၦအ",
			"11": "<sup>11</sup> ၥၭလီၩ့အဂးနီၪဆံၭ.- ၥၭထၪ့ထီၫအခၪ့နီၪ မွဲအထီး ယဲးလၩ့ဘၪယၧၩလဂ့ၩတၭ, ၦလတီၩလလီၩ့ဘၪအ",
			"12": "<sup>12</sup> စူၪနီၪ, မွဲအထီးနၫ့ထၪ့ခွံၬယၧၩလဂ့ၩ.- ထီးနီၪၦမၩ ဆၧအၧၩ့လၩ့ထံၩဖါဝ့ၫလီၫ. ဘၪဆၧခွံၬလၩ့ခွံၬဝ့ၫ တၭဂဲထုၪ့ထဲၩ့လၥ့ၪဘၪလီၫ."
		},
		"37": {
			"1": "<sup>1</sup> ထီးမၩခိထၪ့နၥၭ လၧၦအၧၩ့ဖိၪအကၠီၩ့လဂ့ၩတၭ,",
			"2": "<sup>2</sup> ၥၭခ့ၬၦမၩအၧၩ့မၩၥၫ့ဆၧလဂ့ၩ.- အဂဲးဘဲၫယီၩအ ဝ့ၫၥံၪမိဘၪဆၧကူၭခွံၬဝ့ၫချဲၫ့မၬ ဘဲၫထၩ့မုအၥိၭနီၪ, ဒဲဘဲၫနၪ့ၥံၪမံၩ့ၥံၪအၥံၫ့ဆ့ၬအၥိၭနီၪ လၩ့ယံၭခွံၬဝ့ၫဒၪ",
			"3": "<sup>3</sup> လီၫ.- ဒိၭနဲၩ့နၥၭလၧယဟိဝၩတၭ, မၩဆၧဂ့ၩဆံၭ, အီၪဂုးခၧၫ့နဝ့ၫလၧထံၫၥံၪခးၥံၪအဖၧၩ့တၭ, အၪ့ဆၧမွဲ",
			"4": "<sup>4</sup> ဆၧတီၩလၧၫ့ဎွ့ၩဆံၭ.- တၭမုၬလၩနၥၭလၧယဟိဝၩ အဖၧၩ့ဆံၭ, အဝ့ၫဒၪမိဖ့ၪလၫ့နၧၩ လၧဆၧလၧနဆိၫ့န့",
			"5": "<sup>5</sup> ဘၪလၧနၥၭခံဖၧၩ့လဖၪနီၪလီၫ.- ဖ့ၪလၫ့နဖၧၩ့ၥုၪ့ ဖၧၩ့ၥၭလၧယဟိဝၩတၭ, ဒိၭနဲၩ့နၥၭလၧအဖၧၩ့ဆ့",
			"6": "<sup>6</sup> ဆံၭ,အဝ့ၫဒၪမိဒုၭဂဲထုၪ့ နဆၧတီၩဆၧလီၩ့ဘဲၫဆၧ ဖၩ့အၥိၭနီၪ, နဆၧစ့ၩရၫ့ဘဲၫမုထုၪ့အၥိၭနီၪလီၫ.",
			"7": "<sup>7</sup> အီၪလၩ့မါပံၭလၧယဟိဝၩအမ့ၬယၫတၭ, ယိလါ အဖၧၩ့ၥၭဆံၭ. ထီးမၩခိထၪ့နၥၭ လၧၦလၧအဘီၪ ထၪ့ယီၫထၪ့ လၧအဖၧၩ့ၥၭအကၠီၩ့, လၧၦလၧအမၩ",
			"8": "<sup>8</sup> ဎွ့ၩထၪ့ဆၧကိၪ့ထၪ့အအၧၩ့ အကၠီၩ့နီၪလဂ့ၩ.- အီၪ ထီခွံၬလၧဆၧၥၭထၪ့နီၪတၭ, စဲၪ့ဒၪခွံၬဆၧၥၭခဲၩထၪ့ နီၪဆံၭ.ထီးမၩခိထၪ့နၥၭလဂ့ၩ, မွဲန့ၫဆၧအၧၩ့လီၫ.",
			"9": "<sup>9</sup> အဂဲးဘဲၫယီၩၦမၩအၧၩ့ဆၧလဖၪနီၪ မိဘၪဆၧဒၪ့ထ့ၬ ခွံၬဝ့ၫဒၪလီၫ. အ့ၪမွဲၦလၧအယိလါဆၧ လၧယဟိဝၩ",
			"10": "<sup>10</sup> နီၪမိန့ၥၫထံၫၥံၪခးၥံၪလီၫ.- အီၪလဆိဖိၪနီၪတၭ, ၦလတီၩလလီၩ့ဘၪလဖၪအီၪလၧၩ့အ့ၬ. ဒဲနယိဆီၫ့မီၪ့",
			"11": "<sup>11</sup> အလးတၭ, မွဲလအီၪလၧၩ့ဘၪလီၫ.- အ့ၪမွဲၦလၧအ ၥၭဆၧၩ့လဖၪနီၪ,မိန့ၥၫထံၫၥံၪခးၥံၪတၭ, မိမုၬလၩဆၧ လၧဆၧဘၪလိၬအိၭလိၬ အၪအၪလ့ၬအဖၧၩ့နီၪလီၫ.",
			"12": "<sup>12</sup> တၭၦလတီၩလလီၩ့ဘၪလဖၪ ကိၪ့ထၪ့ဆၧထၫ့ဒုၪ",
			"13": "<sup>13</sup> ဒၩၦတီၩၦလီၩ့နီၪ, အဲၪ့ဂံၬအၥွၫလၧအလီၩ့လီၫ.- က ဆါမိနံဘၪအဝ့ၫ, အဂဲးဘဲၫယီၩဒၪဘၪဝ့ၫလၧအမုလ",
			"14": "<sup>14</sup> နံၩနီၪမိဂဲၫဘၪလီၫ.- ၦလတီၩလလီၩ့ဘၪလဖၪထုၭ ထၪ့အနၭလၧအကၠိၭဖၧၩ့တၭ, ဖဲၪ့ထၪ့အချံၪ ဘဲၫၥိၭ အမိမၩလၩ့ထံၩဖါ ၦဘၪၡၪ့ဘၪနၭ ဒဲၦၡၪ့ဖိၪယၬဖိၪ တၭ,ဒဲဘဲၫၥိၭအမိမၩၥံၫ ၦလၧအၥုၪ့တီၩၥၭလီၩ့လဖၪ",
			"15": "<sup>15</sup> နီၪလီၫ.- အဝ့ၫၥံၪအနၭအဖၩ့နီၪ မိလ့ၩနုၬ လၧအၥၭ ဒၪဝ့ၫအဖၧၩ့တၭ, အချံၪလဖၪနီၪ မိဘၪဆၧမၩခါ ဝ့ၫလီၫ.",
			"16": "<sup>16</sup> တၭဆၧလဆံၭဖိၪ အီၪလၧၦတီၩၦလီၩ့လဂၩအ စူၪဖၧၩ့နီၪဂ့ၩနဲၪ့ ၦလတီၩလလီၩ့ဘၪအၪဂၩအစူၪလး ခၪ့ခိၪအၪအၪလ့ၬနီၪလီၫ.",
			"17": "<sup>17</sup> အဂဲးဘဲၫယီၩ ၦလတီၩလလီၩ့ဘၪ အစူၪဒူၪၥံၪမိ ဘၪဆၧမၩခါခွံၬဝ့ၫ, အ့ၪမွဲၦတီၩၦလီၩ့လဖၪနီၪ ယဟိ ဝၩမၩဆၧၩ့ဝ့ၫလီၫ.",
			"18": "<sup>18</sup> ယဟိဝၩၥ့ၪယၫၦလၧ အလၧၫ့အဎွ့ၩအမုနံၩလ ဖၪတၭ,အဆၧန့ၥၫနီၪ မိအီၪလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"19": "<sup>19</sup> လၧအဆၧၫ့ထီအအၧၩ့နီၪအမ့ၬမိမဲဘၪအ့ၬ. လၧဆၧ",
			"20": "<sup>20</sup> ၥၭဝံလၩ့ဒိၩအမုနံၩနီၪမိဘျဲၩအၪ့ဝ့ၫလီၫ.- အဂဲးဘဲၫ ယီၩၦလတီၩလလီၩ့ဘၪမိဂၭဂီၩ့တၭ, ယဟိဝၩအဒုၪ အဒၩလဖၪနီၪ မိဒံၩခွံၬဝ့ၫ ဘဲၫဆၧအၪ့အဆၪ အလး အ ဆၧဂ့ၩအၥိၭနီၪတၭ, မိဒံၩခွံၬဝ့ၫဘဲၫမ့ၪခူၪ အၥိၭနီၪ",
			"21": "<sup>21</sup> လီၫ.- ၦလတီၩလလီၩ့ဘၪနီၪ အၪ့လီးဆၧတၭ, လ လိၭထဲၩ့ဘၪ, အ့ၪမွဲၦတီၩၦလီၩ့လဖၪနီၪ ယၫ့ၥၭဆၧ",
			"22": "<sup>22</sup> တၭ,ဖ့ၪလၫ့ဆၧလီၫ.- အဂဲးဘဲၫယီၩၦလၧအဘၪဆၧ ဆိၪဂ့ၩလၧအဝ့ၫနီၪ မိန့ၥၫထံၫၥံၪခးၥံၪနီၪလီၫ. တၭ ၦလၧအဘၪဆၧဆိၪအၧၩ့ လၧအဝ့ၫနီၪ မိဘၪဆၧဒၪ့ ထ့ၬခွံၬဝ့ၫလီၫ.",
			"23": "<sup>23</sup> ယဟိဝၩဒုၭခၫထၪ့ၦၡၩနီၪ, ဒဲမုၬလၩအၥၭလၧအ",
			"24": "<sup>24</sup> ဖၧၩ့ၥၭလီၫ.- အဝ့ၫနီၪလၩ့ထံၩဖါဝ့ၫလါနၫ့တၭ, ဘၪ ဆၧဂၭဂီၩ့လူၬဆ့အ့ၬ.အဂဲးဘဲၫယီၩ ယဟိဝၩမၩ",
			"25": "<sup>25</sup> ဆၧၩ့ဝ့ၫလၧအစူၪလီၫ.- ယဝ့ၫဒၪယီၩ ယမွဲယူၭၦလၧ အၥၭဘၪ့တၭ, ယကဲၪထၪ့ဆ့ယူၭ ၦၥၭၡါယူၭတၭ,ၦ တီၩၦလီၩ့ဘၪဆၧစဲၪ့ဒၪဝ့ၫမွဲဂ့ၩ, အချံၫအၥၪအၪ့ကံၩ့",
			"26": "<sup>26</sup> န့ဆၧအၪ့မွဲဂ့ၩ, ယဒၪဘၪအ့ၬ.- အဝ့ၫယၫ့ၥၭဝ့ၫကိၭ မုနံၩမုနၩဒ့ၭတၭ, ဒုၭအၪ့လီးဆၧတၭ, အချံၫအၥၪနီၪ မိဘၪဆၧဆိၪဂ့ၩဝ့ၫလီၫ.",
			"27": "<sup>27</sup> စဲၪ့ထၪ့ခွံၬလၧဆၧအၧၩ့အအီၪတၭ, မၩဆၧဂ့ၩတၭ,",
			"28": "<sup>28</sup> အီၪဂုးခၧၫ့အဆိၩဆိၩအကၠၪကၠၪဆံၭ.- အဂဲးဘဲၫယီၩ ယဟိဝၩအဲၪဆၧစ့ၩရၫ့တီၩတၭ, မိစဲၪ့ဒၪအၡၩဆံၫ့ ဎံၪနီၪဆ့အ့ၬ. အဝ့ၫၥံၪဘၪဆၧယိထဲၩ့ခွါထဲၩ့ဝ့ၫ လၩ့ ဆိၩလၩ့ကၠၪလီၫ. အ့ၪမွဲၦလတီၩလလီၩ့ဘၪအ ချံၫ",
			"29": "<sup>29</sup> အၥၪလဖၪနီၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလီၫ.- ၦတီၩ ၦလီၩ့န့ၥၫထံၫၥံၪခးၥံၪတၭ, အီၪဂုးခၧၫ့ဝ့ၫလၩ့ဆိၩ လၩ့ကၠၪလီၫ.",
			"30": "<sup>30</sup> ၦတီၩၦလီၩ့အနိၭနီၪ ချဲၩ့ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪတၭ,",
			"31": "<sup>31</sup> အဖျ့ၩချဲၩ့ဆၧစ့ၩရၫ့တီၩလီၫ.- ယွၩအဆၧၥီၪ့ဆၧၥၫ့ အီၪဝ့ၫလၧအၥၭခံဖၧၩ့တၭ, အခၪ့နီၪဖျၬဝ့ၫနးဖၧၫ့",
			"32": "<sup>32</sup> အ့ၬ.- ၦလတီၩလလီၩ့ဘၪအီၪခိၭယိၥူၪ ၦတီၩၦလီၩ့",
			"33": "<sup>33</sup> တၭ, အၪ့ဎၬမၩၥံၫဝ့ၫလီၫ.- ယဟိဝၩမိစဲၪ့ဒၪဒုၭအီၪ လၩ့ထးအဝ့ၫလၧအစူၪဖၧၩ့နီၪဆ့အ့ၬ. တၭထီးအဘၪ",
			"34": "<sup>34</sup> ဆၧစ့ၩရၫ့ဝ့ၫနီၪ, မိစ့ၩရၫ့စၪအဝ့ၫဒၪအ့ၬ.- ယိလါဆၧ လၧယဟိဝၩတၭ, ထီးန့အဖၧၩ့ၥၭဆံၭ. တၭအဝ့ၪဒၪ မိအီၪက့ၪထၪ့ထီၫနၧၩ, ဘဲၫၥိၭနမိန့ၥၫ ထံၫၥံၪခးၥံၪနီၪ လီၫ.ထီးၦလတီၩလလီၩ့ဘၪလဖၪ ဘၪဆၧဒၪ့ထ့ၬ ခွံၬနီၪနမိဒၪဘၪနဝ့ၫလီၫ.",
			"35": "<sup>35</sup> ယဒၪဘၪယူၭၦလတီၩလလီၩ့ဘၪ အီၪလၧအက ယးဒိၪကဖးဒိၪတၭ, တရါလၩ့အၥၭဘဲၫၥံၪ့အၥံၫ့လၧ",
			"36": "<sup>36</sup> အအီၪလၧအဂၪ့ခိၪဒၪဝ့ၫအဖၧၩ့အၥိၭနီၪလီၫ.- မွဲလါ နၫ့ဒံၩခွံၬဝ့ၫတၭ, ယိခွါ, လအီၪလၧၩ့ဘၪတၭ, ယယိ အၪ့ဎၬလါနၫ့တၭ, ယဒၪဘၪၥ့ၪအ့ၬ.",
			"37": "<sup>37</sup> ထီးနဲၪ့ၦအလၧၫ့အဎွ့ၩတၭ, ယိထံၫယိဆၭ ၦအ တီၩအလီၩ့နီၪဆံၭ. အဂဲးဘဲၫယီၩၦမၩမုၬမၩဎၩ့ဆၧ",
			"38": "<sup>38</sup> နီၪအဆၧၫ့အထီလၧယၫလခီၫအီၪမုၬဝ့ၫလီၫ.- အ့ၪမွဲ ၦမၩမၪ ဆၧလဖၪနီၪ မိထီၩ့လၧဆၧဂၭဂီၩ့လဖၧၫ့ဎး လီၫ. ၦလတီၩလလီၩ့ဘၪ အဆၧၫ့အထီလၧယၫနီၪ",
			"39": "<sup>39</sup> မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလီၫ.- တၭၦတီၩၦလီၩ့အဆၧ ထိးထဲၩ့တၩ့ထဲၩ့နီၪ ဂဲၫလၧယဟိဝၩအအီၪလီၫ. အ ဝ့ၫနီၪမွဲဝ့ၫလၧအဝ့ၫၥံၪအထိၬ လၧဆၧမၩခိမၩဝီၩအ",
			"40": "<sup>40</sup> ဆၧၫ့အထီအထးဖၧၩ့လီၫ.- တၭယဟိဝၩမၩဆၧၩ့ ယူၭအဝ့ၫၥံၪတၭ, မၩဖီၩ့မၩဖျ့ၭဝ့ၫလီၫ. အဝ့ၫဒၪမိမၩ ဖီၩ့မၩဖျ့ၭဝ့ၫ လၧၦလတီၩလလီၩ့ဘၪအစူၪဖၧၩ့တၭ, မိထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫနီၪ, အဂဲးဘဲၫယီၩအဝ့ၫၥံၪဒိၭ နဲၩ့အၥၭလၧအစူၪဖၧၩ့လီၫ."
		},
		"38": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, လၧနၥၭထၪ့အဖၧၩ့နီၪ ထီးအီၪက့ၪ ဆၧမၪလၧယလီၩ့လဂ့ၩ. တၭအၪ့ၥီၪ့ယၧၩ လၧနၥၭခဲၩ ထၪ့လဂ့ၩ.",
			"2": "<sup>2</sup> အဂဲးဘဲၫယီၩနဖျါၥံၪဆ့ၭနုၬဘၪယၧၩတၭ, နစူၪ",
			"3": "<sup>3</sup> ဆၪ့လၩ့ဆီၪ့လၧယလီၩ့လီၫ.- လၧနၥၭထၪ့အကၠီၩ့ ယဖံၭယယၪအီၪဆီၪ့အီၪချဲၫ့အ့ၬ. လၧယဆၧဒဲၩဘၭ အကၠီၩ့နီၪ, ဆၧမုၬလၩအီၪ လၧယဎွံၪ အဖၧၩ့အ့ၬ.",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩ ယဆၧၥူၭဆၧမၪလုၬဘံၭယခိၪဎွံၪဘဲၫ ဆၧအဎၧၫ့ အၥိၭတၭ, ဎၧၫ့လၨၪဝ့ၫ လၧယဂးလီၫ.",
			"5": "<sup>5</sup> ယဖၧၩ့လးလဖၪနၧၫ့ဝ့ၫတၭ, အုၪဝ့ၫလၧယဆၧမၪအ",
			"6": "<sup>6</sup> ကၠီၩ့လီၫ.- ယဘၪၥုၪ့ခိၥၭဝီၩတၭ, ယအီၪကူၭလၩ့ယ ၥၭနၭမၬလီၫ. ယလ့ၩဆၧလၧၥုၪ့အုၭၥၭအုၭ ၥံၫ့ၥံၫ့",
			"7": "<sup>7</sup> နံၩလီၫ.- အဂဲးဘဲၫယီၩ ယယးဒံၩ့ဎွ့ၩလၧဆၧဆၫခိ",
			"8": "<sup>8</sup> အိၩ့တၭ, ယဖံၭယယၪအီၪဆီၪ့နးဆံၭအ့ၬ.- ယဂဲး ဆါယဘၭဆါတၭ, ယဘၪဆၧလၩ့ဘျ့ၭ နၭမၬလီၫ.",
			"9": "<sup>9</sup> ယကိၭၡၭထၪ့လၧၥုၪ့ခိၥၭဝီၩအကၠီၩ့လီၫ.- ကဆါဧ့, ကယဲယဆိၫ့ဆၧထီးအလူၬ အီၪဝ့ၫလၧနမ့ၬယၫတၭ,",
			"10": "<sup>10</sup> ယဂၪ့အုၩဂၪ့ထိၬ အီၪၥူၪခွံၬလၧနၧၩအ့ၬ.- ယၥုၪ့ဖီး ယၥၭဝၭ, ယဂဲးယဘၭလ့ၩဒၪခွံၬယၧၩလီၫ. တၭယ မ့ၬၥၪအဆၧဖၩ့အီၪလၧၩ့လၧယၧၩဆ့အ့ၬ.",
			"11": "<sup>11</sup> တၭၦလၧအအဲၪယၧၩ, ယထံၩယၥိၭလဖၪနီၪဆၧၫ့ ထုၪ့ဆီၩ့ဆုၩလၧယဖၧၩ့လးတၭ, ယဘူၭယထံးလဖၪ",
			"12": "<sup>12</sup> နီၪဆၧၫ့ထုၪ့လၧအယဲၩ့လီၫ.- ၦလၧအအၪ့ဎၬယၥၭ နီၪ,ဒိၭဖျံၩခွၩ့လၧယဂးတၭ, ၦလၧအအၪ့ဎၬယဘၪ ဆၧအၧၩ့နီၪချဲၩ့ဆၧအၧၩ့တၭ, ကိၪ့အၪ့လီၫဆၧၥံၫ့ၥံၫ့",
			"13": "<sup>13</sup> နံၩလီၫ.- တၭယဝ့ၫဒၪယီၩ, ဘဲၫၦလၧအနါအၧၩ့အ ၥိၭနီၪယနါဂၧၫ့ဆၧအ့ၬ. တၭဘဲၫၦအုၭအၭအၥိၭနီၪ",
			"14": "<sup>14</sup> ယအၩ့ထၪ့ယနိၭဆ့အ့ၬ.- တၭယမၩယၥၭဘဲၫၦလၧ အလနါဂၧၫ့ဘၪဆၧတၭ, ဆၧချဲၩ့ဆၧၫ့အီၪလၧယနိၭ",
			"15": "<sup>15</sup> ဖၧၩ့ဆ့အ့ၬ.- အဂဲးဘဲၫယီၩ, ယဟိဝၩဧ့, ယယိလါ ဆၧလၧနဖၧၩ့လီၫ. နမိစံၭဆၧၫ့ဆၧ, ယယွၩကဆါဧ့,",
			"16": "<sup>16</sup> အဂဲးဘဲၫယီၩ, ယစံၭ,အဝ့ၫၥံၪမိၥၭထိၬဘၪခိၬလၧယ ဖၫ့ခိၪလီၫ. ထီးယခၪ့အ့ၪဖျၬတၭ, အဝ့ၫၥံၪအီၪက့ၪဒိၪ",
			"17": "<sup>17</sup> အၥၭလၧအထၫ့ဒုၪဒၩယၧၩလီၫ.- အဂဲးဘဲၫယီၩလၩ့ ဘူၭလၧယမိလၩ့ထံၩဖါတၭ, ယဆၧၥၭအုၭနီၪအီၪ",
			"18": "<sup>18</sup> ဝ့ၫလၧယမ့ၬယၫလထံၪဎးလီၫ.- အဂဲးဘဲၫယီၩယမိ ဒုၭနဲၪယဆၧအၧၩ့လီၫ. ယၥၭအုၭလၧယဆၧဒဲၩဘၭ",
			"19": "<sup>19</sup> အကၠီၩ့လီၫ.- ယဒုၪယဒၩနီၪမၧၫ့ဝ့ၫတၭ, ယဂဲးဆီၪ့ ယဘၭဆီၪ့, ၦလၧအမ့ၬလဲၩယၧၩ လၧအလးလအီၪ",
			"20": "<sup>20</sup> ဘၪနီၪ, အီၪဝ့ၫအၪဂၩလီၫ.- တၭၦလၧအဖ့ၪထဲၩ့ဆၧ အၧၩ့လၧဆၧဂ့ၩအဂးနီၪ ထၫ့ဒုၪဒၩယၧၩလၧယလီၩ့ ဆၧဂ့ၩအကၠီၩ့လီၫ.",
			"21": "<sup>21</sup> တၭထီးစဲၪ့ဒၪယၧၩလဂ့ၩ, ယဟိဝၩဧ့, ယယွၩဧ့,",
			"22": "<sup>22</sup> အီၪယဲၩ့လၧယၧၩလဂ့ၩ.- ဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩ ကဆါဧ့, မၩချဲၫ့ချဲၫ့ဘဲၫၥိၭနမိမၩဘိၭမၩဆၧၩ့ယၧၩဆံၭ."
		},
		"39": {
			"1": "<sup>1</sup> ယစံၭယမိထီးန့ယဖၧၩ့ၥၭၥံၪ ဘဲၫၥိၭယထီးမၩဆၧ ဒဲၩဘၭလၧယဖျ့ၩလဂ့ၩ. ၦလတီၩလလီၩ့ဘၪအီၪလၧ ယမ့ၬယၫအဘိၩ့ဘၭနီၪတၭ, ယမိၥံၫ့ထၬယနိၭလီၫ.",
			"2": "<sup>2</sup> ယအီၪလၩ့မါပံၭတၭယအီၪအုၭအၭလီၫ. ယအီၪက စုၩနီၪတၭ, လချဲၩ့ထၪ့ဘၪဆၧအဂ့ၩ ဒၪလ့ၬနီၪလီၫ.",
			"3": "<sup>3</sup> တၭယၥုၪ့ခိၥၭဝီၩဂဲၩလိၬလီၫ.- ယၥၭခိထၪ့လၧယ ဖၧၩ့တၭ,လၧယဆီၫ့မီၪ့ဆၧအဘိၩ့ဘၭနီၪ, မ့ၪခဲၩထၪ့",
			"4": "<sup>4</sup> ဝ့ၫလီၫ. တၭယချဲၩ့ဆၧလၧယဖျ့ၩ,- ယဟိဝၩဧ့, ဒုၭ ၥ့ၪယၫယၧၩလၧ ယထုၬဒဲယမုနံၩလဖၪမိအီၪဎွ့ၩအံၩ ဎွ့ၩအိၩနီၪဆံၭ. ယဂဲးယဘၭဆါဖိၫဘဲၫၥ့ၪလဲၪ, ဒုၭ",
			"5": "<sup>5</sup> ၥ့ၪယၫယၧၩဆံၭ.- ယိခွါ, နအီၪက့ၪယမုနံၩလဖၪဘဲၫ လစိၭအၥိၭ, ဒဲလဆိၩဒၪယၧၩမၩအၥၭဘဲၫ အလမွဲ ဘၪဆၧနးမံၩ့အၥိၭ လၧနမ့ၬယၫလီၫ. မွဲမၬ, ၦၡၩလ ဂၩလါလါအ့ၪအီၪလၧအလးဂ့ၩထုၬလါနၫ့, မွဲန့ၫဆၧ",
			"6": "<sup>6</sup> ပျီၩပျီၩအဂးလီၫ.- မွဲမၬ, ကယဲၦၡၩကိၭဂၩဒ့ၭလ့ၩ လၧဆၧလၩၡုၪအဖၧၩ့တၭ, မွဲမၬ, အဝ့ၫၥံၪမၩခိထၪ့ အၥၭပျီၩပျီၩလီၫ. တၭအီၪက့ၪပိၩ့အစူၪလးခၪ့ခိၪနီၪ, မွဲပလၫမိအၪ့မၩန့ဝ့ၫလဂၩလဲၪနီၪ, ၥ့ၪယၫဝ့ၫဆ့အ့ၬ.",
			"7": "<sup>7</sup> ယယိလါဆၧလၧနၧၩတၭ, ဘိၩ့နဲၪ့ယီၩ,ကဆါဧ့,",
			"8": "<sup>8</sup> ယဘၪခိၭဒံၭ ဆၧနီၪလမံၩ့လဲၪ.- တၭမၩဖီၩ့မၩဖျ့ၭ ယၧၩလၧယဆၧအမၪထီးအလူၬနီၪဆံၭ. ထီးအီၪက့ၪ ယၧၩလၧၦဂၭဂီၩ့ဖိၪ အဆၧဒုၪဒွ့ၪ အလးနီၪလဂ့ၩ.",
			"9": "<sup>9</sup> တၭယအီၪလၩ့မါပံၭ, ယမိအၩ့ထၪ့ယနိၭအ့ၬ. အဂဲး",
			"10": "<sup>10</sup> ဘဲၫယီၩနမၩနဝ့ၫလီၫ.- ၥုၭခွံၬနထးဆၧလၧယလီၩ့ ဆံၭ.လၧနစူၪထးဆၧအကၠီၩ့နီၪ ယဂဲးယဘၭလူၬဖီၩ,",
			"11": "<sup>11</sup> ထီးနအ့ၪအၪ့ၥီၪ့ၦၡၩ လၧဆၧအၪ့ၥီၪ့ၥံၪလၧအဆၧ ဆၧၩ့အကၠီၩ့တၭ, ဆၧလၧအမုၬလၩဝ့ၫလၧအဖၧၩ့နီၪ, နမၩလူၬခွံၬဘဲၫဆၧအဎိၩ့အဎါ အၥိၭနီၪလီၫ. မွဲမၬ, ၦၡၩလဂၩလါလါနီၪ, မွဲန့ၫဆၧပျီၩပျီၩလီၫ. (စ့လၫ.)",
			"12": "<sup>12</sup> ခိၭနၪယဆၧဘၩဆိၪဖၪဆံၭ, ယဟိဝၩဧ့, ခိၭနၪယ အၪ့ယၫဆၧမၩဆၧၩ့အဂးဆံၭ. အီၪလၩ့မါပံၭလၧယ မ့ၬထံၫအကၠီၩ့လဂ့ၩ. အဂဲးဘဲၫယီၩ ဘဲၫယဖါၥံၪထီး အလူၬအၥိၭနီၪ, ယမွဲၦမွံၩလၧနမ့ၬယၫ,ၦဂဲၫအီၪဘဲၫ",
			"13": "<sup>13</sup> နီၪၥိၭလီၫ.- ယလချႃၭထဲၩ့ဒံၭဘၪ, ဒဲလအီၪလၧၩ့ ဘၪနီၪ,ဖျါယၧၩ ဘဲၫၥိၭယမိမုၬထၪ့ထဲၩ့ ယဝ့ၫဆံၭ."
		},
		"40": {
			"1": "<sup>1</sup> လၧဆၧအွံၪၥၭဆၧၩ့အဖၧၩ့နီၪ, ယယိလါယဟိဝၩ, အဖၧၩ့ၥၭတၭ, အဝ့ၫဒၪအီၪက့ၪအၥၭလၧယအီၪ ဒဲခိၭ",
			"2": "<sup>2</sup> နၪယအၪ့ယၫဆၧမၩဆၧၩ့အဂးလီၫ.- အဝ့ၫဒၪထုၭ ထၪ့ခွံၬယၧၩ လၧဆၧဖၧၩ့ၥီၫဧူၫဧူၫအဖၧၩ့, ဒဲလၧကဖံၬ လၩ့လၧၩ့ နၭနၭလ့ၬအကျၩတၭ, အီၪက့ၪထၪ့ယခၪ့ လၧလဲၫ့အလီၩ့ ဒဲဒုၭအီၪထၪ့ယၧၩ ဂုးဂုးခၧၫ့ခၧၫ့လီၫ.",
			"3": "<sup>3</sup> တၭအဝ့ၫအီၪက့ၪဆၧၥံၫကျံၩအၥၫ့ လၧယနိၭဖၧၩ့, ဆၧစံၭထၪ့အၪ့အူၭပယွၩလီၫ. ၦအၪဂၩမိဒၪဘၪဝ့ၫဒဲ မိၥၭမဲၪဝ့ၫတၭ, မိဒိၭနဲၩ့အၥၭလၧယဟိဝၩလီၫ.",
			"4": "<sup>4</sup> ၦလၧအအီၪက့ၪယဟိဝၩ လၧဆၧဒိၭနဲၩ့အၥၭတၭ, လကၠၪစိၩဘၪအၥၭ လၧၦအီၪက့ၪထၪ့ထီၫအၥၭ ဒဲၦ လၧအလကၠၪဘၪအၥၭ လၧဆၧအဘျံၭအဘျၪအအီၪ",
			"5": "<sup>5</sup> နီၪ,ဘၪဆိၪဂ့ၩဝ့ၫလီၫ.- နမၩဆၧအၪမံၩ့, ယဟိဝၩ, ယယွၩဧ့, နမၩလၩ့လၭဆၧတၭ,နဆီၫ့မီၪ့ဆၧလၧပဂး အၪမံၩ့တၭ, ယတဲၩ့ဝဲၩဝ့ၫ လၧနမ့ၬယၫၥ့ၪအ့ၬ. တၭ ယဒုၭနဲၪဒဲလီၩဘၪအဝ့ၫၥံၪ အဂဲးအကၠီၪ့နီၪတၭ, အၪ ဝ့ၫထီးအဘၪဆၧဝံထၪ့နၬထၪ့လၥ့ၪဘၪလီၫ.",
			"6": "<sup>6</sup> ဆၧလုဒဲဆၧမၩဘိၪ့နီၪလဘၪဘၪနၥၭတၭ, နဝဲထၪ့ ယနါဖၧၩ့လီၫ. ဆၧလုမ့ၪဒဲဆၧလုဆၧဒဲၩဘၭနီၪနအၪ့",
			"7": "<sup>7</sup> ကံၩ့နဝ့ၫအ့ၬ.- ထီးနီၪလဖၧၫ့ယစံၭယဝ့ၫ, ယိခွါ, ယ ဂဲၫ, လၧလံၬလထူအဖၧၩ့နီၪ ဆၧကွ့ၭအၥၭလၧယဂဲး",
			"8": "<sup>8</sup> ယကၠီၪ့လီၫ.- မုၬယၥၭလၧယမၩထီးဒၪနၥၭ, ယယွၩ ဧ့, တၭနဆၧၥီၪ့ဆၧၥၫ့နီၪအီၪဝ့ၫလၧယၥၭခံဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> ယလီၩလၩ့လၬလၩ့ဆၧၥၭထိၬအပရၧၫ့ လၧဆၧအီၪ ကီၪ့ဖၭဒိၪအဖၧၩ့နီၪလီၫ. ယိခွါ, ယလမၩဘံၭဘၪ",
			"10": "<sup>10</sup> ယနိၭယဟိဝၩဧ့, နၥ့ၪယၫနဝ့ၫလီၫ.- ယအီၪက့ၪၥူၪ နဆၧတီၩဆၧလီၩ့လၧယၥၭခံဖၧၩ့ဆ့အ့ၬ. နမၩတီၩ နလူဒဲထိးထဲၩ့တၩ့ထဲၩ့ဆၧနီၪယလီၩလၩ့လၬလၩ့လီၫ. တၭယအီၪက့ၪၥူၪခွံၬ ယဆၧအဲၪအခိးအတၩ, ဒဲဆၧ မွဲဆၧတီၩ လၧဆၧအီၪကီၪ့ဖၭဒိၪအဖၧၩ့ဆ့အ့ၬ.",
			"11": "<sup>11</sup> နဝ့ၫဒၪယဟိဝၩဧ့,နဆၧယၫ့ၥၭလဖၪနီၪ, ထီးပဒၩ့ လၧယဂးလဂ့ၩ. နဆၧအဲၪအခိးတၩဒဲနဆၧမွဲဆၧတီၩ",
			"12": "<sup>12</sup> နီၪမွဲအခိၭယိယၧၩ လထံၪဎးဆံၭ.- အဂဲးဘဲၫယီၩ ဆၧအၧၩ့ဆၧၥၫ့လဖၪ အီၪဝၬဖီၩ့ယၧၩ, ထီးဆၧဝံထၪ့နၬ ထၪ့လၥ့ၪဘၪတၭ, ယဆၧဒဲၩဘၭဘၪယၧၩနီၪ, ယယိ ဝ့ၫတၭယထိးနၧၩ့အ့ၬ, အဝ့ၫၥံၪအၪနဲၪ့ယခိၪၥူၫအဘီၩ့",
			"13": "<sup>13</sup> လဖၪနီၪဒံၭလီၫ. တၭယၥၭလၩ့ဆံၭဝ့ၫလီၫ.- ယဟိ ဝၩဧ့,မွဲဆၧဘၪနၥၭ လၧနမၩဖီၩ့မၩဖျ့ၭယၧၩဆံၭ. ယ",
			"14": "<sup>14</sup> ဟိဝၩဧ့,မၩဆၧၩ့ယၧၩချဲၫ့ချဲၫ့ဆံၭ.- ၦလၧအအၪ့ဎၬ ယၥၭဘဲၫၥိၭအမိမၩဂၭဂီၩ့ဝ့ၫနီၪ မွဲအမ့ၬဘၪမဲ, ဒဲဘၪ ဆၧအီၪက့ၪမဲအမ့ၬလစီၪ့ဎးဆံၭ. တၭၦလၧအဘၪအ ၥၭလၧယဘၪဆၧအၧၩ့လဖၪနီၪ, မွဲအဂၧၩ့ထဲၩ့အၥၭ",
			"15": "<sup>15</sup> တၭ,ဘၪဆၧအီၪက့ၪမဲအမ့ၬဆံၭ.- ၦလၧအစံၭယၧၩ, ဟဲၬ,ဟဲၬ, နီၪ, မွဲအဝ့ၫၥံၪအီၪယူဝ့ၫ လၧအဆၧမ့ၬမဲ",
			"16": "<sup>16</sup> အကၠီၩ့နီၪဆံၭ.- တၭၦလၧအအၪ့ဎၬနၧၩ ထီးအလူၬ လဖၪနီၪ, မွဲအၥုၪ့ဎွံၫၥၭယီၫ ၥုၪ့ထိၬၥၭထိၬလၧနဖၧၩ့ ဆံၭ.တၭၦလၧအအဲၪ နဆၧထိးထဲၩ့တၩ့ထဲၩ့လဖၪ နီၪ,မွဲအစံၭလထံၪဎးဘီၩ့ဎး လၧယဟိဝၩအဂဲးနီၪ,မွဲ",
			"17": "<sup>17</sup> အဘၪဆၧအီၪက့ၪဒိၪဝ့ၫဆံၭ.- တၭယဝ့ၫဒၪယီၩယမွဲ ၦဘၪၡၪ့ဘၪနၭ ဒဲၦၡၪ့ဖိၪယၬဖိၪလီၫ. မွဲလါနၫ့တၭ, ကဆါနီၪဆီၫ့မီၪ့ဆၧလၧယဂးလီၫ. နမွဲယဆၧမၩဆၧၩ့, ဒဲယဆၧမၩဖီၩ့မၩဖျ့ၭလီၫ. ယယွၩဧ့, ထီးၥုၭနံၩၥုၭ ၥၫ့လဂ့ၩ."
		},
		"41": {
			"1": "<sup>1</sup> ၦလၧအကၩ့ကၩဆၧ လၧၦၡၪ့ဖိၪယၬဖိၪအဂးနီၪ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ. လၧဆၧအၧၩ့ဆၧၥၫ့ အမုနံၩနီၪ,",
			"2": "<sup>2</sup> ယဟိဝၩမိမၩဖီၩ့မၩဖျ့ၭအဝ့ၫဒၪလီၫ.- တၭယဟိဝၩ ယိလၩ့ခွါလၩ့ဝ့ၫတၭ, ဒုၭမၧၫ့ဒံၭအဝ့ၫဒၪလီၫ. တၭ အဝ့ၫဒၪမိဘီၪထၪ့ယီၫထၪ့ လၧထံၫၥံၪခးၥံၪအဖၧၩ့တၭ, နမိဖ့ၪလၫ့ခွံၬအဝ့ၫ ထီးအဒုၪအဒၩ အၥၭအီၪဝ့ၫနီၪဆ့",
			"3": "<sup>3</sup> အ့ၬ.- တၭယဟိဝၩ မိမၩဆီၪ့ထၪ့အဝ့ၫလၧ ဆၧလၩ့ ပွံၭလၩ့ဘဲၩအလးမံၫခိၪလီၫ. နမိတဲၩ့ဝဲၩအလးမံၫလၧ အဘၪဆၧဆၫအခံၫ့အခၫနီၪလီၫ.",
			"4": "<sup>4</sup> ယစံၭ, ယဟိဝၩဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩတၭ,မၩ ဘျၪထဲၩ့ယၥၭဆံၭ, အဂဲးဘဲၫယီၩယမၩမၪဘၪယူၭ",
			"5": "<sup>5</sup> နၧၩယူၭ.- ယဒုၪယဒၩနီၪ ချဲၩ့ဆၧအၧၩ့လၧယဂဲး ယကၠီၪ့တၭ, မွဲအမိၥံၫဒဲအမံၩ့ဂၭဂီၩ့နီၪ ဆံၭယံၬလဲၪ.",
			"6": "<sup>6</sup> အ့ၪဂဲၫယိဆၧနီၪ ချဲၩ့ဆၧအဘျံၭအဘျၪတၭ လၧအ ၥၭခံဖၧၩ့နီၪ အီၪက့ၪကီၪ့ဆၧအၧၩ့ဆၧၥၫ့ လၧအဂးဒၪ ဝ့ၫလီၫ.တၭစဲၪ့ထၪ့ဝ့ၫလၧခီၫနီၪ လီၩလၩ့လၬလၩ့ဝ့ၫ",
			"7": "<sup>7</sup> ဒၪလီၫ.- ကယဲၦလၧအမ့ၬလဲၩယၧၩ ထီးအလူၬလဖၪ နီၪ, ချဲၩ့ဘံၪၥွံၫလိၬအၥၭ ထၫ့ဒုၪဒၩယၧၩလီၫ. တၭအ",
			"8": "<sup>8</sup> ဝ့ၫၥံၪကိၪ့ထၪ့ဆၧအၧၩ့လၧယဂးလီၫ.- စံၭဝ့ၫ ဆၧ အၧၩ့ဘုၭထၬလၧအဝ့ၫနီၪတၭ, လၧအလးမံၫနီၪမိဂဲ",
			"9": "<sup>9</sup> ထုၪ့လၧၩ့အ့ၬ.- မွဲမၬ, ယထံၩယၥိၭလၧယဒိၭနဲၩ့ယ ၥၭလၧအစူၪဖၧၩ့, လၧအအၪ့ယကိၪဆ့လဂၩနီၪ ထၧၫ့ယၧၩလၧအခၪ့နိးခဲၫ့လီၫ.",
			"10": "<sup>10</sup> တၭနဝ့ၫဒၪယီၩ, ယဟိဝၩဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩ, ဘိၭဆၧၫ့ထုၪ့ယၧၩ လၧယမိဖ့ၪထဲၩ့အဝ့ၫ အဂဲးနီၪ",
			"11": "<sup>11</sup> ဆံၭ.- တၭယၥ့ၪယၫဆၧမုၬနၥၭလၧယဖၧၩ့, အဂဲး ဘဲၫယီၩယဒုၪယဒၩၥုၪ့ဎွံၫၥၭယီၫ လၧယဖၫ့ခိၪအ့ၬ.",
			"12": "<sup>12</sup> တၭဆၧလၧယၧၩယီၩ, နဒုၭအီၪဂုးအီၪခၧၫ့ယၧၩလၧ ယဆၧလၧၫ့ဆၧဎွ့ၩအဖၧၩ့တၭ, နအီၪက့ၪလၩ့ယၧၩ လၧနမ့ၬယၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"13": "<sup>13</sup> ယဟိဝၩအံၫစရ့လၭအယွၩနီၪ မွဲအဘၪဆၧစံၭထၪ့ အၪ့အူၭဝ့ၫ လၧအဆိၩဆိၩအကၠၪကၠၪ, ဒဲထီၩ့လၧအ ဆိၩဆိၩအကၠၪကၠၪနီၪဆံၭ. အၩမံၩ့, ဒဲအၩမံၩ့."
		},
		"42": {
			"1": "<sup>1</sup> တၭဘဲၫခ့ၫဘၩ့ဆိၫ့ဒၪန့ထံၫချိၬအၥိၭနီၪ, ယၥၭဆိၫ့",
			"2": "<sup>2</sup> ဒၪန့နၧၩဘဲၫနီၪၥိၭ,ယွၩဧ့,- ဆၧၥူၫယၥၭလၧယွၩ, ယွၩလၧအမၧၫ့ဝ့ၫလဂၩလီၫ. တၭယမိလ့ၩအီၪဘၪ",
			"3": "<sup>3</sup> လၧယွၩအမ့ၬယၫဆံၭယံၬခိၬလဲၪ,- လၧအဝ့ၫၥံၪစံၭ ယၧၩလထံၪဎးအဘိၩ့ဘၭ, မွဲနယွၩအီၪခီၫခီၫလဲၪနီၪ, ယမ့ၬထံၫမွဲယဆၧအၪ့ လၧမုဆၫဒဲလၧမုနၩလီၫ.",
			"4": "<sup>4</sup> ထီးယအ့ၪနၪ့ထၪ့ထဲၩ့ဆၧလဖၪယီၩတၭ, ယလူၫ လၩ့ခွံၬယၥၭလၧယဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ယလ့ၩ ယူၭလၧၦခမျၧးအၥိၭ, ယလ့ၩယဝ့ၫလၧအၥိၭ လၧ ယွၩအဂံၪ့ လၧဆၧၥုၪ့ဎွံၫၥၭယီၫအၥီၫ, ဒဲဆၧစံၭထၪ့အၪ့ အူၭတၭ, ယအီၪလၧၦခမျၧးအၥိၭလၧအမၩဘိၪ့ဆၧ လီၫ.",
			"5": "<sup>5</sup> ယၥၭဧ့, မွဲဘၪနီၫလၫလၧ နၥုၪ့ခါနၥၭလၩ့နီၪလဲၪ, တၭနၥုၪ့ခိနၥၭဝီၩ လၧယဖၧၩ့မွဲဘၪလဲၪ. ယိလါနဝ့ၫ လၧယွၩအဖၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩယမိစံၭထၪ့အၪ့အူၭ ဒံၭအဝ့ၫနီၪဒံၭ, လၧအမွဲယဆၧထိးထဲၩ့တၩ့ထဲၩ့ ဒဲယ ယွၩလီၫ.",
			"6": "<sup>6</sup> ယၥုၪ့ခါယၥၭလၩ့လၧယဖၧၩ့လီၫ. မၩအၥၭဘဲၫနီၪ တၭ, ယမိနၪ့ထၪ့ထဲၩ့နၧၩလၧယီၫဒၫ့အခးဖၧၩ့, ဒဲလၧ ဟၧမၧၫ့ၥံၪ, ဒဲလၧခိၪလီၩ့မဲဇၫ အလီၩ့နီၪလီၫ.",
			"7": "<sup>7</sup> ထံၫယိၬဖၧၩ့ကိၭထၪ့ဝ့ၫ လၧထံၫယိၬဖၧၩ့လၧနထံၫ လၩ့ဆ့ၭလဖၪအၥီၫလီၫ. ကယဲနလပီၩဘွၩခိၪ ဒဲနလ",
			"8": "<sup>8</sup> ပီၩမုလဖၪဂဲၫချႃၬဘံၭယၧၩလီၫ.- လၧမုဆၫလခီၫနီၪ ယဟိဝၩ မၪလူၬအဆၧအဲၪအခိးအတၩ, ဒဲလၧမုနၩ လခီၫအဆၧၥံၫကျံၩ အီၪလၧယၧၩတၭ, ယဆၧဘၩဆိၪ",
			"9": "<sup>9</sup> ဖၪထီၩ့လၧယၥၭမၧၫ့အယွၩလီၫ.- ယမိစံၭ,ယလဲၫ့, ယွၩဧ့, မွဲဘၪနီၫလၫလၧနၥၭနၪ့ယၧၩလဲၪ. ယလ့ၩဆၧ တၭ,ယလ့ၩလၧဆၧၥုၪ့အုၭၥၭအုၭ လၧဒုၪဒၩမၩအၧၩ့",
			"10": "<sup>10</sup> ဆၧအကၠီၩ့နီၪမွဲဘၪလဲၪ.- ထီးယဒုၪယဒၩစံၭယၧၩ ကိၭမုနံၩမုနၩဒ့ၭ, နယွၩအီၪခီၫခီၫလဲၪနီၪတၭ, ဒုၪဒွ့ၪ ယၧၩတၭ,မၩအၥၭဘဲၫဆၧမၩလၩ့ဘျ့ၭ ယဎွံၪလဖၪ လီၫ.",
			"11": "<sup>11</sup> ယၥၭဧ့, မွဲဘၪနီၫလၫလၧနၥုၪ့ခါနၥၭလၩ့နီၪလဲၪ. တၭနၥုၪ့ခိနၥၭဝီၩ လၧယဖၧၩ့မွဲဘၪလဲၪ. ယိလါနဝ့ၫ လၧယွၩအဖၧၩ့ဆံၭ, အဂဲးဘဲၫယီၩ ယမိစံၭထၪ့အၪ့ အူၭဒံၭအဝ့ၫနီၪဒံၭ, လၧအမွဲယဆၧထိးထဲၩ့တၩ့ထဲၩ့, ဒဲယယွၩလီၫ."
		},
		"43": {
			"1": "<sup>1</sup> စ့ၩရၫ့ယၧၩယွၩဧ့, တၭချဲၩ့ခွးလၧယဂးလၧၦလဆံၫ့ လဎံၪဘၪလဆၨၩနီၪဆံၭ. မၩဖီၩ့မၩဖျ့ၭခွံၬယၧၩလၧ",
			"2": "<sup>2</sup> ၦအၪ့လီၫဆၧ, ၦအၧၩ့လဂၩနီၪဆံၭ.- အဂဲးဘဲၫယီၩ နမွဲယဂဲးယဘၭအယွၩလီၫ. တၭမွဲဘၪနီၫလၫလၧနခွံၬ ၡိၭခွံၬယၧၩလဲၪ. ယလၩ့လၧဆၧၥုၪ့အုၭၥၭအုၭလၧ",
			"3": "<sup>3</sup> ဒုၪဒၩမၩအၧၩ့ဆၧအကၠီၩ့နီၪ, မွဲဘၪလဲၪ.- အၪ့မၧၫ့ လၩ့နဆၧဖၩ့ ဒဲနဆၧမွဲဆၧတီၩနီၪ, မွဲအၥိၫ့ယၧၩဆံၭ. မွဲအဒုၭလ့ၩယၧၩ လၧနခိၪလီၩ့ဆံၫ့ဎံၪ, ဒဲထီၩ့လၧန",
			"4": "<sup>4</sup> အီၪအလးနီၪဆံၭ.- တၭယမိဂဲၫလၧယွၩ အဆၧလု လး,ထီၩ့လၧယွၩလၧအမွဲယဆၧၥၭထိၬ, ဒဲယၥုၪ့ဎွံၫ ၥၭယီၫလဂၩအအီၪနီၪလီၫ. တၭယမိစံၭထၪ့အၪ့အူၭ နၧၩလၧနါဒံၩ့, ယွၩ, ယယွၩဧ့.",
			"5": "<sup>5</sup> ယၥၭဧ့, မွဲဘၪနီၫလၫလၧနၥုၪ့ခါနၥၭလၩ့လဲၪ.တၭ နၥုၪ့ခိနၥၭဝီၩလၧယဖၧၩ့မွဲဘၪလဲၪ. ယိလါနဝ့ၫလၧ ယွၩအဖၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩ ယမိစံၭထၪ့အၪ့အူၭ ဒံၭအဝ့ၫနီၪဒံၭ, လၧအမွဲယဆၧထိးထဲၩ့တၩ့ထဲၩ့, ဒဲယ ယွၩလီၫ."
		},
		"44": {
			"1": "<sup>1</sup> ယွၩဧ့, ပနါဂၧၫ့ယူၭလၧပနါ, ပဖါၥံၪလီၩလၩ့လၬ လၩ့ပၧၩ လၧဆၧမၩလၧနမၩလၧမုနံၩလဖၪ လၧဖျိၩ့",
			"2": "<sup>2</sup> နီၪလီၫ.- နနၫ့ထၪ့ခွံၬၦဆၨၩၥံၪလၧနစူၪတၭ, နၥုၪ့လၩ့ ဖျၭလၩ့အဝ့ၫၥံၪ, နမၩဂၭဂီၩ့ၦခမျၧးလဖၪတၭ, ၦလ",
			"3": "<sup>3</sup> ဖၪနီၪနဒုၭအၪထၪ့လီၫ.- အဂဲးဘဲၫယီၩ လမွဲဘၪအဝ့ၫ ၥံၪမၩန့ခးနီၪ လၧအနၭဒၪဝ့ၫအကၠီၩ့, ဒဲမွဲအစူၪဒၪဝ့ၫ မၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪဆ့အ့ၬ. အ့ၪမွဲနစူၪထွ့ၪဒဲနစူၪဒၪ နဝ့ၫဒဲနမ့ၬအဆၧဖၩ့လီၫ. အဂဲးဘဲၫယီၩနခိးနတၩအီၪ လၧအဝ့ၫၥံၪအဂးလီၫ.",
			"4": "<sup>4</sup> နဝ့ၫဒၪယီၩနမွဲယစဎွၩ, ယွၩဧ့,မၪလူၬဆၧမၩဖီၩ့",
			"5": "<sup>5</sup> မၩဖျ့ၭလၧစယၫကူၭအဂးဆံၭ.- တၭပမိဆၪ့လၩ့ ပဒုၪပဒၩလၧနကၠီၩ့ လၧနမံၩ့အကၠီၩ့နီၪတၭ, ပမိယဲး",
			"6": "<sup>6</sup> ထဲးၦလၧအဂဲထုၪ့ထၫ့ဒုၪဒၩပၧၩလီၫ.- အဂဲးဘဲၫယီၩ ယမိဒိၭနဲၩ့ယၥၭလၧယချံၪအ့ၬ. တၭယနၭနီၪမိထိး",
			"7": "<sup>7</sup> ထဲၩ့တၩ့ထဲၩ့ယၧၩဆ့အ့ၬ.- အ့ၪမွဲနမၩဖီၩ့မၩဖျ့ၭ ပၧၩလၧပဒုၪပဒၩအစူၪဖၧၩ့တၭ, ၦလဖၪလၧအမ့ၬ",
			"8": "<sup>8</sup> လဲၩပၧၩနီၪ, နဒုၭမဲအဝ့ၫၥံၪအမ့ၬလီၫ.- ပအီၪက့ၪဖိၫ လိၫပၥၭၥံၫ့ၥံၫ့နံၩလၧယွၩအဖၧၩ့တၭ, ပမိစံၭထၪ့အၪ့ အူၭနမံၩ့လၩ့ဆိၩလၩ့ကၠၪလီၫ. (စ့လၫ.)",
			"9": "<sup>9</sup> နဝ့ၫဒၪနခွံၬၡိၭပၧၩ, ဒဲဒုၭမ့ၬမဲပၧၩတၭ,နလ့ၩထၪ့",
			"10": "<sup>10</sup> လၧပၥုၭမုၥံၪအၥိၭဆ့အ့ၬ.- နဒုၭထဲၩ့ထဲၩ့ပၧၩလၧပ လးခဲၫ့လၧပဒုၪပဒၩအမ့ၬယၫတၭ, ၦလၧအမ့ၬလဲၩ",
			"11": "<sup>11</sup> ပၧၩလဖၪနီၪ အၪ့ဂူၬန့ဆၧလၧအဂးဒၪဝ့ၫလီၫ.- နအီၪ က့ၪပၧၩဘဲၫၥိၪလဖၪ လၧဆၧအၪ့အဂးအၥိၭတၭ, န မၩလၩ့ပြံၩလၩ့ပၩပၧၩ လၧၦဆၨၩၥံၪအကျၩလီၫ.",
			"12": "<sup>12</sup> နအၪ့ဆၫခွံၬနၡၩခမျၧး လၧအလမွဲဘၪဆၧနးမံၩ့အဂး တၭ,နဆၧဒၪနဝ့ၫနီၪအၪထၪ့ လၧအဝ့ၫၥံၪအဎွ့ၩနီၪဆ့",
			"13": "<sup>13</sup> အ့ၬ.- တၭနအီၪက့ၪပၧၩ လၧဆၧဒုၪဒွ့ၪအလးလၧၦ အီၪလၧပနဲၩ့ထံၭအဂး, ဆၧချဲၩ့ကြၩ့ထမးအလး, ဒဲ ဆၧနံဘၪဒုၪဒွ့ၪအလး လၧၦအီၪဝၬဖီၩ့ပၧၩအဂးလီၫ.",
			"14": "<sup>14</sup> တၭနအီၪက့ၪပၧၩ လၧဆၧချဲၩ့ဒီၩ့ လၧၦဆၨၩၥံၪအ ကျၩ,ဆၧဂံၩဂုအခိၪအလး လၧၦခမျၧးအကျၩလီၫ.",
			"15": "<sup>15</sup> ဆၧအီၪက့ၪမဲယမ့ၬအီၪဝ့ၫ လၧယမ့ၬယၫကိၭမုနံၩမု",
			"16": "<sup>16</sup> နၩဒ့ၭတၭ, ယဆၧမ့ၬမဲလုၬဘံၭခွံၬယၧၩ,- လၧၦဒုၪ ဒွ့ၪဆၧဒဲၦချဲၩ့အၧၩ့ဆၧအလူအကၠီၩ့, လၧဆၧအဒုၪအ ဒၩဒဲၦမၩဆၧၫ့ဆၧအၧၩ့အကၠီၩ့နီၪလီၫ.",
			"17": "<sup>17</sup> ကယဲဆၧထီးအလူၬနီၪ လၩ့ဘၪပၧၩလါနၫ့ဘိၩပ ၥၭနၪ့နၧၩအ့ၬ. တၭပမၩနဆၧအုၩ့လၩ့ လၧဆၧအ",
			"18": "<sup>18</sup> ဘျံၭအဘျၪဆ့အ့ၬ.- တၭပၥၭဂၧၩ့ထဲၩ့အ့ၬ. တၭပခၫ",
			"19": "<sup>19</sup> ထၪ့ဆၧလဖၪနီၪ လ့ၩခၫ့ဖၬနဖၧၩ့ၥၭနီၪဆ့အ့ၬ.- မွဲလါ နၫ့ဘဲၫနီၪတၭ, နမၩလၩ့ဘျ့ၭပၧၩလၧထွံၪမံၩ့အိၩ့ယိၩ့ အလးဖၧၩ့တၭ, နလုၬဘံၭပၧၩလၧဆၧၥံၫအလၩၡုၪ",
			"20": "<sup>20</sup> လီၫ.- ပအ့ၪၥၭနၪ့ပယွၩအမံၩ့တၭ, ယူၬထၪ့ပစူၪလၧ",
			"21": "<sup>21</sup> ၦလခီၫဘၩ့မုးဖိၪ အယွၩတၭ,- ယွၩမိအၪ့ဎၬန့ဆၧ ယီၩမွဲအ့ၬဧၪ. အဂဲးဘဲၫယီၩ မွဲအၥ့ၪယၫပၥၭအဆၧ",
			"22": "<sup>22</sup> အီၪၥူၪလဖၪနီၪလီၫ.- အဂဲးဘဲၫယီၩ ပဘၪဆၧမၩၥံၫ ပၧၩၥံၫ့ၥံၫ့နံၩ လၧနကၠီၩ့တၭ, ဆၧအီၪက့ၪပၧၩဘဲၫၥိၪ ၥံၪလၧအမိဘၪဆၧမၩၥံၫဝ့ၫအၥိၭနီၪလီၫ.",
			"23": "<sup>23</sup> နၪ့ထၪ့ထဲၩ့ဆံၭ,မွဲဘၪနီၫလၫလၧနမံၫမၪလဲၪ, ကဆါ ဧ့, ဂဲထုၪ့ဆံၭ. ထီးခွံၬၡိၭပၧၩ လၩ့ဆိၩလၩ့ကၠၪလ",
			"24": "<sup>24</sup> ဂ့ၩ.- မွဲဘၪနီၫလၫလၧနအီၪက့ၪၥူၪခွံၬနမ့ၬ, ဒဲၥၭနၪ့ပ",
			"25": "<sup>25</sup> ဆၧၡၪ့ဆၧနၭ, ဒဲဆၧမၩနၧၩ့ပၧၩနီၫလဲၪ.- အဂဲးဘဲၫ ယီၩပၥၭကူၭလၩ့ဝ့ၫ ထီၩ့လၩ့လၧဂၪ့ခိၪအမုၬလီၫ.ပ",
			"26": "<sup>26</sup> ဂူၭဖိၫ့ဘုၭထၬလၧဂၪ့ခိၪလီၫ.- ဂဲထုၪ့မၩဘိၭမၩဆၧၩ့ ပၧၩတၭ, ဎွ့ၩန့ထဲၩ့ပၧၩ လၧဆၧယၫ့ၥုၪ့ယၫ့ၥၭအကၠီၩ့ နီၪဆံၭ."
		},
		"45": {
			"1": "<sup>1</sup> ယၥၭလၬထၪ့လၩ့လၬလၧဆၧဂ့ၩလမံၩ့, ယမိလီၩ လၩ့လၬလၩ့ယဆၧမၩ လၧစဎွၩအဂးလီၫ. တၭယ ဖျ့ၩမွဲၦလၧအကွ့ၭလံၬဖျဲၪလဂၩအနိၪကွ့ၭလီၫ.",
			"2": "<sup>2</sup> နဎံၫနဲၪ့လၩနဲၪ့ၦၡၩဖိၪဒံၭလီၫ. ဆၧအဎံၫအလၩ လူၫလၩ့အၥၭလၧဆၧနိၭဖျံၩလဖၪအလီၩ့လီၫ. မၩအ ၥၭဘဲၫနီၪတၭ, ယွၩဆိၪဂ့ၩနၧၩ အဆိၩဆိၩအကၠၪကၠၪ လီၫ.",
			"3": "<sup>3</sup> ခဲးထၪ့နနၭ လၧနကံၪထံၭအလီၩ့, ဆၧဒိၪဆၧဆီၪ့",
			"4": "<sup>4</sup> လဂၩဧ့, အီၪလၧနလၩနဖၩ့ နစီၩ့နမၩ့ဆံၭ.- ဘီၪထၪ့ ယီၫထၪ့တၭ, ထူၬဆၧလၧနစီၩ့နမၩ့ လၧဆၧမွဲဆၧတီၩ, ဒဲဆၧၥုၪ့ဆၧၩ့ၥၭဆၧၩ့, ဒဲဆၧတီၩဆၧလီၩ့အကၠီၩ့နီၪ ဆံၭ.တၭနစူၪထွ့ၪမိၥီၪ့လိၪနၧၩ လၧဆၧၥၭမဲၪလဖၪ",
			"5": "<sup>5</sup> နီၪလီၫ.- နဖျါအနါအဲၪ့လၧစဎွၩ အဒုၪအဒၩအၥၭခံ ဖၧၩ့တၭ, ၦခမျၧးမိလၩ့ထံၩဖါလၧနဖၫ့လၬလီၫ.",
			"6": "<sup>6</sup> နလးဆီၩ့ဆီယွၩဧ့, အီၪဝ့ၫအဆိၩဆိၩ အကၠၪကၠၪ လီၫ. နဘၩ့နမုးအနိၪထိၭစဎွၩနီၪ မွဲဆၧတီၩဆၧလီၩ့ အနိၪထိၭလီၫ.",
			"7": "<sup>7</sup> နအဲၪဆၧတီၩဆၧလီၩ့တၭ, နမ့ၬလဲၩဆၧအၧၩ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယွၩ, နယွၩဂုၪနၧၩလၧဆၧၥၭထိၬ",
			"8": "<sup>8</sup> အၥိၪလၧနထံၩနၥိၭအဖၫ့ခိၪလီၫ.- မူၫရၫ့ဒဲအကၠီၫ, ဒဲ ကဒၩရၫအဖံၭနီၪ မွဲနကီၩ့နၥိၭထီးအလူၬ, လၧနီးက",
			"9": "<sup>9</sup> ဆၫ့မဲၪအဖၧၩ့နီၪဆၧဒုၭၥုၪ့ထိၬၥၭထိၬနၧၩလီၫ.- တၭ စဎွၩအဖိၪမုၪၥံၪအီၪဝ့ၫ လၧနၡၩ လၩဖၩ့ဖိၪအကျၩ လီၫ.နးဎွၩမုၪနီၪ အီၪကယၧၩ့အၥၭ လၧအိဖၧၫအ ထီၫ့တၭ,ဆၧၫ့ထုၪ့လၧနစူၪထွ့ၪနီၪလီၫ.",
			"10": "<sup>10</sup> ခိၭနၪ,ဖိၪမုၪဧ့, ယိခွါ, ဒိၭနနါတၭ, ၥၭနၪ့ခွံၬနၡၩခ",
			"11": "<sup>11</sup> မျၧးဒဲနဖါအဂံၪ့ဆံၭ.- မွဲစဎွၩဆိၫ့န့ဘၪအၥၭလၧနဎံၫ နလၩဆံၭ, အဂဲးဘဲၫယီၩ အဝ့ၫဒၪနီၪ မွဲနကဆါလီၫ.",
			"12": "<sup>12</sup> တၭဘိၪ့ထၪ့ဘၩထၪ့အဝ့ၫဒၪဆံၭ.- တၭတဲအၫအဖိၪ မုၪအီၪလၧအဆၧဖ့ၪလၫ့တၭ, ၦၥထံၫလၧၦခမျၧးအ ကျၩနီၪမိအၪ့ယၫဆၧလၧနမ့ၬယၫလီၫ.",
			"13": "<sup>13</sup> စဎွၩအဖိၪမုၪနီၪ အီၪလၧဆၧလၩဖၩ့ ထီးအလူၬအ ဖၧၩ့လီၫ. အကီၩ့အၥိၭ ဘၪဆၧဆၭကံၪဝ့ၫ လၧထီၫ့",
			"14": "<sup>14</sup> လီၫ.- တၭဆၧမိၥိၫ့အဝ့ၫနီၪ လၧစဎွၩအအီၪလၧအ ကီၩ့အၥိၭဘၪဆၧဆၭကံၪဝ့ၫလီၫ. အထံၩအၥိၭ, ၦမုၪ နၩ့ၥံၪလၧအဖိၬအခဲၫ့နီၪ, ဆၧမိဒုၭဂဲၫလၧနအီၪလီၫ.",
			"15": "<sup>15</sup> တၭဆၧမိၥိၫ့အဝ့ၫၥံၪ လၧဆၧၥုၪ့ဎွံၫၥၭယီၫ, ဒဲလၧဆၧ ၥုၪ့ထိၬၥၭထိၬတၭ, မိဂဲၫနုၬဝ့ၫလၧစဎွၩအနီးဖၧၩ့နီၪ လီၫ.",
			"16": "<sup>16</sup> လၧနဖါၥံၪအလးနီၪ နဖိၪခွၫၥံၪမိအီၪဝ့ၫ, နမိအီၪ က့ၪထၪ့အဝ့ၫၥံၪ လၧၦဒိၪဖၭဒိၪလဖၪ လၧဂၪ့ခိၪချိၫ့ ထၧၫ့ဖျိၪ့ယၫလီၫ.",
			"17": "<sup>17</sup> ယမိဒုၭနၪ့ထၪ့ထဲၩ့နမံၩ့ လၧၦအဆၨၩၥံၪထီးအလူၬ အကျၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ၦခမျၧးၥံၪမိစံၭထၪ့ အၪ့အူၭနၧၩအဆိၩဆိၩအကၠၪကၠၪလီၫ."
		},
		"46": {
			"1": "<sup>1</sup> ယွၩမွဲဆၧဖလ့ၬအလးလၧပဂး, ဒဲပဂဲးပဘၭဆ့လီၫ. လၧဆၧမၩခိမၩဝီၩအဖၧၩ့နီၪ, ပဒၪန့အဝ့ၫလၧအမွဲ",
			"2": "<sup>2</sup> ဆၧမၩဆၧၩ့ဖၭဒိၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဂၪ့ခိၪ အ့ၪအၪ့လဲၩအလးလါနၫ့ဘိၩ, ခိၪလီၩ့ထိၩ့ချိၬအ့ၪ ဘၪဆၧဆိၬထၪ့ခွံၬ လၧမၫဆမံၭ အၥၭခံဖၧၩ့လါနၫ့",
			"3": "<sup>3</sup> ဘိၩပၥၭမဲၪဆၧအ့ၬ.- မွဲအထံၫလဖၪၥီၫထၪ့ ဧီၫဧီၫဒဲအ ပၠူၭထၪ့နီၪ မွဲခိၪလီၩ့ထိၩ့ချိၬၡိၩ့ၡိၬ လၧအထၪ့ထီၫအ ကၠီၩ့နီၪဆံၭ.(စ့လၫ.)",
			"4": "<sup>4</sup> တၭထံၫမိၡါအီၪလဘီၩ့နီၪ, အထံၫထဲၩ့ဖၭလဖၪနီၪ ဒုၭၥၭထိၬယွၩအဒိၩ့, ဆၧထီၫထုၬလဂၩအအီၪအလး",
			"5": "<sup>5</sup> ဆံၫ့ဎံၪလီၫ.- ယွၩအီၪဝ့ၫလၧအၥၭခံဖၧၩ့တၭ, မိဝၭ ထိၬဝ့ၫဆ့အ့ၬ. လၧဆၧဖၩ့ထၪ့နီၪ ယွၩမိမၩဆၧၩ့ဝ့ၫ",
			"6": "<sup>6</sup> ဒၪလီၫ.- ၦဆၨၩၥံၪတုၩ့ထၪ့တုၩ့လၩ့တၭ, ဘၩ့မုးၥံၪ ဝၭဝ့ၫလီၫ. အဝ့ၫအလူၥီၫထၪ့နီၪ ဂၪ့ခိၪဖံထၪ့ဝ့ၫဒၪလီၫ.",
			"7": "<sup>7</sup> ဆၧၥုၭမုခမျၧး အယဟိဝၩ အီၪလၧပၥိၭတၭ, စ ယၫကူၭအယွၩနီၪ, မွဲဆၧဖလ့ၬအလးလၧပဂးလီၫ. (စ့လၫ.)",
			"8": "<sup>8</sup> ဂဲၫဘီၪ,ယိခွါ, ယဟိဝၩအဆၧမၩလဖၪ,လၧအအီၪ",
			"9": "<sup>9</sup> က့ၪလၩ့ဆၧအီၪယူလဖၪ လၧဂၪ့ခိၪချိၫ့ယီၩဆံၭ.- တၭ မွဲအဒုၭအီၪထီလၧဆၧဒုၭၥုၭလဖၪ ထီၩ့လၧဂၪ့ခိၪအ ထုၬလီၫ. မၩခါချံၪၥံၪဖျါၥံၪနီၪ, ဒဲဒၪ့ထ့ၬခွံၬဖၩ့ၥံၪနၭ",
			"10": "<sup>10</sup> ၥံၪဒဲဆူၭထၪ့ခွံၬ လဲၪ့ၥုၭလဖၪလၧမ့ၪလီၫ.- အီၪလၩ့မါ ပံၭတၭ, ၥ့ၪယၫလၧယမွဲယွၩဆံၭ. ယမိဘၪဆၧအီၪ က့ၪထၪ့ထီၫယၧၩ လၧၦဆၨၩၥံၪအကျၩတၭ, ယမိဘၪ ဆၧအီၪက့ၪထၪ့ထီၫယၧၩလၧဂၪ့ခိၪချိၫ့လီၫ.",
			"11": "<sup>11</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩ အီၪလၧပၥိၭတၭ, စယၫ ကူၭအယွၩနီၪ မွဲဆၧဖလ့ၬအလးလၧပဂးလီၫ."
		},
		"47": {
			"1": "<sup>1</sup> ကယဲၦခမျၧးၥံၪဧ့, ဒဲၩနၥံၪအစူၪ, ကိၭၡၭထၪ့လၧ",
			"2": "<sup>2</sup> ယွၩလၧဆၧၥုၪ့ဎွံၫၥၭယီၫ အၥီၫနီၪဆံၭ.- အဂဲးဘဲၫ ယီၩယဟိဝၩဆၧထီၫထုၬနီၪ, မွဲဆၧၥၭမဲၪဖၭဒိၪအ လးလီၫ.မွဲစဎွၩဖၭဒိၪလၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫအဖၫ့ခိၪ",
			"3": "<sup>3</sup> လီၫ.- အဝ့ၫဒၪအီၪက့ၪၦခမျၧးလၧပဖၫ့လၬ, ဒဲၦဆၨၩ ၥံၪလၧပခၪ့ဖၫ့လၬလီၫ.",
			"4": "<sup>4</sup> တၭအဝ့ၫဒၪမိရွံန့ ဆၧန့ၥၫလၧပဂး, စယၫကူၭလၧ အအဲၪဝ့ၫအဆၧဂ့ၩဆၧဘၪလီၫ. (စ့လၫ.)",
			"5": "<sup>5</sup> ယွၩလ့ၩထၪ့ယူၭလၧဆၧကိၭၡၭထၪ့တၭ, ယဟိဝၩ",
			"6": "<sup>6</sup> နီၪလၧခွ့ၩအၥီၫလီၫ.- ၥံၫကျံၩစံၭထၪ့အၪ့အူၭယွၩ, ၥံၫကျံၩစံၭထၪ့အၪ့အူၭ, ၥံၫကျံၩစံၭထၪ့အၪ့အူၭပစဎွၩ,",
			"7": "<sup>7</sup> ၥံၫကျံၩထၪ့ဆၧစံၭထၪ့အၪ့အူၭဆံၭ.- အဂဲးဘဲၫယီၩ ဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫ အစဎွၩနီၪမွဲယွၩလီၫ. ၥံၫကျံၩစံၭ",
			"8": "<sup>8</sup> ထၪ့အၪ့အူၭလၧထၭခိၪၥီၪ့ဆၧအဖၧၩ့နီၪဆံၭ.- ယွၩ ကဲၪစဎွၩလၧၦဆၨၩၥံၪအဖၫ့ခိၪ, ယွၩဆၧၫ့နၩ့လၧအ",
			"9": "<sup>9</sup> လးဆီၩ့ဆီဆံၫ့ဎံၪအဖၫ့ခိၪလီၫ.- ၦခမျၧးအၦဒိၪဖၭဒိၪ အီၪကိၩ့အီၪကီၪ့ လၧစအၫဘြဟၫ့အယွၩအၡၩခမျၧး အအီၪနီၪလီၫ. အဂဲးဘဲၫယီၩ ဂၪ့ခိၪအထၩ့ဖံၭလဖၪ အီၪလၧယွၩတၭ, အဝ့ၫဒၪဘၪဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫ ထီၫထီၫလ့ၬလီၫ."
		},
		"48": {
			"1": "<sup>1</sup> ယဟိဝၩနီၪမွဲဖၭဒိၪတၭ, ဆၧမိဘၪအၪ့အူၭထၪ့အ ဝ့ၫဖၭဒိၪ လၧပယွၩအဒိၩ့ဖၧၩ့, လၧအခိၪလီၩ့ ဆံၫ့ဎံၪ",
			"2": "<sup>2</sup> အလီၩ့လီၫ.- ခိၪလီၩ့ဇံအိၫ့အလးမုၬဝ့ၫတၭ, မွဲဂၪ့ခိၪ ထၧၫ့ဖျိၪ့ယၫအဆၧၥုၪ့ဎွံၫၥၭယီၫ အလးတၭ, စဎွၩဖၭ ဒိၪအဒိၩ့အီၪဝ့ၫ လၧအနဲၩ့ဖၩၥံၪ အမုဖၩလခီၫလီၫ.",
			"3": "<sup>3</sup> ၦၡၩၥ့ၪယၫယွၩလၧအနီးလဖၪအဖၧၩ့ လၧအမွဲဆၧဖ",
			"4": "<sup>4</sup> လ့ၬအလးလီၫ.- အဂဲးဘဲၫယီၩ, ယိခွါ, စဎွၩၥံၪအီၪ",
			"5": "<sup>5</sup> ကိၩ့အီၪကီၪ့တၭ လ့ၩဝ့ၫဒၪလစီၪ့ဎးလီၫ.- အဝ့ၫၥံၪဒၪ ဘၪဝ့ၫဘဲၫနီၪတၭ, ထီးနီၪလဖၧၫ့ ထီၫမံၫထီၫမၪဝ့ၫ, ၥၭ",
			"6": "<sup>6</sup> မဲၪၥၭဖျဲၩ့ဆၧတၭ စဲၪ့တလဲးခွံၬဝ့ၫလီၫ.- ဆၧဝၭထိၬ ဖီၪ့ထၬအဝ့ၫၥံၪထီးနီၪ, ဆၧဆိၭက့ၭဘဲၫၦမုၪလၧအ",
			"7": "<sup>7</sup> ဆီၫ့အီၪန့ဆၧနီၪလီၫ.- နမၩဂၭဂီၩ့တၫၡံၭ အကဘၩ့",
			"8": "<sup>8</sup> ၥံၪလၧလံၩမုထၪ့လခီၫနီၪလီၫ.- ဘဲၫပနါဂၧၫ့ဆၧအၥိၭ နီၪ,ပဒၪဘၪဆၧ လၧၥုၭမုခမျၧး အယဟိဝၩ အဒိၩ့ ဖၧၩ့,လၧပယွၩအဒိၩ့ဖၧၩ့လီၫ. ယွၩမိဒုၭအီၪဂုးအီၪ ခၧၫ့လၩ့ဆိၩလၩ့ကၠၪလီၫ. (စ့လၫ.)",
			"9": "<sup>9</sup> ယွၩဧ့, ပနၪ့ထၪ့ထဲၩ့နဆၧအဲၪအခိးအတၩလၧနနီး",
			"10": "<sup>10</sup> ဆံၫ့ဎံၪအဖၧၩ့လီၫ.- ယွၩဧ့, ဘဲၫနမံၩ့အၥိၭနီၪ, နဆၧ စံၭထၪ့အၪ့အူၭ မွဲဘဲၫနီၪၥိၭ ထီၩ့လၧဂၪ့ခိၪအထုၬလဖၪ နီၪလီၫ. နစူၪထွ့ၪနီၪလၧၫ့ဎွ့ၩဝ့ၫ လၧဆၧတီၩဆၧလီၩ့",
			"11": "<sup>11</sup> လီၫ.- မွဲခိၪလီၩ့ဇံအိၫ့ၥုၪ့ထိၬၥၭထိၬ, မွဲယုဒၫအဖိၪ မုၪၥံၪၥုၪ့ဎွံၫၥၭယီၫ လၧဆၧစ့ၩရၫ့လဖၪအကၠီၩ့ဆံၭ.",
			"12": "<sup>12</sup> လ့ၩဝၬဖီၩ့ဇံအိၫ့နီၪ, လ့ၩဝၬဖီၩ့ဝ့ၫတၭ, ဝံထၪ့နၬ",
			"13": "<sup>13</sup> ထၪ့အတၨၭထီၫလဖၪဆံၭ.- ထီးနဲၪ့အခိၪဒၧၩ့လဖၪ, ယိဆီၫ့မီၪ့အနီးၥံၪအဂဲး ဘဲၫၥိၭနၥံၪမိလီၩဘၪ ၦအ",
			"14": "<sup>14</sup> ဆိၩလၧနၥံၪအလးခဲၫ့နီၪဆံၭ.- အဂဲးဘဲၫယီၩယွၩလ ဂၩယီၩမွဲပယွၩအဆိၩဆိၩ အကၠၪကၠၪတၭအဝ့ၫဒၪနီၪ မိၥိၫ့ပၧၩထီးပၥံၫလီၫ."
		},
		"49": {
			"1": "<sup>1</sup> ခိၭနၪဆၧယီၩ, ၦခမျၧးထီးလူၬၥံၪဧ့, တၭဒိၭနၥံၪ",
			"2": "<sup>2</sup> အနါ,ကယဲၦအီၪလၧဂၪ့ခိၪချိၫ့ထီးအလူၬၥံၪဧ့,- ၦအ ဆံၭမွဲဂ့ၩ,ၦအဒိၪမွဲဂ့ၩ, ၦၥထံၫၥံၪ, ဒဲၦၡၪ့ဖိၪယၬဖိၪ",
			"3": "<sup>3</sup> စီၪ့ဎးဆံၭ.- ယနိၭမိချဲၩ့ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪတၭ, ဆၧ ဆီၫ့မီၪ့လၧယၥၭခံဖၧၩ့ ဘၪဆဲၫ့လၧဆၧၥုၪ့ဖၭၥၭဖၭ",
			"4": "<sup>4</sup> လီၫ.- ယမိဒိၭယနါလၧဆၧချဲၩ့ဒီၩ့လၩ့တၭ, ယမိဝဲ ထၪ့ယဆၧချဲၩ့အဒီၩ့အထ့ၬ လၧနါဒံၩ့နီၪအလီၩ့လီၫ.",
			"5": "<sup>5</sup> လၧဆၧအၧၩ့အမုနံၩလဖၪအဖၧၩ့နီၪ, လၧၦခိၭၥူၪ ယၧၩလဖၪအဆၧအၧၩ့အီၪဝၬဖီၩ့ယၧၩတၭ, ယဘၪ",
			"6": "<sup>6</sup> ၥၭမဲၪဆၧနီၪမွဲဘၪလဲၪ.- ၦလဖၪနီၪဒိၭနဲၩ့အၥၭလၧ အစူၪလးအခၪ့ခိၪတၭ, အီၪက့ၪဖိၫလိၫအၥၭလၧအ",
			"7": "<sup>7</sup> ဆၧထူၭဆၧလၧၫ့အၪအကၠီၩ့လီၫ.- တၭၦၡၩဎွ့ၩန့ ထဲၩ့အထၧၫ့ဖုဝဲၥ့ၪလၩလါအ့ၬ, မွဲအဖ့ၪလၫ့ဆၧမၩဖီၩ့",
			"8": "<sup>8</sup> မၩဖျ့ၭလၧယွၩၥ့ၪဆ့အ့ၬ.- အဂဲးဘဲၫယီၩဆၧဎွ့ၩန့ ထဲၩ့အဝ့ၫၥံၪအၥၭမၧၫ့နီၪ, မွဲဆၧအဎွ့ၩဒိၪဒိၪလ့ၬတၭ,",
			"9": "<sup>9</sup> အဆိၩဆိၩအကၠၪကၠၪနီၪ,ဆၧမၩဝ့ၫၥ့ၪအ့ၬ.- ဘဲၫၥိၭ အမိမၧၫ့ဝ့ၫ အဆိၩဆိၩအကၠၪကၠၪတၭ, ထီးထီၩ့ဘၪ လၧဆၧၥွၪခိၪလဂ့ၩနီၪ, ဆၧမၩဖီၩ့မၩဖျ့ၭၥ့ၪအ့ၬ.",
			"10": "<sup>10</sup> အဂဲးဘဲၫယီၩအဝ့ၫနီၪ ဒၪဘၪလၧၦအကိၪ့ၥ့ၪၥံၫဝ့ၫတၭ, ၦဂီၩ့ဖိၪ ဒဲၦအၥၭခံၭနီၪ ဂၭဂီၩ့ဝ့ၫမီၪ့ဎီၩ့ဆ့တၭ, အီၪ က့ၪထၪ့အစူၪလးခၪ့ခိၪ လၧၦလၧအလးခဲၫ့အဂးလီၫ.",
			"11": "<sup>11</sup> တၭအဝ့ၫၥံၪဆီၫ့မီၪ့လၧအၥၭခံဖၧၩ့ လၧအဂံၪ့လဖၪမိ အီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪ, ဒဲအအီၪဝ့ၫအလးလဖၪနီၪ အဆိၩဆိၩအကၠၪကၠၪလီၫ. တၭကိၭအဂၪ့ခိၪဘဲၫအ",
			"12": "<sup>12</sup> မံၩ့ဒၪဝ့ၫအၥိၭနီၪလီၫ.- မွဲလါနၫ့ဘိၩ, ၦၡၩ, လၧဆၧ လၩဆၧဖၩ့အဖၧၩ့နီၪ, အီၪဂုးခၧၫ့အ့ၬ, လၩ့ဂၬဘဲၫဆၧ ဖိၪဆၧဎါလၧအဂၭဂီၩ့ဝ့ၫအၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> ဆၧနီၪမွဲအဝ့ၫၥံၪအဖၧၩ့ၥၭတၭ, မွဲၦအဂီၩ့လီၫ. မွဲ လါနၫ့ဘိၩ, ၦအီၪလၧအလးခဲၫ့လဖၪနီၪမုၬအၥၭလၧ",
			"14": "<sup>14</sup> အဝ့ၫၥံၪအဆၧချဲၩ့အဖၧၩ့ဆ့လီၫ.(စ့လၫ.)- တၭဆၧ အီၪက့ၪအဝ့ၫၥံၪ လၧဖျႃဖၧၩ့ဘဲၫၥိၪအၥိၭနီၪတၭ, ဆၧ ၥံၫဒိၪမိအၪ့ဝ့ၫတၭ, လၧဆၧဖၩ့ထၪ့နီၪ, ၦတီၩၦလီၩ့မိ ပၧၩ့ဘၪလီၫ. တၭအဎံၫအလၩ မိလူၬဝ့ၫလၧဖျႃဖၧၩ့",
			"15": "<sup>15</sup> လၧအအီၪဝ့ၫအလးလီၫ.- အ့ၪမွဲယွၩမိဎွ့ၩန့ထဲၩ့ယ ၥၭလၧဖျႃ အစီၩ့အမၩ့အဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ မိ",
			"16": "<sup>16</sup> မၩန့ယၧၩလီၫ.- ထီးၦလဂၩဂၩအ့ၪကဲၪ ၦၥထံၫဒဲအ",
			"17": "<sup>17</sup> ဂံၪ့အလၩအဖၩ့အၪထၪ့တၭ, ၥၭမဲၪလဂ့ၩ.- အဂဲးဘဲၫ ယီၩထီးအၥံၫတၭ, မွဲအထဲၩ့ဆိၬဆၧန့ နးမံၩ့အ့ၬ.",
			"18": "<sup>18</sup> တၭအလၩအဖၩ့နီၪ လ့ၩလၩ့ဖိၬအခဲၫ့ၥ့ၪအ့ၬ.- အဂဲး ဘဲၫယီၩ လၧအၥၭမၧၫ့ဒံၭအဘိၩ့ဘၭနီၪ ဆိၪဂ့ၩလၩ့ အၥၭလီၫ. နအ့ၪမၩဆၧဂ့ၩ လၧနဂးဒၪနဝ့ၫတၭ, ၦမိ",
			"19": "<sup>19</sup> စံၭထၪ့အၪ့အူၭနၧၩလီၫ.- တၭအဝ့ၫမိလ့ၩလၩ့လၧအ ဖါၥံၪအဆိၩအအီၪလီၫ. တၭမိဒၪဘၪလၧၩ့ဆၧဖၩ့နး",
			"20": "<sup>20</sup> ဆိၭအ့ၬ.- တၭၦၡၩအီၪလၧအလၩအဖၩ့ လၧအဆၧ ကိၪ့ၥ့ၪကိၪ့ဘၪလအီၪဘၪနီၪ လၩ့ဂၬဘဲၫဆၧဖိၪဆၧဎါ လၧအဂၭဂီၩ့အၥိၭနီၪလီၫ."
		},
		"50": {
			"1": "<sup>1</sup> ၦၥ့ၪဆၧလူၬလဂၩ,ယွၩ, ယဟိဝၩချဲၩ့ဆၧတၭ,ကိၭ",
			"2": "<sup>2</sup> ၦဂၪ့ခိၪဖိၪလၧမုထၪ့ထီၩ့လၧမုနုၬ.- လၧဇံအိၫ့ဆၧဎံၫ",
			"3": "<sup>3</sup> ထုၬလၩထုၬအဖၧၩ့နီၪ ယွၩဖၩ့ထၪ့ဝ့ၫလီၫ.- ပယွၩမိ ဂဲၫတၭ, မိအီၪလၩ့မါပံၭအ့ၬ, မ့ၪမိအၪ့ဆၧလၧအမ့ၬ ယၫတၭ, လဖုၬၥံၪဂဲၫဝၬဖီၩ့အဝ့ၫ ဆီၪ့ဆီၪ့လ့ၬလီၫ.",
			"4": "<sup>4</sup> အဝ့ၪဒၪမိကိၭထၪ့ဝ့ၫ လၧမူၭခိၪလၧထၭလခီၫ, ဒဲလၧ ဂၪ့ခိၪနီၪ ဘဲၫၥိၭအမိစ့ၩရၫ့န့ အၡၩခမျၧးအခွးလီၫ.",
			"5": "<sup>5</sup> တၭယၡၩဆံၫ့ဎံၪၥံၪ လၧအအုၩ့လၩ့ဆၧ လၧယၥိၭ လၧဆၧလုနီၪ, ဒုၭအီၪကိၩ့အီၪကီၪ့ လၧယအီၪယီၩ",
			"6": "<sup>6</sup> ဆံၭ.- တၭမူၭခိၪဒုၭနဲၪအဆၧတီၩဆၧလီၩ့လီၫ.အဂဲး ဘဲၫယီၩယွၩအနၫ့ဆါဒၪဝ့ၫနီၪ မွဲၦစ့ၩရၫ့ခွးလဂၩလီၫ. (စ့လၫ.)",
			"7": "<sup>7</sup> ခိၭနၪ,ယၡၩခမျၧးၥံၪဧ့, တၭယမိချဲၩ့ဆၧ အံၫစရ့ လၭဧ့,ဒဲယမိထိးယၥၭ လၧနဂဲးနကၠီၪ့လီၫ. ယဝ့ၫဒၪ ယီၩယမွဲယွၩ, နယွၩလီၫ.",
			"8": "<sup>8</sup> ယမိအၪ့ၥီၪ့နၧၩ လၧနဆၧလုလဖၪအဂဲးအကၠီၪ့အ့ၬ, တၭနဆၧလုမ့ၪအီၪဝ့ၫ လၧယမ့ၬယၫလထံၪဎးလီၫ.",
			"9": "<sup>9</sup> တၭယလမိမၩန့ဘၪချီဖၫလၧဂံၪ့ဖၧၩ့, ဒဲဘ့ၪဖၫလၧန",
			"10": "<sup>10</sup> ဖီၩ့ဖၧၩ့နီၪဆ့အ့ၬ.- အဂဲးဘဲၫယီၩ ဆၧဖိၪဆၧဎါအ မံၩ့လၧမံၩ့လၬကျၩနီၪ, မွဲယဆၧကိၭအဒုၩဒ့ၭ,ဒဲဆၧ ဖိၪဆၧဎါအဒိၩ့လၧခိၪလီၩ့အထီၫ့ၥံၪအလီၩ့, မွဲယဆၧ",
			"11": "<sup>11</sup> ထီးအလူၬလီၫ.- ယၥ့ၪယၫထိၪၥံၪလံၪၥံၪလၧခိၪလီၩ့ ထိၩ့ချိၬထီးအလူၬ, ဒဲဆၧဖိၪဆၧဎါလၧဆၧပျၩ့ဖၧၩ့နီၪ",
			"12": "<sup>12</sup> မွဲယဆၧလီၫ.- ဆၧအ့ၪၥၭဝံယၥၭတၭ, ယလီၩဘၪ နၧၩအ့ၬ.အဂဲးဘဲၫယီၩ ဂၪ့ခိၪဒဲဆၧမၩဎွ့ၩဝ့ၫနီၪမွဲယ",
			"13": "<sup>13</sup> ဆၧလီၫ.- တၭမွဲယမိအၪ့ချီအယၪ,ဒဲယမိအီၩဘ့ၪအ",
			"14": "<sup>14</sup> ၥွံၪနီၪဆ့ဧၪ.- တၭလုထၪ့ယွၩလၧဆၧစံၭထၪ့အၪ့အူၭ ဆံၭ,ဆၧဘၪဆဲၫ့လၧနဆိၪလၩ့နၥၭ လၧဆၧထီၫထုၬ",
			"15": "<sup>15</sup> အမ့ၬယၫနီၪ, မၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ဆံၭ.- တၭလၧမု လနံၩအခိအဝီၩနီၪ, ကိၭထၪ့ယၧၩဆံၭ, ယမိမၩဖီၩ့ မၩဖျ့ၭနၧၩတၭ, နမိမၩလၩမၩဖၩ့ယၧၩလီၫ.",
			"16": "<sup>16</sup> အ့ၪမွဲယွၩစံၭၦလတီၩလလီၩ့ဘၪနီၪ, နဝ့ၫဒၪနလီၩ လၩ့ယဆၧမၪလူၬလဖၪ, ဒဲဆိၬထၪ့ယဆၧအုၩ့လၩ့လၧ",
			"17": "<sup>17</sup> နနိၭနီၪ, မွဲအဘၪဆဲၫ့လၧနၧၩဘဲၫၥ့ၪလဲၪ.- မွဲနမ့ၬလဲၩ ဆၧၥီၪ့ဆၧၥၫ့တၭ, နခွံၬၡိၭယလူယထၫ လၧနလးခဲၫ့",
			"18": "<sup>18</sup> နီၪလီၫ.-နအ့ၪဒၪဘၪၦအၪ့ဂူၪဆၧတၭ, မုၬနၥၭလၧ အၥိၭဆ့,ဒဲနမၩဎုၬ ဆၧလၧၦမၩမၪမုၪ မၩမၪခွၫဆ့",
			"19": "<sup>19</sup> လီၫ.- နဖ့ၪလၫ့နနိၭ လၧဆၧအၧၩ့အဖၧၩ့တၭ, နဖျ့ၩ",
			"20": "<sup>20</sup> ကိၪ့ထၪ့အၪ့လီၫဆၧလီၫ.- တၭနဆၧၫ့နၩ့ချဲၩ့ဆၧထၫ့",
			"21": "<sup>21</sup> ဒုၪဒၩနထၧၫ့ဖုဝဲ, ဒဲနဒုၪဒွ့ၪနမိအဖိၪခွၫလီၫ.- ဆၧနီၪ လဖၪနမၩယူၭတၭ, ယအီၪဒၪယဆၧလၩ့မါပံၭလီၫ. နဆီၫ့မီၪ့လၧယလၩ့ဂၬ နနၫ့ဆါဒၪနဝ့ၫလီၫ. ယမိအၪ့ ၥီၪ့နၧၩတၭ, ယမိနဲၪဖျီၪထၪ့ဆၧလၧနမ့ၬယၫလီၫ.",
			"22": "<sup>22</sup> တၭၦလၧအၥၭနၪ့ယွၩၥံၪဧ့, ယိဆီၫ့မီၪ့ဆၧယီၩဘီၪ, ယမိအဲၪ့ၡၫ့ဘၪခိၬဆၧတၭ, ဆၧမၩဖီၩ့မၩဖျ့ၭအီၪနး",
			"23": "<sup>23</sup> ဂၩအ့ၬ.- တၭၦလၧအမၩဘိၪ့ဆၧစံၭထၪ့အၪ့အူၭနီၪ, မၩလၩမၩဖၩ့ယၧၩ, ဒဲၦၡၩလၧအတဲၩ့ဝဲၩအဖၧၩ့ၥၭ နီၪ,ယမိဒုၭနဲၪအဝ့ၫ လၧယွၩအဆၧထိးထဲၩ့တၩ့ထဲၩ့ လီၫ."
		},
		"51": {
			"1": "<sup>1</sup> ယွၩဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩဘဲၫနဆၧအဲၪအခိးအ တၩအၥိၭနီၪဆံၭ. ဘဲၫနယၫ့ၥၭဆၧအၪအၪလ့ၬအၥိၭ",
			"2": "<sup>2</sup> နီၪကွဲၪဖျါခွံၬ ယဆၧမၪလဖၪဆံၭ.- ၥူၫဝၭခွံၬယၧၩ လၧယဆၧအၧၩ့အကၠီၩ့ဆံၫ့ဆံၫ့ဆံၭ. တၭမၩဆံၫ့ထၪ့",
			"3": "<sup>3</sup> ယၧၩလၧယဆၧဒဲၩဘၭအကၠီၩ့ဆံၭ.- အဂဲးဘဲၫယီၩ ယမိၥ့ၪယၫယဆၧမၪ, ဒဲယဆၧဒဲၩဘၭအီၪလၧယမ့ၬ",
			"4": "<sup>4</sup> ယၫလထံၪဎးလီၫ.- ယမၩမၪဘၪယူၭနၧၩန့ၫနၧၩယူၭ တၭ,မၩဆၧအၧၩ့နီၪလၧနမ့ၬယၫယူၭ. မၩအၥၭဘဲၫ နီၪတၭ,နမွဲဆၧတီၩဆၧလီၩ့ လၧနချဲၩ့ဆၧနီၪ,နမွဲဆၧ",
			"5": "<sup>5</sup> ဆံၫ့လၧနစ့ၩရၫ့နီၪလီၫ.- ယိခွါ, ယအီၪဖျဲၪလၧဆၧ အၧၩ့ဆၧၥၫ့အကျၩတၭ, ယမိဒၧၩ့ထၪ့န့ယၧၩလၧဆၧ",
			"6": "<sup>6</sup> ဒဲၩဘၭအဖၧၩ့နီၪလီၫ.- ယိခွါ, နဝ့ၫဒၪယီၩ, ဘၪနၥၭ လၧဆၧမွဲဆၧတီၩလၧၥၭဖၧၩ့လခီၫ, ဒဲလၧဆၧအီၪၥူၪ",
			"7": "<sup>7</sup> အဖၧၩ့နီၪ ဒုၭၥ့ၪယၫယၧၩလၧဆၧကိၪ့ၥ့ၪဆံၭ.- မၩ ဆံၫ့ယၧၩလၧဟံစိၭဆံၭ, တၭယမိဆံၫ့ထၪ့ယဝ့ၫလီၫ. ၥူၫဝၭဆံၫ့ခွံၬယၧၩဆံၭ, တၭယမိဘွၩနဲၪ့မူၭခိၪအဖီၫ",
			"8": "<sup>8</sup> ဒံၭလီၫ.- ဒုၭနါဂၧၫ့ယၧၩ လၧဆၧၥုၪ့ဎွံၫၥၭယီၫဒဲဆၧ ၥုၪ့ထိၬၥၭထိၬတၭ, ဒုၭၥုၪ့ဎွံၫၥၭယီၫ ဆၧဎွံၪၥံၪလၧ နမၩခါလဖၪနီၪဆံၭ.",
			"9": "<sup>9</sup> အီၪက့ၪၥူၪခွံၬနမ့ၬ လၧယဆၧဒဲၩဘၭတၭ, ထူၭခွံၬ",
			"10": "<sup>10</sup> ယဆၧအၧၩ့ဆၧၥၫ့ထီးအလူၬဆံၭ.- ယွၩဧ့, မၩထဲၩ့ ယၥုၪ့ဆံၫ့ယၥၭဎံၪဆံၭ. တၭမၩထဲၩ့ယၥုၪ့ဂုး ယၥၭ",
			"11": "<sup>11</sup> ခၧၫ့လၧယဖၧၩ့ဆံၭ.- ထီးခွံၬၡိၭခွံၬယၧၩ လၧနအီၪ လဂ့ၩ,ထီးမၩန့ထဲၩ့ နၥၭမုဆံၫ့ဎံၪ လၧယၧၩလဂ့ၩ.",
			"12": "<sup>12</sup> ဒုၭအီၪထၪ့ထဲၩ့န့ယၧၩ လၧဆၧၥၭထိၬဘၪဆဲၫ့ လၧ နဆၧထိးထဲၩ့တၩ့ထဲၩ့တၭ, မၩဆၧၩ့ယၧၩလၧၥၭလ မံၩ့လၧအမၩဒၪဆၧဆံၭ.",
			"13": "<sup>13</sup> တၭယမိဒုၭနဲၪ ၦမၩမၪဆၧလၧနဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭ, ဒဲ ၦမၩဆၧဒဲၩဘၭ မိကၠၪလီၩ့ထဲၩ့အၥၭလၧနအီၪလီၫ.",
			"14": "<sup>14</sup> တၭမၩဖီၩ့မၩဖျ့ၭယၧၩ လၧဆၧမၪအၥွံၪနီၪဆံၭ, ယွၩ ဧ့,ယဆၧထိးထဲၩ့တၩ့ထဲၩ့အယွၩဧ့, ယဖျ့ၩမိစံၭထၪ့ အၪ့အူၭဆၧလၧနဆၧတီၩဆၧလီၩ့အဂဲး လၧဆၧၥုၪ့",
			"15": "<sup>15</sup> ထိၬၥၭထိၬလီၫ.- ကဆါဧ့, ဒုၭအၩ့ထၪ့ယနိၭဖျံၩလ",
			"16": "<sup>16</sup> ဖၪဆံၭ,တၭယနိၭမိစံၭထၪ့အၪ့အူၭနၧၩလီၫ.- အဂဲး ဘဲၫယီၩဆၧဘၪနၥၭလၧဆၧလုအ့ၬ, အ့ၪလမွဲဘၪဘဲၫ နီၪတၭ, ယဖ့ၪလၫ့နၧၩလီၫ. ဆၧလုမ့ၪနီၪဘၪနၥၭဆ့",
			"17": "<sup>17</sup> အ့ၬ.- ယွၩအဆၧလုနီၪမွဲဆၧၥုၪ့ခါၥၭလၩ့လီၫ, တၭ ဆၧၥုၪ့ခါၥၭလၩ့,ဒဲဆၧနီၫ့ယါလၩ့ထဲၩ့အၥၭနီၪ, ယွၩ ဧ့,နမၩကြၩ့ထမးနဝ့ၫအ့ၬ.",
			"18": "<sup>18</sup> မၩဂ့ၩဇံအိၫ့ထီးအဘၪနၥၭတၭ, မၩထၪ့ထဲၩ့ယရု",
			"19": "<sup>19</sup> စလံၫ့အဒိၩ့ခိၪဒၧၩ့နီၪဆံၭ.- ထီးနီၪလဖၧၫ့ ဆၧမိဘၪ နၥၭလၧဆၧလုတီၩလဖၪ လၧဆၧလုမ့ၪ, ဒဲဆၧလုမ့ၪ ထၧၫ့ဒုၩယၫလီၫ. ထီးနီၪလဖၧၫ့ ၦမိလုထၪ့ချီဖၫၥံၪ လၧနဆၧလုလးအဖၫ့ခိၪလီၫ."
		},
		"52": {
			"1": "<sup>1</sup> ၦလၧအဂဲးဆီၪ့လဂၩဧ့, မွဲဘၪနီၫလၧနအီၪက့ၪဖိၫ လိၫနၥၭလၧဆၧအၧၩ့အကၠီၩ့နီၪလဲၪ, ယွၩအခိးအတၩ",
			"2": "<sup>2</sup> အီၪဝ့ၫကိၭမုနံၩမုနၩဒ့ၭလီၫ.- နဖျ့ၩကိၪ့ထၪ့ဆၧမၩ အၧၩ့ဘဲၫဒီၩလိၩ့ဆၧအနါအဲၪ့ဝ့ၫအၥိၭနီၪ, မၩအၪ့လီၫ ဆၧလီၫ.",
			"3": "<sup>3</sup> နအဲၪဆၧအၧၩ့ဒိၪနဲၪ့ဆၧဂ့ၩဒံၭ, ဒဲဆၧချဲၩ့ဘျံၭချဲၩ့ ဘျၪနီၪအၪနဲၪ့ဆၧချဲၩ့တီၩနီၪဒံၭလီၫ. (စ့လၫ.)",
			"4": "<sup>4</sup> နအဲၪကယဲဆၧချဲၩ့မၩဂၭဂီၩ့ဆၧ, ဖျ့ၩအၪ့လီၫဆၧ",
			"5": "<sup>5</sup> ဧ့,- ယွၩမိမၩဂၭဂီၩ့နၧၩ လၩ့ဆိၩလၩ့ကၠၪဆ့လီၫ. အ ဝ့ၫဒၪမိဖီၪ့ထၬနၧၩတၭ, မိထုၭထၪ့ခွံၬနၧၩလၧတဲၩဖၧၩ့တၭ, ထ့ၭထၪ့ခွံၬနၧၩလၧခးလၧၦမၧၫ့ဝ့ၫအဖၧၩ့နီၪလီၫ.(စ့လၫ.)",
			"6": "<sup>6</sup> ၦအတီၩအလီၩ့မိဒၪဘၪဝ့ၫ, ဒဲၥၭမဲၪဝ့ၫတၭ, နံဘၪ",
			"7": "<sup>7</sup> ဝ့ၫနီၪလီၫ.- ယိခွါ, ၦလဂၩလၧအလအီၪက့ၪဘၪယွၩ လၧအဂဲးအဘၭတၭ, ဒိၭနဲၩ့အၥၭလၧအဆၧလၧၫ့ဆၧ ဎွ့ၩအၪအဖၧၩ့တၭ, မၩဆီၪ့ထၪ့အၥၭလၧအဆၧအၧၩ့ လဖၪနီၪ, ယိၦလဂၩနီၪဆံၭ.",
			"8": "<sup>8</sup> တၭယဝ့ၫဒၪယီၩ ယလၩ့ဂၬဘဲၫအလဲအိၫ့အၥံၫ့ဆ့ၭ လထံၭလၧယွၩ အဂံၪ့ဖၧၩ့အၥိၭနီၪလီၫ. တၭယဒိၭနဲၩ့ ယၥၭလၧယွၩအဆၧယၫ့ၥုၪ့ယၫ့ၥၭ လၩ့ဆိၩလၩ့ကၠၪ လီၫ.",
			"9": "<sup>9</sup> တၭယမိစံၭထၪ့အၪ့အူၭနၧၩ လၩ့ဆိၩလၩ့ကၠၪဆ့, အဂဲးဘဲၫယီၩနမၩနဝ့ၫလီၫ. တၭယယိလါဆၧလၧ နမံၩ့နီၪ, အဂဲးဘဲၫယီၩ ဂ့ၩဝ့ၫလၧၦဆံၫ့ဎံၪအမ့ၬယၫ လီၫ."
		},
		"53": {
			"1": "<sup>1</sup> ၦအဂီၩ့စံၭယူၭလၧအၥၭခံဖၧၩ့, ယွၩအီၪနးဂၩအ့ၬ. အဝ့ၫၥံၪအၧၩ့ဝ့ၫၥၫ့ဝ့ၫတၭ, မၩယူၭဆၧၥၭလိၪယူၭ, ၦ",
			"2": "<sup>2</sup> မၩဆၧဂ့ၩအီၪနးဂၩအ့ၬ.- ၦလၧအၥၭဖၭ, ၦအၪ့ဎၬ ယွၩနီၪ,မွဲအအီၪလအီၪဘၪလဲၪ, ဘဲၫၥိၭအမိဒၪဘၪဝ့ၫ တၭ,ယွၩယိလၩ့လၧမူၭခိၪ လၧၦၡၩဖိၪခွၫၥံၪအလီၩ့",
			"3": "<sup>3</sup> လီၫ.- တၭအဝ့ၫၥံၪဂၧၩ့ထဲၩ့ယူၭ အၥၭထီးအလူၬယူၭ, အုၪထၪ့ယူၭလစီၪ့ဎးယူၭ, ၦမၩဆၧဂ့ၩအီၪနးဂၩအ့ၬ, န့ၫလဂၩနီၪအီၪအ့ၬ.",
			"4": "<sup>4</sup> တၭၦလၧအမၩဆၧအၧၩ့လဖၪနီၪ, မွဲအၥ့ၪယၫဆၧ နးမံၩ့အ့ၬဧၪ. တၭအၪ့ဝ့ၫယၡၩခမျၧး, ဘဲၫအအၪ့ကိၪ",
			"5": "<sup>5</sup> အၥိၭတၭ, ကိၭထၪ့ယွၩနီၪဆ့အ့ၬ.- လၧဆၧၥၭမဲၪ အလးလအီၪဘၪနီၪ, ထီးနီၪအဝ့ၫၥံၪၥၭမဲၪဆၧဖၭဒိၪ လီၫ.အဂဲးဘဲၫယီၩယွၩမၩလၩ့ပြံၩလၩ့ပၩ ၦၥုၪ့တဲၩ ထၫ့ဒုၪဒၩနၧၩလဖၪအဎွံၪၥံၪလီၫ. နဒုၭမ့ၬမဲအဝ့ၫၥံၪ နီၪ,အဂဲးဘဲၫယီၩ ယွၩမ့ၬလဲၩအဝ့ၫဒၪလီၫ.",
			"6": "<sup>6</sup> အံၫစရ့လၭအဆၧထိးထဲၩ့တၩ့ထဲၩ့နီၪ, မွဲအဂဲၫ ထၪ့လါလၧဇံအိၫ့ အဖၧၩ့နီၪဆံၭ. တၭထီးယွၩဒုၭထဲၩ့ ထဲၩ့အၡၩဆၧအၪ့မၧၫ့ဎီးဝ့ၫနီၪတၭ, ယၫကူၭမိၥုၪ့ဎွံၫ ၥၭယီၫတၭ, အံၫစရ့လၭမိၥုၪ့ထိၬၥၭထိၬလီၫ."
		},
		"54": {
			"1": "<sup>1</sup> ယွၩဧ့,ထိးထဲၩ့တၩ့ထဲၩ့ယၧၩ လၧနမံၩ့အကၠီၩ့တၭ,",
			"2": "<sup>2</sup> စ့ၩရၫ့တီၩန့ယခွး လၧနစီၩ့နမၩ့ဆံၭ.- ယွၩဧ့,ခိၭနၪ ယဆၧဘၩဆိၪဖၪလဖၪတၭ, ဒိၭနနါလၧယနိၭ အ",
			"3": "<sup>3</sup> ဆၧချဲၩ့လဖၪနီၪဆံၭ.- အဂဲးဘဲၫယီၩ ၦလခီၫဘၩ့မုး ဖိၪဂဲထုၪ့ထၫ့ဒုၪဒၩယၧၩတၭ, ၦမၩဆီၪ့ဆၧအၪ့ဎၬ ယၥၭမၧၫ့လီၫ. အဝ့ၫၥံၪအီၪက့ၪယွၩလၧအမ့ၬယၫဆ့ အ့ၬ.(စ့လၫ.)",
			"4": "<sup>4</sup> ယိခွါ, ယွၩမၩဆၧၩ့ယၧၩ, ကဆါအီၪဝ့ၫလၧၦလၧ",
			"5": "<sup>5</sup> အမၩအၧၩ့ယၥၭအၥိၭလီၫ.- အဝ့ၫဒၪမိဖ့ၪလၫ့ထဲၩ့ ဆၧအၧၩ့ လၧယဒုၪယဒၩလဖၪတၭ, နမိမၩဂၭဂီၩ့ခွံၬ",
			"6": "<sup>6</sup> အဝ့ၫၥံၪလၧဆၧမွဲဆၧတီၩလီၫ.- တၭယမိလုထၪ့နၧၩ လၧဆၧမၩဘိၪ့ဒၪဆၧ, ယမိစံၭထၪ့အၪ့အူၭနမံၩ့,ယ",
			"7": "<sup>7</sup> ဟိဝၩဧ့, အဂဲးဘဲၫယီၩမွဲအဂ့ၩလီၫ.- အဂဲးဘဲၫယီၩမွဲ အမၩဖီၩ့မၩဖျ့ၭယၧၩ လၧဆၧမၩခိမၩဝီၩလဖၪ ထီး အလူၬယူၭ. တၭယမ့ၬၥၪဒၪဘၪယူၭ ဆၧလၧအဘၪ ယၥၭလၧယဒုၪယဒၩလဖၪအလီၩ့လီၫ."
		},
		"55": {
			"1": "<sup>1</sup> ယွၩဧ့, ခိၭနၪယဆၧဘၩဆိၪဖၪဆံၭ. တၭအီၪက့ၪ",
			"2": "<sup>2</sup> ၥူၪနၥၭလၧယအၪ့ယၫဆၧလဂ့ၩ.- ခိၭနၪယလူတၭ, ဒိၭနနါဆံၭ, ယအၪ့ယၫဆၧလၧယၥၭအုၭတၭ, ယ",
			"3": "<sup>3</sup> ကိၭၡၭထၪ့ဆၧ, လၧဆၧအဒုၪအဒၩအလူအကၠီၩ့, လၧ ၦလတီၩလလီၩ့ဘၪ အမၩအၧၩ့ဆၧအကၠီၩ့လီၫ. အဂဲး ဘဲၫယီၩမွဲအဒုၭဘၪယၧၩ လၧဆၧအၧၩ့တၭ, လၧအ",
			"4": "<sup>4</sup> ၥၭထၪ့ဆၧအဖၧၩ့နီၪ, မွဲအမ့ၬလဲၩယၧၩလီၫ.- တၭ ယၥုၪ့ဝၭထိၬယၥၭဝၭထိၬလၧအဖၧၩ့, ဒဲဆၧၥံၫအဆၧ",
			"5": "<sup>5</sup> မၩၥၭမဲၪၥၭဖျဲၩ့နီၪလၩ့ဘၪယၧၩလီၫ.- တၭဆၧၥၭမဲၪ ဒဲဆၧဝၭထိၬလၩ့ဘၪယၧၩတၭ, ယဆၧဝၭထိၬလုၬ",
			"6": "<sup>6</sup> ဘံၭခွံၬယၧၩလီၫ.- တၭယစံၭ, မွဲယအီၪလါလၧယဒံၭ ဘဲၫထိၪလွံအၥိၭနီၪဆံၭ. အ့ၪမွဲဘဲၪနီၪ, ယမိယူၩထၪ့",
			"7": "<sup>7</sup> ခွံၬတၭ,အီၪပွံၭဝ့ၫလီၫ.- ယိခွါ, ယမိဂၭလၧအယဲၩ့",
			"8": "<sup>8</sup> တၭယမိအီၪ လၧၡါမုနၧၫ့ဖၫလီၫ.(စ့လၫ.) - တၭ ယမိမၩဖီၩ့မၩဖျ့ၭ ယၥၭချဲၫ့ချဲၫ့ လၧလံၩမုဒဲလဖုၬနီၪ လီၫ.",
			"9": "<sup>9</sup> မၩဂၭဂီၩ့ခွံၬ, ကဆါဧ့, မၩထဲၩ့ဖၭအဝ့ၫၥံၪအဖျ့ၩ ဆံၭ.အဂဲးဘဲၫယီၩ ယဒၪဘၪဆၧမၩအၧၩ့, ဒဲဆၧအဲၪ့",
			"10": "<sup>10</sup> လိၬဆိၭချဲၩ့လၧဒိၩ့ဖၧၩ့လီၫ.- လၧမုဆၫလခီၫ ဒဲလၧ မုနၩလခီၫနီၪ, အဝ့ၫၥံၪလ့ၩဝၬဖီၩ့ဝ့ၫ လၧဒိၩ့ခိၪဒၧၩ့အ ဒၩ့ခိၪ, ဒဲဆၧမၩဂၭဂီၩ့, ဒဲဆၧၡၪ့ဆၧနၭအီၪဝ့ၫ လၧအ ဖၧၩ့လခီၫလီၫ.",
			"11": "<sup>11</sup> တၭဆၧအၧၩ့ဆၧၥၫ့အီၪဝ့ၫလၧအၥၭခံဖၧၩ့, ဆၧ မၩအၧၩ့ဒဲဆၧအၪ့လီၫဆၧနီၪ လစဲၪ့ထၪ့ခွံၬဘၪလၧဖၠါဖၧၩ့ နီၪလီၫ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩလမွဲဘၪဆၧအဒုၪ အဒၩဒုၪဒွ့ၪယၧၩ, အ့ၪမွဲဘဲၫနီၪတၭ, ယထိးနၧၩ့လီၫ. တၭလမွဲဘၪၦမ့ၬ လဲၩယၧၩလၧအအီၪက့ၪဒိၪအၥၭ လၧယဖၫ့ခိၪ, အ့ၪမွဲ ဘဲၫနီၪတၭ, ယမိအီၪက့ၪၥူၪခွံၬ ယၥၭလၧအအီၪလီၫ.",
			"13": "<sup>13</sup> အ့ၪမွဲနဝ့ၫဒၪ, နမွဲၦလၧယအီၪက့ၪဘဲၫယနၫ့ဆါဒၪယ ဝ့ၫအၥိၭ ယထံၩယၥိၭဒဲၦလၧပၥ့ၪယၫလိၬပၥၭလီၫ.",
			"14": "<sup>14</sup> ပဖံၭၥိၭလိၬပၥၭ လစီၪ့ဎးမုၬမုၬတၭ, ပလ့ၩထၪ့လၧ",
			"15": "<sup>15</sup> ယွၩအဂံၪ့လၧၦခမျၧးအၥိၭလီၫ.- မွဲဆၧအီၪယူလၩ့ ဘၪဝ့ၫဆံၭ, လၧအဝ့ၫၥံၪမၧၫ့ဒံၭနီၪ, မွဲအမိလ့ၩလၩ့လၧ ဖျႃဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩဆၧအၧၩ့အီၪဝ့ၫ လၧအ လးဖၧၩ့လၧအဝ့ၫၥံၪအကျၩနီၪဆ့လီၫ.",
			"16": "<sup>16</sup> တၭယဝ့ၫဒၪယီၩယမိကိၭထၪ့ယွၩလီၫ. တၭယဟိ",
			"17": "<sup>17</sup> ဝၩမိထိးထဲၩ့တၩ့ထဲၩ့ယၧၩလီၫ.- လၧဂၪလခီၫ, ဒဲလၧ ဂီၩလခီၫ, ဒဲလၧမုထုၪ့နီၪ ယမိၥုၪ့ခါၥၭလၩ့ဒဲဘၩဆိၪ",
			"18": "<sup>18</sup> ဖၪဆၧတၭ,ယွၩမိနါဂၧၫ့ယလူလီၫ.- တၭဆၧမိဎွ့ၩန့ ထဲၩ့ယၥၭလၧဆၧဘၪလိၬအိၭလိၬအဂး, လၧဆၧဒုၭ ၥုၭထၫ့ဒုၪဒၩယၧၩအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ၦအီၪ",
			"19": "<sup>19</sup> လၧယၥိၭအၪဂၩလီၫ.- ယွၩဒၪလ့ၬ လၧအဆၧၫ့နၩ့ ဎဘဲၫၦစ့ၩရၫ့ဆၧအၥိၭၭ ခီၫလၧဖျိၩ့လဂၩ မိခိၭနၪဆၧ တၭ,မိစံၭဆၧၫ့အဝ့ၫၥံၪလီၫ. (စ့လၫ.) မွဲဆၧအၪ့လဲၩ လအီၪဘၪလၧအဝ့ၫဒၪတၭ, အဝ့ၫၥံၪၥၭမဲၪယွၩအ့ၬ.",
			"20": "<sup>20</sup> ယၩ့ထၪ့အစူၪထၫ့ဒုၪဒၩ ၦလၧအမၩဘၪလိၬအိၭလိၬ ဆၧလၧအၥိၭတၭ, မၩဂၭဂီၩ့အဆၧအုၩ့လၩ့နီၪလီၫ.",
			"21": "<sup>21</sup> အနိၭဖျ့ၫနဲၪ့ထီပၭလါနၫ့တၭ, ဆၧဒုၭၥုၭအီၪဝ့ၫလၧအ ၥၭခံဖၧၩ့လီၫ. အဆၧချဲၩ့ၥံၪဖူၬနဲၪ့ၥိၪဒံၭ လါနၫ့တၭ, မွဲနၭလၧအထုၭထၪ့အၥၭလဖၪလီၫ.",
			"22": "<sup>22</sup> တၭအီၪက့ၪနဆၧအွံၪဆၧယိၭနီၪ လၧယဟိဝၩအ လီၩ့ဆံၭ, အဝ့ၫမိမၩဆၧၩ့နၧၩလီၫ. တၭၦအတီၩအ လီၩ့လဖၪနီၪအဝ့ၫဒၪဖ့ၪလၫ့အဝၭနးဖၧၫ့အ့ၬ.",
			"23": "<sup>23</sup> တၭနဝ့ၫဒၪ, ယွၩဧ့, နမိဒုၭလ့ၩလၩ့ၦလဖၪနီၪလၧ ဆၧဂၭဂီၩ့ အဆၧဖၧၩ့လီၫ. ၦမၩၥံၫၦၡၩ, ဒဲအၪ့လီၫ ဆၧလဖၪနီၪ မိမၧၫ့ဖိၭဖၫ့ အမုနံၩလဖၪအ့ၬ, အ့ၪမွဲယ ဝ့ၫဒၪယီၩ, ယဒိၭနဲၩ့ယၥၭလၧနၧၩလီၫ."
		},
		"56": {
			"1": "<sup>1</sup> ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩဆံၭ, ယွၩဧ့, အဂဲးဘဲၫယီၩၦ ၡၩမိယုလၩ့ယၧၩတၭ, ဒုၭဆၧကိၭမုနံၩဒ့ၭနီၪ, မၩနၧၩ့",
			"2": "<sup>2</sup> မၩစၪယၧၩလီၫ.- တၭယဒုၪယဒၩလဖၪ မိယုလၩ့ ယၧၩကိၭမုနံၩမုနၩဒ့ၭလီၫ. အဂဲးဘဲၫယီၩ ၦအၪဂၩ အီၪက့ၪထၪ့ထီၫအၥၭတၭ, ဒုၭဆၧထၫ့ဒုၪဒၩယၧၩလီၫ.-",
			"3": "<sup>3</sup> မုနံၩမုနၩလၧယဘၪဆၧအၪ့ယိၪၥၭအုၭနီၪ, ယ မိဒိၭနဲၩ့ယၥၭလၧနၧၩလီၫ.-",
			"4": "<sup>4</sup> လၧယွၩအဖၧၩ့, ယမိစံၭ ထၪ့အၪ့အူၭအလူအထၫ, ယဒိၭနဲၩ့ယၥၭလၧယွၩ တၭ,ယမိၥၭမဲၪဆၧအ့ၬ, ဆၧဖံၭဆၧယၪမၩယၧၩလ မံၩ့မံၩ့နီၪဘၪမိၥ့ၪဧၪ.",
			"5": "<sup>5</sup> အဝ့ၫၥံၪမၩဂၭဂီၩ့ယဆၧချဲၩ့ကိၭမုနံၩဒ့ၭလီၫ. အ ဝ့ၫၥံၪအဆၧဆီၫ့မီၪ့ ထီးအလူၬ ထၫ့ဒုၪဒၩယၧၩလၧ",
			"6": "<sup>6</sup> ဆၧအၧၩ့အဂးလီၫ.- အဝ့ၫၥံၪအီၪကိၩ့အီၪကီၪ့အီၪ က့ၪၥူၪအၥၭတၭ, ယိနဲၪ့ယခၪ့ခၫထၪ့လဖၪ, ယိလါယ",
			"7": "<sup>7</sup> ၥၭမၧၫ့လီၫ.- အဝ့ၫၥံၪမိဖီၩ့ဖျ့ၭလၧဆၧအၧၩ့အကၠီၩ့ နီၪဆ့ဧၪ.လၧဆၧၥၭထၪ့အကၠီၩ့နီၪ ခွံၬလၩ့ခွံၬၦခမျၧး",
			"8": "<sup>8</sup> ဆံၭ,ယွၩဧ့,- နဝံထၪ့နၬထၪ့ယဂၭဝံၩ့ဝၩ့ ဆၧလဖၪ လီၫ.အီၪက့ၪယမ့ၬထံၫ လၧနထိၪ့ဆၧဖံၭအဖၧၩ့နီၪ ဆံၭ,ဆၧနီၪလဖၪအီၪလၧနလံၬဆရၫ့အဖၧၩ့နီၪ, မွဲ",
			"9": "<sup>9</sup> အ့ၬဧၪ.- ထီးမုနံၩလၧယကိၭထၪ့နီၪ, ယဒုၪယဒၩၥံၪ မိထဲၩ့ထဲၩ့ လၧအလးခဲၫ့လီၫ. ဆၧယီၩလမံၩ့ယၥ့ၪ",
			"10": "<sup>10</sup> ယၫယွၩအီၪလၧယၥိၭလီၫ.- လၧယွၩအဖၧၩ့ယမိစံၭ ထၪ့အၪ့အူၭ အလူအထၫလီၫ. လၧယဟိဝၩအဖၧၩ့",
			"11": "<sup>11</sup> ယမိစံၭထၪ့အၪ့အူၭအလူအထၫလီၫ.- ယဒိၭနဲၩ့ယ ၥၭလၧယွၩတၭ, ၦၡၩမိမၩယၧၩဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪ လဲၪနီၪ,ယၥၭမဲၪယဝ့ၫအ့ၬ.",
			"12": "<sup>12</sup> ဆၧလၧယဆိၪလၩ့ယၥၭလၧနဂးနီၪ, အီၪဝ့ၫလၧ ယလီၩ့,ယွၩဧ့, ယမိမၩဘိၪ့နၧၩ လၧဆၧစံၭထၪ့ အၪ့အူၭလဖၪလီၫ.",
			"13": "<sup>13</sup> အဂဲးဘဲၫယီၩ နမၩဖီၩ့မၩဖျ့ၭယၥၭမၧၫ့လၧဆၧ ၥံၫလီၫ.ဘဲၫၥိၭယမိလ့ၩလၧယွၩအမ့ၬယၫ လၧၦမၧၫ့ အဆၧဖၩ့အကျၩနီၪ, နမိမၩဖီၩ့မၩဖျ့ၭယခၪ့ဘဲၫၥိၭအ ထီးဖျၬလဂ့ၩ,မွဲအ့ၬဧၪ."
		},
		"57": {
			"1": "<sup>1</sup> ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩယွၩဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩ ဆံၭ.အဂဲးဘဲၫယီၩ ယၥၭဒိၭနဲၩ့အၥၭ လၧနၧၩလီၫ. တၭယစဲၪ့ဖလ့ၬ ယၥၭလၧနဒံၭအလၩၡုၪဖၧၩ့ထီးဆၧ",
			"2": "<sup>2</sup> ၡၪ့ဆၧနၭလဖၪယီၩ လ့ၩဖီၩ့ခွံၬယၧၩလီၫ.- ယမိကိၭ ထၪ့ယွၩ ဆၧထၪ့ထီၫထုၬလဂၩ, ယွၩလၧအမၩဆၧ",
			"3": "<sup>3</sup> လၧၫ့ထၪ့ဎွ့ၩထၪ့လၧယဂးလီၫ.- တၭအဝ့ၫဒၪမိအၪ့ မၧၫ့လၩ့ လၧမူၭခိၪတၭ, မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧၦ လၧအလီၩ့ဆီးယၧၩ အဆၧဒုၪဒွ့ၪ အစူၪဖၧၩ့နီၪလီၫ. (စ့လၫ.)ယွၩမိအၪ့မၧၫ့လၩ့ အဆၧယၫ့ၥၭ ဒဲအဆၧမွဲ",
			"4": "<sup>4</sup> ဆၧတီၩလီၫ.- ယၥၭအီၪလၧဆၬလၥၧၫ့အကျၩတၭ, ယမံၫနၩ့လၧၦၡၩ လၧအၥၪထၪ့ မ့ၪလၪလဖၪအကျၩ တၭ, ၦၡၩအဖိၪခွၫၥံၪ လၧအၥွၫမွဲဖၩ့ ဒဲဖျါၥံၪတၭ,အ ဖျ့ၩမွဲနၭလၧအနါအဲၪ့ဝ့ၫလီၫ.",
			"5": "<sup>5</sup> မွဲနဘၪဆၧအီၪက့ၪထၪ့ထီၫနၧၩ လၧမူၭခိၪအဖၫ့ခိၪ နီၪ, ယွၩဧ့, မွဲနဆၧလၩဆၧဖၩ့အီၪ လၧဂၪ့ခိၪထၧၫ့ဖျိၪ့",
			"6": "<sup>6</sup> ယၫအဖၫ့ခိၪဆံၭ.- အဝ့ၫၥံၪမၩဝဲၩဖျံၩခွၩ့ လၧယခၪ့ အဂးလီၫ. တၭယၥၭကူၭလၩ့အၥၭလီၫ. အဝ့ၫၥံၪခုၪ့ လၩ့ဆၧဖၧၩ့ လၧယမ့ၬယၫတၭ, အဝ့ၫၥံၪအနၫ့ဆါဒၪ",
			"7": "<sup>7</sup> ဝ့ၫလၩ့ထ့ၬလၧအဖၧၩ့နီၪလီၫ.(စ့လၫ.)- ယၥၭအီၪ ဂုးအီၪခၧၫ့, ယွၩဧ့, ယၥၭအီၪဂုးအီၪခၧၫ့လီၫ. ယမိၥံၫ",
			"8": "<sup>8</sup> ကျံၩထၪ့ဆၧတၭ, ယမိစံၭထၪ့အၪ့အူၭဆၧလီၫ.- နၪ့ ထၪ့,ယလၩဖၩ့ဧ့, နၪ့ထၪ့ဆံၭ.ၥၫ့ထီးဒဲနါဒံၩ့ၥံၪဧ့, ယ",
			"9": "<sup>9</sup> မိထိၪဂဲၩမုဆဲၪ့ဘွၩနီၪလီၫ.- ယမိစံၭထၪ့အၪ့အူၭနၧၩ လၧၦခမျၧးအကျၩ, ကဆါဧ့, ယမိၥံၫကျံၩထၪ့နၧၩလၧ",
			"10": "<sup>10</sup> ၦဆၨၩၥံၪအကျၩလီၫ.- အဂဲးဘဲၫယီၩ နဆၧယၫ့ၥုၪ့ ယၫ့ၥၭဒိၪဝ့ၫဖိးလၧမူၭခိၪတၭ, နဆၧမွဲဆၧတီၩဖိးလၧ ဆၧအုၪ့လဖၪလီၫ.",
			"11": "<sup>11</sup> မွဲနဘၪဆၧအီၪက့ၪထၪ့ထီၫနၧၩ လၧမူၭခိၪအဖၫ့ခိၪ, ယွၩဧ့, မွဲနဆၧလၩဆၧဖၩ့အီၪ လၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫ အဖၫ့ခိၪနီၪဆံၭ."
		},
		"58": {
			"1": "<sup>1</sup> ၦၡၩအဖိၪခွၫၥံၪဧ့, လၧနၥံၪအီၪလၩ့မါပံၭနီၪ, မွဲန ၥံၪချဲၩ့တၡါ ဆၧမွဲဆၧတီၩဧၪ, မွဲနၥံၪစ့ၩရၫ့ဆၧလၧ",
			"2": "<sup>2</sup> ဆၧတီၩအဖၧၩ့ၥၭနီၪဆ့ဧၪ.- မွဲမၬ, နၥံၪမၩဆၧအၧၩ့ လၧနၥံၪအၥၭခံဖၧၩ့ဒၪလ့ၬ, နၥံၪအစူၪ ခံၫ့ဆၧအၧၩ့",
			"3": "<sup>3</sup> လၧဂၪ့ခိၪချိၫ့လီၫ.- ၦလတီၩလလီၩ့ဘၪ လ့ၩမၪဆၧ လၧဆၧအဒၧၩ့လးဖၧၩ့နီၪ, ခီၫလၧအအီၪဖျဲၪၥၫ့ဂၭဖျိၭ",
			"4": "<sup>4</sup> ချဲၩ့ဆၧအဘျံၭအဘျၪလီၫ.- အီၪလၧဆၧစုၪဘဲၫဂူအ စုၪအၥိၭနီၪလီၫ. မၩအၥၭဘဲၫဂူၥၫ့လၧအဆွံၪဘံၭအ",
			"5": "<sup>5</sup> နါတၭ,- အဝ့ၫၥံၪနါဂၧၫ့ ၦၥ့ၪဆၧအူၪဆၧပီၩ လၧအ အူၪဆၧလၧဆၧကိၪ့ၥ့ၪလဖၪအလူအ့ၬ.",
			"6": "<sup>6</sup> မၩဖိၭအၥွၫလၧအနိၭဖၧၩ့နီၪဆံၭ, ယွၩဧ့, မၩခါခွံၬ",
			"7": "<sup>7</sup> ဆၬလၥၧၫ့ဖိၪအၥွၫခၫ့ဆံၭ, ယဟိဝၩဧ့.- အဝ့ၫၥံၪမိ ဖံထၪ့ခွံၬဘဲၫထံၫ လၧအယွၩခွံၬအၥိၭနီၪတၭ, ထီးအ ခၭအဖျါနီၪ, မွဲအဝ့ၫၥံၪမၩအၥၭဘဲၫ အဘၪဆၧဒၪ့ထ့ၬ",
			"8": "<sup>8</sup> ဝ့ၫနံၫကုၭအၥိၭနီၪဆံၭ.- မွဲအမၩအၥၭဘဲၫချိၪလၧအ ဖံထၪ့ခွံၬဝ့ၫလၧအလ့ၩဆၧအၥိၭနီၪ, ဘဲၫဖိၪၥၪလၩ့ ဎွံၪလဂၩအၥိၭတၭ, အဝ့ၫၥံၪဒၪဘၪ မုၥံၪလၩၥံၪဆ့",
			"9": "<sup>9</sup> အ့ၬ.- နၥံၪအဖၧၩ့ၥံၪလချႃၭၥ့ၪယၫဒံၭ ဘၪဆၧဆူၪ, မ့ၪ အၪ့ဝ့ၫမွဲဂ့ၩ, ၥံၫ့ဆ့ၬမွဲဂ့ၩ, လဖုၬမိမၩဂၭဂီၩ့ဝ့ၫလီၫ.",
			"10": "<sup>10</sup> ထီးၦတီၩၦလီၩ့ဒၪဘၪ ဆၧမၩဆၧၫ့ဆၧအၧၩ့တၭ, မိ ၥုၪ့ထိၬၥၭထိၬလီၫ. တၭမိခၫထၪ့လၧၦလတီၩလလီၩ့",
			"11": "<sup>11</sup> ဘၪအၥွံၪဖၧၩ့လီၫ.- တၭၦမိစံၭဝ့ၫ, မွဲမၬ, ဆၧၥၪအီၪ ဝ့ၫလၧၦတီၩၦလီၩ့အဂးလီၫ. မွဲမၬ, ယွၩလၧအစ့ၩရၫ့ ဆၧလၧဂၪ့ခိၪချိၫ့ယီၩ အီၪဝ့ၫတၡါလီၫ."
		},
		"59": {
			"1": "<sup>1</sup> ယွၩဧ့, မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧယဒုၪယဒၩဆံၭ. နမိအီၪက့ၪထၪ့ထီၫယၧၩ လၧၦလၧအဂဲထုၪ့ထၫ့ဒုၪ",
			"2": "<sup>2</sup> ဒၩယၧၩ အဖၫ့ခိၪနီၪလီၫ.- မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧၦ မၩဆၧအၧၩ့, ဒဲမၩဖီၩ့မၩဖျ့ၭယၧၩ လၧဆၧၥွံၪအၦၡၩ",
			"3": "<sup>3</sup> အစူၪဖၧၩ့ဆံၭ.- အဂဲးဘဲၫယီၩ ယိခွါ, အဝ့ၫၥံၪခိၭ ၥူၪဆၧလၧယၥၭအဂးလီၫ. ၦအဂဲးဆီၪ့အဘၭဆီၪ့လ ဖၪအီၪကီၪ့ထၫ့ဒုၪဒၩယၧၩလီၫ. လမွဲဘၪလၧယဆၧ မၪအကၠီၩ့တၭ, မွဲလၧယဆၧဒဲၩဘၭ အကၠီၩ့ဆ့အ့ၬ,",
			"4": "<sup>4</sup> ယဟိဝၩဧ့.- ယဆၧအၧၩ့လအီၪဘၪအကၠီၩ့တၭ,အ အဝ့ၫၥံၪစဲၪ့တလဲးတၭ, မၩဝဲၩအဆၧထၫ့ဒုၪဒၩယၧၩ",
			"5": "<sup>5</sup> လီၫ.နၪ့ထၪ့ဂဲၫမၩဆၧၩ့ယၧၩတၭ, ယိခွါဆံၭ.- တၭ နဝ့ၫဒၪ,ယဟိဝၩ, ဆၧၥုၭမုခမျၧးအယွၩ အံၫစရ့လၭ အယွၩဧ့, နၪ့ထၪ့စ့ၩရၫ့ ၦဆၨၩၥံၪထီးအလူၬဆံၭ.ထီး ဒုၭဖီၩ့ဖျ့ၭၦအၧၩ့အၪ့လီၫဆၧၥံၪနီၪ နးဂၩလဂ့ၩ. (စ့လၫ.)",
			"6": "<sup>6</sup> အဝ့ၫၥံၪဂဲၫထဲၩ့ထဲၩ့ဝ့ၫလၧမုဂၪလၩ့တၭ, အိၩ့ယိၩ့",
			"7": "<sup>7</sup> ဘဲၫထွံၪအၥိၭတၭ, လ့ၩဎဲၪ့ဒိၩ့နီၪလီၫ.- ယိခွါ,ဆၧချဲၩ့ အၧၩ့ဂဲၫထၪ့လၧအနိၭ, ဒဲနၭၥံၪဖၩ့ၥံၪအီၪ လၧအနိၭ ဖျံၩဖၧၩ့,အဂဲးဘဲၫယီၩ မွဲပလၫမိနါဂၧၫ့လဂၩလဲၪ.",
			"8": "<sup>8</sup> အ့ၪမွဲနဝ့ၫဒၪ, ယဟိဝၩဧ့, နမိနံဘၪအဝ့ၫၥံၪလီၫ. နမိ",
			"9": "<sup>9</sup> မၩ့ကြၩ့ထမး ၦဆၨၩၥံၪထီးအလူၬလီၫ.- ယဂဲးယ ဘၭဧ့,ယမိယိလါဆၧလၧနၧၩလီၫ. အဂဲးဘဲၫယီၩ",
			"10": "<sup>10</sup> ယွၩမွဲယထိၬလီၫ.- ယွၩမိမၩဆိၫဆၧလၧယဂးလၧအ ဆၧအဲၪအခိးအတၩလီၫ. ယွၩမိဒုၭဒၪဘၪယၧၩလၧ ဆၧဘၪယၥၭလၧယဒုၪယဒၩလဖၪအလီၩ့လီၫ.",
			"11": "<sup>11</sup> ထီးမၩၥံၫအဝ့ၫၥံၪလဂ့ၩ, ယၡၩခမျၧးမိၥၭနၪ့ဘၪ ခိၬလီၫ. ဒုၭပြံၩပၩအဝ့ၫၥံၪ လၧနစီၩ့နမၩ့တၭ, ဆၪ့",
			"12": "<sup>12</sup> လၩ့အဝ့ၫၥံၪဆံၭ. ပထၩ့ဖံၭလဘံၪ့, ကဆါဧ့,- အဝ့ၫ ၥံၪအနိၭအဆၧဒဲၩဘၭနီၪ, မွဲအနိၭဖျံၩအဆၧချဲၩ့တၭ, မွဲအဘၪဆၧဖီၪ့န့ဝ့ၫ လၧအအီၪက့ၪထၪ့ထီၫအၥၭအ ကၠီၩ့ဒဲလၧအဆိၪဆၧအကၠီၩ့, ဒဲလၧအချဲၩ့ဆၧအဘျံၭ",
			"13": "<sup>13</sup> အဘျၪအကၠီၩ့နီၪဆံၭ.- မၩလူၬဆၧလၧဆၧၥၭထၪ့, မၩလူၬအဝ့ၫၥံၪ ဘဲၫအထီးအီၪလၧၩ့လဂ့ၩ. တၭဒုၭ ၥ့ၪယၫၦၡၩလၧယွၩပၧၩ့ဘၪဆၧ လၧစယၫကူၭအဖၧၩ့ ဖိးလၧဂၪ့ခိၪအထုၬလဖၪနီၪဆံၭ. (စ့လၫ.)",
			"14": "<sup>14</sup> လၧမုဂၪလၩ့နီၪအဝ့ၫၥံၪမိဂဲၫထဲၩ့ထဲၩ့, မိအိၩ့ယိၩ့",
			"15": "<sup>15</sup> ဘဲၫထွံၪအၥိၭတၭ, လ့ၩဎဲၪ့ဒိၩ့နီၪလီၫ.- အဝ့ၫၥံၪလ့ၩ ဝံၩ့ဝၩ့အၪ့ဎၬဆၧတၭ, အ့ၪလဘျဲၩအၪ့ဘၪတၭ, မိအီၪ",
			"16": "<sup>16</sup> ၥၫ့နၩချီၩ့လီၫ.- အ့ၪမွဲယဝ့ၫဒၪယီၩယမိၥံၫကျံၩထၪ့န စီၩ့နမၩ့တၭ, ယမိစံၭထၪ့အၪ့အူၭနဆၧအဲၪ အခိးအ တၩလၧလူၥီၫဖၭဒိၪ လၧဂီၩလခီၫနီၪလီၫ. အဂဲးဘဲၫ ယီၩလၧမုလနံၩလၧယဘၪဆၧခိဆၧဝီၩနီၪ, နမွဲယဆၧ",
			"17": "<sup>17</sup> ဖီၩ့ဖျ့ၭအထိၬ, ဒဲယဆၧဖလ့ၬအလးလီၫ.- ယဂဲးယ ဘၭဧ့,ယမိၥံၫကျံၩထၪ့နၧၩလီၫ. အဂဲးဘဲၫယီၩယွၩမွဲ ယဆၧဖီၩ့ဖျ့ၭအလး, ယဆၧအခိးအတၩအယွၩလီၫ."
		},
		"60": {
			"1": "<sup>1</sup> ယွၩဧ့, နခွံၬၡိၭယူၭပၧၩယူၭ, နမၩလၩ့မုလၩ့ဖၭ ယူၭပၧၩယူၭ နၥၭထၪ့ယူၭတၭ, ကၠၪကဒၩထဲၩ့နၥၭ",
			"2": "<sup>2</sup> လၧပအီၪဆံၭ.- နမၩဝၭၡိၩ့ၡိၭယူၭဂၪ့ခိၪ, နမၩထ့ ဖၭယူၭဝ့ၫယူၭတၭ, မွဲနမၩဘျၪထဲၩ့အထ့ဖၭအလးနီၪ",
			"3": "<sup>3</sup> ဆံၭ, အဂဲးဘဲၫယီၩမွဲအဝၭဝ့ၫဒၪလီၫ.- နဒုၭနဲၪယူၭ နၡၩခမျၧးလၧဆၧကၪဆၧဂဲၩတၭ, နဒုၭအီၩယူၭပၧၩ",
			"4": "<sup>4</sup> လၧစဘံၭထံၫထီးပမၧၩ့ဒၪလ့ၬယူၭ.- နဖ့ၪလၫ့ၥုၭဖိၪ အလၫ့လၧၦလၧအၥၭမဲၪနၧၩ, ဘဲၫၥိၭဆၧမိမၩဖျီၪထၪ့ အၥၭလၧဆၧမွဲဆၧတီၩအကၠီၩ့လီၫ. (စ့လၫ.)",
			"5": "<sup>5</sup> ဘဲၫၥိၭၦလၧနအဲၪဝ့ၫလဖၪမိဖီၩ့မိဖျ့ၭတၭ, ထိး ထဲၩ့တၩ့ထဲၩ့ဆၧ လၧနစူၪထွ့ၪတၭခိၭနၪယလူဆံၭ.",
			"6": "<sup>6</sup> ယွၩချဲၩ့ယူၭ ဆၧလၧဆၧဆံၫ့ဎံၪအဖၧၩ့ယူၭ. ယမိၥုၪ့ဎွံၫ ၥၭယီၫတၭ, ယမိအၪ့နၩ့ဖၭ ၡံခံၫ့အဆၧၫ့တၭ, ယမိ",
			"7": "<sup>7</sup> ထိၪစၧကီၭအဆၧပျၩ့နီၪလီၫ.- ဂံလအၭမွဲယဆၧ, ဒဲမ နၭစ့ၫမွဲယဆၧ, ဒဲအံဖြံၫ့မွဲယခိၪအဂဲးအဘၭ, ယုဒၫမွဲ",
			"8": "<sup>8</sup> ယၡၩပၧၩ့ဆၧအနိၪထိၭ,- မိအၭမွဲယၥူၫဝၭဆၧအ အံၪ့ဒိၫ့လဖျိၪ့, အံဒၧၫ့နီၪ, မွဲယခွံၬၡိၭယခၪ့ဖံၭလၧအ ဖၫ့ခိၪ,ဖလံၡၫဧ့, ၥုၪ့ဝၭထိၬၥၭဝၭထိၬလၧယကၠီၩ့ဆံၭ.",
			"9": "<sup>9</sup> မွဲပလၫမိဒုၭလ့ၩနုၬယၧၩ လၧဒိၩ့ဖၧၩ့အီၪလၧအခိၪ ဒၧၩ့နီၪလဂၩလဲၪ, တၭမွဲပလၫမိၥိၫ့ယၧၩ ထီၩ့လၧအံ",
			"10": "<sup>10</sup> ဒၧၫ့အဖၧၩ့နီၪလဂၩလဲၪ.- မွဲနဝ့ၫဒၪ, ၦလၧအခွံၬၡိၭ ခွံၬပၧၩ,ယွၩဧ့, မွဲအ့ၬဧၪ. ဒဲၦလၧအလ့ၩထၪ့လၧၦၥုၭ",
			"11": "<sup>11</sup> မုခမျၧးအၥိၭအ့ၬဧၪ,ယွၩဧ့.- လၧဆၧမၩခိမၩဝီၩအ ဖၧၩ့နီၪမၩဆၧၩ့ပၧၩဆံၭ. အဂဲးဘဲၫယီၩ ၦၡၩအဆၧ",
			"12": "<sup>12</sup> ထိးထဲၩ့တၩ့ထဲၩ့နီၪ မွဲဆၧပျီၩပျီၩလီၫ.- ပမိမၩဆၧလၧ ဆၧဂဲးဆီၪ့ဘၭဆီၪ့ လၧယွၩအဖၧၩ့လီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫဒၪနီၪ မိယဲးထဲးလၩ့ပဒုၪပဒၩလီၫ."
		},
		"61": {
			"1": "<sup>1</sup> ခိၭနၪယကိၭၡၭဆၧ, ယွၩဧ့, ဒိၭနနါလၧယဆၧဘၩ",
			"2": "<sup>2</sup> ဆိၪဖၪဆံၭ.- ထီးယၥၭအ့ၪဘၪဆၧလုၬဘံၭဝ့ၫတၭ, ယကိၭထၪ့နၧၩလၧဂၪ့ခိၪအထုၬနီၪလီၫ. တၭၥိၫ့ယၧၩ",
			"3": "<sup>3</sup> လၧလဲၫ့လၧအထီၫနဲၪ့ယၧၩလဖျိၪ့အအီၪနီၪဆံၭ.- အ ဂဲးဘဲၫယီၩ နမွဲဆၧဖီၩ့ဖျ့ၭအလးလၧယဂး, ဒဲထိၬအ",
			"4": "<sup>4</sup> ထီၫဂုးခၧၫ့လၧယဒုၪယဒၩအမ့ၬယၫလီၫ.- ယမိအီၪ လၧနတဲၩဆံၫ့ဎံၪအဖၧၩ့ လၩ့ဆိၩလၩ့ကၠၪတၭ, ယမိ စဲၪ့ဖလ့ၬယၥၭ လၧနဒံၭအဖၫ့လၬနီၪလီၫ.(စ့လၫ.)",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩနဝ့ၫဒၪ, ယွၩဧ့, နနါဂၧၫ့ယူၭယဆၧ ဆိၪလၩ့ယၥၭယူၭတၭ, နဖ့ၪလၫ့ယူၭဆၧန့ၥၫလၧၦ လၧအၥၭမဲၪနမံၩ့ယူၭ.",
			"6": "<sup>6</sup> တၭနမိအီၪက့ၪအၪထၪ့မုနံၩၥံၪ လၧစဎွၩအမုနံၩ လဖၪ, အနံၪ့အလၩမိအီၪဝ့ၫ ဘဲၫအၪဆိၩအၪကၠၪအၥိၭ",
			"7": "<sup>7</sup> လီၫ.- တၭအဝ့ၫၥံၪမိအီၪလၧယွၩအမ့ၬယၫလၩ့ဆိၩလၩ့ ကၠၪလီၫ. တၭအီၪက့ၪလၩ့ ဆၧယၫ့ၥုၪ့ယၫ့ၥၭ, ဒဲဆၧ",
			"8": "<sup>8</sup> မွဲဆၧတီၩ လၧအမိပၧၩ့ဘၪဝ့ၫနီၪဆံၭ.- အ့ၪမွဲဘဲၫနီၪ တၭ,ယမိၥံၫကျံၩထၪ့နမံၩ့ လၩ့ဆိၩလၩ့ကၠၪ ဘဲၫၥိၭ ယမိမၩဘိၪ့ဆၧဘၪဆဲၫ့ လၧယဆိၪလၩ့ယၥၭနီၪ လ နံၩဘၪလနံၩလီၫ."
		},
		"62": {
			"1": "<sup>1</sup> ယၥၭအီၪဂုးဖုးမုၬလၩန့ၫ လၧယွၩအဖၧၩ့လီၫ.ဆၧ ထိးထဲၩ့တၩ့ထဲၩ့ယၧၩနီၪ ဂဲၫလၩ့လၧအအီၪလီၫ.",
			"2": "<sup>2</sup> ယလဲၫ့ဒဲဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩ မွဲန့ၫအဝ့ၫဒၪနီၪ, ယထိၬထၪ့ထီၫလဖျိၪ့တၭ, ယဂဲၩယဝၭဘၪအၪအၪ",
			"3": "<sup>3</sup> အ့ၬ.- ဆံၭယံၬနၥံၪအၥၭမိခဲၩထၪ့ထၫ့ဒုၪဒၩ ၦလဂၩ လဲၪ.တၭနၥံၪဝ့ၫထီးအလူၬ, မွဲနၥံၪမိမၩခါလၩ့အဝ့ၫ ဘဲၫဆၧဒီၪ့လၧအကူၭလၩ့အၥၭ, ဘဲၫထနါလၧအဝၭ",
			"4": "<sup>4</sup> အၥိၭနီၪဆ့ဧၪ.- တၭအဝ့ၫၥံၪကိၪ့ထၪ့ဖၭလၩ့ဆၧန့ၫ လၧအမိခွံၬလၩ့ခွံၬ အဝ့ၫလၧအလးဂ့ၩ, အဝ့ၫၥံၪမုၬ လၩဒၪအၥၭ လၧဆၧချဲၩ့ဘျံၭ ချဲၩ့ဘျၪလီၫ. အဝ့ၫၥံၪ ဆိၪဂ့ၩဆၧလၧအနိၭ, အ့ၪမွဲဆိၪအၧၩ့ဆၧ လၧအၥၭ လီၫ.(စ့လၫ.)",
			"5": "<sup>5</sup> ယၥၭဧ့,အီၪဂုးဖုးမုၬလၩန့ၫ လၧယွၩအဖၧၩ့နီၪဆံၭ. အဂဲးဘဲၫယီၩယယိလါဆၧလၧ အဝ့ၫနီၪအဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> အဝ့ၫဒၪမွဲယလဲၫ့ ဒဲဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩနီၪ, မွဲ ယထိၬထၪ့ထီၫလဖျိၪ့တၭ, ယဂဲၩယဝၭဘၪအ့ၬ.",
			"7": "<sup>7</sup> တၭဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩ, ဒဲယလၩယဖၩ့အီၪ ဝ့ၫလၧယွၩအဖၧၩ့နီၪလီၫ. တၭယဂဲးယဘၭ အလဲၫ့, ယဆၧဖလ့ၬ အလးနီၪအီၪဝ့ၫ လၧယွၩအဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> တၭဒိၭနဲၩ့ နၥံၪအၥၭ လၧအဝ့ၫနီၪကိၭအဆၧၫ့အထီ ဒ့ၭ,ၦခမျၧးၥံၪဧ့, လူၫလၩ့ခွံၬနၥံၪအၥၭလၧအမ့ၬယၫ ဆံၭ,ယွၩမွဲဆၧဖလ့ၬအလးလၧပဂးလီၫ. (စ့လၫ.)",
			"9": "<sup>9</sup> တၭၦၡၩအလးဖၨၪမွဲန့ၫပျီၩပျီၩတၭ, ၦၡၩအလး ထၪ့ထီၫမွဲဆၧအဘျံၭအဘျၪလီၫ. လၧခံၫ့အဖၧၩ့တၭ ထၪ့ဝ့ၫတၡါ, ထီးအလူၬနီၪဎွံၫနဲၪ့ဆၧပျီၩပျီၩဒံၭလီၫ.",
			"10": "<sup>10</sup> တၭဒိၭနဲၩ့နၥံၪအၥၭ လၧဆၧမၩအၧၩ့ဆၧလဂ့ၩ, အီၪ က့ၪဖိၫလိၫနၥံၪအၥၭလၧဆၧမၩန့ဆီၪ့ ၦဂူၫဂၩအ ဆၧအကၠီၩ့နီၪလဂ့ၩ. ဆၧစူၪလးခၪ့ခိၪနီၪ အ့ၪအၪထၪ့",
			"11": "<sup>11</sup> တၭ,အီၪက့ၪနၥံၪအၥၭလၧအဖၧၩ့လဂ့ၩ.- ယွၩချဲၩ့ ဆၧလဖၧၫ့တၭ, နံၫဖၧၫ့ယနါဂၧၫ့ဆၧယီၩဆၧအစီၩ့အ",
			"12": "<sup>12</sup> မၩ့အီၪလၧယွၩလီၫ.- တၭဆၧယၫ့ၥုၪ့ယၫ့ၥၭအီၪ လၧ နၧၩ,ကဆါဧ့, အဂဲးဘဲၫယီၩနမိဖ့ၪထဲၩ့ၦၡၩ ဘဲၫအမၩ ဆၧအၥိၭလဂၩဘၪလဂၩကိၭဂၩဒ့ၭလီၫ."
		},
		"63": {
			"1": "<sup>1</sup> ယွၩဧ့, နမွဲယယွၩလီၫ. ယမိအၪ့ဎူၫအၪ့ဎၬနၧၩဆီၪ့ ဆီၪ့လ့ၬ, ယၥၭယီၩၥူၫအၥၭလၧနၧၩ, ယဖံၭယယၪ ဆိၫ့န့နၧၩလၧခးဎဲၫ့ထၬ ယၥၭလၩ့ဘဲၩလၧထံၫလအီၪ",
			"2": "<sup>2</sup> ဘၪအကၠီၩ့လီၫ.- ဘဲၫနီၪၥိၭဆ့, ယယိထံၫယိဆၭနၧၩ လၧလးဆံၫ့ဎံၪအဖၧၩ့ ဘဲၫၥိၭယမိဒၪဘၪနစီၩ့နမၩ့ ဒဲန လၩနဖၩ့လီၫ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ နဆၧအဲၪအခိးအတၩနီၪ ဂ့ၩနဲၪ့ၥၭ မၧၫ့ဒံၭတၭ, ယနိၭဖျံၩ မိစံၭထၪ့အၪ့အူၭနၧၩလီၫ.",
			"4": "<sup>4</sup> ယမၧၫ့အဘိၩ့အဘၭတၭ, ယမိစံၭထၪ့အၪ့အူၭနၧၩဘဲၫ",
			"5": "<sup>5</sup> နီၪၥိၭ, ယမိယူၬထၪ့ယစူၪလၧနမံၩ့အဖၧၩ့လီၫ.- တၭ ယၥၭမိဘျဲၩအၪ့ဆၧအၪ့အွံၪ ဒဲဆၧၥိၪဆၧခံတၭ, ယ နိၭမိစံၭထၪ့အၪ့အူၭ ဆၧလၧနိၭဖျံၩအၥၭထိၬလီၫ.",
			"6": "<sup>6</sup> ထီးယနၪ့ထၪ့ထဲၩ့နၧၩ လၧယလးမံၫခိၪတၭ, ယဆီၫ့ မီၪ့နဂဲးနကၠီၪ့ လၧမုနၩအဆၧခိၭလဖၪ အထးဖၧၩ့နီၪ",
			"7": "<sup>7</sup> လီၫ.- အဂဲးဘဲၫယီၩ နမွဲဆၧမၩဆၧၩ့ယူၭယၧၩတၭ,",
			"8": "<sup>8</sup> ယမိၥုၪ့ဎွံၫၥၭယီၫ လၧနဒံၭအလၩၡုၪဖၧၩ့နီၪလီၫ.- ယ ၥၭဒိၭနဲၩ့အၥၭလၧနၧၩ, နစူၪထွ့ၪမၩဆၧၩ့ယၧၩလီၫ.",
			"9": "<sup>9</sup> တၭၦလၧအအၪ့ဎူၫအၪ့ဎၬ မၩဂၭဂီၩ့ယၥၭလဖၪနီၪမိ",
			"10": "<sup>10</sup> လ့ၩလၩ့လၧဂၪ့ခိၪအဆၧယိၬအဖၧၩ့နီၪလီၫ.- နၭအနါ မိမၩနၧၩ့အဝ့ၫၥံၪတၭ, မိကဲၪထၪ့လၧထွံၪမံၩ့အဂးလီၫ.",
			"11": "<sup>11</sup> အ့ၪမွဲစဎွၩမိၥၭထိၬ လၧယွၩအဖၧၩ့လီၫ. ကယဲၦလၧ အဆိၪလၩ့အၥၭ လၧယွၩအမ့ၬယၫလဂၩလါလါနီၪမိ အီၪက့ၪဖိၫလိၫအၥၭလီၫ. အဂဲးဘဲၫယီၩ ၦလၧအချဲၩ့ ဆၧအဘျံၭအဘျၪနီၪ အနိၭမိဘၪဆၧၥံၭဘံၭထၬဝ့ၫ ဒၪလီၫ."
		},
		"64": {
			"1": "<sup>1</sup> လၧယဆၧဘၩဆိၪဖၪအဖၧၩ့နီၪခိၭနၪယလူ, ယွၩဧ့, တၭမၩဖီၩ့မၩဖျ့ၭယၥၭမၧၫ့ လၧဆၧၥၭမဲၪဒုၪဒၩနီၪ",
			"2": "<sup>2</sup> ဆံၭ.- အီၪက့ၪၥူၪခွံၬယၧၩ လၧၦအၧၩ့အဆၧကိၪ့အီၪၥူၪ ဝ့ၫနီၪ,လၧၦမၩဆၧအၧၩ့လဖၪ အဆၧအီၪကီၪ့တုၩ့ထၪ့",
			"3": "<sup>3</sup> တုၩ့လၩ့ဆၧနီၪဆံၭ.- အဝ့ၫၥံၪကျဲၩ့အဖျ့ၩဘဲၫနၭ အဲၪ့ဝ့ၫအၥိၭနီၪ, တၭဖိၫအဖျါၥံၪ, ဆၧချဲၩ့ခၪဒၪလ့ၬ",
			"4": "<sup>4</sup> လီၫ.- မွဲဘဲၫၥိၭအမိခၭ ၦအလၧၫ့အဎွ့ၩၥံၪလၧဆၧအီၪ ၥူၪအလးဖၧၩ့နီၪလီၫ. ခၭဝ့ၫချဲၫ့မၬတၭ, ၥၭမဲၪဆၧ",
			"5": "<sup>5</sup> အ့ၬ.- အဝ့ၫၥံၪဒုၭဆီၪ့ထၪ့လိၬအၥၭ လၧဆၧအၧၩ့အ ဖၧၩ့တၭ, ကိၪ့ထၪ့ဝ့ၫလၧအမိဆဲၪၥူၪ ဖျံၩခွၩ့ၥံၪလီၫ. တၭစံၭဝ့ၫ မွဲပလၫမိယိဝ့ၫလဂၩလဲၪ.",
			"6": "<sup>6</sup> အဝ့ၫၥံၪအၪ့ဎၬဆၧအၧၩ့တၭ, စံၭဝ့ၫ,ပကိၪ့ထၪ့ဆၧ ကိၪ့လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩလီၫ. တၭအဆၧဆီၫ့မီၪ့လၧအ ၥၭခံဖၧၩ့လဂၩဘၪလဂၩနီၪ, ဒဲအၥၭဆ့မွဲဆၧယိၬမၬ",
			"7": "<sup>7</sup> လီၫ.- အ့ၪမွဲယွၩခၭအဝ့ၫၥံၪလၧဖျါတၭ, ဘၪယူၭချဲၫ့",
			"8": "<sup>8</sup> မၬလီၫ.- ယွၩဒုၭလၩ့ထံၩဖါယူၭအဝ့ၫၥံၪတၭ, အဖျ့ၩ မိဘၪလၧအလီၩ့ဒၪဝ့ၫနီၪလီၫ. ကယဲၦလၧအဒၪဝ့ၫနီၪ",
			"9": "<sup>9</sup> မိစဲၪ့ဖျိၭကိၭဂၩဒ့ၭလီၫ.- ၦထီးအလူၬၥၭမဲၪဝ့ၫတၭ, ဒုၭနဲၪယွၩအမၩဆၧထီးအလူၬလီၫ. တၭအဆၧမၩနီၪ အဝ့ၫၥံၪဆီၫ့မီၪ့ဝ့ၫ လၧအဂဲးအကၠီၪ့ထံၫထံၫဆၭဆၭ",
			"10": "<sup>10</sup> လီၫ.- ၦတီၩၦလီၩ့ၥုၪ့ထိၬၥၭထိၬ လၧယဟိဝၩအဖၧၩ့ တၭ,မိဒိၭနဲၩ့အၥၭလၧအဝ့ၫနီၪတၭ, ၦလၧအၥုၪ့ဆုး လီၩ့ဝ့ၫလဖၪနီၪ အီၪက့ၪဖိၫလိၫအၥၭထီးအလူၬလီၫ."
		},
		"65": {
			"1": "<sup>1</sup> ဆၧစံၭထၪ့အၪ့အူၭအီၪခိၭလၧနဂး လၧဇံအိၫ့အ ဖၧၩ့,ယွၩဧ့, ဒဲၦမၩဘိၪ့နၧၩ လၧဆၧဘၪဆဲၫ့လၧဆၧ",
			"2": "<sup>2</sup> ဆိၪလၩ့အၥၭနီၪလီၫ.- ၦလၧအနါဂၧၫ့ဆၧဘၩဆိၪဖၪ, နဝ့ၫဒၪလဂၩဧ့, ဆၧယၪထီးအလူၬမိဂဲၫထီၩ့လၧနအီၪ",
			"3": "<sup>3</sup> လီၫ.- ဆၧအၧၩ့ဆၧၥၫ့နီၪမၩနၧၩ့မၩစၪယၧၩလီၫ. ပဆၧမၪလဖၪနီၪ နနၫ့ဆါဒၪနဝ့ၫ နမိလုၬဘံၭခွံၬလီၫ.",
			"4": "<sup>4</sup> ၦလၧနရွံန့ဝ့ၫ ဒဲဒုၭၥုၭဘူၭဝ့ၫ လၧနအီၪလဂၩနီၪ,အဝ့ၫ ဒၪ မိအီၪလၧနဝၩ့ လဖၪအဖၧၩ့ ဒဲဘၪဆိၪဂ့ၩဝ့ၫလီၫ. တၭပမိမံၫ့ၥုၪ့မံၫ့ၥၭ လၧနဂံၪ့, နနီးဆံၫ့ဎံၪ အဆၧထူၭ ဆၧလၧၫ့လဖၪနီၪလီၫ.",
			"5": "<sup>5</sup> ဆၧထိးထဲၩ့တၩ့ထဲၩ့ပၧၩအယွၩဧ့, နမိစံၭဆၧၫ့ပၧၩ လၧဆၧဒုၭၥၭမဲၪဆၧလဖၪ လၧဆၧတီၩဆၧလီၩ့အဖၧၩ့ နီၪ,နမွဲဆၧဒိၭနဲၩ့အလး လၧၦအီၪလၧဂၪ့ခိၪအထုၬ ထီးအလူၬ, ဒဲၦလၧမၫဆမံၭဖၧၩ့ အီၪလၧအယဲၩ့လဖၪ",
			"6": "<sup>6</sup> အဂးလဂၩနီၪလီၫ.- နမွဲၦလၧအမၩဂုးမၩခၧၫ့ခိၪလီၩ့ ထိၩ့ချိၬလၧအဂဲးအဘၭ လၧအယးဒံၩ့ခဲးထူၬအၥၭလၧ",
			"7": "<sup>7</sup> အစီၩ့အမၩ့,- ၦလၧအဒုၭအီၪလၩ့မါပံၭမၫဆမံၭအ ၥီၫ,လပီၩလဖၪအၥီၫ, ဒဲၦခမျၧးအဆၧတုၩ့ထၪ့တုၩ့",
			"8": "<sup>8</sup> လၩ့လီၫ.- ထီးနီၪလဖၧၫ့ ၦလၧအအီၪဝ့ၫ လၧအထုၬ လဖၪနီၪၥၭမဲၪနဆၧလၩ့လၭလီၫ. တၭနဒုၭၥုၪ့ဎွံၫၥၭ ယီၫဆၧလၧအစဲၪ့ထၪ့လၧဂီၩဒဲလၧဂၪလီၫ.",
			"9": "<sup>9</sup> နအီၪၡီၩ့ဂၪ့ခိၪဒဲနမၩဘၪစီၪဂ့ၩ နမၩထူၭမၩလၧၫ့ ဝ့ၫအၪအၪလ့ၬတၭ, ယွၩအထံၫမိဎွါဎွ့ၩဝ့ၫ လၧထံၫ လီၫ.ထီးနတဲၩ့ဝဲၩဂၪ့ခိၪဂီၩ့တၭ, နတဲၩ့ဝဲၩဘုၪၥံၪဂူၫ",
			"10": "<sup>10</sup> ၥံၪလၧအဂးလီၫ.- တၭနမၩဘၪစီၪအကၠီၪ့လဖၪလၧၫ့ လၧၫ့ဎွ့ၩဎွ့ၩ, နမၩလၩ့ဒၩဂၪ့ခိၪအဂဲးၥံၪတၭ, နမၩဖျ့ၭ ဝ့ၫလၧဆၧဆၧၩ့လၩ့နီၪ, နဆိၪဂ့ၩအဆၧမဲၪထၪ့လဖၪ",
			"11": "<sup>11</sup> လီၫ.- တၭနဒုၭချႃၬနံၪ့နီၪ လၧနဆၧဂ့ၩအၥရဖူၩလီၫ.",
			"12": "<sup>12</sup> နခၪ့လးၥံၪ ဒုၭလၩ့ဆၩ့ၥိၪလီၫ.- ဒုၭလၩ့ဆၩ့ဝ့ၫလၧ ဆၧအၪ့အဆၪအလးအဖၫ့ခိၪ လၧမံၩ့လၬကျၩ, ဒဲဆၧ စီၩ့ခိၪလဖၪခဲးထူၬအယးဒံၩ့ လၧဆၧၥုၪ့ဎွံၫၥၭယီၫလီၫ.",
			"13": "<sup>13</sup> ဆၧအၪ့အဆၪအလးၥံၪ ဘၪဆၧဒုၭကီၩ့ဒုၭၥိၭဝ့ၫ လၧၥိၪအဒီၪ့လဖၪတၭ, ဆၧဒၩဖၧၩ့နီၪဘၪဆၧဒုၭလုၬ ဝ့ၫလၧဘုၪၥံၪဂူၫၥံၪလီၫ. အဝ့ၫၥံၪကိၭၡၭထၪ့ၡီၩ့တၭ, ၥံၫကျံၩဆၧဆ့လီၫ."
		},
		"66": {
			"1": "<sup>1</sup> ဂၪ့ခိၪဖိၪထီးအလူၬၥံၪဧ့, ကိၭၡၭထၪ့ယွၩလၧနၥံၪ အၥုၪ့ထိၬၥၭထိၬဆံၭ. ၥံၫကျံၩထၪ့အမံၩ့အလၩအဖၩ့",
			"2": "<sup>2</sup> ဆံၭ.- ဒုၭနဲၪဆၧလၩဆၧဖၩ့, အဆၧစံၭထၪ့အၪ့အူၭ",
			"3": "<sup>3</sup> လၧအကြၨၭန့ဘၪဆံၭ.- စံၭယွၩ, နမၩဆၧလဖၪနီၪမွဲ ဆၧၥၭမဲၪအလးဆံၭဒိၪလဲၪ, လၧနစီၩ့ဒိၪနမၩ့ထီၫအ ကၠီၩ့နီၪ,နဒုၪနဒၩလဖၪ မိကျဲၩ့ဆၪ့လၩ့အၥၭလၧနဖၫ့",
			"4": "<sup>4</sup> လၬလီၫ.- ၦဂၪ့ခိၪဖိၪမိဘိၪ့ထၪ့ဘၩထၪ့နၧၩ ကိၭဂၩ ဒ့ၭတၭ,မိၥံၫကျံၩထၪ့နၧၩတၭ, မိစံၭထၪ့အၪ့အူၭနမံၩ့",
			"5": "<sup>5</sup> လီၫ.(စ့လၫ.)- ဂဲၫဘီၪ, ယိယွၩအဆၧမၩလဖၪနီၪ ဆံၭ.တၭအဝ့ၫဒၪ မၩဆၧနီၪမွဲဆၧၥၭမဲၪၥၭဖျဲၩ့အလး",
			"6": "<sup>6</sup> လၧၦၡၩဖိၪၥံၪအဂးဖီၩ,- အဝ့ၫဒၪဒုၭကဲၪထၪ့မၫဆ မံၭလၧခီၫ့ၥူၫခိၪတၭ, ၦခၫ့ဂၬဝ့ၫလၧအခၪ့လီၫ. ထီးနီၪ",
			"7": "<sup>7</sup> ပၥုၪ့ထိၬပၥၭထိၬလၧအဖၧၩ့လီၫ.- တၭအဝ့ၫဒၪပၧၩ့ ဆၧလၧအစီၩ့အမၩ့, အဆိၩဆိၩအကၠၪကၠၪ ဒဲအမ့ၬ ၥၪယိထံၫၦဆၨၩၥံၪလီၫ. မွဲၦပိၩ့ထၪ့ဆၧၥံၪ ထီးအီၪက့ၪ ထၪ့ထီၫအၥၭလဂ့ၩ.(စ့လၫ.)",
			"8": "<sup>8</sup> ၦခမျၧးၥံၪဧ့, စံၭထၪ့အၪ့အူၭပယွၩတၭ, ဒုၭနါဂၧၫ့",
			"9": "<sup>9</sup> အဆၧစံၭထၪ့အၪ့အူၭအလူနီၪဆံၭ.- အဝ့ၫဒၪအီၪက့ၪ ပၥၭလၧဆၧမၧၫ့အဖၧၩ့တၭ, ဖ့ၪလၫ့ပခၪ့ဂဲၩဝၭအ့ၬ.",
			"10": "<sup>10</sup> အဂဲးဘဲၫယီၩနမၩခွါယူၭပၧၩယူၭ, ယွၩဧ့,နအၪ့ကဲၪ့",
			"11": "<sup>11</sup> ယူၭပၧၩဘဲၫၦအၪ့ကဲၪ့စ့ၩအၥိၭနီၪလီၫ.- တၭနဒုၭလ့ၩ နုၬပၧၩလၧဖျံၩခွၩ့အဖၧၩ့, နအီၪက့ၪဆၧယိၭဎၧၫ့လၧ",
			"12": "<sup>12</sup> ပယးဒံၩ့အလီၩ့,- တၭနဒုၭထူၬၦၡၩ လၧပခိၪဎွံၪအဖၫ့ ခိၪလီၫ. တၭပလ့ၩနုၬလၧမ့ၪဖၧၩ့, ဒဲထံၫကျၩလါနၫ့ တၭ,နၥိၫ့ထၪ့ခွံၬပၧၩ ထီၩ့လၧဆၧလၧၫ့ဆၧဎွ့ၩလီၫ.",
			"13": "<sup>13</sup> ယမိလ့ၩထၪ့လၧနဂံၪ့ဖၧၩ့ လၧဆၧလုမ့ၪၥံၪ, ယမိမၩ",
			"14": "<sup>14</sup> ဘိၪ့နၧၩလၧဆၧဘၪဆဲၫ့လၧယဆိၪလၩ့ယၥၭ,- လၧ အထၪ့ဖျ့ၭလၧယနိၭဖၧၩ့ , ဒဲယနိၭချဲၩ့ဆၧလၧယဘၪ",
			"15": "<sup>15</sup> ဆၧခိဆၧဝီၩလီၫ.- တၭယမိလုထၪ့နၧၩ လၧဆၧလုမ့ၪ လၧဆၧဘီၪ့ဆၧၥိၪအကျၩ, ဒဲဆၧဆူၭခဲၩနၧၫ့မၧၫ့ဘၪ ဆဲၫ့လၧၥိၪဖၫၥံၪ, ယမိလုထၪ့ချီဖၫၥံၪ, ဒဲဘ့ၪဖၫၥံၪနီၪ လီၫ.(စ့လၫ.)",
			"16": "<sup>16</sup> ၦလၧအၥၭမဲၪယွၩ ထီးအလူၬၥံၪဧ့, ဂဲၫခိၭနၪဘီၪ, ယမိလီၩဘၪကယဲဆၧလၧအမၩဝ့ၫ လၧယၥၭအဂး",
			"17": "<sup>17</sup> လီၫ.- ယကိၭထၪ့အဝ့ၫဒၪလၧယနိၭတၭ, ယစံၭထၪ့",
			"18": "<sup>18</sup> အၪ့အူၭအဝ့ၫ လၧယဖျ့ၩလီၫ.- ယအ့ၪထိးဆၧၫ့ဆၧ အၧၩ့လၧယၥၭခံဖၧၩ့နီၪတၭ, ယွၩခိၭနၪဆၧအ့ၬ.",
			"19": "<sup>19</sup> အ့ၪမွဲယွၩခိၭနၪဝ့ၫတၡါယူၭ, အဝ့ၫဒၪခိၭနၪယူၭယ",
			"20": "<sup>20</sup> ဆၧဘၩဆိၪဖၪအလူယူၭ.- ယွၩလၧအလကၠၪဒိၭချိၫ့ ဘၪအၥၭလၧယဆၧဘၩဆိၪဖၪ, လၧအလမၩန့ထဲၩ့ ဘၪအခိးအတၩလၧယၧၩယီၩလဂၩနီၪ, မွဲအဘၪဆၧ စံၭထၪ့အၪ့အူၭဆံၭ."
		},
		"67": {
			"1": "<sup>1</sup> တၭဘဲၫၥိၭၦဂၪ့ခိၪဖိၪမိၥ့ၪယၫနဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭ, ဘဲၫ ၥိၭၦၡၩကိၭအဆၨၩဒ့ၭ မိၥ့ၪယၫနဆၧထိးထဲၩ့တၩ့ထဲၩ့",
			"2": "<sup>2</sup> တၭ,မွဲယွၩယၫ့ၥုၪ့ယၫ့ၥၭ ဒဲဆိၪဂ့ၩပၧၩဆံၭ.- မွဲအဒုၭ",
			"3": "<sup>3</sup> ဖၩ့ထၪ့ဘၪပၧၩ လၧအမ့ၬဆံၭ.- ယွၩဧ့, မွဲၦခမျၧး",
			"4": "<sup>4</sup> ၥံၪစံၭထၪ့အၪ့အူၭနၧၩဆံၭ.- မွဲၦခမျၧးၥံၪ ထီးအလူၬ စံၭထၪ့အၪ့အူၭနၧၩဆံၭ. တၭမွဲၦဆၨၩၥံၪၥုၪ့ထိၬၥၭ ထိၬတၭ,ၥုၪ့ဎွံၫၥၭယီၫဆံၭ. အဂဲးဘဲၫယီၩ နဝ့ၫဒၪ ယီၩ,နမိစ့ၩရၫ့တီၩ ၦခမျၧးတၭ, ၦဆၨၩၥံၪလၧဂၪ့ခိၪ",
			"5": "<sup>5</sup> ချိၫ့လဖၪနီၪ, နမိၥိၫ့အဝ့ၫၥံၪလီၫ.(စ့လၫ.)- ယွၩဧ့, မွဲၦခမျၧးၥံၪစံၭထၪ့အၪ့အူၭနၧၩဆံၭ, မွဲၦခမျၧးၥံၪထီး",
			"6": "<sup>6</sup> အလူၬစံၭထၪ့အၪ့အူၭနၧၩဆံၭ.- ဂၪ့ခိၪဖ့ၪထၪ့ယူၭ အဆၧအၪထၪ့ယူၭတၭ, ယွၩ, ပယွၩဒၪပဝ့ၫမိဆိၪဂ့ၩ",
			"7": "<sup>7</sup> ပၧၩလီၫ.- ယွၩမိဆိၪဂ့ၩပၧၩတၭ, ဂၪ့ခိၪအထုၬၥံၪထီး အလူၬမိၥၭမဲၪအဝ့ၫဒၪလီၫ."
		},
		"68": {
			"1": "<sup>1</sup> မွဲယွၩဂဲထုၪ့ဆံၭ, မွဲအဒုၪအဒၩၥံၪလၩ့ပြံၩလၩ့ပၩ ဆံၭ.တၭၦလဖၪလၧအမ့ၬလဲၩယွၩနီၪ မွဲအစဲၪ့ဖျိၭ",
			"2": "<sup>2</sup> လၧအမ့ၬယၫဆံၭ.- တၭဘဲၫမ့ၪခူၪဒံၩခွံၬဝ့ၫအၥိၭနီၪ, နၫ့ထၪ့ခွံၬအဝ့ၫၥံၪ ဘဲၫနီၪအၥိၭဆံၭ. ဘဲၫဎိၭဖံထၪ့ ဝ့ၫလၧမ့ၪအမ့ၬယၫအၥိၭနီၪ, မွဲၦလတီၩလလီၩ့ဘၪ လဖၪဂၭဂီၩ့လၧယွၩအမ့ၬယၫ ဘဲၫနီၪအၥိၭဆံၭ.",
			"3": "<sup>3</sup> အ့ၪမွဲၦတီၩၦလီၩ့လဖၪနီၪ, မွဲအၥၭထိၬဆံၭ. မွဲအၥုၪ့ ဎွံၫၥၭယီၫလၧယွၩအမ့ၬယၫဆံၭ. တၭမွဲအၥုၪ့ဎွံၫၥၭ ယီၫလၧဆၧၥၭထိၬဖၭဒိၪနီၪဆံၭ.",
			"4": "<sup>4</sup> ၥံၫကျံၩထၪ့ယွၩတၭ, ၥံၫကျံၩအၪ့အူၭထၪ့အမံၩ့နီၪ ဆံၭ. မၩဖၧၩ့ၥၭနးဘီၩ့ လၧၦလၧအထၪ့ထူၬဆၧလၧ ၡါမုနၧၫ့ဖၫလဂၩအဂးနီၪဆံၭ. အမံၩ့မွဲယွၩတၭ, ၥုၪ့",
			"5": "<sup>5</sup> ဎွံၫၥၭယီၫလၧအမ့ၬယၫဆံၭ.- ယွၩလၧအအီၪလၧအ လးဆံၫ့ဎံၪအဖၧၩ့နီၪ, မွဲၦဖိၪဎွ့ၪအဖါ, ဒဲၦလၧအစ့ၩ",
			"6": "<sup>6</sup> ရၫ့န့ၦမုၪမဲၪအခွးလီၫ.- ၦလၧအအီၪယူဝ့ၫနီၪယွၩဒုၭ ကဲၪထၪ့လၧဂံၪ့ဖိၪအဒီၪ့လဖၪတၭ, ၦလၧအဘၪဆၧ စၧၩ့ထၬဝ့ၫလဖၪ, ဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫ အ့ၪမွဲၦပိၩ့ထၪ့ဆၧ နီၪအီၪဝ့ၫလၧအလးဎဲၫ့ထၬလီၫ.",
			"7": "<sup>7</sup> ယွၩဧ့, ထီးနလ့ၩထၪ့လၧနၡၩခမျၧးအမ့ၬယၫတၭ, ထီးနဂၭဝံၩ့ဝၩ့လၧၡါမုနၧၫ့ဖၫအဘိၩ့ဘၭနီၪ, (စ့လၫ.)",
			"8": "<sup>8</sup> ဂၪ့ခိၪဝၭၡိၩ့ၡိၭ, မွဲမၬ, မူၭခိၪလၩ့ဆၩ့လၧယွၩအမ့ၬ ယၫမွဲဝ့ၫစဲနၫ လၧယွၩအမ့ၬယၫ, အံၫစရ့လၭအယွၩ",
			"9": "<sup>9</sup> နီၪလီၫ.- ယွၩဧ့, နအၪ့မၧၫ့ဆၧဂဲၫဆၧၩ့အၪအၪလ့ၬ, လၧနၡၩန့ၥၫဆၧအဂးတၭ, ထီးအၥၭလၩ့ဘဲၩနီၪ, န",
			"10": "<sup>10</sup> ဒုၭဆီၪ့ထၪ့ဝ့ၫလီၫ.- တၭနၡၩလဒီၪ့အီၪဝ့ၫ လၧအ ဖၧၩ့လီၫ.လၧနဆၧဂ့ၩအဖၧၩ့, နဝ့ၫဒၪ, နတဲၩ့ဝဲၩဆၧ",
			"11": "<sup>11</sup> လၧၦၡၪ့ဖိၪယၬဖိၪအဂး, ယွၩဧ့,- ကဆါအလူလၩ့ တၭ,ၦမုၪၥံၪလၧအမၩဂၧၫ့ထၪ့ၥၩလၩ့ ဆၧၥၭထိၬအ",
			"12": "<sup>12</sup> ပရၧၫ့နီၪအီၪခမျၧးဖၭဒိၪလီၫ.- ၥုၭမုခမျၧးအစဎွၩၥံၪ စဲၪ့ဖျိၭဝ့ၫ,စဲၪ့ဖျိၭဝ့ၫတၭ, ၦမုၪလၧအအီၪဒၪဆၧလၧ",
			"13": "<sup>13</sup> ဂံၪ့ဖၧၩ့နီၪအၪ့နၩ့ဖၭဆၧအၪ့ဂူၬန့လီၫ.- ထီးနၥံၪမံၫနၩ့ လၧၥိၪဖီၩ့အဘိၩ့ဆၧၩ့တၭ, နၥံၪမိမၩအၥၭဘဲၫထိၪ လွံအဒံၭဖၩ့ဝ့ၫလၧစ့ၩ, ဒဲအဆီၪ့နီၪဘဲၫလၧထီၫ့ဘၩ့အ",
			"14": "<sup>14</sup> ၥိၭလီၫ.- ထီးၦၥ့ၪဆၧလူၬ မၩလၩ့ပြံၩလၩ့ပၩ စဎွၩ ၥံၪလၧအဖၧၩ့တၭ, ဆၧဘွၩဘဲၫမူၭခိၪဖီၫ လၧစၫလမိၫ့ အလီၩ့နီၪလီၫ.",
			"15": "<sup>15</sup> ဘၫၡၫ့နီၪမွဲယွၩအခိၪလီၩ့တၭ, ဘၫၡၫ့နီၪ,မွဲခိၪလီၩ့",
			"16": "<sup>16</sup> အခံၫစူၩလဖၪလီၫ.- ခိၪလီၩ့လၧယွၩဆိၫ့ အီၪလၧအ ဖၧၩ့,ခိၪလီၩ့အခံၫစူၩၥံၪဧ့, မွဲဘၪနီၫလၧနၥံၪခိၭယိ လၧဆၧၥၭခ့ၬနီၪလဲၪ,မွဲမၬ, ယဟိဝၩမိအီၪဝ့ၫလၧအ",
			"17": "<sup>17</sup> လီၩ့အဆိၩဆိၩအကၠၪကၠၪလီၫ.- တၭယွၩအလဲၪ့ၥုၭ လဖၪအီၪအလၬၥံၪ အဘျၩ့အလၬၥံၪ, အထီၫ့ၥံၪအ ဘျၩ့အထီၫ့ၥံၪအဖၫ့ခိၪလီၫ. ယဟိဝၩအီၪဝ့ၫလၧအ",
			"18": "<sup>18</sup> ဝ့ၫၥံၪအကျၩ, စဲနၫအီၪလၧအလးဆံၫ့ဎံၪဖီၩ,- နလ့ၩ ထၪ့ယူၭလၧဆၧထၪ့ထီၫယူၭ. နမီၩ့ထၪ့ အၪ့မၧၫ့ဎီး ယူၭဆၧလၧအအၪ့မၧၫ့ဎီးဆၧနီၪ, နမၩန့ယူၭဆၧဖ့ၪ လၫ့လဖၪလၧၦၡၩအဂးယူၭ, လၧၦပိၩ့ထၪ့ဆၧအဂး",
			"19": "<sup>19</sup> ဒၪလ့ၬ, ဘဲၫၥိၭနမိအီၪ,ယဟိဝၩ,ယွၩဧ့.- မွဲကဆါဘၪ ဆၧစံၭထၪ့အၪ့အူၭလနံၩဘၪလနံၩနီၪဆံၭ. ဆၧအီၪ က့ၪဆၧယိၭဎၧၫ့လၧပလီၩ့ဎလါနၫ့ၭတၭ, ဆၧထိးထဲၩ့ တၩ့ထဲၩ့ပၧၩနီၪမွဲယွၩလီၫ. (စ့လၫ.)",
			"20": "<sup>20</sup> ယွၩနီၪမွဲဆၧထိးထဲၩ့တၩ့ထဲၩ့ပၧၩအယွၩလီၫ.တၭ ဆၧဒုၭစဲၪ့ထၪ့ခွံၬ လၧဆၧၥံၫအဖၧၩ့လဖၪနီၪ အီၪဝ့ၫ",
			"21": "<sup>21</sup> လၧယဟိဝၩ, ကဆါနီၪလီၫ.- မွဲမၬ, ယွၩမိဖ့ၬခွံၬအဒုၪ အဒၩၥံၪအခိၪဎွံၪ, ၦလၧအလ့ၩဆၧလၧအဆၧမၪ အ",
			"22": "<sup>22</sup> ဖၧၩ့နီၪအခိၪဒၩ့အီၪလၧခိၪၥူၪနီၪလီၫ.- ကဆါစံၭဝ့ၫ ဒၪ,ယမိဒုၭဂဲၫထဲၩ့ဆၧလၧဘၫၡၫ့အအီၪ ယမိဒုၭဂဲၫ",
			"23": "<sup>23</sup> ထဲၩ့ဆၧလၧမၫဆမံၭအဆၧယိၬဖၧၩ့နီၪ.- ဘဲၫၥိၭနမိ ယဲးလၩ့လၧဆၧၥွံၪဖၧၩ့တၭ, နထွံၪၥံၪအဖျ့ၩန့ဘၪအ",
			"24": "<sup>24</sup> ဂးလၧဒုၪဒၩၥံၪအအီၪလီၫ.- တၭအဝ့ၫၥံၪဒၪဘၪဝ့ၫ လၧနလ့ၩဆၧယွၩဧ့, ယယွၩ,ယစဎွၩအလ့ၩဆၧလၧ",
			"25": "<sup>25</sup> အလးဆံၫ့ဎံၪအဖၧၩ့နီၪလီၫ.- ၦၥံၫကျံၩဆၧၥံၪလ့ၩလၧ ယၫ,ၦဒံၩ့နါဒံၩ့ၥံၪလၧခဲၫ့, ၦမုၪနၩ့ၥံၪလၧအဖိၬစံၩ့စံၩ့",
			"26": "<sup>26</sup> လဖၪအီၪဝ့ၫလၧအကျၩလီၫ.- လၧၦအဒီၪ့ၥံၪအဖၧၩ့, ၦဘၪဆဲၫ့လၧၦအံၫစရ့လၭအထံၫထၪ့ဖျိၭနီၪ, စံၭထၪ့",
			"27": "<sup>27</sup> အၪ့အူၭယွၩ, ကဆါလဂၩလီၫ.- ၦအဆံၭ, ၦလၧအ ပၧၩ့ဆၧ,ဘံၪ့ယမံၫ့ယုဒၫအၦဒိၪဖၭဒိၪၥံၪ, အၡၩခ မျၧး,ဇ့ၭဘလၧၫ့ အၦဒိၪဖၭဒိၪၥံၪ, နၭၥလဲၫအၦဒိၪ",
			"28": "<sup>28</sup> ဖၭဒိၪၥံၪအီၪထီးနီၪလီၫ.- နယွၩအီၪက့ၪလၩ့ယူၭနဂဲး နဘၭယူၭ, ယွၩဧ့, ဆၧလၧနမၩလၧပဂး မၩဆီၪ့ထၪ့ ဆံၭ.",
			"29": "<sup>29</sup> လၧနနီးအီၪလၧယရုစလံၫ့အဖၧၩ့အကၠီၩ့နီၪ, စဎွၩ",
			"30": "<sup>30</sup> ၥံၪမိဂဲၫဆိၬ ဆၧဖ့ၪလၫ့လၧနအီၪလီၫ.- အၪ့ၥီၪ့ဖီးအ ဆၧဖိၪဆၧဎါအမံၩ့, ချီဖၫအဒီၪ့,ဒဲၦခမျၧးအချီဖိၪၥံၪ, လၧအဆၪ့လၩ့အဝ့ၫၥံၪအၥၭ လၧစ့ၩအဘံၪ့လဖၪနီၪ ဆံၭ.အဝ့ၫဒၪမၩလၩ့ပြံၩလၩ့ပၩ ၦၡၩလၧအမုၬအၥၭ",
			"31": "<sup>31</sup> လၧဆၧဒုၭၥုၭ အဖၧၩ့နီၪလီၫ.- ၦဒိၪလဖၪ မိဂဲၫထၪ့ လၧအံဇံၭအဖၧၩ့, ကုၡၫနီၪ မိယူၬထၪ့အစူၪ ချဲၫ့ချဲၫ့ လၧယွၩအအီၪလီၫ.",
			"32": "<sup>32</sup> ဂၪ့ခိၪအဘၩ့ၥံၪမုးၥံၪဧ့, ၥံၫကျံၩထၪ့ယွၩဆံၭ. စံၭ",
			"33": "<sup>33</sup> ထၪ့အၪ့အူၭကဆါဆံၭ. (စ့လၫ.)- ၦလၧအထူၬမူၭ ခိၪအမူၭခိၪလၧဖျိၩ့လဂၩနီၪ စံၭထၪ့အၪ့အူၭအဝ့ၫနီၪ",
			"34": "<sup>34</sup> ဆံၭ.ယိခွါ, အလူလၩ့ဝ့ၫအၥီၫဖၭဒိၪလီၫ.- အီၪက့ၪ ဆၧဂဲးဆီၪ့ဘၭဆီၪ့ လၧယွၩဆံၭ. အလၩအဖၩ့အီၪ ဝ့ၫလၧအံၫစရ့လၭအဖၫ့ခိၪ, ဒဲအစီၩ့အမၩ့အီၪဝ့ၫလၧ",
			"35": "<sup>35</sup> ဆၧအုၪ့လဖၪလီၫ.- ယွၩဧ့, နမွဲဆၧၥၭမဲၪအလးလၧ နလးဆံၫ့ဎံၪအဖၧၩ့လီၫ. အံၫစရ့လၭအယွၩ မွဲၦလၧ အဖ့ၪလၫ့ၦၡၩခမျၧး လၧအဂဲးအဘၭ ဒဲဆၧအစီၩ့အ မၩ့လီၫ. စံၭထၪ့အၪ့အူၭယွၩဆံၭ."
		},
		"69": {
			"1": "<sup>1</sup> မၩဖီၩ့မၩဖျ့ၭယၧၩဆံၭ. ယွၩဧ့, အဂဲးဘဲၫယီၩထံၫ",
			"2": "<sup>2</sup> လဖၪနီၪဂဲၫနုၬဖိးလၧယၥၭဖၧၩ့လီၫ.- ယလၩ့ဘၧၩ့ လၧဆၧယိၬ အဆၧလၩ့လၧၩ့အဖၧၩ့တၭ, ဆၧၫ့ထုၪ့ အလးအီၪနးစီၪ့အ့ၬ. ယဂဲၫနုၬ လၧထံၫယိၬ အကျၩ",
			"3": "<sup>3</sup> တၭ,ထံၫလုၬဘံၭ မၩလၩ့ဘၧၩ့ယၧၩလီၫ.- ဆၧပွံၭ ယၥၭလၧယကိၭထၪ့ဆၧအကၠီၩ့, ယခိၬဖၧၩ့ဎဲၫ့ထၪ့ တၭ,ယမ့ၬၥၪလူၬ လၧယယိလါ ယယွၩအဖၧၩ့ၥၭအ",
			"4": "<sup>4</sup> ကၠီၩ့နီၪလီၫ.- တၭၦလၧအမ့ၬလဲၩယၧၩပျီၩပျီၩလဖၪ နီၪအီၪဝ့ၫအၪနဲၪ့ ယခိၪၥူၪအဘီၩ့နီၪဒံၭလီၫ. တၭၦ လၧအမိမၩဂၭဂီၩ့ယၧၩ, ယဒုၪယဒၩလတီၩဘၪလဖၪ နီၪအဂဲးအဘၭဆီၪ့ဆီၪ့လ့ၬလီၫ. တၭဆၧလၧယလ မၩန့ဘၪနီၪ, မွဲယဘၪဖ့ၪထဲၩ့ဆ့ဧၪ.",
			"5": "<sup>5</sup> ယွၩဧ့,နၥ့ၪယၫယဆၧဂီၩ့ဆၧစၪတၭ, ယဆၧဒဲၩဘၭ",
			"6": "<sup>6</sup> အီၪၥူၪခွံၬလၧနၧၩဆ့အ့ၬ.- ၦလၧအအီၪခိၭနၧၩလဖၪ နီၪယဟိဝၩဆၧၥုၭမုခမျၧးအကဆါဧ့, မွဲအထီးမ့ၬမဲ ဘၪလၧယကၠီၩ့လဂ့ၩ. ၦလၧအအၪ့ဎၬနၧၩလဖၪနီၪ, မွဲအထီးဘၪဆၧအီၪက့ၪမဲအမ့ၬ လၧယကၠီၩ့လဂ့ၩ,",
			"7": "<sup>7</sup> အံၫစရ့လၭအယွၩဧ့,- အဂဲးဘဲၫယီၩ ယဘၪဆၧဒုၪ",
			"8": "<sup>8</sup> ဒွ့ၪလၧနကၠီၩ့တၭ, ဆၧမ့ၬမဲလုၬဘံၭယမ့ၬလီၫ.- ယ ကဲၪထၪ့ၦမွံၩလၧယထၧၫ့ဖုဝဲအမ့ၬယၫ, ဒဲၦလခီၫဘၩ့",
			"9": "<sup>9</sup> မုးဖိၪ လၧအမိအဖိၪခွၫၥံၪအမ့ၬယၫလီၫ.- အဂဲးဘဲၫ ယီၩယၥၭဆီၪ့လၧနဂံၪ့အဂးနီၪ အၪ့ခွံၬယူၭယၧၩယူၭ တၭ,ၦလၧအဒုၪဒွ့ၪနၧၩနီၪ အဆၧဒုၪ့ဒွ့ၪၥံၪလၩ့ဘၪ",
			"10": "<sup>10</sup> ယူၭလၧယလီၩ့ယူၭ.- ယၥၭဒုၪဆၧအၪ့ဆၧအီၩအ ဘိၩ့ဘၭနီၪယမ့ၬထံၫလၩ့တၭ, ကဲၪထၪ့ဝ့ၫလၧဆၧဒုၪ",
			"11": "<sup>11</sup> ဒွ့ၪယၧၩလီၫ.- ယအီၪက့ၪရၧၬအဆၧယၬလၧယကီၩ့ ယၥိၭတၭ, ယကဲၪထၪ့ဆၧချဲၩ့ဒီၩ့ လၧအဝ့ၫၥံၪအမ့ၬ",
			"12": "<sup>12</sup> ယၫလီၫ.- ၦလၧအဆၧၫ့နၩ့ လၧတရၫ့အဖၧၩ့နီၪ ချဲၩ့ ဆၧထၫ့ဒုၪဒၩယၧၩလီၫ. တၭယကဲၪထၪ့ ၦအီၩမၧၩ့ ၥံၭထံၫဂၬထံၫအၥံၫကျံၩဆၧအလးနီၪလီၫ.",
			"13": "<sup>13</sup> အ့ၪမွဲယဝ့ၫဒၪယီၩ လၧအဆၧၫ့အထီဘၪနီၪယဘၩ ဆိၪဖၪနၧၩ,ယဟိဝၩဧ့, ခိၭနၪယလူလၧနဆၧယၫ့ၥၭ ဒိၪအကၠီၩ့လၧနဆၧထိးထဲၩ့တၩ့ထဲၩ့ အဆၧမွဲဆၧတီၩ",
			"14": "<sup>14</sup> နီၪဆံၭ, ယွၩဧ့,- ထုၭထၪ့ခွံၬယၧၩလၧကဖံၬလၩ့လၧၩ့ အကျၩနီၪဆံၭ, ထီးဒုၭလၩ့ဘၧၩ့ယၧၩလဂ့ၩ. တၭမွဲ ဆၧမၩဖီၩ့မၩဖျ့ၭယၧၩ လၧၦမ့ၬလဲၩယၧၩလဖၪ,",
			"15": "<sup>15</sup> ဒဲလၧထံၫယိၬနီၪဆ့ဆံၭ.- ထံၫလုၬဘံၭဆၧနီၪ,မွဲအထီး မၩလၩ့ဘၧၩ့ယၧၩလဂ့ၩ. တၭထံၫယိၬဖၧၩ့နီၪ, မွဲအ ထီးယုလၩ့ခွံၬယၧၩလဂ့ၩ, မွဲဆၧဖၧၩ့နီၪထီးချႃၬဘံၭ",
			"16": "<sup>16</sup> န့ယၧၩလၧအနိၭလဂ့ၩ.- ခိၭနၪယလူဆံၭ, ယဟိဝၩ ဧ့,အဂဲးဘဲၫယီၩနဆၧအဲၪအခိးအတၩ မွဲဆၧအဂ့ၩ လီၫ.ဘဲၫနယၫ့ၥၭဆၧအၪအၥိၭနီၪ ကၠၪနၥၭလၧယ",
			"17": "<sup>17</sup> အီၪဆံၭ.- အီၪက့ၪၥူၪခွံၬနမ့ၬ လၧနခ့ၫနၡၩအအီၪလ ဂ့ၩ,အဂဲးဘဲၫယီၩယဘၪဆၧခိဆၧဝီၩလီၫ. ခိၭနၪယ",
			"18": "<sup>18</sup> လူလၧအဆိၫအချဲၫ့ဆံၭ.- ၥုၭဘူၭနၥၭလၧယၥၭတၭ, ဎွ့ၩန့ထဲၩ့အဝ့ၫဆံၭ. မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧယဒုၪ ယဒၩအကၠီၩ့နီၪဆံၭ.",
			"19": "<sup>19</sup> နဝ့ၫဒၪနၥ့ၪယၫယဆၧဒုၪဒွ့ၪ, ဒဲယဆၧမ့ၬမဲ,ဒဲဆၧ အီၪက့ၪမဲယမ့ၬလီၫ. ယဒုၪယဒၩထီးအလူၬ အီၪဝ့ၫ",
			"20": "<sup>20</sup> လၧနမ့ၬယၫလီၫ.- ဆၧဒုၪဒွ့ၪဒုၭၥုၪ့ခါၥၭလၩ့ယၧၩ တၭ,ယၥၭဆၫလီၫ. တၭယယိလါၦယၫ့ၥၭဆၧအ ဖၧၩ့ၥၭ,မွဲလါနၫ့အီၪအ့ၬ. ဒဲၦမၩမုၬဆၧအဖၧၩ့ယဒၪ",
			"21": "<sup>21</sup> န့နးဂၩအ့ၬ.- တၭၦဖ့ၪလၫ့ယၧၩ ဆၧခၪလၧဆၧအၪ့ အဂးတၭ, ထီးဆၧၥၭဝံယၥၭလၧထံၫတၭ, အဝ့ၫၥံၪ ဒုၭအီၩယၧၩလၧဆၧဆဲၪ့ထံၫလီၫ.",
			"22": "<sup>22</sup> မွဲအဝ့ၫၥံၪအစပွဲကဲၪထၪ့ဖျံၩခွၩ့ လၧအမ့ၬယၫဆံၭ. ဒဲၦလၧအမၩမုၬလၩဒၪအၥၭနီၪ မွဲအကဲၪထၪ့ခုၩလ",
			"23": "<sup>23</sup> ခၫလၧအဂးဆံၭ.- မွဲအဝ့ၫၥံၪအမ့ၬၥၪခံၭလၩ့ဘဲၫၥိၭ အထီးဒၪဘၪဆၧလဂ့ၩတၭ, ဒုၭဝၭထိၬအယးဒံၩ့လ",
			"24": "<sup>24</sup> ထံၪဎးဆံၭ.- လူၫလၩ့နဆၧၥၭထၪ့လၧအလီၩ့တၭ,မွဲ",
			"25": "<sup>25</sup> နၥၭခဲၩထၪ့ဘၪအဝ့ၫၥံၪဆံၭ.- မွဲအအီၪအလးနီၪအီၪ ယူဝ့ၫဆံၭ. မွဲၦထီးအီၪ လၧအဝ့ၫၥံၪ အတဲၩလဖၪအ",
			"26": "<sup>26</sup> ဖၧၩ့နီၪနးဂၩလဂ့ၩ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမၩအၧၩ့ မၩနၭၦလၧနကျီၪ့ဝ့ၫတၭ, လီၩဘၪဆၧလၧနၡၩဘၪ",
			"27": "<sup>27</sup> ထံၭဆၫအဆၧၡၪ့ဆၧနၭအဂဲးလီၫ.- တၭအီၪက့ၪဆၧ အၧၩ့လၧ အဝ့ၫၥံၪအဆၧအၧၩ့အဖၫ့ခိၪဆံၭ. တၭဒုၭ လ့ၩနုၬအဝ့ၫၥံၪ လၧနဆၧတီၩဆၧလီၩ့အဖၧၩ့လဂ့ၩ.",
			"28": "<sup>28</sup> တၭထူၭခွံၬအဝ့ၫၥံၪ လၧလံၬမၧၫ့အဖၧၩ့ဆံၭ. မွဲအထီး အီၪကွ့ၭအၥၭလၧၦအတီၩအလီၩ့အၥိၭလဂ့ၩ.",
			"29": "<sup>29</sup> အ့ၪမွဲယဝ့ၫဒၪယီၩ, ယဘၪၡၪ့ဘၪနၭတၭ, ယၥုၪ့ အုၭယၥၭအုၭလီၫ. ယွၩဧ့,မွဲနဆၧထိးထဲၩ့တၩ့ထဲၩ့",
			"30": "<sup>30</sup> နီၪအီၪက့ၪယၧၩလၧဆၧထၪ့ထီၫဆံၭ.- တၭယမိစံၭ ထၪ့အၪ့အူၭယွၩအမံၩ့ လၧဆၧၥံၫကျံၩအဖၧၩ့တၭ, ယမိအီၪက့ၪဒိၪအဝ့ၫ လၧဆၧစံၭထၪ့အၪ့အူၭလီၫ.",
			"31": "<sup>31</sup> တၭအယီၩလၧယဟိဝၩအမ့ၬယၫ မွဲဆၧဂ့ၩနဲၪ့ချီဖၫ,",
			"32": "<sup>32</sup> ချီဖၫလၧအအီၪလၧအနိၩ့ ဒဲခၪ့မံၪထ့ဖၭနီၪလီၫ.- တၭ ၦၡၩလၧအၥၭဆၧၩ့နီၪ ဒၪဘၪဝ့ၫတၭ, ၥၭထိၬဝ့ၫဒၪ လီၫ.ၦၡၩလၧအအၪ့ဎၬယွၩ, နၥံၪဝ့ၫဒၪယီၩ, နၥံၪအ",
			"33": "<sup>33</sup> ၥၭမိမၧၫ့ဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩခိၭနၪၦၡၪ့ ဖိၪယၬဖိၪအလူ, ဒဲၦလၧအဘၪဆၧစၧၩ့ထၬလဖၪနီၪ မၩကြၩ့ထမးဝ့ၫအ့ၬ.",
			"34": "<sup>34</sup> မူၭခိၪဒဲဂၪ့ခိၪ, မၫဆမံၭ ဒဲကယဲဆၧအဂဲၩလၧအဖၧၩ့",
			"35": "<sup>35</sup> ထီးအလူၬနီၪ, မွဲအစံၭထၪ့အၪ့အူၭအဝ့ၫနီၪဆံၭ.- အဂဲး ဘဲၫယီၩယွၩမိထိးထဲၩ့တၩ့ထဲၩ့ ဇံအိၫ့ဒဲမၩကဲၪထၪ့ ယုဒၫအဒိၩ့လဖၪ ဘဲၫၥိၭအဝ့ၫၥံၪ မိအီၪလၧအဖၧၩ့",
			"36": "<sup>36</sup> ဒဲန့ဘၪဝ့ၫလၧ အဂးဒၪဝ့ၫဆ့လီၫ.- တၭအခ့ၫအ ၡၩအချံၫအၥၪနီၪမိန့ၥၫဝ့ၫတၭ, ၦလၧအအဲၪအမံၩ့လ ဖၪမိအီၪဂုးခၧၫ့လၧအဖၧၩ့လီၫ."
		},
		"70": {
			"1": "<sup>1</sup> ယွၩဧ့, မၩဖီၩ့မၩဖျ့ၭယၧၩဆံၭ, ယဟိဝၩဧ့,မၩချဲၫ့",
			"2": "<sup>2</sup> ချဲၫ့လၧနမိမၩဆၧၩ့ယၧၩဆံၭ.- ၦလၧအအၪ့ဎၬယၥၭ မၧၫ့လဖၪနီၪ, မွဲအဘၪမ့ၬမဲ ဒဲဘၪဆၧအီၪက့ၪမဲအမ့ၬ နီၪဆံၭ.တၭၦလၧအဘၪအၥၭ လၧယဘၪဆၧအၧၩ့လ ဖၪနီၪ, မွဲဆၧဒုၭဂၧၩ့ထဲၩ့အလးခဲၫ့, ဒဲဘၪဆၧအီၪက့ၪ",
			"3": "<sup>3</sup> မဲအမ့ၬနီၪဆံၭ.- ၦလၧအစံၭ, ဟဲၬ, ဟဲၬ, နီၪ,မွဲဆၧဒုၭ ထဲၩ့ကဒၩထဲၩ့ဝ့ၫ လၧဆၧမ့ၬမဲအလံၩ့အလဲၫအဂးနီၪ",
			"4": "<sup>4</sup> ဆံၭ.- ၦလၧအအၪ့ဎၬနၧၩထီးအလူၬနီၪ, မွဲအၥုၪ့ဎွံၫ ၥၭယီၫ,ၥုၪ့ထိၬၥၭထိၬလၧနဖၧၩ့ဆံၭ. ၦလၧအအဲၪန ဆၧထိးထဲၩ့တၩ့ထဲၩ့လဖၪနီၪ, မွဲအစံၭလထံၪဎး,ယွၩ",
			"5": "<sup>5</sup> ဘၪဆၧအီၪက့ၪဒိၪဝ့ၫနီၪဆံၭ.- ယဝ့ၫဒၪယီၩ, ယမွဲၦ ဘၪၡၪ့ဘၪနၭ, ဒဲၦၡၪ့ဖိၪယၬဖိၪလီၫ. မၩချဲၩ့ချဲၩ့လၧ ယဂး,ယွၩဧ့, နမွဲယဆၧမၩဆၧၩ့ဒဲယဆၧမၩဖီၩ့မၩ ဖျ့ၭ,ယဟိဝၩဧ့, ထီးၥုၭနံၩၥုၭၥၫ့လဂ့ၩ."
		},
		"71": {
			"1": "<sup>1</sup> ယဒိၭနဲၩ့ယၥၭလၧနၧၩ, ယဟိဝၩဧ့, မွဲယထီးဘၪ",
			"2": "<sup>2</sup> ဆၧမ့ၬမဲနးဖၧၫ့လဂ့ၩ.- မၩဖီၩ့မၩဖျ့ၭယၧၩလၧနဆၧ တီၩဆၧလီၩ့အကၠီၩ့တၭ, မၩဖျ့ၭထၪ့ယၧၩဆံၭ. ဒိၭန",
			"3": "<sup>3</sup> နါလၧယၧၩတၭ, ထိးထဲၩ့တၩ့ထဲၩ့ယၧၩဆံၭ.- တၭ ကဲၪထၪ့နဝ့ၫဆၧဖလ့ၬအလဲၫ့လဖျိၪ့ လၧယဂးလၧယမိ လ့ၩလၧအအီၪလထံၪဎးဘီၩ့ဎးနီၪဆံၭ. နမၪလူၬဆၧ လၧယမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့လီၫ. အဂဲးဘဲၫ ယီၩယလဲၫ့ ဒဲယထိၬနီၪမွဲနၧၩလီၫ.",
			"4": "<sup>4</sup> ယယွၩဧ့, မၩဖျ့ၭထၪ့ခွံၬယၧၩလၧၦလတီၩလလီၩ့ ဘၪအစူၪဖၧၩ့, လၧၦအအၧၩ့, ဒဲၦမၩၡၪ့မၩနၭအစူၪ",
			"5": "<sup>5</sup> ဖၧၩ့နီၪဆံၭ.- အဂဲးဘဲၫယီၩနမွဲယဆၧယိလါလီၫ.က ဆါ,ယဟိဝၩဧ့, ခီၫလၧယၥၭဘၪ့နီၪ, နမွဲယဒိၭနဲၩ့",
			"6": "<sup>6</sup> ယၥၭအလးလီၫ.- တၭယဒိၭဆၧမၩဆၧၩ့ယၧၩလၧ နၧၩခီၫလၧဆၧဒၧၩ့လးဖၧၩ့နီၪတၭ, နမၩန့ယၧၩလၧ ယမိအဂူၭဖိၫ့ဖၧၩ့ လံၩလံၩနီၪလီၫ. တၭယမိစံၭထၪ့",
			"7": "<sup>7</sup> အၪ့အူၭနၧၩလထံၪဎးဘီၩ့ဎးလီၫ.- ယမွဲဆၧထီၫမံၫ ထီၫမၪအလး လၧၦအၪဂၩအမ့ၬယၫလါနၫ့တၭ, နမွဲ ယဆၧဖီၩ့ဖျ့ၭအလးဂုးခၧၫ့ဝ့ၫဒၪလီၫ.",
			"8": "<sup>8</sup> တၭယနိၭဖၧၩ့မိဎွ့ၩ လၧဆၧစံၭထၪ့အၪ့အူၭနၧၩ,",
			"9": "<sup>9</sup> ဒဲလၧနၥူၭနၥဲၫ့ကိၭမုနံၩမုနၩဒ့ၭလီၫ.- တၭလၧယၥၭ ၡါအဆၧၫ့အထီယီၩ, ထီးခွံၬၡိၭခွံၬယၧၩလဂ့ၩ.ထီးယ",
			"10": "<sup>10</sup> ဂဲးယဘၭအ့ၪလူၬတၭ, စဲၪ့ဒၪယၧၩလဂ့ၩ.- အဂဲးဘဲၫ ယီၩယဒုၪယဒၩချဲၩ့ထၫ့ဒုၪဒၩယၧၩတၭ, ၦလၧအခိၭ ယိၥူၪလၧယၥၭအဂးနီၪ, ကိၪ့ထၪ့ဖၭလၩ့လစီၪ့ဎး,",
			"11": "<sup>11</sup> တၭစံၭဝ့ၫ, ယွၩစဲၪ့ဒၪယူၭအဝ့ၫယူၭတၭ, လီၩ့ဆီးဖီၪ့ န့ဆံၭ,အဂဲးဘဲၫယီၩ ဆၧမၩဖီၩ့မၩဖျ့ၭဝ့ၫနီၪ အီၪနး",
			"12": "<sup>12</sup> ဂၩအ့ၬ.- ယွၩဧ့, အီၪယဲၩ့လၧယၧၩလဂ့ၩ, ယွၩဧ့,",
			"13": "<sup>13</sup> မၩချဲၫ့ချဲၫ့လၧနမိမၩဆၧၩ့ယၧၩ အဂးနီၪဆံၭ.- ယၥၭ အဒုၪအဒၩလဖၪနီၪ မိဘၪဆၧမ့ၬမဲတၭ, မိလူၬဝ့ၫဒၪ လီၫ.ၦလၧအအၪ့ဎၬ ယဘၪဆၧအၧၩ့လဖၪနီၪ, မိဘၪ ဆၧဒုၪဒွ့ၪ, ဒဲဆၧအီၪက့ၪမဲအမ့ၬလုၬဘံၭဝ့ၫဒၪလီၫ.",
			"14": "<sup>14</sup> အ့ၪမွဲယဝ့ၫဒၪယီၩ, ယမိယိလါဆၧလထံၪဎးတၭ, ယမိအီၪက့ၪအၪထၪ့ ဆၧစံၭထၪ့အၪ့အူၭနၧၩ ထီးအ",
			"15": "<sup>15</sup> လူၬလီၫ.- ယနိၭမိမၩဖျီၪထၪ့နဆၧတီၩဆၧလီၩ့,နဆၧ ထိးထဲၩ့တၩ့ထဲၩ့ကိၭမုနံၩမုနၩဒ့ၭလီၫ, အဂဲးဘဲၫယီၩ",
			"16": "<sup>16</sup> ယၥ့ၪယၫအဆၧဝံဆၧနၬဆ့အ့ၬ.- ယမိလ့ၩဆၧလၧက ဆါယဟိဝၩအဂဲးအဘၭလီၫ. တၭယမိချဲၩ့လၧနဆၧ",
			"17": "<sup>17</sup> တီၩဆၧလီၩ့အဂဲး, န့ၫနဝ့ၫဒၪ,ဒၪလ့ၬလီၫ.- ယွၩဧ့,န ၥီၪ့လိၪယၧၩခီၫလၧယၥၭဘၪ့တၭ, ယဒုၭနဲၪနမၩဆၧ",
			"18": "<sup>18</sup> လၩ့လၭလဖၪခီးဘိၩ့နဲၪ့ယီၩလီၫ.- တၭထီၩ့လၩ့လၧ ယၥၭၡါဒၪလ့ၬ, ဒဲယခိၪဘွၩယီၩ, ယွၩဧ့, ယလချႃၭ ဒုၭနဲၪဒံၭဘၪနစူၪလၧၦအဆၨၩၥံၪ, နစီၩ့နမၩ့လၧကယဲ ၦလၧအမိဂဲၫဝ့ၫတၭ, ထီးစဲၪ့ဒၪယၧၩလဂ့ၩ.",
			"19": "<sup>19</sup> တၭနဆၧတီၩဆၧလီၩ့အီၪဝ့ၫ ဖိးလၧဆၧထၪ့ထီၫနီၪ, ယွၩလၧအမၩဆၧဒိၪလဖၪနီၪလဂၩဧ့, မွဲပလၫလၩ့",
			"20": "<sup>20</sup> ဂၬဘဲၫနၧၩအၥိၭနီၪလဂၩလဲၪ, ယွၩဧ့,- နဒုၭဒၪဘၪ ပၧၩလၧဆၧခိဆၧဝီၩဖၭဒိၪ, နၭမၬလီၫ. နမိမၩမၧၫ့ ထၪ့ထဲၩ့ပၧၩတၭ, နမိဒုၭဂဲၫထဲၩ့ထၪ့ပၧၩ လၧဂၪ့ခိၪ",
			"21": "<sup>21</sup> အဆၧယိၬလဖၪအဖၧၩ့လီၫ.- တၭနမိမၩအၪထၪ့ယ ဆၧဘီၪဆၧယီၫ, ဒဲကၠၪနၥၭတၭ,မၩမုၬထၪ့ထဲၩ့ယၧၩလီၫ.",
			"22": "<sup>22</sup> တၭယမိစံၭထၪ့အၪ့အူၭနၧၩဆ့လၧၥၫ့ထီး နဆၧမွဲ ဆၧတီၩ, ယယွၩဧ့,ယမိၥံၫကျံၩထၪ့နၧၩလၧနါဒံၩ့အံၫ",
			"23": "<sup>23</sup> စရ့လၭအဆၧဆံၫ့ဎံၪလဂၩဧ့,- ယနိၭဖျံၩမိၥုၪ့ဎွံၫၥၭ ယီၫလီၫ.အဂဲးဘဲၫယီၩ ယမိၥံၫကျံၩထၪ့နၧၩ, ဒဲယၥၭ",
			"24": "<sup>24</sup> လၧနဎွ့ၩန့ထဲၩ့ဝ့ၫနီၪဆ့လီၫ.- ယဖျ့ၩမိဒုၭနဲၪ နဆၧ တီၩဆၧလီၩ့ ကိၭမုနံၩမုနၩဒ့ၭလီၫ. အဂဲးဘဲၫယီၩ ၦလၧအအၪ့ဎၬ ယဘၪဆၧအၧၩ့လဖၪနီၪ မိဘၪမ့ၬမဲ, ဒဲဘၪဆၧအီၪက့ၪမဲအမ့ၬလီၫ."
		},
		"72": {
			"1": "<sup>1</sup> ဖ့ၪလၫ့နဆၧစ့ၩရၫ့လဖၪ လၧစဎွၩ, ယွၩဧ့, ဒဲနဆၧ",
			"2": "<sup>2</sup> တီၩဆၧလီၩ့ လၧစဎွၩအဖိၪခွၫဆံၭ.- တၭအဝ့ၫဒၪမိ စ့ၩရၫ့နၡၩခမျၧးလၧအတီၩ, ဒဲနၡၩၡၪ့ဖိၪယၬဖိၪလၧ",
			"3": "<sup>3</sup> ဆၧစ့ၩရၫ့တီၩလီၫ.- တၭခိၪလီၩ့ထိၩ့ချိၬမိဆိၬထၪ့ဆၧ မုၬဆၧဎၩ့လၧၦခမျၧးအအီၪ, ဒဲဆၧစီၩ့ခိၪလဖၪနီၪလၧ",
			"4": "<sup>4</sup> ဆၧတီၩဆၧလီၩ့အကၠီၩ့လီၫ.- တၭအဝ့ၫနီၪမိစ့ၩရၫ့ ၦခမျၧးအၡၩဘၪၡၪ့ဘၪနၭ, ဒဲထိးထဲၩ့တၩ့ထဲၩ့ၦၡၪ့ ဖိၪယၬဖိၪအဖိၪၥံၪ, မိမၩလၩ့ဘျ့ၭ ၦလၧအမၩနၧၩ့",
			"5": "<sup>5</sup> မၩစၪဆၧလီၫ.- မုဒဲလၩအီၪဝ့ၫအဘိၩ့ဘၭနီၪတၭ,ၦလ ဖၪမိၥၭမဲၪနၧၩ ထီးအဆိၩလဆိၩလဖၪမိလူၬဝ့ၫလီၫ.",
			"6": "<sup>6</sup> တၭအဝ့ၫဒၪမိဂဲၫလၩ့ ဘဲၫဆၧဆၧၩ့လၧကူၭခွံၬဆၧ အလးအဖၫ့ခိၪအၥိၭနီၪ, ဘဲၫဆၧဆၧၩ့ဎွံၪလၩ့လၧအ",
			"7": "<sup>7</sup> မၩဘၪစီၪဂၪ့ခိၪအၥိၭနီၪလီၫ.- လၧအမုနံၩလဖၪနီၪ, ၦတီၩၦလီၩ့မိဘီၪထၪ့ယီၫထၪ့, ဒဲဆၧမုၬဆၧဎၩ့လၧၫ့ လၧၫ့ဎွ့ၩဎွ့ၩ, ထီးလၩလအီၪလၧၩ့ဘၪလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫဒၪမိပၧၩ့ဆၧ လၧမၫဆမံၭ ထီၩ့လၧမၫဆမံၭ တၭ, လၧထံၫမိၡါဖိးလၧဂၪ့ခိၪအထုၬလဖၪနီၪလီၫ.",
			"9": "<sup>9</sup> ၦမံၩ့လၬကျၩဖိၪနီၪ မိကူၭလၩ့အၥၭလၧအမ့ၬယၫတၭ,",
			"10": "<sup>10</sup> အဒုၪအဒၩၥံၪ မိဘၪအၪ့လဲၪ့ဂၪ့ခိၪအမုၬလီၫ.- တၫ ၡံၭ,ဒဲကျိၩ့ၥံၪအစဎွၩလဖၪ မိဂဲၫဆိၬအဆၧဖ့ၪလၫ့,ၡ့ ဘၫဒဲစံဘၫအစဎွၩၥံၪမိဂဲၫဆိၬအဆၧဖ့ၪလၫ့လီၫ.",
			"11": "<sup>11</sup> တၭကယဲစဎွၩထီးအလူၬလဖၪ မိဘိၪ့ထၪ့ဘၩထၪ့ အဝ့ၫဒၪလီၫ. ကယဲၦအဆၨၩထီးအလူၬလဖၪ မိမၩ",
			"12": "<sup>12</sup> အဆၧလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫဒၪမိမၩဖီၩ့မၩဖျ့ၭၦ ၡၪ့ဖိၪယၬဖိၪလၧအအၪ့ကံၩ့အၪ့ယၫဆၧ, ဒဲၦဘၪၡၪ့",
			"13": "<sup>13</sup> ဘၪနၭ,ၦလၧဆၧမၩဆၧၩ့ဝ့ၫ လအီၪဘၪနီၪလီၫ.- အ ဝ့ၫဒၪမိယၫ့ၥုၪ့ယၫ့ၥၭၦဘၪၡၪ့ဘၪနၭ, ဒဲၦၡၪ့ဖိၪတၭ,",
			"14": "<sup>14</sup> မိထိးထဲၩ့တၩ့ထဲၩ့ၦၡၪ့ဖိၪအၥၭ,- မိဎွ့ၩန့ထဲၩ့အဝ့ၫ ၥံၪအၥၭလၧဆၧမၩအၧၩ့အစူၪဖၧၩ့, ဒဲလၧဆၧမၩၡၪ့ မၩနၭအစူၪဖၧၩ့တၭ, အဝ့ၫၥံၪအၥွံၪကဲၪထၪ့ဆၧလူ ဒိၪဎွ့ၩဒိၪလၧအမ့ၬယၫလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫဒၪမိမၧၫ့ဝ့ၫတၭ, ၦမိဖ့ၪလၫ့အဝ့ၫၡ့ဘၫအထီၫ့, ဒဲဆၧမိဘၩဆိၪဖၪန့အဂးလထံၪဎးလီၫ. တၭအဝ့ၫဒၪ မိဘၪဆၧစံၭထၪ့အၪ့အူၭဝ့ၫ ကိၭမုနံၩမုနၩဒ့ၭလီၫ.",
			"16": "<sup>16</sup> တၭဘုၪၥံၪဂူၫၥံၪအၪအၪလ့ၬ မိအီၪလၧဂၪ့ခိၪအဖၧၩ့ လၧခိၪလီၩ့ခိၪတၭ, အၥၪမိဝၭဘဲၫလ့ၭဘနၧၫ့အၥိၭနီၪ လီၫ.တၭလၧဒိၩ့ဖၧၩ့လဖၪနီၪ မိဘီၪထၪ့ယီၫထၪ့ဘဲၫ",
			"17": "<sup>17</sup> ဂၪ့ခိၪအနၪ့ၥံၪမံၩ့ၥံၪအၥိၭနီၪလီၫ.- အဝ့ၫဒၪအမံၩ့မိ အီၪလၩ့ဆိၩလၩ့ကၠၪတၭ, လၧမုအီၪဝ့ၫအဘိၩ့ဘၭနီၪ အမံၩ့မိအၪထၪ့ဂီထၪ့လီၫ. တၭၦၡၩမိဆိၪဂ့ၩလၩ့အ ၥၭလၧအဝ့ၫနီၪအကၠီၩ့လီၫ. ကယဲၦအဆၨၩၥံၪ မိစံၭ ထၪ့အၪ့အူၭအဝ့ၫနီၪထီးအလူၬလီၫ.",
			"18": "<sup>18</sup> တၭယဟိဝၩ,ယွၩ, အံၫစရ့လၭအယွၩလၧအမၩ ဆၧလၩ့လၭန့ၫလဂၩနီၪ, မွဲအဘၪဆၧစံၭထၪ့အၪ့အူၭ",
			"19": "<sup>19</sup> ဝ့ၫဆံၭ.- တၭအမံၩ့လၩဖၩ့နီၪ မွဲအဘၪဆၧစံၭထၪ့ အၪ့အူၭလၩ့ဆိၩလၩ့ကၠၪဆံၭ. တၭမွဲဂၪ့ခိၪထၧၫ့ဖျိၪ့ ယၫယီၩဎွ့ၩထၪ့ဝ့ၫလၧအလၩအဖၩ့ဆံၭ. အၩမံၩ့, ဒဲအၩမံၩ့.",
			"20": "<sup>20</sup> စယ့ၭစံၫအဖိၪခွၫစဒၫဝံၭ အဆၧဘၩဆိၪဖၪနီၪဂီၩ့ ယူၭ."
		},
		"73": {
			"1": "<sup>1</sup> ယွၩမွဲမၬဆၧဂ့ၩလၧအံၫစရ့လၭအဂး, လၧၦၥၭဆံၫ့ ဎံၪအဂးလီၫ.",
			"2": "<sup>2</sup> ယဝ့ၫဒၪယီၩယခၪ့လၩ့ဘူၭ မိကၠၪခွံၬအၥၭတၭ,",
			"3": "<sup>3</sup> ဘူၭကၪယခၪ့မိဖျၬလီၫ.- အဂဲးဘဲၫယီၩထီးယဒၪဘၪ ၦလတီၩလလီၩ့ဘၪအဆၧဘီၪဆၧယီၫတၭ, ယၥၭခ့ၬ",
			"4": "<sup>4</sup> ၦအီၪက့ၪဖိၫလိၫအၥၭလီၫ.- အဂဲးဘဲၫယီၩလၧအဝ့ၫ ၥံၪအဆၧၥံၫအဖၧၩ့နီၪ, အဆၧစူၭဆၧဆၫအီၪအ့ၬ,",
			"5": "<sup>5</sup> အဂဲးဆီၪ့အဘၭဆီၪ့လီၫ.- မွဲအဘၪဆၧခိဆၧဝီၩဘဲၫ ၦၡၩခမျၧးအၥိၭအ့ၬ, ဒဲအဝ့ၫၥံၪဘၪဆၧအၡၪ့လဖၪ လၧၦၡၩအကျၩဆ့အ့ၬ.",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧအီၪက့ၪထၪ့ထီၫအၥၭအီၪ ဝၬဖီၩ့အဝ့ၫၥံၪ ဘဲၫဖဲၫလဝၫ့အၥိၭနီၪတၭ, ကီၩ့ၥိၭဝ့ၫ",
			"7": "<sup>7</sup> လၧဆၧမၩအၧၩ့မၩနၭလီၫ.- အမ့ၬၥၪဖျိၭထၪ့လၧအ ဆၧဘီၪ့အကၠီၩ့တၭ, ဘဲၫအၥၭကိၪ့ဆၧအၥိၭနီၪန့ဘၪ",
			"8": "<sup>8</sup> ဝ့ၫအၪနဲၪ့အနီၪဒံၭလီၫ.- အဝ့ၫၥံၪဒုၪဒွ့ၪဆၧတၭ,ချဲၩ့ ဆၧအၧၩ့,ချဲၩ့ဆၧမၩအၧၩ့ လၧဆၧထၪ့ထီၫနီၪလီၫ.",
			"9": "<sup>9</sup> အဝ့ၫၥံၪအီၪက့ၪအနိၭ လၧမူၭခိၪအဖၧၩ့တၭ, အဖျ့ၩ",
			"10": "<sup>10</sup> ဂၭဝံၩ့ဝၩ့လၧဂၪ့ခိၪချိၫ့ လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အၡၩခမျၧးကၠၪခွံၬအၥၭ လၧအအီၪတၭ, အီၩထံၫ ဎွ့ၩတံၭလီၫ.-",
			"11": "<sup>11</sup> တၭအဝ့ၫၥံၪစံၭဝ့ၫ, ယွၩမိၥ့ၪယၫဘဲၫၥ့ၪ လဲၪ.ဆၧၥ့ၪယၫအီၪ လၧဆၧထၪ့ထီၫထုၬနီၪဆ့ဧၪ.",
			"12": "<sup>12</sup> ယိခွါ, ၦလဖၪနီၪမွဲၦလတီၩလလီၩ့ဘၪ,ဒဲၦလၧအ ဘီၪထၪ့ယီၫထၪ့လဖၪ လၧအယီၩလကၠၪတၭ,အစူၪ",
			"13": "<sup>13</sup> လးခၪ့ခိၪအၪထၪ့လီၫ.- မွဲမၬ, ယမၩဆံၫ့ယၥၭ,ဒဲၥူၫ ဝၭခွံၬယစူၪလၧဆၧဒဲၩဘၭလအီၪဘၪအဖၧၩ့ လၧဆၧ",
			"14": "<sup>14</sup> ပျီၩပျီၩလီၫ.- အဂဲးဘဲၫယီၩယဘၪဆၧထးယၧၩကိၭ မုနံၩမုနၩဒ့ၭတၭ, ယဘၪဆၧအၪ့ၥီၪ့ကိၭဂီၩဒ့ၭလီၫ.",
			"15": "<sup>15</sup> ယအ့ၪစံၭ, ယမိလီၩဖျီၪထၪ့ဆၧဘဲၫနီၪတၭ, ယိခွါ,",
			"16": "<sup>16</sup> ယမိမၩမၪဘၪနဖိၪၥံၪအဆိၩလီၫ.- ထီးယဆီၫ့မီၪ့ဘဲၫ ၥိၭယမိၥ့ၪယၫဆၧနီၪတၭ, မွဲဝ့ၫလၧဆၧကၪဆၧဂဲၩ",
			"17": "<sup>17</sup> လၧယမ့ၬယၫနီၪ,- ထီးယလ့ၩနုၬယူၭလၧယွၩအလး ဆံၫ့ဎံၪအဖၧၩ့တၭ, ယထီးနဲၪ့အဝ့ၫၥံၪအထုၬလီၫ.",
			"18": "<sup>18</sup> မွဲမၬ,နအီၪက့ၪအဝ့ၫၥံၪ လၧဆၧအလးဖျ့ၫလဖၪအ",
			"19": "<sup>19</sup> ဖၧၩ့တၭ, နခွံၬလၩ့ဝ့ၫလၧဆၧဂၭဂီၩ့အဖၧၩ့လီၫ.- တၭ ဆၧဒုၭလ့ၩအဝ့ၫၥံၪ လၧဆၧအီၪယူအဖၧၩ့လၧလဆိဖိၪ အထးဖၧၩ့နီၪလီၫ. တၭအဝ့ၫၥံၪဂၭဂီၩ့လူၬထူၬဆံၫ့",
			"20": "<sup>20</sup> ဘၩ့လၧဆၧၥၭမဲၪၥၭဖျဲၩ့အကၠီၩ့လီၫ.- ထီးၦမံၫနၪ့ ထၪ့တၭ,ဘဲၫဆၧမံၫမးအၥိၭနီၪ, ကဆါဧ့,နမိမၩကြၩ့ ထမးအဆၧကိၪ့ထၪ့ဖၭလၩ့နီၪလီၫ.",
			"21": "<sup>21</sup> အဂဲးဘဲၫယီၩ ယၥၭဆၫ, ဒဲယလ့ဘၪဆ့ၭလီၫ.",
			"22": "<sup>22</sup> တၭယမွဲၦလၧအၥၭဆီၫ့မီၪ့ဆၧလအီၪဘၪတၭ ၥ့ၪယၫ ဆၧအ့ၬ.တၭလၧနမ့ၬယၫ မၩယၥၭဘဲၫဆၧဖိၪဆၧဎါ",
			"23": "<sup>23</sup> အၥိၭနီၪလီၫ.- မွဲလါနၫ့ဘိၩ ယအီၪလၧနၥိၭလထံၪ",
			"24": "<sup>24</sup> ဎးတၭ,နဖီၪ့ထၬယစူၪထွ့ၪလီၫ.- နမိၥိၫ့ယၧၩလၧနကိၪ့ ထၪ့ဖၭလၩ့ဆၧတၭ, လၧခဲၫ့ထဲၩ့နီၪနမိမၩန့ထၪ့ယၧၩ",
			"25": "<sup>25</sup> လၧဆၧလၩဖၩ့အဖၧၩ့လီၫ.- အ့ၪလမွဲဘၪနၧၩမွဲပလၫ အီၪဝ့ၫလၧယဂး လၧမူၭခိၪလဂၩလဲၪ. တၭအ့ၪလမွဲ ဘၪလၧနဖၧၩ့ ယဆၧမုၬလၩလၧဂၪ့ခိၪချိၫ့ယီၩ အီၪနး",
			"26": "<sup>26</sup> မံၩ့အ့ၬ.- ယဂဲးယဘၭဒဲယၥၭအ့ၪလူၬဝ့ၫတၭ, ယွၩမွဲ ယၥၭအလဲၫ့, ဒဲယဂးလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"27": "<sup>27</sup> အဂဲးဘဲၫယီၩ, ယိခွါ,ၦလၧအအီၪယဲၩ့လၧနၧၩထီၩ့ ဝ့ၫလၧဆၧဂၭဂီၩ့လီၫ. တၭနမၩဂၭဂီၩ့ကယဲၦလၧအ",
			"28": "<sup>28</sup> စဲၪ့ဒၪခွံၬအဲၪဘိၩ့နၧၩလီၫ.- အ့ၪမွဲယဝ့ၫဒၪယီၩ, ယၥုၭ ဘူၭယၥၭ လၧယွၩအအီၪနီၪ ဂ့ၩလၧယဂးလီၫ. တၭ ယအီၪက့ၪဒိၭနဲၩ့ယၥၭ အလးလၧကဆါယဟိဝၩအ ဖၧၩ့ဘဲၫၥိၭယမိလီၩလၩ့လၬလၩ့ နမၩဆၧထီးအလူၬ လီၫ."
		},
		"74": {
			"1": "<sup>1</sup> ယွၩဧ့,မွဲဘၪနီၫလၧနခွံၬၡိၭပၧၩ လၩ့ဆိၩလၩ့ကၠၪ နီၪလဲၪ.တၭနၥၭထၪ့ခူၪထၪ့ဘၪ နဆၧအၪ့ဆၪအလး",
			"2": "<sup>2</sup> အၥိၪလဒီၪ့နီၪဆ့ဧၪ.- နၪ့ထၪ့ထဲၩ့နဆၧအီၪကီၪ့လၧ နဎွ့ၩန့လၧဖျိၩ့နဆၧန့ၥၫ လၧနဎွ့ၩန့ထဲၩ့ဝ့ၫ, ခိၪလီၩ့ဇံ",
			"3": "<sup>3</sup> အိၫ့ယီၩလၧနအီၪယူၭ လၧအလီၩ့နီၪဆံၭ.- ခၫထၪ့လၧ ဆၧအီၪယူအဆိၩအကၠၪလဖၪနီၪဆံၭ. ဆၧအဒုၪအ ဒၩမၩဂၭဂီၩ့ ကယဲဆၧအီၪ လၧအလးဆံၫ့ဎံၪအဖၧၩ့",
			"4": "<sup>4</sup> လီၫ.- နဒုၪနဒၩလဖၪနီၪ ကိၭၡၭယုၩ့ဆၧလၧနဆၧအီၪ ကီၪ့အၥၭကျၩတၭ, အဝ့ၫၥံၪဘီၩ့ထၪ့အၥုၭဖိၪအလၫ့",
			"5": "<sup>5</sup> လၧဆၧမၩနဲၪ့အလးလီၫ.- တၭဆၧမၩအၥၭဘဲၫၦလၧ အယၩ့ထၪ့အကွၩ လၧၥံၪ့တၪ့အကျၩအၥိၭနီၪလီၫ.",
			"6": "<sup>6</sup> တၭဘိၩ့နဲၪ့ယီၩ အဝ့ၫၥံၪမၩခါခွံၬ ဆၧဒ့ၭကံၪအၥၭ",
			"7": "<sup>7</sup> လစီၪ့ဎးလၧကွၩ ဒဲစၭခုၪလီၫ.- အဝ့ၫၥံၪဆူၭထၪ့ခွံၬ နလးဆံၫ့ဎံၪလၧမ့ၪတၭ, မၩၥၭလိၪနမံၩ့အီၪဝ့ၫအလး",
			"8": "<sup>8</sup> ထီၩ့လၩ့လၧဂၪ့ခိၪလီၫ.- တၭအဝ့ၫၥံၪစံၭလၧအၥၭခံ ဖၧၩ့,မွဲပမၩဂၭဂီၩ့အဝ့ၫၥံၪလစီၪ့ဎးဆံၭ. တၭကယဲ ယွၩအဆၧအီၪကီၪ့အလး လၧအထံၫအခးအဖၧၩ့နီၪ",
			"9": "<sup>9</sup> အဝ့ၫၥံၪဒုၭအၪ့ခွံၬယူၭလၧမ့ၪလီၫ.- ပဆၧမၩနဲၪ့လ ဖၪပဒၪဘၪအ့ၬ. မီၪလအီၪလၧၩ့ဘၪတၭ, ၦလၧအၥ့ၪ ယၫဝ့ၫဆံၭယံၬဆံၭယံၬလဲၪနီၪ, အီၪဝ့ၫလၧပကျၩဆ့ အ့ၬ.",
			"10": "<sup>10</sup> ယွၩဧ့,ဆၧအဒုၪအဒၩမိဒုၪဒွ့ၪဒံၭ ဆၧဆံၭယံၬလဲၪ. တၭဆၧအဒုၪအဒၩနီၪ မိအီၪက့ၪနမံၩ့လၧဆၧပျီၩပျီၩ",
			"11": "<sup>11</sup> လၩ့ဆိၩလၩ့ကၠၪဆ့ဧၪ.- တၭနထုၭထဲၩ့စူၪနစူၪထွ့ၪ နီၪမွဲဘၪလဲၪ. ထုၭထၪ့ခွံၬ လၧနၥၭနၫၡါ အဖၧၩ့နီၪ",
			"12": "<sup>12</sup> တၭမၩဂၭဂီၩ့ဆၧဆံၭ.- တၭယွၩမွဲယစဎွၩလၧဖျိၩ့ လၧအမၩဖီၩ့မၩဖျ့ၭ ဆၧလၧထံၫၥံၪခးၥံၪအဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> နမၩထ့ဖၭမၫဆမံၭ လၧနဂဲးနဘၭလီၫ. တၭနဖ့ၬခါ ခွံၬဆၧမိၡါဖၭဒိၪၥံၪ အခိၪဎွံၪလဖၪ လၧထံၫကျၩ,",
			"14": "<sup>14</sup> နမၩလၩ့ဘျ့ၭမၪ အခိၪဎွံၪၥံၪတၭ, အီၪက့ၪဝ့ၫလၧဆၧ",
			"15": "<sup>15</sup> အၪ့လၧၦခမျၧးအီၪ လၧမံၩ့လၬကျၩအဂးလီၫ.- တၭ နဖ့ၬထံၫထၪ့ဖျိၭဒဲထံၫချိၬတၭ, နဒုၭလၩ့ၥံၭခွံၬထံၫမိၡါ",
			"16": "<sup>16</sup> အဆီၪ့လဖၪလီၫ.- တၭမုနံၩမွဲနဆၧ, မုနၩမွဲနဆၧဆ့ လီၫ.နဝ့ၫဒၪယီၩနတဲၩ့ဝဲၩဆၧဖၩ့, ဒဲမုၥံၪလၩၥံၪလီၫ.",
			"17": "<sup>17</sup> တၭနဝ့ၫဒၪယီၩနအီၪက့ၪဂၪ့ခိၪ အနဲၩ့ထံၭလဖၪထီးအ",
			"18": "<sup>18</sup> လူၬ,နမၩဝဲၩဆၧခိအခၫဒဲဆၧဂီးအခၫဆ့လီၫ.- တၭ နၪ့ထၪ့ထဲၩ့ဆၧယီၩ, ဆၧအဒုၪအဒၩဒုၪဒွ့ၪယူၭယဟိ ဝၩတၭ, ၦခမျၧးအဂီၩ့ မၩကြၩ့ထမးယူၭနမံၩ့လီၫ.",
			"19": "<sup>19</sup> ဖ့ၪလၫ့ခွံၬနထိၪလွံအၥၭ လၧဆၧဖိၪဆၧဎါအဒူၩလဂ့ၩ, တၭထီးၥၭနၪ့နၡၩ ၡၪ့ဖိၪယၬဖိၪ အဆၧအီၪကီၪ့နီၪ",
			"20": "<sup>20</sup> လၩ့ဆိၩလၩ့ကၠၪလဂ့ၩ.- ယိဆၧအုၩ့လၩ့နီၪဆံၭ. အ ဂဲးဘဲၫယီၩဂၪ့ခိၪအလးခံၭလဖၪနီၪ ဎွ့ၩဝ့ၫလၧဆၧမၩ",
			"21": "<sup>21</sup> အၧၩ့မၩနၭအီၪဝ့ၫအလးလဖၪနီၪလီၫ.- ၦလၧအဘၪ ဆၧမၩနၧၩ့ဝ့ၫလဖၪနီၪ, မွဲအထီးထဲၩ့ထဲၩ့ လၧဆၧမ့ၬ မဲလဂ့ၩ. မွဲၦဘၪၡၪ့ဘၪနၭ, ဒဲၦၡၪ့ဖိၪယၬဖိၪနီၪ စံၭ ထၪ့အၪ့အူၭနမံၩ့ဆံၭ.",
			"22": "<sup>22</sup> ဂဲထုၪ့ယွၩဧ့, စ့ၩရၫ့နခွးဒၪနဝ့ၫဆံၭ. ၦအဂီၩ့ဒုၪဒွ့ၪ",
			"23": "<sup>23</sup> နၧၩကိၭမုနံၩမုနၩဒ့ၭနီၪ နၪ့ထၪ့ထဲၩ့ဆံၭ.- ထီးၥၭနၪ့ နဒုၪနဒၩၥံၪအလူလဂ့ၩ. တၭၦလၧအဂဲထုၪ့ထၫ့ဒုၪဒၩ နၧၩအၥီၫနီၪထၪ့ဝ့ၫလထံၪဎးလဘီၩ့ဎးလီၫ."
		},
		"75": {
			"1": "<sup>1</sup> ပစံၭထၪ့အၪ့အူၭနၧၩ, ယွၩဧ့, ပစံၭထၪ့အၪ့အူၭဆၧ လီၫ.လၧနမံၩ့အီၪဘူၭနီၪ နဆၧမၩလၩ့လၭလဖၪ ဒုၭ",
			"2": "<sup>2</sup> ဂၧၫ့ထၪ့ၥၩလၩ့ဝ့ၫဒၪလီၫ.- အဂဲးဘဲၫယီၩယဝ့ၫဒၪ, ယ ဖၭနံၩဖၭၥၫ့ထီး လၧယမိစ့ၩရၫ့ဆၧတီၩဆၧလီၩ့လီၫ.",
			"3": "<sup>3</sup> ဂၪ့ခိၪဒဲကယဲၦလၧအအီၪဝ့ၫ လၧအလီၩ့နီၪဖံထၪ့ခွံၬ ဝ့ၫလီၫ. ယဝ့ၫဒၪယဒုၭအီၪခၧၫ့ အထုၪ့လဖၪနီၪလီၫ. (စ့လၫ.)",
			"4": "<sup>4</sup> ယစံၭၦအဂီၩ့လဖၪနီၪ, ထီးမၩၦဂီၩ့ဖိၪအဆၧနီၪ လဂ့ၩ. ဒဲၦလတီၩလလီၩ့ဘၪနီၪ, အီၪက့ၪထၪ့ထီၫနၥံၪ",
			"5": "<sup>5</sup> အနိၩ့လဂ့ၩ.- အီၪက့ၪထၪ့ထီၫနၥံၪအနိၩ့လၧအလး ထၪ့ထီၫလဂ့ၩ, တၭချဲၩ့ဆၧလၧနၥံၪအခိၬဆီၪ့လဂ့ၩ.",
			"6": "<sup>6</sup> အဂဲးဘဲၫယီၩလၧမုထၪ့မွဲဂ့ၩ, လၧမုနုၬမွဲဂ့ၩ,လၧမုခံၫ့",
			"7": "<sup>7</sup> မွဲဂ့ၩ,ဆၧအီၪက့ၪထီၫထၪ့အလးဂဲၫဘၪအ့ၬ.- အဂဲး ဘဲၫယီၩ ယွၩမွဲၦစ့ၩရၫ့ခွးတၭ, အဝ့ၫနီၪဆၪ့လၩ့လဂၩ",
			"8": "<sup>8</sup> တၭ,အီၪက့ၪထၪ့ထီၫၦလဂၩဒၪဆ့လီၫ.- အဂဲးဘဲၫ ယီၩလိၫ့လဖျိၪ့အီၪဝ့ၫ လၧယဟိဝၩအစူၪဖၧၩ့တၭ, အ စဘံၭထံၫနီၪဝီၩဝ့ၫလီၫ. ဎွ့ၩဝ့ၫလၧဆၧလဲၩဎုၬအၥၭ တၭ,ဆၧလူၫလၩ့ခွံၬဝ့ၫလီၫ. မွဲမၬ, အၥံၭအခၩနီၪဂၪ့ ခိၪအၡၩလတီၩလလီၩ့ဘၪ ထီးအလူၬ မိဘၪဘံၭခွံၬ တၭ,မိအီၩဝ့ၫလီၫ.",
			"9": "<sup>9</sup> အ့ၪမွဲယဝ့ၫဒၪယီၩ, ယမိဒုၭနဲၪဆၧ လၩ့ဆိၩလၩ့ ကၠၪလီၫ. ယမိၥံၫကျံၩစံၭထၪ့အၪ့အူၭ စယၫကူၭအ",
			"10": "<sup>10</sup> ယွၩလီၫ.- တၭယမိဒၪ့ထ့ၬခွံၬ ၦလတီၩလလီၩ့ဘၪအ နိၩ့ထီးအလူၬလီၫ. အ့ၪမွဲၦတီၩၦလီၩ့ အနိၩ့လဖၪ မိဘၪဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫဒၪလီၫ."
		},
		"76": {
			"1": "<sup>1</sup> ၦၥ့ၪယၫယွၩလၧယုဒၫအကျၩတၭ, အမံၩ့ဒိၪဝ့ၫလၧ",
			"2": "<sup>2</sup> အံၫစရ့လၭအဖၧၩ့,- တၭအတဲၩဆံၫ့ဎံၪအီၪဝ့ၫလၧ",
			"3": "<sup>3</sup> စ့လံၫ့အဖၧၩ့,ဒဲအီၪအလးလၧဇံအိၫ့အလီၩ့လီၫ.- ထီး နီၪမွဲအမၩခါချံၪအဖျါၥံၪ , ထၩ့ဖံၭဒဲနၭၥံၪဖၩ့ၥံၪဒဲဆၧ ဒုၭၥုၭလီၫ.(စ့လၫ.)",
			"4": "<sup>4</sup> နကယးကဖးဒိၪနဲၪ့, နလၩနဖၩ့အၪနဲၪ့ခိၪလီၩ့ထိၩ့",
			"5": "<sup>5</sup> ချိၬအီၪလၧဆၧဖိၪဆၧဎါအဒူၩဒံၭလီၫ.- ၦလၧအၥၭ ဒူၩလဖၪနီၪ လၩ့မါယူၭ, အဝ့ၫၥံၪမံၫမၪယူၭ, ဒဲၦအ",
			"6": "<sup>6</sup> ဆီၪ့လဖၪ ဒၪန့အစူၪနးဂၩအ့ၬ.- လၧနအၪ့ၥီၪ့ဆၧအ ကၠီၩ့နီၪ, စယၫကူၭအယွၩဧ့, လဲၪ့ၥုၭဒဲကၥ့ၪနီၪလၩ့ဘၪ ယူၭလၧဆၧမံၫမၪအဖၧၩ့ယူၭ.",
			"7": "<sup>7</sup> နဝ့ၫဒၪယီၩ, နမွဲဆၧၥၭမဲၪဖၭဒိၪအလးလီၫ. ထီး နၥၭအ့ၪထၪ့တၭ, မွဲပလၫဆၧၫ့ထုၪ့ လၧနမ့ၬယၫမိ",
			"8": "<sup>8</sup> ၥ့ၪလဂၩလဲၪ - ဒုၭနါဂၧၫ့ ဆၧစ့ၩရၫ့ လၧမူၭခိၪလီၫ.",
			"9": "<sup>9</sup> ထီးယွၩဂဲထုၪ့စ့ၩရၫ့ဆၧ ဘဲၫၥိၭအမိမၩဖီၩ့မၩဖျ့ၭက ယဲၦအၥၭဆၧၩ့ လၧဂၪ့ခိၪချိၫ့ထီးအလူၬတၭ, ဂၪ့ခိၪ ၥၭမဲၪဝ့ၫတၭ, အီၪလၩ့မါပံၭလီၫ. (စ့လၫ.)",
			"10": "<sup>10</sup> အဂဲးဘဲၫယီၩၦၡၩအၥၭထၪ့နီၪ မိစံၭထၪ့အၪ့အူၭ နၧၩတၭ, နခဲးထူၬနယးဒံၩ့လၧဆၧၥၭထၪ့ လၧအအီၪ",
			"11": "<sup>11</sup> လၩ့ထးနီၪလီၫ.- ဆိၪလၩ့နၥၭတၭ,ဆၧလဖၪနီၪမၩ လၧၫ့ထၪ့ဎွ့ၩထၪ့လၧယဟိဝၩ နၥံၪအယွၩနီၪဆံၭ. မွဲ ကယဲၦလၧအအီၪဝၬဖီၩ့အဝ့ၫဒၪ ထီးအလူၬလဖၪနီၪ ဂဲၫဆိၬဆၧဖ့ၪလၫ့ လၧၦလၧအမွဲဆၧၥၭမဲၪ အလး",
			"12": "<sup>12</sup> ဆံၭ.- တၭအဝ့ၫဒၪနီၪဒၪ့ထ့ၬခွံၬ ၦဒိၪဖၭဒိၪၥံၪအၥၭနီၪ, မွဲဝ့ၫလၧဆၧၥၭမဲၪအလးလၧဂၪ့ခိၪ အစဎွၩၥံၪအဂး လီၫ."
		},
		"77": {
			"1": "<sup>1</sup> ယကိၭထၪ့ယွၩတၭ, ယကိၭၡၭထၪ့နီၪ, ယကိၭထၪ့",
			"2": "<sup>2</sup> ယွၩတၭ, မွဲနခိၭနၪယလူဆံၭ.- တၭလၧယဆၧခိဆၧ ဝီၩအမုနံၩနီၪ ယအၪ့ဎၬကဆါ, ယစူၪအီၪယူၬထၪ့အ ၥၭလၧမုနၩတၭ, လလၩ့ပွံၭဘၪတၭ, ယၥၭလထိး",
			"3": "<sup>3</sup> ဆၧၫ့ဘၪဆၧမၩမုၬထၪ့ထဲၩ့ဝ့ၫနီၪလီၫ.- ယနၪ့ထၪ့ ထဲၩ့ယွၩတၭ, ယကိၭထၪ့ဆၧနီၪ, ယယၧၩ့ဘၪဆၧ",
			"4": "<sup>4</sup> တၭ,ယၥၭလၩ့ဘဲၩ့ဝ့ၫလီၫ.(စ့လၫ.)- နဖီၪ့ထၬယူၭ ယမ့ၬၥၪၥံၪလၧယအီၪနၪ့ထၪ့ယၥၭတၭ, ယၥုၪ့ဝၭထိၬ",
			"5": "<sup>5</sup> ယၥၭဝၭထိၬတၭ, ယချဲၩ့ဆၧၥ့ၪအ့ၬ.- တၭယဆီၫ့မီၪ့ လၧမုနံၩမုနၩ လၧဖျိၩ့အဂဲးအကၠီၪ့,နံၪ့ၥံၪလၩၥံၪလၧ",
			"6": "<sup>6</sup> ဖျိၩ့နီၪလီၫ.- ယနၪ့ထၪ့ထဲၩ့ယဆၧၥံၫကျံၩ လၧမုနၩလ ခီၫတၭ,ယဆီၫ့မီၪ့ဆၧလၧယၥၭနီၪတၭ, ယၥၭအၪ့ဎၬ",
			"7": "<sup>7</sup> ဆၧလီၫ.- မွဲကဆါမိခွံၬၡိၭခွံၬ ဆၧလၩ့ဆိၩလၩ့ကၠၪ",
			"8": "<sup>8</sup> နီၪဆ့ဧၪ.မွဲအမိအီၪက့ၪဒီၭ အခိးအတၩအ့ၬဧၪ.- မွဲ အဆၧယၫ့ၥၭ လအီၪလၧၩ့ဘၪ လၩ့ဆိၩလၩ့ကၠၪဘၪ ဧၪ.တၭမွဲအဆၧချဲၩ့ဝဲၩနီၪ ဂၭဂီၩ့ယူၭအဆိၩဆိၩအ",
			"9": "<sup>9</sup> ကၠၪကၠၪယူၭဧၪ.- မွဲယွၩၥၭနၪ့ယၫ့ၥၭ ဆၧနီၪဆ့ဧၪ. တၭမွဲအၥၭထၪ့နီၪ မၩဘံၭထၬအဆၧယၫ့ၥၭဆ့ဧၪ. (စ့လၫ.)",
			"10": "<sup>10</sup> တၭယစံၭ, ယဆၧဆၫမွဲအယီၩ,အ့ၪမွဲယမိနၪ့ထၪ့ ထဲၩ့ဆၧထီၫထုၬလဂၩ အစူၪထွ့ၪအနံၪ့အလၩလီၫ.",
			"11": "<sup>11</sup> တၭယမိဒုၭနၪ့ထၪ့ထဲၩ့ယွၩအမၩဆၧလဖၪ, အဂဲးဘဲၫ ယီၩယမိနၪ့ထၪ့ထဲၩ့ နမၩလၩ့လၭဆၧလၧဖျိၩ့လီၫ.",
			"12": "<sup>12</sup> ယမိဆီၫ့မီၪ့ဆၧ လၧနမၩဆၧထီးအလူၬ အဂဲးအကၠီၪ့ တၭ, ယမိကၩ့ကၩ ဆၧလၧနမၩဆၧဖံၭဆၧ အဂဲးအ",
			"13": "<sup>13</sup> ကၠီၪ့လီၫ.- ယွၩဧ့, နဖၧၩ့ၥၭအီၪဝ့ၫလၧဆၧဆံၫ့ဎံၪအ ဖၧၩ့လီၫ.တၭမွဲပလၫကဲၪယွၩဒိၪဝ့ၫလဂၩ ဘဲၫပယွၩ",
			"14": "<sup>14</sup> အၥိၭနီၪလဂၩလဲၪ.- တၭနမွဲယွၩလဂၩ လၧအမၩဆၧ လၩ့လၭလီၫ. နဒုၭၥ့ၪယၫယူၭ နစီၩ့နမၩ့ လၧၦခမျၧး",
			"15": "<sup>15</sup> အကျၩလီၫ.- တၭနဎွ့ၩန့ထဲၩ့ယူၭ နၡၩခမျၧးလၧနစူၪ, စယၫကူၭဒဲစယိၥၭလဖၪနီၪလီၫ. (စ့လၫ.)",
			"16": "<sup>16</sup> ထံၫၥံၪဒၪဘၪနၧၩ, ယွၩဧ့, ထံၫၥံၪဒၪဘၪနၧၩတၭ, ၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫလီၫ. ထံၫယိၬအဖၧၩ့လဖၪနီၪ ဝၭဝ့ၫ",
			"17": "<sup>17</sup> ဆ့လီၫ.- ဆၧအုၪ့လဖၪလူၫလၩ့ခွံၬထံၫတၭ, မူၭဖိၭဖၫ့",
			"18": "<sup>18</sup> ဒုၭဎွံၩ့လၫ့တၭ, နဖျါလဖၪဖျိၭဝ့ၫဆ့လီၫ.- နလၫ့အၥီၫ အီၪဝ့ၫလၧလံၩၥဝံၭအဖၧၩ့တၭ, လၫ့ဝဲအဒံၭနီၪဒုၭဖၩ့ ထၪ့ဂၪ့ခိၪတၭ, ဂၪ့ခိၪၡိၩ့ၡိၬ, ဒဲဝၭဝ့ၫဒၪလီၫ.",
			"19": "<sup>19</sup> တၭနဖၧၩ့ၥၭအီၪဝ့ၫ လၧမၫဆမံၭဖၧၩ့ နဖၧၩ့ၥုၪ့ဖၧၩ့ ၥၭလၧထံၫဖၭဒိၪအကျၩ, တၭနခၪ့လးၥံၪၦၥ့ၪယၫဝ့ၫ",
			"20": "<sup>20</sup> ဆ့အ့ၬ.- နၥိၫ့နၡၩခမျၧးလၧစမိစ့ၭ ဒဲစအၫရၧၫ့အစူၪ ဘဲၫၥိၪလဒီၪ့အၥိၭနီၪလီၫ."
		},
		"78": {
			"1": "<sup>1</sup> ခိၭနၪယဆၧၥီၪ့ဆၧၥၫ့, ယၡၩခမျၧးၥံၪဧ့, ဒိၭနၥံၪ",
			"2": "<sup>2</sup> အနါလၧယနိၭအချဲၩ့ဆၧနီၪဆံၭ.- ယမိအၩ့ထၪ့ယနိၭ လၧဆၧချဲၩ့ဒီၩ့တၭ, ယမိလီၩလၩ့လၬလၩ့ဆၧချဲၩ့အ",
			"3": "<sup>3</sup> ဒီၩ့အထ့ၬလၧဖျိၩ့,- လၧပနါဂၧၫ့ယူၭ ဒဲၥ့ၪယၫတၭ,",
			"4": "<sup>4</sup> ပဖါၥံၪလီၩဘၪပၧၩလီၫ.- ပမိအီၪက့ၪၥူၪခွံၬဝ့ၫလၧ အဝ့ၫၥံၪအဖိၪလဖၪဆ့အ့ၬ. ပမိလီၩလၩ့လၬလၩ့ၦအ ဆိၩလၧခဲၫ့လဖၪ လၧယဟိဝၩအဆၧစံၭထၪ့အၪ့အူၭ, ဒဲအဂဲးအဘၭ, ဒဲအဆၧမၩလၩ့လၭလၧအမၩဝ့ၫလဖၪ နီၪလီၫ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ အဝ့ၫဒၪဒုၭအီၪဂုးအီၪခၧၫ့ ဆၧထိး အၥၭလၧစယၫကူၭအဖၧၩ့တၭ, အီၪက့ၪဆၧၥီၪ့ဆၧ ၥၫ့လၧအံၫစရ့လၭအကျၩ လၧအမၪလူၬပဖါၥံၪလၧ",
			"6": "<sup>6</sup> အဝ့ၫၥံၪဘၪဒုၭၥ့ၪယၫအဖိၪၥံၪ,- ဘဲၫၥိၭၦအဆိၩလၧ ခဲၫ့လဖၪမိၥ့ၪယၫ, ဖိၪၥၪလၧအမိအီၪဖျဲၪလဖၪနီၪ မိဂဲ",
			"7": "<sup>7</sup> ထုၪ့တၭ,လီၩလၩ့ဒီၭအဖိၪၥံၪလီၫ.- မွဲဘဲၫၥိၭအမိအီၪ က့ၪအဆၧယိလါလၧယွၩအဖၧၩ့တၭ, ထီးၥၭနၪ့ယွၩ အဆၧမၩလဂ့ၩတၭ, မိထီးန့အဆၧမၪလူၬလဖၪနီၪ",
			"8": "<sup>8</sup> လီၫ.- တၭဘဲၫၥိၭအထီးကဲၪဘဲၫ အဖါၥံၪအၥိၭနီၪလ ဂ့ၩ,ၦလဆိၩလၧအနါကဲၪ့ဒဲပိၩ့ထၪ့ဆၧ, ၦလဆိၩလၧ အၥုၪ့လဂုးအၥၭလခၧၫ့ဘၪတၭ, အၥၭလတီၩဘၪလၧ ယွၩနီၪလီၫ.",
			"9": "<sup>9</sup> ၦအံဖြံၫ့ဖိၪအီၪလၧအစူၪဝဲၩၥံၪလါနၫ့တၭ, လၧဆၧ",
			"10": "<sup>10</sup> ဒုၭၥုၭ အမုနံၩအဖၧၩ့နီၪ ထဲၩ့ထဲၩ့ဝ့ၫလီၫ.- အဝ့ၫၥံၪ ထီးယွၩအဆၧအုၩ့လၩ့အ့ၬ. အီၪက့ၪအၥၭလၧအလ",
			"11": "<sup>11</sup> လ့ၩဘၪလၧအဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့တၭ,- ၥၭနၪ့အ ဆၧမၩဒဲအဆၧလၩ့လၭ လၧအဒုၭနဲၪဝ့ၫလၧအဝ့ၫၥံၪ အမ့ၬယၫလဖၪလီၫ.",
			"12": "<sup>12</sup> အဝ့ၫဒၪမၩဆၧလၩ့လၭ လၧအဝ့ၫၥံၪအဖါၥံၪအမ့ၬ ယၫလၧခးအံဇံၭအဖၧၩ့, ဆၧပျၩ့ဇိအၫ့အဖၧၩ့နီၪလီၫ.",
			"13": "<sup>13</sup> မၩထ့ဖၭပၪ့လဲၪတၭ, ဒုၭခၫ့ဂၬအဝ့ၫၥံၪတၭ, အီၪက့ၪ",
			"14": "<sup>14</sup> ထံၫဘဲၫဆၧပိၩ့အၥိၭနီၪလီၫ.- ၥိၫ့အဝ့ၫၥံၪလၧမုဆၫ လခီၫလၧဆၧအုၪ့တၭ, ဒဲၥၫ့ၥၫ့နၩနီၪ, မွဲလၧမ့ၪအဖၩ့",
			"15": "<sup>15</sup> လီၫ.- အဝ့ၫဒၪမၩထ့ဖၭလိးၥံၪလဲၫ့ၥံၪ လၧၡါမုနၧၫ့ဖၫ တၭ,ဒုၭလၩ့ယွၩထံၫ ဘဲၫထံၫယိၬဖၧၩ့အၥိၭနီၪလီၫ.",
			"16": "<sup>16</sup> အဝ့ၫဒုၭဂဲၫထၪ့ထံၫချိၬၥံၪ လၧလိးၥံၪလဲၫ့ၥံၪအဖၧၩ့",
			"17": "<sup>17</sup> တၭ,ဒုၭလၩ့ယွၩထံၫဘဲၫထံၫမိၡါအၥိၭနီၪလီၫ.- တၭ အဝ့ၫၥံၪမၩမၪအဝ့ၫဒၪ အၪနဲၪ့ဒံၭ လၧအပိၩ့ထၪ့ဆၧ",
			"18": "<sup>18</sup> ထၪ့ထီၫထုၬလဂၩလၧၡါမုနၧၫ့ဖၫ အဖၧၩ့နီၪလီၫ.- တၭ အဝ့ၫၥံၪကျဲၩ့ဖစီၩ့ယွၩလၧအၥၭခံဖၧၩ့ လၧအအၪ့ကံၩ့",
			"19": "<sup>19</sup> ဆၧအၪ့လၧအၥၭကွံၩဆၧအဂးနီၪအကၠီၩ့လီၫ.- အဝ့ၫ ၥံၪချဲၩ့ဆၧထၫ့ဒုၪဒၩယွၩ, စံၭဝ့ၫ, မွဲယွၩတဲၩ့ဝဲၩစပွဲ",
			"20": "<sup>20</sup> လၧၡါမုနၧၫ့ဖၫအဖၧၩ့ယီၩဘၪမိၥ့ၪဧၪ.- ယိခွါ, မွဲအ ဒိၪယူၭလိးလဖျိၪ့နီၪတၭ, ထံၫဖျိၭထၪ့လၩ့ယွၩဝ့ၫ,ဒဲ ထံၫချိၬလုၬဘံၭဆၧလီၫ. မွဲအဖ့ၪလၫ့ကိၪနီၪဘၪမိၥ့ၪ ဆ့ဧၪ.မွဲအမိတဲၩ့ဝဲၩဆၧယၪ လၧအၡၩခမျၧးၥံၪအဂး",
			"21": "<sup>21</sup> ဆ့ဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩနါဂၧၫ့ဝ့ၫနီၪအ ၥၭထၪ့တၭမ့ၪဘၪဆၧဆူၭခဲၩထၪ့ ထၫ့ဒုၪဒၩယၫကူၭ တၭ,ဆၧၥၭဂဲၫ့ဂဲၫထၪ့ ထၫ့ဒုၪဒၩအံၫစရ့လၭဆ့လီၫ.",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪလနဲၩဘၪယွၩ, ဒိၭနဲၩ့အၥၭလၧ",
			"23": "<sup>23</sup> အဝ့ၫနီၪအဆၧမၩဖီၩ့ဖျ့ၭအဖၧၩ့ဆ့အ့ၬ.- အဝ့ၫဒၪမၪ လူၬဆၧအုၪ့လဖၪလၧထၭလခီၫတၭ, ဝဲထၪ့မူၭခိၪအ",
			"24": "<sup>24</sup> တရၫ့,- ဒုၭဂဲၫဆၧၩ့လၩ့မၪ့နၫလၧအဖၫ့ခိၪ ဘဲၫၥိၭအ ဝ့ၫၥံၪမိအၪ့ဆၧတၭ, ဖ့ၪလၫ့မူၭခိၪအဘုၪအဂူၫလီၫ.",
			"25": "<sup>25</sup> တၭဆၧအဂဲးဆီၪ့အဘၭဆီၪ့အဆၧအၪ့နီၪ ၦၡၩအၪ့ ဝ့ၫလီၫ. အဝ့ၫအၪ့မၧၫ့လၩ့ဆၧအၪ့လၧအဝ့ၫၥံၪအအီၪ",
			"26": "<sup>26</sup> ထီးအဘျဲၩအၪ့ဝ့ၫဒၪလီၫ.- အဝ့ၫဒၪဒုၭဂဲၫလံၩမုထၪ့ လၧမူၭခိၪ, ဒဲဒုၭဂဲၫလံၩမုခံၫ့ လၧအစီၩ့အမၩ့နီၪလီၫ.",
			"27": "<sup>27</sup> တၭဒုၭဂဲၫဆၧၩ့လၩ့ဆၧယၪ လၧအဝ့ၫၥံၪအဖၫ့ခိၪဘဲၫ ဂၪ့ခိၪမုၬအၥိၭ, ဒဲထိၪအီၪလၧအဒံၭဘဲၫပၪ့လဲၪအမ့ၭ",
			"28": "<sup>28</sup> အၥိၭနီၪလီၫ.- ဒုၭလၩ့ထ့ၬဝ့ၫလၧၥုၪ့တဲၩအလးအၥၭ",
			"29": "<sup>29</sup> ကျၩတၭ, အီၪဝၬဖီၩ့အအီၪဝ့ၫအလးနီၪလီၫ.- အဝ့ၫ ၥံၪအၪ့ဝ့ၫနီၪ, အၪ့ဘျဲၩအၪ့လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩတၭ,ယွၩ",
			"30": "<sup>30</sup> ဒုၭန့ဘၪအဝ့ၫၥံၪအဆၧၥၭကွံၩနီၪလီၫ. တၭအဝ့ၫၥံၪ ခွံၬၡိၭအဆၧၥၭကွံၩအ့ၬ. ဆၧအၪ့အီၪဝ့ၫလၧအနိၭ",
			"31": "<sup>31</sup> ဖၧၩ့အဘိၩ့ဘၭနီၪတၭ,- ယွၩအၥၭထၪ့လၩ့ဘၪအဝ့ၫ ၥံၪ,မၩၥံၫအၡၩဆီၪ့လဖၪတၭ, ဒုၭဆၪ့လၩ့အံၫစရ့",
			"32": "<sup>32</sup> လၭအဖိၪၥၪခွၫၥံၪလီၫ.- လၧဆၧနီၪလဖၪထီးအလူၬ အကၠီၩ့လါနၫ့ဘိၩ, အဝ့ၫၥံၪမၩဒံၭဆၧဒဲၩဘၭဒံၭ, အ ဝ့ၫဒၪမၩလၩ့လၭဆၧလါနၫ့ဘိၩ အဝ့ၫၥံၪနဲၩဝ့ၫအ့ၬ.",
			"33": "<sup>33</sup> ယွၩမၩလူၬခွံၬ အဝ့ၫၥံၪအမုနံၩလဖၪ လၧဆၧပျီၩပျီၩ အဖၧၩ့တၭ, အနံၪ့အလၩလၧဆၧခိဆၧဝီၩအဖၧၩ့နီၪ ဆ့လီၫ.",
			"34": "<sup>34</sup> ယွၩအ့ၪကျီၪ့ဝ့ၫတၭ, အဝ့ၫၥံၪအၪ့ဎၬအဝ့ၫနီၪ ဂဲၫ",
			"35": "<sup>35</sup> ထဲၩ့ထဲၩ့တၭ, အၪ့ဎၬယွၩလၧအဆိၫအချဲၫ့လီၫ.- တၭ နၪ့ထၪ့ထဲၩ့ဝ့ၫလၧယွၩမွဲအဝ့ၫၥံၪအလိးအလဲၫ့, ဒဲဆၧ",
			"36": "<sup>36</sup> ထၪ့ထီၫယွၩနီၪမွဲဆၧဎွ့ၩန့ထဲၩ့အဝ့ၫၥံၪလီၫ.- မွဲလါနၫ့ ဘိၩ,အဝ့ၫၥံၪအၪ့လီၫန့ဝ့ၫလၧအနိၭတၭ, ချဲၩ့ဘျံၭချဲၩ့",
			"37": "<sup>37</sup> ဘျၪလၧအဖျ့ၩလီၫ.- အဝ့ၫၥံၪအၥၭ လဂုးလခၧၫ့ဘၪ လၧအဝ့ၫဒၪအၥိၭတၭ, အီၪဂုးအီၪခၧၫ့လၧအဆၧအုၩ့",
			"38": "<sup>38</sup> လၩ့အဖၧၩ့နီၪဆ့အ့ၬ.- မွဲလါနၫ့ဘိၩယွၩအၥၭအီၪအ ဝ့ၫၥံၪ,ဖျါခွံၬအဆၧအၧၩ့တၭ, လမၩဂၭဂီၩ့ဘၪဝ့ၫနီၪ, ဘိၭကၠၪခွံၬအဆၧၥၭထၪ့အၪဖၧၫ့တၭ, ထိၪဂဲၩအၥၭ",
			"39": "<sup>39</sup> ခဲၩထၪ့ထီးအလူၬဆ့အ့ၬ.- တၭအဝ့ၫဒၪနၪ့ထၪ့ထဲၩ့ လၧအဝ့ၫၥံၪနီၪမွဲဆၧဖံၭဆၧယၪ, လံၩလၧအစဲၪ့ထၪ့ခွံၬ",
			"40": "<sup>40</sup> တၭဂဲၫထဲၩ့လၧၩ့အ့ၬ.- အဝ့ၫၥံၪပိၩ့ထၪ့ယွၩလၧၡါမု နၧၫ့ဖၫ,ဒဲမၩဆၫအၥၭ လၧၡါမုနၧၫ့ဖၫနီၪဎွ့ဘျၩ့လဲၪ.",
			"41": "<sup>41</sup> အဝ့ၫၥံၪထဲၩ့ထဲၩ့တၭကျဲၩ့ဖစီၩ့ယွၩတၭ, မၩကြၩ့",
			"42": "<sup>42</sup> ထမးအံၫစရ့လၭအဆၧဆံၫ့ဎံၪလဂၩနီၪလီၫ.- တၭမု နံၩလၧအဝ့ၫဒၪ မၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪ လၧအဒုၪအဒၩ ၥံၪအစူၪဖၧၩ့နီၪ, ၦလဖၪနီၪနၪ့ထၪ့ထဲၩ့အဝ့ၫဒၪအစူၪ",
			"43": "<sup>43</sup> နီၪအ့ၬ.- မွဲၦလၧအအီၪက့ၪအဆၧမၩနဲၪ့လၩ့လၭလၧ အံဇံၭအဖၧၩ့, ဒဲအဆၧလၩ့လၭလဖၪ လၧဆၧပျၩ့ဇိ",
			"44": "<sup>44</sup> အၫ့အဖၧၩ့နီၪ,- ဒုၭကဲၪထၪ့အထံၫမိၡါလဖၪလၧဆၧ",
			"45": "<sup>45</sup> ၥွံၪတၭ, ၦအီၩအထံၫၥ့ၪအ့ၬ.- အၪ့မၧၫ့လၩ့ဒူၩလၫအၪ မံၩ့လၧအကျၩ လၧအအဲၪအဝ့ၫၥံၪ, ဒဲဒ့ၪၥံၪလၧအမၩ",
			"46": "<sup>46</sup> ဂၭဂီၩ့ဆၧလီၫ.- ဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪ အဆၧအၪထၪ့",
			"47": "<sup>47</sup> လၧထွ့ဎစံ, ဒဲအမၩဆၧလၧထွ့အၪဘၫလီၫ.- တၭမၩ ဂၭဂီၩ့အစဘံၭမု လၧမုၥၪတၭ, အၥံၪ့ကူၪလဖၪလၧ",
			"48": "<sup>48</sup> ဆၩ့ဎဲၫ့,- တၭဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪ အၥိၪၥံၪချီၥံၪလၧမု ၥၪအဖၧၩ့, ဒဲဆၧဖိၪဆၧဎါအဒိၩ့ လၧလၫ့ဝဲအဒံၭအ",
			"49": "<sup>49</sup> ဖၧၩ့လီၫ.- အဝ့ၫဒၪအၪ့မၧၫ့လၩ့ အၥၭထၪ့ခဲၩထၪ့လၧ အဝ့ၫၥံၪအလီၩ့ ဆၧၥၭထၪ့ဒဲဆၧၥၭခဲၩထၪ့, ဒဲဆၧခိ ဆၧဝီၩလၧအအၪ့မၧၫ့လၩ့ ဆၧအၧၩ့အၥီၫ့လဖၪလၧအ",
			"50": "<sup>50</sup> ဝ့ၫၥံၪအအီၪလီၫ.- တၭမၩဖၧၩ့ၥၭလၧအၥၭထၪ့ဆၧ အဂး,ဘဲၫၥိၭအဝ့ၫၥံၪထီးၥံၫလဂ့ၩနီၪ, ယွၩလီၫ့ကီၩ့ အၥၭမၧၫ့အ့ၬ, အ့ၪမွဲဖ့ၪလၫ့ခွံၬအၥၭမၧၫ့လၧဆၧၥံၫ",
			"51": "<sup>51</sup> ချဲၫ့အဖၧၩ့လီၫ.- အဝ့ၫဒၪဖ့ၬခွံၬကယဲၦဖိၪဝဲၡါလၧအံ ဇံၭအဖၧၩ့, အဂဲးအဘၭအခၪ့ထံၭလဖၪလၧစဟၫ့အ",
			"52": "<sup>52</sup> တဲၩၥံၪအဖၧၩ့လီၫ.- အ့ၪမွဲအၡၩခမျၧးဒၪဝ့ၫနီၪ ဒုၭစဲၪ့ ထၪ့ဝ့ၫဘဲၫၥိၪလဒီၪ့အၥိၭနီၪတၭ, ၥိၫ့ထၪ့အဝ့ၫၥံၪလၧ",
			"53": "<sup>53</sup> ၡါမုနၧၫ့ဖၫဘဲၫချီခမျၧးအၥိၭနီၪလီၫ.- တၭၥိၫ့ဝ့ၫၡီၫၡီၪ တၭ,အဝ့ၫၥံၪၥၭမဲၪဆၧအ့ၬ. အ့ၪမွဲအဝ့ၫၥံၪအဒုၪအ",
			"54": "<sup>54</sup> ဒၩၥံၪနီၪပၪ့လဲၪလုၬဘံၭခွံၬဝ့ၫဒၪလီၫ.- တၭအဝ့ၫဒၪ ဒုၭဂဲၫအဝ့ၫၥံၪ လၧအလးဆံၫ့ဎံၪအနဲၩ့ထံၭ, ခိၪလီၩ့",
			"55": "<sup>55</sup> လဖျိၪ့လၧအစူၪထွ့ၪဎွ့ၩန့ဝ့ၫလီၫ.- အဝ့ၫဒၪနၫ့ထၪ့ခွံၬ ၦဆၨၩၥံၪ လၧအဝ့ၫၥံၪအမ့ၬယၫတၭ, အၪ့နၩ့ဖၭအ ဆၧန့ၥၫလၧဖျံၩတၭ, ဒုၭအီၪအံၫစရ့လၭအဒီၪ့လဖၪ လၧတဲၩဖၧၩ့လီၫ.",
			"56": "<sup>56</sup> မွဲလါနၫ့တၭ, အဝ့ၫၥံၪကျဲၩ့ဖစီၩ့ ဒဲပိၩ့ထၪ့ဆၧထၪ့",
			"57": "<sup>57</sup> ထီၫထုၬယွၩတၭ, ထီးန့ဝ့ၫအဆၧထိးအၥၭအ့ၬ.- အ့ၪ မွဲအဝ့ၫၥံၪထဲၩ့ထဲၩ့တၭ, အၪ့လီၫဆၧဘဲၫအဖါၥံၪအ ၥိၭနီၪလီၫ. တၭအၥၭကဒံၩကဒၩ ဘဲၫချံၪလိၬအၥိၭ",
			"58": "<sup>58</sup> လီၫ.- အဝ့ၫၥံၪမၩၥၭထၪ့ယွၩလၧအဝ့ၫၥံၪအလးထၪ့ ထီၫလဖၪတၭ, မၩၥၭကဲၪ့အဝ့ၫနီၪလၧအဆၧဂၩ့စိၭ ဖျၩအၥၭလီၫ.",
			"59": "<sup>59</sup> ယွၩနါဂၧၫ့ဆၧနီၪတၭ, ၥၭထၪ့ဝ့ၫတၭၥၭလိၪအံၫစ",
			"60": "<sup>60</sup> ရ့လၭနၭမၬလီၫ.- တၭအဝ့ၫဒၪစဲၪ့ဒၪၡဲလိၫအီၪဝ့ၫအ လးနီၪ,တဲၩဆံၫ့ဎံၪလၧအအီၪက့ၪဝ့ၫ လၧၦၡၩအကျၩ",
			"61": "<sup>61</sup> လီၫ.- ဒဲဖ့ၪလၫ့ခွံၬအဆၧဂဲးဆီၪ့ဘၭဆီၪ့လၧဆၧအၪ့ မၧၫ့ဎီးအဖၧၩ့တၭ, အလၩအဖၩ့နီၪလၧအဒုၪအဒၩအ",
			"62": "<sup>62</sup> စူၪဖၧၩ့လီၫ.- အဝ့ၫဒၪဖ့ၪလၫ့ခွံၬအၡၩခမျၧးၥံၪလၧနၭ",
			"63": "<sup>63</sup> တၭ,ၥၭခဲၩထၪ့ဘၪအဆၧန့ၥၫလီၫ.- မ့ၪအၪ့ခွံၬအဝ့ၫ ၥံၪအဖိၪၥၪခွၫလဖၪ, ဒဲအမုၪနၩ့လဖၪဘၪဆၧစံၭထၪ့",
			"64": "<sup>64</sup> အၪ့အူၭဝ့ၫဆ့အ့ၬ.- အၡၩလုဆၧလဖၪလၩ့ထံၩဖါဝ့ၫ လၧဖၩ့ၥံၪနၭၥံၪ, အမုၪမဲၫၥံၪဂၪ့ဆၧယၧၩ့ဆၧအ့ၬ.",
			"65": "<sup>65</sup> ထီးနီၪလဖၧၫ့, ကဆါနၪ့ထၪ့အၥၭဘဲၫၦလၧအမံၫ မၪဝ့ၫအၥိၭနီၪတၭ, ဘဲၫၦလၧအဂဲးဆီၪ့အဘၭဆီၪ့လၧ အကိၭၡၭထၪ့ လၧစဘံၭထံၫအဖၧၩ့အၥိၭနီၪလီၫ.",
			"66": "<sup>66</sup> အဒုၪအဒၩလဖၪနီၪ, အဝ့ၫဒၪကျီၪ့ဒုၭထဲၩ့ဝ့ၫ ဒဲအီၪ က့ၪဝ့ၫလၧဆၧဒုၪဒွ့ၪအလး လၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"67": "<sup>67</sup> အဝ့ၫဒၪခွံၬၡိၭယိၥၭအတဲၩတၭ, လရွံန့ဘၪအံဖြံၫ့ လဒီၪ့တၭ,-",
			"68": "<sup>68</sup> ရွံန့ယုဒၫလဒီၪ့, ခိၪလီၩ့ဇံအိၫ့လၧအအဲၪ ဝ့ၫလီၫ.",
			"69": "<sup>69</sup> တၭအဝ့ၫဒၪမၩထၪ့ အလးဆံၫ့ဎံၪဘဲၫဆၧအလး ထၪ့ထီၫအၥိၭ ဘဲၫဂၪ့ခိၪလၧအအီၪက့ၪအခၪ့ထံၭအ",
			"70": "<sup>70</sup> ဆိၩအကၠၪအၥိၭနီၪလီၫ.- ရွံန့အခ့ၫအၡၩစဒၫဝံၭတၭ,",
			"71": "<sup>71</sup> မၩန့အဝ့ၫလၧၥိၪအဖီၩ့ဖၧၩ့,- လၧအဖိၬၥိၪအၪ့နုအ ခဲၫ့လီၫ.တၭဒုၭဂဲၫထၪ့အဝ့ၫနီၪဘဲၫၥိၭ အမိကဲၪၦယူၬ ၥိၪလၧအၡၩခမျၧးယၫကူၭအဖၫ့ခိၪ, ဒဲလၧအဆၧန့ၥၫ အံၫစရ့လၭအဖၫ့ခိၪလီၫ.",
			"72": "<sup>72</sup> တၭအဝ့ၫလဂၩဘုၪအၪ့အဝ့ၫၥံၪ လၧအၥၭထၧၫ့ဖျိၪ့ ယၫတၭ, ၥိၫ့ဝ့ၫလၧအစူၪကိၪ့ၥ့ၪကိၪ့ဘၪလီၫ."
		},
		"79": {
			"1": "<sup>1</sup> ယွၩဧ့, ၦအဆၨၩၥံၪဂဲၫနုၬယူၭလၧနဆၧန့ၥၫအဖၧၩ့ ယူၭ.မၩဘၪၥၭလိၪယူၭနနီးဆံၫ့ဎံၪယူၭ, မၩလၩ့ဎီး",
			"2": "<sup>2</sup> ယူၭယရုစလံၫ့ယူၭ.- တၭအဝ့ၫၥံၪဖ့ၪလၫ့ယူၭ နခ့ၫနၡၩလဖၪအခိၪစွၪ လၧမူၭခိၪအထိၪၥံၪလံၪၥံၪလၧဆၧ အၪ့အဂး, နၡၩဆံၫ့ဎံၪအယၪလၧဂၪ့ခိၪအဆၧဖိၪဆၧ",
			"3": "<sup>3</sup> ဎါယူၭလီၫ.- ၦလဖၪနီၪလူၫလၩ့ခွံၩ့ယူၭအဝ့ၫၥံၪအၥွံၪ ဘဲၫထံၫအၥိၭ. ဝၬဖီၩ့ယရုစလံၫ့ယူၭတၭ, ၦခုၪ့လၩ့",
			"4": "<sup>4</sup> ဘၧၩ့ခွံၬဝ့ၫအီၪနးဂၩအ့ၬ.- ပဝ့ၫဒၪပကဲၪထၪ့ယူၭဆၧ ဒုၪဒွ့ၪအလးလၧပအီၪလၧပနဲၩ့ထံၭအဂး, ဆၧချဲၩ့လိ ဆၧအလး ဒဲဆၧမၩကြၩ့ထမးဆၧ အလးလၧၦအီၪ ဝၬဖီၩ့ပၧၩအဂးယူၭ.",
			"5": "<sup>5</sup> ဆံၭယံၬလဲၪ, ယဟိဝၩဧ့, နမိၥၭထၪ့ဆၧလၩ့ဆိၩ လၩ့ကၠၪဆ့ဧၪ. တၭနၥၭကဲၪ့နီၪမိအၪ့ဆၧဘဲၫမ့ၪအၥိၭ",
			"6": "<sup>6</sup> နီၪဆ့ဧၪ.- တၭလူၫလၩ့ခွံၬနဆၧၥၭထၪ့လၧၦဆၨၩၥံၪ လၧအလၥ့ၪယၫဘၪနၧၩ ဒဲလၧဘၩ့မုးလဖၪလၧအလ",
			"7": "<sup>7</sup> ကိၭထၪ့ဘၪနမံၩ့နီၪအလီၩ့ဆံၭ.- အဂဲးဘဲၫယီၩအဝ့ၫ",
			"8": "<sup>8</sup> ၥံၪအၪ့ခွံၬစယၫကူၭဒဲမၩယူအအီၪဝ့ၫအလးလီၫ.- ပ ဆၨၩပထံၭအဆၧဒဲၩဘၭၥံၪနီၪ ထီးနၪ့ထၪ့ထဲၩ့ထၫ့ ဒၩပၧၩလဂ့ၩ. မွဲနဆၧယၫ့ၥုၪ့နဆၧယၫ့ၥၭလဖၪဘၪ ခီၩ့ပၧၩလၧအဆိၫအချဲၫ့ဆံၭ. အဂဲးဘဲၫယီၩပဘၪ",
			"9": "<sup>9</sup> ဆၧဆၪ့လၩ့ပၧၩနၭမၬလီၫ.- ပဆၧထိးထဲၩ့တၩ့ထဲၩ့ အယွၩဧ့, မၩဘိၭမၩဆၧၩ့ပၧၩလၧနမံၩ့အလၩအဖၩ့ အခိၪအကၠီၩ့နီၪဆံၭ. တၭမၩဖီၩ့မၩဖျ့ၭပၧၩဒဲဖျါခွံၬ",
			"10": "<sup>10</sup> ပဆၧဒဲၩဘၭ, လၧနမံၩ့အကၠီၩ့နီၪဆံၭ.- တၭၦဆၨၩ ၥံၪမိစံၭ,အဝ့ၫၥံၪအယွၩအီၪခီၫခီၫလဲၪနီၪ, မွဲအဂဲးဘဲၫ ၥ့ၪလဲၪ.တၭဆၧမၩဆၧၩ့ လၧနခ့ၫနၡၩအၥွံၪ လၧအ လူၫလၩ့အၥၭအဂးနီၪ, မွဲအအီၪဖျီၪလၧၦဆၨၩၥံၪအ",
			"11": "<sup>11</sup> ကျၩလၧပမ့ၬယၫဆံၭ.- မွဲၦလၧအဘၪဆၧစၧၩ့ထၬအ ဂၪ့အုၩဂၪ့ထိၬနီၪဂဲၫထၪ့လၧနမ့ၬယၫဆံၭ. တၭဘဲၫန စီၩ့ဒိၪနမၩ့ဒိၪအၥိၭနီၪ, မၩဖီၩ့မၩဖျ့ၭ ၦလၧအဘၪ",
			"12": "<sup>12</sup> ဆၧစ့ၩရၫ့ၥံၫနီၪဆံၭ.- ဒဲၦလၧပနဲၩ့ထံၭအဒုၪဒွ့ၪဆၧ လၧအဒုၪဒွ့ၪနၧၩ, ကဆါဧ့,ဖ့ၪထဲၩ့အဝ့ၫၥံၪနွ့ၫစၩလၧ အၥၭနၫၡါအဖၧၩ့နီၪဆံၭ.",
			"13": "<sup>13</sup> တၭပဝ့ၫဒၪယီၩ ပမွဲနၡၩခမျၧး,နဆၧအၪ့အဆၪအ လးအၥိၪလဖၪနီၪ, ပမိစံၭထၪ့အၪ့အူၭနၧၩ လၩ့ဆိၩ လၩ့ကၠၪလီၫ. ပမိလီၩလၩ့လၬလၩ့ နဆၧစံၭထၪ့အၪ့ အူၭအဆိၩဆိၩအကၠၪကၠၪလီၫ."
		},
		"80": {
			"1": "<sup>1</sup> အံၫစရ့လၭအၡၩယူၬၥိၪဧ့, ခိၭနၪဆံၭ.ၦလၧအၥိၫ့ ယိၥၭဘဲၫၥိၪလဒီၪ့အၥိၭနီၪ, လၧအဆၧၫ့နၩ့လၧခ့ၫရူၬ",
			"2": "<sup>2</sup> အဖၫ့ခိၪနီၪလဂၩဧ့, ဖၩ့ထၪ့နဝ့ၫဆံၭ.- ထိၪဂဲၩနဂဲးန ဘၭလၧအံဖြံၫ့, ဒဲဘံၪ့ယမံၫ့ ဒဲမနၭစ့ၫအမ့ၬယၫတၭ,",
			"3": "<sup>3</sup> ဂဲၫမၩဖီၩ့မၩဖျ့ၭပၧၩဆံၭ.- ယွၩဧ့, ဒုၭဂဲၫထဲၩ့ပၧၩ တၭဒုၭဖၩ့ထၪ့နမ့ၬဆံၭ, တၭပမိထီၩ့လၧဆၧထိးထဲၩ့ တၩ့ထဲၩ့ပၧၩအလးလီၫ.",
			"4": "<sup>4</sup> ယဟိဝၩဆၧၥုၭမုခမျၧးအယွၩဧ့, နမိၥၭထၪ့ဒံၭနၡၩ",
			"5": "<sup>5</sup> ခမျၧး အဆၧဘၩဆိၪဖၪနီၪဆံၭယံၬလဲၪ.- တၭနဒုၭ အၪ့အဝ့ၫၥံၪလၧမ့ၬထံၫအကိၪတၭ, နဒုၭအီၩဝ့ၫလၧမ့ၬ",
			"6": "<sup>6</sup> ထံၫအဆၧတိၪ့လဖျိၪ့အဖၧၩ့လီၫ.- တၭနအီၪက့ၪပၧၩ လၧဆၧအဲၪ့လိၬဆိၬချဲၩ့အလး လၧပအီၪလၧပနဲၩ့ထံၭ ၥံၪအဂးနီၪ, ပဒုၪပဒၩၥံၪနံဘၪ လၧအနၫ့ဆါဒၪဝ့ၫအ ကျၩလီၫ.",
			"7": "<sup>7</sup> ဆၧၥုၭမုခမျၧးအယွၩဧ့,ဒုၭဂဲၫထဲၩ့ပၧၩတၭ, ဒုၭဖၩ့ ထၪ့အမ့ၬဆံၭ. တၭပမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ ပၧၩအလးလီၫ.",
			"8": "<sup>8</sup> နဂဲၫဆိၬစဘံၭမုလမုလၧအံဇံၭအဖၧၩ့, နနၫ့ထၪ့ခွံၬ",
			"9": "<sup>9</sup> ၦဆၨၩၥံၪတၭၥုၪ့လၩ့ဝ့ၫလီၫ.- နမၩအလးလၧအဂး တၭ,ဒုၭဆဲၩလၩ့အဝံနီၪ, ဒဲမၩဎွ့ၩထံၫၥံၪခးၥံၪလီၫ.",
			"10": "<sup>10</sup> ခိၪလီၩ့ထိၩ့ချိၬဘၪဘံၭလၧအလၩၡုၪတၭ, အထဲၩ့",
			"11": "<sup>11</sup> အဖၫ့လဖၪနီၪမွဲဘဲၫယွၩအၥံၪ့ၡိၫအ့ရ့ၭလီၫ.- တၭဖျါ လၩ့အထဲၩ့ ထီၩ့လၧမၫဆမံၭတၭ, အဒိၭအလၪလၧ",
			"12": "<sup>12</sup> ထံၫမိၡါလီၫ.- တၭနမၩလၩ့ဎီးအခိၪဒၧၩ့ၥံၪ, ဘဲၫၥိၭ ၦဖိၬဖၧၩ့ၥၭထီးအလူၬလဖၪ အၪ့ဒ့ၭဝ့ၫနီၪ, မွဲဘၪလဲၪ.",
			"13": "<sup>13</sup> တၭထိၭဖၫလၧမံၩ့လၬကျၩနီၪမၩဂၭဂီၩ့ဝ့ၫ, ဒဲဆၧဖိၪ ဆၧဎါအမံၩ့လၧဆၧပျၩ့ဖၧၩ့နီၪအၪ့ခွံၬဝ့ၫလီၫ.",
			"14": "<sup>14</sup> ဆၧၥုၭမုခမျၧးအယွၩဧ့, ဂဲၫထဲၩ့လါဆံၭ.ယိလၩ့ လၧမူၭခိၪတၭ, ယိလၩ့ခွါလၩ့တၭ, ဂဲၫအီၪၡီၩ့စဘံၭ",
			"15": "<sup>15</sup> မုလမု,- ဒဲစဘံၭမုအလးလၧနစူၪထွ့ၪၥုၪ့ဝ့ၫ, ဒဲဆၧအ",
			"16": "<sup>16</sup> ဖိၪလၧနဒုၭအီၪဂုးအီၪခၧၫ့လၧနဂးဒၪနဝ့ၫဆံၭ.- မ့ၪအၪ့ ခွံၬဝ့ၫ,ဘၪဆၧခူၬလၩ့ဂၭဂီၩ့ခွံၬဝ့ၫ လၧနမ့ၬအဆၧအၪ့ ၥီၪ့ဝ့ၫအကၠီၩ့လီၫ.",
			"17": "<sup>17</sup> မွဲနစူၪအီၪလၧၦဘၪဆဲၫ့ လၧနစူၪထွ့ၪအလီၩ့ၦၡၩ အဖိၪခွၫလၧနဒုၭဆီၪ့ထၪ့အဂဲးအဘၭ လၧနနၫ့ဆါဒၪ",
			"18": "<sup>18</sup> နဝ့ၫအဂးအလီၩ့နီၪဆံၭ.- ပမိထဲၩ့ထဲၩ့အ့ၬ. မၩမၧၫ့",
			"19": "<sup>19</sup> ထၪ့ထဲၩ့ပၧၩဆံၭ.- တၭပမိကဲၪထၪ့နမံၩ့လီၫ.- ယ ဟိဝၩ,ဆၧၥုၭမုခမျၧးအယွၩဧ့, ဒုၭဂဲၫထဲၩ့ပၧၩတၭ, ဒုၭ ဖၩ့ထၪ့နမ့ၬဆံၭ. တၭပမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ ထဲၩ့ပၧၩအလးလီၫ."
		},
		"81": {
			"1": "<sup>1</sup> ၥံၫကျံၩၥီၫထၪ့လၧယွၩ, ပဂဲးပဘၭ, ကိၭၡၭၥၭထိၬ",
			"2": "<sup>2</sup> လါလၧစယၫကူၭအယွၩဆံၭ.- ဆိၬထၪ့ဆၧၥံၫကျံၩ,",
			"3": "<sup>3</sup> ၦဖိၬဒိၩ့ၥံၪစံၭဆၧၫ့ဆၧ, နါဒံၩ့မုၬ,ဒဲၥၫ့ထီး,- အူၪထၪ့ ခွ့ၩလၧလၩထၪ့ၥၫ့း လၧလၩဎွ့ၩအနံၩ,လၧပမၩဘိၪ့ ဆံၫ့ဎံၪအနံၩနီၪဆံၭ.",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩအနီၪမွဲၥနိၫ လၧအံၫစရ့လၭအဂး,",
			"5": "<sup>5</sup> ဆၧစ့ၩရၫ့လၧစယၫကူၭ အယွၩအဖၧၩ့လီၫ.- တၭထီး အစဲၪ့ထၪ့ခွံၬလၧအံဇံၭအဖၧၩ့, ယနါဂၧၫ့ဆၧအလၨ လၧယနၪလၥ့ၪဘၪ, အီၪက့ၪဝ့ၫလၧစယိၥၭအဖၧၩ့လၧ",
			"6": "<sup>6</sup> ဆၧထိးအၥၭအဂးလီၫ.- ယၥုၭခွံၬယခိၬထံၭလၧဆၧ",
			"7": "<sup>7</sup> ယိၭအဖၫ့လၬ,မၩဖီၩ့မၩဖျ့ၭအစူၪလၧဒၩ့လီၫ.- လၧန ဘၪဆၧခိဆၧဝီၩနီၪနကိၭထၪ့တၭ, ယမၩဖီၩ့မၩဖျ့ၭနၧၩ ယစံၭဆၧၫ့နၧၩ လၧလၫ့ဎွံၩ့အလးအီၪၥူၪတၭ, ယမၩ ခွါနၧၩထီးထံၫစမ့ရဘၫလီၫ. (စ့လၫ.)",
			"8": "<sup>8</sup> ခိၭနၪ, ယၡၩခမျၧးၥံၪဧ့, နအ့ၪခိၭနၪယလူတၭ,ယ",
			"9": "<sup>9</sup> မိထိးယၥၭလၧနဂဲးနကၠီၪ့, အံၫစရ့ၭလၭဧ့,- မွဲပလခီၫ ဘၩ့မုးဖိၪအယွၩ ထီးအီၪလၧနၥံၪအကျၩလဂ့ၩတၭ, မွဲနၥံၪထီးဘိၪ့ထၪ့ဘၩထၪ့ ၦလခီၫဘၩ့မုးဖိၪအယွၩနီၪ",
			"10": "<sup>10</sup> လဂ့ၩ.- ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩ,နယွၩလၧအဒုၭ စဲၪ့ထၪ့ခွံၬနၧၩလၧအံဇံၭအခးဖၧၩ့လီၫ. အၩ့ထၪ့နနိၭ",
			"11": "<sup>11</sup> အ့ၪလဲဆံၭးတၭယမိမၩဎွ့ၩလီၫ.- မွဲလါနၫ့တၭယၡၩ ခမျၧးလခိၭနၪဘၪ ယလူယထၫတၭ, အံၫစရ့လၭဘၪ",
			"12": "<sup>12</sup> အၥၭ လၧယၧၩဆ့အ့ၬ.- တၭယဖ့ၪလၫ့ခွံၬ အဝ့ၫၥံၪ လၧအမၩနၧၩ့ထၧၫ့အၥၭအဖၧၩ့တၭ, အဝ့ၫၥံၪလ့ၩဝ့ၫ လၧဆၧကိၪ့ထၪ့ဖၭလၩ့ဒၪဝ့ၫအဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> ယၡၩခမျၧးအ့ၪခိၭနၪယလူ အံၫစရ့လၭအ့ၪဖိၬယ",
			"14": "<sup>14</sup> ဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭတၭ,- လၧလဆိဖိၪအထးဖၧၩ့နီၪ, ယမိ ဒုၭဆၪ့လၩ့အဝ့ၫၥံၪအဒုၪအဒၩ, ဒဲအီၪက့ၪထဲၩ့ဒီၭယ",
			"15": "<sup>15</sup> စူၪလၧၦထၫ့ဒုၪဒၩအဝ့ၫၥံၪအလီၩ့လီၫ.- ၦလၧအမ့ၬ လဲၩယဟိဝၩနီၪ ကျဲၩ့ဆၪ့လၩ့အၥၭ လၧအဖၫ့လၬ တၭးအံၫစရ့လၭအဆၧၫ့အထီ မိအီၪလၩ့ဆိၩလၩ့",
			"16": "<sup>16</sup> ကၠၪလီၫ.- တၭအဝ့ၫဒၪမိဒုၭအၪ့အဝ့ၫၥံၪဆ့ လၧဘုၪ ကၠိၩ့အဂ့ၩထုၬ, ဒဲဒုၭဘျဲၩအၪ့ဝ့ၫ လၧန့ၫစၩ့လၧလဲၫ့မု အဖၧၩ့လီၫ."
		},
		"82": {
			"1": "<sup>1</sup> ယွၩဆၧၫ့ထုၪ့လၧၦဆီၪ့လဂၩနီၪ အဆၧအီၪကီၪ့အ",
			"2": "<sup>2</sup> ကျၩ,လၧယွၩလဖၪအကျၩနီၪစ့ၩရၫ့ဆၧလီၫ.- နၥံၪမိ စ့ၩရၫ့ဆၧလတီၩဘၪ, ဒဲယိမ့ၬၦလတီၩလလီၩ့ဘၪနီၪ",
			"3": "<sup>3</sup> ဆံၭယံၬလဲၪ.(စ့လၫ.)- စ့ၩရၫ့တီၩန့ၦၡၪ့ဖိၪယၬဖိၪ, ဒဲၦဖိၪဎွ့ၪၥံၪး ဒဲအီၪက့ၪတီၩအီၪက့ၪလီၩ့ၦဘၪၡၪ့ဘၪ",
			"4": "<sup>4</sup> နၭဒဲၦၡၪ့ဖိၪယၬဖိၪနီၪဆံၭ.- မၩဖီၩ့မၩဖျ့ၭၦဘၪၡၪ့ ဘၪနၭ,ဒဲၦန့ဆၧအလးအီၪတၭ, မၩဖျ့ၭထၪ့အဝ့ၫၥံၪ လၧၦလတီၩလလီၩ့ဘၪအစူၪဖၧၩ့နီၪဆံၭ.",
			"5": "<sup>5</sup> အဝ့ၫၥံၪလၥ့ၪယၫဘၪဆၧတၭ, နၪဆၧၥ့ၪဆ့အ့ၬ. အဝ့ၫၥံၪဖိၬအဖၧၩ့ၥၭဒၪဝ့ၫ လၧဆၧခံၭကျၩလီၫ. ဂၪ့",
			"6": "<sup>6</sup> ခိၪအခၪ့ထံၭဝၭဝ့ၫထီးအလူၬလီၫ.- ယဝ့ၫဒၪယီၩယ စံၭယူၭ, နၥံၪမွဲယွၩလဖၪ, ဒဲနၥံၪထီးအလူၬမွဲဆၧထၪ့",
			"7": "<sup>7</sup> ထီၫထုၬလဂၩနီၪအဖိၪခွၫၥံၪလီၫ.- မွဲလါနၫ့တၭ,နၥံၪ မိၥံၫဘဲၫၦၡၩအၥိၭတၭ, လၩ့ထံၩဖါဘဲၫၦလဂၩလၧၦ",
			"8": "<sup>8</sup> ဒိၪဖၭဒိၪအကျၩအၥိၭနီၪလီၫ.- ယွၩဧ့, ဂဲထုၪ့နဝ့ၫစ့ၩ ရၫ့ၦဂၪ့ခိၪဖိၪဆံၭး အဂဲးဘဲၫယီၩနမိန့ၥၫဆၧလၧၦ ကိၭဆၨၩဒ့ၭအကျၩလီၫ."
		},
		"83": {
			"1": "<sup>1</sup> ယွၩဧ့, ထီးအီၪလၩ့မါပံၭလဂ့ၩ, အီၪထီၫ့ဒီၪ့လ ဂ့ၩ,အီၪပွံၭလဂ့ၩ,ယွၩဧ့.",
			"2": "<sup>2</sup> အဂဲးဘဲၫယီၩနဒုၪနဒၩၥံၪ တုၩ့ထၪ့တုၩ့လၩ့တၭ,",
			"3": "<sup>3</sup> ၦလၧအမ့ၬလဲၩနၧၩလဖၪနီၪ မိၬထၪ့အခိၪလီၫ.- တၭ အဝ့ၫၥံၪကိၪ့ထၪ့ ဆၧအၪ့လီၫထၫ့ဒုၪဒၩနၡၩခမျၧး,ဒဲ ကိၪ့ထၪ့ဖၭလၩ့လိၬအၥၭ ထၫ့ဒုၪဒၩၦလၧနပၧၩ့ဘၪဝ့ၫ",
			"4": "<sup>4</sup> လဖၪနီၪလီၫ.- တၭအဝ့ၫၥံၪစံၭဝ့ၫ, ဂဲၫဘီၪ,မၩဂၭဂီၩ့ ခွံၬၡီၩ့အဝ့ၫၥံၪဆံၭ. ဘဲၫၥိၭ အထီးကဲၪလၧၩ့ ၦလ ဆၨၩလဂ့ၩး ဒဲဘဲၫၥိၭ ၦအထီးဎွံၩ့ဘၪလၧၩ့ အံၫစရ",
			"5": "<sup>5</sup> လၭအမံၩ့ လဂ့ၩလီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪကိၪ့ လိၬအၥၭလဖျိၪ့ဎးတၭ, အုၩ့လၩ့ဆၧထၫ့ဒုၪဒၩနၧၩ,",
			"6": "<sup>6</sup> တဲၩလဖၪ ဘၪဆဲၫ့လၧအံဒၧၫ့, ဒဲၦအံၡမၫအ့လၭဖိၪ,",
			"7": "<sup>7</sup> ဒဲမိအၭဒဲၦဟၫဂၫဖိၪး- ဂံဘလၭ, ဒဲအၫမၧၫ, ဒဲအၫမ",
			"8": "<sup>8</sup> လ့ၭ,ဒဲၦဖလံၡၫဖိၪဒဲၦတဲအၫဖိၪနီၪလီၫ.- အၭၡၧၫဆ့ ဘုၭထၬ လၧအဝ့ၫၥံၪလီၫ. မွဲဝ့ၫလၧစလီၭအဖိၪခွၫၥံၪ အစူၪဒူၪလီၫ.(စ့လၫ.)",
			"9": "<sup>9</sup> တၭမၩအဝ့ၫၥံၪဘဲၫၦမံဒအၫ့ဖိၪအၥိၭ, ဘဲၫစစံစရၫ",
			"10": "<sup>10</sup> အၥိၭ ဘဲၫစယၫဘံၪ့လၧထံၫချိၬကံၡၧၫ့,- လၧအဘၪ ဆၧမၩဂၭဂီၩ့ဝ့ၫ လၧအံၪ့ဒီၫအၥိၭနီၪဆံၭ. တၭအဝ့ၫ",
			"11": "<sup>11</sup> ၥံၪကဲၪထၪ့ဝ့ၫလၧဆၧအ့ၪလၧဂၪ့ခိၪအဂးလီၫ.- တၭ အီၪက့ၪအၦဒိၪဖၭဒိၪ ဘဲၫစအိရ့ၭအၥိၭ, ဒဲဘဲၫစဇံ အ့ၭအၥိၭ, ဒဲအခိၪလဖၪထီးအလူၬ ဘဲၫစဇံဘၫအၥိၭ,",
			"12": "<sup>12</sup> ဒဲဘဲၫစဇၫလမၧၫနၫအၥိၭ,- လၧအစံၭ, မွဲပမၩန့ၡီၩ့",
			"13": "<sup>13</sup> ယွၩအီၪဝ့ၫအလးလဖၪလၧပဂးဒၪပဝ့ၫဆံၭ.- ယယွၩ ဧ့, အီၪက့ၪအဝ့ၫၥံၪဘဲၫဖ့ၫအၥိၭ, ဘဲၫလီခၫ့မုၬၥဝံၬအ",
			"14": "<sup>14</sup> ၥၭအၥိၭနီၪဆံၭ.- ဘဲၫမ့ၪအၪ့ၥံၪ့လဝၩ့အၥိၭ, ဒဲဘဲၫ",
			"15": "<sup>15</sup> မ့ၪလၪဆူၭခဲၩထၪ့ခိၪလီၩ့ထိၩ့ချိၬအၥိၭနီၪ.- တၭလီၩ့ ဆီးအဝ့ၫၥံၪလၧနလံၩမုလဖုၬဘဲၫနီၪၥိၭ, ဒဲမၩၥၭမဲၪ",
			"16": "<sup>16</sup> အဝ့ၫၥံၪလၧနလံၩၥဝံၭနီၪဆံၭ.- မၩဎွ့ၩအဝ့ၫၥံၪအမ့ၬ လၧဆၧမ့ၬမဲတၭ, အဝ့ၫၥံၪမိအၪ့ဎၬနမံၩ့, ယဟိဝၩဧ့,",
			"17": "<sup>17</sup> အမ့ၬမိမဲတၭ, မိၥၭမဲၪၥၭဖျဲၩ့ဆၧလၩ့ဆိၩလၩ့ကၠၪ",
			"18": "<sup>18</sup> တၭ,မွဲအဘၪဆၧမ့ၬမဲ,ဒဲဂၭဂီၩ့ဆံၭ.- တၭအဝ့ၫၥံၪမိ ၥ့ၪယၫလၧနဝ့ၫဒၪ, နမံၩ့မွဲယဟိဝၩလဂၩဎး, ဆၧထၪ့ ထီၫထုၬလဂၩ လၧဂၪ့ခိၪထီးအလူၬအဖၫ့ခိၪလီၫ."
		},
		"84": {
			"1": "<sup>1</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩဧ့, နအီၪအလးလဖၪနီၪ",
			"2": "<sup>2</sup> အီၪလၧဆၧအဲၪဆၧကွံၩဆံၭဒိၪလဲၪၬ- တၭယဆိၫ့လၧ ယမိန့ဘၪယဟိဝၩအနီးအဝၩ့လဖၪနီၪ ထီးယၥၭလၩ့ ဘဲၩမၬလီၫ. ယၥၭဒဲယဖံၭယယၪကိၭထၪ့ယွၩလၧ",
			"3": "<sup>3</sup> အမၧၫ့ဝ့ၫလဂၩနီၪလီၫ.- ထိၪဎွံၭဒၪလ့ၬ ဒၪန့အဂံၪ့း ထိၪမးလံၫ့နီၪ အီၪလၧအၥွံၫလၧအဂးဒၪဝ့ၫ ထီးအမိ အီၪက့ၪလၩ့အဖိၪလီၫ. တၭအလးနီၪ, ဆၧၥုၭမုခမျၧး အယဟိဝၩ, ယစဎွၩ, ဒဲယယွၩဧ့,မွဲနဆၧလုအလးလ",
			"4": "<sup>4</sup> ဖၪနီၪလီၫ.- ၦလၧအအီၪဂုးခၧၫ့ဝ့ၫလၧနဂံၪ့ဖၧၩ့နီၪဘၪ ဆိၪဂ့ၩဝ့ၫလီၫ.း အဝ့ၫၥံၪမိစံၭထၪ့အၪ့အူၭနၧၩ လထံၪ",
			"5": "<sup>5</sup> ဎးလဘီၩ့ဎးလီၫ.- ၦလၧအဂဲးအဘၭအီၪဝ့ၫလၧနဖၧၩ့,",
			"6": "<sup>6</sup> လၧအၥၭအီၪလၧဎနၭ ဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭနီၪး- လၧအဖိၬ ဖၧၩ့ၥၭလၧမ့ၬထံၫ အခိၪလီၩ့ဆူၭဖၧၩ့, ဒဲဒုၭကဲၪဝ့ၫ လၧထံၫထၪ့ဖျိၭအလးနီၪ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ. မွဲမၬ, ဆၧဂဲၫဆၧၩ့ဆိၫနီၪ လုၬဘံၭဝ့ၫလၧဆၧဆိၪဂ့ၩလဖၪ",
			"7": "<sup>7</sup> လီၫ.- အဝ့ၫၥံၪနီၪဒံၩ့လ့ၩဆၧ, အဂဲးအဘၭဒံၩ့ဆီၪ့ ထၪ့တၭ,အီၪဖျီၪထၪ့ဝ့ၫလၧဇံအိၫ့အလီၩ့ လၧယွၩအ မ့ၬယၫကိၭဂၩဒ့ၭဆုၬဆုၬလီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩ, ဆၧၥုၭမုခမျၧးအယွၩဧ့,ခိၭနၪယဆၧဘၩ",
			"9": "<sup>9</sup> ဆိၪဖၪဆံၭ. စယၫကူၭအယွၩဧ့,ဒိၭနနါဆံၭ.- နဝ့ၫဒၪ, ပထၩ့ဖံၭလဘံၪ့ ယွၩဧ့, ယိလၩ့ခွါလၩ့ဆံၭ. တၭယိ",
			"10": "<sup>10</sup> လၩ့ၦလၧနဂုၪဝ့ၫလဂၩအမ့ၬနီၪဆံၭ.- အဂဲးဘဲၫယီၩ ပအီၪလၧနဝၩ့လဖၪအဖၧၩ့မုလနံၩနီၪ, ဂ့ၩနဲၪ့ပအီၪလၧ အဂူၫဂၩလစီၪ့ အနံၩလထီၫ့နီၪဒံၭလီၫ. လၧယယွၩ အဂံၪ့ဖၧၩ့နီၪယခိၭတရၫ့တၭ, ယအဲၪဒိၭအၪနဲၪ့အီၪ",
			"11": "<sup>11</sup> လၧဆၧအၧၩ့ဆၧၥၫ့အတဲၩလဖၪအဖၧၩ့နီၪလီၫ.- အ ဂဲးဘဲၫယီၩ ယဟိဝၩယွၩမွဲမုၥံၪလၩၥံၪ, ဒဲထၩ့ဖံၭလ ဘံၪ့လီၫ. တၭယဟိဝၩမိဖ့ၪလၫ့ဆၧအခိးအတၩ, ဒဲ ဆၧလၩဖၩ့လီၫ. တၭအဝ့ၫဒၪ ပဒၩ့ထၬဆၧဂ့ၩ လၧၦ",
			"12": "<sup>12</sup> လ့ၩဆၧလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩလဖၪနီၪနးမံၩ့အ့ၬ.- ဆၧၥုၭ မုခမျၧးအယဟိဝၩဧ့, ၦလၧအဒိၭနဲၩ့အၥၭ လၧနၧၩ နီၪဘၪဆိၪဂ့ၩဝ့ၫလီၫ."
		},
		"85": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့,ဆၧဘၪယူၭနၥၭလၧနထံၫနခး, နဒုၭဂဲၫ",
			"2": "<sup>2</sup> ထဲၩ့ယူၭ စယၫကူၭအဆၧအၪ့မၧၫ့ဎီးတၭ,- နမၩဖီၩ့ မၩဖျ့ၭယူၭ နၡၩခမျၧးလၧအဆၧအၧၩ့, နဖျါခွံၬယူၭ",
			"3": "<sup>3</sup> အဆၧဒဲၩဘၭထီးအလူၬလီၫ.(စ့လၫ.)- နထုၭထဲၩ့ ယူၭနၥၭထၪ့ထီးအလူၬတၭ, နကၠၪခွံၬယူၭနၥၭလၧ နၥၭထၪ့ခဲၩထၪ့အအီၪလီၫ.",
			"4": "<sup>4</sup> ပဆၧထိးထဲၩ့တၩ့ထဲၩ့အယွၩဧ့, ဒုၭဂဲၫထဲၩ့ပၧၩ",
			"5": "<sup>5</sup> တၭ,နၥၭထၪ့ပၧၩနီၪ ဒုၭထုၬခွံၬဆံၭ.- တၭမွဲနမိၥၭ ထၪ့ပၧၩလၩ့ဆိၩလၩ့ကၠၪနီၪဆ့ဧၪ. တၭနမိမၩယံၬ ထၪ့နၥၭထၪ့ထီၩ့လၩ့ လဆိၩဘၪလဆိၩ လဆိၩဘၪ",
			"6": "<sup>6</sup> လဆိၩဆ့ဧၪ.- တၭမွဲနမိဒုၭမၧၫ့ထၪ့ထဲၩ့ပၧၩ ဘဲၫၥိၭ",
			"7": "<sup>7</sup> နၡၩခမျၧးၥံၪမိၥၭထိၬလၧနဖၧၩ့အ့ၬဧၪ.- ယဟိဝၩဧ့, မွဲနဒုၭနဲၪပၧၩ လၧနခိးနတၩ, ဒဲဖ့ၪလၫ့ပၧၩ လၧနဆၧ ထိးထဲၩ့တၩ့ထဲၩ့နီၪဆံၭ.",
			"8": "<sup>8</sup> ၦၥ့ၪဆၧလူၬယဟိဝၩလဂၩနီၪ မိစံၭဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪ, ယမိခိၭနၪတၭ, အဂဲးဘဲၫယီၩမွဲအမိချဲၩ့ ဆၧမုၬလၩလၧအခ့ၫအၡၩခမျၧး ဒဲအၡၩဆံၫ့ဎံၪၥံၪအ ဂးလီၫ. မွဲလါနၫ့တၭ, မွဲအဝ့ၫၥံၪထီးထဲၩ့ထဲၩ့လၧဆၧ",
			"9": "<sup>9</sup> ပျီၩပျီၩအအီၪနီၪလဂ့ၩ.- မွဲမၬ, အဆၧမၩဖီၩ့မၩဖျ့ၭ အီၪဘူၭလၧၦလၧအၥၭမဲၪအဝ့ၫ ဘဲၫၥိၭဆၧလၩဖၩ့မိ",
			"10": "<sup>10</sup> အီၪလၧပထံၫပခးလီၫ.- တၭဆၧယၫ့ၥုၪ့ယၫ့ၥၭဒဲဆၧ မွဲဆၧတီၩဘၪခီၩ့လိၬအၥၭ, ဆၧတီၩဆၧလီၩ့ဒဲဆၧမုၬ",
			"11": "<sup>11</sup> ဆၧလၩအဲၪဂါလိၬအၥၭလီၫ.- တၭဆၧမွဲဆၧတီၩမဲၪ ထၪ့လၧဂၪ့ခိၪအဖၧၩ့ ဒဲဆၧတီၩဆၧလီၩ့ ယိလၩ့လၧမူၭ",
			"12": "<sup>12</sup> ခိၪလီၫ.- မွဲမၬ, ယဟိဝၩမိဖ့ၪလၫ့ဆၧဂ့ၩဆၧဘွၩဆ့,",
			"13": "<sup>13</sup> ဒဲပဂၪ့ခိၪမိဖ့ၪလၫ့အဆၧအၪထၪ့နီၪလီၫ.- ဆၧတီၩဆၧ လီၩ့မိလ့ၩလၧအမ့ၬယၫတၭ, မိဒုၭကဲၪထၪ့ဖၧၩ့ၥၭလ ဘီၩ့လၧအခၪ့ယဲးလၩ့အလးလီၫ."
		},
		"86": {
			"1": "<sup>1</sup> ဒိၭနနါယဟိဝၩဧ့, ခိၭနၪယလူဆံၭ. အဂဲးဘဲၫယီၩ",
			"2": "<sup>2</sup> ယဘၪၡၪ့ဘၪနၭ, ဒဲယန့ဘၪဆၧအလးအီၪလီၫ.- ယိ လၩ့ခွါလၩ့ယၥၭမၧၫ့ဆံၭး အဂဲးဘဲၫယီၩ ယမွဲၦလၧ ဆၧအဲၪဝ့ၫလဂၩး နဝ့ၫဒၪယယွၩဧ့, ထိးထဲၩ့တၩ့ထဲၩ့",
			"3": "<sup>3</sup> နခ့ၫနၡၩလၧအဒိၭနဲၩ့အၥၭလၧနၧၩဆံၭ.- ယၫ့ၥုၪ့ ယၫ့ၥၭယၧၩဆံၭး ကဆါဧ့, အဂဲးဘဲၫယီၩယကိၭထၪ့",
			"4": "<sup>4</sup> နၧၩကိၭမုနံၩမုနၩဒ့ၭလီၫ.- မၩၥၭထိၬနခ့ၫနၡၩအၥၭ ဆံၭ.အဂဲးဘဲၫယီၩ ယဆိၬထၪ့ယၥၭလၧနအီၪလီၫ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ ကဆါဧ့, နဝ့ၫဒၪနမွဲဆၧဂ့ၩ, ဒဲနမၩဖီၩ့ မၩဖျ့ၭဆၧတၭ, နခိးနတၩအၪဝ့ၫ လၧကယဲၦလၧအ ကိၭထၪ့နၧၩထီးအလူၬအဂးလီၫ.",
			"6": "<sup>6</sup> ယဟိဝၩဧ့,ခိၭနၪယဆၧဘၩဆိၪဖၪတၭ, ဒိၭနနါ",
			"7": "<sup>7</sup> လၧယအၪ့ကံၩ့ဆၧအၥီၫနီၪဆံၭ.- လၧယဘၪဆၧခိ ဆၧဝီၩအမုလနံၩနီၪ, ယကိၭထၪ့နၧၩလီၫ. အဂဲးဘဲၫ ယီၩနမိခိၭနၪယလူလီၫ.",
			"8": "<sup>8</sup> ကဆါဧ့, လၧယွၩလဖၪအကျၩနီၪ,ၦဘဲၫနၧၩအၥိၭ အီၪအ့ၬး တၭဆၧမၩလဖၪဘဲၫနမၩဆၧအၥိၭနီၪအီၪ ဝ့ၫနးမံၩ့အ့ၬ.",
			"9": "<sup>9</sup> ကယဲၦဆၨၩလၧနမၩကဲၪထၪ့ဝ့ၫ ထီးအလူၬလဖၪ နီၪမိဂဲၫတၭ, ဘိၪ့ဆၧဘၩဆၧလၧနမ့ၬယၫ, ကဆါဧ့,",
			"10": "<sup>10</sup> ဒဲမိမၩလၩမၩဖၩ့နမံၩ့လီၫ.- အဂဲးဘဲၫယီၩနမွဲဆၧအ ဒိၪ,ဒဲမၩဆၧလၩ့လၭၥံၪး နမွဲယွၩလဂၩဎးလီၫ.",
			"11": "<sup>11</sup> နဲၪလိၪယၧၩလၧနဖၧၩ့ၥၭဆံၭး ယဟိဝၩဧ့း ယမိ လ့ၩဆၧလၧနဆၧမွဲဆၧတီၩအဖၧၩ့လီၫ. ဒုၭထံးယၥၭ",
			"12": "<sup>12</sup> လဖျိၪ့ဎးဘဲၫၥိၭယမိၥၭမဲၪနမံၩ့နီၪဆံၭ.- ကဆါ,ယ ယွၩဧ့,ယမိစံၭထၪ့အၪ့အူၭနမံၩ့ လၧယၥၭထၧၫ့ဖျိၪ့ ယၫတၭ, ယမိမၩလၩမၩဖၩ့နမံၩ့ လၩ့ဆိၩလၩ့ကၠၪ",
			"13": "<sup>13</sup> လီၫ.- အဂဲးဘဲၫယီၩ နမၩခိးမၩတၩယၧၩ ဒိၪမၬတၭ, နမၩဖီၩ့မၩဖျ့ၭယၧၩလၧဖျႃယိၬအဖၧၩ့လီၫ.",
			"14": "<sup>14</sup> ယွၩဧ့, ၦအီၪက့ၪအၥၭထၪ့ထီၫလဖၪ ဂဲထုၪ့ထၫ့ဒုၪ ဒၩယၧၩတၭ, ၦမၩၥၭမဲၪၥၭဖျဲၩ့ဆၧအဆၧအီၪကီၪ့နီၪ အၪ့ဎၬယၥၭတၭ, အီၪက့ၪနၧၩလၧအမ့ၬယၫဆ့အ့ၬ.",
			"15": "<sup>15</sup> အ့ၪမွဲနဝ့ၫဒၪ, ကဆါဧ့, နမွဲယွၩလဂၩလၧအၥၭအီၪ ဆၧ,ဒဲယၫ့ၥၭဆၧ, အွံၪၥၭဆၧၩ့ဆၧယံၬ, ဒဲအီၪလၧဆၧ ဂ့ၩဆၧဘွၩ, ဒဲဆၧမွဲဆၧတီၩ လၧအဒိၪအအၪလီၫ.",
			"16": "<sup>16</sup> ကၠၪနၥၭလၧယအီၪတၭ, ယၫ့ၥၭယၧၩဆံၭ. ဖ့ၪလၫ့န ဂဲးနဘၭလၧနခ့ၫနၡၩတၭ, မၩဖီၩ့မၩဖျ့ၭနခ့ၫနၡၩမုၪ",
			"17": "<sup>17</sup> အဖိၪခွၫဆံၭ.- တၭအီၪက့ၪဆၧမၩနဲၪ့ လၧဆၧဂ့ၩအ ဂးလၧယၧၩဆံၭ. ၦလၧအမ့ၬလဲၩယၧၩလဖၪနီၪ မိဒၪဘၪတၭ, အမ့ၬမိမဲဝ့ၫနီၪ, အဂဲးဘဲၫယီၩနဝ့ၫဒၪ, ယဟိဝၩဧ့, နမၩဆၧၩ့ယူၭယၧၩယူၭ, ဒဲမၩမုၬထၪ့ ထဲၩ့ယူၭယၧၩလီၫ."
		},
		"87": {
			"1": "<sup>1</sup> အခၪ့ထံၭနီၪအီၪဝ့ၫ လၧခိၪလီၩ့ဆံၫ့ဎံၪလဖၪအလီၩ့",
			"2": "<sup>2</sup> လီၫ.-ယဟိဝၩအဲၪဇံအိၫ့ အတရၫ့လဖၪ ဒိၪနဲၪ့ယၫ",
			"3": "<sup>3</sup> ကူၭအီၪဝ့ၫအလးထီးအလူၬဒံၭလီၫ.- ဆၧချဲၩ့လၧနဂဲး နကၠီၪ့အီၪဝ့ၫလၧအလၩအဖၩ့, ယွၩအဒိၩ့ဧ့, (စ့လၫ.)",
			"4": "<sup>4</sup> တၭယမိလီၩဘၪရၫဟၭ, ဒဲဘၭဘလၧၫ့လၧၦလၧ အၥ့ၪယၫယၧၩလဖၪအကျၩလီၫ. ယိခွါ,ဖလံၡၫဒဲတဲ အၫ,ဒဲကုၡၫနီၪ, ၦၡၩလဂၩယီၩအီၪဖျဲၪထီးနီၪလီၫ.",
			"5": "<sup>5</sup> တၭၦၡၩစံၭလၧဇံအိၫ့အဂဲးအကၠီၪ့နီၪ, ၦၡၩအယီၩ လဂၩ,ဒဲၦၡၩအနီၪလဂၩ အီၪဖျဲၪဝ့ၫလၧအဖၧၩ့တၭ, ဆၧထၪ့ထီၫထုၬအနၫ့ဆါဒၪဝ့ၫ မိဒုၭအီၪဂုးအီၪခၧၫ့ဝ့ၫ",
			"6": "<sup>6</sup> ဒၪလီၫ.- တၭထီးယဟိဝၩကွ့ၭၦၡၩခမျၧးအမံၩ့တၭ, မွဲအမိဝံထၪ့နၬထၪ့ဝ့ၫ ၦလဂၩယီၩ အီၪဖျဲၪဝ့ၫထီးနီၪ လီၫ.(စ့လၫ.)",
			"7": "<sup>7</sup> တၭၦၥံၫကျံၩဆၧ, ဒဲၦအူၪဆၧဒဲၦဒံၩ့ဆၧစံၭဝ့ၫ,ယ ထံၫထၪ့ဖျိၭအလးအီၪဝ့ၫ လၧနဖၧၩ့ထီးအလူၬလီၫ."
		},
		"88": {
			"1": "<sup>1</sup> ယဟိဝၩ,ယဆၧထိးထဲၩ့တၩ့ထဲၩ့အယွၩဧ့, လၧမု",
			"2": "<sup>2</sup> ဆၫဆၫ,မုနၩနၩနီၪ, ယကိၭထၪ့လၧနမ့ၬယၫလီၫ.- မွဲ ယဆၧဘၩဆိၪဖၪဂဲၫနုၬလါလၧနမ့ၬယၫဆံၭ. ဒိၭနနါ",
			"3": "<sup>3</sup> လၧယကိၭထၪ့ဆၧဆံၭ.- အဂဲးဘဲၫယီၩယၥၭဎွ့ၩလၧ ဆၧမၩခိမၩဝီၩတၭ, ယၥၭမၧၫ့အီၪဘူၭလၧဖျႃဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> တၭဆၧအီၪက့ၪယၧၩ လၧၦလၧအလ့ၩလၩ့လၧ ဆၧဖၧၩ့နီၪအကျၩ, ယမၩယၥၭဘဲၫၦၡၩလဂၩလၧ အဂဲးအဘၭလအီၪဘၪအၥိၭနီၪလီၫ.",
			"5": "<sup>5</sup> ယဘၪဆၧစဲၪ့ဒၪယၧၩ လၧၦၥံၫအကျၩတၭ,ဘဲၫၦ လၧအဘၪဆၧမၩၥံၫဝ့ၫလဖၪနီၪ အီၪဝ့ၫလၧဆၧၥွၫခိၪ ဖၧၩ့,လၧနလနၪ့ထၪ့ထဲၩ့လၧၩ့ဘၪတၭ, အဝ့ၫၥံၪဘၪ",
			"6": "<sup>6</sup> ဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလၧနစူၪဖၧၩ့နီၪလီၫ.- နအီၪက့ၪလၩ့ ယၧၩလၧဆၧဖၧၩ့ အယိၬထုၬလၧဆၧခံၭကျၩ,လၧထံၫ",
			"7": "<sup>7</sup> ယိၬလဖၪအဖၧၩ့လီၫ.- တၭနဆၧၥၭထၪ့အီၪဎၧၫ့လၧ ယလီၩ့, နမၩၡၪ့မၩနၭယၧၩ လၧနလပီၩဘွၩခိၪထီး",
			"8": "<sup>8</sup> အလူၬလီၫ.(စ့လၫ.)- ၦလၧအၥ့ၪယၫယၧၩလဖၪနီၪ, နဒုၭအီၪယဲၩ့လၧယၧၩး နအီၪက့ၪယၧၩ လၧဆၧၥၭ လိၪလၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ. ယဘၪဆၧစၧၩ့ထၬ",
			"9": "<sup>9</sup> တၭယဂဲၫထၪ့လၧခီၫၥ့ၪအ့ၬ.- ယမ့ၬၥၪလၩ့အိၫ့လၧ ဆၧၡၪ့ဆၧနၭအကၠီၩ့လီၫ. ယဟိဝၩဧ့,ယကိၭထၪ့နၧၩ",
			"10": "<sup>10</sup> ၥံၫ့နံၩချီၩ့း ယယူၬထၪ့ယစူၪလၧနအီၪလီၫ.- မွဲနမိမၩ လၩ့လၭဆၧလၧၦၥံၫအမ့ၬယၫနီၪဆ့ဧၪ. တၭၦလၩ လဖၪမိဂဲထုၪ့ စံၭထၪ့အၪ့အူၭနၧၩဆ့ဧၪ. (စ့လၫ.)",
			"11": "<sup>11</sup> တၭပမိလီၩလၩ့လၬလၩ့ နဆၧအဲၪအခိးအတၩလၧ ဆၧၥွၪခိၪဖၧၩ့, ဒဲနဆၧမွဲဆၧတီၩလၧဆၧဂၭဂီၩ့အဖၧၩ့",
			"12": "<sup>12</sup> နီၪဆ့ဧၪ.- တၭမွဲနဆၧလၩ့လၭလဖၪ မိအီၪဖျီၪလၧဆၧ ခံၭကျၩ, ဒဲနဆၧတီၩဆၧလီၩ့ လၧဆၧၥၭနၪ့အခးဖၧၩ့",
			"13": "<sup>13</sup> ဆ့ဧၪ.- ယဝ့ၫဒၪယီၩ,ယကိၭထၪ့နၧၩ, ယဟိဝၩဧ့, လၧဂီၩလခီၫ ယဆၧဘၩဆိၪဖၪနီၪမိထီၩ့လၧနမ့ၬယၫ",
			"14": "<sup>14</sup> လီၫ.- ယဟိဝၩဧ့, မွဲဘၪနီၫလၧနခွံၬၡိၭယၥၭလဲၪ,ဒဲန",
			"15": "<sup>15</sup> အီၪက့ၪၥူၪခွံၬနမ့ၬ လၧယၧၩမွဲဘၪလဲၪ.- ယဘၪဆၧ ၡၪ့ဆၧနၭတၭ, ခီၫလၧယၥၭဘၪ့ခီးဘိၩ့နဲၪ့ယီၩ လၩ့ ဘူၭလၧယမိၥံၫလီၫ. ယဘၪနဆၧမၩၥၭမဲၪၥၭဖျဲၩ့တၭ,",
			"16": "<sup>16</sup> ယၥၭလူၬလီၫ.- တၭနၥၭထၪ့ဆီၪ့ လ့ၩဘၪယဖၫ့ခိၪ,",
			"17": "<sup>17</sup> နဆၧၥၭမဲၪၥၭဖျဲၩ့နီၪမၩဂၭဂီၩ့ယၧၩလီၫ.- တၭအဝ့ၫ ၥံၪအီၪဝၬဖီၩ့ယၧၩ ဘဲၫထံၫအၥိၭ ၥံၫ့နံၩချီၩ့တၭ, ဝၩ့",
			"18": "<sup>18</sup> ထၬယၧၩလစီၪ့ဎးလီၫ.- တၭၦအဲၪယၧၩ, ဒဲယထံၩယ ၥိၭနီၪ နဒုၭအီၪယဲၩ့လၧယၧၩလီၫ. ၦၥ့ၪယၫယၧၩနီၪ အီၪဝ့ၫလၧဆၧခံၭကျၩလီၫ."
		},
		"89": {
			"1": "<sup>1</sup> ယမိၥံၫကျံၩထၪ့ ယဟိဝၩအဆၧယၫ့ၥၭလဖၪလၩ့ ဆိၩလၩ့ကၠၪ, ယမိဒုၭၥ့ၪယၫနဆၧမွဲဆၧတီၩလၧၦလ ဆိၩဘၪလဆိၩ, လဆိၩဘၪလဆိၩ လၧယနိၭလီၫ.",
			"2": "<sup>2</sup> အဂဲးဘဲၫယီၩ ယစံၭယူၭဆၧယၫ့ၥၭနီၪမိအီၪဂုးအီၪ ခၧၫ့အဆိၩဆိၩ အကၠၪကၠၪလီၫ. တၭလၧမူၭခိၪနီၪ, နဆၧမွဲဆၧတီၩ နအီၪက့ၪဂုးအီၪက့ၪခၧၫ့ လၧအဖၧၩ့",
			"3": "<sup>3</sup> လီၫ.- ယအုၩ့လၩ့ဆၧ လၧယၡၩဘၪရွံန့လဂၩအဂး",
			"4": "<sup>4</sup> တၭ,ယဆိၪလၩ့ယၥၭလၧယခ့ၫယၡၩစဒၫဝံၭ.- ယမိ ဒုၭအီၪဂုးအီၪခၧၫ့နချံၫနၥၪ လၩ့ဆိၩလၩ့ကၠၪ, ဒဲမၩ ထၪ့နလးဆီၩ့ဆီ ထီၩ့လၩ့လဆိၩဘၪလဆိၩ လဆိၩ ဘၪလဆိၩလီၫ. (စ့လၫ.)",
			"5": "<sup>5</sup> တၭမူၭခိၪစံၭထၪ့အၪ့အူၭနဆၧလၩ့လၭ, ယဟိဝၩ ဧ့, မွဲမၬ, နဆၧမွဲဆၧတီၩဆ့လၧၦဆံၫ့ဎံၪ အဆၧအီၪ",
			"6": "<sup>6</sup> ကီၪ့အဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩမွဲပလၫအီၪလၧမူၭခိၪ နီၪဆၧယိဎီၩ့ လၧယဟိဝၩမိၥ့ၪလဂၩလဲၪ. မွဲပလၫ လၩ့ဂၬယဟိဝၩလၧဆၧအဆီၪ့အဖိၪခွၫၥံၪ အကျၩနီၪ",
			"7": "<sup>7</sup> လဂၩလဲၪ.- ယွၩမွဲဆၧၥၭမဲၪအလးဖၭဒိၪ လၧအၡၩ ဆံၫ့ဎံၪအဆၧအီၪကီၪ့အကျၩ, ဒဲဆၧၥၭမဲၪဖၭဒိၪအ",
			"8": "<sup>8</sup> လးလၧကယဲၦလၧအအီၪဝၬဖီၩ့ဝ့ၫအဖၫ့ခိၪလီၫ.- ယ ဟိဝၩဆၧၥုၭမုခမျၧးအယွၩဧ့, မွဲပလၫအီၪလၧအစီၩ့ အမၩ့ဘဲၫနၧၩ အၥိၭလဂၩလဲၪ, ယွၩဧ့, တၭနဆၧမွဲ",
			"9": "<sup>9</sup> ဆၧတီၩအီၪဝၬဖီၩ့နၧၩလီၫ.- နပၧၩ့မၫဆမံၭ အတုၩ့ ထၪ့တုၩ့လၩ့းထီးအလပီၩထၪ့တၭ, နဒုၭအီၪဂုးဖုးအ",
			"10": "<sup>10</sup> ဝ့ၫၥံၪလီၫ.- နဝ့ၫဒၪ, နမၩလၩ့ဘျ့ၭရၫဟၭ ဎအံဇံၭၭ ဘဲၫၦလၧအဘၪ ဆၧမၩၥံၫဝ့ၫအၥိၭနီၪ, နမၩလၩ့မု",
			"11": "<sup>11</sup> လၩ့ဖၭနဒုၪနဒၩလၧနစူၪဆီၪ့လီၫ.- တၭမူၭခိၪမွဲနဆၧ, ဂၪ့ခိၪဆ့မွဲနဆၧ, ဂၪ့ခိၪဒဲအဆၧလၧၫ့ဆၧဎွ့ၩလဖၪနီၪ,",
			"12": "<sup>12</sup> မွဲနအီၪက့ၪလၩ့အခၪ့ထံၭလီၫ.- တၭဆၧလၧမုဖၩ,ဒဲ မုခံၫ့နီၪ,မွဲနတဲၩ့လၩ့နဝ့ၫဆ့လီၫ. တၫဘီၫ ဒဲဟၧမၧၫ့",
			"13": "<sup>13</sup> ၥုၪ့ဎွံၫၥၭယီၫလၧနမံၩ့အဖၧၩ့လီၫ.- နစူၪအီၪလၧအဂဲး ဆီၪ့အဘၭဆီၪ့, နစူၪဆီၪ့, နစူၪထွ့ၪအီၪထၪ့ထီၫလီၫ.",
			"14": "<sup>14</sup> ဆၧတီၩဆၧလီၩ့, ဒဲဆၧစ့ၩရၫ့မွဲနလးဆီၩ့ဆီအခၪ့ထံၭ လီၫ.ဆၧယၫ့ၥၭ, ဒဲဆၧမွဲဆၧတီၩ လ့ၩလၧနမ့ၬယၫ လီၫ.",
			"15": "<sup>15</sup> ၦခမျၧးလၧအၥ့ၪယၫဆၧၥၭထိၬအပရၧၫ့နီၪ ဘၪဆိၪ ဂ့ၩဝ့ၫလီၫ. ယဟိဝၩဧ့, အဝ့ၫၥံၪမိလ့ၩဝ့ၫ လၧနမ့ၬအ",
			"16": "<sup>16</sup> ဆၧဖၩ့အကျၩလီၫ.- မိၥုၪ့ဎွံၫၥၭယီၫလၧနမံၩ့အဖၧၩ့ ၥံၫ့နံၩချီၩ့တၭ, မိဘၪဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫ လၧနဆၧ",
			"17": "<sup>17</sup> တီၩဆၧလီၩ့အဖၧၩ့နီၪလီၫ.- အဂဲးဘဲၫယီၩနဝ့ၫဒၪယီၩ နမွဲအဝ့ၫၥံၪအဂဲးအဘၭအဆၧလၩဖၩ့လီၫ. မွဲလၧနခိး နတၩအကၠီၩ့နီၪတၭ, ပနိၩ့ဘၪဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫ",
			"18": "<sup>18</sup> လီၫ.- အဂဲးဘဲၫယီၩပထၩ့ဖံၭလဘံၪ့ မွဲယဟိဝၩတၭ, ပစဎွၩနီၪမွဲအံၫစရ့လၭအဆၧဆံၫ့ဎံၪလဂၩလီၫ.",
			"19": "<sup>19</sup> ထီးနီၪလဖၧၫ့ နချဲၩ့ဆၧလၧနၡၩဆံၫ့ဎံၪလၧဆၧဒၪ ဆၧလၧယၫလခီၫတၭ, နစံၭ, ယအီၪက့ၪယူၭဆၧမၩ ဆၧၩ့လၧၦလၧအဂဲးဆီၪ့အဘၭဆီၪ့ လဂၩအလီၩ့ယူၭ တၭ, ယအီၪက့ၪထၪ့ထီၫယူၭ ၦဘၪဆၧရွံန့ဝ့ၫလၧၦ",
			"20": "<sup>20</sup> ခမျၧးအကျၩလဂၩယူၭ.- တၭယဒၪန့ယူၭယခ့ၫယၡၩ",
			"21": "<sup>21</sup> စဒၫဝံၭ, ယဂုၪယူၭအဝ့ၫလၧယၥိၪဆံၫ့ဎံၪယူၭ.- တၭ ယစူၪမိအီၪဂုးအီၪခၧၫ့ လၧအဝ့ၫဒၪး ယစူၪဒူၪမိဒုၭ",
			"22": "<sup>22</sup> ဆီၪ့ထၪ့ဝ့ၫဆ့လီၫ.- ဆၧအဒုၪအဒၩလမၩန့ဘၪဆၧ လၧအဝ့ၫနီၪတၭ, ဆၧအၧၩ့ဆၧၥၫ့အဖိၪခွၫမိမၩၡၪ့မၩ",
			"23": "<sup>23</sup> နၭဘၪအဝ့ၫနီၪဆ့အ့ၬ.- ယမိဒိၪလၩ့ထံၩဖါအဒုၪအ ဒၩလၧအမ့ၬယၫတၭ, ယမိကျီၪ့ၦလၧအမ့ၬလဲၩဝ့ၫလၧ",
			"24": "<sup>24</sup> ဆၧၡၪ့ဆၧနၭလီၫ.- တၭယဆၧမွဲဆၧတီၩ, ဒဲယဆၧ ယၫ့ၥၭမိအီၪလၧယၥိၭလီၫ. တၭအနိၩ့မိဘၪဆၧအီၪ",
			"25": "<sup>25</sup> က့ၪထၪ့ထီၫဝ့ၫလၧယမံၩ့အကၠီၩ့လီၫ.- တၭယအီၪက့ၪ အစူၪလၧမၫဆမံၭအဖၫ့ခိၪ, ဒဲအစူၪထွ့ၪလၧထံၫမိၡါ",
			"26": "<sup>26</sup> ၥံၪအဖၫ့ခိၪလီၫ.- တၭအဝ့ၫဒၪမိစံၭယၧၩ, နဝ့ၫဒၪယီၩ, နမွဲယဖါ,ယယွၩ, ဒဲဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩအလဲၫ့",
			"27": "<sup>27</sup> လီၫ.- တၭယမိအီၪက့ၪအဝ့ၫနီၪလၧယဖိၪဝဲၡါဆ့,ထၪ့",
			"28": "<sup>28</sup> ထီၫနဲၪ့ဂၪ့ခိၪအစဎွၩၥံၪဒံၭလီၫ.- ယဆၧယၫ့ၥၭယမိ အီၪက့ၪလၧအဂး အဆိၩဆိၩအကၠၪကၠၪတၭ, ယဆၧ",
			"29": "<sup>29</sup> အုၩ့လၩ့နီၪမိအီၪဂုးအီၪခၧၫ့လၧအၥိၭလီၫ.- တၭယမိ အီၪက့ၪလၩ့အချံၫအၥၪလၩ့ဆိၩလၩ့ကၠၪးဒဲအလးဆီၩ့",
			"30": "<sup>30</sup> ဆီနီၪဘဲၫမူၭခိၪအမုနံၩလဖၪအၥိၭနီၪလီၫ.- အဖိၪခွၫ ၥံၪအ့ၪစဲၪ့ဒၪ ယဆၧၥီၪ့ဆၧၥၫ့တၭ, လလ့ၩဘၪလၧယ",
			"31": "<sup>31</sup> ဆၧစ့ၩရၫ့အဖၧၩ့နီၪ,- အ့ၪလၨၪခၫ့ဖၬ ယလူယထၫ",
			"32": "<sup>32</sup> တၭ,လထီးန့ဘၪယဆၧမၪလူၬၥံၪ,- ထီးနီၪလဖၧၫ့ ယမိစ့ၩရၫ့ အဆၧမၪလၧနိၪထး, ဒဲအဆၧအၧၩ့နီၪ, လၧယဆၧထးလဖၪနီၪလီၫ.-",
			"33": "<sup>33</sup> မွဲလါနၫ့တၭ, ယမၩန့ထဲၩ့ယဆၧအဲၪအခိးအတၩလၧအဝ့ၫနီၪအ့ၬ.- တၭယ",
			"34": "<sup>34</sup> ဆၧမွဲဆၧတီၩချဲၩ့ဆၧအဘျံၭအဘျၪအ့ၬ.- ယမိမၩဂၭ ဂီၩ့ယဆၧအုၩ့လၩ့အ့ၬး တၭယအၪ့လဲၩဆၧလၧအ",
			"35": "<sup>35</sup> ထၪ့ဖျ့ၭလၧယနိၭဖၧၩ့ဆ့အ့ၬ.- ယဆိၪလၩ့ယၥၭလ ဖၧၫ့လၧယဆၧဆံၫ့ဎံၪအဖၧၩ့နီၪ, ယချဲၩ့ဆၧအဘျံၭ",
			"36": "<sup>36</sup> အဘျၪလၧစဒၫဝံၭအ့ၬ.- အချံၫအၥၪ မိအီၪလၩ့ဆိၩ လၩ့ကၠၪတၭ, အလးဆီၩ့ဆီဘဲၫမုမ့ၬအၥိၭ လၧယမ့ၬ",
			"37": "<sup>37</sup> ယၫလီၫ.- ဘဲၫလၩအၥိၭနီၪမိအီၪဂုးအီၪခၧၫ့လၩ့ဆိၩ လၩ့ကၠၪတၭ, ဘဲၫဆၧထိးအၥၭလၧမူၭခိၪတီၩဝ့ၫအၥိၭ နီၪလီၫ. (စ့လၫ.)",
			"38": "<sup>38</sup> မွဲလါနၫ့တၭ,နခွံၬၡိၭယူၭ,ဒဲၥၭလိၪယူၭတၭ, နၥၭ",
			"39": "<sup>39</sup> ထၪ့ဘၪယူၭနၡၩလၧနဂုၪဝ့ၫလဂၩနီၪလီၫ.- နမၩဂၭ ဂီၩ့ယူၭနခ့ၫနၡၩအဆၧအုၩ့လၩ့း နမၩစံၪစၪယူၭအ",
			"40": "<sup>40</sup> ၥရဖူၩလၧနခွံၬလၩ့လၧဂၪ့ခိၪလီၫ.- နမၩဂၭဂီၩ့ယူၭ အခိၪဒၧၩ့ထီးအလူၬတၭ, နမၩအီၪယူယူၭအထိၬလ",
			"41": "<sup>41</sup> ဖၪနီၪလီၫ.- ကယဲၦလၧအလ့ၩဖိၬဖၧၩ့ၥၭ ထီးအလူၬ နီၪအၪ့ဂူၬန့အဆၧလီၫ. အဝ့ၫဒၪကဲၪထၪ့ယူၭဆၧဒုၪ",
			"42": "<sup>42</sup> ဒွ့ၪအလးလၧၦအီၪဝ့ၫလၧအနဲၩ့ထံၭအဂးလီၫ.- တၭ နအီၪက့ၪထၪ့ထီၫၦထၫ့ဒုၪဒၩအဝ့ၫ လၧအစူၪထွ့ၪတၭ,",
			"43": "<sup>43</sup> နဒုၭၥၭထိၬ အဒုၪအဒၩထီးအလူၬလီၫ.- တၭနဒုၭ ကျံၭအနၭအနါဆ့တၭ, နဒုၭအီၪဂုးအီၪခၧၫ့ဝ့ၫလၧဆၧ",
			"44": "<sup>44</sup> ဒုၭၥုၭအဖၧၩ့ဆ့အ့ၬ.- တၭနမၩလၩ့လၭအဆၧယုၩ့ယဲ ဒဲမၩလၩ့ဎီးခွံၬအလးဆီၩ့ဆီ လၧဂၪ့ခိၪအလီၩ့လီၫ.",
			"45": "<sup>45</sup> နမၩလၩ့ၡၩအၥၭဘၪ့အမုနံၩလဖၪတၭ, နဒုၭလုၬဘံၭ ဝ့ၫလၧဆၧမ့ၬမဲလီၫ.(စ့လၫ.)",
			"46": "<sup>46</sup> ဆံၭယံၬလဲၪ, ယဟိဝၩဧ့ၬ နမိအီၪက့ၪၥူၪနၥၭ လၩ့ဆိၩလၩ့ကၠၪဆ့ဧၪ. တၭမွဲနၥၭထၪ့နီၪ မိအၪ့",
			"47": "<sup>47</sup> ဘဲၫမ့ၪအၥိၭနီၪဆ့ဧၪ.- ယၥၭမၧၫ့ အဆၧၫ့အထီ ဖၨၪဆံၭဒိၪလဲၪနီၪ, နၪ့ထၪ့ထဲၩ့ဆံၭ.တၭ နမၩကဲၪ ထၪ့ၦၡၩထီးအလူၬ ပျီၩပျီၩနီၪမွဲဘၪလဲၪ.",
			"48": "<sup>48</sup> ၦလၧအမၧၫ့ဝ့ၫတၭ, လမိဒၪဘၪဆၧၥံၫနီၪ, မွဲပလၫလ ဂၩလဲၪ. မွဲအမၩဖီၩ့မၩဖျ့ၭအၥၭမၧၫ့ လၧဖျႃအဖၧၩ့ ဘၪမိၥ့ၪဧၪ.(စ့လၫ.)",
			"49": "<sup>49</sup> ကဆါဧ့, နဆၧယၫ့ၥၭလဖၪလၧအခၪ့ထံၭလၧန ဆိၪလၩ့နၥၭလၧအဂဲးအကၠီၪ့လၧစဒၫဝံၭ, လၧနဆၧ မွဲဆၧတီၩနီၪ, မွဲအအီၪခီၫခီၫလဲၪ.",
			"50": "<sup>50</sup> နခ့ၫနၡၩအဆၧဒုၪဒွ့ၪ လၧယဆိၬၦအၪဆၨၩထီးအ လူၬလၧယၥၭနၫၡါအလီၩ့နီၪ, နၪ့ထၪ့နဝ့ၫဆံၭ,ကဆါ ဧ့.-",
			"51": "<sup>51</sup> နဒုၪနဒၩၥံၪဒုၪဒွ့ၪဆၧ, ယဟိဝၩဧ့, အဝ့ၫၥံၪဒုၪဒွ့ၪ နၡၩဒိၭဂုၪအၥၭအခၫထၪ့ဆၧလဖၪနီၪလီၫ.",
			"52": "<sup>52</sup> မွဲယဟိဝၩ ဘၪဆၧစံၭထၪ့အၪ့အူၭ လၩ့ဆိၩလၩ့ ကၠၪဆံၭ. အၩမံၩ့,ဒဲအၩမံၩ့."
		},
		"90": {
			"1": "<sup>1</sup> ကဆါဧ့, နမွဲယူၭဆၧအီၪဂုးခၧၫ့အလး လၧပဂး အဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"2": "<sup>2</sup> ခိၪလီၩ့ထိၩ့ချိၬလချႃၭအီၪဖျဲၪဒံၭဘၪတၭ, နလချႃၭ မၩကဲၪထၪ့ဒံၭဘၪဂၪ့ခိၪ, ဒဲခီၫ့တၭ, နဝ့ၫဒၪယီၩလၧအ ဆိၩဆိၩ အကၠၪကၠၪ, နမွဲယွၩထီၩ့လၧအဆိၩဆိၩအ ကၠၪကၠၪလီၫ.",
			"3": "<sup>3</sup> နဒုၭကဲၪထဲၩ့ၦၡၩလၧဂၪ့ခိၪမုၬတၭ, နစံၭ,ထဲၩ့ထဲၩ့",
			"4": "<sup>4</sup> ဆံၭ,ၦၡၩအဖိၪခွၫၥံၪဧ့,- အဂဲးဘဲၫယီၩလၧနမ့ၬယၫ နီၪအနံၪ့လထီၫ့ မၩအၥၭဘဲၫလၧမုဂၪလနံၩ လၧအ ဖီၩ့ခွံၬအၥိၭတၭ, မၩအၥၭဘဲၫၦအီၪခိၭဆၧအဆၧၫ့",
			"5": "<sup>5</sup> အထီလၧမုနၩအၥိၭနီၪလီၫ.- နဝ့ၬခွံၬအဝ့ၫၥံၪတၭ, မၩအၥၭဘဲၫအမံၫအၥိၭတၭ ဒံၩခွံၬလၧဂီၩလခီၫဘဲၫ",
			"6": "<sup>6</sup> နၪ့ၥံၪမံၩ့ၥံၪအၥိၭနီၪလီၫ.- လၧဂီၩလခီၫနီၪဂ့ၩထၪ့ဝ့ၫ တၭ,မဲၪထၪ့ဝ့ၫဒၪဆ့း လၧမုဂၪလၩ့လခီၫနီၪဘၪဆၧ ခူၬခွံၬဝ့ၫတၭ, ဎဲၫ့ထၪ့ခွံၬဝ့ၫလီၫ.",
			"7": "<sup>7</sup> အဂဲးဘဲၫယီၩပလူၬခွံၬ လၧနၥၭထၪ့အကၠီၩ့တၭ,ပ",
			"8": "<sup>8</sup> ဘၪဆၧခိဆၧဝီၩလၧနၥၭခဲၩထၪ့နီၪလီၫ.- နအီၪက့ၪ လၩ့ပဆၧအၧၩ့လၧနမ့ၬယၫ ဒဲပဆၧဒဲၩဘၭလၧအအီၪ",
			"9": "<sup>9</sup> ၥူၪလဖၪလၧနမ့ၬ အဆၧဖၩ့အကျၩလီၫ.- အဂဲးဘဲၫ ယီၩပမုနံၩထီးအလူၬလဖၪ လ့ၩဖီၩ့ခွံၬဝ့ၫလၧနဆၧ ၥၭထၪ့အဖၧၩ့, ပနံၪ့ပလၩလူၬဝ့ၫ ဘဲၫဆၧဆီၫ့မီၪ့လ",
			"10": "<sup>10</sup> ထံၪအၥိၭနီၪလီၫ.- ပနံၪ့လဖၪအမုနံၩနီၪ မွဲအနံၪ့နွ့ၫ ဆံၫတၭ,လၧဆၧဂဲးဆၧဘၭအကၠီၩ့နီၪ အ့ၪအီၪအနံၪ့ ဎိၭဆံၫတၭး ဆၧလၧအဂဲးအဘၭနီၪ မွဲဆၧခိဆၧဝီၩ, ဒဲဆၧၡၪ့ဆၧနၭလီၫ. အဂဲးဘဲၫယီၩ ဒံၩခွံၬဝ့ၫတၭ, ပ",
			"11": "<sup>11</sup> ယူၩထၪ့ခွံၬလီၫ.- နဆၧၥၭထၪ့အစီၩ့အမၩ့ မွဲဘဲၫဆၧ ၥၭမဲၪနၧၩအၥိၭ နၥၭခဲၩထၪ့နီၪ, မွဲပလၫၥ့ၪယၫလဂၩ လဲၪ.",
			"12": "<sup>12</sup> ၥီၪ့လိၪလါပၧၩဘဲၫၥိၭ ပမိဝံထၪ့နၬထၪ့ပမုနံၩလဖၪ",
			"13": "<sup>13</sup> တၭ, န့ဘၪပၥၭလၧအကိၪ့ဆၧၥ့ၪအၥိၭနီၪဆံၭ.- ဂဲၫ ထဲၩ့,ယဟိဝၩဧ့,ဆံၭယံၬလဲၪၬ တၭမွဲနယၫ့ၥၭထဲၩ့န",
			"14": "<sup>14</sup> ခ့ၫနၡၩၥံၪဆံၭ.- ဒုၭမံၫ့ၥုၪ့ မံၫ့ၥၭလါပၧၩ လၧနဆၧ ယၫ့ၥၭလၧအဆိၫအချဲၫ့, ဘဲၫၥိၭပမိၥုၪ့ဎွံၫၥၭယီၫ,ၥုၪ့",
			"15": "<sup>15</sup> ထိၬၥၭထိၬလဆိၩဒၪပၧၩယီၩဆံၭ.- တၭဒုၭၥုၪ့ထိၬ ၥၭထိၬပၧၩဘဲၫမုနံၩလၧနမၩၡၪ့မၩနၭပၧၩ, ဒဲနံၪ့လ",
			"16": "<sup>16</sup> ဖၪလၧပဒၪဘၪဆၧအၧၩ့ဆၧၥၫ့နီၪဆံၭ.- တၭနမၩ ဆၧနီၪ,မွဲအအီၪဖျီၪလၧနခ့ၫနၡၩအမ့ၬယၫ, ဒဲနလၩ နဖၩ့နီၪ လၧအဝ့ၫၥံၪအဖိၪအလံၩ အမ့ၬယၫနီၪဆံၭ.",
			"17": "<sup>17</sup> တၭမွဲယဟိဝၩ, ပယွၩအဎံၫအလၩအီၪလၧပလီၩ့ ဆံၭ.တၭဒုၭအီၪဂုးအီၪခၧၫ့ဆၧလၧပမၩ လၧပစူၪ လၧပဂးဆံၭ. မွဲမၬ,ဆၧလၧပမၩလၧပစူၪနီၪ, ဒုၭအီၪ ဂုးအီၪခၧၫ့အဝ့ၫနီၪဆံၭ."
		},
		"91": {
			"1": "<sup>1</sup> တၭၦလၧအအီၪဝ့ၫ လၧဆၧထၪ့ထီၫထုၬလဂၩအ လးအီၪၥူၪအဖၧၩ့နီၪ, အီၪဝ့ၫလၧၦၥ့ၪဆၧလူၬအလၩ",
			"2": "<sup>2</sup> ၡုၪဖၧၩ့လီၫ.- ယမိစံၭလၧယဟိဝၩအဂဲးအကၠီၪ့, မွဲယ ဆၧဖလ့ၬအလး,ဒဲယထိၬလဖျိၪ့,ယယွၩ, ယမိဒိၭနဲၩ့ ယၥၭလၧအဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ မွဲအမိမၩဖီၩ့မၩဖျ့ၭနၧၩလၧၦၡၩဖီၪ့",
			"4": "<sup>4</sup> ထိၪအဖျံၩခွၩ့, ဒဲလၧဆၧၥံၫချဲၫ့မၩဂၭဂီၩ့ဆၧလီၫ.- မိ ချႃၬဘံၭနၧၩ လၧအဆီၪ့ၥံၪတၭ, နမိဒိၭနဲၩ့နၥၭလၧအ ဒံၭအဖၫ့လၬတၭ, အဆၧမွဲဆၧတီၩနီၪ မွဲထၩ့ဖံၭဖိၪဒဲ",
			"5": "<sup>5</sup> ထၩ့ဖံၭဖၭဒိၪလီၫ.- နမိဘၪအၪ့ယိၪဆၧလၧဆၧမၩ ၥၭမဲၪၥၭဖျဲၩ့လၧမုနၩအကၠီၩ့, ဒဲဖျါလၧအယူၩဝ့ၫလၧ",
			"6": "<sup>6</sup> မုဆၫအကၠီၩ့နီၪဆ့အ့ၬ.- ဆၧၥံၫချဲၫ့လၧအလ့ၩဆၧ လၧဆၧခံၭကျၩအကၠီၩ့, ဒဲဆၧမၩဂၭဂီၩ့ ဆၧလၧအ",
			"7": "<sup>7</sup> မၩအီၪယူဆၧလၧမုထုၪ့အကၠီၩ့နီၪဆ့အ့ၬ.- ၦၡၩလ ထီၫ့မိလၩ့ထံၩဖါလၧနနဲၩ့ထံၭ, ဒဲၦၡၩအလၬလဖၪ လၧနစူၪထွ့ၪလါနၫ့ဘိၩ, ၥုၭဘူၭအၥၭလၧနအီၪအ့ၬ.",
			"8": "<sup>8</sup> နမိယိဆၧနီၪန့ၫလၧနမ့ၬၥၪတၭ, ၦလတီၩလလီၩ့ဘၪ",
			"9": "<sup>9</sup> အဆၧဖ့ၪဆၧၫ့ထဲၩ့ဝ့ၫနီၪနမိဒၪဘၪလီၫ.- လၧနအီၪ က့ၪယဟိဝၩ, ယဆၧဖလ့ၬအလး, ဆၧထၪ့ထီၫထုၬလ",
			"10": "<sup>10</sup> ဂၩနီၪ, နဆၧအီၪဂုးခၧၫ့အလးအကၠီၩ့နီၪ,- ဆၧအၧၩ့ လဘၪဘၪနၧၩတၭ, ဆၧၥံၫချဲၫ့ဂဲၫဘူၭဘၪ လၧနတဲၩ",
			"11": "<sup>11</sup> ဆ့အ့ၬ.- အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမိမၪလူၬအၥီၫ့ၥံၪလၧ နဂဲးနကၠီၪ့လၧအဘၪယိထဲၩ့ခွါထဲၩ့နၧၩ လၧနဖၧၩ့ၥၭ",
			"12": "<sup>12</sup> ထီးအလူၬအဖၧၩ့လီၫ.- တၭအဝ့ၫၥံၪမိဆိၬထၪ့နၧၩ လၧအစူၪလီၩ့ ဘဲၫနခၪ့ထီးဘၪထံၭ လၧလိးလဂ့ၩအ",
			"13": "<sup>13</sup> ၥိၭနီၪလီၫ.- နမိယဲးလၩ့ဆၬလၥၧၫ့,ဒဲဂူၥၫ့တၭ,နမိယဲး ထဲးဆၬလၥၧၫ့ဖိၪ, ဒဲၡီၩ့နီၪလီၫ.",
			"14": "<sup>14</sup> လၧအအဲၪယၧၩအကၠီၩ့တၭ, ယမိမၩဖီၩ့မၩဖျ့ၭဝ့ၫ ယမိအီၪက့ၪထၪ့ထီၫဝ့ၫ လၧအၥ့ၪယၫယမံၩ့အကၠီၩ့နီၪ",
			"15": "<sup>15</sup> လီၫ.- အဝ့ၫဒၪမိကိၭထၪ့ယၧၩတၭ, ယမိစံၭဆၧၫ့ဝ့ၫ လီၫ.ထီးအဘၪ ဆၧခိဆၧဝီၩတၭ, ယမိအီၪလၧအ ၥိၭ,ယမိမၩဖီၩ့မၩဖျ့ၭဝ့ၫ, ဒဲမၩလၩဖၩ့ဝ့ၫဆ့လီၫ.",
			"16": "<sup>16</sup> ယမိဒုၭမံၫ့ၥုၪ့မံၫ့ၥၭအဝ့ၫ လၧအၥၭအီၪကိၩ့အီၪခိၭ တၭ,ယမိဒုၭဒၪဘၪဝ့ၫ လၧယဆၧထိးထဲၩ့ တၩ့ထဲၩ့ လီၫ."
		},
		"92": {
			"1": "<sup>1</sup> ပစံၭထၪ့အၪ့အူၭယဟိဝၩ, ဒဲၥံၫကျံၩအၪ့အူၭထၪ့",
			"2": "<sup>2</sup> နမံၩ့နီၪ, မွဲဆၧအဂ့ၩ,ဆၧထၪ့ထီၫထုၬလဂၩဧ့.- လၧပ ဒုၭနဲၪနဆၧအဲၪအခိးအတၩလၧဂီၩလခီၫ, ဒဲနဆၧမွဲ",
			"3": "<sup>3</sup> ဆၧတီၩလၧမုနၩလခီၫ,- လၧဆၧအီၪလၧဖျံၩဆံၫဘီၩ့",
			"4": "<sup>4</sup> လၧၥၫ့ထီး,လၧနါဒံၩ့ၥီၫမုၬမုၬလီၫ.- အဂဲးဘဲၫယီၩန မၩၥၭထိၬယၧၩ လၧနမၩဆၧအကၠီၩ့နီၪၬ ယဟိဝၩဧ့,",
			"5": "<sup>5</sup> ယမိၥုၪ့ဎွံၫၥၭယီၫ လၧနစူၪအဆၧမၩအဖၧၩ့လီၫ.- န မၩဆၧလဖၪနီၪ, မွဲဆံၭဒိၪလဲၪၬ ယဟိဝၩဧ့, တၭန ကိၪ့ထၪ့ဖၭလၩ့ဆၧနီၪယိၬမၬလီၫ.",
			"6": "<sup>6</sup> ၦအီၪလၧဆၧဖိၪဆၧဎါအၥၭ လၥ့ၪယၫဘၪတၭ, ၦ",
			"7": "<sup>7</sup> အဂီၩ့နၪၥ့ၪဆၧယီၩအ့ၬ.- တၭထီးၦအအၧၩ့မဲၪထၪ့ ဘဲၫနၪ့ၥံၪမံၩ့ၥံၪအၥိၭနီၪတၭ, ၦမၩဆၧအၧၩ့ထီးအ လူၬဘီၪထၪ့ယီၫထၪ့တၭ, မွဲဘဲၫၥိၭအမိထီၩ့ လၧဆၧ",
			"8": "<sup>8</sup> ဂၭဂီၩ့လၩ့ဆိၩလၩ့ကၠၪလီၫ.- တၭနဝ့ၫဒၪနမွဲဆၧထၪ့",
			"9": "<sup>9</sup> ထီၫထုၬလၩ့ဆိၩလၩ့ကၠၪ,ယဟိဝၩဧ့,- အဂဲးဘဲၫယီၩ, ယိခွါ,နဒုၪနဒၩၥံၪး ယဟိဝၩဧ့, အဂဲးဘဲၫယီၩ, ယိ ခွါ,နဒုၪနဒၩၥံၪ ထီၩ့လၧဆၧဂၭဂီၩ့တၭ, ကယဲၦၡၩ လၧအမၩဆၧအၧၩ့ ထီးအလူၬနီၪ လၩ့မုလၩ့ဖၭလီၫ.",
			"10": "<sup>10</sup> အ့ၪမွဲနအီၪက့ၪထၪ့ထီၫယနိၩ့ ဘဲၫချီဖၫမံၩ့အနိၩ့ အၥိၭနီၪလီၫ. ယဒိၭဆၧဂုၪယၧၩ လၧၥိၪအၥံၫ့လီၫ.",
			"11": "<sup>11</sup> တၭယမ့ၬၥၪန့ဘၪဆၧလၧအဆိၫ့ဘၪ ၦလၧအခိၭၥူၪ ဆၧလၧယဂးအလီၩ့, ယနါနါဂၧၫ့ဆၧ လၧၦအအၧၩ့",
			"12": "<sup>12</sup> လၧအဂဲထုၪ့ထၫ့ဒုၪဒၩယၧၩအဂဲးလီၫ.- ၦတီၩၦလီၩ့ မိဂ့ၩထၪ့ဘဲၫၥံၪ့စီၩ့မလီၫ့အၥိၭ မိဒိၪထၪ့ဘဲၫၥံၪ့ၡိၫအ့",
			"13": "<sup>13</sup> ရ့ၭလၧလ့ၭဘနၧၫ့အလီၩ့အၥိၭနီၪလီၫ.- ၦၡၩလၧအ ၥုၪ့လၩ့အၥၭလၧယဟိဝၩအဂံၪ့ဖၧၩ့နီၪ ဂ့ၩထၪ့ဝ့ၫလၧ",
			"14": "<sup>14</sup> ပယွၩအဝၩ့လဖၪအဖၧၩ့း- လၧအၥၭၡါခိၪဘွၩလါနၫ့",
			"15": "<sup>15</sup> ဘိၩဘၪ့ထၪ့ၥၪထၪ့တၭ, အီၪဝ့ၫၥံၫ့ဆ့ၬလီၫ.- ဘဲၫၥိၭ ဆၧမိဒုၭနဲၪလၧယဟိဝၩ မွဲအတီၩအလီၩ့နီၪ, အဝ့ၫဒၪ မွဲယလဲၫ့လဖျိၪ့တၭ, ဆၧအၧၩ့အီၪလၧအဖၧၩ့နးဆံၭ အ့ၬ."
		},
		"93": {
			"1": "<sup>1</sup> ယဟိဝၩပၧၩ့ဆၧတၭ, ကီၩ့ဝ့ၫၥိၭဝ့ၫလၧဆၧအက ယးကဖး ယဟိဝၩကီၩ့ဝ့ၫၥိၭဝ့ၫလၧဆၧဂဲးဆၧဘၭ, ဒဲခဲးထူၬအယးဒံၩ့ဆ့လီၫ. မွဲမၬ,ဂၪ့ခိၪမိအီၪဂုးအီၪ",
			"2": "<sup>2</sup> ခၧၫ့လဂဲၩလဝၭဘၪလီၫ.- နလးဆီၩ့ဆီအီၪခၧၫ့ခီၫလၧ ဖျိၩ့, နဝ့ၫဒၪနအီၪလၧဖျိၩ့ အဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"3": "<sup>3</sup> ထံၫလုၬဘံၭဆၧဆိၬထၪ့ဆၧ, ယဟိဝၩဧ့,ထံၫလုၬဘံၭ ဆၧဆိၬထၪ့အၥီၫး ထံၫလုၬဘံၭဆၧဆိၬထၪ့အလပီၩ",
			"4": "<sup>4</sup> ဆီၪ့လဖၪလီၫ.- တၭယဟိဝၩလၧအလးထၪ့ထီၫနီၪ အလၩအဖၩ့ဒိၪနဲၪ့ထံၫအၪအၥီၫ, မၫဆမံၭအလပီၩ",
			"5": "<sup>5</sup> ဘွၩခိၪအဒိၪအဆီၪ့နီၪဒံၭလီၫ.- နဆၧထိးအၥၭလဖၪ နီၪမွဲဆၧမွဲဆၧတီၩလၩ့ထံးလၩ့ဆ့လီၫ. ဆၧဆံၫ့ဎံၪ ကြၨၭလၧနဂံၪ့အဂးလၩ့ဆိၩလၩ့ကၠၪ, ယဟိဝၩဧ့."
		},
		"94": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, ယွၩလၧအမၩဆၧၫ့ထဲၩ့ဆၧအၧၩ့,ၦ",
			"2": "<sup>2</sup> လၧအမၩဆၧၫ့ထဲၩ့ဆၧအၧၩ့, ယွၩဧ့, ဖၩ့ထၪ့ဆံၭ.-ဂဲ ထုၪ့ဆံၭး ၦလၧအစ့ၩရၫ့ဂၪ့ခိၪဧ့,ဖ့ၪထဲၩ့ၦၡၩအီၪက့ၪ ထၪ့ထီၫအၥၭလၧဆၧလၧအမၩဝ့ၫအကၠီၩ့နီၪဆံၭ.",
			"3": "<sup>3</sup> ယဟိဝၩဧ့, ၦၡၩလတီၩလလီၩ့ဘၪနီၪဆံၭယံၬလဲၪ, ၦၡၩလတီၩလလီၩ့ဘၪမိၥုၪ့ဎွံၫၥၭယီၫ လၧဆၧအဖၫ့",
			"4": "<sup>4</sup> ခိၪဆံၭယံၬလဲၪၬ- အဝ့ၫၥံၪဒုၭထၪ့ဖျ့ၭဆၧလၧအနိၭ တၭ,ချဲၩ့ဆၧကၪလဖၪး ၦမၩဆၧအၧၩ့ထီးအလူၬလ",
			"5": "<sup>5</sup> ဖၪနီၪအီၪက့ၪဖိၫလိၫအၥၭလီၫ.- အဝ့ၫၥံၪဂူၬလၩ့ဘျ့ၭ နၡၩခမျၧး,ယဟိဝၩဧ့, တၭမၩနၧၩ့မၩစၪနဆၧန့ၥၫ",
			"6": "<sup>6</sup> လီၫ.- မွဲအကျီၪ့ၥံၫခွံၬၦမုၪမဲၫ, ဒဲၦမွံၩတၭမၩၥံၫၦဖိၪ",
			"7": "<sup>7</sup> ဎွ့ၪလီၫ.- တၭအဝ့ၫၥံၪစံၭဝ့ၫ, ယဟိဝၩလဒၪဘၪတၭ, စယၫကူၭအယွၩယိဝ့ၫဆ့အ့ၬ.",
			"8": "<sup>8</sup> ၦၡၩလၧၦခမျၧးအကျၩအီၪ လၧဆၧဖိၪဆၧဎါအ ၥၭၥံၪဧ့,နၪၥ့ၪဆၧဆံၭ. ၦအဂီၩ့ၥံၪဧ့, နၥံၪမိန့ဘၪဆၧ",
			"9": "<sup>9</sup> ကိၪ့ၥ့ၪဆံၭယံၬခိၬလဲၪ.- တၭၦလဂၩလၧအၥုၪ့လၩ့ နါနီၪ,မွဲအနါဂၧၫ့ဆၧအ့ၬဧၪ. ၦလၧအတဲၩ့လၩ့ၦမ့ၬ",
			"10": "<sup>10</sup> ၥၪလဂၩနီၪ, မွဲအဒၪဘၪဆၧအ့ၬဧၪ.- ၦလၧအအၪ့ၥီၪ့ ၦဆၨၩၥံၪလဂၩနီၪ, ဒဲၦလၧအၥီၪ့လိၪၦၡၩလၧဆၧၥ့ၪ",
			"11": "<sup>11</sup> ယၫလဂၩနီၪ, မွဲအဖ့ၪလၫ့ဆၧဒဲၩဘၭအ့ၬဧၪ.- ယဟိ ဝၩၥ့ၪယၫ ၦၡၩကိၪ့ထၪ့ဖၭလၩ့ဆၧနီၪ မွဲဆၧပျီၩပျီၩ",
			"12": "<sup>12</sup> လီၫ.- ယဟိဝၩဧ့, ၦလဂၩလၧနနၭအၪ့ၥီၪ့ဝ့ၫ, ဒဲၥီၪ့လိၪ ဝ့ၫလၧနဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့နီၪ, ဘၪဆိၪဂ့ၩဝ့ၫတၭး",
			"13": "<sup>13</sup> မွဲဘဲၫၥိၭနမိဒုၭအီၪပွံၭဝ့ၫ လၧဆၧအၧၩ့အမုနံၩလဖၪ နီၪ,ထီးဆၧခုၪ့လၩ့ ၦၡၩလတီၩလလီၩ့ဘၪအဆၧဖၧၩ့",
			"14": "<sup>14</sup> နီၪလီၫ.- အဂဲးဘဲၫယီၩ ယဟိဝၩလခွံၬၡိၭဘၪအၡၩ",
			"15": "<sup>15</sup> ခမျၧးတၭ, စဲၪ့ဒၪအဆၧန့ၥၫနီၪဆ့အ့ၬ.- အဂဲးဘဲၫယီၩ ဆၧစ့ၩရၫ့မိထဲၩ့ထဲၩ့ လၧဆၧတီၩဆၧလီၩ့အအီၪ, ဒဲ ကယဲၦလၧအၥၭလီၩ့ ထီးအလူၬလဖၪမိဖိၬအခဲၫ့လီၫ.",
			"16": "<sup>16</sup> တၭမွဲပလၫမိဂဲထုၪ့လၧယဂး ထၫ့ဒုၪဒၩၦအအၧၩ့ လဖၪနီၪလဲၪ. မွဲပလၫမိအီၪက့ၪဆၧၫ့ထုၪ့အၥၭလၧယ",
			"17": "<sup>17</sup> ဂးထၫ့ဒုၪဒၩၦမၩဆၧအၧၩ့လဖၪလဲၪ.- ယဟိဝၩအ့ၪ လမွဲဘၪယဆၧမၩဆၧၩ့တၭ, ယၥၭမိအီၪထၪ့ချဲၫ့ချံၭ",
			"18": "<sup>18</sup> လၧဆၧလၩ့မါပံၭအဖၧၩ့လီၫ.- ထီးယအ့ၪစံၭယခၪ့ ဖျၬနီၪးယဟိဝၩဧ့, နခိးနတၩ မၩဂုးမၩခၧၫ့ယၧၩ",
			"19": "<sup>19</sup> လီၫ.- လၧယဆီၫ့မီၪ့ဆၧအၪ လၧယၥၭခံဖၧၩ့အကျၩ နီၪနဆၧမုၬလၩလဖၪဒုၭမုၬယၥၭလီၫ.",
			"20": "<sup>20</sup> တၭဆၧအၧၩ့အလးဆီၩ့ဆီ လၧအထၫ့ဒုၪဒၩဆၧ",
			"21": "<sup>21</sup> ၥီၪ့ဆၧၥၫ့နီၪ, မိဖံၭၥိၭလိၬအၥၭ လၧနၧၩဆ့ဧၪ.- အ ဝ့ၫၥံၪအီၪကိၩ့အီၪကီၪ့ ထၫ့ဒုၪဒၩ ၦတီၩၦလီၩ့ အၥၭ တၭ,စ့ၩရၫ့စၪဆၧၥွံၪ လၧအဆၧဒဲၩဘၭလအီၪဘၪနီၪ လီၫ.",
			"22": "<sup>22</sup> အ့ၪမွဲယထိၬထၪ့ထီၫလဖျိၪ့နီၪ, မွဲယဟိဝၩ, ဒဲ",
			"23": "<sup>23</sup> ဆၧဖလ့ၬအလဲၫ့လဖျိၪ့နီၪမွဲယယွၩလီၫ.- တၭယွၩမိ ဒုၭဘၪအဝ့ၫၥံၪလၧအဆၧအၧၩ့ဒၪဝ့ၫတၭ, မိဒၪ့ထ့ၬ ခွံၬဝ့ၫလၧအဆၧအၧၩ့ဒၪဝ့ၫအဖၧၩ့လီၫ. ယဟိဝၩပ ယွၩမိဒၪ့ထ့ၬခွံၬအဝ့ၫၥံၪလီၫ."
		},
		"95": {
			"1": "<sup>1</sup> ဂဲၫဘီၪ, မွဲပၥံၫကျံၩၡီၩ့ ယဟိဝၩလၧဆၧၥီၫဖၭဒိၪ ဆံၭ.မွဲပၥၭထိၬတၭ ကိၭၡၭထၪ့ၡီၩ့ ပဆၧထိးထဲၩ့",
			"2": "<sup>2</sup> တၩ့ထဲၩ့အလဲၫ့ဆံၭ.- မွဲပလ့ၩထၪ့ၡီၩ့လၧအမ့ၬယၫ အီၪလၧဆၧစံၭထၪ့အၪ့အူၭတၭ, ကိၭၡၭထၪ့ၡီၩ့အ ဝ့ၫဒၪလၧဆၧၥံၫကျံၩလဖၪဆံၭ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩမွဲယွၩဖၭဒိၪ, ဒဲစဎွၩဖၭဒိၪ",
			"4": "<sup>4</sup> လဂၩလၧယွၩထီးအလူၬအဖၫ့ခိၪလီၫ.- ဂၪ့ခိၪအဆၧ ယိၬဖၧၩ့ၥံၪအီၪလၧအစူၪဖၧၩ့တၭ, ခိၪလီၩ့ထိၩ့ချိၬအ ဆၧလူဒိၪဎွ့ၩဒိၪလဖၪနီၪ, မွဲအဆၧဆ့လီၫ.",
			"5": "<sup>5</sup> မၫဆမံၭနီၪမွဲအဆၧတၭ, မၩကဲၪထၪ့ဝ့ၫး ဒဲခီၫၥူၫ ခိၪမၩဝ့ၫလၧအစူၪဆ့လီၫ.",
			"6": "<sup>6</sup> ဂဲၫဘီၪ, မွဲပဘိၪ့ထၪ့ဘၩထၪ့ၡီၩ့တၭ, ထွံၩလၩ့ၡီၩ့ ဒဲချံၭလၩ့ပခၪ့လၧယဟိဝၩ လၧအတဲၩ့လၩ့ပၧၩအမ့ၬ",
			"7": "<sup>7</sup> ယၫဆံၭ.- အဂဲးဘဲၫယီၩအဝ့ၫဒၪမွဲပယွၩတၭ, ပဝ့ၫ ဒၪပမွဲအဆၧအၪ့အဆၪအလး အၡၩခမျၧး, ဒဲအစူၪ",
			"8": "<sup>8</sup> အၥိၪလဒီၪ့လီၫ.- နၥံၪအ့ၪခိၭနၪအလူအထၫလၧမုလ နံၩယီၩ, ထီးမၩနီၩ့နၥံၪအၥၭဘဲၫလၧမ့ရဘၫအၥိၭ, ဘဲၫဆၧကျဲၩ့ဖစီၩ့အမုနံၩ လၧမံၩ့လၬကျၩအၥိၭနီၪလ",
			"9": "<sup>9</sup> ဂ့ၩ.- ထီးနီၪနၥံၪအဖါၥံၪကျဲၩ့ဖစီၩ့ယၧၩတၭ, မၩခွါ",
			"10": "<sup>10</sup> ယၧၩ,ဒၪဘၪယဆၧမၩဆ့လီၫ.- တၭယၥုၪ့ခိၥၭဝီၩ အနံၪ့လံဆံၫအထးဖၧၩ့ လၧၦလဆိၩနီၪအကၠီၩ့လီၫ. တၭယစံၭ, အဝ့ၫၥံၪမွဲၦခမျၧးလၧအဂၭဖျိၭဆၧလၧအ",
			"11": "<sup>11</sup> ၥၭတၭ, ၥ့ၪယၫယဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭနီၪဆ့အ့ၬ.- မၩအ ၥၭဘဲၫနီၪတၭ, ယဆိၪလၩ့ယၥၭလၧယၥၭထၪ့အဖၧၩ့ လၧၦလဖၪနီၪ မိလ့ၩနုၬဘၪဝ့ၫလၧယဆၧအီၪပွံၭအ ဖၧၩ့နီၪဆ့အ့ၬ."
		},
		"96": {
			"1": "<sup>1</sup> ဂၪ့ခိၪဖိၪထီးအလူၬၥံၪဧ့, ၥံၫကျံၩထၪ့ယဟိဝၩလၧ",
			"2": "<sup>2</sup> ထၭခိၪအၥၫ့တၭ, ၥံၫကျံၩထၪ့ယဟိဝၩဆံၭ.- ၥံၫကျံၩ ထၪ့ယဟိဝၩ, စံၭထၪ့အၪ့အူၭအမံၩ့တၭ, ဒုၭဂၧၫ့ထၪ့ ၥၩလၩ့ အဆၧထိးထဲၩ့တၩ့ထဲၩ့ လၧလနံၩဘၪလနံၩ",
			"3": "<sup>3</sup> ဆံၭ.- လီၩလၩ့လၬလၩ့ၦဆၨၩၥံၪ လၧအလၩအဖၩ့, အဆၧလၩ့လၭလဖၪ လၧၦခမျၧးထီးအလူၬအကျၩနီၪ",
			"4": "<sup>4</sup> ဆံၭ.- အဂဲးဘဲၫယီၩယဟိဝၩမွဲဆၧအဒိၪတၭ, ဆၧစံၭ ထၪ့အၪ့အူၭအလးအီၪဝ့ၫဖၭဒိၪဆ့လီၫ. အဝ့ၫဒၪမွဲ ဆၧၥၭမဲၪအလးဒိၪနဲၪ့ယွၩလဖၪ ထီးအလူၬနီၪဒံၭလီၫ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ ကယဲၦဆၨၩလဖၪအယွၩၥံၪထီးအ လူၬနီၪ, မွဲဆၧပျီၩပျီၩတၭး အ့ၪမွဲယဟိဝၩမၩကဲၪထၪ့",
			"6": "<sup>6</sup> မူၭခိၪလီၫ.- ဆၧဂဲးဆၧဘၭ,ဒဲဆၧအကယးကဖးအီၪ ဝ့ၫလၧအမ့ၬယၫ, ဒဲဆၧအစီၩ့အမၩ့, ဒဲဆၧအဎံၫအ လၩအီၪဝ့ၫလၧအလးဆံၫ့ဎံၪအဖၧၩ့နီၪလီၫ.",
			"7": "<sup>7</sup> ဖ့ၪလၫ့ဆၧလၧယဟိဝၩ, ၦခမျၧးအဂံၪ့ဒီၪ့ၥံၪဧ့,ဖ့ၪ",
			"8": "<sup>8</sup> လၫ့ဆၧလၩဖၩ့, ဒဲအစီၩ့အမၩ့လၧယဟိဝၩဆံၭ.- ဖ့ၪ လၫ့ယဟိဝၩအမံၩ့ အလၩအဖၩ့နီၪတၭ, ဆိၬဆၧမၩ",
			"9": "<sup>9</sup> ဘိၪ့တၭ, ဂဲၫနုၬလၧအနီးလဖၪအဖၧၩ့ဆံၭ.- ဘိၪ့ထၪ့ ဘၩထၪ့ယဟိဝၩလၧဆၧဆံၫ့ဎံၪအဎံၫအလၩဆံၭ. ၦ ဂၪ့ခိၪဖိၪထီးအလူၬၥံၪဧ့, ဝၭထိၬလၧအမ့ၬယၫဆံၭ.",
			"10": "<sup>10</sup> စံၭလၧၦဆၨၩၥံၪအကျၩ, ယဟိဝၩပၧၩ့ဆၧ မွဲမၬ,ဂၪ့ ခိၪမိအီၪဂုးအီၪခၧၫ့, လဝၭဘၪလီၫ. အဝ့ၫဒၪမိစ့ၩရၫ့ တီၩန့ၦခမျၧးလီၫ.",
			"11": "<sup>11</sup> မွဲမူၭခိၪၥုၪ့ထိၬၥၭထိၬ, ဒဲဂၪ့ခိၪၥုၪ့ဎွံၫၥၭယီၫဆံၭ.",
			"12": "<sup>12</sup> မွဲမၫဆမံၭဒဲအဆၧလၧၫ့ဆၧဎွ့ၩနီၪၥီၫထၪ့ဆံၭ.- မွဲဂၪ့ ခိၪအဝၩ့လဖၪ, ဒဲကယဲဆၧအီၪလၧအဖၧၩ့နီၪ, ၥုၪ့ဎွံၫ ၥၭယီၫဆံၭ. ထီးနီၪလဖၧၫ့ ကယဲၥံၪ့လၧမံၩ့လၬကျၩ မိၥုၪ့ထိၬၥၭထိၬ လၧယဟိဝၩအမ့ၬယၫ ထီးအလူၬ",
			"13": "<sup>13</sup> လီၫ.- အဂဲးဘဲၫယီၩ ဂဲၫဝ့ၫဘဲၫၥိၭအမိစ့ၩရၫ့ဂၪ့ခိၪ လီၫ.တၭမိစ့ၩရၫ့ၦဂၪ့ခိၪဖိၪ လၧဆၧတီၩဆၧလီၩ့ဒဲၦ ခမျၧးၥံၪလၧဆၧမွဲဆၧတီၩလီၫ."
		},
		"97": {
			"1": "<sup>1</sup> ယဟိဝၩပၧၩ့ဆၧတၭ, မွဲဂၪ့ခိၪၥုၪ့ဎွံၫၥၭယီၫဆံၭ. မွဲကျိၩ့ၥံၪအၪဖျိၪ့နီၪၥုၪ့ထိၬၥၭထိၬဆံၭ.",
			"2": "<sup>2</sup> ဆၧအုၪ့ဒဲဆၧခံၭအီၪဝၬဖီၩ့အဝ့ၫဒၪး ဆၧတီၩဆၧ လီၩ့,ဒဲဆၧစ့ၩရၫ့မွဲအဝ့ၫဒၪ အလးဆီၩ့ဆီအခၪ့ထံၭ",
			"3": "<sup>3</sup> လီၫ.- မ့ၪလ့ၩလၧအမ့ၬယၫတၭ, အၪ့ခွံၬအဒုၪအဒၩ",
			"4": "<sup>4</sup> အီၪဝၬဖီၩ့ဝ့ၫလီၫ.- အလၫ့ဝဲဒံၭဒုၭဖၩ့ထၪ့ဂၪ့ခိၪ, ဂၪ့ခိၪ",
			"5": "<sup>5</sup> ဒၪဘၪဝ့ၫတၭ, ဝၭၡိၩ့ၡိၬဝ့ၫဒၪလီၫ.- ခိၪလီၩ့ထိၩ့ချိၬ ဖံၪထၪ့ဝ့ၫဘဲၫဎိၭအၥိၭ လၧယဟိဝၩအမ့ၬယၫလၧဂၪ့",
			"6": "<sup>6</sup> ခိၪထၧၫ့ဖျိၪ့ယၫ အကဆါအမ့ၬယၫလီၫ.- မူၭခိၪဒုၭဖျီၪ ထၪ့အဆၧတီၩဆၧလီၩ့တၭ, ၦဆၨၩထီးအလူၬလဖၪ",
			"7": "<sup>7</sup> ဒၪဘၪအလၩအဖၩ့လီၫ.- ကယဲၦလၧအမၩဆၧဂၩ့ဆၧ ဖၪ့အဆၧမၩ, ၦလၧအအီၪက့ၪဖိၫလိၫအၥၭ လၧဆၧ လမွဲဘၪဆၧအကၠီၩ့လဖၪနီၪ အမ့ၬမိမဲဝ့ၫလီၫ. ယွၩထီး အလူၬၥံၪဧ့, ဘိၪ့ထၪ့ဘၩထၪ့အဝ့ၫဒၪဆံၭ.",
			"8": "<sup>8</sup> ဇံအိၫ့နါဂၧၫ့ဝ့ၫတၭ, ၥုၪ့ထိၬၥၭထိၬဒဲယုဒၫအဖိၪမုၪ ၥံၪၥုၪ့ဎွံၫၥၭယီၫ လၧနစ့ၩရၫ့ဆၧလဖၪအကၠီၩ့, ယဟိ",
			"9": "<sup>9</sup> ဝၩဧ့,- အဂဲးဘဲၫယီၩ,ယဟိဝၩဧ့, နဝ့ၫဒၪနမွဲဆၧထၪ့ ထီၫလၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫအဖၫ့ခိၪးနအီၪလၧဆၧထၪ့ ထီၫလၧယွၩထီးအလူၬလဖၪအဖၫ့ခိၪ လၩ့ထံးလၩ့ ဆ့ၭလီၫ.",
			"10": "<sup>10</sup> ၦလၧအအဲၪယဟိဝၩၥံၪဧ့,ၥၭဂဲၫ့မ့ၬလဲၩဆၧအၧၩ့ ဆံၭ. အဝ့ၫဒၪခိၭထၬအၡၩဆံၫ့ဎံၪအၥၭမၧၫ့နီၪတၭ, မၩဖီၩ့ မၩဖျ့ၭဝ့ၫ လၧၦလတီၩလလီၩ့ဘၪအစူၪဖၧၩ့လီၫ.",
			"11": "<sup>11</sup> ဆၧဖၩ့ဎွံၪယူၭအၥၭ လၧၦတီၩၦလီၩ့အဂးယူၭ.ဒဲ ဆၧၥုၪ့ထိၬၥၭထိၬ လၧၦအၥၭဆုးလီၩ့အဂးနီၪဆ့လီၫ.",
			"12": "<sup>12</sup> ၦတီၩၦလီၩ့ၥံၪဧ့, ၥုၪ့ထိၬၥၭထိၬလၧယဟိဝၩအ ဖၧၩ့ဆံၭ. တၭစံၭထၪ့အၪ့အူၭအဆၧနၪ့ထၪ့ထဲၩ့ ဆံၫ့ ဎံၪနီၪဆံၭ."
		},
		"98": {
			"1": "<sup>1</sup> ၥံၫကျံၩထၪ့ယဟိဝၩလၧထၭခိၪအၥၫ့ဆံၭ. အဂဲးဘဲၫ ယီၩ အဝ့ၫဒၪမၩဆၧလၩ့လၭလဖၪလီၫ. အစူၪထွ့ၪဒဲ အစူၪဒူၪဆံၫ့ဎံၪ ထိးထဲၩ့တၩ့ထဲၩ့ဆၧလၧအဂးလီၫ.",
			"2": "<sup>2</sup> ယဟိဝၩဒုၭၥ့ၪယၫယူၭ အဆၧထိးထဲၩ့တၩ့ထဲၩ့တၭ, ဒုၭနဲၪအဆၧတီၩဆၧလီၩ့ လၧၦဆၨၩၥံၪအမ့ၬယၫ",
			"3": "<sup>3</sup> လီၫ.- အဝ့ၫဒၪနၪ့ထၪ့ထဲၩ့အဆၧအဲၪအခိးအတၩဒဲအ ဆၧမွဲဆၧတီၩ လၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအဂးလီၫ. ဂၪ့ခိၪအထုၬၥံၪထီးအလူၬနီၪ ဒၪဘၪယူၭပယွၩအဆၧ ထိးထဲၩ့တၩ့ထဲၩ့ယူၭ.",
			"4": "<sup>4</sup> ကိၭၡၭထၪ့လၧယဟိဝၩ ၦဂၪ့ခိၪဖိၪထီးအလူၬၥံၪ ဧ့,ၥုၪ့ထိၬၥၭထိၬ ဒဲၥုၪ့ဎွံၫၥၭယီၫတၭ, ၥံၫကျံၩအၪ့အူၭ",
			"5": "<sup>5</sup> ထၪ့ဆၧဆံၭ.- ၥံၫကျံၩအၪ့အူၭထၪ့ယဟိဝၩလၧနါဒံၩ့",
			"6": "<sup>6</sup> လၧနါဒံၩ့ဒဲဆၧၥံၫကျံၩအလူဆ့ဆံၭ.- ပံၩၥံၪခဲၫၥံၪဒဲခွ့ၩ အၥီၫနီၪမၩဆၧၥၭထိၬအၥီၫဖၭဒိၪ လၧစဎွၩယဟိဝၩ အမ့ၬယၫဆံၭ.",
			"7": "<sup>7</sup> မွဲမၫဆမံၭၥီၫထၪ့, ဒဲအဆၧလၧၫ့ဆၧဎွ့ၩးဂၪ့ခိၪဒဲၦ အီၪဝ့ၫလၧအလီၩ့ဆ့ဆံၭ.",
			"8": "<sup>8</sup> မွဲထံၫလုၬဘံၭဆၧဒဲၩအစူၪဆံၭ, မွဲခိၪလီၩ့ထိၩ့ချိၬ ၥုၪ့ဎွံၫၥၭယီၫလစီၪ့ဎး လၧယဟိဝၩအမ့ၬယၫဆံၭ.",
			"9": "<sup>9</sup> အဂဲးဘဲၫယီၩအဝ့ၫဂဲၫဝ့ၫဘဲၫၥိၭ အမိစ့ၩရၫ့ဂၪ့ခိၪလီၫ. တၭမိစ့ၩရၫ့ၦဂၪ့ခိၪဖိၪ လၧဆၧတီၩဆၧလီၩ့ ဒဲၦခမျၧး ၥံၪလၧဆၧမွဲဆၧတီၩလီၫ."
		},
		"99": {
			"1": "<sup>1</sup> ယဟိဝၩပၧၩ့ဆၧ, မွဲၦဆၨၩၥံၪဝၭထိၬဆံၭ. အဝ့ၫ နီၪဆၧၫ့နၩ့ဝ့ၫလၧခ့ၫရူၬၥံၪအဖၫ့ခိၪတၭ, မွဲဂၪ့ခိၪဝၭဝ့ၫ ဒၪဆံၭ.",
			"2": "<sup>2</sup> ယဟိဝၩဒိၪဝ့ၫလၧဇံအိၫ့အဖၧၩ့တၭ, အီၪထၪ့ထီၫ",
			"3": "<sup>3</sup> ဝ့ၫလၧၦဆၨၩၥံၪ ထီးအလူၬအဖၫ့ခိၪလီၫ.- နမံၩ့လၧ အမွဲအဒိၪဒဲဆၧၥၭမဲၪအလးနီၪ မွဲၦစံၭထၪ့အၪ့အူၭဝ့ၫ",
			"4": "<sup>4</sup> ဆံၭ.အနီၪမွဲဆံၫ့ဎံၪဝ့ၫလီၫ.- စဎွၩလၧအဂဲးဆီၪ့အ ဘၭဆီၪ့နီၪအဲၪဆၧစ့ၩရၫ့တီၩတၭ, နဒုၭအီၪဂုးအီၪခၧၫ့ ဆၧတီၩဆၧလီၩ့လီၫ. နမၩဆၧစ့ၩရၫ့တီၩ, ဒဲဆၧတီၩ ဆၧလီၩ့လၧယၫကူၭအဖၧၩ့လီၫ.",
			"5": "<sup>5</sup> အီၪက့ၪထၪ့ထီၫယဟိဝၩပယွၩတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ ထီးအခၪ့ယဲးလၩ့ထံၭနီၪဆံၭ. အဝ့ၫဒၪနီၪမွဲဆံၫ့ဎံၪဝ့ၫလီၫ.",
			"6": "<sup>6</sup> စမိစ့ၭ, ဒဲစအၫရၧၫ့လၧအၡၩလုဆၧအကျၩ,ဒဲစစၫ မုၫအ့လၭ လၧၦလၧအကိၭထၪ့အမံၩ့အကျၩနီၪးအဝ့ၫ",
			"7": "<sup>7</sup> ၥံၪကိၭထၪ့ယဟိဝၩတၭ, အဝ့ၫဒၪခိၭနၪဝ့ၫလီၫ.- တၭ အဝ့ၫချဲၩ့ဒုၪ့အဝ့ၫၥံၪ လၧဆၧအုၪ့အထုၪ့ အဖၧၩ့နီၪ လီၫ.အဝ့ၫၥံၪထီးန့အဆၧထိးအၥၭ, ဒဲဆၧမၪလူၬလၧ",
			"8": "<sup>8</sup> အဖ့ၪလၫ့ဝ့ၫလဖၪနီၪလီၫ.- ယဟိဝၩ,ပယွၩဧ့, နစံၭ ဆၧၫ့အဝ့ၫၥံၪလီၫ. နမွဲယွၩလဂၩ လၧအဖျါခွံၬအဝ့ၫ ၥံၪအဆၧမၪတၭ, နမၩဆၧၫ့ထဲၩ့ဆၧအၧၩ့လၧအဝ့ၫၥံၪ အဆၧမၩအကၠီၩ့လီၫ.",
			"9": "<sup>9</sup> အီၪက့ၪထၪ့ထီၫယဟိဝၩပယွၩတၭ,ဘိၪ့ထၪ့ဘၩ ထၪ့ ဆၧလၧအခိၪလီၩ့ဆံၫ့ဎံၪ အလီၩ့နီၪဆံၭ. အဂဲး ဘဲၫယီၩယဟိဝၩပယွၩနီၪမွဲဆံၫ့ဎံၪဝ့ၫလီၫ."
		},
		"100": {
			"1": "<sup>1</sup> ကယဲဂၪ့ခိၪဖိၪထီးအလူၬၥံၪဧ့, ကိၭၡၭထၪ့လၧယ ဟိဝၬဆံၭ.",
			"2": "<sup>2</sup> မၩယဟိဝၩအဆၧလၧၥၭထိၬ, ဂဲၫလၧအအီၪလၧ",
			"3": "<sup>3</sup> ဆၧၥံၫကျံၩမုၬမုၬဆံၭ.- ၥ့ၪယၫလၧယဟိဝၩမွဲယွၩ ဆံၭ.အဝ့ၫဒၪနီၪတဲၩ့လၩ့ပၧၩတၭ, ပမွဲအဝ့ၫဒၪအဆၧ, ပမွဲအၡၩခမျၧး, ဒဲအဆၧအၪ့ဆၪအလးအၥိၪလဒီၪ့",
			"4": "<sup>4</sup> လီၫ.-တၭဂဲၫနုၬလၧအတရၫ့ၥံၪ လၧဆၧစံၭထၪ့အၪ့ အူၭအခိးအတၩး ဒဲလၧအဝၩ့လဖၪလၧဆၧၥံၫကျံၩ အၪ့အူၭထၪ့ဝ့ၫဆံၭ. တၭစံၭထၪ့အၪ့အူၭအခိးအတၩ,",
			"5": "<sup>5</sup> ဒဲၥံၫကျံၩထၪ့အမံၩ့ဆံၭ.- အဂဲးဘဲၫယီၩယဟိဝၩနီၪ ဂ့ၩဝ့ၫတၭ,အခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪ, ဒဲအ ဆၧမွဲဆၧတီၩအီၪဝ့ၫ လဆိၩဘၪလဆိၩ လဆိၩဘၪ လဆိၩလီၫ."
		},
		"101": {
			"1": "<sup>1</sup> ယမိၥံၫကျံၩထၪ့လၧဆၧအခိးအတၩ, ဒဲဆၧစ့ၩရၫ့ အဂဲးအကၠီၪ့နီၪ, ယဟိဝၩဧ့, ယမိစံၭထၪ့အၪ့အူၭနၧၩ",
			"2": "<sup>2</sup> လီၫ.- ယမိထီးလၩ့ယၥၭလၧဖၧၩ့ၥၭ လၧၫ့လၧၫ့ဎွ့ၩ ဎွ့ၩလဘီၩ့အဖၧၩ့လီၫ. တၭနမိဂဲၫလၧယအီၪဆံၭယံၬ ခိၬလဲၪ. ယမိလ့ၩဆၧလၧယၥၭလၧၫ့ဎွ့ၩ လၧယဂံၪ့",
			"3": "<sup>3</sup> ဖၧၩ့လီၫ.- ဆၧမၩအၧၩ့နီၪမိအီၪက့ၪလၧယမ့ၬယၫ နးမံၩ့အ့ၬ. ၦလၧအမၩမၪဆၧနီၪယမ့ၬလဲၩအဆၧမၩ",
			"4": "<sup>4</sup> တၭးမိဘုၭထၬလၧယလီၩ့အ့ၬ.- ဆၧၥၭကဲၪ့မိဘၪစဲၪ့ ဖၭလၧယၧၩတၭး ၦၡၩအအၧၩ့နီၪ ယမိၥ့ၪယၫအဝ့ၫ",
			"5": "<sup>5</sup> အ့ၬ.- ၦလၧအခဲၪၦလၧအနဲၩ့ထံၭနီၪ ယမိနၫ့ထၪ့ခွံၬ ဝ့ၫလီၫ. ၦလၧအအီၪက့ၪအမ့ၬထၪ့ထီၫတၭ, အီၪက့ၪ",
			"6": "<sup>6</sup> ဖိၫလိၫအၥၭနီၪယထိးနၧၩ့အ့ၬ.- တၭယမ့ၬၥၪမိအီၪ လၧၦအတီၩအလီၩ့လဖၪအလီၩ့ လၧထံၫၥံၪခးၥံၪအ ဖၧၩ့ဘဲၫၥိၭအမိအီၪလၧယၥိၭလီၫ. တၭၦလၧအလ့ၩ ဆၧလၧဖၧၩ့ၥၭ အလၧၫ့အဎွ့ၩလဘီၩ့နီၪ မိမၩယဆၧ",
			"7": "<sup>7</sup> လီၫ.- ၦလၧအအၪ့လီၫဆၧနီၪ မိအီၪဘၪလၧယဂံၪ့ဖၧၩ့ အ့ၬ. ၦလၧအချဲၩ့ဆၧအဘျံၭအဘျၪ မိအီၪဂုးအီၪခၧၫ့",
			"8": "<sup>8</sup> လၧယမ့ၬယၫဆ့အ့ၬ.- ဘဲၫၥိၭယမိဒၪ့ထ့ၬခွံၬၦၡၩမၩ ဆၧအၧၩ့ထီးအလူၬလၧယဟိဝၩအဒိၩ့ဖၧၩ့နီၪ, ယမိ မၩဂၭဂီၩ့လဂီၩဘၪလဂီၩ လဂီၩဘၪလဂီၩကယဲၦလ တီၩလလီၩ့ဘၪလၧခးဖၧၩ့ထီးအလူၬလီၫ."
		},
		"102": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, ခိၭနၪယဆၧဘၩဆိၪဖၪတၭ, ဆၧလၧ",
			"2": "<sup>2</sup> ယအၪ့ကံၩ့နီၪ, မွဲအလ့ၩနုၬလၧနအီၪဆံၭ.- တၭမုနံၩ မုနၩလၧယဘၪဆၧခိဆၧဝီၩနီၪ ထီးမၩဘံၭနမ့ၬလၧ ယၧၩလဂ့ၩ,ဒိၭနနါလၧယၧၩဆံၭ. မုလနံၩ လၧယ ကိၭထၪ့နၧၩတၭ, စံၭဆၧၫ့ယၧၩချဲၫ့ချဲၫ့ဆံၭ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ ယမုနံၩဒံၩခွံၬဝ့ၫဘဲၫမ့ၪခူၪအၥိၭတၭ,",
			"4": "<sup>4</sup> မ့ၪအၪ့ယဎွံၪၥံၪဘဲၫၥံၪ့မုအၥိၭနီၪလီၫ.- ယၥၭဘၪဆၧ ကျီၪ့ခွံၬတၭ, ဎဲၫ့ထၪ့ခွံၬဘဲၫနၪ့ၥံၪမံၩ့ၥံၪအၥိၭ ထီးယ",
			"5": "<sup>5</sup> ၥၭနၪ့အၪ့ဆၧလီၫ.- မွဲယဂၪ့အုၩ့ဂၪ့ထိၬဆၧအၥီၫအ",
			"6": "<sup>6</sup> ကၠီၩ့တၭ, ယဎွံၪဘုၭထၬလၧယယၪလီၫ.- ယလၩ့ဂၬ ဘဲၫစၭကဝၭလၧမံၩ့လၬကျၩ, ယလၩ့ဂၬဘဲၫထိၪပဂူၪ",
			"7": "<sup>7</sup> လၧဆၧအီၪယူဝ့ၫအလးအၥိၭနီၪလီၫ.- ယအီၪခိၭ တၭ,ယမၩယၥၭဘဲၫထိၪဎွံၭ အီၪလဘံၪ့ဎးလၧဂံၪ့ခိၪ",
			"8": "<sup>8</sup> အၥိၭနီၪလီၫ.- တၭယဒုၪယဒၩဒုၪဒွ့ၪယၧၩ ၥံၫ့နံၩချီၩ့, ဒဲလၧအအီၪက့ၪဖိၫလိၫအၥၭ လၧယဖၫ့ခိၪ ဆိၪလၩ့",
			"9": "<sup>9</sup> အၥၭထၫ့ဒုၪဒၩယၧၩလီၫ.- အဂဲးဘဲၫယီၩယအၪ့ဖံၫ့ ချၪဘဲၫကိၪအၥိၭနီၪတၭ, ယလဲၩဎုၬယဆၧအီၩလၧ",
			"10": "<sup>10</sup> မ့ၬထံၫလီၫ.- မွဲလၧနၥၭထၪ့, ဒဲနၥၭခဲၩထၪ့အကၠီၩ့း အဂဲးဘဲၫယီၩ နအီၪက့ၪထၪ့ထီၫယၧၩတၭ, နခွံၬလၩ့",
			"11": "<sup>11</sup> ယၧၩဆ့လီၫ.- ယမုနံၩမုနၩလဖၪ မၩအၥၭဘဲၫဆၧ လၩၡုၪထုၭထီၫထၪ့အၥၭ အၥိၭနီၪတၭ, ယဝ့ၫဒၪယီၩ ယဎဲၫ့ထၪ့ခွံၬဘဲၫနၪ့ၥံၪမံၩ့ၥံၪအၥိၭနီၪလီၫ.",
			"12": "<sup>12</sup> အ့ၪမွဲနၧၩ,ယဟိဝၩဧ့, နဆၧၫ့နၩ့ဎလၧလးဆီၩ့ဆီၭ လၩ့ဆိၩလၩ့ကၠၪ,ဒဲဆၧနၪ့ထၪ့ထဲၩ့နၧၩနီၪ အီၪဝ့ၫအ",
			"13": "<sup>13</sup> ဆိၩဆိၩအကၠၪကၠၪလီၫ.- နမိဂဲထုၪ့တၭ, နမိယၫ့ၥုၪ့ ယၫ့ၥၭဇံအိၫ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧဖၭနံၩဖၭၥၫ့အ",
			"14": "<sup>14</sup> ထီလၧဆၧမိယၫ့ၥုၪ့ယၫ့ၥၭအဝ့ၫနီၪဘၪယူၭ.- အဂဲး ဘဲၫယီၩ နခ့ၫနၡၩမုၬလၩအၥၭ လၧအလိးလဖၪတၭ,",
			"15": "<sup>15</sup> အဲၪအဂၪ့ခိၪမုၬဒၪလ့ၬဆ့လီၫ.- တၭၦဆၨၩၥံၪမိၥၭ မဲၪယဟိဝၩအမံၩ့, ဒဲကယဲဂၪ့ခိၪအစဎွၩၥံၪနလၩဖၩ့",
			"16": "<sup>16</sup> လီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩမၩထၪ့ထဲၩ့ဇံအိၫ့တၭ,",
			"17": "<sup>17</sup> မိအီၪဖျီၪထၪ့လၧအလၩအဖၩ့အဖၧၩ့လီၫ.- မိကၠၪအၥၭ လၧၦၡၪ့ဖိၪယၬဖိၪအဆၧဘၩဆိၪဖၪအအီၪတၭ, မိမၩ",
			"18": "<sup>18</sup> ကြၩ့ထမးအဆၧဘၩဆိၪဖၪဆ့အ့ၬ.- ဆၧယီၩမိဘၪ ကွ့ၭအၥၭ, လၧၦလၧအမိဂဲၫလၧခဲၫ့လဆိၩအဂးတၭ, ၦလၧအမိဘၪဆၧမၩကဲၪထၪ့ဝ့ၫ လဆၨၩမိစံၭထၪ့အၪ့",
			"19": "<sup>19</sup> အူၭယဟိဝၩလီၫ.- ယဟိဝၩယိလၩ့ဆၧလၧအလး ဆံၫ့ဎံၪထၪ့ထီၫး လၧမူၭခိၪနီၪယဟိဝၩယိလၩ့ဝ့ၫလၧ",
			"20": "<sup>20</sup> ဂၪ့ခိၪး- ဘဲၫၥိၭအမိနါဂၧၫ့ၦဘၪစၧၩ့ထၬအၥၭအဆၧ ဂၪ့အုၩဂၪ့ထိၬ, ဘဲၫၥိၭအမိဖျါခွံၬၦလၧအဘၪဆၧစ့ၩ",
			"21": "<sup>21</sup> ရၫ့ၥံၫ,- ဘဲၫၥိၭၦမိလီၩလၩ့လၬလၩ့ ယဟိဝၩအမံၩ့ လၧဇံအိၫ့အလီၩ့, ဒဲအဆၧစံၭထၪ့အၪ့အူၭ လၧယရု",
			"22": "<sup>22</sup> စလံၫ့အဖၧၩ့နီၪလီၫ.- မွဲလၧၦဆၨၩၥံၪထီးအ့ၪအီၪ ကီၪ့လစီၪ့ဎး, ဒဲလၧဘၩ့မုးဖိၪၥံၪ, ဘဲၫၥိၭအမိမၩယ ဟိဝၩအဆၧအကၠီၩ့လီၫ.",
			"23": "<sup>23</sup> အဝ့ၫဒၪမၩလၩ့ဆါထဲၩ့ ယဂဲးယဘၭလၧဖၧၩ့ၥၭ",
			"24": "<sup>24</sup> အဖၧၩ့တၭ, မၩလၩ့ဖၨၪယမုနံၩမုနၩလဖၪလီၫ.- ယ စံၭ,ယယွၩဧ့, မၩန့ထၪ့ခွံၬယၧၩ လၧယမုနံၩဖိၭဖၫ့လ ဂ့ၩၬနနံၪ့နလၩအီၪဝ့ၫ အဆိၩဆိၩ အကၠၪကၠၪလီၫ.",
			"25": "<sup>25</sup> လၧဖျိၩ့နီၪ နအီၪက့ၪလၩ့ဂၪ့ခိၪတၭ, မူၭခိၪနီၪမွဲနစူၪ",
			"26": "<sup>26</sup> အဆၧမၩဆ့လီၫ.- အဝ့ၫၥံၪမိထီၩ့လၧဆၧဂၭဂီၩ့, အ့ၪမွဲနဝ့ၫဒၪယီၩ နမိအီၪဂုးခၧၫ့လီၫ. တၭအဝ့ၫၥံၪမိ လးလံၩဝ့ၫထီးအလူၬ ဘဲၫဆၧကီၩ့ဆၧၥိၭ အၥိၭနီၪတၭ, ဘဲၫဆဲၫ့လဘံၪ့အၥိၭ နမိအၪ့လဲၩဝ့ၫတၭ, အဝ့ၫၥံၪမိ",
			"27": "<sup>27</sup> ဘၪဆၧအၪ့လဲၩခွံၬဝ့ၫဒၪလီၫ.- အ့ၪမွဲနဝ့ၫဒၪယီၩ, နမွဲ",
			"28": "<sup>28</sup> ဘဲၫလးလးတၭ, နနံၪ့နလၩအထုၬအီၪအ့ၬ.- နခ့ၫနၡၩ အဖိၪအလံၩမိအီၪဂုးခၧၫ့ဎလၧခးဖၧၩ့ၭတၭ, အဝ့ၫၥံၪ အချံၫအၥၪမိအီၪဂုးအီၪခၧၫ့လၧနမ့ၬယၫလီၫ."
		},
		"103": {
			"1": "<sup>1</sup> ယၥၭၡီၩ့ဧ့,စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ. ဒဲကယဲ ဆၧလၧယဖၧၩ့ဧ့,စံၭထၪ့အၪ့အူၭ အမံၩ့ဆံၫ့ဎံၪနီၪ",
			"2": "<sup>2</sup> ဆံၭ.- ယၥၭၡီၩ့ဧ့, စံၭထၪ့အၪ့အူၭ ယဟိဝၩဆံၭ. တၭအဆၧမၩဂ့ၩလဖၪနီၪ မွဲနထီးၥၭနၪ့နးမံၩ့လဂ့ၩ.",
			"3": "<sup>3</sup> အဝ့ၫလဂၩနီၪမွဲၦလၧအဖျါခွံၬ နဆၧၥူၭဆၧမၪထီးအ လူၬ,ဒဲမၩဘျၪထဲၩ့ နဆၧစူၭဆၧဆၫ ကိၭအမံၩ့ဒ့ၭး",
			"4": "<sup>4</sup> အဝ့ၫဒၪဎွ့ၩန့ထဲၩ့ နၥၭမၧၫ့လၧဆၧဂၭဂီၩ့အဖၧၩ့နီၪ, ဒုၭချႃၬထၪ့နၧၩလၧဆၧအဲၪအခိးအတၩ ဒဲဆၧယၫ့ၥုၪ့",
			"5": "<sup>5</sup> ယၫ့ၥၭလဖၪအၥရဖူၩတၭ,- အဝ့ၫဒၪဒုၭဘျဲၩအၪ့န နိၭလၧဆၧဂ့ၩၥံၪတၭ,နၥၭလၩ့ဘၪ့ထဲၩ့ဘဲၫလံၬ ကျီၫ့ ကျီၫ့အၥိၭနီၪလီၫ.",
			"6": "<sup>6</sup> ယဟိဝၩမၩဆၧတီၩဆၧလီၩ့, ဒဲဆၧစ့ၩရၫ့လၧက",
			"7": "<sup>7</sup> ယဲၦလၧအဘၪဆၧမၩအၧၩ့မၩနၭဝ့ၫအဂးလီၫ.- တၭ အဝ့ၫဒၪဒုၭၥ့ၪယၫစမိစ့ၭလၧအဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭ, ဒဲၦအံၫစ",
			"8": "<sup>8</sup> ရ့လၭအဖိၪၥံၪလၧအဆၧဖံၭဆၧမၩလီၫ.- ယဟိဝၩ ၥုၪ့အီၪၥၭအီၪဆၧ, ဒဲယၫ့ၥုၪ့ယၫ့ၥၭဆၧလီၫ. ၥၭထၪ့",
			"9": "<sup>9</sup> ကၪတၭ,အခိးအတၩအီၪအၪမၬလီၫ.- တၭအၪ့ၥီၪ့ ဆၧလထံၪဎးလဘီၩ့ဎးအ့ၬး တၭအီၪက့ၪအဆၧၥၭ",
			"10": "<sup>10</sup> ထၪ့လၩ့ဆိၩလၩ့ကၠၪဆ့အ့ၬ.- အဝ့ၫဒၪမၩပၧၩဘဲၫပ ဆၧဒဲၩဘၭအၥိၭနီၪဆ့အ့ၬ. ဖ့ၪဆၧၫ့ထဲၩ့ပၧၩဘဲၫပ",
			"11": "<sup>11</sup> ဆၧၥူၭဆၧမၪအၥိၭဆ့အ့ၬ.- အဂဲးဘဲၫယီၩဘဲၫမူၭခိၪ ဆီၩ့ဆီထၪ့လၧဂၪ့ခိၪအဖၫ့ခိၪအၥိၭနီၪ အခိးအတၩ ဒိၪဝ့ၫလၧၦလၧအၥၭမဲၪအဝ့ၫအဖၫ့ခိၪ ဘဲၫနီၪအၥိၭဆ့",
			"12": "<sup>12</sup> လီၫ.- ဘဲၫမုထၪ့လခီၫယဲၩ့ဝ့ၫ လၧမုနုၬလခီၫအၥိၭနီၪ, အဝ့ၫဒုၭယဲၩ့ထၪ့ ပဆၧၥူၭဆၧမၪ လၧပၧၩဘဲၫနီၪၥိၭ",
			"13": "<sup>13</sup> ဆ့လီၫ.- တၭဘဲၫဖါအၥၭအီၪအဖိၪအလံၩအၥိၭနီၪ, ယဟိဝၩအၥၭအီၪ ၦလၧအၥၭမဲၪအဝ့ၫ ဘဲၫနီၪအၥိၭ",
			"14": "<sup>14</sup> ဆ့လီၫ.- အဂဲးဘဲၫယီၩမွဲအၥ့ၪယၫပမိၡါတၭ, နၪ့ထၪ့",
			"15": "<sup>15</sup> ထဲၩ့လၧပမွဲဂၪ့ခိၪအမုၬလီၫ.- ဆၧလၧၦၡၩယီၩ, အမု နံၩမၩအၥၭ ဘဲၫနၪ့ၥံၪမံၩ့ၥံၪအၥိၭတၭး ဘဲၫဖီၫလၧ",
			"16": "<sup>16</sup> ဆၧပျၩ့ဖၧၩ့အၥိၭနီၪ, ဖီၫထၪ့ဝ့ၫဘဲၫနီၪၥိၭလီၫ.- အ ဂဲးဘဲၫယီၩလံၩအူၪဘၪဝ့ၫတၭ, လအီၪလၧၩ့ဘၪနီၪ,",
			"17": "<sup>17</sup> အလးၥ့ၪယၫလၧၩ့ဝ့ၫအ့ၬ.- အ့ၪမွဲယဟိဝၩအခိးအ တၩဘၪ ၦလၧအၥၭမဲၪအဝ့ၫလဖၪနီၪ လၧဖျိၩ့လၧအ ဆိၩဆိၩအကၠၪကၠၪ, ထီၩ့လၩ့လၧအဆိၩဆိၩ အကၠၪ ကၠၪဒဲအဆၧတီၩဆၧလီၩ့ အီၪလၧဖိၪဆိၩလံၩဆိၩး",
			"18": "<sup>18</sup> လၧၦလၧအထီးန့ဆၧအုၩ့လၩ့ ဒဲနၪ့ထၪ့ထဲၩ့အဆၧ မၪလူၬၥံၪဘဲၫၥိၭအမိထီးန့မၩဝ့ၫလီၫ.",
			"19": "<sup>19</sup> ယဟိဝၩအီၪက့ၪလၩ့ အလးဆီၩ့ဆီ ဂုးခၧၫ့လၧမူၭ ခိၪတၭ, အဘၩ့အမုးနီၪပၧၩ့ဘၪဆၧထီးအလူၬလီၫ.",
			"20": "<sup>20</sup> အၥီၫ့လၧအဂဲးဆီၪ့အဘၭဆီၪ့, ဒဲမၩဆၧတၭ, ခိၭ နၪအဆၧချဲၩ့အၥီၫ, နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့အူၭယဟိ",
			"21": "<sup>21</sup> ဝၩဆံၭ.- ကယဲအၡၩၥုၭမုခမျၧးအခ့ၫအၡၩၥံၪလၧအ မၩထီးဒၪယွၩအၥၭ, နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့အူၭယဟိ",
			"22": "<sup>22</sup> ဝၩဆံၭ.- ကယဲဆၧလၧယဟိဝၩမၩကဲၪထၪ့ဝ့ၫကိၭ မံၩ့ဒ့ၭအီၪဝ့ၫလၧအဘၩ့အမုးအဖၧၩ့ လစီၪ့လါလါ ၥံၪဧ့,စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ. ယၥၭၡီၩ့ဧ့, စံၭ ထၪ့အၪ့အူၭယဟိဝၩဆံၭ."
		},
		"104": {
			"1": "<sup>1</sup> ယၥၭၡီၩ့ဧ့,စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ. ယဟိ ဝၩယယွၩဧ့, နဝ့ၫဒၪနဒိၪမၬလီၫ. နကီၩ့နၥိၭမွဲဆၧလၩ",
			"2": "<sup>2</sup> ဖၩ့,ဒဲဆၧစီၩ့ဆၧမၩ့လီၫ.- တၭနလုၬဘံၭနနၫ့ဆါဒၪန ဝ့ၫလၧဆၧဖၩ့ဘဲၫလၧဖၬဘဲၩ့အၥိၭနီၪ, နပၠၪထၪ့မူၭခိၪ",
			"3": "<sup>3</sup> ဘဲၫကလကၫအၥိၭနီၪ,- နမွဲၦလၧအမၩအဒူၭလၧထၭ လဖၪလၧထံၫကျၩတၭ, မၩအလဲၪ့ၥုၭလၧဆၧအုၪ့လ",
			"4": "<sup>4</sup> ဖၪတၭ, ထူၬဆၧလၧလံၩအဒံၭအဖၫ့ခိၪလီၫ.- တၭမွဲ အအီၪက့ၪလံၩလၧအၥီၫ့, ဒဲမ့ၪလၪလၧအမွဲအခ့ၫအ",
			"5": "<sup>5</sup> ၡၩလီၫ.- အီၪက့ၪဂၪ့ခိၪအခၪ့ထံၭနီၪ, ဘဲၫၥိၭအလဂဲၩ လဝၭဘၪအဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"6": "<sup>6</sup> တၭနလုၬဘံၭဝ့ၫလၧမၫဆမံၭ ဘဲၫဆၧကီၩ့ဆၧၥိၭ အၥိၭနီၪတၭး ထံၫၥံၪအီၪဝ့ၫလၧခိၪလီၩ့ထိၩ့ချိၬအဖၫ့",
			"7": "<sup>7</sup> ခိၪလီၫ.- တၭလၧနအၪ့ၥီၪ့ဆၧနီၪ အဝ့ၫၥံၪစဲၪ့ဖျိၭဝ့ၫး လၧနလၫ့ဎွံၩ့ၥီၫအကၠီၩ့နီၪ စဲၪ့ခွံၬဝ့ၫချဲၫ့ချဲၫ့လ့ၬလီၫ.",
			"8": "<sup>8</sup> ခိၪလီၩ့ၥံၪထၪ့ဝ့ၫတၭ, ထိၩ့ချိၬၥံၪလၩ့ဝ့ၫ ထီးအလး",
			"9": "<sup>9</sup> လၧနအီၪက့ၪလၧအဂးလီၫ.- နအီၪက့ၪလၩ့အဆၧၫ့ တၭ,အဝ့ၫၥံၪခၫ့ဂၬဝ့ၫအ့ၬ. တၭမိဂဲၫထဲၩ့ထဲၩ့ဘဲၫၥိၭ",
			"10": "<sup>10</sup> အမိလုၬဘံၭဒီၭဂၪ့ခိၪဆ့အ့ၬ.- အဝ့ၫဒၪအၪ့မၧၫ့လၩ့ ထံၫထၪ့ဖျိၭလၧခိၪလီၩ့ဆူၭဖၧၩ့ လၧအယွၩလၩ့လၧခိၪ",
			"11": "<sup>11</sup> လီၩ့ထိၩ့ချိၬအကျၩလီၫ.- ဆၧဖိၪဆၧဎါအမံၩ့လၧမံၩ့ လၬကျၩ ထီးအလူၬနီၪအီၩဝ့ၫတၭ, ကၥ့ၪယီၩ့ဘျဲၩ",
			"12": "<sup>12</sup> အီၩအၥၭလၧထံၫနီၪလီၫ.- ထိၪလၧမူၭခိၪအီၪဝ့ၫလၧ",
			"13": "<sup>13</sup> အဖၫ့ခိၪလၧၥံၪ့ထဲၩ့အကျၩဎွံၩ့ဝ့ၫလီၫ.- အဝ့ၫဒၪမၩ ဘၪစီၪခိၪလီၩ့ၥံၪလၧအဒူၭ လၧထၭလခီၫး ဂၪ့ခိၪနီၪ",
			"14": "<sup>14</sup> ဘျဲၩအၪ့လၧနမၩအၥၪလီၫ.- အဝ့ၫဒုၭမဲၪထၪ့နၪ့ၥံၪမံၩ့ ၥံၪလၧဆၧဖိၪဆၧဎါအဂး, ဒဲဘုၪၥံၪဂူၫၥံၪလၧၦၡၩအ ဂး,ဘဲၫၥိၭအမိဒုၭမဲၪထၪ့ဆၧအၪ့ လၧဂၪ့ခိၪဖၧၩ့လီၫ.",
			"15": "<sup>15</sup> လၧစဘံၭထံၫအကၠီၩ့ မၩဎွံၫၦၡၩအၥၭတၭ, မၩဖၩ့ ထၪ့ၦမ့ၬလၧၥိၪတၭ, မၩခၧၫ့ထၪ့ၦၡၩအၥၭ လၧကိၪ",
			"16": "<sup>16</sup> လီၫ.- ယဟိဝၩအၥံၪ့ဎွ့ၩဝ့ၫ လၧလ့ၭဘနၧၫ့အၥံၪ့ၡိၫ",
			"17": "<sup>17</sup> အ့ရ့ၭလၧအၥုၪ့ဝ့ၫ,- ထီးထိၪၥံၪလံၪၥံၪမၩအၥွံၫနီၪ,",
			"18": "<sup>18</sup> ၥံၪ့ၡိၫလဖၪမွဲထိၪဖၭဒိၪအဂံၪ့လီၫ.- ခိၪလီၩ့ထီၫလဖၪ မွဲလၧဘ့ၪမံၩ့အဂးတၭ, လိးၥံၪလဲၫ့ၥံၪမွဲဆၧဖီၩ့ဖျ့ၭအ လးလၧပဒဲၩအဂးလီၫ.",
			"19": "<sup>19</sup> အဝ့ၫဒၪအီၪက့ၪလၩ့လၩ လၧဆၧအဆၧၫ့အထီအ",
			"20": "<sup>20</sup> ဂး မုနီၪၥ့ၪယၫအလၩ့နုၬလီၫ.- နမၩဆၧခံၭတၭ, မု နၩအီၪထၪ့ဝ့ၫ, ထီးဆၧဖိၪဆၧဎါအမံၩ့လၧမံၩ့လၬကျၩ",
			"21": "<sup>21</sup> ထီးအလူၬနီၪဂဲၫထၪ့ဝ့ၫလီၫ.- ဆၬလၥၧၫ့ဖိၪဂၪ့ကိၭ လၧအဆၪအဂးတၭ, အၪ့ဎၬအဆၧအၪ့လၧယွၩလီၫ.",
			"22": "<sup>22</sup> မုထၪ့နီၪအဝ့ၫၥံၪထဲၩ့ဝ့ၫတၭ, ခိၬလၩ့ဝ့ၫလၧအအီၪ",
			"23": "<sup>23</sup> အလးဖၧၩ့နီၪလီၫ.- တၭၦၡၩလ့ၩထၪ့လၧအဆၧမၩ, ဒဲလၧအဆၧဖံၭဆၧမၩထီးမုဂၪလၩ့လီၫ.",
			"24": "<sup>24</sup> ယဟိဝၩဧ့, နမၩဆၧလမံၩ့ဘၪလမံၩ့လမံၩ့ဘၪလ မံၩ့အၪမၬလဲၪၬ နမၩဆၧထီးအလူၬ လၧဆၧကိၪ့ၥ့ၪ လီၫ.တၭဂၪ့ခိၪဎွ့ၩဝ့ၫ လၧဆၧဖိၪဆၧလံၩနစူၪလးန",
			"25": "<sup>25</sup> ခၪ့ခိၪလဖၪနီၪလီၫ.- မၫဆမံၭနီၪဒိၪဝ့ၫလဲဝ့ၫကိၭခီၫ ဒ့ၭတၭ,လၧအဖၧၩ့နီၪ, ဆၧအဂဲၩလၧဆၧဝံထၪ့နၬထၪ့ လၥ့ၪဘၪအီၪဝ့ၫတၭ, ဆၧဖိၪဆၧဎါအဒိၪဂ့ၩ, အဆံၭ",
			"26": "<sup>26</sup> ဂ့ၩ,အီၪဝ့ၫဆ့လီၫ.- ထီးနီၪကဘၩ့ၥံၪ လ့ၩဆၧတၭ, မၪလၧနမၩကဲၪထၪ့ဝ့ၫ ဘဲၫၥိၭအမိလိၬကွ့ၩ လၧအ",
			"27": "<sup>27</sup> ဖၧၩ့နီၪအီၪဝ့ၫလီၫ.- ဆၧထီးအလူၬနီၪ အီၪခိၭနၧၩ တၭ,လၧအဆၧၫ့အထီဘၪနီၪ နဖ့ၪလၫ့အဝ့ၫၥံၪလၧ",
			"28": "<sup>28</sup> အဆၧအၪ့လီၫ.- နဖ့ၪလၫ့ဝ့ၫတၭ, အဝ့ၫၥံၪအၪ့ထုၫ့ ထၪ့ဝ့ၫတၭး နပၠၪထၪ့နစူၪ, အဝ့ၫၥံၪဘျဲၩအၪ့လၧဆၧ",
			"29": "<sup>29</sup> ဂ့ၩလီၫ.- နအီၪက့ၪၥူၪနမ့ၬတၭ, အဝ့ၫၥံၪအၥုၪ့ခိၥၭ ဝီၩးနအၪ့မၩန့ခွံၬအၥၪ, အဝ့ၫၥံၪလၩ့ယံၭတၭ, ထဲၩ့",
			"30": "<sup>30</sup> ထဲၩ့လၧဂၪ့ခိၪအမုၬလီၫ.- နအၪ့မၧၫ့လၩ့နၥၭနီၪအဝ့ၫ ၥံၪဘၪဆၧမၩကဲၪထၪ့ဝ့ၫတၭ, နမၩၥၫ့ထၪ့ထဲၩ့ဂၪ့ခိၪ ချိၫ့လီၫ.",
			"31": "<sup>31</sup> မွဲယဟိဝၩ အလၩအဖၩ့အီၪဝ့ၫ လၩ့ဆိၩလၩ့ကၠၪ ဆံၭး မွဲအၥုၪ့ထိၬၥၭထိၬလၧအစူၪၥံၪမၩဆၧလဖၪအ",
			"32": "<sup>32</sup> ဖၧၩ့ဆံၭ.- အဝ့ၫဒၪယိလၩ့ဝ့ၫလၧဂၪ့ခိၪချိၫ့တၭ, အ ဆၧၡိၩ့ၡိၬ, အဝ့ၫဒၪထိၭခိၪလီၩ့ၥံၪတၭ, အဝ့ၫၥံၪခူၪ ထၪ့ဝ့ၫလီၫ.",
			"33": "<sup>33</sup> ယၥၭမၧၫ့ဒံၭအဘိၩ့ဘၭတၭ, ယမိစံၭထၪ့အၪ့အူၭ ယဟိဝၩ, ယအီၪဒံၭအဘိၩ့ဘၭတၭ, ယမိၥံၫကျံၩအၪ့ အူၭထၪ့ဆၧလၧယယွၩလီၫ.",
			"34": "<sup>34</sup> ယဆီၫ့မီၪ့အဂဲးအကၠီၪ့နီၪမုၬမၬတၭး ယဝ့ၫဒၪယီၩ, ယမိၥၭထိၬလၧယဟိဝၩအဖၧၩ့လီၫ.",
			"35": "<sup>35</sup> ၦဆၧဒဲၩဘၭဖိၪ မိဘၪဆၧမၩလူၬခွံၬဝ့ၫ လၧဂၪ့ခိၪ ချိၫ့တၭ, ၦလတီၩလလီၩ့ဘၪ လမိအီၪလၧၩ့ဘၪလီၫ. ယၥၭၡီၩ့ဧ့, စံၭထၪ့အၪ့အူၭ ယဟိဝၩဆံၭ. စံၭထၪ့ အၪ့အူၭယွၩဆံၭ."
		},
		"105": {
			"1": "<sup>1</sup> စံၭထၪ့အၪ့အူၭယဟိဝၩ, ကိၭထၪ့အမံၩ့းဒုၭၥ့ၪယၫ",
			"2": "<sup>2</sup> ၦခမျၧးၥံၪလၧအမၩဆၧနီၪဆံၭ.- ၥံၫကျံၩထၪ့အဝ့ၫ ဒၪတၭ,ၥံၫကျံၩအၪ့အူၭထၪ့အဝ့ၫတၭ, လီၩဘၪလိၬန",
			"3": "<sup>3</sup> ၥံၪအၥၭလၧအဆၧမၩလၩ့လၭထီးအလူၬအဂဲး,- အီၪ က့ၪဖိၫလိၫနၥံၪအၥၭလၧအမံၩ့ဆံၫ့ဎံၪအဖၧၩ့ဆံၭ. ၦ လၧအအၪ့ဎၬယဟိဝၩလဖၪနီၪ, မွဲအၥုၪ့ထိၬၥၭထိၬ",
			"4": "<sup>4</sup> လၧအၥၭခံဖၧၩ့ဆံၭ.- အၪ့ဎၬယဟိဝၩဒဲအဂဲးအဘၭ",
			"5": "<sup>5</sup> တၭ,အၪ့ဎၬအမ့ၬထံၪဎးဘီၩ့ဎးဆံၭ.- နၪ့ထၪ့ထဲၩ့ ဆၧလၩ့လၭ လၧအမၩယူၭဝ့ၫလဖၪနီၪ, အဆၧလၩ့",
			"6": "<sup>6</sup> လၭဒဲအဆၧစ့ၩရၫ့လၧအနိၭနီၪဆံၭ.- အခ့ၫအၡၩ စအၫဘြဟၫ့ အချံၫအၥၪၥံၪဧ့, ၦလၧအရွံန့ဝ့ၫစယၫ",
			"7": "<sup>7</sup> ကူၭ အဖိၪအလံၩၥံၪဧ့,- အဝ့ၫဒၪယဟိဝၩမွဲပယွၩ, အဆၧစ့ၩရၫ့လဖၪအီၪဝ့ၫ လၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫလီၫ.",
			"8": "<sup>8</sup> တၭအဝ့ၫဒၪနၪ့ထၪ့ထဲၩ့ ဆၧအုၩ့လၩ့အဆိၩအကၠၪ,",
			"9": "<sup>9</sup> ဆၧချဲၩ့လၧအမၪလူၬ ၦအဆိၩအထီၫ့ၥံၪလီၫ.- ဆၧ လၧအအုၩ့လၩ့ စအၫဘြဟၫ့, ဒဲအဆိၪလၩ့အၥၭလၧ",
			"10": "<sup>10</sup> စအံစၭနီၪ.- ဒဲအီၪက့ၪဂုးဝ့ၫ လၧဆၧၥီၪ့ဆၧၥၫ့လၧစ ယၫကူၭအဂး, ဒဲအံၫစရ့လၭ လၧဆၧအုၩ့လၩ့အဆိၩ",
			"11": "<sup>11</sup> အကၠၪအဂးလီၫ.- စံၭဝ့ၫဒၪ, ယမိဖ့ၪလၫ့နၧၩလၧခး",
			"12": "<sup>12</sup> ကၫနအၫ့,ဆၧဖၭန့လမံၩ့လၧနၥံၪန့ၥၫဆၧလီၫ.- လၧအ ဝ့ၫၥံၪအီၪၡၩဂၩနီၪတၭ, မွဲယူၭ,ၦၡၩဂၩ,ဒဲမွဲၦမွံၩလၧ",
			"13": "<sup>13</sup> အဖၧၩ့ဆ့လီၫ.- အဝ့ၫၥံၪလ့ၩဆၧလၧၦလဆၨၩထီၩ့ လၧၦလဆၨၩ, လၧလခီၫဘၩ့မုးထီၩ့လၧၦခမျၧးအဂူၫ",
			"14": "<sup>14</sup> ဂၩအအီၪလီၫ.- အဝ့ၫဒၪဖ့ၪလၫ့ၦမၩၡၪ့မၩနၭအဝ့ၫ ၥံၪနးဂၩအ့ၬ. တၭမွဲအအၪ့ၥီၪ့စဎွၩၥံၪလၧအဝ့ၫၥံၪအ",
			"15": "<sup>15</sup> ကၠီၩ့တၭဎစံၭဝ့ၫဒၪ,ၭ- ထီးထိၭယၡၩဂုၪအၥၭလဂ့ၩ, ဒဲမၩအၧၩ့ယမီၪၥံၪလဂ့ၩ.",
			"16": "<sup>16</sup> တၭအဝ့ၫဒၪကိၭန့ဆၧၥၭဝံလၩ့ဒိၩ လၧခးအဖၫ့ခိၪ,",
			"17": "<sup>17</sup> မၩခါကိၪအနိၪထိၭ ထီးအလူၬလီၫ.- အဝ့ၫအၪ့မၧၫ့ လၩ့ၦလဂၩလၧအဝ့ၫၥံၪအမ့ၬယၫ, စယိၥၭလဂၩလၧ",
			"18": "<sup>18</sup> အဘၪဆၧအၪ့ဆၫခွံၬဝ့ၫလၧဎီးအဂးလီၫ.- ၦမၩဆၫ အခၪ့လၧၥွ့ၫထၭတၭ, မၩၡၪ့မၩနၭဝ့ၫ လၧထၭအ",
			"19": "<sup>19</sup> ဖၧၩ့,- ထီးအဆၧၫ့အထီလၧအချဲၩ့ဆၧနီၪ ထီၩ့ဝ့ၫဒၪ တၭးယဟိဝၩ အဆၧချဲၩ့နီၪ မၩဖီၩ့ဖျ့ၭယူၭ အဝ့ၫ",
			"20": "<sup>20</sup> ယူၭ.- တၭစဎွၩအၪ့မၧၫ့လၩ့ဆၧမၩဖျ့ၭထၪ့ဝ့ၫ, ၦလၧ",
			"21": "<sup>21</sup> အပၧၩ့ၦခမျၧးလဂၩနီၪဖျါခွံၬအဝ့ၫလီၫ.- တၭအီၪက့ၪ ဝ့ၫလၧအဂံၪ့အကဆါ, ဒဲၦပၧၩ့အဆၧဖိၪဆၧလံၩထီး",
			"22": "<sup>22</sup> အလူၬ,- ဘဲၫၥိၭအမိစၧၩ့ထၬအၦဒိၪဖၭဒိၪလဖၪထီး ဒၪအၥၭ, ဒဲၥီၪ့လိၪအၡၩၥုၪ့က့ၭၥၭၡါ လၧဆၧကိၪ့ၥ့ၪ",
			"23": "<sup>23</sup> လီၫ.- အံၫစရ့လၭဂဲၫနုၬ လၧအံဇံၭအဖၧၩ့တၭ, စယၫ",
			"24": "<sup>24</sup> ကူၭအီၪၦမွံၩ လၧစဟၫ့အခးဖၧၩ့လီၫ.- အဝ့ၫဒၪဒုၭ အၪထၪ့အၡၩခမျၧးအၪအၪလ့ၬတၭ, ဒုၭဆီၪ့ထၪ့အ",
			"25": "<sup>25</sup> ဝ့ၫၥံၪအၪနဲၪ့အဒုၪအဒၩဒံၭလီၫ.- တၭဘိၭကၠၪၦလဖၪ အၥၭထီးအဝ့ၫၥံၪမ့ၬလဲၩအၡၩခမျၧး, ဒဲမၩအခ့ၫအ ၡၩလၧဆၧအၪ့လီၫလီၫ.",
			"26": "<sup>26</sup> အဝ့ၫဒၪအၪ့မၧၫ့အခ့ၫအၡၩစမိစ့ၭ, ဒဲစအၫရၧၫ့လၧ",
			"27": "<sup>27</sup> အရွံန့ဝ့ၫနီၪလီၫ.- အဝ့ၫၥံၪအီၪက့ၪဆၧမၩနဲၪ့လၩ့လၭ ဒဲဆၧလၩ့လၭလၧအဝ့ၫၥံၪ အကျၩထီးအလူၬလၧစဟၫ့",
			"28": "<sup>28</sup> အခးဖၧၩ့နီၪလီၫ.- အဝ့ၫဒၪအၪ့မၧၫ့လၩ့ဆၧခံၭ, ဆၧ",
			"29": "<sup>29</sup> ခံၭလၩ့ဝ့ၫတၭ, အဝ့ၫၥံၪပိၩ့ထၪ့အလူဆ့အ့ၬ.- အၪ့မၧၫ့ အထံၫၥံၪကဲၪထၪ့ဆၧၥွံၪတၭ, မၩၥံၫအဒ့ၪၥံၪယၪၥံၪ",
			"30": "<sup>30</sup> လီၫ.- အဝ့ၫၥံၪအထံၫအခးနီၪ ဖၭထၪ့န့ဒ့ၪလဖၪအၪ",
			"31": "<sup>31</sup> အၪလ့ၬလၧအစဎွၩအဒူၭဖၧၩ့လီၫ.- အဝ့ၫဒၪချဲၩ့ဆၧ တၭ,ဒူၩလၫဂဲၫထၪ့, ဒဲဆၧဎါအီၪထၪ့ ထၧၫ့ခးယၫ",
			"32": "<sup>32</sup> လီၫ.- အဝ့ၫဒၪဖ့ၪလၫ့မုၥၪလၧအဆၧဆၧၩ့အဂး, ဒဲမ့ၪ",
			"33": "<sup>33</sup> လၪလၧအခးဖၧၩ့လီၫ.- ဒဲအမၩဂၭဂီၩ့ အဝ့ၫၥံၪအစ ဘံၭမုလဖၪ, ဒဲအချိၪ့ဒိၩ့,ဒဲမၩခါလၩ့အၥံၪ့ၥံၪလၧအ",
			"34": "<sup>34</sup> နဲၩ့ထံၭလဖၪလီၫ.- အဝ့ၫဒၪချဲၩ့ဆၧတၭ, ထွ့အၪဘၫ ၥံၪဂဲၫထၪ့, ဒဲထွ့ယ့ၫလ့ၬနီၪတၭ, ဆၧဝံထၪ့နၬထၪ့ၥ့ၪ",
			"35": "<sup>35</sup> အ့ၬ.- တၭအဝ့ၫၥံၪအၪ့နၪ့ၥံၪမံၩ့ၥံၪ လၧအခးဖၧၩ့ထီးအ",
			"36": "<sup>36</sup> လူၬတၭ,အၪ့ဝ့ၫအဂၪ့ခိၪအဆၧၥၪဆ့လီၫ.- တၭအဝ့ၫ ဒၪကျီၪ့ခွံၬဝ့ၫ အဖိၪဝဲၡါထီးအလူၬ လၧအဝ့ၫၥံၪအခး",
			"37": "<sup>37</sup> ဖၧၩ့အဆၧဂဲးဆၧဘၭ ထီးအလူၬအခိၪလီၫ.- အဝ့ၫ ၥိၫ့ထၪ့ခွံၬအၡၩခမျၧးလၧကျိၪၥံၪ စ့ၩၥံၪ ဒဲထီၫ့ၥံၪလွ့ၫ ၥံၪ,ၦလၧအဂဲးဆါအီၪ လၧအဒီၪ့ၥံၪအကျၩနးဂၩအ့ၬ.",
			"38": "<sup>38</sup> ထီးအဝ့ၫၥံၪ စဲၪ့ထၪ့ခွံၬတၭ, ၦအံဇံၭဖိၪ ၥၭထိၬဝ့ၫ လီၫ.အဂဲးဘဲၫယီၩ မွဲဆၧၥၭမဲၪအဝ့ၫၥံၪလၩ့ဘၪလၧ",
			"39": "<sup>39</sup> အလီၩ့လီၫ.- အဝ့ၫဒၪဒၩလၩ့ဆၧအုၪ့နီၪ လၧဆၧချႃၬ ဘံၭအဂး, ဒဲမ့ၪလၧမုနၩလခီၫ ဘဲၫၥိၭအမိဖၩ့ထၪ့ဝ့ၫ",
			"40": "<sup>40</sup> လီၫ.- ၦအၪ့ကံၩ့ဝ့ၫတၭ, အဝ့ၫဒၪဒုၭဂဲၫထိၪဝံၪၥံၪတၭ,",
			"41": "<sup>41</sup> ဒုၭဘျဲၩအၪ့အဝ့ၫၥံၪ လၧမူၭခိၪအကိၪလီၫ.- အိၭထၪ့ လိးၥံၪလဲၫ့ၥံၪတၭ, ထံၫဖျိၭထၪ့ယွၩလၩ့ဝ့ၫ ဘဲၫထံၫချိၬ",
			"42": "<sup>42</sup> အၥိၭလၧဆၧအလး ဎဲၫ့ထၬအဖၧၩ့နီၪလီၫ.- အဂဲး ဘဲၫယီၩအဝ့ၫဒၪနၪ့ထၪ့ထဲၩ့ အဆၧချဲၩ့ဝဲၩဆံၫ့ဎံၪလၧ",
			"43": "<sup>43</sup> အခ့ၫအၡၩစအၫဘြဟၫ့း- တၭၥိၫ့ထၪ့ခွံၬအၡၩခမျၧး လၧၥုၪ့ဎွံၫၥၭယီၫ, အၡၩရွံန့ဖိၪ လၧၥုၪ့ထိၬၥၭထိၬ",
			"44": "<sup>44</sup> လီၫ.- တၭဖ့ၪလၫ့အဝ့ၫၥံၪ လၧၦဆၨၩလဖၪအထံၫအ",
			"45": "<sup>45</sup> ခးတၭ,န့ၥၫဆၧလၧၦခမျၧးအမၩဆၧနီၪ,- ဘဲၫၥိၭ အမိထီးန့အဆၧမၪလူၬ, ဒဲထီးန့ဖံၭထၬအဆၧၥီၪ့ဆၧ ၥၫ့လီၫ. နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့အူၭယွၩဆံၭ."
		},
		"106": {
			"1": "<sup>1</sup> စံၭထၪ့အၪ့အူၭယွၩဆံၭ. စံၭထၪ့အၪ့အူၭယဟိဝၩ ဆံၭ. အဂဲးဘဲၫယီၩအဝ့ၫဒၪဂ့ၩဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ",
			"2": "<sup>2</sup> အခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- မွဲပလၫမိ လီၩလၩ့လၬလၩ့ ယဟိဝၩအဆၧမၩလၧအဒိၪလဖၪ နီၪလဂၩလဲၪး မွဲပလၫမိဒုၭနါဂၧၫ့ အဆၧစံၭထၪ့အၪ့",
			"3": "<sup>3</sup> အူၭထီးအလူၬလဂၩလဲၪ.- တၭၦလၧအထီးန့အဆၧ စ့ၩရၫ့, ၦလၧအမၩဆၧတီၩဆၧလီၩ့ကိၭအဆၧၫ့အထီ",
			"4": "<sup>4</sup> ဒ့ၭနီၪဘၪဆိၪဂ့ၩဝ့ၫလီၫ.- နၪ့ထၪ့ထဲၩ့ယၧၩလၧဆၧ ဘၪနၥၭလၧနၡၩခမျၧး, ယဟိဝၩဧ့, အီၪၡီၩ့ယၧၩလၧ",
			"5": "<sup>5</sup> နဆၧထိးထဲၩ့တၩ့ထဲၩ့,- ဘဲၫၥိၭယမိဒၪဘၪနၡၩရွံန့ ၥံၪအဆၧဂ့ၩ, ဘဲၫၥိၭယမိၥၭထိၬ လၧနၡၩလဆၨၩအ ဆၧၥၭထိၬ, ဘဲၫၥိၭယမိၥုၪ့ဎွံၫၥၭယီၫလၧနဆၧန့ၥၫနီၪ",
			"6": "<sup>6</sup> ဆံၭ.- ပမၩယူၭဆၧဒဲၩဘၭဘဲၫပဖါၥံၪအၥိၭ, ပမၩမၪ",
			"7": "<sup>7</sup> ယူၭ,ပမၩယူၭဆၧလတီၩလလီၩ့ဘၪယူၭ.- ပဖါၥံၪ လယိဆီၫ့မီၪ့ဘၪနဆၧလၩ့လၭ လၧအံဇံၭအဖၧၩ့တၭ, နခိးနတၩအၪအၪလ့ၬနီၪ, အဝ့ၫၥံၪနၪ့ထၪ့ထဲၩ့ဆ့အ့ၬ. တၭအဝ့ၫၥံၪပိၩ့ထၪ့ဆၧလၧမၫဆမံၭနဲၩ့ထံၭ, ထီးမၫ",
			"8": "<sup>8</sup> ဆမံၭဝီၩအနဲၩ့ထံၭနီၪလီၫ.- အ့ၪမွဲအဝ့ၫဒၪ မၩဖီၩ့ မၩဖျ့ၭအဝ့ၫၥံၪ လၧအမံၩ့အကၠီၩ့ ဘဲၫၥိၭအမိဒုၭၥ့ၪ",
			"9": "<sup>9</sup> ယၫဝ့ၫလၧအစီၩ့ဒိၪအမၩ့ဒိၪလီၫ.- အဝ့ၫဒၪအၪ့ၥီၪ့ မၫဆမံၭဝီၩတၭ, လၩ့ၥံၭခွံၬဝ့ၫလီၫ. တၭအဝ့ၫဒၪဒုၭ လ့ၩအဝ့ၫၥံၪလၧထံၫယိၬဖၧၩ့ ဘဲၫလၧမံၩ့လၬကျၩအ",
			"10": "<sup>10</sup> ၥိၭနီၪလီၫ.- မၩဖီၩ့ဖျ့ၭအဝ့ၫၥံၪလၧၦလၧအမ့ၬလဲၩဝ့ၫ အစူၪဖၧၩ့တၭ, ဎွ့ၩန့ထဲၩ့ဝ့ၫလၧအဒုၪအဒၩအစူၪဖၧၩ့",
			"11": "<sup>11</sup> လီၫ.- တၭထံၫလုၬဘံၭအဝ့ၫၥံၪအဒုၪအဒၩတၭး အီၪ",
			"12": "<sup>12</sup> လၩ့ထးဝ့ၫနးဂၩအ့ၬ.- ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪနဲၩ့ထဲၩ့ ဝ့ၫအလူအထၫတၭ, ၥံၫကျံၩထၪ့ဝ့ၫလၧဆၧစံၭထၪ့အၪ့ အူၭနီၪလီၫ.",
			"13": "<sup>13</sup> အဝ့ၫၥံၪၥၭနၪ့ဝ့ၫအဆၧမၩချဲၫ့ချဲၫ့တၭ, ခိၭနၪအဆၧ",
			"14": "<sup>14</sup> ကိၪ့ထၪ့ဖၭလၩ့ဆ့အ့ၬ.- ၥၭကွံၩဆၧလၧၡါမုနၧၫ့ဖၫ",
			"15": "<sup>15</sup> တၭ,မၩခွါယွၩလၧပွ့ၪခိၪပွ့ၪနါအဖၧၩ့လီၫ.- ဆၧလၧ အဝ့ၫၥံၪအၪ့ကံၩ့ဝ့ၫနီၪ, မွဲအဖ့ၪလၫ့ဝ့ၫလါနၫ့ဘိၩ,ဒုၭ",
			"16": "<sup>16</sup> ဎွ့လၩ့အဝ့ၫၥံၪအၥၭခံဖၧၩ့လီၫ.- တၭအဝ့ၫၥံၪၥၭခ့ၬ စမိစ့ၭလၧၦၥုၪ့တဲၩအလးဖၧၩ့, ဒဲယဟိဝၩအၡၩဆံၫ့",
			"17": "<sup>17</sup> ဎံၪစအၫရၧၫ့နီၪလီၫ.- ဂၪ့ခိၪအိၭထၪ့အၥၭ ယုလၩ့ခွံၬ",
			"18": "<sup>18</sup> စဒၫၥၫ့တၭ,ချႃၬဘံၭစဘဲရၫ့အဆၧအီၪကီၪ့,- မ့ၪဆူၭ ခဲၩအၥၭလၧအဆၧအီၪကီၪ့အဖၧၩ့တၭ, မ့ၪလၪအၪ့",
			"19": "<sup>19</sup> ခွံၬၦလတီၩလလီၩ့ဘၪလဖၪနီၪလီၫ.- တၭအဝ့ၫၥံၪ တဲၩ့ချီဖိၪလၧဟိရ့ၭတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ဆၧဂၩ့ၥိၫ့",
			"20": "<sup>20</sup> ဝ့ၫလဒုၩနီၪလီၫ.- တၭအဝ့ၫၥံၪအၪ့လဲၩအလၩအဖၩ့",
			"21": "<sup>21</sup> လၧဆၧလၩ့ဂၬချီလၧအအၪ့နၪ့ၥံၪနီၪအဂးလီၫ.- အဝ့ၫ ၥံၪၥၭနၪ့ဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫ ယွၩလၧအမၩဆၧ",
			"22": "<sup>22</sup> ဒိၪလဖၪလၧအံဇံၭအဖၧၩ့,- ဆၧလၩ့လၭၥံၪလၧစဟၫ့ အခးဖၧၩ့, ဆၧၥၭမဲၪအလးလၧမၫဆမံၭဝီၩနီၪလီၫ.",
			"23": "<sup>23</sup> တၭအဝ့ၫဒၪစံၭဝ့ၫလၧအမိမၩဂၭဂီၩ့အဝ့ၫၥံၪနီၪး အ့ၪ လမွဲဘၪအၡၩရွံန့, စမိစ့ၭဆၧၫ့ထုၪ့လၧအမ့ၬယၫလၧ ဆၧမၩဂၭဂီၩ့ဆၧအဖၧၩ့, ဘဲၫၥိၭအမိဘိၭကၠၪခွံၬအ ဆၧၥၭထၪ့လၧအထီးမၩဂၭဂီၩ့ဆၧလဂ့ၩတၭ, မိမၩ ဝ့ၫလီၫ.",
			"24": "<sup>24</sup> အဝ့ၫၥံၪမၩကြၩ့ထမးထံၫမုၬခးမုၬတၭ, နဲၩအလူအ",
			"25": "<sup>25</sup> ထၫဆ့အ့ၬ.- အဝ့ၫၥံၪၥူၭဝံၪၥူၭလၩဆၧလၧအတဲၩလ",
			"26": "<sup>26</sup> ဖၪအဖၧၩ့တၭ,ခိၭနၪယဟိဝၩအလူအ့ၬ.- တၭအဝ့ၫဒၪ ယၩ့ထၪ့အစူၪလၧအဝ့ၫၥံၪအလီၩ့တၭ, မိမၩလၩ့ထံၩ",
			"27": "<sup>27</sup> ဖါဝ့ၫလၧၡါမုနၧၫ့ဖၫ,- မိမၩလၩ့ထံၩဖါအဝ့ၫၥံၪအချံၫ အၥၪလၧၦဆၨၩၥံၪအကျၩတၭ, မိမၩလၩ့မုလၩ့ဖၭ",
			"28": "<sup>28</sup> အဝ့ၫၥံၪလၧခးလဖၪအဖၧၩ့လီၫ.- တၭအဝ့ၫၥံၪမၪဘုၭ ထၬအၥၭလၧဘၫအလၭပံအီၫတၭ, အၪ့ဆၧၥံၫအဆၧ",
			"29": "<sup>29</sup> လုလဖၪလီၫ.- အဝ့ၫၥံၪမၩၥၭထၪ့အဝ့ၫနီၪ လၧအမၩ မၪဆၧလဖၪတၭ, ဆၧၥံၫချဲၫ့အီၪထၪ့လၧအကျၩလီၫ.",
			"30": "<sup>30</sup> ထီးနီၪလဖၧၫ့ စဖံနအၭ ဆၧၫ့ထုၪ့မၩဖီၩ့ဖျ့ၭဆၧတၭ,",
			"31": "<sup>31</sup> ဆၧၥံၫချဲၫ့အီၪထီဝ့ၫလီၫ.- တၭဆၧအီၪက့ၪဆၧနီၪလ မံၩ့လၧအဆၧတီၩဆၧလီၩ့အဂး, လဆိၩဘၪလဆိၩ",
			"32": "<sup>32</sup> လၩ့ဆိၩလၩ့ကၠၪလီၫ.- အဝ့ၫၥံၪမၩၥၭထၪ့ဝ့ၫထီးထံၫ မ့ရဘၫဆ့တၭ, စမိစ့ၭဘၪဆၧအၧၩ့ လၧအဝ့ၫၥံၪအ",
			"33": "<sup>33</sup> ကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမၩခိမၩဝီၩအၥၭတၭ, အဝ့ၫၥံၪချဲၩ့မၪဆၧလၧအနိၭလီၫ.",
			"34": "<sup>34</sup> ၦဆၨၩလဖၪလၧယဟိဝၩလီၩဘၪဝဲၩ အဂဲးအကၠီၪ့",
			"35": "<sup>35</sup> နီၪအဝ့ၫၥံၪမၩဂၭဂီၩ့အ့ၬ.- အ့ၪမွဲအမၩဎုၬအၥၭလၧ",
			"36": "<sup>36</sup> ၦဆၨၩၥံၪတၭ, မၩလိၪအဝ့ၫၥံၪအဆၧမၩလီၫ.- မၩ အဝ့ၫၥံၪအဆၧဂၩ့နီၪအဆၧမၩတၭ, ဆၧကဲၪထၪ့ဖျံၩ",
			"37": "<sup>37</sup> ခွၩ့လၧအဂးလီၫ.- တၭလုထၪ့ဆၧဂၩ့လၧအဖိၪခွၫၥံၪ, ဒဲအဖိၪမုၪၥံၪနီၪ, လူၫလၩ့ဆၧၥွံၪလၧအဆၧဒဲၩဘၭလ",
			"38": "<sup>38</sup> အီၪဘၪး- အဖိၪခွၫၥံၪဒဲအဖိၪမုၪၥံၪအၥွံၪလၧအလုထၪ့ လၧကၫနအၫ့ အဆၧဂၩ့ဆၧဖၪ့အဂးလီၫ. တၭခးနီၪ",
			"39": "<sup>39</sup> ဘၪၥၭလိၪလၧဆၧၥွံၪလီၫ.- အဝ့ၫၥံၪဘၪၥၭလိၪဝ့ၫလၧ အဆၧမၩဒၪဝ့ၫအကၠီၩ့တၭ, မၩမၪမုၪမၩမၪခွၫလၧအ",
			"40": "<sup>40</sup> ဆၧမၩလဖၪနီၪလီၫ.- ယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪ အၡၩခမျၧးဒၪဝ့ၫတၭ, ၥၭလိၪအဆၧန့ၥၫဒၪဝ့ၫလီၫ.",
			"41": "<sup>41</sup> ဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪလၧၦဆၨၩၥံၪအစူၪဖၧၩ့တၭ, ၦလၧ",
			"42": "<sup>42</sup> အမ့ၬလဲၩအဝ့ၫၥံၪနီၪပၧၩ့ဘၪဝ့ၫလီၫ.- အဒုၪအဒၩၥံၪ မၩၡၪ့မၩနၭအဝ့ၫၥံၪတၭ, ဆၪ့လၩ့ဝ့ၫလၧအဝ့ၫၥံၪအ",
			"43": "<sup>43</sup> စူၪဖၫ့လၬလီၫ.- အဝ့ၫနီၪမၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪအၪ ဘျၩ့လါနၫ့ဘိၩ, အဝ့ၫၥံၪပိၩ့ထၪ့ဝ့ၫလၧအကိၪ့လိၬအ ၥၭအဖၧၩ့တၭ, ဘၪဆၧမၩၡၪ့မၩနၭဝ့ၫ လၧအဆၧ အၧၩ့အကၠီၩ့လီၫ.",
			"44": "<sup>44</sup> ထီးအနါဂၧၫ့အဝ့ၫၥံၪအၪ့ကံၩ့အၪ့ယၫဆၧတၭ, ယိ",
			"45": "<sup>45</sup> ဝ့ၫအဆၧၡၪ့ဆၧနၭလီၫ.- အဝ့ၫဒၪနၪ့ထၪ့ထဲၩ့အဆၧ အုၩ့လၩ့လၧအဝ့ၫၥံၪအဂးတၭ, ယၫ့ၥုၪ့ယၫ့ၥၭဝ့ၫဘဲၫ",
			"46": "<sup>46</sup> အခိးအတၩအၪအၥိၭနီၪလီၫ.- တၭဒုၭကဲၪထၪ့အဝ့ၫ ၥံၪလၧၦဘၪဆၧယၫ့ၥၭ လၧကယဲၦအၪ့မၧၫ့ဎီးဝ့ၫလ ဖၪအမ့ၬယၫထီးအလူၬလီၫ.",
			"47": "<sup>47</sup> ထိးထဲၩ့တၩ့ထဲၩ့ပၧၩ, ယဟိဝၩ,ပယွၩဧ့,တၭအၪ့ ထုၫ့ကီၪ့ပၧၩလၧၦဆၨၩၥံၪအကျၩ, ဘဲၫၥိၭပမိစံၭထၪ့ အၪ့အူၭနမံၩ့ဆံၫ့ဎံၪဒဲအီၪက့ၪဖိၫလိၫပၥၭ လၧနဆၧစံၭ",
			"48": "<sup>48</sup> ထၪ့အၪ့အူၭအဖၧၩ့ဆံၭ.- မွဲယဟိဝၩအံၫစရ့ၭလၭအ ယွၩနီၪဘၪဆၧစံၭထၪ့အၪ့အူၭ လၧအဆိၩဆိၩအ ကၠၪကၠၪထီၩ့လၧအဆိၩဆိၩအကၠၪကၠၪနီၪဆံၭ. တၭ မွဲၦခမျၧးထီးအလူၬနီၪစံၭ, အၩမံၩ့, ဆံၭ. စံၭ ထၪ့အၪ့အူၭယွၩဆံၭ."
		},
		"107": {
			"1": "<sup>1</sup> စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭး အဂဲးဘဲၫယီၩအဝ့ၫ ဒၪဂ့ၩဝ့ၫလီၫ. အခိးအတၩအီၪဝ့ၫ လၩ့ဆိၩလၩ့ကၠၪ အဂဲးလီၫ.",
			"2": "<sup>2</sup> မွဲၦလၧယဟိဝၩဎွ့ၩန့ထဲၩ့ဝ့ၫလဖၪ, ၦလၧအဎွ့ၩန့",
			"3": "<sup>3</sup> ထဲၩ့ဝ့ၫလၧအဒုၪအဒၩအစူၪဖၧၩ့း- ဒဲအၪ့ထုၫ့ကီၪ့ဝ့ၫ လၧခးၥံၪလၧမုထၪ့ လၧမုနုၬး လၧမုဖၩ,လၧမုခံၫ့လ",
			"4": "<sup>4</sup> ဖၪနီၪ,မွဲအဝ့ၫၥံၪစံၭဘဲၫနီၪၥိၭဆံၭ.- အဝ့ၫၥံၪလ့ၩဝံၩ့ ဝၩ့လၧၡါမုနၧၫ့ဖၫ, လၧအလးအီၪယူအဖၧၩ့း ဒၪန့ဒိၩ့",
			"5": "<sup>5</sup> လၧအမိအီၪဝ့ၫနးစီၪ့အ့ၬ.- တၭအဆၧၥၭဝံအၥၭ, ဒဲဆၧ ၥူၫအၥၭ လၧထံၫနီၪ, အၥၭလၩ့ဘဲၩဝ့ၫ လၧအဖၧၩ့",
			"6": "<sup>6</sup> လီၫ.- လၧအဝ့ၫၥံၪဘၪဆၧခိဆၧဝီၩအဖၧၩ့နီၪ, ကိၭ ထၪ့ယဟိဝၩတၭ, အဝ့ၫဒၪမၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪလၧ",
			"7": "<sup>7</sup> အဆၧၡၪ့ဆၧနၭထီးအလူၬလီၫ.- တၭအဝ့ၫဒၪၥိၫ့အ ဝ့ၫၥံၪလၧဖၧၩ့ၥၭဘၪ, ဘဲၫၥိၭအမိလ့ၩထီၩ့လၧဒိၩ့လၧ",
			"8": "<sup>8</sup> အမိအီၪဝ့ၫလၧအဖၧၩ့လီၫ.- မွဲၦစံၭထၪ့အၪ့အူၭလါ ယဟိဝၩလၧအခိးအတၩအကၠီၩ့, ဒဲလၧအမၩဆၧလၩ့",
			"9": "<sup>9</sup> လၭလဖၪလၧၦၡၩအဖိၪၥံၪအဂးအကၠီၩ့ဆံၭ.- အ ဂဲးဘဲၫယီၩ ၦလၧအၥၭဝံအၥၭ လၧထံၫနီၪ, မွဲအဒုၭ ဘျဲၩအီၩဝ့ၫတၭ, ၦလၧအၥၭဝံအၥၭနီၪ မွဲအဒုၭဘျဲၩ",
			"10": "<sup>10</sup> အၪ့ဝ့ၫလၧဆၧဂ့ၩလီၫ.- ၦလၧအဆၧၫ့နၩ့လၧဆၧခံၭ ကျၩၥံၪ,ဒဲလၧဆၧၥံၫအလၩၡုၪဖၧၩ့ ဘၪစၧၩ့ထၬအ",
			"11": "<sup>11</sup> ၥၭလၧဆၧၡၪ့ဆၧနၭ, ဒဲလၧၥွ့ၫထၭနီၪဆ့လီၫ.- အဂဲး ဘဲၫယီၩအဝ့ၫၥံၪပိၩ့ထၪ့ယွၩအလူအထၫတၭ, လဒူၩ လယၪ့ဘၪ ဆၧထၪ့ထီၫထုၬလဂၩ အဆၧကိၪ့တၭး",
			"12": "<sup>12</sup> အဝ့ၫဒၪဒုၭဆၪ့လၩ့ အဝ့ၫၥံၪအၥၭ လၧဆၧမၩခိမၩ ဝီၩအကၠီၩ့နီၪ, အဝ့ၫၥံၪလၩ့ထံၩဖါတၭ, ဆၧမၩဆၧၩ့",
			"13": "<sup>13</sup> ဝ့ၫနီၪအီၪနးဂၩအ့ၬ.- ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪဘၪ ဆၧခိ ဆၧဝီၩအဘိၩ့ဘၭနီၪ, ကိၭထၪ့ယဟိဝၩတၭ, အဝ့ၫဒၪ မၩဖီၩ့မၩဖျ့ၭ အဝ့ၫၥံၪ လၧဆၧၡၪ့ဆၧနၭ ထီးအလူၬ",
			"14": "<sup>14</sup> လီၫ.- ၥိၫ့ထၪ့ခွံၬအဝ့ၫၥံၪလၧဆၧခံၭကျၩ, ဒဲလၧဆၧ ၥံၫလၩၡုၪအဖၧၩ့တၭ, မၩထ့ၬခွံၬအဝ့ၫၥံၪ အဖျံၩၥံၪ",
			"15": "<sup>15</sup> လီၫ.- မွဲပစံၭထၪ့အၪ့အူၭလါ ယဟိဝၩလၧအခိးအ တၩအကၠီၩ့, ဒဲလၧအမၩဆၧလၩ့လၭလဖၪ လၧၦၡၩ",
			"16": "<sup>16</sup> အဖိၪၥံၪအဂးနီၪအကၠီၩ့ဆံၭ.- အဂဲးဘဲၫယီၩ အဝ့ၫဒၪ မၩခါခွံၬတရၫ့ထီးဘၩ့တၭ, ဒၪ့ထ့ၬခွံၬထၭဘီၩ့လဖၪ နီၪဆ့လီၫ.",
			"17": "<sup>17</sup> ၦအဂီၩ့လၧအမၩမၪဆၧအကၠီၩ့း ဒဲလၧအဆၧအၧၩ့",
			"18": "<sup>18</sup> အကၠီၩ့နီၪဘၪဆၧၡၪ့ဆၧနၭလီၫ.- အၥၭနီၪၥၭလိၪ ဆၧအၪ့ထီးအလူၬတၭ, ၥုၭဘုၭအၥၭလၧဆၧၥံၫအ",
			"19": "<sup>19</sup> တရၫ့လဖၪအအီၪလီၫ.- လၧအဝ့ၫၥံၪဘၪဆၧခိဆၧဝီၩ အဖၧၩ့နီၪ, ကိၭထၪ့ယဟိဝၩတၭ, အဝ့ၫဒၪမၩဖီၩ့မၩ",
			"20": "<sup>20</sup> ဖျ့ၭအဝ့ၫၥံၪလၧအဆၧၡၪ့ဆၧနၭထီးအလူၬလီၫ.- အ ဝ့ၫဒၪအၪ့မၧၫ့လၩ့အလူတၭ, မၩဘျၪထဲၩ့အဝ့ၫၥံၪ ဒဲမၩဖီၩ့မၩဖျ့ၭဝ့ၫ လၧအဆၧမၩဂၭဂီၩ့ဝ့ၫ လဖၪနီၪ",
			"21": "<sup>21</sup> လီၫ.- မွဲပစံၭထၪ့အၪ့အူၭလါယဟိဝၩ လၧအခိးအ တၩအကၠီၩ့, ဒဲလၧအမၩဆၧလၩ့လၭလဖၪလၧၦၡၩ",
			"22": "<sup>22</sup> အဖိၪၥံၪအဂးနီၪအကၠီၩ့ဆံၭ.- တၭမွဲအဝ့ၫၥံၪလုထၪ့ လါဆၧလုစံၭထၪ့အၪ့အူၭ, ဒဲလီၩလၩ့လၬလၩ့အမၩ",
			"23": "<sup>23</sup> ဆၧလဖၪလၧဆၧၥုၪ့ဎွံၫၥၭယီၫဆံၭ.- ၦလၧအလ့ၩ လၩ့လၧမၫဆမံၭ လၧကဘၩ့ဖၧၩ့လဖၪနီၪ, လၧအမၩ",
			"24": "<sup>24</sup> ဆၧမၩလၧထံၫဖၭဒိၪအဖၧၩ့နီၪး- အဝ့ၫၥံၪဒၪဘၪယ ဟိဝၩအဆၧမၩ ဒဲအဆၧလၩ့လၭ လၧထံၫယိၬဖၧၩ့",
			"25": "<sup>25</sup> လီၫ.- ယွၩချဲၩ့ဆၧတၭ, လံၩမုအီၪထၪ့လၧအမိမၩဒိၪ",
			"26": "<sup>26</sup> ထၪ့လပီၩလဖၪလီၫ.- ၦလ့ၩထၪ့ဝ့ၫလၧမူၭခိၪတၭ, လ့ၩလၩ့ဝ့ၫလၧထံၫယိၬဖၧၩ့နီၪ, အၥၭဖံၪထၪ့ဝ့ၫလၧ",
			"27": "<sup>27</sup> အဘၪဆၧခိဆၧဝီၩအကၠီၩ့လီၫ.- အဝ့ၫၥံၪလ့ၩဝံၩ့ဝၩ့ ဆၧတၭ လ့ၩဒံၩ့ခံၫ့ဒၪ့ဎၩ့ ဘဲၫၦအီၩမၧၩ့ ၥံၭထံၫဂၬ ထံၫအၥိၭနီၪတၭ, အဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ ထီးအလူၬ",
			"28": "<sup>28</sup> ကဲၪဆၧပျီၩပျီၩလီၫ.- ထီးအဝ့ၫၥံၪဘၪဆၧခိဆၧဝီၩ နီၪကိၭထၪ့ယဟိဝၩတၭ, အဝ့ၫဒၪဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫ",
			"29": "<sup>29</sup> လၧအဆၧၡၪ့ဆၧနၭအဖၧၩ့လီၫ.- အဝ့ၫဒၪဒုၭအီၪဂုး",
			"30": "<sup>30</sup> ဖုးလဖုၬ, ဒဲအလပီၩၥံၪအီၪလၩ့မါပံၭလီၫ.- ထီးနီၪလ ဖၧၫ့ လၧဆၧအီၪဂုးဖုးအကၠီၩ့နီၪ, အဝ့ၫၥံၪအၥုၪ့ထိၬ အၥၭထိၬတၭ, ယွၩၥိၫ့ဝ့ၫလၧမၫဆမံၭနဲၩ့ ထီးအဘၪ",
			"31": "<sup>31</sup> အၥၭလစီၪ့နီၪလီၫ.- မွဲပစံၭထၪ့အၪ့အူၭလါယဟိဝၩ လၧအခိးအတၩအကၠီၩ့, ဒဲလၧအမၩဆၧလၩ့လၭလ",
			"32": "<sup>32</sup> ဖၪလၧၦၡၩအဖိၪၥံၪအဂးနီၪအကၠီၩ့ဆံၭ.- မွဲအဝ့ၫၥံၪ အီၪက့ၪထၪ့ထီၫအဝ့ၫဒၪ လၧၦခမျၧးအဆၧအီၪကီၪ့အ ဖၧၩ့တၭ, စံၭထၪ့အၪ့အူၭအဝ့ၫလၧၦၥုၪ့က့ၭၥၭၡါၥံၪ ဆၧၫ့နၩ့အကျၩဆံၭ.",
			"33": "<sup>33</sup> ထံၫချိၬၥံၪအဝ့ၫဒၪဒုၭကဲၪထၪ့ လၧၡါမုနၧၫ့ဖၫတၭ,",
			"34": "<sup>34</sup> ဒဲထံၫထၪ့ဖျိၭလဖၪလၧခီၫ့ၥူၫခိၪနီၪ,- ဒဲခးလၧအၥၪ ထၪ့လဘံၪ့လၧဆၧအီၪယူဝ့ၫအလး, လၧၦလၧအအီၪ",
			"35": "<sup>35</sup> ဝ့ၫလၧအဖၧၩ့ၥံၪအဆၧအၧၩ့အကၠီၩ့လီၫ.- အဝ့ၫဒၪဒုၭ ကဲၪထၪ့ၡါမုနၧၫ့ဖၫလၧကမၫ, ဒဲခီၫ့ၥူၫခိၪလၧထံၫထၪ့",
			"36": "<sup>36</sup> ဖျိၭတၭ,- အၪ့မၧၫ့ၦဘၪဆၧၥၭဝံအၥၭနီၪ အီၪဝ့ၫထီး နီၪ,ဘဲၫၥိၭအမိတဲၩ့ဝဲၩဒိၩ့ လၧဆၧအီၪဝ့ၫအဂးလီၫ.",
			"37": "<sup>37</sup> ဒဲအဝ့ၫၥံၪဎွံၪဆၧလၧဆံၬဖၧၩ့, ဒဲၥုၪ့စဘံၭအလးဘဲၫ ၥိၭဆၧၥၪဎလၧလနံၪ့အဂးလနံၪ့အဂး,ၭ မိအၪထၪ့ဝ့ၫ",
			"38": "<sup>38</sup> လီၫ.- ဆိၪဂ့ၩအဝ့ၫၥံၪဆ့တၭ, ဒုၭအၪထၪ့အၪအၪ လ့ၬ,ဒုၭလၩ့ၡၩအဝ့ၫၥံၪ အဆၧဖိၪ ဆၧဎါ အဒိၩ့နီၪ",
			"39": "<sup>39</sup> အ့ၬ.- တၭမၩဒီၭလဖၧၫ့အဝ့ၫၥံၪ လၩ့ၡၩဝ့ၫတၭ, ဘၪ ဆၧဆၪ့လၩ့ဝ့ၫ လၧဆၧမၩနၧၩ့မၩစၪဝ့ၫ, ဆၧမၩနၭ",
			"40": "<sup>40</sup> ဝ့ၫဒဲဆၧမၩခိမၩဝီၩဝ့ၫအကၠီၩ့နီၪလီၫ.- ယွၩလူၫလၩ့ ဆၧကြၩ့ထမး လၧၦဒိၪဖၭဒိၪၥံၪအလီၩ့တၭ, ဒုၭဂၭ ဝံၩ့ဝၩ့အဝ့ၫၥံၪလၧဆၧပျီၩပျီၩ, ထီးဖၧၩ့ၥၭလအီၪဘၪ",
			"41": "<sup>41</sup> အလးဖၧၩ့လီၫ.- အဝ့ၫဒၪထုၭထၪ့ခွံၬၦၡၪ့ဖိၪယၬဖိၪ လၧဆၧၡၪ့ဆၧနၭအဖၧၩ့ အီၪက့ၪထၪ့ထီၫဝ့ၫတၭ, အီၪ",
			"42": "<sup>42</sup> က့ၪဂံၪ့ဒီၪ့ၥံၪဘဲၫၥိၪလဒီၪ့အၥိၭနီၪလီၫ.- ၦအၥၭဆုး လီၩ့လဖၪမိဒၪဘၪဒဲၥၭထိၬဝ့ၫတၭ, ဆၧအၧၩ့ဆၧၥၫ့ ထီးအလူၬနီၪမိကၭဘံၭထၬအနိၭဒၪဝ့ၫလီၫ.",
			"43": "<sup>43</sup> ၦလၧအကိၪ့ဆၧၥ့ၪနီၪ, မွဲအနၪၥ့ၪဆၧလဖၪနီၪ ဆံၭ. မွဲၦလဖၪနီၪ ထီးန့ယဟိဝၩအဆၧအဲၪအခိး အတၩဆံၭ."
		},
		"108": {
			"1": "<sup>1</sup> ယွၩဧ့, ယၥၭအီၪဂုးအီၪခၧၫ့း ယမိစံၭထၪ့အၪ့အူၭ ဆၧးယမိၥံၫကျံၩဆၧစံၭထၪ့အၪ့အူၭ လၧယလၩယဖၩ့ ဒၪလ့ၬလီၫ.",
			"2": "<sup>2</sup> နၪ့ထၪ့ဆံၭ, ၥၫ့ထီးဒဲနါဒံၩ့ၥံၪဧ့, ယမိထိၪဂဲထုၪ့",
			"3": "<sup>3</sup> ဆၧဖၩ့မုဆဲၪ့ထၪ့နီၪဖီၩၬ- တၭယမိစံၭထၪ့အၪ့အူၭနၧၩ လၧၦခမျၧးၥံၪအကျၩ, ယဟိဝၩဧ့, ယမိၥံၫကျံၩအၪ့",
			"4": "<sup>4</sup> အူၭထၪ့နၧၩ လၧၦဆၨၩၥံၪအကျၩလီၫ.- အဂဲးဘဲၫ ယီၩနခိးနတၩဒိၪဝ့ၫလၧမူၭခိၪ, ဒဲနဆၧမွဲဆၧတီၩထီၩ့",
			"5": "<sup>5</sup> လၧဆၧအုၪ့လဖၪနီၪလီၫ.- မွဲနဘၪဆၧအီၪက့ၪထၪ့ထီၫ နၧၩလၧမူၭခိၪအဖၫ့ခိၪ, ယွၩဧ့, ဒဲနလၩနဖၩ့လၧဂၪ့ခိၪ",
			"6": "<sup>6</sup> ထၧၫ့ဖျိၪ့ယၫအဖၫ့ခိၪဆံၭ.- ဘဲၫၥိၭနၡၩၥၭဘီၩ့ၥံၪ မိ ဖီၩ့မိဖျ့ၭတၭ, ထိးထဲၩ့တၩ့ထဲၩ့ဆၧလၧနစူၪထွ့ၪတၭ,",
			"7": "<sup>7</sup> စံၭဆၧၫ့ယၧၩဆံၭ.- ယွၩချဲၩ့ယူၭဆၧလၧအဆၧဆံၫ့ ဎံၪအဖၧၩ့ယူၭး ယမိၥုၪ့ဎွံၫၥၭယီၫ, ယမိအၪ့နၩ့ဖၭၡံ",
			"8": "<sup>8</sup> ခံၫ့အဆၧၫ့တၭ, ယမိထိၪစၧကီၭအဆၧပျၩ့လီၫ.- ဂံလ အၭမွဲယဆၧဒဲမနၭစ့ၫမွဲယဆၧ, ဒဲအံဖြံၫ့မွဲယခိၪအဂဲး အဘၭတၭ, ယုဒၫမွဲယၡၩပၧၩ့ဆၧ အနိၪထိၭလဘီၩ့",
			"9": "<sup>9</sup> လီၫ.- မိအၭမွဲယၥူၫဝၭဆၧအအံၪ့ဒိၫ့လဖျိၪ့, ယမိခွံၬ ၡိၭယခၪ့ဖံၭ လၧအံဒၧၫ့အဖၫ့ခိၪး ယမိၥုၪ့ဎွံၫၥၭယီၫ",
			"10": "<sup>10</sup> လၧဖလံၡၫအဖၫ့ခိၪလီၫ.- မွဲပလၫမိဒုၭလ့ၩနုၬယၧၩ လၧဒိၩ့အီၪလၧအခိၪဒၧၩ့လဂၩလဲၪ. မွဲပလၫမိၥိၫ့ယၧၩ",
			"11": "<sup>11</sup> လၧအံဒၧၫ့အဖၧၩ့လဂၩလဲၪ.- နဝ့ၫဒၪၦလၧအခွံၬၡိၭ ပၧၩလမွဲဘၪဧၪ, ယွၩဧ, နဝ့ၫဒၪယီၩ, မွဲနမိလ့ၩထၪ့",
			"12": "<sup>12</sup> လၧပၥုၭမုခမျၧးၥံၪအၥိၭအ့ၬဧၪ, ယွၩဧ့,- လၧဆၧမၩ ခိမၩဝီၩအဖၧၩ့နီၪ မၩဆၧၩ့ပၧၩဆံၭ. အဂဲးဘဲၫယီၩ",
			"13": "<sup>13</sup> ၦၡၩအဆၧမၩဖီၩ့မၩဖျ့ၭနီၪ, မွဲဆၧပျီၩပျီၩလီၫ.- တၭ ပမိမၩဆၧလၧဆၧဂဲးဆီၪ့ဘၭဆီၪ့ လၧယွၩအဖၧၩ့နီၪ, ဒဲအဝ့ၫဒၪ မွဲၦလၧအမိယဲးထဲးလၩ့ပဒုၪပဒၩလီၫ."
		},
		"109": {
			"1": "<sup>1</sup> အီၪလၩ့မါပံၭလဂ့ၩ, ယဆၧစံၭထၪ့အၪ့အူၭအယွၩ",
			"2": "<sup>2</sup> ဧ့,- အဂဲးဘဲၫယီၩၦလတီၩလလီၩ့ဘၪအနိၭ, ဒဲၦအၪ့ လီၫဆၧအနိၭနီၪအၩ့ထၪ့အၥၭလၧယလီၩ့လီၫ. အဝ့ၫ ၥံၪချဲၩ့ထၫ့ဒုၪဒၩယၧၩ လၧအဖျ့ၩအဘျံၭအဘျၪလီၫ.",
			"3": "<sup>3</sup> တၭအီၪဝၬဖီၩ့ယၧၩ လၧဆၧၥၭဂဲၫ့ အဆၧချဲၩ့တၭ, ထီးအလးလအီၪဘၪနီၪ ဒုၭဆၧထၫ့ဒုၪဒၩယၧၩလီၫ.",
			"4": "<sup>4</sup> လၧယဆၧအဲၪအဂးနီၪ အဝ့ၫၥံၪကဲၪထၪ့ယဒုၪယဒၩ လါနၫ့တၭ, ယဝ့ၫဒၪယီၩ, ယဖ့ၪလၫ့ယနၫ့ဆါလၧဆၧ",
			"5": "<sup>5</sup> ဘၩဆိၪဖၪအဂးလီၫ.- တၭလၧယဆၧဂ့ၩအဂးအဝ့ၫ ၥံၪအီၪက့ၪဆၧအၧၩ့လၧယလီၩ့, ဒဲဆၧၥၭဂဲၫ့မ့ၬလဲၩ လၧယဆၧအဲၪအဂးလီၫ.",
			"6": "<sup>6</sup> နဝ့ၫဒၪအီၪက့ၪၦလတီၩလလီၩ့ဘၪလဂၩ လၧအဝ့ၫ ဒၪအဖၫ့ခိၪဆံၭ. တၭမွဲဆၧအဒုၪအဒၩ ဆၧၫ့ထုၪ့လၧ",
			"7": "<sup>7</sup> အစူၪထွ့ၪဆံၭ.- ထီးအဘၪဆၧစ့ၩရၫ့နီၪ, မွဲဆၧအီၪ က့ၪဝ့ၫလၧၦလတီၩလလီၩ့ဘၪဆံၭ. တၭမွဲအဆၧဘၩ",
			"8": "<sup>8</sup> ဆိၪဖၪ ကဲၪထၪ့ဆၧဒဲၩဘၭဆံၭ.- တၭမွဲအနံၩအၥၫ့ အီၪၡၩခိၬဆံၭ. မွဲၦဂူၫဂၩထၪ့ဘၭ အယိဆၧအလး",
			"9": "<sup>9</sup> ဆံၭ.- မွဲအဖိၪၥံၪကဲၪထၪ့ၦဖိၪဎွ့ၪ,ဒဲအမၫလၧၦမုၪမဲၫ",
			"10": "<sup>10</sup> ဆံၭ.- မွဲအဖိၪၥံၪ စဲၪ့ဝံၩ့ဝၩ့ဆၧလထံၪဎးလဘီၩ့ဎး ဒဲအၪ့ကံၩ့ဆၧတၭ, အၪ့ဎၬဆၧလၧအလး အီၪယူအ",
			"11": "<sup>11</sup> ဖၧၩ့ဆံၭ.- မွဲအဒ့ၪအမါအကဆါနီၪ မၩန့ကယဲဆၧ အီၪထီးအလူၬဆံၭ. တၭမွဲၦလခီၫဘၩ့မုးဖိၪနီၪ အၪ့",
			"12": "<sup>12</sup> ဂူၬန့အဆၧမၩဆံၭ.-မွဲပမၩဘူၭမၩဆၧၩ့အဝ့ၫနီၪ ထီး အီၪလဂ့ၩ, တၭမွဲၦယၫ့ၥၭ အဖိၪဎွ့ၪနီၪ ထီးအီၪလ",
			"13": "<sup>13</sup> ဂ့ၩ.- မွဲအဆၨၩအဆၬနီၪ ဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫဆံၭ. မွဲအဝ့ၫၥံၪအမံၩ့ ဘၪဆၧထူၭခွံၬဝ့ၫ လၧခဲၫ့လဆိၩအ",
			"14": "<sup>14</sup> ကျၩနီၪဆံၭ.- မွဲယဟိဝၩနၪ့ထၪ့ထဲၩ့ အဖါၥံၪအဆၧ အၧၩ့နီၪဆံၭ. တၭမွဲအမိအဆၧဒဲၩဘၭ ထီးဘၪဆၧ",
			"15": "<sup>15</sup> ထူၭခွံၬလဂ့ၩ.- မွဲအအီၪလၧယဟိဝၩအမ့ၬယၫလထံၪ ဎးဘီၩ့ဎးဘဲၫၥိၭ အမိဒၪ့ထ့ၬခွံၬအဆၧနၪ့ထၪ့ထဲၩ့လၧ",
			"16": "<sup>16</sup> ဂၪ့ခိၪချိၫ့ဆံၭ.- အဂဲးဘဲၫယီၩမွဲလနၪ့ထၪ့ထဲၩ့ဘၪလၧ အမိဒုၭနဲၪဆၧယၫ့ၥၭတၭ, မၩအၧၩ့ၦဘၪၡၪ့ဘၪနၭ, ဒဲၦၡၪ့ဖိၪယၬဖိၪနီၪ ဘဲၫၥိၭအမိမၩၥံၫဒၪလ့ၬ ၦအၥုၪ့",
			"17": "<sup>17</sup> ခါအၥၭလၩ့လဂၩနီၪလီၫ.- အဲၪဝ့ၫလၧဆၧဆိၪအၧၩ့ တၭ,ဘၪထဲၩ့လၧအလီၩ့ဒၪဝ့ၫ, လဘၪဘၪအၥၭလၧ",
			"18": "<sup>18</sup> ဆၧဆိၪဂ့ၩအကၠီၩ့တၭ, အီၪယဲၩ့လၧအအီၪလီၫ.- တၭ ၥိၭဆၧဆိၪအၧၩ့ ဘဲၫဆဲၫ့လဘံၪ့အၥိၭနီၪတၭ, ဂဲၫနုၬ လၧအဂူၭဖိၫ့ဖၧၩ့ ဘဲၫထံၫအၥိၭ, ဒဲလၧအဎွံၪဖၧၩ့ဘဲၫ",
			"19": "<sup>19</sup> ၥိၪအၥိၭနီၪလီၫ.- မွဲအကဲၪထၪ့ဘဲၫဖၬဘဲၩ့လၧအလုၬ ဝ့ၫအၥိၭတၭ, ဘဲၫခၧၩ့ယးလၧအခဲးထူၬဝ့ၫလထံၪဎး",
			"20": "<sup>20</sup> အၥိၭနီၪဆံၭ.- တၭၦလၧအထၫ့ဒုၪဒၩယၧၩ, ဒဲချဲၩ့ အၧၩ့ယၧၩလဖၪအကၠီၩ့တၭ, မွဲဆၧနီၪကဲၪထၪ့အလံၩ့ အလဲၫလၧယဟိဝၩအစူၪဖၧၩ့နီၪဆံၭ.",
			"21": "<sup>21</sup> တၭနဝ့ၫဒၪယဟိဝၩ, ကဆါဧ့, မၩဆၧလၧယဂး လၧနမံၩ့အကၠီၩ့နီၪဆံၭ. မွဲနခိးနတၩဂ့ၩဝ့ၫတၭ, မၩဖီၩ့ မၩဖျ့ၭယၧၩဆံၭ.",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩယဝ့ၫဒၪယီၩ, ယမွဲၦဘၪၡၪ့ဘၪနၭ ဒဲၦၡၪ့ဖိၪယၬဖိၪတၭ, ယၥၭဘၪဆ့ၭလၧယဖၧၩ့လီၫ.",
			"23": "<sup>23</sup> တၭယဘၪဆၧလ့ၩဖီၩ့ခွံၬ ဘဲၫဆၧလၩၡုၪလၧအထီၫ ထၪ့အဘိၩ့ဘၭအၥိၭနီၪ, ယဘၪဆၧနၫ့ထၪ့ခွံၬယၧၩ",
			"24": "<sup>24</sup> ဘဲၫထွ့အၪဘၫအၥိၭလီၫ.- ယခၪ့လုးခိၪဝၭထိၬလၧ ယဒုၪဆၧအၪ့အကၠီၩ့တၭ, ယယၪဎွ့လၩ့လၧဆၧဘီၪ့",
			"25": "<sup>25</sup> လအီၪဘၪအကၠီၩ့လီၫ.- တၭယကဲၪထၪ့ဆၧဒုၪဒွ့ၪအလး လၧအဝ့ၫၥံၪအဂးနီၪ, အဝ့ၫၥံၪယိယၧၩတၭဖျၭအခိၪလီၫ.",
			"26": "<sup>26</sup> မၩဆၧၩ့ယၧၩ, ယဟိဝၩ, ယယွၩဧ့,ထိးထဲၩ့တၩ့",
			"27": "<sup>27</sup> ထဲၩ့ယၧၩဘဲၫနခိးနတၩအၥိၭနီၪဆံၭ.- တၭမွဲၦၥ့ၪယၫ လၧဆၧယီၩလမံၩ့မွဲနစူၪ, လၧနမၩဝ့ၫနီၪဆံၭ, ယဟိ",
			"28": "<sup>28</sup> ဝၩဧ့,- အဝ့ၫၥံၪမိဆိၪအၧၩ့ဆၧတၭ, အ့ၪမွဲနဝ့ၫဒၪယီၩ ဆိၪဂ့ၩဆၧဆံၭ. တၭအဝ့ၫၥံၪဂဲထုၪ့ထၪ့ဝ့ၫတၭ, မွဲအ",
			"29": "<sup>29</sup> မ့ၬမဲဆံၭ. အ့ၪမွဲနခ့ၫနၡၩနီၪ မွဲအၥၭထိၬဆံၭ.- မွဲၦ ထၫ့ဒုၪဒၩယၧၩလဖၪနီၪၥိၭဆၧမ့ၬမဲတၭ, လုၬဘံၭအ",
			"30": "<sup>30</sup> ၥၭလၧဆၧမ့ၬမဲ ဘဲၫလၧဖၬဘဲၩ့အၥိၭနီၪဆံၭ.- ယမိ စံၭထၪ့အၪ့အူၭယဟိဝၩအၪအၪလ့ၬ လၧယနိၭတၭ, လၧၦအၪဂၩအကျၩနီၪ ယမိစံၭထၪ့အၪ့အူၭ အဝ့ၫဒၪ",
			"31": "<sup>31</sup> လီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫဆၧၫ့ထုၪ့လၧၦၡၪ့ဖိၪယၬ ဖိၪအစူၪထွ့ၪဘဲၫၥိၭ အမိမၩဖီၩ့မၩဖျ့ၭဝ့ၫလၧၦလၧအ မိစ့ၩရၫ့စၪအၥၭအစူၪဖၧၩ့လီၫ."
		},
		"110": {
			"1": "<sup>1</sup> ယဟိဝၩ စံၭယကဆါ, ဆၧၫ့နၩ့လၧအစူၪထွ့ၪထီး ယအီၪက့ၪနဒုၪနဒၩလၧနခၪ့ယဲး လၩ့အလးနီၪဆံၭ.",
			"2": "<sup>2</sup> တၭယဟိဝၩဧ့, အၪ့မၧၫ့လၩ့ နစီၩ့နမၩ့ အနိၪထိၭလ ဘီၩ့လၧဇံအိၫ့အဖၧၩ့တၭး နဝ့ၫဒၪပၧၩ့ဆၧလၧနဒုၪန",
			"3": "<sup>3</sup> ဒၩအကျၩဆံၭ.- လၧနစီၩ့နမၩ့အမုနံၩအဖၧၩ့နီၪ, နၡၩ ခမျၧးမိကဲၪဒၪဆၧမၩဘိၪ့ အနၫ့ဆါၥံၪလၧဆၧဆံၫ့ဎံၪ အဎံၫအလၩအဖၧၩ့တၭ, လၧဂီၩလခီၫအဒၧၩ့လးဖၧၩ့ နီၪနအီၪလၧနၥၭဘၪ့အဆၩ့ထံၫလီၫ.",
			"4": "<sup>4</sup> ယဟိဝၩဆိၪလၩ့ယူၭအၥၭယူၭတၭ, မိနီၫ့ယါလၩ့ ထဲၩ့အၥၭအ့ၬ. နမွဲၦလုဆၧလၩ့ဆိၩလၩ့ကၠၪဘဲၫစမ့ၫ",
			"5": "<sup>5</sup> လခံစဒ့ၭအဖၧၩ့ၥၭအၥိၭနီၪလီၫ.- ကဆါအီၪလၧနစူၪ ထွ့ၪနီၪတၭ, လၧအၥၭထၪ့အမုနံၩနီၪအဝ့ၫကျီၪ့စဎွၩ",
			"6": "<sup>6</sup> ၥံၪ,- တၭစ့ၩရၫ့ဆၧလၧၦဆၨၩၥံၪအကျၩး ဒဲမၩဎွ့ၩ ဆၧလၧၦအစွၪတၭ, မိကျီၪ့ခွံၬၦအခိၪဎွံၪ လၧခးအၪ",
			"7": "<sup>7</sup> ဘံၪ့အဖၫ့ခိၪလီၫ.- အဝ့ၫဒၪမိအီၩဆၧလၧထံၫချိၬလၧ ဖၧၩ့ၥၭလီၫ. မၩအၥၭဘဲၫနီၪတၭ, မိမိၬထၪ့အခိၪဎွံၪ လီၫ."
		},
		"111": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့အူၭယွၩဆံၭ. တၭယမိစံၭ ထၪ့အၪ့အူၭယဟိဝၩလၧ ယၥၭထၧၫ့ဖျိၪ့ယၫလၧၦအ ၥၭဆုးလီၩ့ဖံၭၥိၭလိၬအၥၭအကျၩ, ဒဲလၧဆၧအီၪကီၪ့",
			"2": "<sup>2</sup> အဖၧၩ့လီၫ.- ယဟိဝၩအဆၧမၩလဖၪနီၪဒိၪဝ့ၫတၭ, ဘၪဆၧအၪ့ဎၬယိဝ့ၫ လၧကယဲၦလၧအမုၬလၩအၥၭ",
			"3": "<sup>3</sup> လၧအဝ့ၫၥံၪအဖၧၩ့ကိၭဂၩဒ့ၭလီၫ.- အဝ့ၫဒၪမၩဆၧ နီၪမွဲဆၧအဎံၫအလၩဒဲအလၩအဖၩ့, ဒဲအဆၧတီၩဆၧ",
			"4": "<sup>4</sup> လီၩ့အီၪဂုးအီၪခၧၫ့လၩ့ဆိၩလၩ့ကၠၪလီၫ.- အဝ့ၫဒၪ ဒုၭနၪ့ထၪ့ထဲၩ့ အဆၧလၩ့လၭလဖၪလီၫ. ယဟိဝၩ",
			"5": "<sup>5</sup> အီၪလၧဆၧအခိးအတၩတၭ,အၥၭအီၪဆၧလီၫ.- ဖ့ၪ လၫ့ဆၧအၪ့လၧၦလၧအၥၭမဲၪအဝ့ၫတၭ, နၪ့ထၪ့ထဲၩ့",
			"6": "<sup>6</sup> အဆၧအုၩ့လၩ့လၩ့ဆိၩလၩ့ကၠၪလီၫ.- အဝ့ၫဒၪဒုၭနဲၪ အမၩဆၧအစီၩ့အမၩ့ လၧအၡၩခမျၧးဘဲၫၥိၭအမိဖ့ၪ",
			"7": "<sup>7</sup> လၫ့အဝ့ၫၥံၪလၧၦဆၨၩၥံၪအဆၧန့ၥၫလီၫ.- အမၩဆၧ လၧအစူၪနီၪမွဲဆၧမွဲဆၧတီၩဒဲဆၧစ့ၩရၫ့တီၩလီၫ. တၭ ကယဲအဆၧမၪလူၬနီၪ မွဲဆၧဂုးဆၧခၧၫ့ ထီးအလူၬ",
			"8": "<sup>8</sup> လီၫ.- အီၪဂုးအီၪခၧၫ့ဝ့ၫ လၩ့ဆိၩလၩ့ကၠၪတၭ, မၩ အၥၭလၧဆၧမွဲဆၧတီၩ ဒဲလၧဆၧၥၭဆုးလီၩ့အဖၧၩ့",
			"9": "<sup>9</sup> လီၫ.- အဝ့ၫဒၪအၪ့မၧၫ့လၩ့ ဆၧဎွ့ၩန့ထဲၩ့ လၧအၡၩ ခမျၧးအအီၪး မၪလူၬအဆၧအုၩ့လၩ့ လၩ့ဆိၩလၩ့ကၠၪ လီၫ. အမံၩ့မွဲဆၧဆံၫ့ဎံၪ, ဒဲဆၧၥၭမဲၪအလးနီၪလီၫ.",
			"10": "<sup>10</sup> ဆၧၥၭမဲၪယဟိဝၩနီၪ, မွဲဆၧကိၪ့ၥ့ၪကိၪ့ဘၪအခၪ့ထံၭ လီၫ.ကယဲၦလၧအထီးန့ဝ့ၫ ထီးအလူၬနီၪ အီၪလၧ အၥုၪ့ဖၭၥၭဖၭဂ့ၩဘၪစဲၪလီၫ. တၭအဆၧစံၭထၪ့အၪ့ အူၭနီၪအီၪဂုးအီၪခၧၫ့လၩ့ဆိၩလၩ့ကၠၪလီၫ."
		},
		"112": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၩဆံၭ. ၦၡၩလၧအၥၭ မဲၪယဟိဝၩတၭ, မုၬလၩဝ့ၫဖၭဒိၪ လၧအဆၧမၪလူၬ",
			"2": "<sup>2</sup> ၥံၪအဖၧၩ့နီၪ, ဘၪဆိၩဂ့ၩဝ့ၫလီၫ.- အချံၫအၥၪမိဆီၪ့ ထၪ့လၧဂၪ့ခိၪချိၫ့တၭ, ၦအတီၩအလီၩ့လဆိၩနီၪမိဘၪ",
			"3": "<sup>3</sup> ဆိၪဂ့ၩဝ့ၫလီၫ.- ဆၧထူၭဆၧလၧၫ့ ဒဲဆၧလူဒိၪဎွ့ၩဒိၪ ၥံၪအီၪလၧအဂံၪ့ဖၧၩ့း ဒဲအဆၧတီၩဆၧလီၩ့ အီၪဂုး",
			"4": "<sup>4</sup> အီၪခၧၫ့လၩ့ဆိၩလၩ့ကၠၪလီၫ.- ဆၧမိဖၩ့ထၪ့လၧဆၧ ခံၭကျၩ လၧၦအတီၩအလီၩ့အဂးတၭ, အဝ့ၫဒၪအီၪ လၧဆၧအခိးအတၩ ဒဲၥၭအီၪဆၧ, ဒဲတီၩဝ့ၫလီၩ့ဝ့ၫ",
			"5": "<sup>5</sup> လီၫ.- ၦၡၩလၧအယၫ့ၥၭဆၧဒဲဒုၭအၪ့လီးဆၧနီၪဘၪ ဆိၪဂ့ၩဝ့ၫလီၫ. လၧဆၧစ့ၩရၫ့အဖၧၩ့နီၪအဝ့ၫဒၪအခွး",
			"6": "<sup>6</sup> မိနၧၩ့လီၫ.- အဂဲးဘဲၫယီၩ လဂဲၩလဝၭဘၪလၩ့ဆိၩ လၩ့ကၠၪတၭ, ၦအတီၩအလီၩ့မိဘၪဆၧနၪ့ထၪ့ထဲၩ့ဝ့ၫ",
			"7": "<sup>7</sup> အဆိၩဆိၩအကၠၪကၠၪလီၫ.- အဝ့ၫဒၪလအၪ့ယိၪဘၪ လၧဆၧပရၧၫ့အအၧၩ့အဂဲးတၭ, အၥၭအီၪဂုးအီၪခၧၫ့",
			"8": "<sup>8</sup> ဒိၭနဲၩ့အၥၭလၧယဟိဝၩလီၫ.- အဝ့ၫဒၪအၥၭအီၪဂုး အီၪခၧၫ့ဝ့ၫတၭ, လၥၭမဲၪဘၪဆၧနီၪ, မိဒၪဘၪဆၧဘၪ",
			"9": "<sup>9</sup> အၥၭလၧအဒုၪအဒၩအလီၩ့လီၫ.- အၪ့နၩ့ဖၭဆၧလၧ ဆၧယၫ့ၥၭအဂးတၭ, ဖ့ၪလၫ့ဆၧလၧၦၡၪ့ဖိၪယၬဖိၪလီၫ. အဆၧတီၩဆၧလီၩ့အီၪဂုးအီၪခၧၫ့လၩ့ဆိၩလၩ့ကၠၪလီၫ. အနိၩ့အီၪက့ၪထၪ့ထီၫ လၧဆၧလၩဆၧဖၩ့ အဖၧၩ့လီၫ.",
			"10": "<sup>10</sup> ၦလတီၩလလီၩ့ဘၪနီၪမိဒၪဘၪတၭ, အၥၭဆၫနီၪ, မိအဲၪ့ဂံၬအၥွၫတၭ, မိဖံၪထၪ့ခွံၬဝ့ၫလီၫ. ၦလတီၩလ လီၩ့ဘၪအၥၭကွံၩဆၧနီၪ မိထီၩ့ဝ့ၫလၧဆၧဂၭဂီၩ့လီၫ."
		},
		"113": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၩဆံၭ. စံၭထၪ့အၪ့ အူၭဆၧ,ယဟိဝၩအခ့ၫအၡၩနၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့",
			"2": "<sup>2</sup> အူၭယဟိဝၩအမံၩ့ဆံၭ.- ထီးယီၩလၧယၫလခီၫ, မွဲ ယဟိဝၩအမံၩ့ ဘၪဆၧစံၭထၪ့အၪ့အူၭ လၩ့ဆိၩလၩ့",
			"3": "<sup>3</sup> ကၠၪဆံၭ.- လၧမုထၪ့ထီၩ့လၧမုနုၬနီၪ, ယဟိဝၩအမံၩ့ မွဲဆၧစံၭထၪ့အၪ့အူၭအလးလီၫ.",
			"4": "<sup>4</sup> တၭယဟိဝၩအီၪထၪ့ထီၫ လၧၦကိၭဆၨၩဒ့ၭအဖၫ့ ခိၪနီၪ, အလၩအဖၩ့အီၪဝ့ၫလၧအဖၫ့ခိၪလီၫ.",
			"5": "<sup>5</sup> မွဲပလၫလၩ့ဂၬဘဲၫယဟိဝၩပယွၩအၥိၭ လၧအဆၧၫ့",
			"6": "<sup>6</sup> နၩ့လၧအလးထၪ့ထီၫနီၪလဂၩလဲၪ.- အဝ့ၫဒၪယိလၩ့ ဆၧယဲၩ့ယဲၩ့လ့ၬဘဲၫၥိၭအမိယိဘၪဆၧ လၧမူၭခိၪဖၧၩ့",
			"7": "<sup>7</sup> ဒဲလၧဂၪ့ခိၪချိၫ့လီၫ.- အဝ့ၫဒၪထုၭထၪ့ခွံၬ ၦဂဲးဆါဘၭ ဆါလၧဂၪ့ခိၪမုၬအကျၩတၭ ဆိၬထၪ့ခွံၬၦကြၨၭန့ဘၪ",
			"8": "<sup>8</sup> ဆၧလဖၪလၧဆၧအ့ၪပိၩ့အလီၩ့နီၪး- ဘဲၫၥိၭအမိဒုၭ အီၪဝ့ၫလၧၦဒိၪဖၭဒိၪၥံၪအၥိၭ, ဒဲအၡၩခမျၧးအၦဒိၪ",
			"9": "<sup>9</sup> ဖၭဒိၪၥံၪအၥိၭလီၫ.- အဝ့ၫဒၪဒုၭအီၪၦထူၬဖိၪလၧအ ဂံၪ့ဒီၪ့,ဒုၭကဲၪထၪ့ဝ့ၫဖိၪခွၫၥံၪ အမိလၧအၥၭထိၬလီၫ. နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၩဆံၭ."
		},
		"114": {
			"1": "<sup>1</sup> ခီၫလၧအံၫစရ့လၭစဲၪ့ထၪ့ခွံၬလၧအံဇံၭအဖၧၩ့, ဒဲ စယၫကူၭအၡၩဂံၪ့ဖိၪစဲၪ့ထၪ့ခွံၬ လၧၦခမျၧးအီၪလၧၦ",
			"2": "<sup>2</sup> လခီၫဘၩ့မုးဖိၪအလၨအကျၩတၭး- ယုဒၫမွဲအလး ဆံၫ့ဎံၪဒဲအံၫစရ့လၭနီၪ မွဲအလးလၧအပၧၩ့ဝ့ၫလီၫ.",
			"3": "<sup>3</sup> မၫဆမံၭဒၪဘၪဝ့ၫစဲၪ့ဖျိၭတၭ, ယီၫဒၫ့နီၪဂၧၩ့ထဲၩ့အ",
			"4": "<sup>4</sup> ၥၭလၧအလးခဲၫ့လီၫ.- ခိၪလီၩ့ၥံၪဖုၫထၪ့ယူၭဘဲၫၥိၪ ဖၫအၥိၭဒဲဆၧစီၩ့ခိၪနီၪ ဘဲၫၥိၪဖိၪအၥိၭလီၫ.",
			"5": "<sup>5</sup> မၫဆမံၭဧ့, မွဲဘၪနီၫလၧနစဲၪ့ဖျိၭနီၪလဲၪ. ယီၫဒၫ့ဧ့, မွဲဘၪနီၫ လၧနဂၧၩ့ထဲၩ့နၥၭ လၧနလးခဲၫ့နီၪလဲၪ.- ခိၪ",
			"6": "<sup>6</sup> လီၩ့ၥံၪဧ့, လၧနၥံၪဖုၫထၪ့ ဘဲၫၥိၪဖၫအၥိၭနီၪလဲၪ, ဒဲ ဆၧစီၩ့ခိၪၥံၪဧ့, ဘဲၫၥိၪဖိၪအၥိၭနီၪလဲၪ.",
			"7": "<sup>7</sup> ဂၪ့ခိၪဧ့, ဝၭၡိၩ့ၡိၬ လၧယွၩအမ့ၬယၫ,လၧစယၫကူၭ",
			"8": "<sup>8</sup> အယွၩအမ့ၬယၫဆံၭ.- မွဲၦလၧအအၪ့မၧၫ့လဲၫ့ကဲၪထၪ့ ထံၫကမၫ, လိးမ့ၪနီၪလၧထံၫထၪ့ဖျိၭလီၫ."
		},
		"115": {
			"1": "<sup>1</sup> လၧပဂးဒၪပဝ့ၫမွဲအ့ၬ, ယဟိဝၩဧ့, လၧပဂးမွဲအ့ၬး အ့ၪမွဲအီၪက့ၪဆၧလၩဖၩ့ လၧနမံၩ့ဒၪဝ့ၫ လၧနခိးန",
			"2": "<sup>2</sup> တၩ,ဒဲလၧနဆၧမွဲဆၧတီၩအကၠီၩ့နီၪဆံၭ.- လၧၦဆၨၩ ၥံၪမိစံၭဝ့ၫ, အဝ့ၫၥံၪအယွၩအီၪခီၫခီၫလဲၪနီၪ, မွဲအဘၪ",
			"3": "<sup>3</sup> ဆၧနီၪလဲၪ.- အ့ၪမွဲပယွၩအီၪလၧမူၭခိၪး ထီးဒၪအၥၭ နီၪမၩဝ့ၫဒၪထီးအလူၬလီၫ.",
			"4": "<sup>4</sup> အဝ့ၫၥံၪအဆၧဂၩ့ဆၧဖၪ့နီၪမွဲစ့ၩ, ဒဲထီၫ့တၭ, မွဲၦ",
			"5": "<sup>5</sup> ၡၩအစူၪမၩဆၧလီၫ.- အနိၭအီၪလါနၫ့တၭ, ချဲၩ့ဆၧ",
			"6": "<sup>6</sup> အ့ၬ.အမ့ၬၥၪၥံၪအီၪလါနၫ့တၭ, ဒၪဆၧအ့ၬ.- အနါၥံၪ အီၪလါနၫ့တၭ,နါဂၧၫ့ဆၧအ့ၬ.- အနၫဖူၫအီၪလါနၫ့ တၭ,နၧၫ့ဘၪဆၧအ့ၬ.",
			"7": "<sup>7</sup> အစူၪအီၪ, ဖီၪ့ဆၧအ့ၬ. အခၪ့အီၪဂၭဖၬအ့ၬး လၧအခိၬဖၧၩ့နီၪၥီၫထၪ့ဆ့အ့ၬ.",
			"8": "<sup>8</sup> ၦလၧအမၩကဲၪထၪ့ဝ့ၫလဖၪ, ၦဒိၭနဲၩ့အၥၭလၧအ ဝ့ၫၥံၪကိၭဂၩဒ့ၭနီၪ, လၩ့ဂၬဘဲၫအဝ့ၫၥံၪအၥိၭဆ့လီၫ.",
			"9": "<sup>9</sup> အံၫစရ့လၭဧ့, ဒိၭနဲၩ့နၥံၪအၥၭလၧယဟိဝၩဆံၭ. အဝ့ၫဒၪမွဲအဝ့ၫၥံၪအဆၧမၩဆၧၩ့း ဒဲအဝ့ၫၥံၪအထၩ့",
			"10": "<sup>10</sup> ဖံၭလဘံၪ့လီၫ.- စအၫရၧၫ့အၡၩဂံၪ့ဖိၪၥံၪဧ့, ဒိၭနဲၫ့န ၥံၪအၥၭလၧယဟိဝၩဆံၭ. အဝ့ၫဒၪမွဲအဝ့ၫၥံၪအဆၧ",
			"11": "<sup>11</sup> မၩဆၧၩ့း ဒဲအဝ့ၫၥံၪအထၩ့ဖံၭလဘံၪ့လီၫ.- ၦလၧအ ၥၭမဲၪယဟိဝၩၥံၪဧ့, ဒိၭနဲၩ့နၥံၪအၥၭ လၧယဟိဝၩ ဆံၭ.အဝ့ၫဒၪမွဲအဝ့ၫၥံၪ အဆၧမၩဆၧၩ့း ဒဲအဝ့ၫၥံၪ အထၩ့ဖံၭလဘံၪ့လီၫ.",
			"12": "<sup>12</sup> ယဟိဝၩနၪ့ထၪ့ထဲၩ့ယူၭပၧၩတၭ, မိဆိၪဂ့ၩပၧၩ တၭ,မိဆိၪဂ့ၩအံၫစရ့လၭအၡၩဂံၪ့ဖိၪတၭ, မိဆိၪဂ့ၩ",
			"13": "<sup>13</sup> စအၫရၧၫ့အၡၩဂံၪ့ဖိၪလီၫ.- မိဆိၪဂ့ၩ ၦလၧအၥၭမဲၪ",
			"14": "<sup>14</sup> ယဟိဝၩ,ဒဲဒိၪဒဲဆံၭလီၫ.- ယဟိဝၩမိမၩအၪထၪ့န",
			"15": "<sup>15</sup> ၥံၪ,နၥံၪဝ့ၫဒဲဖိၪဒဲလံၩလီၫ.- ယဟိဝၩလၧအမၩကဲၪ",
			"16": "<sup>16</sup> ထၪ့မူၭခိၪ, ဒဲဂၪ့ခိၪယီၩ, မွဲအဆိၪဂ့ၩနၥံၪဆံၭ.- မူၭခိၪ နီၪမွဲမူၭခိၪလၧယဟိဝၩအဂးလီၫ. အ့ၪမွဲဂၪ့ခိၪယီၩ",
			"17": "<sup>17</sup> ဖ့ၪလၫ့ဝ့ၫလၧၦၡၩအဖိၪခွၫၥံၪလီၫ.- တၭၦၥံၫယူၭ, ဒဲ ၦလၧအလ့ၩလၩ့လၧဆၧအီၪလၩ့မါပံၭ အဖၧၩ့ၥံၪနီၪ, စံၭထၪ့အၪ့အူၭယွၩအ့ၬ.",
			"18": "<sup>18</sup> အ့ၪမွဲပဝ့ၫဒၪယီၩ, ထီးယီၩလၧယၫလခီၫ ပမိစံၭ ထၪ့အၪ့အူၭယွၩလၩ့ဆိၩလၩ့ကၠၪလီၫ. နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၩဆံၭ."
		},
		"116": {
			"1": "<sup>1</sup> ယအဲၪဆၧကွံၩဆၧး အဂဲးဘဲၫယီၩယဟိဝၩခိၭနၪ",
			"2": "<sup>2</sup> ယလူဒဲယအၪ့ကံၩ့အၪ့ယၫဆၧလဖၪနီၪလီၫ.- အဝ့ၫ ဒၪဒိၭအနါလၧယၧၩအကၠီၩ့တၭ, လဆိၩဒၪယၥၭယီၩ ယမိကိၭထၪ့အဝ့ၫလီၫ.",
			"3": "<sup>3</sup> တၭဆၧၥံၫအဖျံၩအီၪဝၬဖီၩ့ယၧၩတၭ, ဖျႃဖၧၩ့အ ဆၧခိဆၧဝီၩနီၪ လၩ့ဘၪယၧၩလီၫ. တၭယဒၪန့ဆၧခိ",
			"4": "<sup>4</sup> ဆၧဝီၩ,ဒဲဆၧၥုၪ့အုၭၥၭအုၭလီၫ.- တၭယကိၭထၪ့ ယဟိဝၩအမံၩ့, ယဟိဝၩဧ့, မၩဖီၩ့မၩဖျ့ၭလါယၥၭ",
			"5": "<sup>5</sup> ဆံၭ.- ယဟိဝၩအီၪလၧဆၧအခိးအတၩတီၩဝ့ၫလီၩ့",
			"6": "<sup>6</sup> ဝ့ၫတၭ, ပယွၩအၥၭအီၪဆၧလီၫ.- ယဟိဝၩယိထဲၩ့ခွါ ထဲၩ့ၦလၧအလမၩလိၪဘၪဆၧလီၫ. ယဘၪဆၧဆၪ့ လၩ့ယၧၩတၭ, အဝ့ၫဒၪထိးထဲၩ့တၩ့ထဲၩ့ယၧၩလီၫ.",
			"7": "<sup>7</sup> ယၥၭၡီၩ့ဧ့, ထဲၩ့ထဲၩ့လၧနဆၧအီၪပွံၭ အလးဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩမၩဂ့ၩယူၭနၧၩ ဖၭဒိၪလီၫ.",
			"8": "<sup>8</sup> အဂဲးဘဲၫယီၩ နမၩဖီၩ့မၩဖျ့ၭယူၭယၥၭမၧၫ့ လၧဆၧ ၥံၫ,ယမ့ၬၥၪလၧမ့ၬထံၫ, ဒဲယခၪ့လၧဆၧဘၪထၧၩ့ဘၪ",
			"9": "<sup>9</sup> ထံၭနီၪလီၫ.- တၭယမိလ့ၩဆၧလၧယဟိဝၩအမ့ၬယၫ",
			"10": "<sup>10</sup> လၧထံၫၥံၪခးၥံၪ လၧၦၡၩမၧၫ့ဝ့ၫလၧအဖၧၩ့လီၫ.- ယ နဲၩဆၧ, မၩအၥၭဘဲၫနီၪတၭ, ယချဲၩ့ဆၧလီၫ. ယဝ့ၫ ဒၪယီၩယဘၪဆၧၡၪ့ဆၧနၭဒိၪမၬလီၫ.",
			"11": "<sup>11</sup> ထီးယဘၪဆၧၥၭမဲၪၥၭဖျဲၩ့ဖၭဒိၪတၭ, ယစံၭၦၡၩ ၥံၪ,မွဲၦချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧထီးအလူၬလီၫ.",
			"12": "<sup>12</sup> တၭယမိဖ့ၪထဲၩ့ယဟိဝၩ လၧအမၩဂ့ၩယၧၩလၧ ဆၧထီးအလူၬအကၠီၩ့နီၪ လၧဆၧနီၪလမံၩ့လဲၪ.",
			"13": "<sup>13</sup> ယမိမၩန့ဆၧထိးထဲၩ့တၩ့ထဲၩ့အလိၫ့လဖျိၪ့ ဒဲကိၭ",
			"14": "<sup>14</sup> ထၪ့ယဟိဝၩအမံၩ့လီၫ.- ဘိၩ့နဲၪ့ယီၩယမိမၩဘိၪ့ယ ဟိဝၩလၧဆၧဘၪဆဲၫ့ လၧယဆိၪလၩ့ယၥၭလၧအၡၩ",
			"15": "<sup>15</sup> ခမျၧးထီးအလူၬအမ့ၬယၫ ဘိၩ့နဲၪ့ယီၩလီၫ.- အၡၩ ဆံၫ့ဎံၪလဖၪအဆၧၥံၫနီၪ, မွဲဆၧလူဒိၪဎွ့ၩဒိၪလၧယ",
			"16": "<sup>16</sup> ဟိဝၩအမ့ၬၥၪဖၧၩ့လီၫ.- ယအၪ့ကံၩ့အၪ့ယၫနၧၩ, ယ ဟိဝၩဧ့, အဂဲးဘဲၫယီၩ, ယမွဲနခ့ၫနၡၩ လၩ့ထံးလၩ့ ဆ့ၭ,ယမွဲနခ့ၫနၡၩ, နခ့ၫနၡၩမုၪအဖိၪခွၫ, နကွဲၪလၩ့",
			"17": "<sup>17</sup> ယူၭဖျံၩစၧၩ့ထၬယၧၩယူၭ.- ယမိလုထၪ့နၧၩ လၧဆၧ လုစံၭထၪ့အၪ့အူၭတၭ, ယမိကိၭထၪ့ယဟိဝၩအမံၩ့",
			"18": "<sup>18</sup> လီၫ.- ဘိၩ့နဲၪ့ယီၩယမိမၩဘိၪ့ယဟိဝၩလၧဆၧဘၪ ဆဲၫ့လၧဆၧဆိၪလၩ့ယၥၭ လၧအၡၩခမျၧးထီးအလူၬ",
			"19": "<sup>19</sup> အမ့ၬယၫလီၫ.- လၧယဟိဝၩအဂံၪ့အဝၩ့ၥံၪအဖၧၩ့ လၧနၥၭခံဖၧၩ့, ယရုစလံၫ့ဧ့, နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့ အူၭယွၩဆံၭ."
		},
		"117": {
			"1": "<sup>1</sup> ၦကိၭဆၨၩဒ့ၭၥံၪဧ့, စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭး ၦခမျၧးထီးအလူၬၥံၪဧ့, ၥံၫကျံၩထၪ့ယဟိဝၩဆံၭ.",
			"2": "<sup>2</sup> အဂဲးဘဲၫယီၩ အခိးအတၩအီၪလၧပဂးဒိၪမၬတၭ, ယဟိဝၩအဆၧမွဲအတီၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ. နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၩဆံၭ."
		},
		"118": {
			"1": "<sup>1</sup> စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ. အဂဲးဘဲၫယီၩအဝ့ၫ ဒၪဂ့ၩဝ့ၫတၭ, အခိးအတၩအီၪဝ့ၫ လၩ့ဆိၩလၩ့ကၠၪ အဂဲးလီၫ.",
			"2": "<sup>2</sup> မွဲအံၫစရ့လၭစံၭလါဆံၭ, အဂဲးဘဲၫယီၩအခိးအတၩ",
			"3": "<sup>3</sup> အီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- မွဲစအၫရၧၫ့အၡၩဂံၪ့ဖိၪ စံၭလါဆံၭး အဂဲးဘဲၫယီၩ အခိးအတၩအီၪဝ့ၫလၩ့",
			"4": "<sup>4</sup> ဆိၩလၩ့ကၠၪလီၫ.- ၦလၧအၥၭမဲၪယဟိဝၩနီၪ, မွဲအ စံၭလါဆံၭး အဂဲးဘဲၫယီၩအခိးအတၩအီၪဝ့ၫလၩ့ဆိၩ",
			"5": "<sup>5</sup> လၩ့ကၠၪလီၫ.- လၧယဘၪဆၧခိဆၧဝီၩအလးယီၩ, ယကိၭထၪ့ယွၩတၭ, ယွၩစံၭဆၧၫ့ယၧၩ ဎဒဲအီၪက့ၪယၧၩၭ",
			"6": "<sup>6</sup> လၧအလးဖၭလဲအဖၧၩ့လီၫ.- မွဲယဟိဝၩအီၪလၧယ ၥိၭတၭ, ၦၡၩမိမၩယၧၩဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ ယမိ",
			"7": "<sup>7</sup> အၪ့ယိၪအ့ၬ.- ယဟိဝၩအီၪလၧယၥိၭ လၧၦမၩဆၧၩ့ ယၧၩအကျၩတၭ, ယမိဒၪဘၪဆၧ လၧအဘၪယၥၭ",
			"8": "<sup>8</sup> လၧၦလၧအမ့ၬလဲၩယၧၩလဖၪအလီၩ့လီၫ.- ဆၧဒိၭ နဲၩ့လၧယဟိဝၩနီၪမွဲဆၧဂ့ၩနဲၪ့ ဆၧဒိၭနဲၩ့အၥၭလၧ",
			"9": "<sup>9</sup> ၦၡၩဒံၭလီၫ.- ဆၧဒိၭနဲၩ့လၧယဟိဝၩနီၪ မွဲဆၧဂ့ၩနဲၪ့",
			"10": "<sup>10</sup> ဆၧဒိၭနဲၩ့အၥၭ လၧၦဒိၪဖၭဒိၪၥံၪ ဒံၭလီၫ.- ၦဆၨၩ ထီးအလူၬအီၪဝၬဖီၩ့ယၧၩ, ယမိဒၪ့ထ့ၬခွံၬ အဝ့ၫၥံၪ",
			"11": "<sup>11</sup> လၧယဟိဝၩအမံၩ့နီၪလီၫ.- အဝ့ၫၥံၪအီၪဝၬဖီၩ့ယၧၩ, မွဲမၬအီၪဝၬဖီၩ့ယၧၩး ယမိဒၪ့ထ့ၬခွံၬတၡါ အဝ့ၫၥံၪ",
			"12": "<sup>12</sup> လၧယဟိဝၩအမံၩ့အကၠီၩ့လီၫ.- အဝ့ၫၥံၪအီၪဝၬဖီၩ့ ယၧၩဘဲၫန့ၫၥံၪအၥိၭနီၪတၭ, မွဲအလၩ့ဖံၭယူၭဘဲၫဆၧ ဆူၪအမ့ၪအၥိၭနီၪတၭ, ယမိဒၪ့ထ့ၬခွံၬတၡါအဝ့ၫၥံၪ",
			"13": "<sup>13</sup> လၧယဟိဝၩအမံၩ့လီၫ.- နဆၪ့ယၧၩဆီၪ့ ဘဲၫၥိၭ ယမိလၩ့ထံၩဖါလါနၫ့တၭ, ယဟိဝၩမၩဆၧၩ့ယၧၩ",
			"14": "<sup>14</sup> လီၫ.- ယွၩမွဲယဂဲးယဘၭ, ဒဲယထၭခိၪတၭ, ကဲၪထၪ့",
			"15": "<sup>15</sup> ဝ့ၫလၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩလီၫ.- တၭဆၧအၥီၫ ဘၪဆဲၫ့လၧဆၧၥုၪ့ထိၬၥၭထိၬ, ဒဲဆၧထိးထဲၩ့တၩ့ထဲၩ့ နီၪအီၪဝ့ၫလၧၦတီၩၦလီၩ့အတဲၩၥံၪအဖၧၩ့လီၫ. ယဟိ",
			"16": "<sup>16</sup> ဝၩအစူၪထွ့ၪမၩဆၧအစီၩ့အမၩ့လီၫ.- ယဟိဝၩအစူၪ ထွ့ၪထၪ့ထီၫဝ့ၫတၭ, ယဟိဝၩအစူၪထွ့ၪမၩဆၧအစီၩ့ အမၩ့လီၫ.",
			"17": "<sup>17</sup> ယလၥံၫဘၪတၭ, မွဲယမိမၧၫ့ဒံၭဒဲလီၩလၩ့လၬလၩ့",
			"18": "<sup>18</sup> ယွၩအဆၧမၩလဖၪနီၪလီၫ.- တၭယွၩအၪ့ၥီၪ့ယၧၩ နၭနၭလ့ၬလါနၫ့တၭ, ဖ့ၪလၫ့ခွံၬယူၭယၧၩလၧဆၧၥံၫ",
			"19": "<sup>19</sup> အ့ၬ.- ဝဲထၪ့န့ယၧၩ လၧဆၧတီၩဆၧလီၩ့အတရၫ့ၥံၪ ဆံၭ.ယမိလ့ၩနုၬလၧအဖၧၩ့တၭ, ယမိစံၭထၪ့အၪ့အူၭ",
			"20": "<sup>20</sup> ယွၩလီၫ.- ယဟိဝၩအတရၫ့ယီၩ ၦတီၩၦလီၩ့ၥံၪမိလ့ၩ",
			"21": "<sup>21</sup> နုၬလၧအဖၧၩ့လီၫ.- ယမိစံၭထၪ့အၪ့အူၭနၧၩ,အဂဲးဘဲၫ ယီၩနခိၭနၪယူၭယလူယူၭ, နကဲၪထၪ့ဆၧထိးထဲၩ့တၩ့",
			"22": "<sup>22</sup> ထဲၩ့ယၧၩယူၭ.- လိးလၧၦမၩဆၧဖိၪၥံၪခွံၬၡိၭဝ့ၫလ",
			"23": "<sup>23</sup> ဖျိၪ့နီၪအီၪယူၭလၧဆၧအနိၪ့အခိၪစီၪ့ယူၭ.- ဆၧလမံၩ့ ယီၩဂဲၫလၧယဟိဝၩတၭ, မွဲဆၧလၩ့လၭလၧပမ့ၬယၫ",
			"24": "<sup>24</sup> လီၫ.- ဆၧလၧမုလနံၩယီၩ, ယဟိဝၩတဲၩ့ဝ့ၫတၭ,ပမိ",
			"25": "<sup>25</sup> ၥုၪ့ဎွံၫၥၭယီၫ, ဒဲၥုၪ့ထိၬၥၭထိၬလၧအဖၧၩ့လီၫ.- ထိး ထဲၩ့တၩ့ထဲၩ့လါ ဆၧဘိၩ့နဲၪ့ယီၩဆံၭ, ယဟိဝၩဧ့, ဒုၭ",
			"26": "<sup>26</sup> ဘီၪထၪ့ယီၫထၪ့လါဆၧဆံၭ, ယဟိဝၩဧ့,- ၦလၧအ ဂဲၫလၧယဟိဝၩအမံၩ့နီၪ မွဲအဘၪဆၧဆိၪဂ့ၩဆံၭ. ပ",
			"27": "<sup>27</sup> ဆိၪဂ့ၩနၥံၪလၧယဟိဝၩအဂံၪ့ဖၧၩ့လီၫ.- ယဟိဝၩမွဲ ယွၩတၭ, ဒုၭဖၩ့ထၪ့ဘၪယူၭပၧၩယူၭ. စၧၩ့ထၬဆၧ",
			"28": "<sup>28</sup> လုလၧဆၧလုလးအနိၩ့အဖျံၩၥံၪနီၪဆံၭ.- နမွဲယယွၩ တၭယမိစံၭထၪ့အၪ့အူၭနၧၩ, ယယွၩတၭ, ယမိအီၪ",
			"29": "<sup>29</sup> က့ၪထၪ့ထီၫနၧၩလီၫ.- စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪဂ့ၩဝ့ၫလီၫ. မွဲအခိးအတၩအီၪ ဝ့ၫလၩ့ဆိၩလၩ့ကၠၪအဂဲးလီၫ."
		},
		"119": {
			"1": "<sup>1</sup> ၦလၧအၥၭဆုးလီၩ့ဝ့ၫ လၧအဖၧၩ့ၥၭအဖၧၩ့တၭ, လ့ၩဆၧလၧယဟိဝၩ အဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့နီၪဘၪ",
			"2": "<sup>2</sup> ဆိၪဂ့ၩဝ့ၫလီၫ.- ၦလၧအထီးန့ဖံၭထၬအဆၧထိးအၥၭ လဖၪနီၪဘၪဆိၪဂ့ၩဝ့ၫတၭ, အဝ့ၫၥံၪအၪ့ဎၬန့ယွၩလၧ",
			"3": "<sup>3</sup> အၥၭထၧၫ့ဖျိၪ့ယၫလီၫ.- အဝ့ၫၥံၪလမၩဘၪဆၧအၧၩ့ တၭ, လ့ၩဝ့ၫလၧအဝ့ၫဒၪ အဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭနီၪလီၫ.",
			"4": "<sup>4</sup> နမၪလူၬဆၧလၧပဘၪထီးန့ဖံၭထၬ နဆၧၥီၪ့ဆၧၥၫ့လ",
			"5": "<sup>5</sup> ဖၪလၩ့ထံးလၩ့ဆ့ၭလီၫ.- ဘဲၫၥိၭယမိထီးန့ဖံၭထၬ နဆၧၥနိၫလဖၪနီၪ, မွဲဆၧဒုၭနဲၪလါ ယဖၧၩ့ၥၭၥံၪ",
			"6": "<sup>6</sup> ဆံၭ.- ထီးယအ့ၪယိမ့ၬနဆၧမၪလူၬၥံၪထီးအလူၬတၭ,",
			"7": "<sup>7</sup> ယမ့ၬမိမဲဘၪအ့ၬ.- ထီးယအ့ၪမၩလိၪနစ့ၩရၫ့ဆၧတီၩ တၭ,ယမိစံၭထၪ့အၪ့အူၭနၧၩ လၧယၥၭဆုးလီၩ့လီၫ.",
			"8": "<sup>8</sup> တၭယမိထီးန့ဖံၭထၬ နၥနိၫလဖၪတၭ, မွဲနထီးခွံၬၡိၭ ခွံၬယၧၩလူၬထူၬလဂ့ၩ.",
			"9": "<sup>9</sup> ၦဖိၪၥၪခွၫမိမၩဆံၫ့အဖၧၩ့ၥၭဘဲၫၥ့ၪလဲၪ. မွဲလၧအ",
			"10": "<sup>10</sup> ထီးလၩ့အၥၭဘဲၫနလူနထၫအၥိၭနီၪလီၫ.- ယအၪ့ဎၬ ယူၭနၧၩလၧယၥၭထၧၫ့ဖျိၪ့ယၫတၭး မွဲယထီးလ့ၩမၪ",
			"11": "<sup>11</sup> ဘၪနဆၧမၪလူၬၥံၪလဂ့ၩ.- ဘဲၫၥိၭယထီးမၪဘၪနၧၩ လဂ့ၩတၭ, ယအီၪက့ၪကီၪ့ထၬနလူနထၫ လၧယၥၭခံ",
			"12": "<sup>12</sup> ဖၧၩ့လီၫ.- ယဟိဝၩဧ့, မွဲနဘၪဆၧစံၭထၪ့အၪ့အူၭနၧၩ",
			"13": "<sup>13</sup> ဆံၭ.ၥီၪ့လိၪယၧၩလၧနၥနိၫလဖၪဆံၭ.- လၧယနိၭဖျံၩ ၥံၪယလီၩလၩ့လၬလၩ့ယူၭ ကယဲနစ့ၩရၫ့ဆၧလၧနနိၭ",
			"14": "<sup>14</sup> ထီးအလူၬနီၪလီၫ.- ယၥုၪ့ဎွံၫၥၭယီၫယူၭလၧနဆၧထိး နၥၭအဖၧၩ့ၥၭအဖၧၩ့, ဘဲၫလၧကယဲဆၧအစူၪလးခၪ့",
			"15": "<sup>15</sup> ခိၪထီးအလူၬအကၠီၩ့အၥိၭနီၪလီၫ.- ယမိဆီၫ့မီၪ့ဆၧ လၧနဆၧမၪလူၬၥံၪအဂဲးတၭ, ယမိယိမ့ၬနဖၧၩ့ၥုၪ့ဖၧၩ့",
			"16": "<sup>16</sup> ၥၭလီၫ.- တၭယမိၥုၪ့ဎွံၫၥၭယီၫ လၧနဆၧမၪလူၬအ ဖၧၩ့နီၪ,ယမိၥၭနၪ့နလူနထၫအ့ၬ.",
			"17": "<sup>17</sup> မၩဂ့ၩနခ့ၫနၡၩဘဲၫၥိၭယမိမၧၫ့တၭ, ယမိထီးန့ဖံၭ",
			"18": "<sup>18</sup> ထၬနလူနထၫလီၫ.- ဝဲထၪ့ယမ့ၬၥၪဆံၭ, တၭယမိဒၪ",
			"19": "<sup>19</sup> ဘၪဆၧလၩ့လၭလၧနဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့လီၫ.- ယမွဲ ၦမွံၩလၧဂၪ့ခိၪချိၫ့ယီၩတၭ, ထီးအီၪက့ၪၥူၪခွံၬ နဆၧ",
			"20": "<sup>20</sup> မၪလူၬၥံၪလၧယမ့ၬယၫလဂ့ၩ.- ယၥၭဆိၫ့န့နဆၧစ့ၩ",
			"21": "<sup>21</sup> ရၫ့ကိၭအဆၧၫ့အထီဒ့ၭ ယၥုၪ့ခါယၥၭလၩ့လီၫ.- ၦ လၧအအီၪက့ၪထၪ့ထီၫအၥၭ လၧအဘၪဆၧဆိၪအၧၩ့, လၧအလၨၪခၫ့ဖၬ နဆၧမၪလူၬၥံၪနီၪနအၪ့ၥီၪ့ယူၭအဝ့ၫ",
			"22": "<sup>22</sup> ၥံၪယူၭ.- ဆၧဒုၪဒွ့ၪ, ဒဲဆၧမၩကြၩ့ထမးနီၪၥုၭခွံၬလၧ ယၧၩဆံၭ. အဂဲးဘဲၫယီၩယထီးန့ယူၭ နဆၧထိးနၥၭ",
			"23": "<sup>23</sup> လီၫ.- ၦဒိၪဖၭဒိၪဆ့ဆၧၫ့နၩ့တၭ, ချဲၩ့ထၫ့ဒုၪထၫ့ဒၩ ယၧၩယီၩး အ့ၪမွဲနခ့ၫနၡၩ ဆီၫ့မီၪ့ဆၧလၧနၥနိၫလဖၪ",
			"24": "<sup>24</sup> အဂဲးလီၫ.- နဆၧထိးနၥၭလဖၪနီၪ မွဲယဆၧၥုၪ့ဎွံၫၥၭ ယီၫဆ့, ဒဲဆၧဒုၭကိၪ့ယၧၩလီၫ.",
			"25": "<sup>25</sup> ယၥၭဘုၭထၬလၧဂၪ့ခိၪအမုၬတၭး ဘဲၫနချဲၩ့ဆၧ",
			"26": "<sup>26</sup> အၥိၭနီၪဒုၭမၧၫ့ထၪ့ထဲၩ့ယၧၩဆံၭ.- ယဖၧၩ့ၥုၪ့ဖၧၩ့ ၥၭအဂဲးနီၪယလီၩလၩ့လၬလၩ့ယူၭတၭ, နနါဂၧၫ့ယူၭ ယလူယူၭ, ၥီၪ့လိၪလါယၧၩလၧနၥနိၫလဖၪနီၪဆံၭ.",
			"27": "<sup>27</sup> ဒုၭနၪၥ့ၪလါယၧၩ လၧနဆၧၥီၪ့ဆၧၥၫ့လဖၪ အဖၧၩ့ ၥၭဆံၭ. တၭယမိဆီၫ့မီၪ့ဆၧလၧနဆၧလၩ့လၭအဂဲး",
			"28": "<sup>28</sup> လီၫ.- မွဲယၥုၪ့အုၭယၥၭအုၭတၭ, ယၥၭအမ့ၬထံၫ လၩ့တၭး ဘဲၫနလူနထၫအၥိၭနီၪ ဒုၭဂဲထုၪ့ထဲၩ့ယၧၩ",
			"29": "<sup>29</sup> ဆံၭ.- မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧဆၧအဘျံၭအဘျၪအ ဖၧၩ့ၥၭတၭ, ယၫ့ၥၭဖ့ၪလၫ့ယၧၩ လၧနဆၧၥီၪ့ဆၧၥၫ့",
			"30": "<sup>30</sup> နီၪဆံၭ.- တၭဆၧမွဲဆၧတီၩအဖၧၩ့ၥၭနီၪ ယရွံန့ယူၭ နစ့ၩရၫ့ဆၧလဖၪနီၪ ယအီၪက့ၪလၩ့လၧယမ့ၬယၫ",
			"31": "<sup>31</sup> လီၫ.- ယဖီၪ့ထၬနဆၧထိးနၥၭလဖၪဂုးခၧၫ့, ယဟိ ဝၩဧ့,မွဲယထီးဘၪဆၧအီၪက့ၪမ့ၬမဲယၧၩလဂ့ၩ.",
			"32": "<sup>32</sup> ထီးနအ့ၪမၩလဲထၪ့ယၥၭတၭ, ယမိစဲၪ့ဖိၬနဆၧ မၪလူၬၥံၪအဖၧၩ့ၥၭလီၫ.",
			"33": "<sup>33</sup> ယဟိဝၩဧ့,ၥီၪ့လိၪယၧၩလၧနၥနိၫလဖၪအဖၧၩ့ၥၭ",
			"34": "<sup>34</sup> နီၪဆံၭ.တၭယမိထီးန့ဖံၭထၬထီးအထုၬလီၫ.- ဒုၭနၪ ၥ့ၪယၧၩဆံၭး တၭယမိထီးန့ဖံၭထၬ နဆၧမၪလူၬနီၪ,",
			"35": "<sup>35</sup> ဒဲယမိထီးန့ လၧယၥၭထၧၫ့ဖျိၪ့ယၫဆ့လီၫ.- ဒုၭဖိၬ ယၧၩလၧနဆၧမၪလူၬလဖၪ အဖၧၩ့ၥၭဆံၭ. အဂဲးဘဲၫ",
			"36": "<sup>36</sup> ယီၩဆၧမုၬလၩယၥၭလၧအဖၧၩ့လီၫ.- ဘိၭကၠၪယၥၭ လၧဆၧၥၭကွံၩနီၪလဂ့ၩ, အ့ၪမွဲလၧနဆၧထိးအၥၭလ",
			"37": "<sup>37</sup> ဖၪနီၪလခီၫဆံၭ.- ဒုၭယိဖီၩ့ယိဖျ့ၭယမ့ၬၥၪလၧဆၧ ပျီၩပျီၩနီၪဆံၭး ဒုၭမၧၫ့ထၪ့ထဲၩ့ယၧၩ လၧနဖၧၩ့ၥုၪ့",
			"38": "<sup>38</sup> ဖၧၩ့ၥၭနီၪဆံၭ.-ဒုၭအီၪဂုးအီၪခၧၫ့နလူနထၫလၧနခ့ၫ",
			"39": "<sup>39</sup> နၡၩလၧအၥၭမဲၪနၧၩလဂၩအဂးဆံၭ.- မၩဖီၩ့မၩဖျ့ၭ ယၧၩလၧယဆၧဒုၪဒွ့ၪလၧယၥၭမဲၪယဝ့ၫနီၪဆံၭ. အ",
			"40": "<sup>40</sup> ဂဲးဘဲၫယီၩနဆၧစ့ၩရၫ့လဖၪ မွဲအဂ့ၩအဘၪလီၫ.- ယိ ခွါ, ယဆိၫ့န့ဘၪနဆၧမၪလူၬၥံၪတၭး မၩမၧၫ့ထၪ့ထဲၩ့ လါယၧၩလၧနဆၧတီၩဆၧလီၩ့အဖၧၩ့နီၪဆံၭ.",
			"41": "<sup>41</sup> တၭယဟိဝၩဧ့, မွဲနခိးနတၩ,နဆၧထိးထဲၩ့တၩ့ထဲၩ့",
			"42": "<sup>42</sup> ဂဲၫထီၩ့လၧယၧၩဘဲၫနဆၧချဲၩ့အၥိၭနီၪဆံၭ.- တၭယ မိချဲၩ့ဆၧၫ့ ၦလၧအဒုၪဒွ့ၪယၧၩယီၩး အဂဲးဘဲၫယီၩ",
			"43": "<sup>43</sup> ယဒိၭနဲၩ့ယၥၭလၧနလူလီၫ.- တၭထီးမၩန့ခွံၬနဆၧ ချဲၩ့အမွဲအတီၩ လၧယနိၭဖၧၩ့လူၬထူၬလဂ့ၩ. အဂဲး",
			"44": "<sup>44</sup> ဘဲၫယီၩယခိၭယူၭလၧနဆၧစ့ၩရၫ့ၥံၪအဂးလီၫ.- တၭ ယမိထီးန့ဖံၭထၬ နဆၧၥီၪ့ဆၧၥၫ့ လထံၪဎးလၩ့ဆိၩ",
			"45": "<sup>45</sup> လၩ့ကၠၪဒဲလၩ့ဆိၩလၩ့ကၠၪတၭး- ဒဲယမိလ့ၩဆၧလၧ အလးဖၭလဲနီၪ, အဂဲးဘဲၫယီၩယအၪ့ဎၬ နဆၧၥီၪ့ဆၧ",
			"46": "<sup>46</sup> ၥၫ့ၥံၪလီၫ.- တၭယမိချဲၩ့ဆၧလၧနဆၧထိးနၥၭလဖၪ အဂဲးလၧစဎွၩၥံၪအမ့ၬယၫနီၪ, ယမ့ၬမိမဲဘၪအ့ၬ.",
			"47": "<sup>47</sup> တၭနဆၧမၪလူၬၥံၪ, လၧယအဲၪဝ့ၫလဖၪနီၪ, ယမိၥုၪ့",
			"48": "<sup>48</sup> ဎွံၫၥၭယီၫလၧအဝ့ၫၥံၪအဖၧၩ့လီၫ.- တၭယယူၬထၪ့ ယစူၪလၧနဆၧမၪလူၬၥံၪ, လၧယအဲၪဝ့ၫအအီၪနီၪ,ယ ဆီၫ့မီၪ့ဆၧလၧနၥနိၫလဖၪအဂဲးလီၫ.",
			"49": "<sup>49</sup> နလူနထၫလၧနဒုၭယိလါနခ့ၫနၡၩလၧအဖၧၩ့နီၪ, မွဲ",
			"50": "<sup>50</sup> နနၪ့ထၪ့ထဲၩ့ဆံၭ.- အယီၩမွဲဆၧလၧအမၩမုၬထၪ့ထဲၩ့ ယၧၩလၧယဘၪၡၪ့ဘၪနၭ အဘိၩ့ဘၭနီၪ, နလူနထၫ",
			"51": "<sup>51</sup> မၩမၧၫ့ထၪ့ထဲၩ့ယၧၩယူၭ.- တၭၦအီၪက့ၪထၪ့ထီၫအ ၥၭလဖၪနီၪဒုၪဒွ့ၪယၧၩနၭမၬတၭး ယဂၭဎ့ၭခွံၬနဆၧ",
			"52": "<sup>52</sup> ၥီၪ့ဆၧၥၫ့အ့ၬ.- ယဟိဝၩဧ့, နစ့ၩရၫ့ဆၧလၧဖျိၩ့လၧအ ၥၫ့နီၪယနၪ့ထၪ့ထဲၩ့ယူၭ. တၭယၥၭမုၬထၪ့ဝ့ၫလီၫ.",
			"53": "<sup>53</sup> မွဲၦလတီၩလလီၩ့ဘၪ စဲၪ့ဒၪခွံၬနဆၧၥီၪ့ဆၧၥၫ့အကၠီၩ့",
			"54": "<sup>54</sup> တၭ,ယၥၭခိထၪ့ဒိၪဒိၪလ့ၬလီၫ.- တၭနၥနိၫလဖၪနီၪ မွဲယူၭယဆၧၥံၫကျံၩၥံၪ လၧယအီၪၦမွံၩ အဂံၪ့ဖၧၩ့",
			"55": "<sup>55</sup> လီၫ.-ယဟိဝၩဧ့, ယနၪ့ထၪ့ထဲၩ့ယူၭနမံၩ့လၧမုနၩလ",
			"56": "<sup>56</sup> ခီၫတၭ, ယထီးန့ဖံၭထၬယူၭနဆၧၥီၪ့ဆၧၥၫ့လီၫ.- အ ယီၩအီၪယူၭလၧယၧၩ, လၧယထီးန့ယူၭနဆၧၥီၪ့ဆၧ ၥၫ့ၥံၪအဂဲးလီၫ.",
			"57": "<sup>57</sup> ယဟိဝၩမွဲယဂးတၭ ယစံၭယူၭလၧယမိထီးန့ဖံၭ",
			"58": "<sup>58</sup> ထၬနလူနထၫလီၫ.- တၭယအၪ့ဎၬယူၭနခိးနတၩလၧ ယၥၭထၧၫ့ဖျိၪ့ယၫယီၩ ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩဘဲၫနဆၧ",
			"59": "<sup>59</sup> ချဲၩ့အၥိၭနီၪဆံၭ.- ယဆီၫ့မီၪ့ယူၭဆၧလၧယဖၧၩ့ၥၭ အဂဲးတၭ, ယဘိၭကၠၪထဲၩ့ယူၭ ယခၪ့လၧနဆၧထိးန",
			"60": "<sup>60</sup> ၥၭၥံၪအအီၪနီၪလီၫ.- ယအီၪယံၬအီၪနးအ့ၬး ယမၩ ချဲၫ့ချဲၫ့ယူၭ ဘဲၫယမိထီးန့ဖံၭထၬ နဆၧမၪလူၬၥံၪအ",
			"61": "<sup>61</sup> ၥိၭနီၪလီၫ.- ၦလတီၩလလီၩ့ဘၪအဖျံၩခွၩ့အီၪဝၬဖီၩ့ ယၧၩလါနၫ့တၭ, ယၥၭနၪ့ခွံၬနဆၧၥီၪ့ဆၧၥၫ့နီၪအ့ၬ.",
			"62": "<sup>62</sup> လၧနဆၧတီၩဆၧလီၩ့ အဆၧစ့ၩရၫ့ၥံၪအကၠီၩ့နီၪ, ယ မိဂဲထုၪ့ လၧဖိၭဖၫ့မု ဘဲၫၥိၭယမိစံၭထၪ့အၪ့အူၭနၧၩ",
			"63": "<sup>63</sup> လီၫ.- တၭယထၧၫ့ထံၩထၧၫ့ၥိၭကယဲၦလၧအၥၭမဲၪ နၧၩ,ဒဲၦလၧအထီးန့ဖံၭထၬ နဆၧၥီၪ့ဆၧၥၫ့ၥံၪလီၫ.",
			"64": "<sup>64</sup> တၭဂၪ့ခိၪလၧၫ့ဎွ့ၩဝ့ၫလၧနခိးနတၩး ယဟိဝၩဧ့, ၥီၪ့ လိၪယၧၩလၧနၥနိၫလဖၪဆံၭ.",
			"65": "<sup>65</sup> ယဟိဝၩဧ့, ဘဲၫနလူနထၫအၥိၭနီၪ နမၩဂ့ၩယူၭန",
			"66": "<sup>66</sup> ခ့ၫနၡၩယူၭလီၫ.- ၥီၪ့လိၪယၧၩလၧယနၪဆၧမိၥ့ၪအ့ၪ ဂ့ၩ,ဒဲဆၧၥ့ၪယၫဆံၭ. အဂဲးဘဲၫယီၩယနဲၩယူၭနဆၧ",
			"67": "<sup>67</sup> မၪလူၬၥံၪလီၫ.- ယလချႃၭဘၪဒံၭဘၪဆၧၡၪ့ဆၧနၭ တၭ,ယလ့ၩမၪဖၧၩ့ၥၭနီၪ, အ့ၪမွဲဘိၩ့နဲၪ့ယီၩယထီး",
			"68": "<sup>68</sup> န့ဖံၭထၬယူၭနလူနထၫယူၭလီၫ.- နမွဲဆၧဂ့ၩနမၩဂ့ၩ",
			"69": "<sup>69</sup> ဆၧတၭး ၥီၪ့လိၪယၧၩလၧနၥနိၫလဖၪဆံၭ.- ၦအီၪ က့ၪထၪ့ထီၫအၥၭနီၪ ကိၪ့ထၪ့ဖၭလၩ့ဆၧချဲၩ့အဘျံၭ အဘျၪထၫ့ဒုၪဒၩယၧၩး အ့ၪမွဲယဝ့ၫဒၪယီၩ ယမိထီး န့ဖံၭထၬနဆၧမၪလူၬၥံၪ လၧယၥၭထၧၫ့ဖျိၪ့ယၫလီၫ.",
			"70": "<sup>70</sup> တၭအဝ့ၫၥံၪအၥၭနီၪ ဘီၪ့ထၪ့ဝ့ၫဘဲၫဆၧၥိၪဆၧချၫအ ၥိၭလီၫ.အ့ၪမွဲယဝ့ၫဒၪယီၩ ယၥုၪ့ဎွံၫၥၭယီၫလၧန",
			"71": "<sup>71</sup> ဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့လီၫ.- တၭယဘၪဆၧၡၪ့ဆၧနၭ နီၪဂ့ၩဝ့ၫ လၧယဂးလၧယမိမၩလိၪ နၥနိၫလဖၪအ",
			"72": "<sup>72</sup> ဂဲးလီၫ.- တၭဆၧၥီၪ့ဆၧၥၫ့ လၧနနိၭနီၪ ဂ့ၩနဲၪ့ဒံၭလၧ ထီၫ့ၥံၪလွ့ၫၥံၪ, ဒဲကျိၪၥံၪစ့ၩၥံၪ အထီၫ့လဖၪလၧယဂး လီၫ.",
			"73": "<sup>73</sup> နစူၪမၩကဲၪထၪ့ယူၭယၧၩ, ဒဲဖ့ၪလၫ့ယူၭ ယခံးယ ဂၩ့တၭး ဒုၭနၪၥ့ၪယၧၩ ဘဲၫၥိၭယမိမၩလိၪ နဆၧမၪ",
			"74": "<sup>74</sup> လူၬၥံၪဆံၭ.- ၦလၧအၥၭမဲၪနၧၩနီၪ မိဒၪဘၪယၧၩမိၥၭ ထိၬဝ့ၫတၭး အဂဲးဘဲၫယီၩ ယယိလါဆၧလၧနလူနထၫ",
			"75": "<sup>75</sup> အဖၧၩ့လီၫ.- ယဟိဝၩဧ့,ယၥ့ၪယၫလၧနဆၧစ့ၩရၫ့နီၪ မွဲဆၧတီၩဆၧလီၩ့တၭ, နဒုၭၡၪ့ဒုၭနၭယူၭယၧၩတီၩ",
			"76": "<sup>76</sup> တီၩလီၩ့လီၩ့လီၫ.- တၭဘဲၫနလူနထၫ အီၪလၧနခ့ၫ နၡၩအၥိၭနီၪ, မွဲနခိးနတၩမၩမုၬထၪ့ထဲၩ့ လါယၧၩ",
			"77": "<sup>77</sup> ဆံၭ.- တၭမွဲနဆၧယၫ့ၥုၪ့ယၫ့ၥၭဘၪယၧၩ, ဘဲၫၥိၭ ယမိမုၬထၪ့ဆံၭ. အဂဲးဘဲၫယီၩ နဆၧၥီၪ့ဆၧၥၫ့မွဲယ",
			"78": "<sup>78</sup> ဆၧၥုၪ့ဎွံၫၥၭယီၫလီၫ.- တၭၦအီၪက့ၪထၪ့ထီၫအၥၭ နီၪ,မွဲအမ့ၬမဲဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမၩအၧၩ့ ယၧၩလၧဆၧအဘျံၭအဘျၪး အ့ၪမွဲယဝ့ၫဒၪယီၩ, ယ",
			"79": "<sup>79</sup> ဆီၫ့မီၪ့ဆၧလၧနဆၧၥီၪ့ဆၧၥၫ့ၥံၪအဂဲးလီၫ.- တၭၦ လၧအၥၭမဲၪနၧၩ, ဒဲၦလၧအၥ့ၪယၫနထိးနၥၭလဖၪနီၪ",
			"80": "<sup>80</sup> မိဂဲၫထဲၩ့လၧယအီၪလီၫ.- ဘဲၫၥိၭယမ့ၬထီးမဲလဂ့ၩ တၭ,မွဲယၥၭလၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧနၥနိၫလဖၪအဖၧၩ့ ဆံၭ.",
			"81": "<sup>81</sup> ဆၧၥူၫယၥၭလၧနဆၧထိးထဲၩ့တၩ့ထဲၩ့, ယၥၭလၩ့",
			"82": "<sup>82</sup> ဘဲၩတၭး ယယိလါနဆၧချဲၩ့အဖၧၩ့ၥၭလီၫ.- တၭယ မ့ၬၥၪလူၬလၧနလူနထၫအကၠီၩ့လီၫ. ယစံၭ, ဆံၭယံၬ",
			"83": "<sup>83</sup> ခိၭနမိမၩမုၬထၪ့ထဲၩ့ယၧၩလဲၪ.- အဂဲးဘဲၫယီၩယ မၩယၥၭဘဲၫထံၫထိၪ့ဆၧဖံၭ လၧမ့ၪခူၪကျၩအၥိၭနီၪ",
			"84": "<sup>84</sup> တၭးနၥနိၫလဖၪနီၪယၥၭနၪ့အ့ၬ.- နခ့ၫနၡၩအမုနံၩ နီၪဆံၭအၪလဲၪ. ဆံၭယံၬခိၬ နမိစ့ၩရၫ့ ၦမၩအၧၩ့မၩ",
			"85": "<sup>85</sup> ၥၫ့ယၧၩလဖၪနီၪလဲၪ.- တၭၦလၧအအီၪက့ၪထၪ့ထီၫ အၥၭနီၪခုၪ့လၩ့ဆၧဖၧၩ့လၧယဂးတၭ, အဝ့ၫၥံၪမွဲဘဲၫ",
			"86": "<sup>86</sup> နဆၧၥီၪ့ဆၧၥၫ့အၥိၭနီၪအ့ၬ.- တၭနဆၧမၪလူၬၥံၪမွဲ ဆၧအတီၩထီးအလူၬတၭး ၦမၩအၧၩ့မၩၥၫ့ယၧၩလၧ ဆၧအဘျံၭအဘျၪလီၫ. နဝ့ၫဒၪ မၩဆၧၩ့လါယၧၩ",
			"87": "<sup>87</sup> ဆံၭ.- လၩ့ဘူၭဝ့ၫလၧအဝ့ၫၥံၪ မၩဂၭဂီၩ့ယူၭယၧၩ လၧထံၫၥံၪခးၥံၪအဖၧၩ့တၭ, ယဝ့ၫဒၪ,ယစဲၪ့ဒၪနဆၧ",
			"88": "<sup>88</sup> ၥီၪ့ဆၧၥၫ့အ့ၬ.- မၩမၧၫ့ထၪ့ယၧၩဘဲၫနဆၧယၫ့ၥၭအ ၥိၭတၭ,ယမိထီးန့ဖံၭထၬ နနိၭအဆၧထိးအၥၭလဖၪ နီၪလီၫ.",
			"89": "<sup>89</sup> ယဟိဝၩဧ့, နလူနထၫအီၪဂုးအီၪခၧၫ့ လၧမူၭခိၪအ",
			"90": "<sup>90</sup> ဖၧၩ့အဆိၩဆိၩအကၠၪကၠၪနီၪလီၫ.- တၭနဆၧမွဲဆၧ တီၩအီၪဝ့ၫ လဆိၩဘၪလဆိၩ လဆိၩဘၪလဆိၩနီၪး နမၩကဲၪထၪ့အီၪက့ၪလၩ့ဂၪ့ခိၪတၭ, အီၪဂုးအီၪခၧၫ့",
			"91": "<sup>91</sup> ဝ့ၫလီၫ.- နစ့ၩရၫ့ဆၧလဖၪနီၪ အီၪဂုးအီၪခၧၫ့ဝ့ၫထီးမု လနံၩယီၩး အဂဲးဘဲၫယီၩ ကယဲဆၧထီးအလူၬအဆံၫ့",
			"92": "<sup>92</sup> မွဲနခ့ၫနၡၩလီၫ.- နဆၧၥီၪ့ဆၧၥၫ့ အ့ၪလမွဲဘၪယဆၧ ၥုၪ့ဎွံၫၥၭယီၫတၭ, ယဂၭဂီၩ့ယူၭ လၧယဘၪဆၧၡၪ့",
			"93": "<sup>93</sup> ဆၧနၭအဖၧၩ့ယူၭလီၫ.- ယလၥၭနၪ့ဘၪနဆၧၥီၪ့ဆၧ ၥၫ့ၥံၪလၩ့ဆိၩ လၩ့ကၠၪနီၪတၭ, အဂဲးဘဲၫယီၩ နမၩ",
			"94": "<sup>94</sup> မၧၫ့ထၪ့ထဲၩ့ယၧၩလၧအဝ့ၫၥံၪလီၫ.- ယမွဲနဆၧတၭ, ထိးထဲၩ့တၩ့ထဲၩ့လါယၧၩဆံၭ. အဂဲးဘဲၫယီၩယအၪ့",
			"95": "<sup>95</sup> ဎၬနဆၧၥီၪ့ဆၧၥၫ့ၥံၪလီၫ.- ၦလတီၩလလီၩ့ဘၪအီၪ ခိၭၥူၪဝ့ၫလၧအမိမၩဂၭဂီၩ့ယၧၩတၭး အ့ၪမွဲယဝ့ၫဒၪ ယီၩ,ယဆီၫ့မီၪ့ဆၧလၧနဆၧထိးနၥၭလဖၪ အဂဲး",
			"96": "<sup>96</sup> လီၫ.- ဆၧလၧၫ့ဆၧဎွ့ၩထီးလူၬအထုၬနီၪယဒၪဘၪ ယူၭး တၭနဆၧမၪလူၬနီၪမွဲလဲလဲလ့ၬလီၫ.",
			"97": "<sup>97</sup> ယအဲၪနဆၧၥီၪ့ဆၧၥၫ့နီၪဆံၭဒိၪလဲၪ. ယဆီၫ့မီၪ့အ",
			"98": "<sup>98</sup> ဂဲးအကၠီၪ့ၥံၫ့နံၩချီၩ့လီၫ.- နဆၧမၪလူၬၥံၪဒုၭကဲၪယၧၩ အၦကိၪ့ၥ့ၪနဲၪ့ ယဒုၪယဒၩၥံၪ ဒံၭတၭး အဂဲးဘဲၫ",
			"99": "<sup>99</sup> ယီၩအီၪလၧယၥိၭလၩ့ဆိၩလၩ့ကၠၪလီၫ.- တၭယနၪ ဆၧၥ့ၪအၪနဲၪ့ၦၥီၪ့လိၪယၧၩ ထီးအလူၬဒံၭနီၪး အဂဲး ဘဲၫယီၩယဆီၫ့မီၪ့လၧနဆၧထိးနၥၭလဖၪ အဂဲးအ",
			"100": "<sup>100</sup> ကၠီၪ့လီၫ.- တၭယနၪဆၧၥ့ၪအၪနဲၪ့ ၦမွံၩၦၡါဒံၭတၭး အဂဲးဘဲၫယီၩယထီးန့ဖံၭထၬ နဆၧမၪလူၬၥံၪလီၫ.",
			"101": "<sup>101</sup> တၭယပဒၩ့ယခၪ့ လၧကယဲဖၧၩ့ၥၭအအၧၩ့အၥၫ့ဘဲၫ",
			"102": "<sup>102</sup> ၥိၭယမိထီးန့နလူနထၫလီၫ.- တၭယလ့ၩဒၪနဆၧစ့ၩ ရၫ့အ့ၬး အဂဲးဘဲၫယီၩ နၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ယၧၩလီၫ.",
			"103": "<sup>103</sup> တၭလၧယထဲးယိဆၧနီၪ, နလူနထၫဆၧၫ့ဆံၭဒိၪလဲၪ!",
			"104": "<sup>104</sup> ဆၧၫ့နဲၪ့န့ၫစၩ့လၧယနိၭဖၧၩ့ဒံၭလီၫ.- ယန့ဘၪယၥုၪ့ ဖၭၥၭဖၭ လၧနဆၧၥီၪ့ဆၧၥၫ့ အဖၧၩ့နီၪး မၩအၥၭ ဘဲၫနီၪတၭ,ယမ့ၬလဲၩၥၭဂဲၫ့ ဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪအ ဖၧၩ့ၥၭကိၭဘီၩ့ဒ့ၭလီၫ.",
			"105": "<sup>105</sup> နလူနထၫနီၪမွဲမ့ၪဒိၩ့လဖျိၪ့ လၧယခၪ့အဂး, ဒဲဆၧ",
			"106": "<sup>106</sup> ဖၩ့လဖျိၪ့လၧယဖၧၩ့ၥၭအဂးလီၫ.- ယဆိၪလၩ့ယူၭ ယၥၭလၧယမိထီးန့ နဆၧစ့ၩရၫ့အတီၩအလီၩ့တၭ,",
			"107": "<sup>107</sup> ယမၩတီၩယူၭယလူလီၫ.- ယဘၪဆၧၡၪ့ဆၧနၭနၭ မၬးယဟိဝၩဧ့, မၩမၧၫ့ထၪ့ထဲၩ့လါယၧၩ ဘဲၫနလူ",
			"108": "<sup>108</sup> နထၫအၥိၭနီၪဆံၭ.- ယဟိဝၩဧ့, ယနိၭအဆၧမၩဘိၪ့ ဒၪဆၧနီၪ, မွဲအဘၪနၥၭဆံၭ. တၭၥီၪ့လိၪယၧၩလၧ",
			"109": "<sup>109</sup> နဆၧစ့ၩရၫ့လဖၪနီၪဆံၭ.- ယၥၭအီၪဝ့ၫလၧယစူၪ ဖၧၩ့လထံၪဎးဘီၩ့ဎး လါနၫ့တၭ, ယၥၭနၪ့နဆၧၥီၪ့",
			"110": "<sup>110</sup> ဆၧၥၫ့ဆ့အ့ၬ.- ၦလတီၩလလီၩ့ဘၪ မၩဖျံၩခွၩ့လၧ ယဂး,မွဲလါနၫ့တၭ, ယၥၭဂၭဖျိၭနဆၧၥီၪ့ဆၧၥၫ့ၥံၪ",
			"111": "<sup>111</sup> အဖၧၩ့ၥၭနီၪအ့ၬ.- ယအီၪက့ၪနဆၧထိးနၥၭလဖၪ လၧယဆၧန့ၥၫယဝ့ၫလၩ့ဆိၩလၩ့ကၠၪနီၪ, အဂဲးဘဲၫ",
			"112": "<sup>112</sup> ယီၩအဝ့ၫၥံၪ ဒုၭၥုၪ့ဎွံၫၥၭယီၫယၥၭလီၫ.- ယအီၪ က့ၪလၩ့ယူၭယၥၭ လၧယမိထီးန့နၥနိၫလဖၪ လၩ့ ဆိၩလၩ့ကၠၪထီးဆၧအထုၬနီၪလီၫ.",
			"113": "<sup>113</sup> ၦလၧအၥၭဂံၩ့ဂၩ့လဖၪ ယမ့ၬလဲၩအဝ့ၫၥံၪတၭ,",
			"114": "<sup>114</sup> အ့ၪမွဲနဆၧၥီၪ့ဆၧၥၫ့နီၪယအဲၪယဝ့ၫလီၫ.- နမွဲယအီၪ ၥူၪအလး, ဒဲယထၩ့ဖံၭလဘံၪ့တၭး ယယိလါဆၧလၧ",
			"115": "<sup>115</sup> နလူနထၫအဖၧၩ့လီၫ.- ၦမၩဆၧအၧၩ့ၥံၪဧ့, စဲၪ့ဒၪခွံၬ ယၧၩဆံၭ. တၭယမိထီးန့ယယွၩ အဆၧမၪလူၬၥံၪ",
			"116": "<sup>116</sup> လီၫ.- ဒုၭအီၪဂုးအီၪခၧၫ့လါယၧၩ ဘဲၫနလူနထၫအ ၥိၭနီၪဆံၭး တၭယမိမၧၫ့ယဝ့ၫယီၩ, တၭမွဲယမ့ၬထီး",
			"117": "<sup>117</sup> မဲလၧယယိလါဆၧအကၠီၩ့လဂ့ၩ.- မၩဆၧၩ့လါယၧၩ ဆံၭ, တၭယမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩး ဒဲယမိယိမ့ၬ လၧနဆၧမၪလူၬၥံၪ လထံၪဎးဘီၩ့ဎး",
			"118": "<sup>118</sup> လီၫ.- ကယဲၦလၧအဂၭဖျိၭ နၥနိၫလဖၪ အဖၧၩ့ၥၭ ထီးအလူၬနီၪ, နခွံၬၡိၭခွံၬဝ့ၫတၭး အဂဲးဘဲၫယီၩအ ဝ့ၫၥံၪအဆၧအၪ့လီၫနီၪ မွဲဆၧအဘျံၭအဘျၪလီၫ.",
			"119": "<sup>119</sup> ဘဲၫထီးၥံၪၡၬၥံၪအအ့ၪအၥိၭနီၪ, ကယဲၦလတီၩလ လီၩ့ဘၪလၧဂၪ့ခိၪချိၫ့ ထီးအလူၬယီၩနခွံၬၡိၭခွံၬဝ့ၫ, မၩအၥၭဘဲၫနီၪတၭ, ယအဲၪနဆၧထိးအၥၭ လဖၪ",
			"120": "<sup>120</sup> လီၫ.- ယၡုၭဝၭထိၬလၧဆၧၥၭမဲၪနၧၩအကၠီၩ့တၭ, ယၥၭမဲၪနဆၧစ့ၩရၫ့ၥံၪလီၫ.",
			"121": "<sup>121</sup> ယမၩယူၭဆၧစ့ၩရၫ့အတီၩယူၭ, ဒဲဆၧတီၩဆၧ လီၩ့လီၫ. ထီးအီၪက့ၪထးယၧၩ လၧၦမၩနၧၩမၩစၪ",
			"122": "<sup>122</sup> ယၧၩအစူၪဖၧၩ့နီၪလဂ့ၩ.- ကဲၪထၪ့နခ့ၫနၡၩအဆၧ ထိးအၥၭ လၧဆၧဂ့ၩ အဂးဆံၭ. ၦလၧအအီၪက့ၪ ထၪ့ထီၫအၥၭနီၪ, မွဲအထီးမၩနၧၩ့မၩစၪယၧၩလဂ့ၩ.",
			"123": "<sup>123</sup> ယမ့ၬၥၪလူၬလၧယယိလါ နဆၧထိးထဲၩ့တၩ့ထဲၩ့အ ကၠီၩ့, ဒဲလၧနဆၧတီၩဆၧလီၩ့ အလူအထၫအဖၧၩ့ၥၭ",
			"124": "<sup>124</sup> အကၠီၩ့နီၪလီၫ.- မၩနခ့ၫနၡၩ ဘဲၫနခိးနတၩ အၥိၭ",
			"125": "<sup>125</sup> တၭ,ၥီၪ့လိၪယၧၩလၧနၥနိၫလဖၪဆံၭ.- ယဝ့ၫဒၪ ယီၩယမွဲနခ့ၫနၡၩတၭ, ဖ့ၪလၫ့ယၧၩလၧ ယၥုၪ့ဖၭၥၭ",
			"126": "<sup>126</sup> ဖၭဆံၭး တၭယမိၥ့ၪယၫနၥနိၫလဖၪလီၫ.- အမုအ လၩဘၪယူၭလၧယဟိဝၩကြၨၭမၩဆၧယူၭ, ၦလဖၪ",
			"127": "<sup>127</sup> လၨၪခၫ့ဖၬယူၭနဆၧၥီၪ့ဆၧၥၫ့ယူၭ.- မၩအၥၭဘဲၫနီၪ တၭ,ယအဲၪနဆၧမၪလူၬၥံၪ ဒိၪနဲၪ့ထီၫ့ၥံၪလွ့ၫၥံၪ, ဒဲဒိၪ",
			"128": "<sup>128</sup> နဲၪ့ဒံၭထီၫ့ဆံၫ့ဆ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, နဆၧ ၥီၪ့ဆၧၥၫ့ထီးအလူၬၥံၪ ယအီၪက့ၪတီၩအီၪက့ၪလီၩ့ ကိၭထံၪဒ့ၭ, ဒဲကယဲဖၧၩ့ၥၭဘၪဆဲၫ့လၧဆၧဘျံၭဆၧ ဘျၪနီၪယမ့ၬလဲၩၥၭဂဲၫ့ယဝ့ၫကိၭဘီၩ့ဒ့ၭလီၫ.",
			"129": "<sup>129</sup> နဆၧထိးအၥၭလဖၪနီၪ မွဲဆၧလၩ့လၭဝ့ၫ,မၩအၥၭ ဘဲၫနီၪတၭ, ယထီးန့အဝ့ၫၥံၪလၧယၥုၪ့ယၥၭလီၫ.",
			"130": "<sup>130</sup> နလူနထၫဝဲထၪ့အၥၭနီၪ ဒုၭဖၩ့ထၪ့ဆၧတၭ, ဒုၭနၪ",
			"131": "<sup>131</sup> ၥ့ၪၦလၧအလမၩလိၪဘၪဆၧလီၫ.- ယအၩ့လဲထၪ့ ယနိၭတၭ, ယၥၭလၩ့ပွံၭလၩ့ထၩ့နီၪ, အဂဲးဘဲၫယီၩ",
			"132": "<sup>132</sup> ယဆိၫ့န့နဆၧမၪလူၬၥံၪလီၫ.- ကၠၪနၥၭလၧယအီၪ တၭ,ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩ, ဘဲၫနယုၩယါမၩၦလၧ",
			"133": "<sup>133</sup> အအဲၪနမံၩ့ၥံၪနီၪဆံၭ.- ဒုၭခၫထၪ့ယၧၩဂုးဂုးခၧၫ့ခၧၫ့ လၧနလူနထၫအဖၧၩ့ဆံၭ. တၭမွဲဆၧအၧၩ့ဆၧၥၫ့ထီး",
			"134": "<sup>134</sup> ပၧၩ့ယၧၩနးမံၩ့လဂ့ၩ.- မၩဖီၩ့မၩဖျ့ၭလါယၧၩလၧ ၦၡၩအဆၧမၩနၧၩ့မၩစၪနီၪဆံၭ. တၭယမိထီးန့ဖံၭ",
			"135": "<sup>135</sup> ထၬနဆၧၥီၪ့ဆၧၥၫ့ၥံၪလီၫ.- ဒုၭဖၩ့ထၪ့ဘၪနမ့ၬလၧ နခ့ၫနၡၩအလီၩ့တၭ, ၥီၪ့လိၪလါယၧၩ လၧနၥနိၫလ",
			"136": "<sup>136</sup> ဖၪနီၪဆံၭ.- မွဲၦလထီးန့ဘၪ နဆၧၥီၪ့ဆၧၥၫ့အကၠီၩ့ တၭ,ထံၫချိၬလၩ့ယွၩလၧယမ့ၬၥၪဖၧၩ့လီၫ.",
			"137": "<sup>137</sup> ယဟိဝၩဧ့, နမွဲဆၧတီၩဆၧလီၩ့တၭ, နစ့ၩရၫ့ဆၧ",
			"138": "<sup>138</sup> လဖၪနီၪ တီၩဝ့ၫလီၩ့ဝ့ၫလီၫ.- နဆၧထိးနၥၭၥံၪလၧ နမၪလူၬနီၪတီၩဝ့ၫလီၩ့ဝ့ၫတၭ, မွဲတီၩဝ့ၫလၩ့ထံးလၩ့",
			"139": "<sup>139</sup> ဆ့ၭလီၫ.- ယၥၭဆီၪ့နီၪအၪ့ခွံၬယၧၩယီၩ, အဂဲးဘဲၫ",
			"140": "<sup>140</sup> ယီၩယဒုၪယဒၩၥၭနၪ့နလူနထၫလီၫ.- နလူနထၫနီၪ",
			"141": "<sup>141</sup> ဆံၫ့ဝ့ၫဂ့ၩမၬတၭ, နခ့ၫနၡၩအဲၪဝ့ၫဆ့လီၫ.- ယမွဲၦ အဆံၭ,ဒဲၦဒူၩယၪ့ယၧၩအ့ၬ. ယၥၭနၪ့နဆၧၥီၪ့ဆၧ",
			"142": "<sup>142</sup> ၥၫ့ၥံၪအ့ၬ.- နဆၧတီၩဆၧလီၩ့နီၪမွဲဆၧတီၩဆၧလီၩ့ အဆိၩအကၠၪတၭ, နဆၧၥီၪ့ဆၧၥၫ့နီၪမွဲအတီၩလီၫ.",
			"143": "<sup>143</sup> ဆၧၡၪ့ဆၧနၭ, ဒဲဆၧခိဆၧဝီၩနီၪဒၪန့ယၧၩ, နဆၧမၪ",
			"144": "<sup>144</sup> လူၬၥံၪနီၪမွဲယဆၧမုၬဆၧလၩလီၫ.- နဆၧထိးနၥၭ လဖၪမွဲဆၧတီၩဆၧလီၩ့ လၩ့ဆိၩလၩ့ကၠၪတၭး ဒုၭ နၪၥ့ၪယၧၩဆံၭး ယမိမၧၫ့ထၪ့ယဝ့ၫလီၫ.",
			"145": "<sup>145</sup> ယကိၭထၪ့အၪ့ယၫ ဆၧလၧယၥၭထၧၫ့ဖျိၪ့ယၫ တၭ,စံၭဆၧၫ့ယၧၩဆံၭး ယဟိဝၩဧ့, ယမိထီးန့နၥနိၫ",
			"146": "<sup>146</sup> လဖၪလီၫ.- ယအၪ့ကံၩ့ဆၧလၧနၧၩတၭ, ထိးထဲၩ့ တၩ့ထဲၩ့ယၧၩဆံၭ. တၭယမိထီးန့နဆၧထိးနၥၭလ",
			"147": "<sup>147</sup> ဖၪလီၫ.- ယဂဲထုၪ့ဂီၩဂီၩ လၧဆၧဖၩ့ထၪ့ၥၫ့တၭ, ယ ကိၭၡၭထၪ့လၧဆၧမၩဆၧၩ့ယၧၩအဂး ယယိလါ",
			"148": "<sup>148</sup> ဆၧလၧနလူနထၫအဖၧၩ့လီၫ.- ယမ့ၬၥၪယိလါၦအီၪ ခိၭဆၧအဆၧၫ့အထီၥံၪဘဲၫၥိၭ ယမိဆီၫ့မီၪ့ဆၧလၧန",
			"149": "<sup>149</sup> လူနထၫအဂဲးလီၫ.- ခိၭနၪလါယလူဘဲၫနခိးနတၩအ ၥိၭနီၪဆံၭ, ယဟိဝၩဧ့း ဘဲၫနစ့ၩရၫ့ဆၧအၥိၭနီၪမၩ",
			"150": "<sup>150</sup> မၧၫ့ထၪ့ထဲၩ့ယၧၩဆံၭ.- ၦလၧအအၪ့ဎၬ မၩဆၧ အၧၩ့လဖၪနီၪ ဂဲၫဘူၭဝ့ၫတၭ, အီၪယဲၩ့ လၧနဆၧၥီၪ့",
			"151": "<sup>151</sup> ဆၧၥၫ့လီၫ.- ယဟိဝၩဧ့, နအီၪဘူၭတၭ,နဆၧမၪလူၬ",
			"152": "<sup>152</sup> ၥံၪမွဲအတီၩထီးအလူၬလီၫ.- တၭယၥ့ၪယၫယံၬယံၬ ယူၭလၧနဆၧထိးနၥၭလဖၪအကၠီၩ့, လၧနအီၪက့ၪ ခၧၫ့ယူၭအဝ့ၫၥံၪလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"153": "<sup>153</sup> ယိဆီၫ့မီၪ့ယဆၧၡၪ့ဆၧနၭတၭ, မၩဖီၩ့မၩဖျ့ၭလါ ယၧၩဆံၭ. အဂဲးဘဲၫယီၩ နဆၧၥီၪ့ဆၧၥၫ့နီၪယၥၭနၪ့",
			"154": "<sup>154</sup> အ့ၬ.- ချဲၩ့အ့ၪယခွးတၭ, မၩဖီၩ့မၩဖျ့ၭလါယၧၩ ဆံၭ.ဘဲၫနလူနထၫအၥိၭနီၪ, မၩမၧၫ့ထၪ့ထဲၩ့လါ",
			"155": "<sup>155</sup> ယၧၩဆံၭ.- ဆၧထိးထဲၩ့တၩ့ထဲၩ့နီၪ အီၪယဲၩ့ဝ့ၫလၧ ၦလတီၩလလီၩ့ဘၪး အဂဲးဘဲၫယီၩအဝ့ၫၥံၪလအၪ့",
			"156": "<sup>156</sup> ဎၬဘၪနၥနိၫလဖၪနီၪလီၫ.- ယဟိဝၩဧ့, နဆၧယၫ့ၥုၪ့ ယၫ့ၥၭအီၪဒိၪမၬတၭး ဘဲၫနဆၧစ့ၩရၫ့ၥံၪအၥိၭနီၪ",
			"157": "<sup>157</sup> မၩမၧၫ့ထၪ့ထဲၩ့ယၧၩဆံၭ.- ၦလၧအမၩအၧၩ့ယၧၩ, ဒဲယဒုၪယဒၩနီၪ အီၪအၪလါနၫ့တၭ, ယဂၭဎ့ၭနဆၧ",
			"158": "<sup>158</sup> ထိးနၥၭၥံၪဆ့အ့ၬ.- ယယိၦအၪ့လီၫဆၧတၭ, ယၥၭ ခိထၪ့လီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪလထီးန့ဘၪနလူ",
			"159": "<sup>159</sup> နထၫလီၫ.- ယဝ့ၫဒၪယီၩ ယအဲၪနဆၧမၪလူၬလဖၪ ဆံၭအၪဆံၭအၪလဲၪနီၪ, ယိဆီၫ့မီၪ့ခွါဆံၭး ယဟိဝၩ ဧ့,ဘဲၫနခိးနတၩအၥိၭနီၪ, မၩမၧၫ့ထၪ့ထဲၩ့လါယၧၩ",
			"160": "<sup>160</sup> ဆံၭ.- နလူနထၫထီးအလူၬနီၪ, မွဲဆၧတီၩတၭ,နဆၧ စ့ၩရၫ့အတီၩအလီၩ့နီၪ အီၪဝ့ၫအဆိၩဆိၩအကၠၪကၠၪ ကိၭထံၪဒ့ၭလီၫ.",
			"161": "<sup>161</sup> ၦဒိၪဖၭဒိၪမၩအၧၩ့မၩနၭယၧၩပျီၩပျီၩတၭ ယၥၭ",
			"162": "<sup>162</sup> ဝၭထိၬလၧနလူနထၫအကၠီၩ့လီၫ.- ယၥုၪ့ဎွံၫၥၭယီၫ လၧနလူနထၫအကၠီၩ့ ဘဲၫၦလၧအဒၪန့ ဆၧအၪ့ဂူၬန့",
			"163": "<sup>163</sup> အၪအၪလ့ၬအၥိၭနီၪလီၫ.- ဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪနီၪ ယမ့ၬလဲၩဒဲယၥၭလိၪဆ့တၭး အ့ၪမွဲနဆၧၥီၪ့ဆၧၥၫ့",
			"164": "<sup>164</sup> နီၪယအဲၪဒိၪမၬလီၫ.- လနံၩနွ့ၫဖၧၫ့, လနံၩနွ့ၫဖၧၫ့ ယစံၭထၪ့အၪ့အူၭနၧၩ လၧနဆၧတီၩဆၧလီၩ့အဆၧ",
			"165": "<sup>165</sup> စ့ၩရၫ့ၥံၪအကၠီၩ့လီၫ.- ၦလၧအအဲၪနဆၧစ့ၩရၫ့ၥံၪနီၪ အီၪလၧဆၧမုၬဆၧလၩအၪမၬတၭး ဆၧလၩ့ထံၩဖါ",
			"166": "<sup>166</sup> အလးနီၪ အီၪလၧအဝ့ၫၥံၪနးမံၩ့အ့ၬ.- ယဟိဝၩဧ့, ယယိလါ နဆၧထိးထဲၩ့တၩ့ထဲၩ့အဖၧၩ့ၥၭတၭ, ယ",
			"167": "<sup>167</sup> ထီးန့ဖံၭထၬ နဆၧမၪလူၬၥံၪလီၫ.- နဆၧထိးနၥၭလ ဖၪနီၪယထီးန့လၧယၥၭတၭ, ယအဲၪအဝ့ၫၥံၪဒိၪဒိၪ",
			"168": "<sup>168</sup> လ့ၬလီၫ.- ယထီးန့နဆၧၥီၪ့ဆၧၥၫ့ၥံၪ ဒဲနဆၧထိးနၥၭ လဖၪဆ့တၭး အဂဲးဘဲၫယီၩ ယဖၧၩ့ၥၭၥံၪအီၪလၧန မ့ၬယၫထီးအလူၬလီၫ.",
			"169": "<sup>169</sup> မွဲယဆၧဘၩဆိၪဖၪဂဲၫထၪ့လါလၧနအီၪဆံၭ. ယ ဟိဝၩဧ့, ဒုၭနၪၥ့ၪလါယၧၩ ဘဲၫနလူနထၫအၥိၭနီၪ",
			"170": "<sup>170</sup> ဆံၭ.- မွဲယအၪ့ယၫဆၧဂဲၫထၪ့လါ လၧနအီၪဆံၭ. တၭမၩဖီၩ့မၩဖျ့ၭလါယၧၩ ဘဲၫနလူနထၫ အၥိၭနီၪ",
			"171": "<sup>171</sup> ဆံၭ.- ထီးနအ့ၪၥီၪ့လိၪယၧၩ လၧနၥနိၫလဖၪတၭ,",
			"172": "<sup>172</sup> ယနိၭမိစံၭထၪ့အၪ့အူၭဆၧလီၫ.- ယဖျ့ၩမိလီၩလၩ့ လၬလၩ့နလူနထၫနီၪ, အဂဲးဘဲၫယီၩ နဆၧမၪလူၬၥံၪ",
			"173": "<sup>173</sup> မွဲအတီၩအလီၩ့ထီးအလူၬလီၫ.- မွဲနစူၪမၩဆၧၩ့လါ ယၧၩဆံၭး အဂဲးဘဲၫယီၩ ယရွံန့နဆၧၥီၪ့ဆၧၥၫ့ၥံၪ",
			"174": "<sup>174</sup> လီၫ.- တၭယဆိၫ့န့ဘၪနဆၧထိးထဲၩ့တၩ့ထဲၩ့,ယဟိ",
			"175": "<sup>175</sup> ဝၩဧ့,တၭနဆၧၥီၪ့ဆၧၥၫ့နီၪ မွဲယဆၧမုၬလၩလီၫ.- မွဲ ယၥၭမၧၫ့ဒံၭဒဲစံၭထၪ့အၪ့အူၭနၧၩဆံၭ. တၭမွဲနဆၧ",
			"176": "<sup>176</sup> စ့ၩရၫ့ၥံၪနီၪမၩဆၧၩ့လါယၧၩဆံၭ.- ယဂၭဖျိၭဖၧၩ့ ၥၭဘဲၫၥိၪလၧအလၩ့မါလဒုၩအၥိၭနီၪလီၫ. အၪ့ဎူၫ အၪ့ဎၬလါနခ့ၫနၡၩဆံၭး အဂဲးဘဲၫယီၩ ယၥၭနၪ့န ဆၧမၪလူၬၥံၪအ့ၬ."
		},
		"120": {
			"1": "<sup>1</sup> လၧယဘၪဆၧခိဆၧဝီၩအဖၧၩ့နီၪ ယကိၭထၪ့ယဟိ",
			"2": "<sup>2</sup> ဝၩတၭ,အဝ့ၫဒၪခိၭနၪယလူလီၫ.- ယဟိဝၩဧ့, မၩဖီၩ့ မၩဖျ့ၭယၥၭ လၧနိၭဖျံၩအဘျံၭအဘျၪ, ဒဲဖျ့ၩအအၪ့",
			"3": "<sup>3</sup> လီၫဆၧဆံၭ.- ဖျ့ၩအအၪ့လီၫဆၧဧ့,ၦမိဖ့ၪလၫ့နၧၩလၧ",
			"4": "<sup>4</sup> ဆၧနီၪလမံၩ့လဲၪး တၭပမိမၩဒံၭနၧၩဘဲၫၥ့ၪလဲၪ.- ၦ ၡၩအဆီၪ့ၥံၪအဖျါလၧအစူၩဝ့ၫ ဒဲရီၥံၫ့အမ့ၪအၧၩ့ဖၭ လီၫ.",
			"5": "<sup>5</sup> တၭယဘၪဆၧအၡၪ့ယီၩ, အဂဲးဘဲၫယီၩ ယမွဲၦမွံၩ လၧၦမံစ့ၭဖိၪအကျၩတၭ, ယအီၪလၧကံဒၧၫဖိၪအတဲၩ",
			"6": "<sup>6</sup> ဖၧၩ့,- မွဲယအီၪလၧၦလၧအမ့ၬလဲၩဆၧဘၪလိၬအိၭ",
			"7": "<sup>7</sup> လိၬၥံၪအကျၩယံၬလ့ၬလီၫ.- ယဝ့ၫဒၪယီၩ ယမွဲလၧ ဆၧဘၪလိၬအိၭလိၬအဂး, အ့ၪမွဲထီးယအ့ၪချဲၩ့ဆၧ တၭ,အဝ့ၫၥံၪဆိၫ့ဒုၭဆၧလီၫ."
		},
		"121": {
			"1": "<sup>1</sup> ယမိယိထၪ့ဆၧလၧခိၪလီၩ့ထိၩ့ချိၬၥံၪတၭ, ဆၧမၩ",
			"2": "<sup>2</sup> ဆၧၩ့ယၧၩမွဲအဂဲၫအထံၭခီၫခီၫလဲၪ.- တၭယဆၧမၩ ဆၧၩ့နီၪဂဲၫလၧယဟိဝၩ, လၧအမၩကဲၪထၪ့မူၭခိၪ, ဒဲ",
			"3": "<sup>3</sup> ဂၪ့ခိၪလဂၩအအီၪနီၪလီၫ.- အဝ့ၫနီၪမွဲအထီးဖ့ၪလၫ့ နခၪ့ဖျၬလဂ့ၩ ၦလၧအခိၭထၬနၧၩလဂၩနီၪ, မွဲအထီး",
			"4": "<sup>4</sup> မံၫမၪလဂ့ၩ.- ယိခွါ, ၦလၧအခိၭထၬအံၫစရ့လၭလ",
			"5": "<sup>5</sup> ဂၩနီၪလမိမံၫခံၫ့ဘၪတၭ, မံၫမၪဝ့ၫဆ့အ့ၬ.- ယဟိဝၩ မွဲၦလၧအယိထဲၩ့ခွါထဲၩ့နၧၩတၭး ယဟိဝၩမွဲဆၧလၩ",
			"6": "<sup>6</sup> ၡုၪအီၪလၧနစူၪထွ့ၪလခီၫလီၫ.- မုမ့ၬလမၩဆၫဘၪ နၧၩလၧမုဆၫလခီၫ, ဒဲလၩနီၪလၧမုနၩလခီၫဆ့အ့ၬ.",
			"7": "<sup>7</sup> ယဟိဝၩမိခိၭထၬဒုၭဖီၩ့ခွံၬနၧၩ လၧဆၧအၧၩ့ထီးအ",
			"8": "<sup>8</sup> လူၬးအဝ့ၫဒၪမိယိထဲၩ့ခွါထဲၩ့နၥၭမၧၫ့လီၫ.- နလ့ၩထၪ့ ဆၧဒဲနဂဲၫထဲၩ့နီၪ ထီးယီၩလၧယၫလခီၫ, ယဟိဝၩမိ ယိထဲၩ့ခွါထဲၩ့နၧၩ လၩ့ဆိၩလၩ့ကၠၪလီၫ."
		},
		"122": {
			"1": "<sup>1</sup> တၭလၧၦစံၭယၧၩ, မွဲပလ့ၩၡီၩ့လၧယဟိဝၩအဂံၪ့",
			"2": "<sup>2</sup> ဆံၭနီၪ, ယၥုၪ့ထိၬယၥၭထိၬလီၫ.- ယရုစလံၫ့ဧ့,ပခၪ့မိ ဆၧၫ့ထုၪ့လၧနတရၫ့ဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> ယရုစလံၫ့နီၪ ဆၧမၩကဲၪထၪ့ ဘဲၫဒိၩ့လၧဆၧအီၪ",
			"4": "<sup>4</sup> ထံးလိၬအၥၭအၥိၭနီၪလီၫ.- ၦအဒီၪ့ၥံၪယွၩအဒီၪ့ၥံၪ လ့ၩထၪ့ထီၩ့နီၪဘဲၫဆၧမၪလူၬအံၫစရ့လၭအၥိၭ, ဘဲၫ",
			"5": "<sup>5</sup> ၥိၭအမိစံၭထၪ့အၪ့အူၭ ယဟိဝၩအမံၩ့လီၫ.- အဂဲး ဘဲၫယီၩ ဆၧစ့ၩရၫ့အလးဆီၩ့ဆီၥံၪ စဒၫဝံၭအဂံၪ့အ လးဆီၩ့ဆီၥံၪအီၪဝ့ၫထီးနီၪလီၫ.",
			"6": "<sup>6</sup> ဘၩဆိၪဖၪန့ ယရုစလံၫ့အဆၧဘၪလိၬအိၭလိၬအ ဂးဆံၭ. ၦလၧအအဲၪနၧၩလဖၪနီၪ မိကဲၪထၪ့ကဲၪထီၫ",
			"7": "<sup>7</sup> ဝ့ၫလီၫ.- မွဲဆၧဘၪလိၬအိၭလိၬ အီၪလၧနခိၪဒၧၩ့အ ဖၧၩ့,ဒဲဆၧဘီၪဆၧယီၫ အီၪလၧနနီးၥံၪအဖၧၩ့ဆံၭ.",
			"8": "<sup>8</sup> လၧယထၧၫ့ဖုဝဲ ဒဲယထံၩယၥိၭအကၠီၩ့နီၪ ယမိစံၭဘိၩ့ နဲၪ့ယီၩ, မွဲဆၧဘၪလိၬအိၭလိၬ အီၪလၧနဖၧၩ့ဆံၭ.",
			"9": "<sup>9</sup> ယမိအၪ့ဎၬနဆၧဂ့ၩ, လၧယဟိဝၩပယွၩ အဂံၪ့အ ကၠီၩ့လီၫ."
		},
		"123": {
			"1": "<sup>1</sup> ၦလၧအအီၪဝ့ၫလၧမူၭခိၪဧ့, ယယိထၪ့ဆၧလၧနၧၩ",
			"2": "<sup>2</sup> လီၫ.- ယိခွါ, ဘဲၫဆၧအခ့ၫအၡၩခွၫၥံၪအမ့ၬၥၪယိ လၧအကဆါခွၫအစူၪအၥိၭ, ဒဲဘဲၫဆၧအခ့ၫအၡၩမုၪ အမ့ၬၥၪ ယိလၧအကဆါမုၪ အစူၪအၥိၭနီၪ ပမ့ၬၥၪ ယိလၧယဟိဝၩပယွၩအအီၪဘဲၫနီၪၥိၭ, ထီးအယၫ့ၥုၪ့",
			"3": "<sup>3</sup> ယၫ့ၥၭပၧၩလီၫ.- ယၫ့ၥုၪ့ယၫ့ၥၭပၧၩ, ယဟိဝၩဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭပၧၩလါဆံၭ. အဂဲးဘဲၫယီၩ ပဘၪဆၧ",
			"4": "<sup>4</sup> မၩဎွ့ၩလၧဆၧကြၩ့ထမးနၭမၬလီၫ.- လၧၦလၧအလ ဒူၩလယၪ့ဘၪဆၧလဖၪအဆၧဒုၪဒွ့ၪနီၪ ပၥၭဎွ့ၩတံၭ, ဒဲၦလၧအအီၪက့ၪထၪ့ထီၫ အၥၭၥံၪ အဆၧကြၩ့ထမး နီၪလီၫ."
		},
		"124": {
			"1": "<sup>1</sup> မွဲအံၫစရ့လၭစံၭ, အ့ၪလမွဲဘၪလၧယဟိဝၩလၧအ",
			"2": "<sup>2</sup> အီၪလၧပၥိၭတၭး- ထီးၦဂဲထုၪ့ထၫ့ဒုၪဒၩပၧၩနီၪ, အ့ၪ",
			"3": "<sup>3</sup> လမွဲဘၪယဟိဝၩ လၧအအီၪလၧပၥိၭတၭ,- ထီးအ ဝ့ၫၥံၪအၥၭထၪ့ပၧၩနီၪ, မိယုလၩ့မၧၫ့ယူၭပၧၩလီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ထံၫမိလုၬဘံၭခွံၬယူၭပၧၩယူၭတၭ, ထံၫ",
			"5": "<sup>5</sup> မိၡါမိယွၩလၩ့ယူၭလၧပၥၭအဖၫ့ခိၪး- ထီးနီၪလဖၧၫ့ ထံၫၥံၪလၧအဒိၪထၪ့ဝ့ၫနီၪ မိယွၩလၩ့ယူၭလၧပဖၫ့ခိၪ ယူၭလီၫ.",
			"6": "<sup>6</sup> ယဟိဝၩ လၧအလဖ့ၪလၫ့ဘၪပၧၩ လၧအဝ့ၫၥံၪအ ၥွၫအဆၧအဲၪ့အဂး, လဂၩနီၪ, မွဲအဘၪဆၧအၪ့အူၭ",
			"7": "<sup>7</sup> ဝ့ၫဆံၭ.- တၭပၥၭဖျ့ၭထၪ့ယူၭ, ဘဲၫထိၪလဘံၪ့လၧၦ ဖီၪ့ထိၪၥံၪလံၪၥံၪ အဖျံၩခွၩ့အဖၧၩ့အၥိၭနီၪ, ဖျံၩခွၩ့",
			"8": "<sup>8</sup> ထ့ၬခွံၬယူၭတၭ, ပဝ့ၫဒၪယီၩၦဂၭဖျ့ၭယူၭ.- ဆၧမၩ ဆၧၩ့ပၧၩအီၪဝ့ၫ လၧယဟိဝၩ လၧအမၩကဲၪထၪ့မူၭ ခိၪ,ဒဲဂၪ့ခိၪလဂၩနီၪအမံၩ့အဖၧၩ့လီၫ."
		},
		"125": {
			"1": "<sup>1</sup> ၦလၧအဒိၭနဲၩ့အၥၭလၧယဟိဝၩလဖၪနီၪ မၩအၥၭ ဘဲၫခိၪလီၩ့ဇံအိၫ့အၥိၭး လဂဲၩလဝၭဘၪဝ့ၫတၭ, အီၪ",
			"2": "<sup>2</sup> လၩ့ဆိၩလၩ့ကၠၪလီၫ.- ခိၪလီၩ့ထိၩ့ချိၬအီၪဝၬဖီၩ့ယရု စလံၫ့တၭ, ယဟိဝၩအီၪဝၬဖီၩ့ အၡၩခမျၧးထီးယီၩ",
			"3": "<sup>3</sup> လၧယၫလခီၫ အဆိၩဆိၩအကၠၪကၠၪဆ့လီၫ.- အဂဲး ဘဲၫယီၩ ၦအၧၩ့ၦၥၫ့အနိၪထိၭဘီၩ့ လမိအီၪဘၪလၧ ၦအတီၩအလီၩ့အလးနီၪ, အဂဲးဘဲၫယီၩ ၦအတီၩအ လီၩ့မိယူၬထၪ့ဘၪခိၬအစူၪမၩ ဆၧအၧၩ့ဆၧၥၫ့ဆ့လီၫ.",
			"4": "<sup>4</sup> ယဟိဝၩဧ့,မၩဂ့ၩလါၦအဂ့ၩအဘွၩ, ဒဲၦအၥၭလီၩ့",
			"5": "<sup>5</sup> နီၪဆံၭ.- အ့ၪမွဲၦလၧအလ့ၩဖိၬမၪဖၧၩ့ၥၭအကဲၪ့ကီၪ့ လဖၪနီၪယဟိဝၩမိနၫ့ထၪ့ခွံၬဝ့ၫ လၧၦမၩဆၧအၧၩ့ၥံၪ အၥိၭနီၪလီၫ. မွဲဆၧဘၪလိၬအိၭလိၬအီၪ လၧအံၫစရ့ လၭအလီၩ့ဆံၭ."
		},
		"126": {
			"1": "<sup>1</sup> ထီးယဟိဝၩဒုၭဂဲၫထဲၩ့ထဲၩ့ ၦဇံအိၫ့ဖိၪလၧအဆၧ အၪ့မၧၫ့ဎီးဝ့ၫနီၪတၭ, ပမွဲဘဲၫၦလၧအမံၫမးဆၧအၥိၭ",
			"2": "<sup>2</sup> လီၫ.- ထီးနီၪလဖၧၫ့ပနိၭဎွ့ၩဝ့ၫလၧဆၧနံ, ဒဲပဖျ့ၩဎွ့ၩ ဝ့ၫလၧဆၧၥံၫကျံၩလီၫ. ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪစံၭလၧ ၦဆၨၩၥံၪအကျၩနီၪ, ယဟိဝၩ မၩဆၧဖၭဒိၪလဖၪ",
			"3": "<sup>3</sup> လၧအဝ့ၫၥံၪအဂးလီၫ.- တၭယဟိဝၩမၩယူၭဆၧဖၭ ဒိၪၥံၪလၧပဂးယူၭ, ပၥၭထိၬလၧအကၠီၩ့လီၫ.",
			"4": "<sup>4</sup> ယဟိဝၩဧ့, ကၠၪထဲၩ့ပဆၧအၪ့မၧၫ့ဎီး ဘဲၫထံၫချိၬ",
			"5": "<sup>5</sup> အီၪလၧမုခံၫ့လခီၫအၥိၭနီၪဆံၭ.- ၦလၧအဎွံၪဆၧလၧ အမ့ၬထံၫလၩ့ဝ့ၫလဖၪနီၪ မိကူၭဆၧလၧဆၧၥၭထိၬအ",
			"6": "<sup>6</sup> ဖၧၩ့လီၫ.- ၦလဂၩလ့ၩထၪ့တၭ, လ့ၩဝ့ၫလၧအမ့ၬထံၫ လၩ့,ဎွံၪဆၧချံၪနီၪတၭ, မိဂဲၫထဲၩ့တၡါလၧအၥုၪ့ဎွံၫ ၥၭယီၫ,အီၪလၧအဘုၪလၧၫ့ၥံၪလီၫ."
		},
		"127": {
			"1": "<sup>1</sup> ယဟိဝၩအ့ၪလမၩဘၪဂံၪ့တၭ, ၦလၧအမၩဆၧလ ဖၪနီၪမၩဝ့ၫပျီၩပျီၩလီၫ. ယဟိဝၩအ့ၪလခိၭထၬဘၪ",
			"2": "<sup>2</sup> ဒိၩ့တၭ,ၦပၧၩ့ဆၧလဖၪနီၪအီၪဝ့ၫပျီၩပျီၩလီၫ.- နၥံၪ ဂဲထုၪ့ဂီၩဂီၩ, နၥံၪဆၧၫ့နၩ့ယံၬယံၬ, နၥံၪအၪ့ဆၧၥၭ အုၭအကိၪနီၪပျီၩပျီၩလီၫ. ၦလၧယွၩအဲၪဝ့ၫလဖၪနီၪ, မွဲအဖ့ၪလၫ့အမံၫဝ့ၫဘဲၫနီၪလီၫ.",
			"3": "<sup>3</sup> ယိခွါ, ၦဖိၪၦလံၩနီၪ,မွဲဆၧန့ၥၫလၧယဟိဝၩဖ့ၪ လၫ့ဝ့ၫလီၫ. တၭၦဒၧၩ့လးအဆၧၥၪနီၪ မွဲဆၧအလံၩ့ အလဲၫလီၫ.",
			"4": "<sup>4</sup> ဘဲၫဖျါၥံၪလၧၦအဆီၪ့အစူၪဖၧၩ့အၥိၭနီၪ ၦၡၩၥၭ",
			"5": "<sup>5</sup> ဘၪ့အဖိၪခွၫၥံၪမွဲဘဲၫနီၪအၥိၭလီၫ.- ၦလၧအလၧၫ့ဖီၩ့ ဎွ့ၩလၧအဝ့ၫၥံၪနီၪဘၪဆိၪဂ့ၩဝ့ၫလီၫ. ထီးအချဲၩ့လိၬ အၥၭလၧအဒုၪအဒၩလၧတရၫ့ဖၧၩ့တၭ, အမ့ၬမဲဘၪ အ့ၬ."
		},
		"128": {
			"1": "<sup>1</sup> ကယဲၦလၧအၥၭမဲၪ ယဟိဝၩ ဒဲဖိၬအဖၧၩ့ၥုၪ့ဖၧၩ့",
			"2": "<sup>2</sup> ၥၭၥံၪနီၪ ဘၪဆိၪဂ့ၩဝ့ၫကိၭဂၩဒ့ၭလီၫ.- နမိအၪ့ဆၧ လၧနမၩဆၧလၧနစူၪတၭး နမိအီၪမုၬတၭ, နမိဘၪဆၧ",
			"3": "<sup>3</sup> ဂ့ၩဆၧဘွၩလီၫ.- နမၫမိမၩအၥၭ ဘဲၫစဘံၭမုလၧအ ၥၪထၪ့လၧအအီၪလၧ နဂံၪ့နဲၩ့ထံၭအၥိၭနီၪတၭ, နဖိၪ နလံၩမိမၩအၥၭဘဲၫအလဲအိၫ့အထံၭၥံၪ အီၪဝၬဖီၩ့န စပွဲအၥိၭနီၪလီၫ.",
			"4": "<sup>4</sup> ယိခွါ, ၦလၧအၥၭမဲၪယဟိဝၩနီၪမိဘၪဆၧဆိၪဂ့ၩ",
			"5": "<sup>5</sup> ဘဲၫနီၪအၥိၭလီၫ.- တၭယဟိဝၩမိဆိၪဂ့ၩနၧၩလၧဇံ အိၫ့တၭ နမိဒၪဘၪယရုစလံၫ့ အဆၧဂ့ၩလဆိၩဒၪနၧၩ",
			"6": "<sup>6</sup> လီၫ.- တၭနမိဒၪဘၪနဖိၪၥံၪအဖိၪလီၫ. မွဲဆၧဘၪလိၬ အိၭလိၬအီၪလါလၧအံၫစရ့လၭဆံၭ."
		},
		"129": {
			"1": "<sup>1</sup> တၭၦမၩၡၪ့မၩနၭယၧၩ ခီၫလၧယၥၭဘၪ့အၪဖၧၫ့",
			"2": "<sup>2</sup> အၪဘျၩ့နီၪ, အံၫစရ့လၭ စံၭဝ့ၫဘဲၫနီၪလီၫ.- တၭၦမၩ ၡၪ့မၩနၭယၧၩခီၫ လၧယၥၭဘၪ့အၪဖၧၫ့အၪဘျၩ့လါ",
			"3": "<sup>3</sup> နၫ့တၭ,မၩနၧၩ့ယၧၩအ့ၬ.- ၦထဲၫဆၧၥံၪထဲၫလၧယ ချိၫ့တၭ,မၩအကၠီၪ့ထီၫထီၫလ့ၬလီၫ.",
			"4": "<sup>4</sup> ယဟိဝၩမွဲအတီၩအလီၩ့တၭ, ဒၪ့ထ့ၬခွံၬ ၦအၧၩ့ၦ",
			"5": "<sup>5</sup> ၥၫ့အဖျံၩလီၫ.- ကယဲၦလၧအမ့ၬလဲၩၥၭဂဲၫ့ၦဇံအိၫ့ ဖိၪၥံၪနီၪအမ့ၬမိဘၪမဲတၭ, မိဘၪကၠၪထဲၩ့အၥၭထီးအ",
			"6": "<sup>6</sup> လူၬလီၫ.- အဝ့ၫၥံၪမိမၩအၥၭဘဲၫနၪ့လၧအအီၪလၧ ဂံၪ့ခိၪလၧၦလချႃၭထ့ၭထၪ့ခွံၬဒံၭဘၪနီၪ ဎဲၫ့ထၪ့ဝ့ၫအ",
			"7": "<sup>7</sup> ၥိၭနီၪလီၫ.- ၦကူၭဆၧနီၪန့လစူၪအ့ၬး ၦလၧအကၭ",
			"8": "<sup>8</sup> ဆၧနီၪန့လဝံၩဆ့အ့ၬ.- ၦလဲးလီၩ့လၧဖၧၩ့ၥၭးမွဲယဟိ ဝၩအဆၧဆိၪဂ့ၩဘၪနၥံၪဆံၭ, ပဆိၪဂ့ၩနၥံၪလၧယ ဟိဝၩအမံၩ့နီၪ,စံၭဝ့ၫအ့ၬ."
		},
		"130": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, ယကိၭထၪ့နၧၩ, လၧဆၧယိၬအဖၧၩ့",
			"2": "<sup>2</sup> လီၫ.- ကဆါဧ့, ခိၭနၪလါယလူဆံၭ. ဒိၭနနါလၧယ",
			"3": "<sup>3</sup> အၪ့ယၫဆၧအလူဆံၭ.- ယဟိဝၩဧ့, နအ့ၪထီးနဲၪ့ပ ဆၧမၪတၭ, ကဆါဧ့,မွဲပလၫမိဆၧၫ့ထုၪ့လဂၩလဲၪ.",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩ နမၩဖီၩ့မၩဖျ့ၭဆၧဘဲၫၦၡၩမိၥၭမဲၪနၧၩ အၥိၭလီၫ.",
			"5": "<sup>5</sup> ယယိလါယဟိဝၩအဖၧၩ့ၥၭ, ယၥၭယိလါယဟိ ဝၩအဖၧၩ့ၥၭတၭ, ယယိလါဆၧလၧအလူအထၫအ",
			"6": "<sup>6</sup> ဖၧၩ့နီၪလီၫ.- ယၥၭခိၭယိလါကဆါအဖၧၩ့ၥၭအၪနဲၪ့ ဒိၪနဲၪ့ၦခိၭယိလါဆၧဖၩ့ထၪ့အဖၧၩ့ၥၭဒံၭ, အၪနဲၪ့ၦ ခိၭယိလါဆၧဖၩ့ထၪ့အဖၧၩ့ၥၭဒံၭလီၫ.",
			"7": "<sup>7</sup> နဝ့ၫဒၪအံၫစရ့လၭဧ့, ယိလါဆၧလၧယဟိဝၩဆံၭ. အဂဲးဘဲၫယီၩဆၧအခိးအတၩ, ဒဲဆၧထိးထဲၩ့တၩ့ထဲၩ့",
			"8": "<sup>8</sup> လၧအအၪအီၪလၧအဝ့ၫနီၪလီၫ.- တၭအဝ့ၫဒၪမိဎွ့ၩန့ ထဲၩ့အံၫစရ့လၭမၩဖီၩ့ဖျ့ၭအဆၧအၧၩ့ ထီးအလူၬလီၫ."
		},
		"131": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, ယၥၭထၪ့ထီၫအ့ၬ, ယမ့ၬၥၪၥံၪယအီၪ က့ၪထၪ့ထီၫဆ့အ့ၬ. ယမၩဘၪဆဲၫ့ယၥၭလၧဆၧလၧ",
			"2": "<sup>2</sup> အဒိၪလၨၪ, ဒဲဆၧလၧအကၪလၨၪလၧယဂးအ့ၬ.- မွဲ မၬယမၩၡုၪမၪမုၬ, ဒဲမၩဂုးဖုးယၥၭဘဲၫ ဖိၪၥၪလၧအ လၩ့ၡၪလၧအမိအနုအၥိၭနီၪတၭ, ယၥၭမၩအၥၭဘဲၫ ဖိၪၥၪလၧအလၩ့ၡၪလၧအမိအနုအၥိၭနီၪလီၫ.",
			"3": "<sup>3</sup> နဝ့ၫဒၪအံၫစရ့လၭဧ့, ယိလါဆၧလၧယဟိဝၩနီၪ ထီးယီၩလၧယၫလခီၫလၩ့ဆိၩလၩ့ကၠၪဆံၭ."
		},
		"132": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, နၪ့ထၪ့ထဲၩ့စဒၫဝံၭလၧအဆၧၡၪ့ဆၧနၭ",
			"2": "<sup>2</sup> ထီးအလူၬအဖၧၩ့နီၪဆံၭ.- အဝ့ၫနီၪဆိၪလၩ့အၥၭလၧ ယဟိဝၩအမ့ၬယၫတၭ, ဆိၪလၩ့အၥၭလၧစယၫကူၭ",
			"3": "<sup>3</sup> အကဆါအမ့ၬယၫဘဲၫယီၩ,- ယလချႃၭ ဒၪန့ဒံၭဘၪ ဆၧအလးလၧယဟိဝၩအဂး, အအီၪအလးလၧစ ယၫကူၭ အကဆါအဂးနီၪတၭ, ယမိဂဲၫနုၬ လၧယ",
			"4": "<sup>4</sup> ဂံၪ့အတဲၩဖၧၩ့အ့ၬ.- ယမိလ့ၩထၪ့လၧယလးမံၫအ",
			"5": "<sup>5</sup> ဖၫ့ခိၪဆ့အ့ၬ.- ယမိဒုၭမံၫယမ့ၬၥၪအ့ၬ,ယမိဒုၭမံၫခံၫ့ ယမ့ၬဖံၭနီၪဆ့အ့ၬ.",
			"6": "<sup>6</sup> ယိခွါ, ပနါဂၧၫ့ဆၧလမံၩ့နီၪ လၧအ့ၭဖတၫအဖၧၩ့, ပဒၪန့ဆၧလမံၩ့နီၪ လၧၥံၪ့လဝၩ့အမံၩ့လၬကျၩလီၫ.",
			"7": "<sup>7</sup> ပမိလ့ၩနုၬလၧအအီၪဝ့ၫအလးဖၧၩ့နီၪ, ပမိဘိၪ့ထဲၩ့",
			"8": "<sup>8</sup> ဘၩထဲၩ့လၧခးယဲးလၩ့အခၪ့ထံၭလီၫ.- ယဟိဝၩဧ့, ဂဲထုၪ့ထၪ့, လ့ၩနုၬလၧနအီၪပွံၭအလး, နဝ့ၫဒၪလဂၩ,",
			"9": "<sup>9</sup> ဒဲနစီၩ့နမၩ့အတလၫလဖျိၪ့နီၪဆံၭ.- မွဲနၡၩလုဆၧၥံၪ ဘၪဆၧဒုၭကီၩ့ထၪ့ၥိၭထၪ့ လၧဆၧတီၩဆၧလီၩ့တၭ, မွဲနၡၩဆံၫ့ဎံၪနီၪကိၭၡၭထၪ့ လၧအဆၧၥၭထိၬနီၪ",
			"10": "<sup>10</sup> ဆံၭ.- လၧနခ့ၫနၡၩစဒၫဝံၭအကၠီၩ့နီၪဘိၭကၠၪထဲၩ့န ၡၩဒိၭဂုၪအၥၭလဂၩအမ့ၬလဂ့ၩ.",
			"11": "<sup>11</sup> ယဟိဝၩ ဆိၪလၩ့အၥၭ လၧစဒၫဝံၭလၧဆၧမွဲဆၧ တီၩ, လကၠၪခွံၬဘၪအၥၭလၧဆၧယီၩ, ယမိအီၪက့ၪန",
			"12": "<sup>12</sup> မိၡါအဆၧၥၪ လၧနလးဆီၩ့ဆီအဖၫ့ခိၪလီၫ.- နဖိၪန လံၩအ့ၪထီးန့ဖံၭထၬ ယဆၧအုၩ့လၩ့, ဒဲယဆၧထိး ယၥၭလၧယမိၥီၪ့လိၪအဝ့ၫၥံၪတၭ, အဝ့ၫၥံၪအဖိၪအ လံၩမိဆၧၫ့နၩ့ဆ့ လၧနလးဆီၩ့ဆီအဖၫ့ခိၪ လၩ့ဆိၩ",
			"13": "<sup>13</sup> လၩ့ကၠၪလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩ ရွံန့ယူၭဇံအိၫ့ တၭ,ဘၪအၥၭလၧအမိကဲၪထၪ့ အအီၪအလးလၧအ",
			"14": "<sup>14</sup> ဂးလီၫ.- အယီၩလစီၪ့မွဲယအီၪပွံၭအလးလၩ့ဆိၩလၩ့ ကၠၪတၭး ယမိအီၪထီးယီၩ အဂဲးဘဲၫယီၩမွဲအဘၪယူၭ",
			"15": "<sup>15</sup> ယၥၭလီၫ.- ယမိဆိၪဂ့ၩအဆၧအၪ့ဆၧအီၩလၩ့ထံး လၩ့ဆ့ၭတၭ, အၡၪ့ဖိၪယၬဖိၪနီၪ ယမိဒုၭဘျဲၩအၪ့ဝ့ၫ",
			"16": "<sup>16</sup> လၧကိၪလီၫ.- ယမိဒုၭကီၩ့ဒုၭၥိၭအၡၩလုဆၧၥံၪလၧ ဆၧထိးထဲၩ့တၩ့ထဲၩ့တၭ, အၡၩဆံၫ့ဎံၪၥံၪမိကိၭၡၭ",
			"17": "<sup>17</sup> ထၪ့လၧအဆၧၥၭထိၬအကၠီၩ့လီၫ.- ထီးနီၪလစီၪ့ယမိ ဒုၭစဲၪ့ထၪ့စဒၫဝံၭအနိၩ့း ယတဲၩ့ဝဲၩယူၭမ့ၪဒိၩ့လဖျိၪ့",
			"18": "<sup>18</sup> လၧယၡၩဒိၭဂုၪအၥၭလဂၩအဂးလီၫ.- ယမိဒုၭကီၩ့ ဒုၭၥိၭအဒုၪအဒၩလၧဆၧမ့ၬမဲး အ့ၪမွဲအၥရဖူၩမိဂ့ၩ ထၪ့လၧအနၫ့ဆါဒၪဝ့ၫအလီၩ့လီၫ."
		},
		"133": {
			"1": "<sup>1</sup> ထၧၫ့ဖုဝဲၥံၪအီၪဝ့ၫလၧအၥၭလဖျိၪ့ဎးနီၪ, မွဲဆၧဂ့ၩ",
			"2": "<sup>2</sup> ဆံၭဒိၪလဲၪး တၭမုၬဆံၭဒိၪလဲၪနီၪ, ယိခွါဘီၪ!- မၩ အၥၭဘဲၫၥိၪအဂ့ၩ အီၪလၧအခိၪဎွံၪလၧအလၩ့ယွၩ ဘၪခၪလၬဆီၪ့, စအၫရၧၫ့အခၪလၬဆီၪ့, လၧအလၩ့",
			"3": "<sup>3</sup> ယွၩထီၩ့လၩ့လၧအဆဲၫ့ခၪ့ထံၭအၥိၭနီၪ!- မၩအၥၭ ဘဲၫခိၪလီၩ့ဟၧမၧၫ့အဆၩ့ထံၫ လၧအလၩ့ဘၪလၧဇံ အိၫ့အခိၪလီၩ့ၥံၪအလီၩ့အၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩမၪလူၬဆၧဆိၪဂ့ၩ, ဘဲၫပစံၭဆၧအၥိၭဆၧ မၧၫ့အဆိၩအကၠၪထီးနီၪလီၫ."
		},
		"134": {
			"1": "<sup>1</sup> ယိခွါ, နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭး ကယဲယဟိဝၩအခ့ၫအၡၩ လၧအဆၧၫ့ထုၪ့လၧယဟိဝၩ အဂံၪ့လၧမုနၩလခီၫထီးအလူၬၥံၪဧ့, စံၭထၪ့အၪ့အူၭ",
			"2": "<sup>2</sup> ယဟိဝၩဆံၭ.- ယူၬထၪ့နၥံၪအစူၪလၧဆၧအလးဆံၫ့",
			"3": "<sup>3</sup> ဎံၪအအီၪတၭ, ဆိၪဂ့ၩယဟိဝၩဆံၭ.- ယဟိဝၩလၧ အမၩကဲၪထၪ့မူၭခိၪ, ဒဲဂၪ့ခိၪလဂၩနီၪ, မွဲအဆိၪဂ့ၩ နၧၩလၧဇံအိၫ့အဖၧၩ့ဆံၭ."
		},
		"135": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၩဆံၭ. စံၭထၪ့အၪ့အူၭ ယဟိဝၩအမံၩ့ဆံၭ. ယဟိဝၩအခ့ၫအၡၩ လၧအဆၧၫ့",
			"2": "<sup>2</sup> ထုၪ့လၧယဟိဝၩအဂံၪ့ဖၧၩ့,- လၧပယွၩအဂံၪ့အဝၩ့",
			"3": "<sup>3</sup> လဖၪအဖၧၩ့ၥံၪဧ့, စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ.- စံၭ ထၪ့အၪ့အူၭယွၩဆံၭ. အဂဲးဘဲၫယီၩယဟိဝၩဂ့ၩဝ့ၫ တၭ,ၥံၫကျံၩထၪ့အမံၩ့ဆံၭ. အဂဲးဘဲၫယီၩမုၬဝ့ၫလီၫ.",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩ ယွၩရွံန့ယၫကူၭ လၧအဆၧဒၪဝ့ၫ,",
			"5": "<sup>5</sup> အံၫစရ့လၭလၧအဆၧလူဒိၪဎွ့ၩဒိၪအဂးလီၫ.- အဂဲး ဘဲၫယီၩယၥ့ၪယၫလၧယဟိဝၩမွဲဆၧဖၭဒိၪတၭ, ပက",
			"6": "<sup>6</sup> ဆါဒိၪနဲၪ့ကယဲယွၩထီးအလူၬနီၪဒံၭလီၫ.- ကယဲဆၧဘၪ ယူၭအၥၭထီးအလူၬနီၪ ယဟိဝၩမၩယူၭဝ့ၫ လၧမူၭ ခိၪဖၧၩ့ဒဲလၧဂၪ့ခိၪချိၫ့, ဒဲလၧမၫဆမံၭဖၧၩ့, ဒဲလၧထံၫ",
			"7": "<sup>7</sup> ယိၬထီးအလူၬအကျၩလီၫ.- အဝ့ၫဒၪနီၪဒုၭအွံၩထၪ့ ဆၩ့ထံၫထီၩ့လၧဂၪ့ခိၪအထုၬလဖၪတၭ, တဲၩ့လၫ့ဝဲအ ဒံၭလၧဆၧဆၧၩ့အဂးတၭ, ဒုၭဂဲၫထၪ့လံၩလၧအအီၪ က့ၪကီၪ့ဆၧအလးဖၧၩ့နီၪလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫဒၪနီၪကျီၪ့ၥံၫခွံၬ ၦအံဇံၭအဖိၪဝဲၡါလၧၦၡၩ",
			"9": "<sup>9</sup> ၥံၪဒဲလၧဆၧဖိၪဆၧဎါအဒိၩ့နီၪဆ့လီၫ.- အဝ့ၫဒၪအၪ့ မၧၫ့လၩ့ဆၧနဲၪ့လၩ့လၭ ဒဲဆၧလၩ့လိလၩ့လၭလၧန ကျၩ,အံဇံၭဧ့, လၧဖၫရိၫ, ဒဲအခ့ၫအၡၩအကျၩလီၫ.",
			"10": "<sup>10</sup> အဝ့ၫဒၪကျီၪ့ၥံၫခွံၬ ၦအၪဆၨၩတၭ, မၩၥံၫစဎွၩဖၭ",
			"11": "<sup>11</sup> ဒိၪၥံၪး- ၦအၫမိၫဖိၪ အစဎွၩစဲဟၫ့, ဒဲဘၫၡၫ့အစဎွၩ",
			"12": "<sup>12</sup> အီၭ,ဒဲကၫနအၫ့အဘၩ့အမုးၥံၪထီးအလူၬ.- တၭဖ့ၪ လၫ့အဝ့ၫၥံၪအထံၫအခးလၧဆၧန့ၥၫ, လၧအၡၩခမျၧး အံၫစရ့လၭအဆၧန့ၥၫအဂးလီၫ.",
			"13": "<sup>13</sup> ယဟိဝၩဧ့, နမံၩ့အီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ. ယ ဟိဝၩဧ့, ဆၧနၪ့ထၪ့ထဲၩ့နၧၩယီၩ, အီၪဝ့ၫအဆိၩဆိၩ",
			"14": "<sup>14</sup> အကၠၪကၠၪလီၫ.- အဂဲးဘဲၫယီၩ ယဟိဝၩမိစ့ၩရၫ့အ ၡၩခမျၧးတၭ,မိနီၫ့ယါလၩ့ထဲၩ့အၥၭ လၧအခ့ၫအၡၩ",
			"15": "<sup>15</sup> အခိၪအကၠီၩ့လီၫ.- ၦဆၨၩၥံၪအဆၧဂၩ့ဆၧဖၪ့နီၪ",
			"16": "<sup>16</sup> မွဲစ့ၩ,ဒဲထီၫ့, ၦၡၩအစူၪအဆၧမၩလီၫ.- အဝ့ၫၥံၪ အီၪလၧအနိၭလါနၫ့တၭ, ချဲၩ့ဆၧအ့ၬး အီၪလၧအမ့ၬ",
			"17": "<sup>17</sup> ၥၪလါနၫ့တၭ, ဒၪဆၧအ့ၬး- အီၪလၧအနါၥံၪလါနၫ့ တၭ,နါဂၧၫ့ဆၧအ့ၬ.မွဲမၬ, အၥၪအီၪလၧအနိၭဖၧၩ့ ဆ့အ့ၬ.",
			"18": "<sup>18</sup> ၦလၧအတဲၩ့ဝ့ၫလဖၪ, ဒဲကယဲၦလၧအဒိၭနဲၩ့အၥၭ",
			"19": "<sup>19</sup> လၧအဝ့ၫၥံၪထီးအလူၬနီၪလၩ့ဂၬအဝ့ၫၥံၪလီၫ.- အံၫ စရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, စံၭထၪ့အၪ့အူၭ ယဟိဝၩ ဆံၭ.စအၫရၧၫ့အၡၩဂံၪ့ဖိၪၥံၪဧ့, စံၭထၪ့အၪ့အူၭယ",
			"20": "<sup>20</sup> ဟိဝၩဆံၭ.- စလံဝဲၫအၡၩဂံၪ့ဖိၪၥံၪဧ့, စံၭထၪ့အၪ့အူၭ ယဟိဝၩဆံၭ. ၦလၧအၥၭမဲၪယဟိဝၩၥံၪဧ့, စံၭထၪ့",
			"21": "<sup>21</sup> အၪ့အူၭယဟိဝၩဆံၭ.- ယဟိဝၩလၧအအီၪဝ့ၫလၧယ ရုစလံၫ့အဖၧၩ့နီၪ, စံၭထၪ့အၪ့အူၭအဝ့ၫနီၪလၧဇံအိၫ့ အဖၧၩ့ဆံၭ. နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၩဆံၭ."
		},
		"136": {
			"1": "<sup>1</sup> စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ, အဂဲးဘဲၫယီၩအဝ့ၫ ဒၪဂ့ၩဝ့ၫတၭး မွဲအခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪ",
			"2": "<sup>2</sup> လီၫ.- စံၭထၪ့အၪ့အူၭယွၩၥံၪအယွၩလဂၩဆံၭ.အဂဲး ဘဲၫယီၩအခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"3": "<sup>3</sup> စံၭထၪ့အၪ့အူၭကဆါၥံၪအကဆါလဂၩဆံၭ. အ ဂဲးဘဲၫယီၩ အခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"4": "<sup>4</sup> ၦလၧအမၩဆၧလၩ့လိလၩ့လၭဖၭဒိၪ မွဲအဝ့ၫဒၪလဂၩ ဎးနီၪး အဂဲးဘဲၫယီၩအခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့",
			"5": "<sup>5</sup> ကၠၪလီၫ.- အဝ့ၫဒၪတဲၩ့လၩ့မူၭခိၪလၧဆၧကိၪ့ဘၪကိၪ့ ၥ့ၪနီၪး အဂဲးဘဲၫယီၩအခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့",
			"6": "<sup>6</sup> ကၠၪလီၫ.- အဝ့ၫဒၪဒၩလၩ့ဂၪ့ခိၪလၧထံၫဖၫ့ခိၪနီၪး အဂဲး ဘဲၫယီၩအခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"7": "<sup>7</sup> အဝ့ၫဒၪတဲၩ့လၩ့ဆၧဖၩ့ဖၭဒိၪလဖၪနီၪး အဂဲးဘဲၫယီၩ",
			"8": "<sup>8</sup> အခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- မုမ့ၬလဖျိၪ့ နီၪဘဲၫၥိၭအမိပၧၩ့မုနံၩး အဂဲးဘဲၫယီၩအခိးအတၩ",
			"9": "<sup>9</sup> အီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- လၩလဖျိၪ့နီၪဒဲၡၪၥံၪ ဘဲၫၥိၭအမိပၧၩ့မုနၩး အဂဲးဘဲၫယီၩအခိးအတၩအီၪ ဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"10": "<sup>10</sup> အဝ့ၫဒၪကျီၪ့ခွံၬၦအံဇံၭအဖိၪဝဲၡါၥံၪ အဂဲးဘဲၫ",
			"11": "<sup>11</sup> ယီၩအခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- ၥိၫ့ထၪ့ ခွံၬအံၫစရ့လၭ လၧအဝ့ၫၥံၪအကျၩနီၪး အဂဲးဘဲၫယီၩ",
			"12": "<sup>12</sup> အခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- လၧအစူၪ ဆီၪ့ဒဲလၧအစူၪဒူၪယူၬထၪ့အၥၭနီၪး အဂဲးဘဲၫယီၩအ",
			"13": "<sup>13</sup> ခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- မၩထ့ဖၭမၫ ဆမံၭဝီၩနံၫခီၫနီၪး အဂဲးဘဲၫယီၩအခိးအတၩအီၪဝ့ၫ",
			"14": "<sup>14</sup> လၩ့ဆိၩလၩ့ကၠၪလီၫ.- ဒုၭခၫ့ဂၬအံၫစရ့လၭလၧအၥၭ ကျၩနီၪးအဂဲးဘဲၫယီၩ အခိးအတၩအီၪဝ့ၫ လၩ့ဆိၩ",
			"15": "<sup>15</sup> လၩ့ကၠၪလီၫ.- အဝ့ၫဒၪတရုၩလၩ့ခွံၬ ဖၫရိၫဒဲအၥုၭမု ခမျၧးလၧမၫဆမံၭဝီၩအဖၧၩ့း အဂဲးဘဲၫယီၩ အခိးအ တၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"16": "<sup>16</sup> ၥိၫ့အၡၩခမျၧးလၧၡါမုနၧၫ့ဖၫအဖၧၩ့း အဂဲးဘဲၫယီၩ",
			"17": "<sup>17</sup> အခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- ကျီၪ့ၥံၫခွံၬ စဎွၩဖၭဒိၪၥံၪနီၪး အဂဲးဘဲၫယီၩ အခိးအတၩအီၪဝ့ၫ",
			"18": "<sup>18</sup> လၩ့ဆိၩလၩ့ကၠၪလီၫ.- တၭမၩၥံၫခွံၬစဎွၩလၧအမံၩ့ ဂၧၫ့ထၪ့ၥၩလၩ့နီၪး အဂဲးဘဲၫယီၩ အခိးအတၩအီၪဝ့ၫ",
			"19": "<sup>19</sup> လၩ့ဆိၩလၩ့ကၠၪလီၫ.- ဒဲၦအၫမိၫဖိၪအစဎွၩစဲဟၫ့နီၪး အဂဲးဘဲၫယီၩ အခိးအတၩအီၪဝ့ၫ လၩ့ဆိၩလၩ့ကၠၪ",
			"20": "<sup>20</sup> လီၫ.- ဒဲဘၫၡၫ့အစဎွၩအီၭနီၪး အဂဲးဘဲၫယီၩအခိးအ",
			"21": "<sup>21</sup> တၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- တၭဖ့ၪလၫ့အဝ့ၫ ၥံၪအထံၫအခးလၧဆၧန့ၥၫနီၪး အဂဲးဘဲၫယီၩအခိးအ",
			"22": "<sup>22</sup> တၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- ဆၧန့ၥၫလၧအခ့ၫ အၡၩအံၫစရ့လၭအဂးနီၪ အဂဲးဘဲၫယီၩအခိးအတၩ အီၪဝ့ၫလၩ့ဆိၩ့လၩ့ကၠၪလီၫ.",
			"23": "<sup>23</sup> အဝ့ၫဒၪနၪ့ထၪ့ထဲၩ့ပၧၩ လၧပဘၪၡၪ့ဘၪနၭအဘိၩ့ ဘၭနီၪး အဂဲးဘဲၫယီၩ အခိးအတၩ အီၪဝ့ၫလၩ့ဆိၩ",
			"24": "<sup>24</sup> လၩ့ကၠၪလီၫ.- တၭမၩဖီၩ့မၩဖျ့ၭပၧၩ လၧပဒုၪပဒၩၥံၪး အဂဲးဘဲၫယီၩ အခိးအတၩအီၪဝ့ၫ လၩ့ဆိၩလၩ့ကၠၪ လီၫ.",
			"25": "<sup>25</sup> အဝ့ၫဒၪဖ့ၪလၫ့ဆၧအၪ့ဆၧအီၩ လၧကယဲဆၧအၥၭ ထီးအလူၬနီၪး အဂဲးဘဲၫယီၩအခိးအတၩအီၪဝ့ၫလၩ့ ဆိၩလၩ့ကၠၪလီၫ.",
			"26": "<sup>26</sup> စံၭထၪ့အၪ့အူၭမူၭခိၪအယွၩနီၪဆံၭး အဂဲးဘဲၫယီၩ အခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ."
		},
		"137": {
			"1": "<sup>1</sup> ပဆၧၫ့နၩ့လၧဘၭဘလၧၫ့အထံၫချိၬၥံၪ အနဲၩ့ထံၭ တၭ,ထီးပနၪ့ထၪ့ထဲၩ့ဇံအိၫ့နီၪ ပမ့ၬထံၫလၩ့ထီးနီၪ",
			"2": "<sup>2</sup> လီၫ.- ပဘျၭထၪ့ပနါဒံၩ့လၧ ဖံစလီၫ့အလီၩ့ လၧအလး",
			"3": "<sup>3</sup> နီၪလီၫ.- အဂဲးဘဲၫယီၩ ထီးနီၪ ၦလၧအအၪ့မၧၫ့ဎီးပၧၩ လဖၪနီၪအၪ့မၧၫ့ၦၥံၫကျံၩဆၧတၭး ၦလၧအအၪ့မၧၫ့ ဆီၪ့ပၧၩလဖၪနီၪ အၪ့မၧၫ့ပၥၭထိၬဆၧလီၫ. တၭစံၭ ဝ့ၫဒၪ,ၥံၫကျံၩအ့ၪပၧၩလၧဇံအိၫ့အထၭခိၪ လဆၫ့ဆၫ့",
			"4": "<sup>4</sup> ဆံၭ.- တၭပမိၥံၫကျံၩ ယဟိဝၩအထၭခိၪလၧၦလခီၫ ဘၩ့မုးအခးဖၧၩ့နီၪဘဲၫၥ့ၪလဲၪ.",
			"5": "<sup>5</sup> ယရုစလံၫ့ဧ့, ယအ့ၪၥၭနၪ့နၧၩတၭ, မွဲယစူၪထွ့ၪ",
			"6": "<sup>6</sup> ၥၭနၪ့ဆၧဆံၭ.- ယအ့ၪလနၪ့ထၪ့ထဲၩ့ဘၪနၧၩတၭ, ယအ့ၪလအီၪက့ၪဘၪယရုစလံၫ့ လၧယဆၧၥၭထိၬအ ဒိၪထုၬအဖၫ့ခိၪတၭ, မွဲယဖျ့ၩဘုၭထၬ လၧယထၫချၬ ဆံၭး",
			"7": "<sup>7</sup> ယဟိဝၩဧ့, ၦအံဒၧၫ့ဖိၪၥံၪလၧအစံၭဝ့ၫ, မၩဂၭဂီၩ့ မၩဂၭဂီၩ့ထီၩ့လၩ့ လၧအခၪ့ထံၭနီၪ, နၪ့ထၪ့ထဲၩ့လါ",
			"8": "<sup>8</sup> အဝ့ၫၥံၪလၧယရုစလံၫ့အနံၩနီၪဆံၭ.- ဘၭဘလၧၫ့အ ဖိၪမုၪလၧအမိထီၩ့လၧဆၧဂၭဂီၩ့ဧ့, ၦလၧအဖ့ၪဆၧၫ့ ထဲၩ့နၧၩ ဘဲၫနမၩပၧၩအၥိၭနီၪ ဘၪဆိၪဂ့ၩဝ့ၫလီၫ.",
			"9": "<sup>9</sup> ၦလၧအမၩန့နဖိၪၥၪၥံၪတၭ, ခွံၬလၩ့ခွံၬအဝ့ၫၥံၪလၧ လဲၫ့အလီၩ့နီၪ ဘၪဆိၪဂ့ၩဝ့ၫလီၫ."
		},
		"138": {
			"1": "<sup>1</sup> ယမိစံၭထၪ့အၪ့အူၭနၧၩ လၧယၥၭထၧၫ့ဖျိၪ့ယၫ,လၧ",
			"2": "<sup>2</sup> ယွၩလဖၪအမ့ၬယၫနီၪယမိၥံၫကျံၩထၪ့နၧၩလီၫ.- ယမိ ဘိၪ့ထၪ့ဘၩထၪ့ဆၧတီၩ လၧနဆၧလုဂံၪ့ဆံၫ့ဎံၪတၭ, ယမိစံၭထၪ့အၪ့အူၭနမံၩ့ လၧနခိးနတၩအကၠီၩ့,ဒဲနဆၧ မွဲဆၧတီၩအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩ နအီၪက့ၪနလူ",
			"3": "<sup>3</sup> နထၫဒိၪနဲၪ့နမံၩ့ထီးအလူၬလီၫ.- လၧမုလနံၩလၧယ ကိၭထၪ့နၧၩနီၪ နစံၭဆၧၫ့ယၧၩတၭ, နဒုၭဆီၪ့ထၪ့ယ ဂဲးယဘၭလၧယၥၭခံဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> ကယဲဂၪ့ခိၪအစဎွၩထီးအလူၬၥံၪး ထီးအနါဂၧၫ့ဆၧ ချဲၩ့လၧယနိၭတၭ, မိစံၭထၪ့အၪ့အူၭနၧၩ,ယဟိဝၩဧ့,",
			"5": "<sup>5</sup> တၭအဝ့ၫၥံၪမိၥံၫကျံၩဆၧ လၧယဟိဝၩအဖၧၩ့ၥၭ,လၧ ယဟိဝၩအလၩအဖၩ့ဒိၪဝ့ၫလီၫ.",
			"6": "<sup>6</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩအီၪလၧဆၧထၪ့ထီၫလါနၫ့ တၭ, ယိလၩ့ၦလၧအဆၪ့လၩ့အၥၭတၭး ၦအီၪက့ၪ ထၪ့ထီၫအၥၭနီၪၥ့ၪယၫဝ့ၫလၧအယဲၩ့လီၫ.",
			"7": "<sup>7</sup> ထီးယအ့ၪလ့ၩလါနၫ့ လၧဆၧၡၪ့ဆၧနၭ အကျၩ တၭ,နမိဒုၭမၧၫ့ထၪ့ထဲၩ့ယၧၩလီၫ. နယၩ့ထၪ့နစူၪထၫ့ ဒုၪဒၩယဒုၪယဒၩအၥၭထၪ့တၭ, နစူၪထွ့ၪမိထိးထဲၩ့",
			"8": "<sup>8</sup> တၩ့ထဲၩ့ယၧၩလီၫ.- ဆၧလၧအဘၪဆဲၫ့လၧယၧၩယီၩ, ယဟိဝၩမိမၩထီးအဎွ့ၩထၪ့တၭး ယဟိဝၩဧ့, နခိးန တၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ. နစူၪအဆၧမၩနီၪ နစဲၪ့ဒၪခွံၬဝ့ၫအ့ၬ."
		},
		"139": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, နအၪ့ဎၬယိယူၭယၧၩတၭ,နၥ့ၪယၫ",
			"2": "<sup>2</sup> ယၧၩလီၫ.- ယဆၧၫ့နၩ့ဂ့ၩယဂဲထုၪ့ဂ့ၩ,နဝ့ၫဒၪနၥ့ၪ ယၫတၭ, နနၪၥ့ၪယဆၧဆီၫ့မီၪ့အီၪ လၧအယဲၩ့ဒံၭ",
			"3": "<sup>3</sup> လီၫ.- ယဖၧၩ့ၥၭဒဲယမံၫနၩ့နီၪနအီၪဝၬဖီၩ့တၭ,နၥ့ၪယၫ",
			"4": "<sup>4</sup> ယဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭထီးအလူၬလီၫ.- အဂဲးဘဲၫယီၩ, ယိ ခွါ, ယဟိဝၩဧ့, ဆၧချဲၩ့လၧယဖျ့ၩအလီၩ့ထီးအလူၬ",
			"5": "<sup>5</sup> လၧနလၥ့ၪယၫဘၪနီၪအီၪနးထံၪအ့ၬ.- နအီၪလၧယလး ခဲၫ့ဒဲလၧယမ့ၬယၫတၭ, နအီၪက့ၪနစူၪလၧယလီၩ့လီၫ.",
			"6": "<sup>6</sup> ဆၧၥ့ၪယၫဘဲၫနီၪအၥိၭ လၩ့လၭလၨၪလၧယဂး အီၪ ထၪ့ထီၫဝ့ၫနီၪ ယထၪ့ဘၭၥ့ၪအ့ၬ.",
			"7": "<sup>7</sup> တၭဘဲၫၥိၭယဖီၩ့ခွံၬနၥၭနီၪ, ယမိလ့ၩခီၫခီၫလဲၪ.",
			"8": "<sup>8</sup> တၭယမိစဲၪ့ဖျိၭခွံၬ လၧနမ့ၬယၫခီၫခီၫလဲၪ.- ယအ့ၪ ထၪ့ဘၭလၧမူၭခိၪတၭ, နအီၪနဝ့ၫထီးနီၪး ယအ့ၪဒၩ လၩ့ယလးမံၫ လၧဖျႃဖၧၩ့တၭ, ယိခွါ, နအီၪထီးနီၪ",
			"9": "<sup>9</sup> လီၫ.- ယအ့ၪမၩန့မုဂီၩအဒံၭအီၪလၧမၫဆမံၭအထုၬ",
			"10": "<sup>10</sup> လခီၫ,- နစူၪမိၥိၫ့ယၧၩထီးနီၪဆ့တၭ, နစူၪထွ့ၪဖီၪ့ထၬ",
			"11": "<sup>11</sup> ယၧၩလီၫ.- ယအ့ၪစံၭ, မွဲမၬ, ဆၧခံၭမိမၩဘံၭမၩ ဘၧၩ့ယၧၩတၭ, မုနၩကဲၪထၪ့ဆၧဖၩ့ဝၬဖီၩ့ယၧၩလီၫ.",
			"12": "<sup>12</sup> တၭဆၧခံၭဒၪလ့ၬ မၩဘံၭဆၧလၧနမ့ၬယၫနီၪဆ့အ့ၬ. တၭမုနၩမိဖၩ့ထၪ့ ဘဲၫမုဆၫအၥိၭ ဆၧခံၭမွဲဘဲၫဆၧ ဖၩ့အၥိၭလီၫ.",
			"13": "<sup>13</sup> အဂဲးဘဲၫယီၩ နမၩကဲၪထၪ့ယလ့ၥံၪ,နထၭထၪယၧၩ",
			"14": "<sup>14</sup> လၧယမိအဒၧၩ့လးဖၧၩ့လီၫ.- တၭဆၧတဲၩ့လၩ့ယၧၩ အီၪလၧဆၧၥၭမဲၪအလး, ဒဲဆၧထီၫမံၫထီၫမၪလၩ့လၭ အလးလီၫ. မၩအၥၭဘဲၫနီၪတၭ,ယမိစံၭထၪ့အၪ့အူၭ နၧၩလီၫ. နဆၧမၩၥံၪလၩ့လၭဝ့ၫနီၪ, ယၥ့ၪယၫလၩ့",
			"15": "<sup>15</sup> ထံးလၩ့ဆ့ၭဆ့လီၫ.- တၭလၧဆၧမၩကဲၪထၪ့ယၧၩ လၧဆၧအီၪၥူၪအလးနီၪ, ဘဲၫဆၧထဲၫ့ယၧၩ ဘဲၫလၧ ဂၪ့ခိၪယိၬအဖၧၩ့အၥိၭနီၪ, ယခံးယဂၩ့အီၪၥူၪလၧန",
			"16": "<sup>16</sup> မ့ၬယၫအ့ၬ.- တၭယဂၩ့ၥံၪအီၪကွ့ၭအၥၭလၧနလံၬဖၧၩ့ ထီးအလူၬ, ယဆၧလလီၪ့နီၪ နမ့ၬၥၪဒၪဘၪလၧအလ အီၪဒံၭဘၪနးမံၩ့တၭ, လနံၩဘၪလနံၩလနံၩဘၪလနံၩ ဘၪဆၧမၩကဲၪထၪ့ဝ့ၫလီၫ.",
			"17": "<sup>17</sup> တၭယွၩဧ့, နဆၧဆီၫ့မီၪ့နီၪမွဲဆၧလူဒိၪဎွ့ၩဒိၪလၧ ယၧၩဆံၭဒိၪလဲၪၬ တၭအဆၧဝံဆၧနၬနီၪမွဲအဆံၭအၪ",
			"18": "<sup>18</sup> လဲၪၬ- ယအ့ၪဝံထၪ့နၬထၪ့အဝ့ၫၥံၪအီၪဝ့ၫအၪနဲၪ့မ့ၭ ဖျိၪ့ဒံၭလီၫ. ယမံၫနၪ့ထၪ့ယၥၭတၭ ယအီၪဒံၭလၧ နၥိၭလီၫ.",
			"19": "<sup>19</sup> ယွၩဧ့, နမိမၩၥံၫခွံၬၦလတီၩလလီၩ့ဘၪနီၪ,အခိး",
			"20": "<sup>20</sup> မွဲၦမၩၥံၫၦၡၩၥံၪဧ့, စဲၪ့ဒၪခွံၬယၧၩဆံၭ.- အဂဲးဘဲၫ ယီၩမွဲၦလၧအချဲၩ့မၪဘၪနမံၩ့, ကိၭထၪ့နၧၩပျီၩပျီၩ,",
			"21": "<sup>21</sup> ဘဲၫနဒုၪနဒၩအၥိၭနီၪလီၫ.- ယဟိဝၩဧ့, ၦလၧအမ့ၬ လဲၩနၧၩလဖၪနီၪ, ယမိမ့ၬလဲၩအဝ့ၫၥံၪမွဲအ့ၬဧၪ. တၭ",
			"22": "<sup>22</sup> ယမိၥၭလိၪၦလၧအထၫ့ဒုၪထၫ့ဒၩနၧၩမွဲအ့ၬဧၪ.- ယ မ့ၬလဲၩအဝ့ၫၥံၪလၧ ဆၧမ့ၬလဲၩလၩ့ထံးလၩ့ဆ့ၭတၭ,",
			"23": "<sup>23</sup> ယအီၪက့ၪဝ့ၫလၧယဒုၪယဒၩလီၫ.- ယွၩဧ့, အၪ့ဎၬယိ ယၧၩတၭ, ၥ့ၪယၫယၥၭဆံၭ. မၩခွါယၧၩတၭ, ၥ့ၪယၫ",
			"24": "<sup>24</sup> ယဆၧဆီၫ့မီၪ့ၥံၪဆံၭ.- တၭဖၧၩ့ၥၭအအၧၩ့ လၧယ ဖၧၩ့မွဲအအီၪဧၪ, လအီၪဘၪလဲၪနီၪ, ယိနဝ့ၫတၭ, ၥိၫ့ ယၧၩလၧဖၧၩ့ၥၭအဆိၩအကၠၪအဖၧၩ့ဆံၭ."
		},
		"140": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, မၩဖီၩ့မၩဖျ့ၭလါယၧၩ လၧၦအအၧၩ့ အၥၫ့, ခိၭထၬဒုၭဖီၩ့ယၧၩ လၧၦမၩဆီၪ့ဆၧဆံၭ.",
			"2": "<sup>2</sup> အဝ့ၫၥံၪကိၪ့ထၪ့ဆၧအၧၩ့ လၧအၥၭခံဖၧၩ့း အီၪကိၩ့",
			"3": "<sup>3</sup> အီၪကီၪ့ ကိၭမုနံၩမုနၩဒ့ၭ ဘဲၫၥိၭအမိဒုၭဆၧလီၫ.- အ အဝ့ၫၥံၪကျဲၩ့စူၩအဖျ့ၩဘဲၫဂူအၥိၭး ဂူအၧၩ့အစုၪအီၪဝ့ၫ",
			"4": "<sup>4</sup> လၧအဖျ့ၩအဖၫ့လၬလီၫ.(စ့လၫ.)- ယဟိဝၩဧ့, မၩ ဖီၩ့ဖျ့ၭယၧၩ လၧၦလတီၩလလီၩ့ဘၪအစူၪဆံၭ. ခိၭ ထၬဒုၭဖီၩ့ယၧၩ လၧၦမၩဆီၪ့ဆၧ, ၦလၧအကိၪ့ဆၧ",
			"5": "<sup>5</sup> ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ ယလ့ၩဆၧနီၪဆံၭ.- ၦလၧအ အီၪက့ၪထၪ့ထီၫအၥၭနီၪ အီၪက့ၪၥူၪဖျံၩခွၩ့လၧယဂး, ဒဲဖျံၩၥံၪး အဝ့ၫၥံၪဒၩလၩ့ၡၬလၧဖၧၩ့ၥၭနဲၩ့ထံၭ, ဆဲၪဆၧ လၧယဂးလီၫ.(စ့လၫ.)",
			"6": "<sup>6</sup> ယစံၭယဟိဝၩ,နမွဲယယွၩတၭး ယဟိဝၩဧ့,ခိၭနၪ",
			"7": "<sup>7</sup> ယဆၧအၪ့ယၫၥံၪအလူဆံၭ.- ယဟိဝၩ,ကဆါ,မွဲဆၧ ထိးထဲၩ့တၩ့ထဲၩ့ယၧၩ အစီၩ့အမၩ့တၭး လၧဆၧဒုၭ",
			"8": "<sup>8</sup> ၥုၭအမုနံၩနီၪ နချႃၬဘံၭယခိၪဎွံၪလီၫ.- ယဟိဝၩဧ့, ၦလတီၩလလီၩ့ဘၪအဆၧဆိၫ့န့ဘၪနီၪ ဖ့ၪလၫ့လ ဂ့ၩ.မွဲအဆၧကိၪ့ထၪ့ၥံၪထီးကဲၪထၪ့လဂ့ၩ မိအီၪက့ၪ ထၪ့ထီၫအၥၭလီၫ.(စ့လၫ.)",
			"9": "<sup>9</sup> ၦလၧအအီၪဝၬဖီၩ့ယၧၩၥံၪအခိၪဎွံၪနီၪ, အနိၭဖျံၩ",
			"10": "<sup>10</sup> ဒၪဝ့ၫအဆၧအၧၩ့မိမၩဘံၭအနၫ့ဆါၥံၪလီၫ.- အဝ့ၫဒၪ မိခွံၬလၩ့မ့ၪအၧၩ့ဖၭ လၧအဝ့ၫၥံၪအလီၩ့တၭ, မိခွံၬ လၩ့ခွံၬအဝ့ၫၥံၪ လၧမ့ၪဖၧၩ့း လၧထံၫယိၬဖၧၩ့, ဘဲၫ",
			"11": "<sup>11</sup> ၥိၭအထီးဂဲထုၪ့ထဲၩ့လၧၩ့လဂ့ၩလီၫ.- ၦချဲၩ့ဆၧအၧၩ့ နီၪမိအီၪဂုးအီၪခၧၫ့ဘၪ လၧထံၫၥံၪခးၥံၪ အဖၧၩ့အ့ၬ. ၦမၩဆီၪ့ဆၧလဂၩနီၪ ဆၧအၧၩ့မိလီၩ့မၩဂၭဂီၩ့အဝ့ၫ လီၫ.",
			"12": "<sup>12</sup> ယဟိဝၩမိစ့ၩရၫ့တီၩန့ ၦလၧအဘၪဆၧၡၪ့ဆၧနၭ အဂးတၭ, မိစ့ၩရၫ့ၦၡၪ့ဖိၪယၬဖိၪနီၪယၥ့ၪယၫလီၫ.",
			"13": "<sup>13</sup> မွဲမၬၦအတီၩနီၪ မိစံၭထၪ့အၪ့အူၭနမံၩ့, ၦအၥၭဆုး လီၩ့နီၪမိအီၪဂုးခၧၫ့လၧနမ့ၬယၫလီၫ."
		},
		"141": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, ယကိၭထၪ့နၧၩလီၫ. မၩချဲၫ့ချဲၫ့လၧ ယဂးဆံၭ. ထီးယကိၭထၪ့နၧၩတၭ, ခိၭနၪယလူဆံၭ.",
			"2": "<sup>2</sup> မွဲယဆၧဘၩဆိၪဖၪယီၩ ကဲၪထၪ့ဘဲၫဆၧဆူၭခဲၩနၧၫ့ မၧၫ့လၧနမ့ၬယၫအၥိၭး ယယူၬထၪ့ယစူၪယီၩမွဲအကဲၪ ဘဲၫဆၧမၩဘိၪ့လၧဂၪလခီၫအၥိၭနီၪဆံၭ.",
			"3": "<sup>3</sup> ယဟိဝၩဧ့, အီၪက့ၪၦခိၭဆၧလၧယနိၭအမ့ၬယၫ",
			"4": "<sup>4</sup> ဆံၭးအီၪခိၭထၬယနိၭဖျံၩအတရၫ့ဆံၭ.- ထီးဘိၭကၠၪ ယၥၭလၧဆၧအၧၩ့လမံၩ့လါလါဘဲၫၥိၭ ယမိကျ့ၭစၨၭ မၩဆၧအၧၩ့လၧၦလတီၩလလီၩ့ဘၪ လၧအမၩအၧၩ့ ဆၧၥံၪအၥိၭနီၪလဂ့ၩ. တၭမွဲယထီးအၪ့အဝ့ၫၥံၪအ ဆၧအၪ့အွံၪၥံၪလဂ့ၩ.",
			"5": "<sup>5</sup> ၦအတီၩအလီၩ့ထးယၧၩနီၪ, မွဲဆၧအခိးအတၩလ မံၩ့လၧယဂးမွဲအအၪ့ၥီၪ့ယၧၩဆံၭ. ကဲၪထၪ့ၥိၪလၧ ယခိၪဎွံၪအဂးနီၪ, ယခိၪဎွံၪခွံၬၡိၭအ့ၬ. ထီးနီၪလဖၧၫ့ ယဘၩဆိၪဖၪ လၧအဝ့ၫၥံၪ အဆၧၡၪ့ဆၧနၭ အကၠီၩ့",
			"6": "<sup>6</sup> လီၫ.- ထီးအဝ့ၫၥံၪအၡၩစ့ၩရၫ့ခွးလဖၪမိဘၪဆၧခွံၬ လၩ့ခွံၬဝ့ၫလၧလဲၫ့မုအကျၩတၭ, ထီးနီၪလဖၧၫ့ၦလဖၪ မိနါဂၧၫ့ယဆၧချဲၩ့ လၧအမွဲဆၧအမုၬလီၫ.",
			"7": "<sup>7</sup> ပဎွံၪပနၧၩ့လၩ့ပြံၩပၩလၧဖျႃဖၧၩ့အခိၪထိၭ ဘဲၫၦ လၧအထဲၫဆၧဒဲဖ့ၬဆၧလၧဂၪ့ခိၪချိၫ့ အၥိၭနီၪလီၫ.",
			"8": "<sup>8</sup> အဂဲးဘဲၫယီၩယဟိဝၩ, ကဆါဧ့, ယမ့ၬၥၪအီၪလၧ နအီၪ,ယဒိၭနဲၩ့ယၥၭလၧနၧၩး ထီးလူၫလၩ့ခွံၬယၥၭ",
			"9": "<sup>9</sup> လဂ့ၩ.- ခိၭထၬဒုၭဖီၩ့ယၧၩ လၧဖျံၩခွၩ့လၧၦအီၪက့ၪ ဝ့ၫလၧယဂး, ဒဲလၧၦမၩဆၧအၧၩ့လဖၪအဆၧဆဲၪနီၪ",
			"10": "<sup>10</sup> ဆံၭ.- မွဲၦလတီၩလလီၩ့ဘၪလၩ့ထံၩဖါလၧအၡၬဒၪ ဝ့ၫအဖၧၩ့ဆံၭ. အ့ၪမွဲယၧၩယီၩ မွဲယလ့ၩဖီၩ့ဖျ့ၭလါ ဆံၭ."
		},
		"142": {
			"1": "<sup>1</sup> ယကိၭထၪ့ယဟိဝၩ လၧယလူၥီၫ, ယအၪ့ယၫယ",
			"2": "<sup>2</sup> ဟိဝၩ လၧယလူၥီၫလီၫ.- ယလူၫလၩ့ယဆၧဆီၫ့မီၪ့ လၧယမ့ၬယၫ, ယဒုၭနဲၪအဝ့ၫဒၪလၧယဆၧခိဆၧဝီၩ",
			"3": "<sup>3</sup> လီၫ.- ထီးယၥၭအ့ၪလၩ့ဘဲၩတၭ,နၥ့ၪယၫယဖၧၩ့ၥၭ လီၫ.ဖၧၩ့ၥၭလၧယဖိၬဝ့ၫလဘီၩ့အဖၧၩ့နီၪ, ၦအီၪက့ၪ",
			"4": "<sup>4</sup> ၥူၪဖျံၩခွၩ့လၧယဂးလီၫ.- ယယိလၧယစူၪထွ့ၪနီၪ ယိ ဆၧတၭ,ၦလၧအၥ့ၪယၫယၧၩအီၪအ့ၬ. ယဆၧဖလ့ၬ အလးလၩ့မါလီၫ. ၦလၧအလီၫ့ကီၩ့ယၥၭ အီၪနးဂၩ အ့ၬ.",
			"5": "<sup>5</sup> ယဟိဝၩဧ့,ယကိၭထၪ့နၧၩ, ယစံၭ,နမွဲယဆၧဖလ့ၬ",
			"6": "<sup>6</sup> အလး, ယဂးလၧၦၡၩမၧၫ့ဝ့ၫအခးဖၧၩ့လီၫ.- ခိၭနၪ ယအၪ့ယၫဆၧဆံၭး အဂဲးဘဲၫယီၩယဘၪဆၧဆၪ့လၩ့ ယၧၩနၭမၬလီၫ. မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧၦမၩအၧၩ့ မၩနၭယၧၩနီၪဆံၭ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအဂဲးအ ဘၭဆီၪ့နဲၪ့ယၧၩဒံၭလီၫ.",
			"7": "<sup>7</sup> ဒုၭစဲၪ့ထၪ့ခွံၬယၥၭ လၧထီၫ့ဖၧၩ့, ဘဲၫၥိၭယမိစံၭ ထၪ့အၪ့အူၭနမံၩ့ဆံၭ. ၦအတီၩအလီၩ့မိအီၪကီၪ့ဝၬ ဖီၩ့ယၧၩး အဂဲးဘဲၫယီၩ နမိမၩဂ့ၩယၧၩလီၫ."
		},
		"143": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, ခိၭနၪယဆၧဘၩဆိၪဖၪ, ဒိၭနနါလၧယ အၪ့ယၫဆၧဆံၭ. ဘဲၫနမၩတီၩနလူအၥိၭ, ဘဲၫနတီၩ",
			"2": "<sup>2</sup> နလီၩ့အၥိၭနီၪ စံၭဆၧၫ့ယၧၩဆံၭ.- တၭချဲၩ့ခွးလၧန ခ့ၫနၡၩလဂ့ၩ, အဂဲးဘဲၫယီၩၦအမၧၫ့လၧအတီၩလၧန",
			"3": "<sup>3</sup> မ့ၬယၫနီၪအီၪဝ့ၫနးဂၩအ့ၬ.- အဂဲးဘဲၫယီၩဒုၪဒၩမၩ အၧၩ့မၩနၭယၥၭတၭ, ဆၪ့လၩ့ယူၭ ယၥၭမၧၫ့ထီၩ့ လၧဂၪ့ခိၪး ဒုၭအီၪယၧၩလၧဆၧခံၭကျၩ, ဘဲၫၦလၧ",
			"4": "<sup>4</sup> အၥံၫယံၬယံၬယူၭအၥိၭနီၪလီၫ.- တၭယၥၭလၧယ ဖၧၩ့ယီၩလၩ့ပွံၭလၩ့ထၩ့နီၪ, ယၥၭအီၪယူဝ့ၫလၧယ",
			"5": "<sup>5</sup> ဖၧၩ့လီၫ.- ယနၪ့ထၪ့ထဲၩ့မုနံၩလၧဖျိၩ့, ယဆီၫ့မီၪ့နမၩ ဆၧထီးအလူၬ အဂဲးအကၠီၪ့တၭး ယမိဆီၫ့မီၪ့ဆီၫ့မၬ",
			"6": "<sup>6</sup> ဆၧလၧနမၩကဲၪထၪ့လဖၪအဂဲးအကၠီၪ့လီၫ.- ယယူၬ ထၪ့ယစူၪလၧနအီၪ, ယၥၭလၧနမ့ၬယၫမၩအၥၭဘဲၫ ဂၪ့ခိၪလၧအဎဲၫ့ထၬအၥိၭနီၪလီၫ. (စ့လၫ.)",
			"7": "<sup>7</sup> ယဟိဝၩဧ့, မၩချဲၫ့ချဲၫ့စံၭဆၧၫ့ယၧၩဆံၭး ယၥၭမိ လူၬလီၫ. တၭဘဲၫၥိၭယထီၩ့ကဲၪထၪ့ဘၪဘဲၫၦလၧအ လ့ၩလၩ့ လၧဆၧဖၧၩ့လဂ့ၩတၭ, အီၪက့ၪၥူၪခွံၬနမ့ၬ",
			"8": "<sup>8</sup> လၧယၧၩလဂ့ၩ.- ဒုၭနါဂၧၫ့ယၧၩလၧနဆၧအဲၪအခိး အတၩလၧဂီၩလခီၫဆံၭ. အဂဲးဘဲၫယီၩယဒိၭနဲၩ့ယ ၥၭလၧနၧၩလီၫ. ဖၧၩ့ၥၭလၧယကြၨၭဖိၬ လဘီၩ့နီၪ, ဒုၭၥ့ၪယၫယၧၩဆံၭး အဂဲးဘဲၫယီၩ ယဆိၬထၪ့ယၥၭ",
			"9": "<sup>9</sup> လၧနအီၪလီၫ.- ယဟိဝၩဧ့,မၩဖီၩ့မၩဖျ့ၭယၧၩလၧယ ဒုၪယဒၩၥံၪဆံၭ. ယအီၪက့ၪၥူၪယၥၭလၧနဖၧၩ့လီၫ.",
			"10": "<sup>10</sup> တၭဘဲၫၥိၭယမိမၩဆၧ လၧအဘၪနၥၭတၭ, ၥီၪ့လိၪ ယၧၩဆံၭ. အဂဲးဘဲၫယီၩ နမွဲယယွၩလီၫ. နၥၭဂ့ၩနီၪ,",
			"11": "<sup>11</sup> မွဲအၥိၫ့ယၧၩလၧခးဒၩအဖၧၩ့ဆံၭ.- ယဟိဝၩဧ့, မၩ မၧၫ့ထၪ့ထဲၩ့ယၧၩ လၧနမံၩ့အကၠီၩ့ဆံၭ. လၧနဆၧတီၩ ဆၧလီၩ့အကၠီၩ့နီၪ, မၩဖီၩ့မၩဖျ့ၭယၥၭလၧဆၧခိဆၧ",
			"12": "<sup>12</sup> ဝီၩနီၪဆံၭ.- လၧနဆၧအဲၪအခိးအတၩအဖၧၩ့, နမိမၩ ဂၭဂီၩ့ယဒုၪယဒၩတၭ, မိမၩဂၭဂီၩ့ကယဲၦလၧအမၩ အၧၩ့ယၥၭထီးအလူၬနီၪး အဂဲးဘဲၫယီၩ ယမွဲနခ့ၫန ၡၩလီၫ."
		},
		"144": {
			"1": "<sup>1</sup> ယဟိဝၩ,ယလဲၫ့, ၦလၧအၥီၪ့လိၪယစူၪဘဲၫၥိၭအ မိဒုၭဆၧတၭ, ယစူၪနိၩ့ဘဲၫၥိၭယမိဒုၭၥုၭလဂၩနီၪ, မွဲ",
			"2": "<sup>2</sup> အဘၪဆၧစံၭထၪ့အၪ့အူၭဝ့ၫဆံၭ.- မွဲဝ့ၫလၧယဆၧ အဲၪအခိးအတၩဒဲယထိၬ, ယတၨၭထီၫ, ဒဲၦမၩဖီၩ့မၩ ဖျ့ၭယၧၩ, ယထၩ့ဖံၭလဘံၪ့, ဒဲၦလၧယဒိၭနဲၩ့ယၥၭ လၧအဖၧၩ့, ၦလၧအအီၪက့ၪယၡၩခမျၧး လၧယဖၫ့",
			"3": "<sup>3</sup> လၬလီၫ.- ယဟိဝၩဧ့, ၦၡၩလၧနအီၪက့ၪၥ့ၪယၫနၥၭ လၧအဂဲး, ဒဲၦၡၩအဖိၪခွၫလၧနမိဆီၫ့မီၪ့လၧအဂဲးနီၪ, မွဲဆၧနီၪလဲၪ.",
			"4": "<sup>4</sup> တၭၦၡၩၥံၪမၩအၥၭ ဘဲၫဆၧပျီၩပျီၩအၥိၭနီၪလီၫ. အမုနံၩၥံၪမၩအၥၭဘဲၫ ဆၧအလၩၡုၪ လၧအဒံၩခွံၬ အၥိၭနီၪလီၫ.",
			"5": "<sup>5</sup> ယဟိဝၩဧ့, မၩကူၭလၩ့နမူၭခိၪတၭ, ဂဲၫလၩ့ဆံၭ. ထိၭခိၪလီၩ့ၥံၪဆံၭး တၭအဝ့ၫၥံၪမိခူၪထၪ့ဝ့ၫလီၫ.",
			"6": "<sup>6</sup> အၪ့မၧၫ့လၫ့ဝဲဒံၭတၭ, မၩလၩ့မုလၩ့ဖၭအဝ့ၫၥံၪဆံၭ.",
			"7": "<sup>7</sup> ခၭထၪ့နဖျါၥံၪတၭ, မၩဂၭဂီၩ့အဝ့ၫၥံၪဆံၭ.- ဆဲၩလၩ့ နစူၪလၧထၭလခီၫနီၪတၭ, ထုၭထၪ့ခွံၬလါယၧၩတၭ, မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧထံၫဖၭဒိၪအဖၧၩ့, ဒဲၦလခီၫ",
			"8": "<sup>8</sup> ဘၩ့မုးဖိၪ အစူၪဖၧၩ့နီၪဆံၭ.- အဝ့ၫၥံၪနီၪအနိၭချဲၩ့ အၪ့လီၫဆၧတၭ, အစူၪထွ့ၪနီၪမွဲဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪ အစူၪထွ့ၪလီၫ.",
			"9": "<sup>9</sup> ယွၩဧ့, ယမိၥံၫကျံၩထၪ့နၧၩလၧထၭခိၪအၥၫ့, ဒဲနါ ဒံၩ့အီၪလၧအဖျံၩဆံၫဘီၩ့နီၪ, ယမိၥံၫကျံၩထၪ့နၧၩ",
			"10": "<sup>10</sup> လီၫ.- အဝ့ၫလဂၩနီၪမွဲၦလၧအဖ့ၪလၫ့ဆၧထိးထဲၩ့တၩ့ ထဲၩ့လၧစဎွၩၥံၪး ၦလၧအမၩဖီၩ့မၩဖျ့ၭ အခ့ၫအၡၩ",
			"11": "<sup>11</sup> စဒၫဝံၭလၧနၭမၩအၧၩ့ဆၧလီၫ.- ထုၭထၪ့ခွံၬလါယၧၩ တၭ,မၩဖီၩ့မၩဖျ့ၭယၧၩ လၧၦလခီၫဘၩ့မုးဖိၪ အစူၪ ဖၧၩ့,ၦလၧအနိၭချဲၩ့အၪ့လီၫဆၧ,ဒဲအစူၪထွ့ၪမွဲဆၧ",
			"12": "<sup>12</sup> ချဲၩ့ဘျံၭချဲၩ့ဘျၪအစူၪထွ့ၪဆံၭ.- ဘဲၫၥိၭၦဖိၪခွၫၥံၪမိ ဖိၪၥၪခွၫထၪ့ဘဲၫၥံၪ့ဖိၪလၧအဒိၪထၪ့အၥိၭနီၪ, ဘဲၫၥိၭ ပဖိၪမုၪၥံၪမိမၩအၥၭဘဲၫနိၪ့အထုၪ့, လိးဘၪဆၧတဲၩ",
			"13": "<sup>13</sup> ဝ့ၫဘဲၫၦမၩနီးၥံၪအဂးအၥိၭနီၪ,- ဘဲၫၥိၭပဖၫ့ၥံၪမိဎွ့ၩ ဝ့ၫဒဲဖ့ၪလၫ့ဆၧလမံၩ့ဘၪလမံၩ့, ဘဲၫၥိၭပၥိၪမိဖိၪဆါ အဖိၪအထီၫ့ၥံၪ ဒဲအၪထၪ့အလၬၥံၪလၧပဖၧၩ့ၥုၪ့ဖၧၩ့",
			"14": "<sup>14</sup> ၥၭဖၧၩ့,- ဘဲၫၥိၭပချီၥံၪမိအီၪလၧအဂဲးဆီၪ့အဘၭဆီၪ့, ဘဲၫၥိၭဆၧမၩဂၭဂီၩ့, ဒဲဆၧအလၩ့မါထီးအီၪလဂ့ၩ, ဘဲၫၥိၭဆၧကိၭၡၭထၪ့နီၪ ထီးအီၪလၧပဖၧၩ့ၥုၪ့ဖၧၩ့ ၥၭလဂ့ၩလီၫ.",
			"15": "<sup>15</sup> ၦခမျၧးလၧအမွဲဘဲၫနီၪၥိၭလဖၪ ဘၪဆိၪဂ့ၩဝ့ၫတၭး ၦခမျၧးလၧအယွၩမွဲယဟိဝၩနီၪ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ."
		},
		"145": {
			"1": "<sup>1</sup> ယယွၩစဎွၩဧ့, ယမိအီၪက့ၪထၪ့ထီၫနၧၩတၭ,ယမိ",
			"2": "<sup>2</sup> စံၭထၪ့အၪ့အူၭနမံၩ့လၩ့ဆိၩလၩ့ကၠၪလီၫ.- ယမိစံၭ ထၪ့အၪ့အူၭနၧၩ ကိၭမုနံၩကိၭမုနၩဒ့ၭတၭ, ယမိၥံၫ",
			"3": "<sup>3</sup> ကျံၩထၪ့နမံၩ့လၩ့ဆိၩလၩ့ကၠၪလီၫ.- ယဟိဝၩလဂၩ နီၪဒိၪဝ့ၫတၭ, ဂ့ၩၦစံၭထၪ့အၪ့အူၭဝ့ၫအၪအၪလ့ၬလီၫ. တၭမွဲအဆံၭဒိၪလဲၪ,ဆံၭဒိၪလဲၪနီၪ, ပအၪ့ဎူၫအၪ့ဎၬ",
			"4": "<sup>4</sup> ၥ့ၪအ့ၬ.- ၦလဆိၩဘၪလဆိၩမိစံၭထၪ့အၪ့အူၭနဆၧ မၩတၭ, မိဒုၭနဲၪနဆၧမၩအဒိၪလီၫ.",
			"5": "<sup>5</sup> တၭယမိၥံၫကျံၩထၪ့ လၧနကယးကဖးအစီၩ့အမၩ့ အလၩအဖၩ့, ဒဲနမၩဆၧလၩ့လၭလဖၪ အဂဲးအကၠီၪ့",
			"6": "<sup>6</sup> လီၫ.- တၭၦၡၩမိချဲၩ့လၧနမၩလၩ့လၭဆၧ အစီၩ့အ မၩ့အဂဲးအကၠီၪ့တၭ, ယမိလီၩ့လၩ့လၬလၩ့နမၩဆၧ",
			"7": "<sup>7</sup> အဒိၪအထီၫလဖၪနီၪလီၫ.- ဆၧနၪ့ထၪ့ထဲၩ့နမၩဂ့ၩ ဆၧဖၭဒိၪနီၪမိထၪ့ဖျ့ၭလၧအနိၭး ဒဲအဝ့ၫၥံၪမိၥံၫကျံၩ ထၪ့ထဲၩ့နဆၧတီၩဆၧလီၩ့လီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩယၫ့ၥုၪ့ဆၧယၫ့ၥၭဆၧ, ဒဲၥုၪ့အီၪၥၭအီၪ",
			"9": "<sup>9</sup> ဆၧဒဲၥၭထၪ့ကၪတၭ, အခိးအတၩဒိၪမၬလီၫ.- ယဟိ ဝၩမၩဂ့ၩၦကိၭဂၩဒ့ၭတၭ, အၥၭအီၪကယဲဆၧလၧ",
			"10": "<sup>10</sup> အတဲၩ့လၩ့ဝ့ၫထီးအလူၬလီၫ.- ယဟိဝၩဧ့, နမၩဆၧ ထီးအလူၬလဖၪနီၪ စံၭထၪ့အၪ့အူၭနၧၩ, ဒဲနၡၩဆံၫ့",
			"11": "<sup>11</sup> ဎံၪၥံၪမိဆိၪဂ့ၩနၧၩလီၫ.- အဝ့ၫၥံၪမိချဲၩ့ဆၧလၧနဘၩ့ နမုးအလၩအဖၩ့အဂဲးအကၠီၪ့တၭ, မိလီၩဘၪဆၧလၧ",
			"12": "<sup>12</sup> နစီၩ့နမၩ့အဂဲးအကၠီၪ့နီၪ,- ဘဲၫၥိၭအမိဒုၭၥ့ၪယၫၦ ၡၩအဖိၪၥံၪလၧအမၩဆၧအဒိၪ, ဒဲအဘၩ့အမုးနီၪအ",
			"13": "<sup>13</sup> ကယးအကဖးအီၪလၧအလၩအဖၩ့လီၫ.- တၭနဘၩ့ နမုးနီၪ, မွဲအဘၩ့အမုးအဆိၩအကၠၪ, ဒဲနပၧၩ့ဆၧနီၪ အီၪဝ့ၫအဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"14": "<sup>14</sup> ယဟိဝၩမၩဆၧၩ့ ကယဲၦလၧအလၩ့ထံၩဖါဝ့ၫတၭ, ဘိၭဂဲထုၪ့ကယဲၦလၧအလၩ့ကူၭဝ့ၫလဖၪ ထီးအလူၬ လီၫ.",
			"15": "<sup>15</sup> ကယဲဆၧအမ့ၬၥၪယိလါဆၧလၧနၧၩတၭ, လၧအ ဆၧၫ့အထီဘၪနီၪ, နဖ့ၪလၫ့အဝ့ၫၥံၪအဆၧအၪ့လီၫ.",
			"16": "<sup>16</sup> နပၠၪလၩ့နစူၪတၭ, ကယဲၥၭအဆၧဆိၫ့နီၪနဖ့ၪလၫ့လၧၫ့",
			"17": "<sup>17</sup> ဎွ့ၩလီၫ.- ယဟိဝၩတီၩဝ့ၫလီၩ့ဝ့ၫလၧအဖၧၩ့ၥၭထီး အလူၬအဖၧၩ့တၭ, ဆံၫ့ဎံၪဝ့ၫလၧအမၩဆၧ ထီးအ လူၬအဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> တၭယဟိဝၩအီၪဘူၭ လၧကယဲၦလၧအကိၭထၪ့ ဝ့ၫ,ကယဲၦလၧအကိၭထၪ့ဝ့ၫ လၧဆၧမွဲဆၧတီၩအဖၧၩ့",
			"19": "<sup>19</sup> ကိၭဂၩဒ့ၭလီၫ.- မိမၩဝ့ၫထီးဒၪၦလၧအၥၭမဲၪဝ့ၫလ ဖၪအၥၭတၭ, မိခိၭနၪအအၪ့ယၫဆၧတၭ, မိထိးထဲၩ့",
			"20": "<sup>20</sup> တၩ့ထဲၩ့အဝ့ၫၥံၪလီၫ.- ယဟိဝၩယိထဲၩ့ခွါထဲၩ့ၦလၧ အအဲၪဝ့ၫထီးအလူၬတၭ, မိမၩဂၭဂီၩ့ကယဲၦလတီၩ",
			"21": "<sup>21</sup> လလီၩ့ဘၪလဖၪနီၪလီၫ.- ယနိၭမိချဲၩ့ယဟိဝၩအဆၧ စံၭထၪ့အၪ့အူၭတၭ, ကယဲဆၧဖံၭဆၧယၪထီးအလူၬ နီၪ,မွဲအဆိၪဂ့ၩအမံၩ့ဆံၫ့ဎံၪ အဆိၩဆိၩအကၠၪကၠၪ ဆံၭ."
		},
		"146": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့အူၭယွၩဆံၭး ယၥၭဧ့,စံၭထၪ့",
			"2": "<sup>2</sup> အၪ့အူၭယဟိဝၩဆံၭ.- ယမိစံၭထၪ့အၪ့အူၭယဟိဝၩ လဆိၩဒၪယၧၩ, လၧယအီၪဒံၭအဘိၩ့ဘၭယီၩ ယမိ",
			"3": "<sup>3</sup> ၥံၫကျံၩစံၭထၪ့အၪ့အူၭ ယယွၩလီၫ.- လၧၦဒိၪဖၭဒိၪၥံၪ, ဒဲၦၡၩအဖိၪခွၫလၧဆၧမၩဆၧၩ့လအီၪဘၪလၧအဖၧၩ့ လဖၪနီၪ, ဒိၭနဲၩ့နၥံၪအၥၭလၧအဝ့ၫၥံၪလဂ့ၩ.",
			"4": "<sup>4</sup> အၥၭစဲၪ့ထၪ့ခွံၬတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧအဂၪ့ခိၪတၭ, အဆၧကိၪ့ထၪ့ဖၭလၩ့ဂၭဂီၩ့ လၧမုလနံၩဎးနီၪလီၫ.",
			"5": "<sup>5</sup> ၦလၧစယၫကူၭအယွၩ မွဲအဆၧမၩဆၧၩ့, ၦလၧ အဒိၭနဲၩ့အၥၭ လၧအယွၩယဟိဝၩနီၪ ဘၪဆိၪဂ့ၩဝ့ၫ",
			"6": "<sup>6</sup> လီၫ.- ၦလၧအတဲၩ့လၩ့မူၭခိၪ ဒဲဂၪ့ခိၪ, မၫဆမံၭဒဲက ယဲဆၧအီၪလၧအဖၧၩ့, လၧအယိထဲၩ့ခွါထဲၩ့ဆၧမွဲ",
			"7": "<sup>7</sup> ဆၧတီၩလၩ့ဆိၩလၩ့ကၠၪ,- လၧအစ့ၩရၫ့ၦဘၪဆၧမၩ နၧၩ့မၩစၪဝ့ၫ, လၧအဖ့ၪလၫ့ ဆၧအၪ့ဆၧအီၩ လၧၦ လၧအၥၭဝံအၥၭး ယဟိဝၩမၩဖျ့ၭထၪ့ၦလၧအဘၪ စၧၩ့ထၬဝ့ၫလဖၪလီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩမၩဖၩ့ထၪ့ ၦမ့ၬဘျီၪအမ့ၬၥၪး ယဟိဝၩ ဒုၭဂဲထုၪ့ ၦလၧအလၩ့ကူၭဝ့ၫ, ယဟိဝၩအဲၪၦတီၩၦ",
			"9": "<sup>9</sup> လီၩ့း-ယဟိဝၩယိထဲၩ့ခွါထဲၩ့ၦမွံၩ, မၩဆၧၩ့ၦဖိၪဎွ့ၪ ဒဲၦမုၪမဲၫလီၫ. အ့ၪမွဲၦလတီၩလလီၩ့ဘၪအဖၧၩ့ၥၭ နီၪအဝ့ၫဒၪဘိၭဘျံၭဒၪခွံၬဝ့ၫလီၫ.",
			"10": "<sup>10</sup> ယဟိဝၩကဲၪစဎွၩလၩ့ဆိၩလၩ့ကၠၪး နယွၩဇံအိၫ့ ဧ့,အဆိၩဆိၩအကၠၪကၠၪလီၫ. နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၪဆံၭ."
		},
		"147": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့အူၭယွၩဆံၭ.အဂဲးဘဲၫယီၩ ၥံၫကျံၩစံၭထၪ့အၪ့အူၭပယွၩနီၪ, မွဲဆၧအဂ့ၩ အဂဲး ဘဲၫယီၩမွဲဆၧအမုၬ, ဆၧစံၭထၪ့အၪ့အူၭနီၪ, မွဲအဂ့ၩ အဘၪလီၫ.",
			"2": "<sup>2</sup> ယဟိဝၩမၩကဲၪထၪ့ထဲၩ့ဒိၩ့ယရုစလံၫ့, ဒုၭအီၪကိၩ့ အီၪကီၪ့အံၫစရ့လၭအၡၩ လၧအဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫ",
			"3": "<sup>3</sup> လီၫ.- မၩဘျၪထဲၩ့ၦအၥုၪ့ခါအၥၭလၩ့တၭ, ဘီၪ့ထၪ့",
			"4": "<sup>4</sup> အဖၧၩ့လးၥံၪလီၫ.- အဝ့ၫဒၪဝံထၪ့နၬထၪ့ၡၪၥံၪအဆၧ",
			"5": "<sup>5</sup> ဝံဆၧနၬတၭ, ကိၭဝ့ၫအမံၩ့ထီးအလူၬလီၫ.- ပကဆါ နီၪမွဲအဒိၪတၭ, အစီၩ့အမၩ့ဒိၪမၬလီၫ. တၭအၥုၪ့ဖၭ",
			"6": "<sup>6</sup> အၥၭဖၭနီၪၦဝံထၪ့နၬထၪ့ၥ့ၪအ့ၬ.- ၦလၧအဆၪ့လၩ့ အၥၭလဖၪနီၪယဟိဝၩဘိၭထၪ့ဝ့ၫ အ့ၪမွဲၦလတီၩလ လီၩ့ဘၪနီၪမၩလၩ့ထံၩဖါဝ့ၫထီၩ့လၧဂၪ့ခိၪလီၫ.",
			"7": "<sup>7</sup> တၭစံၭဆၧၫ့ယဟိဝၩ အီၪလၧဆၧစံၭထၪ့အၪ့အူၭ ဆံၭ.ၥံၫကျံၩစံၭထၪ့အၪ့အူၭပယွၩ လၧနါဒံၩ့ဆံၭ.",
			"8": "<sup>8</sup> အဝ့ၫနီၪလုၬဘံၭမူၭဖိၭဖၫ့ လၧဆၧအုၪ့တၭ,တဲၩ့ဝဲၩ",
			"9": "<sup>9</sup> ဆၧဆၧၩ့လၧဂၪ့ခိၪအဂးတၭး- ဒုၭမဲၪထၪ့နၪ့ၥံၪမံၩ့ ၥံၪလၧခိၪလီၩ့အလီၩ့လီၫ. ဖ့ၪလၫ့ဆၧအၪ့ဆၧအီၩ လၧဆၧဖိၪဆၧဎါ, ဒဲလၧကျၭဖိၪလၧအကိၭထၪ့ဆၧ",
			"10": "<sup>10</sup> လီၫ.- လဘၪဘၪအၥၭလၧကၥ့ၪအဂဲးအဘၭနီၪ, အဲၪ",
			"11": "<sup>11</sup> ဒိၭၦၡၩအခၪ့ဆ့အ့ၬ.- ယဟိဝၩမုၬလၩအၥၭလၧၦ လၧအၥၭမဲၪအဝ့ၫ, ၦလၧအယိလါအခိးအတၩအ ဖၧၩ့ၥၭလီၫ.",
			"12": "<sup>12</sup> ယရုစလံၫ့ဧ့, ၥံၫကျံၩထၪ့ယဟိဝၩဆံၭ. ဇံအိၫ့ဧ့,",
			"13": "<sup>13</sup> စံၭထၪ့အၪ့အူၭနယွၩဆံၭ.- အဂဲးဘဲၫယီၩ မွဲအမၩဆီၪ့ ယူၭနတရၫ့အနိၪဘီၩ့လဖၪတၭ, ဆိၪဂ့ၩယူၭနဖိၪန",
			"14": "<sup>14</sup> လံၩအီၪလၧနဖၧၩ့လီၫ.- အဝ့ၫဒၪအီၪက့ၪလၩ့ဆၧဘၪ လိၬအိၭလိၬလၧနခးအနဲၩ့ထံၭ, ဒုၭဘျဲၩအၪ့နၧၩလၧ",
			"15": "<sup>15</sup> ဘုၪကၠိၩ့အဂ့ၩလီၫ.- ဖ့ၪယုအဆၧမၪလူၬလ့ၩဆၧလၧ",
			"16": "<sup>16</sup> ဂၪ့ခိၪချိၫ့, အဆၧချဲၩ့စဲၪ့တလဲးဝ့ၫချဲၫ့မၬလီၫ.- ဖ့ၪလၫ့ မူၭခိၪဖီၫဘဲၫၥိၪဆီၪ့အၥိၭ, ဎွံၪပၩဆၩ့ထံၫလၩ့ဒၭဘဲၫ",
			"17": "<sup>17</sup> ဖံၫ့ချၪအၥိၭနီၪလီၫ.- ခွံၬလၩ့ခွံၬအထံၫလိးဘဲၫဆၧလ ကုၭလကုၭအၥိၭတၭ, မွဲပလၫဆၧၫ့ထုၪ့လၧအဆၧဂီး",
			"18": "<sup>18</sup> အမ့ၬယၫမိၥ့ၪလဂၩလဲၪ.- အဝ့ၫဒၪဖျါလၩ့အလူတၭ မၩဖံထၪ့အဝ့ၫၥံၪ, ဒုၭအူၪအလံၩတၭ, ထံၫၥံၪယွၩ",
			"19": "<sup>19</sup> လၩ့ဝ့ၫလီၫ.- အဝ့ၫဒၪဒုၭနဲၪအလူလၧစယၫကူၭ, အ ဆၧမၪလူၬၥံၪ, ဒဲအဆၧစ့ၩရၫ့ၥံၪ လၧအံၫစရ့လၭနီၪ လီၫ.",
			"20": "<sup>20</sup> အဝ့ၫဒၪမၩဆၧဘဲၫနီၪၥိၭ လၧၦအဆၨၩၥံၪနးဆၨၩ အ့ၬ.တၭအဆၧစ့ၩရၫ့လဖၪနီၪ အဝ့ၫၥံၪၥ့ၪယၫဝ့ၫအ့ၬ. နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့အူၭယွၩဆံၭ."
		},
		"148": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့အူၭယွၩဆံၭ. ဆၧအီၪလၧမူၭ ခိၪၥံၪဧ့, စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ. ဆၧအီၪလၧ",
			"2": "<sup>2</sup> ဆၧထၪ့ထီၫၥံၪဧ့, စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪဆံၭ.- အၥီၫ့ ထီးအလူၬၥံၪဧ့, စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪဆံၭ. အၥုၭ မုခမျၧးထီးအလူၬၥံၪဧ့, စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪဆံၭ.",
			"3": "<sup>3</sup> မုဒဲလၩၥံၪဧ့, စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪဆံၭ. ဆၧဖၩ့အ",
			"4": "<sup>4</sup> ၡၪထီးအလူၬၥံၪဧ့, စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪဆံၭ.- မူၭ ခိၪအထီၫထုၬ, ဒဲထံၫၥံၪလၧမူၭခိၪအဖၫ့ခိၪဧ့, စံၭထၪ့",
			"5": "<sup>5</sup> အၪ့အူၭအဝ့ၫဒၪဆံၭ.- မွဲအဝ့ၫၥံၪစံၭထၪ့အၪ့အူၭယ ဟိဝၩအမံၩ့ဆံၭး အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမၪလူၬဆၧ",
			"6": "<sup>6</sup> တၭ,အဝ့ၫၥံၪကဲၪထၪ့ဝ့ၫလီၫ.- တၭအဝ့ၫဒၪမၩဂုးမၩ ခၧၫ့အဝ့ၫၥံၪ လၩ့ဆိၩလၩ့ကၠၪး အီၪက့ၪလၩ့အဆၧၫ့ လၧအမိခၫ့ဖၬဘၪအ့ၬ.",
			"7": "<sup>7</sup> မွဲအစံၭထၪ့အၪ့အူၭယဟိဝၩ လၧဂၪ့ခိၪဆံၭး မၫဆ",
			"8": "<sup>8</sup> မံၭအၡီၩ့ၥံၪ, ဒဲကယဲထံၫယိၬဖၧၩ့,- မ့ၪဒဲမုၥၪ, မူၭခိၪ ဖီၫ,ဒဲဆၩ့ခူၪ, လံၩမုလၧအမၩထီးဒၪအဆၧမၪလူၬး",
			"9": "<sup>9</sup> ခိၪလီၩ့ထိၩ့ချိၬ, ဒဲကယဲဆၧစီၩ့ခိၪး ၥံၪ့လၧအၥၪထၪ့း ဒဲ",
			"10": "<sup>10</sup> ကယဲၥံၪ့ၡိၫအ့ရ့ၭ,- ဆၧဖိၪဆၧဎါအမံၩ့, ဒဲဆၧဖိၪဆၧ ဎါအဒိၩ့, ဆၧလၧအစွၩၥံၪ, ဒဲထိၪၥံၪလၧအယူၩဝ့ၫ,",
			"11": "<sup>11</sup> ဂၪ့ခိၪအစဎွၩၥံၪ, ဒဲၦဆၨၩထီးအလူၬၥံၪ, ၦဒိၪဖၭဒိၪ,",
			"12": "<sup>12</sup> ဒဲဂၪ့ခိၪအၡၩစ့ၩရၫ့ခွးထီးအလူၬ,- ၦဖိၪၥၪခွၫၥံၪဒဲၦ",
			"13": "<sup>13</sup> မုၪနၩ့ၥံၪ,ၦၥၭၡါၥံၪ, ဒဲၦဖိၪၥၪၥံၪ,- မွဲအစံၭထၪ့အၪ့ အူၭယဟိဝၩအမံၩ့ဆံၭ. အဂဲးဘဲၫယီၩ ဆၧအီၪက့ၪ ထၪ့ထီၫဝ့ၫအမံၩ့, န့ၫအဝ့ၫဒၪအမံၩ့အၥၪတၭး အလၩ အဖၩ့အီၪဝ့ၫလၧမူၭခိၪ ဒဲဂၪ့ခိၪအဖၫ့ခိၪလီၫ.",
			"14": "<sup>14</sup> တၭမွဲအအီၪက့ၪထၪ့အၡၩခမျၧးအနိၩ့ လၧဆၧထၪ့ ထီၫ, အၡၩဆံၫ့ဎံၪၥံၪ ထီးအလူၬ အဆၧစံၭထၪ့အၪ့ အူၭးၦအံၫစရ့လၭဖိၪ, ၦလဆၨၩအီၪဘူၭလၧအဝ့ၫ နီၪလီၫ. နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့အူၭယွၩဆံၭ."
		},
		"149": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၩဆံၭ. ၥံၫကျံၩထၪ့ယ ဟိဝၩလၧထၭခိၪအၥၫ့, ဒဲအဆၧစံၭထၪ့အၪ့အူၭလၧ",
			"2": "<sup>2</sup> အၡၩဆံၫ့ဎံၪအဆၧအီၪကီၪ့အကျၩနီၪဆံၭ.- မွဲအံၫစ ရ့လၭၥၭထိၬ လၧၦတဲၩ့လၩ့အဝ့ၫအဖၧၩ့ဆံၭ. မွဲၦဇံ အိၫ့အဖိၪၥံၪအၥုၪ့ဎွံၫၥၭယီၫ လၧအစဎွၩအဖၧၩ့ဆံၭ.",
			"3": "<sup>3</sup> မွဲအစံၭထၪ့အၪ့အူၭအမံၩ့ လၧဆၧဂဲထုၪ့လံအဖၧၩ့ ဆံၭ.မွဲအၥံၫကျံၩစံၭထၪ့အၪ့အူၭအဝ့ၫနီၪ လၧဒိၩ့ဒဲ",
			"4": "<sup>4</sup> နါဒံၩ့ဆံၭ.- အဂဲးဘဲၫယီၩယဟိဝၩမုၬလၩအၥၭ လၧ အၡၩခမျၧးတၭး အဝ့ၫဒၪမိမၩဎံၫမၩလၩ ၦအၥုၪ့ ဆၧၩ့အၥၭဆၧၩ့ လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့လီၫ.",
			"5": "<sup>5</sup> မွဲၦဆံၫ့ဎံၪၥံၪၥုၪ့ထိၬၥၭထိၬ လၧဆၧလၩဖၩ့အကျၩ ဆံၭ. မွဲအဝ့ၫၥံၪၥံၫကျံၩထၪ့ ဆၧလၧအလးမံၫခိၪနီၪ",
			"6": "<sup>6</sup> ဆံၭ.- မွဲယွၩအဆၧစံၭထၪ့အၪ့အူၭ အီၪလၧအနိၭဖၧၩ့ တၭ, အနၭလၧအအဲၪ့နံၫခီၫလူၬ အီၪလၧအဝ့ၫၥံၪအ",
			"7": "<sup>7</sup> စူၪဖၧၩ့ဆံၭ.- ဘဲၫၥိၭအမိဖ့ၪဆၧၫ့ထဲၩ့ဆၧအၧၩ့လၧၦ",
			"8": "<sup>8</sup> ဆၨၩၥံၪ,ဒဲဖ့ၪလၫ့ဆၧၡၪ့ဆၧနၭ လၧၦခမျၧး,- ဘဲၫၥိၭ အမိစၧၩ့ထၬအစဎွၩလၧၥွ့ၫထၭ, ဒဲအၦဒိၪဖၭဒိၪလၧ",
			"9": "<sup>9</sup> ဖျံၩထၭ,- ဘဲၫၥိၭအမိမၩဆၧစ့ၩရၫ့ကွ့ၭအၥၭလၧအ ဂးလီၫ. အခိးမွဲဆၧလၩဖၩ့ လၧအၡၩဆံၫ့ဎံၪထီးအ လူၬအဂးလီၫ. နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၩဆံၭ."
		},
		"150": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဧ့,စံၭထၪ့အၪ့အူၭယွၩဆံၭ. စံၭထၪ့အၪ့အူၭယွၩ လၧအလးဆံၫ့ဎံၪအဖၧၩ့ဆံၭ. စံၭထၪ့အၪ့အူၭယွၩ လၧအစီၩ့အမၩ့ အမူၭဖိၭဖၫ့အ ဖၧၩ့ဆံၭ.",
			"2": "<sup>2</sup> စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪ လၧအမၩဆၧအဒိၪအဆီၪ့ အကၠီၩ့နီၪဆံၭ. စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪ ဘဲၫအဒိၪအထီၫ အအၪအဂီ အၥိၭနီၪဆံၭ.",
			"3": "<sup>3</sup> စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪလၧခွ့ၩအၥီၫဆံၭ. စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪလၧၥၫ့ထီးဒဲနါဒံၩ့ဆံၭ.",
			"4": "<sup>4</sup> စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪလၧဒိၩ့, ဒဲဆၧဂဲထုၪ့လံဆံၭ. စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪလၧဆၧဒံၩ့ၥံၪဒဲပံၩၥံၪဆံၭ.",
			"5": "<sup>5</sup> စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪလၧစံၩ့စံၩ့ လၧအၥီၫထၪ့ဖၭ ဒိၪဆံၭ. စံၭထၪ့အၪ့အူၭအဝ့ၫဒၪ လၧစံၩ့စံၩ့ လၧအၥီၫထၪ့မုၬ ဆံၭ.",
			"6": "<sup>6</sup> ကယဲဆၧလၧအၥၪလမံၩ့လါလါနီၪ, မွဲအစံၭထၪ့အၪ့ အူၭယွၩဆံၭ. နၥံၪဝ့ၫဧ့, စံၭထၪ့အၪ့အူၭယွၩဆံၭ."
		}
	}
};
module.exports = book;